INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(1, '10-Yard Fight', '10-Yard Fight', NULL, 'You\'re the quarterback in this amazingly real football game! Enjoy realistic gridiron action as you move your team up and down the field to victory! Run, pass, kick, punt... you call the plays in this true-to-life football game. Play against the computer or against a friend for hours of real football action. The sights, the sounds and the plays are so real you\'ll think you\'re right on the fifty yard line!', '/images/nes/1/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2f/10YardFight_arcadeflyer.png', 1, 1.5),
(2, '1942', '1942', NULL, '1942... you and daring fighter pilot "Super Ace" are engaged in realistic, thrilling and challenging high-flying battles with the enemy. Over land, on the sea and in the air, your own skill and dexterity... combined with Super Ace\'s flying mastery, duel enemy pilots in fighter and bomber craft. 1942... it\'s airplanes taking off and landing on ocean-going aircraft carriers... disrupting enemy formations ready to attack... intercepting enemy air-warriors you must defeat by "blasting \'em out of the sky." Will it be victory? Or defeat? It\'s in your skillful hands!', '/images/nes/2/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/52/1942_arcade_flyer.png', 2, 3.5),
(3, '1943: The Battle of Midway', '1943: The Battle of Valhalla', NULL, 'The most crucial and decisive battle of World War II is about to be fought... by you! Enemy forces are descending upon Midway Island. Enemy bombers, dive bombers, and zeroes are roaring over the island like a typhoon. The surrounding Pacific waters are teeming with enemy aircraft carriers. As the top gun of the Navy\'s most elite crew of fighter pilots, you must pilot your specially-outfitted P-38 into the very midst of the enemy squadron. Equipped with an array of secret weapons, only you can turn the tide against the formidable enemy fleet. The outcome of history\'s most fateful air/sea battle rests in your hands! Can you avenge Pearl Harbor?', '/images/nes/3/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7c/1943_The_Battle_of_Midway_flyer.png', 3, NULL),
(4, 'The 3-D Battles of WorldRunner', NULL, NULL, 'The battle of a lifetime comes alive in 3-D! The wildest of the space cowboys is out looking for adventure. Now he\'s got it and he needs your help. A strange world terrorized by Grax, the Alien Serpentbeast, has asked you, Worldrunner, for help. Knowing you can outrun, outjump and outblast anyone or anything, you race into battle. But this is no ordinary fight. These battles will carry you to eight strange planets filled with bottomless pits, shooting stars, and poisonous aliens, all sworn to defend their Serpent King. And each new world is ruled by an Alien Serpentbeast more terrifying and more powerful than anything you\'ve ever seen before. Are you ready, Worldrunner? They\'re waiting for you!', '/images/nes/4/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/6a/NES3dworldrunnerbox_mod.png', NULL, NULL),
(5, '720°', NULL, NULL, 'Hop on and hang ten as you crash around corners, swerve on sidewalks, and leap over the locals at Skate City, a skateboarder\'s fantasy world where virtually every surface is skateable. Flip and twist around the street fighters, Frisbee throwers, hard bodies and killer bees that jam city streets. Polish your skills and take your act to the skate parks where you\'ll vie for medals and cash in downhill, jump, ramp, and slalom competition. Shoot the tubes, "catch air" as you fly off ramps - master all of the moves including the dangerous 720. You\'ll need every edge as you try to become champion of the skating world!', '/images/nes/5/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/24/720-arcadegame.jpg', NULL, NULL),
(6, '8 Eyes', NULL, NULL, 'After hundreds of years of chaos, mankind has finally emerged from the ruins of nuclear war. This world of the distant future has once again flourished under the guidance of the Great King, who harnessed the power of the 8 Eyes to rebuild the planet. These strange jewels of power were formed at the eyes, or center, of the eight nuclear explosions  which nearly destroyed the Earth. In the wrong hands, the 8 Eyes could cause untold destruction... And now, they have been seized by the Great King\'s eight Dukes, in a desperate bid to gain control of the world for themselves. They have banished the King to the nuclear wastelands, and already their squabbling threatens to plunge the world into war once again! The task of retrieving the 8 Eyes falls to you, Orin the Falconer, the bravest and mightiest of the King\'s Guardsmen. With your fighting falcon, Cutrus, you must penetrate each of the 8 Dukes\' castles. There you will face the Dukes\' soldiers, and battle strange nuclear mutants such as living skeletons, giant wasps, and mud men. You must defeat the monstrous Boss of each castle to retrieve the Jewel of Power he guards. Then, to complete your quest, return the 8 Eyes to the Altar of Peace to await the return of the Great King, so that he may finish the rebuilding of Earth. Your reward will be the eternal gratitude of all mankind!', '/images/nes/6/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/71/8_eyes_front.jpg', 2.5, NULL),
(7, 'Abadox', 'Abadox', NULL, 'Your home planet of Abadox has been swallowed whole by the deadliest menace in space! Its name: Parasitis. Its prey: All surrounding life forms. Its goal: To feed on the entire Universe!', '/images/nes/7/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/70/Abadox_box_art.jpg', NULL, NULL),
(8, 'The Addams Family', NULL, NULL, 'Great Scott, man! The fiendish Abigail Craven has brainwashed Uncle Fester and imprisoned Pugsley, Wednesday and Granny somewhere in the Addams Family Mansion! The house is amaze of scary rooms with bizarre ghouls around every blood-curdling bend -- ah, home sweet home! It\'s up to the sword fighting, golf ball-hurling, Fezi-copter flying Gomez to rescue his family... or they\'ll face a fate worse than life! So, get ready for the kookiest, ookiest, creepiest, fun ever!', '/images/nes/8/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a2/Addams_Family_video_game_box_art.jpg', 2, 3),
(9, 'The Addams Family: Pugsley\'s Scavenger Hunt', NULL, NULL, 'Darling little Pugsley has lost his family to kidnappers who have hidden them as prisoners in their own spooky home. Only lovable little Pugsley can rescue them by hunting for delightfully strange items located in secret spots in their weird mansion. What oddities and atrocities await him! There are twisted creatures and complex features at every turn of the task.', '/images/nes/9/cover.jpg', 'https://m.media-amazon.com/images/M/MV5BZWM2MGVhMGMtODBlMS00NjBhLWE4ZTctZjdhYzEwMWJhMmE0XkEyXkFqcGdeQXVyNjExODE1MDc@._V1_SY1000_CR0,0,732,1000_AL_.jpg', 1.5, 3),
(10, 'Advanced Dungeons & Dragons: DragonStrike', NULL, NULL, 'Wicked dragonarmies threaten the good people of Ansalon. There\'s only one defense... fight dragons with dragons! Command your winged warrior to fly off and challenge enemy beasts in a tooth-and-claw battle high above Krynn. It\'s awesome airborne fantasy action in the AD&D game tradition!\nEngage in exciting dragon-to-dragon combat. Control breathtaking on-screen airborne battles. Choose from three types of dragons: Bronze, Silver and Gold. Attack with potent breath weapons like paralyzing gas, lightning and fireballs. Fly at your choice of two altitudes. Play alone or against an opponent!', '/images/nes/10/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8b/Community_S02E14_-_Advanced_Dungeons_%26_Dragons.jpg', NULL, NULL),
(11, 'Advanced Dungeons & Dragons: Heroes of the Lance', NULL, NULL, 'At last! You can play the first Official ADVANCED DUNGEONS & DRAGONS action game made for the Nintendo Entertainment System! HEROES OF THE LANCE is based on the Dragons of Despair DRAGONLANCE module, placing you in control of eight fantasy characters. Guide your brave companions through their adventures as they encounter dragons and dwarves... magic and monsters, in their quest for the precious Disks of Mishakal. The fate of the world of Krynn is in your hands! Vanquish the ancient black dragon Khisanth or you are doomed to failure!\nAction-packed animated graphics. Eight characters, each with different attributes and skills. Fight giant spiders, Gully Dwarves, dragons and monstrous Draconians. Defend yourself with magic and an arsenal of weapons!', '/images/nes/11/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Advanced_Dungeons_%26_Dragons_Heroes_of_the_Lance_Cover.png', NULL, 4.5),
(12, 'Advanced Dungeons & Dragons: Hillsfar', NULL, NULL, 'Direct your charger into the walled city of Hillsfar for fast battle action and challenging fantasy adventure! Hillsfar has been invaded by Maalthir, the self-proclaimed First Lord, who rules the region with his powerful magic and his ruthless guards, the Red Plumes. In the AD&D game tradition, you must make many choices in the roles you play. Each profession has its own missions. Intelligence must guide your characters with dexterity and charm to battle minotaurs, orcs and armed guards; test your skills in the gladiators\' colliseum or archery range.\nBased on an internationally-known PC game. Exciting on-screen action in the AD&D game tradition. Players create and name human and non-human characters with choice of gender, race and skills!\n', '/images/nes/12/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8b/Community_S02E14_-_Advanced_Dungeons_%26_Dragons.jpg', NULL, NULL),
(13, 'Advanced Dungeons & Dragons: Pool of Radiance', NULL, NULL, 'Pool of Radiance is a role-playing video game developed and published by Strategic Simulations, Inc (SSI) in 1988. It was the first adaptation of TSR\'s Advanced Dungeons & Dragons (AD&D) fantasy role-playing game for home computers, becoming the first episode in a four-part series of D&D computer adventure games. The other games in the "Gold Box" series used the game engine pioneered in Pool of Radiance, as did later D&D titles such as the Neverwinter Nights online game. Pool of Radiance takes place in the Forgotten Realms fantasy setting, with the action centered in and around the port city of Phlan.\n\nJust as in traditional D&D games, the player starts by building a party of up to six characters, deciding the race, sex, class and ability scores for each. The player\'s party is enlisted to help the settled part of the city by clearing out the marauding inhabitants that have taken over the surroundings. The characters move on from one area to another, battling bands of enemies as they go and ultimately confronting the powerful leader of the evil forces. During play the player characters gain experience points, which allow them to increase their capabilities. The game primarily uses a first-person perspective, with the screen divided into sections to display pertinent textual information. During combat sequences, the display switches to a top-down "video game isometric" view.', '/images/nes/13/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/4c/Pool_of_Radiance_Coverart.png', NULL, NULL),
(14, 'Adventure Island', 'Takahashi Meijin no Boken Jima', NULL, 'You just found out that Princess Leilani was kidnapped by the Evil Witch Doctor and taken to Adventure Island in the South Pacific.', '/images/nes/14/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3c/Adventureisland.jpg', 2, 2.5),
(15, 'Adventure Island II ', NULL, NULL, 'Soar into action with Adventure Island II. That Evil Witch Doctor\'s just snatched your favorite lady. And you\'ve got to battle your way past EIGHT treacherous islands to get her back.', '/images/nes/15/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2c/Adventure_Island_2_box_art.jpg', NULL, NULL),
(16, 'Adventure Island 3', NULL, NULL, 'Jeannie Jungle Kidnapped by Space Aliens!\n\nWhats a hero to do? A mysterious flying saucer just made off with Master Higgins girlfriend and its up to him to save her! But first he must defeat scores of mutated monsters across eight uncharted islands! Fly a dive-bombing pterodactyl or ride under the waves on a sea serpent in search of the missing Jeannie Jungle!\n\nBattle your way through all new dangers and challenges on the biggest Adventure Island yet! Find secret treasure chambers, surf through killer waves and grab all the bonus items you can handle as you master each realm! Action, adventure and more await you in this thrilling addition to the Adventure Island saga!\n\n-A new dinosaur friend joins Master Higgins team of wild reptiles!\n-Collect Power Crystals to gain temporary in vulnerability!\n-Hours of entertainment for the whole family to enjoy!', '/images/nes/16/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cf/Adventure_Island_3_Boxart.jpg', NULL, NULL),
(17, 'Adventures in the Magic Kingdom', NULL, NULL, 'This is your ticket to breath-taking Adventures in the Magic Kingdom! Join the exciting adventure as you search through the Magic Kingdom for the six silver keys that will unlock the Enchanted Castle. Use all your skills and resources to achieve your goal.', '/images/nes/17/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/ce/Adventures_in_the_Magic_Kingdom.png', 1, 1.5),
(18, 'The Adventures of Bayou Billy', 'Mad City', NULL, 'You\'re a ragin\' Cajun on the tail of a swamp rat. For the first time ever, three of the most awesome action video experiences explode into one mean swamp stompin\' adventure.', '/images/nes/18/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/23/Bayou_Billy_box.jpg', NULL, NULL),
(19, 'Adventures of Dino Riki', NULL, NULL, 'In prehistoric times, where ancient dinosaur creatures ruled, the adventures of Dino-Riki began. A courageous and intelligent young man, Dino-Riki, is determined to establish mankind\'s future in this violent age. Dino-Riki must explore and fight his way through deserts filled with quicksand, sinking lotus swamps, dark caverns and deep canyons.', '/images/nes/19/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ea/AdventuresofDinoRiki.jpg', 1.5, NULL),
(20, 'The Adventures of Gilligan\'s Island', NULL, NULL, '"Okay little buddy, you just stay right behind your old pal the Skipper and everything\'s gonna be just fine. All we have to do is follow these clues and find the magic stone tablet and we can get off this forsaken island once and for all. So Gilligan, please try not to mess things up just this one time. Stay away from the quicksand and don\'t go wandering off into any dark caves. Can you promise me that, little buddy? Little buddy? Now where has he gone to? Gilligan, get out of that tree and stop messing around!! OK, just walk right in my footsteps and don\'t cause any more trouble or we could be stuck doing reruns forever! OK, little buddy? Gilligan? Gilligan!!"', '/images/nes/20/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/92/GilligansIslandNESBoxArt.jpg', NULL, NULL),
(21, 'Adventures of Lolo', NULL, NULL, 'Prince Lolo of Gentryland visited Eden, a country of love and peace, and enjoyed many pleasant days with Princess Lala of Eden. But one day, Egger, the King of Darkness, who had an evil plot to conquer Eden, spirited the Princess away before Lolo\'s eyes.', '/images/nes/21/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9b/BoxArtLolo1%28US%29.jpg', 4, 7),
(22, 'Adventures of Lolo 2', NULL, NULL, 'Our hero Lolo has charmed and enchanted puzzle-loving game players around the world with his unfailing courage and plucky persistence - and now he\'s off for his second quest!', '/images/nes/22/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9e/Adventures_of_Lolo_2_Cover.png', 4, NULL),
(23, 'Adventures of Lolo 3', NULL, NULL, 'The journey continues! The game preferred by the best and the brightest is back with a brand new installment. See if you qualify!', '/images/nes/23/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c7/BoxArtLolo3%28US%29.jpg', 12.5, NULL),
(24, 'The Adventures of Rad Gravity', NULL, NULL, 'Take a radical trek through interstellar space...Mix it up with weird aliens...And save the galaxy from the evil Agathos. Get upside down...in the greatest space adventure ever!', '/images/nes/24/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/4/49/Radbox3.jpg/220px-Radbox3.jpg', 10, NULL),
(25, 'The Adventures of Rocky and Bullwinkle and Friends', NULL, NULL, 'Moose on the Loose or Squirrely Heroes! An all-new episode in Bullwinkle\'s life when he finds out he\'s the Lost Earl of Moosechester!', '/images/nes/25/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/17/Adventures_of_Rocky_and_Bullwinkle_NES_box_art.jpg', NULL, NULL),
(26, 'The Adventures of Tom Sawyer', 'Tom Sawyer no Bouken', NULL, 'Join Tom on a journey of action-packed adventure! Raft down a raging river, conquer the monkeys of the Dark Forest, break the spell of the terrible Haunted Mansion. And just when you think you\'re safe, you better be ready for Mystery Cave - the toughest test! Tom needs your help to defeat his super-powerful enemies and advance to new worlds of adventure!', '/images/nes/26/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/c/cf/NES_Adventures_of_Tom_Sawyer_Box.JPG', 1, NULL),
(27, 'Air Fortress', NULL, NULL, 'A mysterious and powerful AIR FORTRESS is threatening the planet Farmel. The destiny of Farmel rests in the abilities of one specially trained person code number 82592 - HAL BAILMAN. His mission: Save Farmel from the Air Fortress!', '/images/nes/27/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2e/Air_Fortress_Cover.png', NULL, NULL),
(28, 'Airwolf', NULL, NULL, 'Deep within enemy territory, your fellow countrymen are imprisoned. Only one man in the free world would dare attempt to save them. You, Stringfellow Hawke, commander of Airwolf. And yet, as you strap yourself into the cockpit of your supersonic jet copter, you know this is the most dangerous assignment you have ever flown.', '/images/nes/28/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/02/NesAirwolf.jpg', NULL, 3.5),
(29, 'Al Unser Jr.\'s Turbo Racing ', 'World Grand-Prix - Pole To Finish', NULL, 'Get ready for racing action like you\'ve never experienced it. Because Al Unser Jr.\'s Turbo Racing is so much more than just a game you drive. It\'s a game you design, a game where everything - from the pit crew to the power boost, from the suspension to the speed, right down to the color of the racing machine itself - is in your control.', '/images/nes/29/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c4/Al_Unser_Jr.%27s_Turbo_Racing_Coverart.png', NULL, NULL),
(30, 'Alfred Chicken', NULL, NULL, 'Super-Hero with a Bionic Beak! Whoa... Alfred needs your help! The Evil Meka-Chickens have raided the hen house and stolen Alfred\'s chick, Floella, and all the little egg-a-roonies! Now, these turkeys say they\'ll scramble the eggs. It\'s nothing to crow about! An egg-xasperated Alfred Chicken struts off to pluck his loved ones from the dangers of the Meka-Chickens\' world. Remember, while Alfred is a super-hero wannabe, he\'s still a ruffled-feather chicken... you gotta help! Egg-splore way out worlds and warp space. Fight fowl feasting fiends. Find fine feathered friends. Make Meka-Chickens mincemeat. After you play this game, who you think is "Chicken" will never be the same!', '/images/nes/30/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b9/Alfred_Chicken_cover.jpg', 2.5, 3),
(31, 'Alien3', NULL, NULL, 'The ALIENS are fast, spit acid and are right behind you! The motion tracker is your only warning. No time to think, no time to catch your breath... RUN!\nCan\'t see very far ahead in these air ducts. Hard to breathe. Face-huggers can be anywhere. You have the firepower... blast the ALIENS with your machine gun, flame thrower and grenade launcher. You know what you have to do... rescue the trapped prisoners and end this nightmare!\nJust keep telling yourself, "This isn\'t really happening. It\'s only a game!!!"', '/images/nes/31/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4b/Alien3_game_cover_art.jpg', NULL, NULL),
(32, 'All-Pro Basketball', 'Zenbei!! Pro Basketball', NULL, 'The crowd is roaring and the pressure is on...', '/images/nes/32/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/09/All-Pro_Basketball_Cover.png', NULL, NULL),
(33, 'Alpha Mission', 'ASO: Armored Scrum Object', NULL, 'Defend your home planet against the Seven Stars Alliance!', '/images/nes/33/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e1/Alpha_Mission_arcade_flyer.png', 1, NULL),
(34, 'Amagon', 'Totsuzen! Macho Man', NULL, 'Amagon, the most decorated Marine, was assigned a mission by his commander to investigate a strange, monster-infested South Pacific island, from which no man has ever returned alive. With a machine gun as his only weapon, he took off by plane and crash-landed on the island\'s beachhead.', '/images/nes/34/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c7/Amagon_Cover.png', NULL, NULL),
(35, 'American Gladiators', NULL, NULL, 'Welcome to the Wild World of Sports. Fight or flight? The American Gladiators are ready to square off, and frankly they don\'t believe you\'re up to the challenge. But it\'s up to you to prove them wrong. Nitro, Blaze, Laser, Zap, Gold, Gemini and Lace are all ready and waiting to psyche you out of your game.', '/images/nes/35/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/24/American_Gladiators_Coverart.png', 1.5, 3),
(36, 'Anticipation', NULL, NULL, 'Bored with board games? Tired of pursuing trivia? Had your fill of ethical questions? Then you\'re ready for ANTICIPATION. This zany, unpredictable, totally wacked-out video board game begins with a giant connect-the-dots puzzle. Suddenly, a video pencil starts connecting the dots and, before you know it, you\'re in a maddening race against the clock, trying to solve the puzzle. Is it an Igloo? A Penguin? Whatever it is, you - and all your friends - will have a great time trying to guess what the pencil is drawing. Guess right and you\'ll get a crack at the really tough puzzles - no dots or clues, just the pencil drawing a picture. Think you\'re up to it? Then challenge your friends. Or take on the computer. Either way, this off-the-floor board game will challenge you, excite you and generally drive you crazy for years to come.', '/images/nes/36/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/85/Anticipation_nes.jpg', 1, NULL),
(37, 'Arch Rivals', NULL, NULL, 'The real arcade action between the Arch Rivals is really hot, \'cause tonight there\'s no fouls! WHAT?! NO FOULS? That\'s right. No Fouls. This is basketball where breaking the rules is part of the rules! If you can\'t block a shot - knock your opponent\'s block off. Arch Rivals also takes real skills like passing, shooting, dribbling, ball handling, slam dunks, and 3 point shots. It\'s not just basketball... it\'s basketBRAWL!', '/images/nes/37/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0d/Archrival_box.jpg', NULL, NULL),
(38, 'Archon', NULL, NULL, 'A chess board is lined with trolls, wizards, knights and other magical beings. Just another strategy game? Don\'t count on it. When you challenge a square held by the enemy, the board explodes into a battlefield. Your strategic skills on the game board will determine your fate in battle as you take on your opponent in a heartpounding duel to the death.', '/images/nes/38/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/4/48894_thumb.jpg', NULL, NULL),
(39, 'Arkanoid', NULL, NULL, 'It\'s a real block-buster!', '/images/nes/39/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a9/Arkanoid_arcadeflyer.png', 2, NULL),
(40, 'Arkista\'s Ring', NULL, NULL, 'The Evil Shogun has stolen the ring of Arkista, plunging the Elven Kingdom into darkness and despair. Only one elf, Christine, is brave enough to take up the treacherous challenge to recover the stolen treasure. She must fight, through towns, graveyards, and mazes crawling with hordes of monsters. Yet, with your help, can she make it to the infamous Ninja Dungeon?', '/images/nes/40/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/47/NES_Arkistas_Ring.jpg', 1, 3),
(41, 'Asterix', NULL, NULL, 'Asterix is an Action game, developed by Sourcery and published by Infogrames,  which was released in Europe in 1999.', '/images/nes/41/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fb/Asterix_NES.jpg', NULL, NULL),
(42, 'Astyanax', 'Lord of King', NULL, 'Return to the age of myths and magic, demons and dragons! Sure, you\'ve travelled some strange terrain in your video game journeys, but wait till you see where Astyanax takes you!', '/images/nes/42/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/6/48896_thumb.jpg', 1, 1),
(43, 'Athena', NULL, NULL, 'A fantasy world of boundless adventure awaits you!', '/images/nes/43/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/43/Athena_game_flyer.png', NULL, NULL),
(44, 'Athletic World', 'Family Trainer: Athletic World', NULL, 'Five exciting playing fields! Three different skill levels! Customized advice screen - game adjusts to your age and gender!', '/images/nes/44/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/8/48898_thumb.jpg', NULL, NULL),
(45, 'Attack of the Killer Tomatoes', NULL, NULL, 'Can no one stop these Vicious Veggies? Tomato oppression threatens the world! Dr. Gangrene is out to conquer the planet with his army of Killer Tomatoes. Who is mankind\'s last hope? Chad Finletter, the all-American Boy.', '/images/nes/45/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3d/Attack_of_the_Killer_Tomatoes_%281991%29_Coverart.png', NULL, NULL),
(46, 'Aussie Rules Footy', NULL, NULL, 'Experience all the thrills and spills of Aussie Rules Footy now on your Nintendo. Choose your favourite team, play one match or a whole season and see if you can make it through to the big one - the Grand Final!', '/images/nes/46/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/ca/Aussie_Rules_Footy_cover_art.jpg', NULL, NULL),
(47, 'Back to the Future', NULL, NULL, 'You are Marty McFly, just a typical senior at Hill Valley High. But after getting behind the wheel of a nuclear-powered sports car turned time machine, you find yourself in the year 1955 where you\'ve accidentally tampered with history. Now it must be corrected. You must somehow make sure that teenagers Lorraine Baines and George McFly (the two kids that will eventually grow up to become your parents) fall in love before the photo of your family fades away and you\'re left with nothing to come home to. It won\'t be easy. You\'ll have to protect George from Biff and his gang of bullies while doing your best to keep them from beating you up instead. To complicate things, Lorraine has a crush on you, so you\'ll have to dodge her advances while trying to figure out a way to get George and her to kiss at the school dance. Time is wasting and even if you manage to put all of the pieces in place, there is still no guarantee that you\'ll get back. It will all come down to one brief moment in time when the past, present and future all meet.', '/images/nes/47/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/af/BackToTheFutureNESBoxart.jpg', 3, NULL),
(48, 'Back to the Future Part II & III', NULL, NULL, 'It\'s time to go back... Great Scott! Returning from the year 2015, Doc Emmet Brown has some bad news for Marty McFly... His future\'s in danger unless he can put things right! Guide Marty through five levels in this exciting interpretation of the smash-hit film. Can you assure a safe future for Marty? Or will Biff ensure there\'s no future at all?', '/images/nes/48/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/15/BTTFIIandIII.jpg', NULL, NULL),
(49, 'Bad Dudes', 'Dragon Ninja', NULL, 'The opponents in your battle for supremacy are four types of Evil Ninja star-throwing Assassins whose skills are many and dangerous! Also out to spoil your day are Acrobatic Women Warriors and vicious Guard Dogs. At the end of each level you must overcome the Ninja Master in order to progress. Some examples of these superhuman villains are: A fire-breathing Fat Man, an Armor Clad Giant and the Green and Gruesome Giant Ninja - who has a disconcerting habit of suddenly multiplying into an army!', '/images/nes/49/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c0/Bad_Dudes_DragonNinja_arcadeflyer.png', 1, 1.5),
(50, 'Bad News Baseball', 'Gekitou!! Stadium', NULL, 'Looking for a baseball game that will challenge your skills and tickle your funnybone? You\'ve finally found it. Bad News Baseball is the new cartoon-style, outrageously funny baseball game only from Tecmo. It\'s fast-paced and jam-packed full of new animated cinema displays and exciting action. And now Bad News Baseball has boys and girls teams! Play against the computer, play with a buddy, or use the spectator mode, but you had better get ready to laugh. Featuring 12 boys teams and 12 girls teams, 11 different pitches and Tecmo\'s famous instant close-ups, all you need is a hotdog and you\'re ready to play.', '/images/nes/50/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/65/Bad_News_Baseball_Coverart.png', 3, NULL),
(51, 'Bad Street Brawler', NULL, NULL, 'Lawbreaking crooks, thugs, and circus renegades rule the mean streets. It\'s a real zoo out there! The city is unsafe and the good citizens live in constant fear. You are DUKE DUNNEGAN - former punk rocker and the world\'s coolest martial arts vigilante! You are a lean, mean thug-thrashing machine, returning to your native city streets as the ultimate defender of freedom! There\'s evil waiting behind every bush and danger lurking behind every corner - LOOK OUT! It\'s up to you to send the bad guys reeling with furious fist and foot bashing action! It\'s non-stop martial arts madness! Nail the no-gooders today - and watch the street savages scatter!', '/images/nes/51/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e9/Bad_Street_Brawler_cover.png', NULL, NULL),
(52, 'Balloon Fight', NULL, NULL, 'You\'ll need lightning-fast reactions to win this battle in the sky! Take to the skies! It\'s BALLOON FIGHT! You\'ll score lots of points and have loads of fun when you burst enemy balloons and send their parachutes crashing into the sea. But beware. These hot-air invaders having an amazing ability to land safely, blow up another balloon and come back stronger than before! What\'s more, if you fly too low you\'ll be devoured by man-eating sharks! Challenge them alone if you think you\'re up to it, or team up with a friend. Either way, you\'ll have the time of your life fighting off your opponents in the sky and avoiding those hungry sharks below in BALLOON FIGHT!', '/images/nes/52/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a8/BalloonFightnesboxart.jpg', 1, 1.5),
(53, 'Banana Prince', 'Bananan Ouji no Daibouken', NULL, 'Banana Prince is an Action game, developed by Kid and published by Takara,  which was released in Japan in 1991.', '/images/nes/53/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/0/0e/BananaPrinceIIcover.JPG', NULL, NULL),
(54, 'Bandai Golf: Challenge Pebble Beach', NULL, NULL, 'Play one of the world\'s most difficult and challenging golf courses on your Nintendo Entertainment System! This super-realistic golf game, complete with its beautiful seaside view and varying wind conditions, allows you to play each of the 18 holes with fantastic accuracy and realism. Enter your handicap, choose your tee-off position, select your club, control your swing and the ball\'s flight, direction and spin! Try to break par on this course with its challenging slopes, rises, bunkers and water hazards!', '/images/nes/54/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2f/Bandai_Golf_-_Challenge_Pebble_Beach_game_cover_art.jpg', 1, NULL),
(55, 'Bandit Kings of Ancient China', 'Suikoden: Tenmei no Chikai', NULL, 'Join history\'s greatest band of robbers - The Bandit Kings of the Song Empire! The year is 1101 and the evil minister Gao Qiu has seized all Imperial authority! The Emperor has one last chance to restore the glory of days past - a desperate gamble to find the last great hero in China! As a Bandit King, make allies and conquer territories. Watch out for typhoons, riots, epidemics, desertions and attacks from wild beasts. Enjoy festivals with your loyal band of heroes. Gain the support of the people and receive the benefits of their favor. But stay alert... in the end, who will be victorious? You or Gao Qiu?', '/images/nes/55/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c9/Bandit_Kings_of_Ancient_China_cover_art.jpg', NULL, NULL),
(56, 'Barbie', NULL, NULL, 'She\'s the hottest star with the coolest looks. She\'s Barbie! And she wants you to join her on a magical adventure through exciting worlds of fun, fashion and fantasy! One enchanted evening, Barbie dreams she\'s been invited to the Fantasy Ball. But she\'s got nothing to wear! Can you help her get the magical fantasy accessories she needs to make her entrance a smashing success? Your search will take you and Barbie on incredible adventures through three different fantasy worlds: Mall World, Underwater World, and 50\'s Soda Shop World. Along the way you\'ll discover exciting surprises, make new friends and model some of the coolest Barbie fashions ever! But be careful. One false step and you just might wake up from the dream before you get to the ball. Barbie is counting on you, so let\'s go!', '/images/nes/56/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/78/Barbie_NES_box_art.jpg', NULL, NULL),
(57, 'The Bard\'s Tale', NULL, NULL, 'The Bard\'s Tale is a modern interpretation of the original role-playing game of the same name. In this game, you\'ll take on the role of the Bard, a sardonic and opportunistic musician and adventurer. You can choose the Bard\'s responses toward other characters that he encounters with either "snarky" or nice dialogue. Each choice changes the course of events in the game. All the action takes place in medieval environments rife with townsfolk, birds, animals, rustling trees, and trickling water.', '/images/nes/57/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/81/Bardstalebox.jpg', NULL, NULL),
(58, 'Barker Bill\'s Trick Shooting', NULL, NULL, 'Barker Bill is your host. Join him and assistant Tricksie for arcade-style Trick Shooting! Get out your Zapper video gun. Blast floating balloons before they drift away. But, don\'t hit the friendly dog - he\'ll get mad! Rack up points by shooting spinning plates tossed by Barker Bill and Tricksie. They are happy when you make a shot, but scold you when you miss! Shoot around window panes to knock falling targets out of the picture! Take aim at tomatoes, eggs and watermelons before they land on poor Tricksie\'s head! So, set your sites for a day at the carnival with Tricksie and Barker Bill!', '/images/nes/58/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/1/13/BB_TS_NES.PNG', NULL, NULL),
(59, 'Base Wars', NULL, NULL, '$23.4 billion a year for a .250 hitter? Baseball salaries in the 24th Century have rocketed through the O-zone! And team owners are rebelling. They\'ve replaced these greedy players with mighty robots programmed for punishment. The result is Base Wars - a bizarre cross between baseball and gladiatorial combat. It\'s heroes are an awesome array of mutant machines. Metallic monsters resembling man, half-ton tanks and unidentified fielding objects. But forget about good sportsmanship in the Cyber League. Because in Base Wars, winning isn\'t everything, it\'s the only thing. And these mega horsepower sultans of swat are armed to the circuits with enough laser swords, guns and ammunition to spark an interplanetary war. All the elements of baseball are here - pitching, hitting, fielding and base running. Plus a brutal bonus: one-on-one battle royales for base possession.', '/images/nes/59/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/9/9a/Base_Wars_cover.jpg/220px-Base_Wars_cover.jpg', NULL, NULL),
(60, 'Baseball', NULL, NULL, 'The most realistic baseball game outside of a ballpark! It\'s the bottom of the ninth. You\'re at the plate. Here comes the pitch. You swing - it\'s a smash deep into center field. A home run! It\'s Nintendo BASEBALL. A game so real you\'ll think you\'re in the majors. You control the swing of the bat. The speed of the pitch. The hits, the steals, the double plays! Play against a computer opponent or challenge a friend. Nintendo\'s state-of-the-art graphics and realistic game play will have you really believing you\'re playing baseball. Just add peanuts, popcorn and crackerjacks... for the time of your life!', '/images/nes/60/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/64/Baseball_NES_box_art.jpg', 1, 3),
(61, 'Baseball Simulator 1.000', 'Choujin Ultra Baseball', NULL, 'Precise pitching, bulls-eye batting, and far-out fielding! It\'s all under your control with simple yet sophisticated operation. At last, the definitive baseball action game. With loads of features, it\'s the ultimate baseball simulation you\'ve waited for. Play ball with your favorite major league stars, heroes from the past, fantasy leagues - even enter yourself as the star! Enter team and player names and all the important stats for your very own team. Play a full length season with six teams for 5, 30, 60, or even 165 games. Follow the teams and players through the season - monitor their stats, even get top 10 rankings in batting and pitching. Add a whole new dimension of fun to baseball with the wacky Ultra Plays. Throw pitches that disappear or speed up in mid-air. Fight back with hits that explode or knock out the fielders. And catch them by leaping hundreds of feet in the air. With the six teams of the Ultra League, you\'ll play baseball like it\'s never been played before!', '/images/nes/61/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7c/BaseballSimulatorNESBoxart.jpg', NULL, NULL),
(62, 'Baseball Stars', 'Baseball Stars: Mezase Sankanou!!', NULL, 'Baseball Stars is a Sports game, developed and published by SNK,  which was released in Japan in 1998.', '/images/nes/62/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/28/BaseballStarsNESCover.jpg', 14.5, NULL),
(63, 'Baseball Stars 2', NULL, NULL, 'Baseball Stars 2 is baseball at its finest! A game made by players for players. Play in two leagues, Fighting and Exciting, against a global league of all-stars. Strike outs, stealing home, home runs, diving catches, and POWER hitting are just a few of the action-packed attractions found in this sequel of sequels!', '/images/nes/63/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8d/BaseballStars2NeoGeoBoxart.jpg', 14.5, NULL),
(64, 'Bases Loaded', 'Moero!! Pro Yakyuu', NULL, 'Pitch, hit and run like the pros! Here\'s voice, action and graphics so real, you\'ll believe you\'re in the lineup. The characters look like real baseball players, not cartoons. The action moves at the same pace as a real game. Sounds real, too! The crack of the bat, the calls of the ump, the roar of the crowd when you score. Play against the computer or a friend. Pick your team from 12 different lineups. It\'s tough. Each team has 30 players - 12 pitchers and 18 fielders. Each ballplayer has his own style. The trick: learn all 360 players! Control and play any position. Whether pitching or at bat, control every aspect of the game. Throw a fastball, high outside or a slider. Swing for the fences. Hit and run, bunt, steal or call for a pinch hitter. Win the Pennant by storing your wins and losses. Sign autographs later.', '/images/nes/64/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d1/Bases_Loaded_box_art.jpg', 3, NULL),
(65, 'Bases Loaded II: Second Season', 'Moero!! Pro Yakyuu \'88', NULL, 'Do you have what it takes to play and manage a World Series team? You\'ve got all the tools. Diving stops and leaping catches. Stolen bases and precision pickoffs. A pitching staff of junkballing lefties, flamethrowing righties, and crafty old relievers. But the key is to know when to use them, on any given day or play. You can tell a lot from your player\'s state - the most detailed in video baseball history, from streaks and slumps right down to each player\'s biorhythms - daily mood and physical condition. Beyond that, you have to rely on instinct alone. Because this is the "SECOND SEASON." When baseball becomes a thinking man\'s game, a war of nail-biting drama, strategy and nerves. When a world championship rides on every pitch, and one wrong move can end your season. From the first costly error to the last clutch hit, this is baseball at its very best. A big step up from the original "BASES LOADED"... and a world away from any other video baseball game.', '/images/nes/65/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7c/Bases_Loaded_2_box_art.jpg', 9.5, NULL),
(66, 'Bases Loaded 3', NULL, NULL, 'A unique challenge in game play: be the perfect player; get a perfect rating; play a perfect game! Bases Loaded 3 introduces an exciting new element to NES game play. It rates your abilities in 13 skill categories. The better you get, the harder it gets. So sharpen your skills, step up to the plate, and take a swing at beating us! No wonder perennial All-Star Ryne Sandberg calls Bases Loaded 3 "perfect." Because perfection is the only goal for the great ones!', '/images/nes/66/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a7/Bases_Loaded_3_box_art.jpg', 3, NULL),
(67, 'Bases Loaded 4', NULL, NULL, 'It might be, it could be, it is - the best baseball game ever for the NES! America\'s NES baseball favorite has extended the regular season to include 130 games and a seven game final series. More fun, action and excitement than ever before! Take to the field with larger players. Play defense from an outfielder\'s point of view. Manage your team based on their individual speed and stamina ratings. One or two player action with voice, action and graphics so real you can\'t take your eye off the ball. This season play to win it all, with Bases Loaded 4!', '/images/nes/67/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a7/Bases_Loaded_3_box_art.jpg', NULL, NULL),
(68, 'Batman', NULL, NULL, 'He\'s totally new. Totally tough. And he\'ll stop at nothing to make sure justice prevails! From the dark streets of GOTHAM CITY to the deepest corners of the criminal underworld comes the CAPED CRUSADER as you\'ve never seen him before. Incredibly strong. Armed to the teeth. And ready to put his life on the line for the sake of all, on a search-and-destroy mission to end the Joker\'s reign of terror. He leaps, he flies, he dodges enemy fire and delivers it right back... with a vengeance. This is no kid stuff. This is as real as video gaming gets. If you liked what you saw in the movie, you\'re gonna love what you see here. Because this time around, BATMAN is all business, and he won\'t let anything stand in his way!', '/images/nes/68/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/4/48/Batman_%28NES_game%29.jpg/220px-Batman_%28NES_game%29.jpg', NULL, NULL),
(69, 'Batman Returns', NULL, NULL, 'One oversized bird and one stinky cat are out to take control of this urban jungle. Only you, as Batman, possess the power to stop the sinister plots of The Penguin and Catwoman!', '/images/nes/69/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/BatmanReturnsCoverart.jpg', 2, 2.5),
(70, 'Batman: Return of the Joker', 'Dynamite Batman', NULL, 'The seedy underworld is crawling with criminals. Even worse - the JOKER is back on top of \'em all! Law and order means nothing... until now! Because BATMAN is here - and the action is hotter than ever! Ear-crunching sound effects. Pulse-quickening music. Graphics that are as hot as 16-bit. And this time, BATMAN hits fast and hard. Flying, leaping, and sliding to attack! And striking at the heart of the JOKER. The CAPED CRUSADER has a totally new arsenal at his command: Batarang, Crossbow, Sonic Neutralizer. He\'s even got a superfueled jetpack. And even more powerful weapons at the touch of a button. BATMAN has got to use all of his power. Because this world is a very dark place, and you never know where the JOKER is hiding!', '/images/nes/70/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e6/Batman_Return_of_the_Joker_NES.jpg', 1, 3.5),
(71, 'Battle Chess', NULL, NULL, 'An entire medieval world at war on the checkered field! Only Battle Chess combines a magnificent chess logic system with colorful and dramatic 3D animations. Featuring 10 levels of play and an opening library of 30,000 moves challenging the most sophisticated players. Play against the computer or your friend or let the computer play against itself.', '/images/nes/71/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/01/Battle_Chess.png', 1.5, 10),
(72, 'The Battle of Olympus', NULL, NULL, 'This is an ancient story - a time when men and gods lived together. The peaceful village of Elis was the home of the fairest maiden and a gentle yet brave young man named Orpheus. Helene and Orpheus swore eternal love to each other. But alas, one day, Helene fell victim to the fangs of a venomous serpent and was turned to stone. Your adventure will take you through ancient Greece on a classic mythological quest. It may be easy to defeat the snakes and centaurs that inhabit most of the cities but how will you defeat Hydra? Or the terrible three-headed dog, Cerberus? You\'ll need to use all of your adventuring skills to find the magic items that will allow you to rescue your beloved Helene.', '/images/nes/72/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7c/Battle_of_olympus.jpg', NULL, 14),
(73, 'Battle Tank', NULL, NULL, 'Climb in and discover the earthshaking power of BATTLETANK, the only NES tank game that puts you inside the tank! First you\'ll receive your mission orders; then plan your attack using the Satellite Radar Map. There\'s no easy route - you\'ll have to travel through deserts, mountains and snow fields. At every turn, you\'re challenged by bloodthirsty enemy defenses, including tanks, copters, machine gun fire and mines. Use 150mm shells, 50 caliber machine guns, smoke bombs and wire-guided missiles to defend yourself and complete your orders. Launch full-scale attacks on heavily-defended enemy strongholds that include a train yard, a refinery and a nuclear power plant. But be careful, each mission gets harder and you only have one tank per mission. Six hits and your tank is cooked. So get fired up and ready for non-stop gut-wrenching action with BATTLETANK!', '/images/nes/73/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3c/Battle_Tank_cover.png', NULL, NULL),
(74, 'Battleship', NULL, NULL, 'With a modern, dynamic and interactive 3D board, BATTLESHIP brings the classic franchise to a new level for a memorable experience.', '/images/nes/74/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/8/748_front.jpg', NULL, NULL),
(75, 'Battletoads', NULL, NULL, 'Battletoads is an Action game, developed and published by Rare Ltd.,  with no announced release date.', '/images/nes/75/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e8/Battletoads_Coverart.png', 4, 6.5),
(76, 'Battletoads & Double Dragon', NULL, NULL, 'When a battlecruiser the size of a city and called the Colossus smashes out of the moon, its laser cannon glowing menacingly, you can bet it ain\'t gonna be makin\' no social calls... You can bet it\'s gonna be creating some bad n\' crazy mayhem on good ol\' planet Earth - \'specially when you know that the dreaded Dark Queen and the shady Shadow Boss are on board just rarin\' to rock n\' roll... The dastardly duo are about to unleash their most monstrous plan yet - from their secret lunar base they intend to launch an invasion that\'ll make them masters of the world... Neutralized by deadly glooming rays, Earth\'s forces are powerless... That is, until the Dragons join the \'Toads! Take a toadacious trip with the dream ticket as those terrific twins Billy and Jimmy Lee team up with Zitz, Flash and Pimple against the combined might of the gruesome twosome and their mindless minions Big Blag, Abobo, Robo-Manus and Roper, in a toadally new adventure!', '/images/nes/76/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/63/BattleToadsDoubleDragon.jpg', 2, 7),
(77, 'Beetlejuice', NULL, NULL, 'It\'s showtime...starring me...The Ghost with the Most! How\'d you like to help me scare those city folks out of your house...and their wits!?! We\'ll scare our way through eight horrific levels, including the Graveyard (it\'s so nice this time of the year) and the Ghoul House. And run into (and away from) Killer Giant Beetles, Legs Without Heads and Deadly Scorpions. Wait \'til you get a load of the weirdos in the Afterlife Waiting Room! Just remember, one wrong move and you\'re food for the Sand Worm.', '/images/nes/77/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e5/Beetlejuice_MS-DOS_cover.jpg', 1, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(78, 'Best of the Best: Championship Karate', 'Super Kick Boxing', NULL, 'The ancient art of Karate, you have been obsessed with its mystical magic and power. Since you were a young child you\'ve dreamed of entering the arenas, matching your skills against the Best of the Best. Your dream has turned into reality as you\'ve been ranked 16th in the world and now you\'re ready to enter the International World Championships. Training does not stop here, continue to master your moves, focus on a style or create your own.  Choose between 55 possible moves and program your favorites into your style. Study your opponents carefully, for they are watching you. Your body and mind must work together with your concentration and spirit. Imagine the superiority of your speed and power, for those who lack the spirit will lose the battle. You will meet many tough fighters as obsessed with being the best as you are and they can\'t wait to see what you\'re made of!', '/images/nes/78/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/32/Best_of_the_Best_Championship_Karate_cover.jpg', NULL, NULL),
(79, 'Bigfoot', NULL, NULL, 'Get behind the wheel of Bigfoot - King of the Monster Trucks - and drive 14,000 pounds of explosive head-to-head crunching action! First, compete on the most treacherous off-road terrain America has to offer: twisted roads, washed-out bridges, and mud bogs as deep as your truck. Next, upgrade your rig with monster tires, super-charged engines and more. Then, put your pedal to the metal in the toughest events of the monster truck circuit. Caution: Don\'t blow your engine... Otherwise you\'ll end up in the junkyard instead of the winner\'s circle!', '/images/nes/79/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e0/BigfootBoxart.jpg', NULL, NULL),
(80, 'Bill & Ted\'s Excellent Video Game Adventure', NULL, NULL, 'An NES game based on these two bodacious dudes of movie fame? Excellent!!! History has been all screwed up and only the San Dimas Duo can set things straight. Awesome responsibility, man! Ride the Power Phone Booth to six different worlds. Galactic, man! Search for Famous Historical Dudes through space and time. Most cosmic! Talk with the likes of Julius Caesar (he invented Caesar Salad) and Napoleon (the short, dead dude). Send them back in time or you\'ll miss the Wyld Stallyns concert - starring you! Heavy! It\'s a bodacious, mind-boggling, role-playing adventure. And your only chance to save the world and earn the respect you deserve. No way - yes way! A most excellent role-playing adventure!', '/images/nes/80/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/d/db/Bill_Ted_VG.jpg/220px-Bill_Ted_VG.jpg', 3, NULL),
(81, 'Bill Elliott\'s NASCAR Challenge', NULL, NULL, 'Experience life in the fast lane!', '/images/nes/81/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/93/Bill_Elliott%27s_NASCAR_Challenge_cover.jpg', NULL, NULL),
(82, 'Bionic Commando', 'Hitler no Fukkatsu: Top Secret', NULL, 'For two years, your people have struggled against the relentless onslaught of invading forces. With your army reduced to a handful and your artillery depleted, further resistance seems impossible. But in a hidden underground laboratory, a team of scientists has at last perfected a new kind of fighting machinery: a bionic arm that extends and contracts, providing unheard of strength and maneuverability. Combined with an arsenal of rapid-fire, armor-piercing and heat-seeking weaponry, this will put the power of an entire army in the hands of one man... one carefully chosen soldier, who has what it takes to become a new breed of unstoppable commando... a Bionic Commando. And you are that soldier! Your mission will take you through the heavily-patrolled wilderness surrounding the enemy headquarters and into the very heart of the fortress itself. Even to the most courageous soldier, it would seem an impossible challenge. But there has never been a soldier like the Bionic Commando!', '/images/nes/82/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/86/Bionic_Commando.jpg', NULL, NULL),
(83, 'The Black Bass', 'The Black Bass 2', NULL, 'The rumor is true that they will open the International Anglers Fishing Tournament with a selected 200 professional anglers at your NES. The shadow of the fish appears from the depths of the lake. This is a real simulation game between man and fish. THE BLACK BASS makes a fantasy dream competition come true. THE BLACK BASS will jump up and try to hide at the bottom of the trees in the four different lakes. Now the Tournament is ready to start!', '/images/nes/83/cover.png', 'https://upload.wikimedia.org/wikipedia/en/thumb/7/70/TheBlackBassUSA_NESfrontcover.png/200px-TheBlackBassUSA_NESfrontcover.png', NULL, NULL),
(84, 'Blades of Steel', NULL, NULL, 'Fight for victory in the hottest hockey game on ice! With sharpened blades and a lethal stick, you slash into a rink surrounded by thousands of screaming fans. It\'s time for full-speed, high contact hockey, the kind of bone-jarring action played by the pros. The puck is dropped, you take control, center it and... Whoa! Your opponent viciously checks you from behind, making an incredible steal. You charge after him, crushing him against the boards. Suddenly tempers flare, off come the gloves, and you\'re swinging fists like a prize fighter. What action! You can even rack up assists like the great you-know-who. Or play goalie in the slap shooting penalty scenes. So strap on Blades of Steel. And imagine those immortal words - "He shoots, he scores!"', '/images/nes/84/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/40/Blades_of_Steel_cover.png', 1.5, NULL),
(85, 'Blaster Master', 'Chou-Wakusei Senki MetaFight', NULL, 'You\'ve fallen down a hidden manhole into a world of creatures so terrifying they\'d scare the rats away. You can panic and perish, or blast your way through an endless maze of tunnels, searching for the secret passages to your escape. And that\'s the easy part. Because the Masters of the Caverns lay waiting - prehistoric creatures so powerful, so gigantic, they literally fill your screen! So load your arsenal and get ready for BlasterMaster.', '/images/nes/85/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Blaster_Master_boxart.jpg', 3, 5),
(86, 'The Blue Marlin', 'Blue Marlin, The: Tsuri Kichi Sanpei', NULL, 'The Blue Marlin is a Sports game, published by Starfish,  which was released in Japan in 2000.', '/images/nes/86/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/7/73/The_blue_marlin_nes_box_art.jpg/220px-The_blue_marlin_nes_box_art.jpg', NULL, NULL),
(87, 'The Blues Brothers', NULL, NULL, 'The greatest rock \'n\' roll game is about to begin: THE BLUES BROTHERS! Cruise along with Jake and Elwood, those all-time rhythm \'n\' blues men in this crazy platform game - an explosive mix of adventure, comedy and music. Back by popular demand, the Blues Brothers are out to conquer the stage one more time. To an upbeat rhythm you set off across town... but it ain\'t that easy. You\'ve got to escape from prison, swim through the catacombs, and shoot to the upper heights of the big city before you can start the concert. Creating chaos and confusion, you encounter Charlie, the crazy cop, and Horatio, the deadly spider... Get ready to play the blues!', '/images/nes/87/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/3/27253_front.jpg', 1, 5.5),
(88, 'Bo Jackson Baseball', NULL, NULL, 'Bo Jackson Baseball is the most complete baseball game ever available for your NES. If you\'ve played the others, you know that some have a little of this and some of that - but never everything a real baseball fanatic needs in one cool Game Pak... until now. Because Bo knows exactly what you\'re looking for in a baseball game. One or two players - head-to-head in exhibition or in a championship league pennant chase. You\'re on the mound - 15 pitches, pick-offs and bean-balls. You\'re behind the plate - call for the pitch and gun down base runners. You\'re in the batter\'s box - bunt, choke up for contact or just swing for the fences. You\'re in the field directing all 9 players - run, jump, dive and throw. You\'re on the basepaths - with complete control of each individual runner to steal at will. Bo Jackson Baseball has the largest players ever seen in a game and the best digitized sounds you\'ll ever hear!', '/images/nes/88/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9e/Bo_Jackson_Baseball_Coverart.png', NULL, NULL),
(89, 'Bomberman', NULL, NULL, 'The world-famous exhilarating action game Bomberman!', '/images/nes/89/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/72/BombermanCover.jpg', 2, 3),
(90, 'Bomberman II', NULL, NULL, 'Explosive action spotlights this riveting game of split-second timing and really short fuses! Bomberman\'s back - this time with new power-up items that enhance this classic seek-and-destroy adventure! It\'s all-out fun for the whole family as you hunt monsters (or each other) in a non-stop bomb-dropping frenzy! The one-player mode has over 50 levels of intense gameplay! Find the right strategy and blow the mangy critters to smithereens! You can also take on one or two of your friends in heated competition to see who among you can earn the title of Supreme Bomberman! Secret Bonus Rounds add mega-points and extra lives to your score! Uncover hidden bonus items for super bombs and fantastic firepower!', '/images/nes/90/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/72/BombermanCover.jpg', 2, 2),
(91, 'Bonk\'s Adventure', 'FC Genjin', NULL, 'Bonk yourself out in this head-buttin\', head-splittin\' adventure. As Bonk the Caveman, use your head against Kongo Zilla, Tractorhead and the wackiest array of prehistoric foes ever seen. Be sure to eat your meat-and-vegetables as you power-up to battle Evil King Drool himself. It\'s a real headbanger!', '/images/nes/91/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7b/Bonkadventure.jpg', 1.5, 3),
(92, 'Boulder Dash', NULL, NULL, 'Stoneford, an old adventurer, ill in bed, called his son, Rockford, to his side. Handing Rockford an old map, he said: "My son, you must take up the quest I never completed. Find the Secret Jewels of the Six Worlds, and you will be rich beyond your wildest dreams!" These were his final words. As Rockford, your quest begins in the strange and perilous Boulder World. An underground world swarming with weird enemies, all out to prevent you from collecting the priceless diamonds just waiting to be mined. Can you master the enchanted walls, transform butterflies into jewels, find the mysterious escape tunnel, and get away from the growing amoeba before it engulfs you? Six different magical worlds of adventure await you in BOULDER DASH!', '/images/nes/92/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a6/Boulder_Dash_NES.jpg', 7.5, NULL),
(93, 'A Boy and His Blob: Trouble on Blobolonia', NULL, NULL, 'Blob has come from the distant planet Blobolonia in search of an earth boy to help him save his world. Join him on this fantastic adventure in mysterious caverns beneath the earth searching for treasure. then travel to Blobolonia to battle the evil emperor. Discover Blob\'s amazing appetite for jellybeans and the different transformations that occur with each flavor. Learn to use these shapes to overcome even the most outrageous obstacles.', '/images/nes/93/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/3/21833_front.jpg', 1, 2.5),
(94, 'Bram Stoker\'s Dracula', NULL, NULL, 'Bram Stoker\'s Dracula sucks you into a terrifying world of evil. And there\'s only one way to survive. Kill the Prince of Darkness! But it won\'t be easy. From deep in the cold, dark dungeons of Castle Dracula to the brutal Transylvanian countryside, you\'ll be in a constant fight for your life. As the sun sets, the evil Prince of Darkness rises and attacks as a bat, a vicious wolf, even an old man. With every multiple level - each divided into day and night - you\'re plunged deeper into the ultimate interactive experience, as Dracula rises in search of blood... yours! Incredibly realistic 3D graphics, digitized footage from the actual movie, CD sound, and characters based on real actors, turn this game into the ultimate interactive horror movie for your Sega CD.', '/images/nes/94/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1a/DraculaSNES_boxart.jpg', 2, 8),
(95, 'Break Time: The National Pool Tour', NULL, NULL, 'BreakTime gives you fast-breaking pool-playing fun in four different ways: Rotation, 8-Ball, 9-Ball and a 14-1 Rack Game - all with music and realistic sound effects. It\'s the closest thing yet to the feel of real billiard ball action. You can even match your skills with tricky, animated pool sharks from all over the country such as Ernie English of Milwaukee and Suzy Cue in New York. Chalk up and challenge the experts! Beat them all and work your way up to National Pool Tour Champion. Make time for BreakTime!', '/images/nes/95/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0e/Breaktimethenationalpooltour.jpg', NULL, NULL),
(96, 'BreakThru', NULL, NULL, 'Accomplish your mission with your highly sophisticated assault vehicle to BREAK THRU each of the five enemy strongholds! Travel through the mountains, bridges and cities to reach the airfield. Impenetrable enemy forces impede your progress; tanks, helicopters, jeeps, landmines and more stand in your way. Press on, for all is lost if you fail to BREAK THRU!', '/images/nes/96/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/6/6f/BreakThru_arcadeflyer.PNG', 1, NULL),
(97, 'Bubble Bobble', NULL, NULL, 'THESE ARE TWO HUNGRY DINO-MIGHTS AND THEY\'VE GOT BUBBLE FIGHT\'N FUN DOWN TIGHT. You and your two brontosaurus buddies, Bub and Bob, are up to your brows in bubble troubles. You\'ve got to battle battalions of bullies by blowing and bursting billions of bubbles. It\'s a fast-paced bubble banquet through over 100 screens of slap happy suds. Got an appetite for fun... then get blowin\'.', '/images/nes/97/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ed/Bubble_bobble.jpg', 2.5, 4.5),
(98, 'Bubble Bobble Part 2', 'Bubble Bobble 2', NULL, 'A new breed of heroes! Cubby and Rubby, descendants of the famous Bubby, must battle the Skull Brothers and their army of fiends to rescue a friend in danger. Fortunately, our dinosaur heroes can blow bubbles that will destroy their foes. They will rain fire, floods and tornado!', '/images/nes/98/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/eb/Bubbobpart2.jpg', 1.5, NULL),
(99, 'Bucky O\'Hare', NULL, NULL, 'BUCKY\'S GONNA NEED A LOT OF LUCK FROM HIS RABBIT\'S FOOT!', '/images/nes/99/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/59/Bucky_OHare_North_American_NES_box_art.jpg', NULL, NULL),
(100, 'The Bugs Bunny Birthday Blowout', NULL, NULL, 'It\'s Bugs Bunny\'s 50th birthday and Bugs has been invited to a huge party in his honor. But Elmer Fudd, Yosemite Sam, Wile E. Coyote and Sylvester didn\'t make the guest list and they\'re out for not-so-sweet revenge. They have non-stop nasty tricks up their sleeves to spoil Bugs\' chances of ever arriving at his own birthday bash. Dodge dangerous contraptions! Smash mysterious monsters! Help Bugs hip-hop to a happy birthday blowout!', '/images/nes/100/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/3/48973_front.jpg', 1.5, NULL),
(101, 'The Bugs Bunny Crazy Castle', NULL, NULL, 'Our hero Bugs Bunny needs your help on a daring quest to rescue his main squeeze, Honey Bunny - caught in the clutches of those despicable Looney Tunes characters Daffy Duck, Yosemite Sam, Sylvester and Wile E. Coyote. Sufferin\' succotash! Hop from one spooky room to another, chase up creaky stairs and slide down rusty pipes. To get to Honey, remember the secret passwords, then collect all the carrots you find. But hurry! Before you can say "What\'s up, doc?" those rascals are on your cottontail. Bugs can throw a good rabbit-punch in a pinch. But for added protection, you can use some unusual objects like boxing gloves, cargo crates and water buckets. And that\'s not all - after a drink from the Magic Bottle nothing will stop you! With a deft wrist, a quick wit, and a swift kick, you will win the game and have Bugs and Honey hopping happily together again!', '/images/nes/101/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/31/Crazy_Castle_Cover.png', 3, 4.5),
(102, 'Bump \'n\' Jump', 'Buggy Popper', NULL, 'You\'re cruising along with your baby, Bunny, in your Buggy, when from behind you hear this brain-boggling b-b-baroooooom! It\'s Dark Jackal and his beastly band of Blacktop Bullies! They buzz by and when the smoke clears, the passenger seat\'s bare. These dudes have kidnapped your baby, Bunny! Only you and the Buggy can bring her back. But not without a bone-bouncing chase that makes the Indy 500 look like bumper cars. Over jam-packed city streets and treacherous curves on mountain cliffs, past Dark Jackal\'s Bullies to catch his Buggy and Bunny. And the cops are bearing down on you from behind. Think you got what it takes to save Bunny?', '/images/nes/102/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/c/c5/Bumpnjump_arcadeflyer.PNG', NULL, NULL),
(103, 'Burai Fighter', NULL, NULL, 'In a remote corner of the galaxy, there lives a race of super-brains known as the Burai. For thousands of years, their vast mental capabilities have been focused upon one goal: the conquest of the universe! To accomplish this, they are creating huge armies of robo-mutants - bizarre creatures, half robot and half living flesh. With their seven manufacturing bases producing thousands of robo-mutants each day, the Burai armies will soon overrun the galaxy - unless you can stop them! Strap on your proton pack, charge up your laser cannon, and prepare to do battle with the deadliest army of mutant rogues in the universe. You must somehow penetrate the seven bases of the Burai, where you will confront a super-mutant guarding each base - monstrous creatures like the Giganticrab, Jawsipede, and Fangskull - until finally, you face the terrifying Slimedragon! But with the awesome arsenal of weapons at your command, victory may still be within your reach. It\'s up to you to rid the universe of the evil Burai once and for all!', '/images/nes/103/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Burai_Fighter_North_American_NES_box_art.jpg', 1, NULL),
(104, 'BurgerTime', NULL, NULL, 'As Chef Peter Pepper, you must fend off the Food Foes while making perfect burgers! Use pinches of pepper to stun Mr. Hot Dog, Mr. Egg and Mr. Pickle, or lure them onto or under burger buns, lettuce, cheese or tomatoes to escape their clutches! Making perfect burgers gets progressively tougher through the six screens of BurgerTime!', '/images/nes/104/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0a/BurgerTime_arcadeflyer.png', 1, NULL),
(105, 'Cabal', NULL, NULL, 'Sweep through the occupied territory of D.R.A.T. - the Dreaded Republic of Allied Terrorists. You must blast your way through 20 action-packed screens. You\'ll be armed to the teeth with a powerful assault rifle and destructive grenades. Pick up extra firepower as you go, and pulverize everything in your path! Rely on your quickness, accuracy and savage wit to survive the fierce attacks from land, sea and air. Wipe out the entire terrorist camp before they wipe out you. It\'s the ultimate test. Are you ready to dare the danger?', '/images/nes/105/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1d/Cabal_arcadeflyer.png', NULL, 1.5),
(106, 'Caesars Palace', NULL, NULL, 'Caesars Palace is a Miscellaneous game, developed by Virgin Games and published by MacPlay,  which was released in 1994.', '/images/nes/106/cover.jpg', 'https://upload.wikimedia.org/wikipedia/commons/e/ea/Caesars_Palace_-_South_East_-_2010-12-12.jpg', NULL, NULL),
(107, 'California Games', NULL, NULL, 'Get ready for the gnarliest, most radically awesome sports events under the sun! They\'re six of California\'s hottest games. Geared for daredevils - and guaranteed to get your adrenaline pumping! First, pick your sponsor. Then tackle the heavy competition in surfing, rollerskating, BMX bike racing and more. Take risks to score high, \'cause wimps wipe out! Trophies are awarded for single events and overall competition! So grab your gear and go for it. You\'ll be up to your jams in awesome action. And you just might walk away with first prize!', '/images/nes/107/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7e/California_Games_Coverart.png', 1, 3),
(108, 'Capcom\'s Gold Medal Challenge \'92', 'Capcom Barcelona \'92', NULL, 'Catch the spirit of world-class competition with Capcom\'s Gold Medal Challenge \'92! Train and compete with up to seven friends in 18 pulse-pounding events. Now\'s the time to really pump up and get physical! Out muscle your friends in Weightlifting and leave them in the dust in the 100 Meter Dash. Make a huge splash in the swim meets and leave everyone else in your wake. Earn a perfect 10 in the Vault and watch as the crowd goes wild! With Capcom\'s Gold Medal Challenge \'92, all the thrills and excitement of world-class competition are right at your fingertips!', '/images/nes/108/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Capcom%27s_Gold_Medal_Challenge_%2792_Cover.jpg', NULL, NULL),
(109, 'Captain America and The Avengers', NULL, NULL, 'When Captain America throws his mighty shield... Red Skull\'s goons will feel the pain of its power! On this adventure, it\'s personal. Captain America and Hawkeye must track down their fellow Avengers, Iron Man and Vision. But the kidnappers - Red Skull, Ultron, Crossbones and Wizard - have let loose a legion of thugs that stand between you and your friends. Captain America and the Avengers. It\'s a cross-country chase of action with your favorite Marvel comic book heroes!', '/images/nes/109/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Captain_America_and_The_Avengers.jpg', 1.5, 3),
(110, 'Captain Planet and the Planeteers', NULL, NULL, 'Fight real ecological threats through nine levels of deadly pollution. Five eco-heroes summon Earth, Fire, Wind, Water and Heart to defend our planet from destruction! With magic energy, they combine forces to summon Captain Planet, the champion crusader for Earth safety!', '/images/nes/110/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1e/Captain_Planet_and_the_Planeteers_title.jpg', NULL, NULL),
(111, 'Captain Skyhawk', NULL, NULL, 'No one noticed when they landed, and now it might be too late to stop them! In remote corners of the globe, alien invaders are draining Earth\'s energy and "feeding" it to their space station. When the power drain is complete, the aliens plan to vaporize Earth with a deadly laser blast. You\'re Captain Skyhawk - the only person who can stop them! Climb aboard your hi-tech F-14VTS jet - fully equipped with the latest in deadly weapons. A unique spy satellite viewer lets you see your entire plane as you battle alien forces over amazing gridscape graphics. Whether you\'re soaring over mountains at Mach 3 or floating in hover mode, your F-14VTS will measure up to any challenge! When you run out of firepower, just rocket up to your space station and load up with Phoenix missiles, Hawk bombs and more! The final challenge is still to come. You must destroy the dreaded alien space station! Fire up your afterburners, Captain! It\'s time to fry some aliens!', '/images/nes/111/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b0/Captain_Skyhawk_Coverart.png', 2.5, NULL),
(112, 'Casino Kid', '$1,000,000 Kid: Maboroshi no Teiou Hen', NULL, 'Outwit and outplay your rivals for the chance to become the King of the Casino. Ever dream of playing in the ultimate Poker and Blackjack competition? Here\'s your chance. You are the Casino Kid, born to gamble and working the fast-paced floor of a swank gambling house. All eyes are on you, as you triumph over the toughest gamblers around! Yet, CASINO KID is much more than a card game - it\'s also a maze game where Tourists and Bunny Girls supply you with the information you need to lead you to your next opponent, and beat him at his own game. If you can succeed in winning a million dollars by beating 16 different Poker players and Blackjack dealers, you will be transported to a mansion where you\'ll challenge your ultimate rival, the Casino King, for his title. Good luck, Casino Kid!', '/images/nes/112/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2f/CasinoKidBoxart.jpg', NULL, NULL),
(113, 'Casino Kid 2', NULL, NULL, 'Since CASINO KID became U.S. Champion, a mystery person has organized an International Gambling Championship. He wants to play you. But first you must jet around the globe and take on the world\'s best, and beat \'em! The stakes are high and the competition is fierce, so you must play tough and smart. Then you get to play against the mystery challenger -  the toughest challenge of all. Win and CASINO KID becomes International Casino KING! Best of luck!', '/images/nes/113/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2f/CasinoKidBoxart.jpg', NULL, NULL),
(114, 'Castelian', 'Kyorochan Land', NULL, 'Julius is his name. Demolition is his game. Eight colossal towers that almost crack the sky! You and Julius - the Anurian Hybrid - are charged with the task of collapsing the alien towers. As Julius climbs and leaps across the face of each tower, he is confronted by potent and very deadly adversaries. Roving Hexalons, scanning I-Balls, orbiting Spheroids and dissolving pathways threaten you at every turn. Their mere touch will cost you your life! Yet, somehow, you must reach the tower\'s top in order to detonate your powerful D-bombs! Your courage, skill and determination will guide you to the summit of Castelian. Fire your Carbonobombs, catch the high-speed elevator, and escape into the doorways of the unknown. The island\'s future depends upon you and Julius. Watch him, learn his secrets and demolition will become your game!', '/images/nes/114/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/1/46051_front.jpg', NULL, NULL),
(115, 'Castle of Dragon', 'Dragon Unit', NULL, 'Princess Amoreena has been carried away by the evil offspring of Darklarza the Dragon Master. Geraden, Duke of Menlary, needs your help to defeat the hideous legions of the undead to secure the Instruments of Darklarza\'s demise.', '/images/nes/115/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/6/48986_front.jpg', 1, 1),
(116, 'Castlequest', 'Castle Excellent', NULL, 'A long time ago in a faraway land, there lived a lovely young princess named Margarita. Her beauty and grace were known throughout the land - especially to Mad Mizer, the Dark Lord of the grim Groken Castle high in the Forbidden Mountains. He had vowed to make the Princess his queen; and so, one terrible day, he sent his ghoulish helpers to capture her, and she was carried off and imprisoned in one of the hundred miserable rooms of Groken Castle. News of the kidnapping spread throughout the kingdom, and many courageous young men braved the perils of Groken Castle in an attempt to rescue the Princess - only to become hopelessly lost in the complicated maze of rooms, ensnared in one of the many treacherous traps, or foiled by Mad Mizer\'s deadly servants. Finally the news reached the worthy Prince Rafael, who had long loved the Princess from afar. Raising his sword to the heavens, Prince Rafael swore that nothing would keep him from her side, and set out on his Castlequest. The odds against him seemed hopeless... But legend has it that two magical fairies have been held captive in the Castle for centuries. If the Prince can find and release them to gain their help, he may yet succeed in his quest. And to rescue his fair Princess, he is prepared to face the deadly wrath of the Dark Lord himself!', '/images/nes/116/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/34/CastlequestNESBoxart.jpg', 1.5, NULL),
(117, 'Castlevania', 'Akumajou Dracula', NULL, 'If you think it\'s scary on the outside, wait\'ll you see the basement! You\'re in for the longest night of your life. Ghosts, goblins, demons, wolves, bats - creatures lurking around every corner. As you descend deeper and deeper, they get thicker and thicker. Better stick close to the cavern floor - it\'s your only chance of finding a weapon or two. You\'re gonna need \'em. Because when you finally meet the Count, you know he\'ll be going for the jugular. So keep your courage up and your stake sharp. And say your prayers!', '/images/nes/117/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/24/Castlevania_NES_box_art.jpg', 3, 7),
(118, 'Castlevania II: Simon\'s Quest', NULL, NULL, 'Castlevania was a cakewalk compared to this bloody curse. You thought you had the Prince of Darkness defanged - eh, Simon Belmont? Well think again, \'cause according to a damsel in distress, evil Count Dracula has left a horrifying curse in his wake. And the only hope you have of ending the terror is to destroy his missing body parts! Talk about your frightening quest, searching a maze of mansions, graveyards and dark, eerie forests - each guarded by man-eating werewolves, fire-throwing zombies and other devilish demons. Your grim chances are kept alive in Transylvania, where cowardly villagers offer clues to the whereabouts of Dracula\'s remains. And where you\'ll purchase magic weapons, including silver knives and flame whips. But beware the night. For when the sun disappears, Dracula\'s curse grows deadlier. And your chances grow dimmer and dimmer.', '/images/nes/118/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8a/Castlevania_II_Simon%27s_Quest.jpg', 4, 5),
(119, 'Castlevania III: Dracula\'s Curse', 'Akumajou Densetsu', NULL, 'Led by the immortal Count Dracula, the greatest army of evil ever assembled is poised to bury mankind in a Tomb of Terror. Destroying this legion of Swamp Dragons, Slasher Skeletons and Forces of the Undead will be the supreme challenge for the mightiest of warriors. Your place in history is 100 years before Simon Belmont\'s birth. Dracula is young at heart, and it will take more than a stake to penetrate his evil. Luckily, you command the role of Trevor - Simon\'s forefather and the origin of the Belmont Warlord Chromosones. Trevor has a power never before seen by human eyes - the power to transform into three different spirits: Grant DaNasty, the ferocious Ghost Pirate. Sypha, the Mystic Warlord. And Alucard, Dracula\'s forgotten son. You must perfectly time Trevor\'s body transformations to match up his different fighting spirits against Ultimate Evils. Trevor also has the strength and wisdom to command the Battle Axe, Invisibility Potion and Mystic Whip. But the most important weapon Trevor has is your cunning to choose the correct Paths of Fate and your bravery to lead him past 17 possible levels of never-ending doom, including the Haunted Ship of Fools, the Sunken City of Poltergeists, the Clock Tower of Untimely Death and Curse Castle. Never before have so many dangers confronted you at one time. And if by some miracle you triumph, you\'ll no longer be a mere mortal. You\'ll be a legend who\'ll live forever!', '/images/nes/119/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/95/Castlevania_III_Dracula%27s_Curse.jpg', 4, 13.5),
(120, 'Caveman Games', NULL, NULL, 'CAVELAND SPORTS NEWS', '/images/nes/120/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/4/49004_front.jpg', NULL, NULL),
(121, 'Championship Bowling', NULL, NULL, 'Championship Bowling combines true bowling mechanics with zany and amusing characters rolling their personalized balls in some crazy locations. The game boasts an array of distinctive characters, each uniquely animated, along with multiplayer functionality and many unlockable features.', '/images/nes/121/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/7/21877_front.jpg', NULL, NULL),
(122, 'Championship Pool', 'Super Billiard', NULL, 'Here\'s a straight game of 8-Ball to play against your friends - no trick stuff - with rock \'n\' roll riffs dancing on your eardrums. All the thrills of one of the world\'s most popular games is yours whenever you want it, and you\'ll never even have to wait for a table! Championship Pool gives you all the excitement of pure pool play, with unique features you may not find in any other electronic billiards product. And this NES pool game is officially endorsed by The Billiard Congress of America. Pit yourself against the computer or challenge up to 7 human opponents using the Party Pool option. Choose from zoom-in and zoom-out screens, and choose the music to get you going! Think you\'re a shark? Try Tournament Mode where only the best players qualify for the world championship tournament. Play 8-ball, 9-Ball, straight pool or over 15 different games!  Chalk up and rack \'em... It\'s your break!', '/images/nes/122/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d6/NESPool.jpg', NULL, NULL),
(123, 'Championship Rally', 'Exciting Rally', NULL, 'Championship Rally is a Racing game, developed and published by Songbird Productions,  which was released in 2000.', '/images/nes/123/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cc/Championship_Rally_cover_art.jpg', NULL, NULL),
(124, 'Chessmaster', NULL, NULL, 'Chessmaster includes plenty of features to improve your chess skills, no matter what level you are. In Chess School, you can learn basic and advanced tactics before challenging computer-controlled opponents in single-player or multiplayer modes. The game includes a variety of gameplay modes, such as Quick Game, Rated Play, Handicap, Setup Position, and Puzzle. Watch as each piece attacks each other on the checkered battlefield. This immersive environment also features information about your opponent, tournament notifications, and evolving chess personalities.', '/images/nes/124/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/bc/Chessmaster_2000_cover.png', NULL, NULL),
(125, 'Chip \'n Dale: Rescue Rangers', NULL, NULL, 'Welcome the brave Disney\'s Rescue Rangers to your mobile phone! The Fat Cat together with Professor Nimnul have brought the city to the brink of anarchy. The villain\'s terror has paralyzed the police force, and the only ones able to restore order are the famous Rescue Rangers. Fat Cat has managed to kidnap Zipper, so the chipmunks have to rescue their friend and strike back. Fat Cat captured Zipper on his distant island, and the Rangers have to repair their legendary plane to get to it. Unfortunately, there are no spare parts, so the Rescue Rangers have to practice their investigating skills together with enterprising ones as only the Rangers plane can help them get to the Fat Cat\'s den.', '/images/nes/125/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/2/49612_front.jpg', NULL, NULL),
(126, 'Chip \'n Dale Rescue Rangers 2', NULL, NULL, 'Chip and Dale, those tiny but daring detectives, have learned of some terrifying news: The notorious criminal cat has escaped from prison and he\'s stolen the Urn of the Pharaoh. The Rescue Rangers must once again assemble to help crack the case of the missing urn and return the feline felon, Fat Cat, back to the slammer. Join Chip and Dale and the rest of the Rangers in their wacky new adventure. Help them explore the dangerous levels of the downtown restaurant and meet the exploding personality of Water Rabbit. Aid them on their escape through the freezing floors of the giant refrigerator. Search the ghostly walls of the haunted warehouse and find the final clue to unravel the secret headquarters of Fat Cat.', '/images/nes/126/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e1/Chip-and-dale-rescue-rangers-2-cover.jpg', 1, 2.5),
(127, 'Chubby Cherub', 'Obake no Q Tarou: Wan Wan Panic', NULL, 'A game where you\'ll chomp and chase all day! Chubby Cherub is a chivalrous little angel whose life is far from trouble-free. He gets bitten by dogs and pecked at by birds. Firecrackers are thrown at him and smoke puffs cover him from head to toe. And all because he wants to help people - and get some food to eat! Your skills can get Chubby Cherub out of trouble. In this fun-filled, fast-paced Game Pak, you and Chubby Cherub can go on endless adventures. And with you at the controls, Chubby Cherub can rescue his friend, perform his deeds, and make the day a cheerful one!', '/images/nes/127/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/25/Chubby_Cherub_Coverart.png', NULL, NULL),
(128, 'Circus Caper', 'Moeru! Oniisan', NULL, 'Thrills, action and fantasy! Circuses are always full of dreams and hope. A big circus comes to a city where Tim and his sister Judy live. However, they can afford only one ticket. Tim kindly gives it to the little girl, "Thanks, brother," Judy says. "Be sure to meet me at the exit after the show." But Judy fails to appear after the show. Mr. Magic, boss of the circus, looms in front of Tim who is anxiously waiting. "You\'d better give up on your sister," the malicious magician chuckles, as he tells the boy he kidnapped Judy. "Shucks!" Tim shouts. "You can\'t do that!" Tim rushes in to rescue his sister. Wicked clowns, tightrope artists, and ferocious animals attack Tim, who fights with a yo-yo, a hammer and a soccer ball. Go, Tim! Beat them all and get the key to the tent where Judy is confined. Rescue her as soon as possible!', '/images/nes/128/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1a/Circus_Caper_Cover.jpg', NULL, NULL),
(129, 'City Connection', NULL, NULL, 'Your mission: Race your speed demon car from New York to Tokyo in record time. With the cops and the enemy on your tail. They ambush you at every turn, pushing you off the road, leaping into your path. You outsmart them, firing an arsenal of oil cans you\'ve collected in the road, knocking them out and racking up more points. Cover every stretch of the highway in order to hit the next city. You can make it. Or can you?', '/images/nes/129/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1f/CityConnection_ArcadeTitleScreen.png', 1, NULL),
(130, 'Clash at Demonhead', 'Dengeki Big Bang!', NULL, 'Can a One-Man Engine of Destruction Prevent Mankind\'s Extinction? ', '/images/nes/130/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/57/Clashatdemonhead.jpg', 2, NULL),
(131, 'Classic Concentration', NULL, NULL, 'A picture can be worth a thousand dollars when you play this terrific television game. Classic Concentration has been faithfully reproduced as a fast-paced home game. It\'s a test of skill and memory as you try to match the prizes behind the numbers, then guess the rebus puzzle as the squares on the board are uncovered. This exciting game is one of the most popular, long-running shows on television and is great fun for the whole family! Concentration - it\'s a classic!', '/images/nes/131/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/1/4/49014_front.jpg', NULL, NULL),
(132, 'Cliffhanger', NULL, NULL, 'Based on the white-knuckle action-adventure movie starring Sylvester Stallone, Cliffhanger challenges you to brave thundering avalanches, icy cliffs, and the head-spinning heights of the Rocky Mountains while you combat a vicious group of well-armed, extremely dangerous fugitives. You\'ll hang on for dear life through 7 exciting levels requiring all your strength and skill just to survive. Experience wild new forms of game play like mountain climbing and cave exploration, along with all the excitement of all the incredible hand-to-hand and armed combat action. The adventure isn\'t over until you find $100 million in stolen loot, defeat the fugitives, and reunite with your friends!', '/images/nes/132/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fd/NesCliffhanger.jpg', 1, NULL),
(133, 'Clu Clu Land', NULL, NULL, 'Are you clever enough to unravel the mystery of Clu Clu Land? The evil Sea Urchin has hidden all the gold in Clu Clu Land in an underground mystery maze. It\'s up to you to find the gold before time runs out! But beware. The Sea Urchin will do everything in his power to stop you. He\'ll set up traps to trick you, like inviting you into his house where you\'ll be swallowed alive! Or bounce you against the Rubber Trap and land you flat on your back! But if you, or you and a friend, can control the Sea Urchin by stunning him with electric shockwaves, you just might find out where he\'s hidden the gold and move on to an exciting bonus round!', '/images/nes/133/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/41/Clu_Clu_Land_Cover.jpg', 1, NULL),
(134, 'Cobra Command', NULL, NULL, 'The most advanced Cobra attack helicopter ever built is at your command! You\'ll fly alone into a deadly no man\'s land where enemy choppers, tanks, soldiers, cannons and warships are all aiming to blast you out of the sky! Helpless hostages are counting on you to rescue them as you make your way to enemy headquarters for your final assault!', '/images/nes/134/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/af/CobraCommand_arcadeflyer.png', NULL, NULL),
(135, 'Cobra Triangle', NULL, NULL, 'You\'re in the hot seat and it\'s full speed ahead into a river of danger! Logs jam the river, whirlpools spin madly. You\'re under enemy fire, and it\'s a race against time! And this is just the start! Advance in skill and work your way up through the seven stages of Cobra Triangle. Collect pods in mid-air as you rocket over jumps. Outmaneuver the enemy as you frantically speed exploding mines to the safety areas. You thought you\'d seen it all. And then! Speeding boats actually drag helpless swimmers away! You\'re the protector. It\'s up to you to outwit the enemy and sink their rotten boats... before it\'s too late! Finally, you meet the monsters. Can you discover the secret of getting past them? And if you can, what dangers await you then?', '/images/nes/135/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b5/Cobratriangle.jpg', 1, 1.5),
(136, 'Code Name: Viper', 'Ningen Heiki Dead Fox', NULL, 'Deep in the jungles of South America, you\'re on the mission of your life. Your commander must think you\'re superhuman. He\'s instructed you to destroy a powerful drug cartel, free innocent hostages and take down the murderous Drug Lord. No sweat, right? As you slip into the drug cartel\'s bases, you find yourself hopelessly outnumbered. Your only chance is to get better firearms and ammo, and find your fellow agent with the bombs.', '/images/nes/136/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9a/Code_Name_Viper_cover.jpg', 2, 4),
(137, 'Color a Dinosaur', NULL, NULL, 'Now children ages 3 to 6 (or adults who don\'t want to miss out on all the fun) can spend hours of imaginative play coloring, patterning and creating dozens of bright, colorful dinosaurs... from the mighty Tyrannosaurus Rex to the lovable Triceratops, flying Pterodactyl and gigantic Brontosaurus - and many more. Youngsters can choose from among 16 different dinosaur outlines to decorate with 4 palettes, 11 colors and 9 patterns.', '/images/nes/137/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/79/Coloradino-box.jpg', NULL, NULL),
(138, 'Commando', 'Senjo no Ookami', NULL, 'Take control of Commando - "Super Joe" - and use your skill on a highly secret mission... challenging the Evil Empire Army in fierce guerilla warfare. Super Joe and your skill - armed only with Super Joe\'s rifle and unlimited ammunition, plus a hand grenade that requires replenishing. Your assignment... find and destroy the enemy... stopping attempts to dominate the world\'s population and resources. You must skillfully control Super Joe\'s venture into a deep, unexplored jungle region. Surprisingly, you and Super Joe find the enemy behind iron walls, on bridges to cross, and in trucks and jeeps that try to ram Super Joe.', '/images/nes/138/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/26/Commando_flyer.png', 1, 1.5),
(139, 'Conan: The Mysteries of Time', NULL, NULL, 'In an age unheard of, where barbarous kingdoms battle for survival in a savage and unforgiving land... you stand alone. You, the great and mighty Conan, born of pure Cimmerian blood, will claim what must be yours... the throne of Aquilonia. Yet, beware! The journey is a dangerous one, with enemies and challenges at every turn. Flying demons assault you, fiendish spirits lash out, a nymph challenges you. What is her plan? Only Conan dares to know the difference between subtle temptress and menacing foe. Now, explore the entire world in the true adventures of Conan, the greatest barbarian hero ever. Every detail of the Hyborean world has been captured in this multi-level super-action game. From the Forests of Asgard to the Tombs of Zamboula, you feel the fury, the passion, the power... that is Conan!', '/images/nes/139/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/2/2c/Mysteries_of_Time_cover.jpg/220px-Mysteries_of_Time_cover.jpg', 1, NULL),
(140, 'Conflict', NULL, NULL, 'The Red Wolves are on the prowl... Western Europe, 0530 hours, 15 July. A faraway rumble of machinery heralds the approach of what can only be a massive armored force. As you radio headquarters for reinforcements and air support, you lean forward out of the turret hatch of your M-1A1, hoping to catch a glimpse of the enemy in the distant horizon. Are those T-80\'s you see silhouetted in the first rays of the rising sun? And that roar - high over the clouds! Could that be a squadron of MIG-29\'s racing to intercept your incoming A-10 Thunderbolts? It doesn\'t really matter at this point. Your troops are committed. And there can only be one winner in CONFLICT!', '/images/nes/140/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/00/Conflict_NES_cover.jpg', NULL, NULL),
(141, 'Conquest of the Crystal Palace', 'Matendo Douji', NULL, 'Return to the once beautiful Crystal Palace where your father\'s kingdom was brutally overthrown by Zaras, king of the infernal plateau. Call upon your guardian dog. Zap and battle your way through the peaks of Mount Crystal. Find Kim at the astral-mart, she will help you along your way with tools and food needed to make this awesome journey. Step into the Realm of the Guardian, the walkway to impending doom. Acid rain is forecasted by QNN... so keep your eyes on the road ahead. Beware! You will fight the biggest, meanest enemies ever seen on the NES!  Investigate the Lair of Hungry Ghosts, gather special weaponry and gold. Enter the Gateway of Flame. Look out! The pathway has disappeared and there\'s only a moment between you and a sea of lava. These tasks and much more must be accomplished if you wish to regain your rightful throne!', '/images/nes/141/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4d/Conquest_of_the_Crystal_Palace_cover.jpg', NULL, NULL),
(142, 'Contra', 'Contra', NULL, 'The universe teeters on the brink of total annihilation at the hands of the vile alien warmonger, Red Falcon. Earth\'s only hope rests with you, a courageous member of the Special Forces elite commando squad. Your mission: Battle deep into the deadly Amazon jungle, where the Red Falcon and his galactic henchmen have transformed ancient Mayan temples into awesome monuments dedicated to mass destruction. A multitude of weapons, from rapid-fire machine guns to high-tech lasers are at your disposal as you sweat blood, fighting past 3-D mazes, underground security systems, and tropical forests surrounded by giant waterfalls and alien cannons. This is the ultimate test for the ultimate guerilla warrior. And if you survive, Earth survives!', '/images/nes/142/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/65/Contra_cover.jpg', 1, 1),
(143, 'Contra Force', NULL, NULL, 'Commandos Burn, Smith, Beans and Iron are a special forces team who have seen more than their fair share of action. Neo City is their post, now that a terrorist group known as D.N.M.E. is bombarding its citizens with a typhoon of a crime wave. The C-Force has been asked to stop them, no matter what. Take command solo or team up with a comrade in 2-player mode. Even if you go it alone, you can call on a backup soldier for spot support. Tap into your special forces training to devise unique battle plans and attack patterns, select weapons, and decide which soldier\'s individual strengths are best suited for the dirty deeds going down. You can switch commandos whenever the situation calls for it. Endure all 5 grueling missions, swarming with traps and terrorists, that take place in a warehouse, on a battleship, at a construction site, aboard a helicopter, and at C-Force headquarters. Encounter secret passageways, hidden rooms, aerial angle views and more. Every man is a walking arsenal with heavy-duty weaponry including rocket launchers, flame throwers, bazookas, rifles, land mines and time bombs. This mission is no cakewalk, but if it was, they wouldn\'t have given it to you. Hit it with all you\'ve got!', '/images/nes/143/cover.gif', 'https://upload.wikimedia.org/wikipedia/en/4/48/Contraforcecover.gif', 1.5, NULL),
(144, 'Cool World', NULL, NULL, 'It\'s an imaginary world that\'s real. It exists in another dimension, where cartoon characters, called Doodles are alive. It\'s Cool World.', '/images/nes/144/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4e/Cool_World_cover.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(145, 'Cowboy Kid', 'Western Kids', NULL, 'Sheriff Sam and Little Chief are coming to town in this delightful western adventure. COWBOY KID is a two-player simultaneous action-adventure for the entire family. Cowboy Kid has 4 MEGS of action packed into this NES cartridge. Players must learn to be appointed sheriff so they can rid the west of the scourge of evil. Can you bring these dudes to justice? Cowboy Kid rounds up arcade and adventure action for the wildest showdown in the west. Beware, rustlers! There\'s a new sheriff in town!', '/images/nes/145/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/5/49035_front.jpg', 2, NULL),
(146, 'Crackout', NULL, NULL, 'Use your reflexes to win battles on your way to figuring out the keyword. The central computer at the nerve center of Planet Selim has been infiltrated and its self-destruct system activated. The only way to stop the process is to reach the internal keyboard and enter in the correct 14-letter keyword. Each of these letters is hidden in the walls along the way. You must destroy the blocks of the computer\'s defense system to find out the keyboard letters and to reach the central keyboard. Your weapon in this block game is a superball. If you catch items that appear when you destroy enemies, you\'ll increase your power. Destroy blocks one after another to clear all the levels.', '/images/nes/146/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/18/Crackout_video_game.jpg', NULL, NULL),
(147, 'Crash \'n the Boys: Street Challenge', 'Bikkuri Nekketsu Shin Kiroku! Harukanaru Kin Medal', NULL, 'Sure they\'re from the wrong part of town, but Crash Cooney and his buds from Southside High romped all over the Spring Heel City Track Meet. Now all the rich mama\'s-boys from up on "The Hill" want a rematch - no rules, no-holds-barred. So they\'re takin\' it to the streets! Control your favorite team - Crash \'N\' The Boys of Southside High, or any of the three Hiller schools: Washington High, Lincoln High or Jefferson High. Plus you\'ll face the computer-controlled Team Thomley - a group of super athletes ready to trounce all the schools. Rage through 5 wild street events - 400 M Hurt-les, Hammer Golf, Water Slaughter, Skyline Scramble and Judo.', '/images/nes/147/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2a/Crash_N_the_Boys_Street_Challenge_NES_box_art.jpg', 3, NULL),
(148, 'Crystalis', 'God Slayer: Haruka Tenkū no Sonata', NULL, 'When the Great War engulfed the world, bringing civilization as we know it to an end, it ushered in a new era of sorcery and magic. The magicians used their magic to keep order, and peace reigned for a hundred years... Until an evil magician named Draygon, seeking to control and dominate his fellow men, began to use his powers for destruction and conquest. To combat Draygon\'s evil, the other magicians constructed four powerful swords of wind, fire, water and thunder. Used together, the swords would transform into the mightiest weapon ever created: the sword Crystalis. But Draygon seized the weapons and scattered them far and wide throughout the land. Only one hope remained: A young lad, himself a great magician, who had been imprisoned in a cave and frozen during the Great War. Though they knew it might destroy them, the wise magicians pooled all of their powers in an attempt to revive him. When the boy awoke - his mind a blank, even his name forgotten - they had vanished, leaving him to find his destiny in this strange new world. In CRYSTALIS, you play the role of the young magician, making your way through Draygon\'s hostile land in an effort to locate the weapons you will need to defeat him. Draygon\'s monsters and black magic will threaten you at every turn, but you must not falter - only you can deliver the world from his scourge of evil!', '/images/nes/148/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9b/Crystalisboxart.jpg', 9, 16.5),
(149, 'Cyberball', NULL, NULL, 'Bash your way to the goal post in Cyberball, the national sport of the 21st century. Massive Robots grapple for yardage on this metal-crunching gridiron of the future. And when the action gets critical, the ball explodes!', '/images/nes/149/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/12/Cyberball_Cover.jpg', NULL, NULL),
(150, 'Cybernoid: The Fighting Machine', NULL, NULL, 'Grab the controls of Cybernoid - the Fighting Machine - and destroy the squadrons of pirate craft. Upgrade your Cybernoid from a humble space battle fighter to a spectacular Fighting Machine. Blast your way forward firing bounce bombs and impact mines annihilating all in your path with your invincible CyberMace. It\'s a fast and furious orgy of video destruction!', '/images/nes/150/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/0/49050_front.jpg', NULL, NULL),
(151, 'Dance Aerobics', 'Family Trainer: Aerobics Studio', NULL, 'It\'s time to get up and get physical with Nintendo\'s DANCE AEROBICS. You and all your friends will have a blast working your way through 12 levels of aerobic conditioning and 64 separate aerobic routines. With Dance Aerobics, you\'ll feel better, you\'ll look better, and you\'ll have lots of fun. So don\'t just stand there, get out your Power Pad and shake, rattle and roll your way into a new you!', '/images/nes/151/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/1/49051_front.jpg', NULL, NULL),
(152, 'Danny Sullivan\'s Indy Heat', NULL, NULL, 'You\'ve played it in the arcades... Now play it at home! Settle into the cockpit of one of the world\'s most powerful racing machines. Listen to the engine roar as you accelerate to break-neck speeds in a matter of seconds. An engine, tire or fuel loss may slow you down, but you can count on the split second performance of your expert pit crew to get you back on the track for your winning lap. It won\'t be easy... After all, you\'re racing against Danny Sullivan! But use your winnings to hone your car\'s performance to a razor\'s edge, and the championship may be within your grasp. You\'ll work your way up through 8 grueling tracks to the ultimate challenge: the Tradewest Speed Bowl. If you\'re ready to race with the big boys, Indy car competition doesn\'t get any hotter than this!', '/images/nes/152/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/86/DannySullivansIndyHeat_arcadeflyer.png', NULL, NULL),
(153, 'Darkman', NULL, NULL, 'Once, he had a normal life, a beautiful girlfriend and a brilliant medical career - creating synthetic skin for accident victims. Then he was the victim himself, brutally attacked by sadistic criminals - his face and body burned beyond recognition. Now DARKMAN walks the night, searching for the woman he loves. A man who looks like a monster, he hopes to salvage his scorched flesh... and have revenge on those who destroyed his life!', '/images/nes/153/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f4/Darkman_front.jpg', 1, NULL),
(154, 'Dash Galaxy in the Alien Asylum', NULL, NULL, 'You\'re Dash Galaxy, Inter-planetary super hero. You\'ve fought your way out of tight spots a hundred times, in a dozen solar systems. But you haven\'t seen tight till you accidentally land in the mental ward of the universe. The Alien Asylum. You must make your way through the mysterious and deadly levels of the Alien Asylum and destroy its Overlords in the Control Complex. Your weapons? Your wits. And a supply of bombs, detonators, and life-support modules. You\'ll need them all to penetrate deadly force fields. Move "Mind Blocks" into key positions to advance. And greet a gruesome variety of space-age lunatics who want you to stay. Wild graphics. Insane action. Dash Galaxy in the Alien Asylum might just drive you crazy!', '/images/nes/154/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/da/DashGalaxyBoxart.jpg', NULL, NULL),
(155, 'Day Dreamin\' Davey', NULL, NULL, 'Set off with time-travelling Davey as he follows his wandering imagination on an epic journey through the past. Guide Davey as he picks up spells from Merlin the Magician, takes on Cyclops in ancient Greece, searches for Pandora\'s Box, and covers all the stops along the way to the final showdown - the Gunfight at the OK Corral! So pay attention and don\'t lose your hall pass - or this might go on your permanent record!', '/images/nes/155/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a2/DayDreaminDaveyNES.jpg', 2, NULL),
(156, 'Days of Thunder', NULL, NULL, 'Days of Thunder invites gamers to enter the high-pressure world of stock car racing in this adrenaline-packed multiplayer arcade title, putting gamers up against the film\'s lead characters, including Cole Trickle, Rowdy Burns and Russ Wheeler.', '/images/nes/156/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8b/Days_of_Thunder_cover_art_%28NES%29.jpg', NULL, NULL),
(157, 'Deadly Towers', 'Mashou', NULL, 'You are young Prince Myer, setting out to defend the ancient kingdom of Willner. Rubas, King of Devils, has built a castle in the north and is preparing to invade your kingdom. Ringing magic bells, he is calling out an army of the most terrifying creatures known (or unknown) to man. To defeat Rubas, you must journey to his palace and burn down his seven bell towers. On your quest, you will collect weapons and armor to defend yourself against rats and crawlers; bats, snakes and slime; demons, dragons and more. You\'ll need every ounce of help you can get. For you are all that stands between your people and the forces of darkness.', '/images/nes/157/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f3/Deadly_Towers_boxart.png', 3, NULL),
(158, 'Defender II', 'Stargate', NULL, 'Alien marauders are attacking your planet. They\'re kidnapping resident humanoids and turning them into mutants! You pilot your ship along the planet surface, blasting away. But first you go for the Landers - the most treacherous of the aliens. You race to the nearest Stargate and whoosh! You experience that eerie - time warp - feeling as you\'re transported to the other side of the planet. Only you, with the help of the Stargate, can save the planet against attack!', '/images/nes/158/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/ea/Defender_red_label.flyer.png', 1, NULL),
(159, 'Defender of the Crown', NULL, NULL, 'It is a time of lusty wenches and black-hearted villains. King Richard has been slain and all of England is thrown into civil war. Only one person can lead the country to peace. Lay seige to castles and raid enemy strongholds to recover the lost crown. Enlist the aid of Robin Hood and outwit the vile Normans to restore order to the war-torn land. Face your foes on the battlefield or in grand tournaments of chivalry.', '/images/nes/159/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/09/DefenderOfTheCrown.jpg', 1, NULL),
(160, 'Defenders of Dynatron City', NULL, NULL, 'Welcome to Dynatron City, where nobody\'s normal. Dr. Mayhem\'s atomic experiments produced six really cool superheroes... and an awful lot of enemies. Battle your way through sewers full of Gatomorphs and Loogiehawks, streets crawling with rabid robots, and the malevolent Mega Mall, where you have your showdown with Atom Ed, the floating head. And then you\'re ready for Dr. Mayhem himself! Monkey Kid\'s banana bombs waste Loogiehawks! Radium Dog snaps up big bargains in Mega Mall! Buzzsaw Girl\'s blades stop metal mutants!', '/images/nes/160/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1e/Defenders_of_Dynatron_City_Cover.jpg', NULL, NULL),
(161, 'Déjà Vu', NULL, NULL, 'Okay pal, here\'s the set-up: You wake up on the floor and you don\'t know who you are or how you got there. You\'re searching through a seedy Chicago casino, decorated with one somewhat familiar, but very dead, body. You gotta find out who you are and who iced this guy... In a hurry! Otherwise, the cops are gonna peg you for Murder One. Deja Vu. In this case, what you don\'t know can kill you!', '/images/nes/161/cover.png', 'https://upload.wikimedia.org/wikipedia/en/thumb/6/6a/Deja_Vu_cover.png/220px-Deja_Vu_cover.png', NULL, NULL),
(162, 'Demon Sword', 'Fudou Myououden', NULL, 'In a land of impossible evils... all paths lead to the Dark Lord! A beautiful princess cries out in terror, and a world despairs in darkness. Only you, the hero warrior Victar, can traverse chasms of fire and mountains of doom to battle the fiendish gatekeeper and confront the Dark Lord. In your cunning and skillful hands, the Demon Sword grows with a magical power more lethal than all the wretched weapons of the Dark Lord\'s legions. Gather your courage, grasp your blade and release the power that is yours to control!', '/images/nes/162/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/68/Demon_Sword_Cover.jpg', NULL, NULL),
(163, 'Desert Commander', 'Sensha Senryaku: Sabaku no Kitsune', NULL, 'Squint your eyes and imagine a relentless sun searing a hostile desert valley floor. Sniff the oily smoke and burning smell of yesterday\'s fierce combat drifting darkly through thin parched air... Desert Commander is a unique war simulation game, for one or two players, that creates realistic battlefield situations where your greatest weapons are intelligence and courage. Military hardware, troop strength and deployment options are completely variable at any of five levels of battle complexity and conditions. Yet with your forces evenly matched against those of your enemy, all planning, calculations and actions must be carefully considered to dominate today\'s contest. Your strategies should be brilliant; your tactics, flawless. Victory can be won only when you outwit your opponent - then conquer his armies or capture his headquarters. The enemy has been sighted. Your challenge has been accepted. The future of the free world now awaits your brave and steady command!', '/images/nes/163/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/2/21912_front.jpg', NULL, NULL),
(164, 'Destination Earthstar', NULL, NULL, 'Pull out of warp speed and lock on your Neutron torpedoes - now! Your 360 degree radar swipe has detected hostile Kojan fighters. Sight \'\'em and shoot \'em, one by one. Then hyperwarp toward their deadly Base Station and overtake it... from the inside! Blast alien spaceships with your front-end lasers and heat-seeking rear-firing missiles! Mission complete? Hardly. It\'s on to the next star system, where more enemies lie waiting. Waiting to keep you from your long awaited return to... Destination Earthstar!', '/images/nes/164/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/1/49061_front.jpg', NULL, NULL),
(165, 'Destiny of an Emperor', 'Tenchi o Kurau', NULL, 'In the era known as the Later Han, the people of China were plagued by a bandit horde called the Yellow Scarves. They searched for a hero that could amass a force strong enough to conquer these cutthroats and thieves. At that time, three men were separately gaining power by attaining the service of many Warlords. They each planned on ridding their country of the Yellow Scarves, but when that task is finished there will only be room for one Emperor. Return to a time of sword and honor, where an oath was signed in blood. Master the strategies in this role-playing game for the NES.', '/images/nes/165/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/31/Destiny_of_an_Emperor_Cover.jpg', 18, NULL),
(166, 'Devil World', NULL, NULL, 'Lost in the maze of Devil World, Tamagon the Dragon has to steer clear of the Devil, his nasty co-Devils, and his treacherous helpers, Medaman, the Fried-Eggman and Bon-Bon, and ward off their attacks by breathing fire. After each round, the maze scrolls up, down, right or left. The Devil decides the direction and points with his finger. As you guide Tamagon through the maze, you also have to avoid being sandwiched between the walls.', '/images/nes/166/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1d/DevilWorldBoxart.jpg', NULL, NULL),
(167, 'Dick Tracy', NULL, NULL, 'Ace detective Dick Tracy pored over the crime files and mug shots that littered the desk in his dimly lit office down at police headquarters. "This crime wave has to be the work of Big Boy Caprice," he thought to himself. "I can smell his greasy handiwork behind each of these cases. But, I need to get some hard evidence on him. If only I can nab some of his hoods - Itchy, Flattop and the rest. I\'d rearrange their thinking and have them singing like that nightclub temptress, Breathless Mahoney. Then I could put Caprice behind bars for good." Suddenly, Tracy\'s two-way wrist radio seized the detective\'s attention... "Calling Dick Tracy, calling Dick Tracy." He sprang to his feet and burst into the squad room shouting "O.K., boys, let\'s go. This could be our big break!"', '/images/nes/167/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/3/24833_front.jpg', 2.5, 3.5),
(168, 'Die Hard', NULL, NULL, 'Dozens of terrorists. A handful of hostages. World class weapons. And a barefoot cop with very little time. You\'re John McClane, a tough New York cop, alone, tired and barefoot. Terrorists have taken over the building, they\'ve got hostages, including your wife, and the L.A. cops don\'t know about you or the terrorists... yet! Intelligent enemies: The terrorists don\'t stay in one place and they track you from level to level. Exclusive "RealVision" feature: See only what your character can see. Use stairs, elevators and air vents to go from floor to floor, evade enemy fire, or launch surprise attacks. Explosive weapons include Uzis, flash bombs, C4 explosives, a rocket launcher and more. Multiple endings for unpredictable excitement and replayability!', '/images/nes/168/cover.jpeg', 'https://upload.wikimedia.org/wikipedia/en/c/ce/Die_hard_nes_cover.jpeg', 3, NULL),
(169, 'Dig Dug II', NULL, NULL, 'DIG DUG has decided to chill out from the pressures of the real world by taking a long overdue vacation on a beautiful Caribbean island. "At last," he thinks to himself, "sun, sand, surf, and no more hassles from those miserable pests Pooka and Fygar!" Lying in a hammock between the graceful palm trees, he drifts off into a blissful dream of beautiful bikini clad native girls catering to his every wish. But just when he thinks he\'s got it made in the shade, along come his troublesome enemies to turn his peaceful paradise into a tropical nightmare. Help DIG DUG rid the island of these irritating intruders and bring tranquility back to his vacation by the sea!', '/images/nes/169/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/3/41953_front.jpg', 1, NULL),
(170, 'Digger T. Rock: Legend of the Lost City', NULL, NULL, 'Ready for tunnels of underground fun? Our hero, Digger T. Rock, is mining for a legendary lost city - and he needs you to dig in and help out! Burrow through mysterious caverns, each one a "mine-boggling" maze of unknown dangers. Battle fierce foes like dinosaurs, ghouls and cranky cavemen with clubs. Collect rocks, dynamite, ladders and jewels, and use them wisely. Dig deep to uncover secrets, like how to open cavern doors - and how to reach them before they slam shut! Dare to dig down to the deepest, most dangerous cavern... and discover what lies beyond!', '/images/nes/170/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/4/49064_front.jpg', 1, 1.5),
(171, 'Dirty Harry', NULL, NULL, 'Dirty Harry is an Action game, developed by Double Helix Games and published by Warner Bros. Interactive Entertainment,  which was cancelled before it was released.', '/images/nes/171/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/6/49066_front.jpg', NULL, NULL),
(172, 'Disney\'s Aladdin', NULL, NULL, 'Hang on to your carpet for ACTION and FUN! Aladdin slashes his shining scimitar to fight through Agrabah, escape the Sultan\'s dungeon, survive the fiery Cave of Wonders, snatch the Genie\'s Lamp and save Princess Jasmine from the evil Jafar! Aladdin battles thieves and desert warriors, and barely dodges danger on his high-speed carpet. Palace Guards drop their drawers and camels spit dirt wads. Aladdin ping-pongs like a pinball INSIDE the Genie\'s Lamp!', '/images/nes/172/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0d/Aladdingenesis.jpg', NULL, NULL),
(173, 'Disney\'s Beauty and the Beast', NULL, NULL, 'A self-centered prince is transformed into a hideous beast by the magic of an enchantress. What\'s more, all his servants have been turned into household objects.', '/images/nes/173/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/7/48927_front.jpg', NULL, NULL),
(174, 'Disney\'s Darkwing Duck', NULL, NULL, 'The kingpins of crime are at it again! The mysterious criminal organization F.O.W.L. has hatched a plan to take control of the peaceful city of St. Canard. Six of their most heinous henchmen are running rampant through the city and only the daring Darkwing Duck can bring them to justice! Join Darkwing as he explores the woods to weed out Bushroot\'s evil plan. Search the warehouses along the wharf for Mega Volt and pull the plug on an electrifying scheme. Track down all six of FOWL\'s crafty criminals and then prepare yourself as Darkwing squares off against the sinister Steelbeak in his fiendish floating fortress!', '/images/nes/174/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/0/2770_front.jpg', NULL, NULL),
(175, 'Disney\'s The Jungle Book', NULL, NULL, 'Get down to the bare necessities of life... and escort Mowgli through the jungle to the safety of the human village. Fight the boggle-eyed snake, Kaa, and defeat Shere Khan the hungry tiger in this exciting adventure based on Disney\'s classic! It\'ll drive you ape crazy!', '/images/nes/175/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1f/Jungle_Book_game_cover.jpg', NULL, NULL),
(176, 'Disney\'s The Lion King', NULL, NULL, 'Disney\'s The Lion King brings to life the majesty of Africa through the tale of Simba, a lion cub faced with the challenging transition to maturity. Driven into the wilderness by his evil uncle Scar, Simba finds salvation with Pumbaa the warthog and Timon the Meerkat, and his education begins.', '/images/nes/176/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/2/28582_front.jpg', 2, 2.5),
(177, 'Disney\'s The Little Mermaid', NULL, NULL, 'Ariel, the little mermaid who became human, and Eric, prince of the land, are head over fins in love. But Ariel\'s friends are in deep trouble! Ursula, the evil Witch of the Sea, has cast a spell on all watery creatures. If Ursula\'s not stopped, she\'ll take over the ocean! To save her friends, Ariel dives into the sea, becoming a mermaid again. But the water is full of jellyfish, lobsters, eels, and blowfish. Ariel quickly snares the fierce fish, while diving and leaping to escape danger. At Ursula\'s palace, the wicked witch attacks with her most treacherous tricks. Can Ariel defeat her in time to save the sea? It\'s the catch of the year! Swim to Ariel\'s favorite music, including the Academy Award-winning Under the Sea. Gasp as Ariel tackles slithery eels, snarling sharks, walruses and the amazing Soldierfish. Find out if Ariel can ever return to Eric. Your whole family will fall hook, line, and sinker for The Little Mermaid!', '/images/nes/177/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f6/Little_Mermaid_game_cover.jpg', NULL, NULL),
(178, 'Donkey Kong', NULL, NULL, 'Can you save Mario\'s girl from the clutches of Donkey Kong? Donkey Kong has kidnapped Mario\'s girlfriend Pauline and taken her to the top of a construction site. It\'s up to you to help Mario save Pauline before time runs out. But it won\'t be easy. Donkey Kong will do everything in his power to stop you. He\'ll throw barrel bombs, flaming fireballs and anything else he can get his hands on. So if you\'re looking for action, don\'t monkey around. Get the original Donkey Kong from the Nintendo Arcade Classics Series!', '/images/nes/178/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/3/3f/Donkey_Kong_arcade_at_the_QuakeCon_2005.png', 17, 25),
(179, 'Donkey Kong 3', NULL, NULL, 'Donkey Kong is at it again! This time he\'s loose in the greenhouse. And he\'s got company: a swarm of very pesky bees! It\'s up to you to get Donkey Kong out of the greenhouse and exterminate the bees... without hurting the flowers. But that\'s easier said than done! Because Donkey Kong has plenty of coconuts to hurl at you, and those bees know just where to sting you so it hurts. But, if you keep your wits about you, you\'ll score lots of points and have lots of laughs in the best Donkey Kong of them all... DONKEY KONG 3!', '/images/nes/179/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/3/3f/Donkey_Kong_arcade_at_the_QuakeCon_2005.png', 1, NULL),
(180, 'Donkey Kong Classics', NULL, NULL, 'What\'s more fun than a barrel of monkeys? A Donkey Kong double feature! In DONKEY KONG you\'ll duck barrel bombs and flaming fireballs as you help Mario save his girlfriend Pauline from the clutches of Donkey Kong. In DONKEY KONG JR., you\'ll join forces with these madcap monkeys to help Donkey Kong Jr. rescue his father from Mario\'s prison. Are you ready for laughter? You\'d better be. Because this double dose of monkey business will have you rolling in the aisles!', '/images/nes/180/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/6/21916_front.jpg', 2, NULL),
(181, 'Donkey Kong Jr.', NULL, NULL, 'Mario has gone mad! He\'s turned the tables on Donkey Kong and locked him in a cage. It\'s up to you, as Donkey Kong Jr., to rescue your father by stealing Mario\'s set of keys. But it won\'t be easy. You\'ll have to fight off ape-eating Snapjaws, jump onto moving islands and break through a jungle of vines to get to the keys that will free Donkey Kong. Can you handle the action? Because this off-the-wall monkey business will have you going bananas!', '/images/nes/181/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2b/Donkey_Kong_Jr._%28arcade_game%29.png', 1, 1),
(182, 'Donkey Kong Jr. Math', NULL, NULL, 'Are you good with numbers? Well, here\'s your chance to prove it. Use your brains to help Donkey Kong Jr. add, subtract, divide and multiply correctly. And to make it more of a challenge, you\'ll have to climb up chains, jump on islands and choose the right answers in the least amount of time. Play against the computer or challenge a friend. Either way, you\'ll learn a lot, and no one will ever make a monkey out of you. At least when it comes to numbers!', '/images/nes/182/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/88/Donkey_Kong_Jr_Math_box.jpg', 1, 1),
(183, 'Double Dare', NULL, NULL, 'Double Dare is a Miscellaneous game, developed and published by GameTek,  which was released in 1988.', '/images/nes/183/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/94/Double_Dare_NES_Game.jpg', NULL, NULL),
(184, 'Double Dragon', NULL, NULL, 'Double Dragon is the story of Billy and Jimmy Lee, twin brothers who learned to fight on the cold, tough streets of the city. Their expert knowledge of the martial arts combined with their street smarts, has made them both formidable fighting machines. But now Billy is faced with his greatest challenge. Marian has been kidnapped by the Black Warriors, the savage street gang of the mysterious Shadow Boss! Using whatever weapons come to hand - knives, whips, bats, rocks, oil drums, even dynamite - Billy must pursue the gang through the slums, factories, and wooded outskirts of the city to reach the hideout for his final confrontation with the Shadow Boss... his brother Jimmy!', '/images/nes/184/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e6/Ddragon_chirashi.jpg', 1, 3),
(185, 'Double Dragon II: The Revenge', NULL, NULL, 'The Double Dragons - Billy and Jimmy Lee - are back to avenge the loss of Marion! In their quest to defeat the evil Shadow Warriors, the martial arts duo are challenged in 9 incredible missions, facing ruthless street gangs, nunchaku-toting ninja and giant mutant warriors! The non-stop action winds its way through construction sites, alleyways and underwater hideouts complete with secret elevator shafts, spiked ceilings and razor-sharp mechanical claws! And in a bonus mission, never before seen, the duo\'s worst fear becomes reality as they fight the ultimate battle between good and evil. A battle where not only their lives are at stake, but the fate of the entire world!', '/images/nes/185/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ef/DD2_Flyer.jpg', 1.5, 2),
(186, 'Double Dragon III: The Sacred Stones', 'Double Dragon III: The Rosetta Stone', NULL, 'Only one man knows the real story behind Marion\'s disappearance... and he\'s dead! Now the Double Dragons must rely on a mysterious fortune teller to locate Marion and her ransom - the Sacred Stones of Power! You\'ll fend off vicious street thugs, evil ninja warriors, deadly gladiators, Manchurian barbarians and more! Defeat your most dreaded enemies and out of pure respect they\'ll join your side - adding their Iron Claws and Shangai Stars to your all-new martial arts maneuvers - like the awesome mid-air somersault. Double Dragon III. If you survive the action, you\'ll rescue Marion, retain your honor and discover the truth behind the Sacred Stones. If you fail...', '/images/nes/186/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2e/NES_Double_Dragon_III_cover.jpg', NULL, NULL),
(187, 'Double Dribble', NULL, NULL, 'Finally, it\'s here! The basketball game you\'ve dreamed of. The first home game with 5 on 5, full court, board-banging action. A contest with graphics so real, they\'ll knock your high-tops off. Ready to captain your team to the title, you bolt into the arena with electricity in your fingers and ice in your veins. Intensity builds. The crowd roars. The game is yours to win or lose. But to win you\'ll need speed in the lane, touch for three-pointers, muscle to power past picks, and the skill to crash the glass. And, if you break free underneath - watch out! Because now you can power home a rim-rockin\' slam! So pull up your shorts and take a deep breath. It\'s crunch time. Time to show your stuff!', '/images/nes/187/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/25/DoubleDribble_arcadeflyer.png', 1, 1.5),
(188, 'Dr. Chaos', NULL, NULL, 'Michael must rescue his brother, Dr. Chaos, from the weird results of a scientific experiment gone haywire. But the haunted house is filled with bloodthirsty creatures, booby traps, and life force challenges. They try to prevent Michael from finding the special weapons and vials of secret strength he needs to save Dr. Chaos and himself! A dangerous maze of corridors guarded by evil creatures and monsters! Mysterious rooms that conceal both dangers and life-saving weapons! Space warp to another time and place where death and destruction await! Thriller graphics! Graphic score pad to track life force, weapons found, and weapons in use!', '/images/nes/188/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/43/Drchaos_boxart.jpg', NULL, NULL),
(189, 'Dr. Jekyll and Mr. Hyde', 'Houma ga Koku', NULL, 'The classic tale of horror comes to vivid life in this fast-moving video game! Dr. Jekyll succeeds in separating a man\'s personality into GOOD and EVIL - but he experiments on himself! Now, without warning, the kind Dr. Jekyll transforms into the monstrous Mr. Hyde. Follow Dr. Jekyll as he fights off enemies in hazardous 19th century London, only to be suddenly plunged into Mr. Hyde\'s World of Demons! Here Mr. Hyde must battle attacking monsters and ghouls with his secret weapon - the deadly PSYCHO-WAVE! But the excitement doesn\'t end there - as you do battle in each of the two worlds of this game, the worlds themselves are struggling with each other for control! Which will triumph - GOOD or EVIL? DR. JEKYLL or MR. HYDE?', '/images/nes/189/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/9/21919_front.jpg', 3, NULL),
(190, 'Dr. Mario', NULL, NULL, 'It\'s Dr. Mario for an intense new challenge! Mario throws multi-colored vitamin capsules into a bottle that contains an ugly variety of nasty viruses. You can move, shift or spin capsules as they fall. Arrange them to align with other capsules on top of the virus. If you can get four or more of the same color in a row, POOF! They disappear! Destroy all of the viruses in the bottle and you progress to the next round where things get even more difficult!', '/images/nes/190/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f8/Dr._Mario_box_art.jpg', 1, 11.5),
(191, 'Dragon Fighter', NULL, NULL, 'It is a dark and disastrous time for the good people of the peaceful kingdom of Baljing. Zabbaong, a vicious and jealous warlock, has unleashed his evil hordes upon the land, ransacking and pillaging everything in their path. The country is in ruins and the people despair. However, a brave warrior has been summoned by Baljing\'s protector, the Dragon Spirit, to battle Zabbaong\'s evil armies and bring peace once again to the land. Engage the enemy as a valiant gladiator with an onslaught of muscle and steel, or do battle in the air, as you become a fierce and formidable dragon. You\'ll encounter everything from robots and giant centipedes to monstrous sea serpents, as you guide this courageous warrior and his dragon alter ego through the six stages of Zabbaong\'s sinister henchmen and make your way to the final encounter with the wicked sorceror himself! All the good people of Baljing are counting on you!', '/images/nes/191/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/9/1/49091_front.jpg', 1, NULL),
(192, 'Dragon Power', 'Dragon Ball: Shenron no Nazo', NULL, 'The adventure begins! The quest is on for the dragon\'s seven crystal balls. The prize: your greatest wish! Together with Goku and Nora you must face the obstacles that lead to each of the balls. Each obstacle seems greater than the last, but with your skill and the help of Swift Cloud and Magic Pole, anything is possible. It\'s Dragon Power!', '/images/nes/192/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/8/49088_front.jpg', 1, NULL),
(193, 'Dragon Spirit', NULL, NULL, 'Amur, the spirit of the dragon, lives within you. As the winged creature that breathes mega-tons of fire, your mission is revealed. Rescue Princess Alicia from Zowel, Demon of Darkness. So take to the skies and destroy enemy creatures with breath and fireballs. Add dragon heads and incredible power-ups. Confront Zowel in a Super Battle of Beasts. (Careful not to breathe on Alicia).', '/images/nes/193/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/cb/Dragon_Spirit_flyer.png', 1, 4.5),
(194, 'Dragon Quest', 'Dragon Warrior', NULL, 'All is darkness. The Dragon-lord has captured the Princess and stolen Erdrick\'s powerful ball of light. You are Erdrick\'s heir. To you has fallen the most dangerous task - to rescue the King\'s daughter and recover the mystic ball of light. Search out the Dragon-lord\'s lair and face your destiny. In this role-playing adventure you are the Dragon Warrior!', '/images/nes/194/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/84/Dragon_Warrior.jpg', NULL, NULL),
(195, 'Dragon Quest II', 'Dragon Warrior II', NULL, 'Long ago, a descendant of Erdrick the Great defeated the Dragonlord and recovered the mystical ball of light in Alefgard. Under the rule of his children and their descendants there was prosperity throughout the land for generations. One day, however, this peace was shattered by the wicked Sorcerer Hargon. Now it is time for you to claim your birthright as the Prince of Midenhall, for Erdrick\'s blood also flows through your veins. With the Prince of Cannock and the Princess of Moonbrooke by your side, you are about to embark on a most adventurous journey. Use your strength and cunning for you are about to enter the world of Dragon Warrior II.', '/images/nes/195/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fd/Dragon_Warrior_II.jpg', NULL, NULL),
(196, 'Dragon Warrior III', 'Dragon Quest III: And thus into Legend...', NULL, 'The Legacy of Erdrick Continues...', '/images/nes/196/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/9/7/49097_front.jpg', 28.5, 36),
(197, 'Dragon Warrior IV', 'Dragon Quest', NULL, 'As the legend of Erdrick slips into the past, it\'s time to begin anew. Ragnar, the King\'s General. Alena, the Princess. Taloon, the Merchant. Nara & Mara, the Dancer and the Fortune Teller. A Hero. Fulfill a prophesy. Is this your destiny? Experience this epic, multi-quest RPG!', '/images/nes/197/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/5/21925_front.jpg', 18, 41.5),
(198, 'Dragon\'s Lair', NULL, NULL, 'You play the heroic Dirk the Daring, a valiant knight on a quest to rescue the fair princess from the clutches of an evil dragon. Control the actions of the daring adventurer and find your way through the castle of a dark wizard who has enchanted it with treacherous monsters and obstacles. In the mysterious caverns below the castle, your odyssey continues against the awesome forces that oppose your journey to the dragon\'s lair. Dragon\'s Lair is a fully animated classic arcade game from legendary animator Don Bluth.', '/images/nes/198/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/1/11941_front.jpg', 1, 2.5),
(199, 'Dropzone', NULL, NULL, 'Dropzone is a Strategy game, developed by Sparkypants Studios and published by Gameforge,  which was released in 2017.', '/images/nes/199/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/1/28571_front.jpg', NULL, NULL),
(200, 'Duck Hunt', NULL, NULL, 'Your trusty hunting dog wades into the marshes to flush out your prey. Your fingers tighten around your Zapper light gun. Suddenly, there\'s a duck in the air! You\'ve only got three shots to bag this duck, and if you miss, even your dog laughs at you! But become a sharp shooter, and you\'ll progress to the next round where two ducks fly up at the same time. And then you\'re on to the ultimate challenge: Clay Shooting, where you\'ll compete in a wild clay-pigeon shooting contest. Play DUCK HUNT and discover you can have lots of laughs and be challenged at the same time!', '/images/nes/200/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/14/DuckHuntBox.jpg', 1, 21.5),
(201, 'DuckTales', 'Wanpaku Duck Yume Bouken', NULL, 'Embark on an authentic DuckTales adventure, as Scrooge McDuck and his three nephews; Huey, Dewey and Louie travel to exotic locations throughout the world in their quest to retrieve the five Legendary Treasures.', '/images/nes/201/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/64/DuckTales_NES_Cover.png', 1, 2),
(202, 'DuckTales 2', NULL, NULL, 'Scrooge McDuck is hot on the trail of the richest adventure ever. Pieces to the map of the Lost Treasure of McDuck have been scattered across the globe, and Scrooge must find them before the greedy Flintheart Glomgold grabs them. It\'s going to be a race to the finish as both of them try to find the treasure and become the richest duck in the world! Join Scrooge and his nephews as they explore the ancient pyramids of Egypt and do battle with swash-buckling pirates in the Bermuda Triangle. Help them search the haunted halls of an ancient Scottish castle and scale the watery heights of Niagara Falls. Aid Scrooge in his quest for the secret of the island of Mu and you\'ll gain the final clue to unravel the hidden location of the Lost Treasure of McDuck!', '/images/nes/202/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/15/Ducktales_2_cover.png', 1, 2),
(203, 'Dungeon Magic: Sword of the Elements', 'Dungeon & Magic: Sword of Element', NULL, 'A dark storm veils the sun, twisting trees and sowing terror. Deep in the earth the devil Darces emerges to rule over all. Join in the quest for Tores, the only sword with magic enough to smite Darces the Overlord. Search ancient caves, dank dungeons and mysterious mazes for clues to the age-old prophecy. Receive blessings and cast wondrous spells. Every step brings danger, every town holds a secret. If at last you understand, you can call the elements to your ultimate triumph!', '/images/nes/203/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/0/3/49103_front.jpg', 15, NULL),
(204, 'Dusty Diamond\'s All-Star Softball', 'Softball Tengoku', NULL, 'Mudville was the sight of the classic poem, "Casey at the Bat." But Mudville has another - and some say even greater - claim to fame. Each year, the world\'s wildest softball players gather in Mudville to battle for the World\'s All-Star Softball Championship. Can your team - with a little advice from Dusty Diamond, the legendary all-time All-Star - play fiercely enough to win? You\'ll have to battle your way through five tournament games to challenge last year\'s champions, the awesome "Amazons." Will they triumph again? Choose your team... and play ball!', '/images/nes/204/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/0/5/49105_front.jpg', 3, NULL),
(205, 'Dynowarz: Destruction of Spondylus', NULL, NULL, 'Something was terribly wrong in the distant man-made Spondylus Solar System. One by one the planets\' central life support computers had been infected with a life-threatening virus while the planet surfaces had been overrun with giant computerized dinosaurs known as Robosaurs. Under attack in his laboratory on Alpha Planet, Professor Proteus, the mastermind of the Spondylus System and founder of the Robosaur project suddenly realized that this deadly sabotage could only be the work of his former partner, the deranged Dr. Brainius. Years earlier, the doctor had fled Alpha Planet after Professor Proteus had exposed him for performing forbidden robotic experiments on human subjects. At last, he had returned to seek his revenge using the Professor\'s own creations! But, little did he realize that Proteus had been hard at work for the past few years perfecting the ultimate robosaur, Cyborasaurus! There was only one hope to save the Spondylus System. Cyborasaurus must be unleashed! The DYNOWARZ must begin!', '/images/nes/205/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/4/4c/Dynowarztitle.PNG', 1, NULL),
(206, 'Elevator Action', NULL, NULL, 'The ups & downs of the spy game! You\'re a macho master spy who must sneak through a heavily guarded enemy defense building to steal top-secret government documents!', '/images/nes/206/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/ee/Elevator_Action.png', 4, NULL),
(207, 'Eliminator Boat Duel', NULL, NULL, 'Get ready, get psyched, get turboed for the thrill of your aquatic life as you make a splash into the racing scene. Your dream is to dethrone the Emperor of foul play, the King of sore losers, the legendary Power Boating League World Champion - Disaster Don. He\'s as cunning as he is rotten and he\'ll stoop to anything to stop you from getting the glory. You\'ve waited for this all your life. You\'ve dreamed of the leanest, meanest, radical raspberry red Eliminator, the likes and sounds of which the world has never, ever seen before - a boat with such a thunderous roar the competitors quake but the beach babes swoon - this boat could make you King of the Ocean!', '/images/nes/207/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a3/Eliminator_Boat_Duel_cover.jpg', NULL, NULL),
(208, 'Elite', NULL, NULL, 'Command your Cobra spaceship in a fantastic voyage of discovery and adventure, a supreme test of your combat , navigational and entrepreneurial skills. Trade between countless planets, using the proceeds to equip your ship with heat-seeking missiles, beam lasers and other weapons - corporate states can be approached without risk, but unruly anarchies may be swarming with space pirates. Black market trading can be lucrative but could result in skirmishes with local police and a price on your head! However you make your money, by fair means or foul, you must blast onwards through space annihilating pirate ships and hostile aliens as you strive to earn your reputation as one of the Elite!', '/images/nes/208/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/4/4/43344_front.jpg', NULL, NULL),
(209, 'Excitebike', NULL, NULL, 'This thrilling Nintendo programmable game lets you vary the obstacles, change the sequence of events, and increase the racing challenge time and time again! You\'ll start out in a Nintendo designed preliminary race, and move through a series of increasingly difficult challenge races! You\'ll face crazy curves, hairpin turns, daredevil jumps, and some very fierce motorcross competition, as you race your bike towards the checkered flag. This thrilling test of driving strategy and skill will keep you riveted to the screen for hours!', '/images/nes/209/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f8/Excitebike_cover.jpg', 1, 1),
(210, 'F-117A Stealth Fighter', NULL, NULL, 'Strap yourself into the cockpit of the world\'s most elite fighting weapon! It\'s the F-117A Stealth Fighter. And once you fly it, you\'ll see why no other flight simulator compares! Incredible 3-D graphics will keep you glued to your screen as you experience the same intense pressures that gripped America\'s Gulf War pilots. Penetrate enemy airspace without being seen! Tangle with the enemy in treacherous dogfights! Launch awesome firepower against fierce opponents! Your wait is over. The ultimate weapon has arrived. Now it\'s your turn to pilot the real Stealth Fighter!', '/images/nes/210/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/dc/F19stealthfighter_box_front.jpg', NULL, NULL),
(211, 'F-15 Strike Eagle', NULL, NULL, 'Strap into your ejection seat and get ready for challenging and exciting modern jet fighter combat with F-15 Strike Eagle! Fly combat missions, engage enemy aircraft, and destroy enemy ground targets in the skies of Southeast Asia, Europe and the Middle East. All the sophisticated tools of modern electronic air warfare are available including computer assisted targeting, heads-up display, airborne radar and ground tracking target display maps.', '/images/nes/211/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/4/31234_front.jpg', NULL, NULL),
(212, 'Family Feud', NULL, NULL, 'Family Feud Deluxe Edition for the 3DO system brings you over 4,000 new survey questions taken right from the hit television show. Play alone or with up to nine friends. Full motion video families battle against each other in the fully rendered Family Feud studio. After the host\'s digitized voice reads the answer, ring in to guess the top survey responses from people across the country.', '/images/nes/212/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/0/21940_front.jpg', 1, NULL),
(213, 'Faria: A World of Mystery and Danger', 'Faria Fuuin no Tsurugi', NULL, 'If you\'re ready for mind-blowing action... If you\'re prepared to test yourself against the most fearsome forces of evil... Then it\'s time to enter the world of FARIA! Slash your way through a relentless onslaught of bloodthirsty monsters! Challenge a cruel and cunning Wizard with your magic and your wits! The King\'s daughter has been kidnapped by a fiendishly powerful Wizard for his bride. The soldiers and magicians of the King are all powerless to rescue her. And now you have come from a distant land to answer the king\'s desperate pleas for help! FARIA is action-adventuring fun for the entire family!', '/images/nes/213/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/4/49124_front.jpg', 10, NULL),
(214, 'Faxanadu', NULL, NULL, 'You are the elves\' last hope. Outside the town walls lurk monsters with the power to destroy anything in their path. Inside the walls, water and time are running out. Soon the ancient elf town of Eolis will vanish into eternity. Only you can save Eolis. No one else dares to venture beyond the walls, onto the World Tree, where towns and fortresses precariously await the whims of fate at the hands of the Evil. You are searching for the water source and for an antidote to the poison that makes the water undrinkable. To find them you\'ll need gold and food and magic, speed with a sword... and luck. Every town holds a new mystery, every fortress a new danger. Merchants will sell you magic and valuable tools, but it\'s up to you to figure out what you need. Long, secret mantras help you slip through the mists, but will you survive the next challenge? This is Faxanadu, the legend, the adventure - the incredible journey on the World Tree!', '/images/nes/214/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/6/49126_front.jpg', 5.5, 6.5),
(215, 'Felix the Cat', NULL, NULL, 'The World\'s Most Famous Cat is off on his greatest adventure yet! Felix must rescue his girlfriend Kitty from his oldest adversary - The Professor. You see, The Professor has kidnapped her and demands Felix\'s Magic Bag of Tricks as ransom. Now it\'s up to Felix to save the day! Join Felix on his worldwide search - fly a monoplane across mountains, delve into the ocean depths in a submarine and race across bizarre landscapes in a wild and wacky one-wheeled car! All of these provided by the Magic Bag of Tricks! But beware! The Professor has his crew out to stop Felix. Rock Bottom, Poindexter and Master Cylinder can\'t wait to try their luck at capturing our courageous hero. So get set for incredible action in a world where imagination is all a hero needs!', '/images/nes/215/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/a/a9/FelixNESBoxart.JPG', 1, 1);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(216, 'Ferrari Grand Prix Challenge', 'Ferrari', NULL, 'Drive for the world\'s most famous auto racing team in the ultimate F1 competition... FERRARI GRAND PRIX CHALLENGE. From the qualifying laps to earn starting position, to multi-G cornering, to "every-second-counts" pit stops... get closer to real life Grand Prix racing than any game has taken you before. Challenge 25 Formula One drivers for the ultimate reward in auto racing... THE GRAND PRIX WORLD CHAMPIONSHIP!', '/images/nes/216/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/1/46191_front.jpg', 3, NULL),
(217, 'Fester\'s Quest', NULL, NULL, 'It\'s just a kidnapping. Of an entire day. By an alien UFO! Will Fester sit still for this? The quest begins. For starters, take on slime replicators, skeeters, globules and giant scorpions. Your health is at stake, not to mention your life! Will you whip the Alien Bosses or will they whip you? Lucky for you, this is a family affair. And what a family! Find your way to Thing and help is right at hand. In trouble? Just ring for Lurch. He\'ll give those aliens trouble with a capital "L". The fate of the whole city is in your hands, and we\'ve saved the worst for last!', '/images/nes/217/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/2/21942_front.jpg', 2, 3.5),
(218, 'Final Fantasy', NULL, NULL, 'An evil shroud covers the world in darkness. You must restore the powers of earth, wind, fire and water to the Four Orbs. Create your own band of 4 Light Warriors from fighters, thieves, martial artists, and magicians. You\'ll need all their skills to triumph in this massive role-playing adventure. Your treacherous journey takes you to all parts of a strange new world. Explore dangerous castles and dark caverns where dadly perils and great rewards, await at every turn. Hundreds of ferocious monsters block your path. With patience, skill, and cunning, you can defeat them.', '/images/nes/218/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/FF1_USA_boxart.jpg', 33, 69.5),
(219, 'Fire \'n Ice', NULL, NULL, 'If you like puzzles and logic, you\'re going to love Fire \'n Ice! Fire monsters are loose on Coolmint Island. You must use your wits and skill to clear each level and defeat the wicked wizard. Beware! You might find yourself extremely hooked on this wildly addictive puzzle game!', '/images/nes/219/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/0/49150_front.jpg', NULL, NULL),
(220, 'Fisher-Price: Firehouse Rescue', NULL, NULL, 'It\'s Fisher-Price Firehouse Rescue! Have you ever wanted to drive your very own fire truck? Now you can, with the exciting NES version of every child\'s favorite Fisher-Price toy. Guide your brightly colored fire truck through the street mazes. When you get to the flashing house, bring the Little People (and even their cat) down the fire truck ladder. Whether you\'re 3 years old or 8 years old or anywhere in between, this game is made just for you. There are four graduating skill levels, with multiple mazes at each level so there\'s lots of fun and challenges for everyone. Can you work your way up from Firefighter to Fire Chief? Sure you can!', '/images/nes/220/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/2/49152_front.jpg', NULL, NULL),
(221, 'Fisher-Price: I Can Remember', NULL, NULL, 'To play I Can Remember, you have to concentrate! Can you remember what you see? Can you remember where you saw it? Choose a number and look at the picture that\'s revealed underneath. Then choose another number and look at that picture. Do they match? If they do, they\'ll stay turned up. If they don\'t, they\'ll turn down again and your opponent gets to pick two more. Keep picking pairs until all the pictures are matched and the entire game board is uncovered. Play alone, play against a friend or even the computer. As you get better, the boards get harder, with more numbers and more pictures to remember. You can do it!', '/images/nes/221/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/8/49148_front.jpg', NULL, NULL),
(222, 'Fisher-Price: Perfect Fit', NULL, NULL, 'Dropping down the Perfect Fit game chute are familiar, everyday objects such as letters, numbers, figures, and lots of familiar Fisher-Price toys. Inside the game board are outlines of these same objects, just waiting for you to move the pictures into their correct outlines. Play at your own level, from simple matches to matches requiring up-down or side-to-side flips. Play alone and better your time, or play against a friend or even the computer to see who\'s quicker. Whichever way you do it, it\'s great fun!', '/images/nes/222/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/3/21963_front.jpg', NULL, NULL),
(223, 'Fist of the North Star', 'Hokuto no Ken 2', NULL, 'Danger lurks at every turn and hits when least expected! Since Laou\'s death, the Central Imperial Capital, a city ruled by the Emperor Heaven, has been in great confusion. KEN returns to rescue its people from the tyranny of their evil ruler. But many powerful enemies confront KEN and try to thwart his rescue efforts. Will he succeed or will he perish? Only you can answer these questions!', '/images/nes/223/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/7/49157_front.jpg', NULL, NULL),
(224, 'Flight of the Intruder', NULL, NULL, 'It\'s 1972. The Gulf of Tonkin, Vietnam. You\'re Navy airman Jake "Cool Hand" Cribbon - ready to take on the best the Hanoi war machine has to offer. And this time, it looks like you\'re in for it! Experience top-flight realism with Flight of the Intruder! In this incredible air combat simulator, you\'ll fight for your life, flying either an A-6 Intruder bomber or an F-4 Phantom fighter in 12 different missions and over 50 combat rounds. Select from an arsenal of high-tech weaponry, including machine guns and heat-seeking missiles, and send them screaming toward your enemy with the help of a Heads-Up display and full cockpit instrumentation. Feel the heat as your weapons detonate in brilliant explosions! Then return to your carrier for some well-deserved R&R!', '/images/nes/224/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/3/49153_front.jpg', NULL, NULL),
(225, 'The Flintstones: The Rescue of Dino & Hoppy', 'Flintstones: The Rescue of Dino and Hoppy', NULL, 'It\'s prehistoric pandemonium as your favorite cave family, the Flintstones, get a visit from the 30th century. The clever scientist, Dr. Butler, needs some dinosaurs for the Orbit City Zoo, and he\'s invented a time machine to capture Dino and Hoppy. Can Fred find all the pieces that the Great Gazoo needs to build a time machine of his own? Can he make a jump into the future with the help of Wilma, Barney and Betty and rescue his prehistoric pals? Who says history has to be boring?', '/images/nes/225/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/9/49159_front.jpg', 2, NULL),
(226, 'The Flintstones: Surprise at Dinosaur Peak', NULL, NULL, 'Pebbles and Bamm-Bamm have wandered away from home and it looks like Fred and Barney found them. Unfortunately, an active volcano stands in the way. Now, Fred and Barney must travel across the pre-hysterical world of Bedrock to rescue the kids! Fred swings a mean club and Barney\'s sling carries a nasty sting in this adventure for the whole family. Scale the side of a cliff, use crocodiles as trampolines, and leap into action as Bedrock\'s most famous citizens go looking for their children. Collect the hidden five fabled fire gemstones to pay a greedy Pterodactyl to return Pebbles and Bamm-Bamm to their homes!', '/images/nes/226/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/4/49164_front.jpg', 1, NULL),
(227, 'Flying Dragon: The Secret Scroll', 'Hiryu no Ken', NULL, 'Suddenly, from an evil world, a mysterious super corp, "The Tusk Soldiers" appear, carrying a letter of challenge to Shorinji! What\'s the secret of the Hiryu no Ken Scrolls? Ryuhi begins his journey to The World Tournament, where the secret of the scrolls will be revealed to him.', '/images/nes/227/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/2/49162_front.jpg', 1, 1),
(228, 'Flying Warriors', NULL, NULL, 'New Heroes were born, their names, the Flying Warriors! The great adventures of five young heroes from the Light Dimension now begin! The Super Action System and Artificial Intelligence enables players to enjoy the speedy and realistic versus action. It also includes an independent mode that lets a maximum of eight people participate in fights against each other! When the evil red star appears in the sky and the great monster Demonyx revives, the five Flying Warriors sent by the Dragon Lord are ready to fight!', '/images/nes/228/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/6/49166_front.jpg', 6, NULL),
(229, 'Formula One: Built to Win', NULL, NULL, 'Win prize money or go gambling in Las Vegas to build up your account... Use the money in your account to make improvements on your car and enter exciting races all over the world!', '/images/nes/229/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/43/Formula_One_Built_to_Win_Cover.jpg', NULL, NULL),
(230, 'Formula One Sensation', NULL, NULL, 'F-1 Sensation features championship races and drivers from the 1992 Formula One season.\n\nThe game contains 18 tracks, each playable separately in the "Free Run" mode, or one-by-one against the 16 of the 1992 season in the "Grand Prix" mode. In the latter, a one-lap qualification drive must be passed before each race, determining the starting position in the grid, and also serving as a short practice for the upcoming course.\n\nIn both, player drivers and rival drivers can be freely selected. Each driver in the game is divided into three levels based on real-life skill: A, B, and C. Because there are less entries than there are racers, these choices directly affect the game\'s difficulty.', '/images/nes/230/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/8/86/F-1_Sensation.jpg/220px-F-1_Sensation.jpg', NULL, NULL),
(231, 'Frankenstein: The Monster Returns', NULL, NULL, 'For years the monster lay in the grave, and the villagers went peacefully about their business trying to forget the horrible nightmare days when HE had spread terror throughout the countryside. For years the sun seemed to shine brighter and the crops grew taller than anyone could ever remember. Surely, their troubles were far behind them, and life was one blissful long walk through paradise. But, their wonderful world would be shattered in one mighty flash from the heavens. For lightning had struck the old tombstone that lay battered and overgrown with weeds in a dark corner of the ancient cemetary. And just as fiendish life had once been given to the dead, it would be given again. First a twitch of a finger, a flutter of a heartbeat, then a powerful surge of energy to the twisted criminal brain that so long ago had terrorized the land in the powerful body of the hideous monster. The horror was about to begin again... Frankenstein had risen from the dead!', '/images/nes/231/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Frankenstein_The_Monster_Returns_Cover.jpg', NULL, NULL),
(232, 'Freedom Force', NULL, NULL, 'From a distant corner of the galaxy, an evil alien race sets in motion a sinister plan to conquer the Earth. They unleash a powerful catalyst -- Energy X -- that imbues the planet\'s worst miscreants with super-powers to bring the planet to its knees. Now Earth\'s only hope lies with a new breed of heroes... The Freedom Force!', '/images/nes/232/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/4/21964_front.jpg', NULL, NULL),
(233, 'Friday the 13th', NULL, NULL, 'It all takes place out at Crystal Lake. That pleasant little camp where happy children of all ages go to spend a fun-filled summer... but this summer will be different. The fun will have to wait. Jason has decided to come to camp and terror is the only game they\'ll be playing. Only you can stop this terror. You and your six camp counselors can prevent Jason from running wild. It\'s not an easy task. You must first fight your way through forests filled with man-eating wolves, caves covered with blood-sucking bats, and hordes of mindless zombies at every turn. If a friend is in danger it\'s up to you to help... or else you can just kiss them goodbye. Jason doesn\'t play favorites. He\'ll take anyone. Don\'t think that hiding in a cabin or staying adrift in a canoe will keep you safe. The only way to survive this summer is to challenge Jason, face to face, and destroy him. Don\'t worry that it hasn\'t been done before... there is always a first time (well, not always).', '/images/nes/233/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6e/Fridaythe13thseries.jpg', NULL, NULL),
(234, 'Fun House', NULL, NULL, 'Now you can bring this wacky, wild, goopy, gloppy TV game show home. Rollerblade your way through 80 zany rooms tossing tomatoes at targets in the most outrageous Fun House ever built. This unpredictable mansion is not a place you\'d want to call home. Fun House is a race against the clock where only the skilled can survive. Clock\'s running low? Find a lightning bolt to gain speed or pick up an alarm clock for some extra time. Better yet, find the hidden warp zones and short cut to the next maze. But watch out for the banana launchers and glob guns which will take away some of your precious time. Can you avoid the obstacles? Can you rollerblade on icy floors or up slime covered ramps? Can you collect enough coins to earn another pair of skates? The mission\'s yours. Remember... only those who think fast and move quickly will survive this sticky mess. Will you?', '/images/nes/234/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/9/49169_front.jpg', NULL, NULL),
(235, 'G.I. Joe: A Real American Hero', NULL, NULL, 'Snake Eyes is one of five characters you will use in your long battle. Receive vital information transmitted from Joe headquarters by General Hawk. Cling to walls while dodging a barrage of enemy fire. Find gun symbols to power up your massive arsenal of weapons. Catch enemy vehicles like the BuzzBoar. Fight the Cobra SeaRay, one of many enemy bosses!', '/images/nes/235/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/22/G.I._Joe_-_A_Real_American_Hero_Coverart.png', NULL, NULL),
(236, 'G.I. Joe: The Atlantis Factor', NULL, NULL, 'G.I. Joe\'s squad of mean, lean combat experts moves into action! Cobra Commander has raised the ancient island of Atlantis from the ocean depths, and is using it as a base. With a nearly indestructible army, and powerful space weapons, the power-crazed Cobra is about to take over the world! Advance through the lethal mazes of Cobra\'s weapons complex, battling soldiers, gunships, laser orbs, and skin-shredding birds of prey. Infiltrate secret storerooms where Cobra Commander carries out his deadly schemes. At each level, find an ally of even greater strength and skill to join your combat team. At last, face Cobra Commander himself in a treacherous duel for world dominance! This is a fight only G.I. JOE can win!', '/images/nes/236/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5e/G.I._Joe_The_Atlantis_Factor_Cover.jpg', 3, NULL),
(237, 'Galaga', NULL, NULL, 'Take control of a fighter space craft and shoot down the invading aliens. Watch out for the swooping motherships, which will try to steal your fighter. Rescue captured fighters to double your firepower. Earn Perfect Bonuses as you battle your way through wave after wave in different challenging stages.', '/images/nes/237/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4d/Galaga_flyer.jpg', 1, 2),
(238, 'Galaxy 5000', NULL, NULL, 'The future of Grand Prix racing is in outer space. And you\'re one of the hottest turbo-racers in the solar system. But are you tough enough to win the ultimate racing challenge, the GALAXY 5000? Dozens of track objects, including land mines, gun turrets, speed zappers, warp doors and deadly solar spikes! Awesome digitized sound effects. Hear the driver scream as he falls off the track. Use your winnings to repair damage, or upgrade to a more powerful turbo-craft!', '/images/nes/238/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b0/Galaxy5000.jpg', NULL, NULL),
(239, 'Gargoyle\'s Quest II', 'Red Arremer II', NULL, 'Before Man ruled the world there were the monsters of Etruria. One such beast - Firebrand the Gargoyle, must act to restore the magic that quickly fades from the Ghoul Realm. Join him on his perilous journey as he looks for the origin of a mysterious dark beam of light. Breathe fire at hideous creatures that hunger for your essence. Dodge magical assaults, deadly traps and cunning opponents that will stop at nothing to protect their ghastly secret! See if you have what it takes to solve riddles while battling for your very life!', '/images/nes/239/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c6/Gargoylesquest2.jpg', 3, 3.5),
(240, 'Gauntlet', NULL, NULL, 'Gauntlet is an Action game, developed and published by 2 Bears Studio,  scheduled to be released in 2018.', '/images/nes/240/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/9/49179_front.jpg', NULL, NULL),
(241, 'Gauntlet II', NULL, NULL, 'The arcade megahit comes to the NES! Experience all the genuine arcade action, including the original digitized sound and spellbinding graphics. And experience every one of the over 100 arcade mazes complete with all the sorcerous secret rooms, traps, monster generators, transporters, force fields, and villains - it\'s all straight from the arcades, and it\'s all here.', '/images/nes/241/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/de/Gauntlet_II_game_flyer.png', 4.5, NULL),
(242, 'Gemfire', 'Royal Blood', NULL, 'Long, long ago in the land of Ishmeria, 6 magicians and a dragon were sealed in the gems of the crown Gemfire. With their magic locked inside, the crown held powers to help the people of Ishmeria. But, King Eselred used Gemfire against the people, destroying the towns and fields! In a brave attempt to stop the king, Princess Robyn released the gems from the crown.', '/images/nes/242/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/8/47468_front.jpg', 7, NULL),
(243, 'Genghis Khan', 'Aoki Ookami to Shiroki Mejika: Genghis Khan', NULL, 'Become Genghis Khan and lead the most fearsome army in the known world. Use your Land of Mongols to build an empire on the bodies of your enemies and the rubble of their conquered cities. With skill, cunning, diplomacy and luck, all of Europe and Asia could be yours. Failure means shame in the eyes of your princess, or even death! Victory on the battlefield requires bold strategy and clever planning. Outmaneuver your opponent with cavalry, lay siege to his castle with archers or even challenge him to a duel. But success also requires brilliant political tactics and a sharp eye for business during times of peace. Genghis Khan is based on actual history and offers a blend of strategy and role playing elements. Make history as you play the great Khan himself or his rivals, Richard the Lionhearted, Emperor Alexious III, or Shogun Minamoto of Japan.', '/images/nes/243/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/6/25356_front.jpg', NULL, NULL),
(244, 'George Foreman\'s KO Boxing', NULL, NULL, 'You\'re "Big George" Foreman and you\'ve got an appetite for BIG action that only KO BOXING can satisfy. Take on a roster of 15 heavyweight contenders as you go for the World Championship. Rook your opponents with stinging left-right combos! Pound your way to the title with a spectacular "Big George" Super Punch - while the computer "judge" tracks the action! GEORGE FOREMAN\'S KO BOXING puts the power of the greatest knockout artist in your hands!', '/images/nes/244/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/4/30924_front.jpg', NULL, NULL),
(245, 'Ghostbusters', NULL, NULL, 'Have you and your friends been experiencing paranormal activity? Grab your Proton Pack and join the Ghostbusters as you explore Manhattan, blasting ghosts, and trapping those runaway ghouls.', '/images/nes/245/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/96/Ghostbusters_%282016_video_game%29.png', NULL, NULL),
(246, 'Ghostbusters II', NULL, NULL, 'They\'re back! Weird things are happening... The slime is on the rise. The Titanic has arrived. And after 300 years, Vigo the Carpathian won\'t stay dead. Who you gonna call? Get your bustin\' business back on its feet. Hit the streets in your Ectomobile. Go underground to discover a river of slime... and rise above it all with the Statue of Liberty. All to turn evil to good and defeat Vigo at the Museum of Art. Action, adventure, strategy challenges - and great laughs!', '/images/nes/246/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e4/Ghostbusters2nes.jpg', NULL, NULL),
(247, 'Ghost Lion', NULL, NULL, 'How high are your Hopes? How powerful are your Dreams? How strong is your Courage? You\'ll need them all to help Maria find her parents in the caverns of the Ghost Lion. Use your magic Bombs, Storms and Thunder wisely against Zombies, Goblins, and Kobold, the monster with the face of a dog. Keep your companions close. Centaur, the half-man, half-horse. Twana, Spirit of the Lamp. And faithful Mojo, the Spirit of the Spear. It\'s the easiest way to get into role playing. And only the biggest supply of Courage will get you and Maria through!', '/images/nes/247/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/6/20386_front.jpg', NULL, 10),
(248, 'Ghosts \'n Goblins', 'Makai-Mura', NULL, 'The beautiful princess is kidnapped. Her lover, the Knight in shining armor, armed with five different weapons to fight the enemy, sets out to rescue the beautiful princess. The Knight, aided by your skill, must pass through seven different guarded gates, fighting and destroying demons, dragons, giants and zombies. There are hidden characters, too! Some friends, some foes. Ghosts \'N Goblins is exciting... challenging you and the Knight to rescue the princess, amid great danger, escaping Hades, land of the enemies!', '/images/nes/248/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a1/GhostsnGoblins_flyer.jpg', 5, 11.5),
(249, 'Ghoul School', NULL, NULL, 'One day Spike O\'Hara, a senior from the academic institution of Cool School High found a glowing skull in the local cemetery, a finding that would prove to be a disaster. Spike brought the skull to his teacher and it is from here that our ghostly tale unfolds...The skull ended up being a beacon, a homing device for all the spirits and monsters from the realm of the dead. These ghouls from a land downunder have sort of captured your dream girl Samantha Pompom, the beautiful head cheerleader of the school. She\'s being held somewhere in the school and you\'ve got to find her. (Everyone before you has failed -- but don\'t let that discourage you.)', '/images/nes/249/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9b/Ghoul_School_Cover.jpg', 3, NULL),
(250, 'Goal!', 'Moero!! Pro Soccer', 'Super Cup Soccer', 'The clock ticks down. The roar of the crowd rises in a deafening chant of "U-S-A! U-S-A!" Suddenly, your winger breaks free, and spots the open man in the middle. Pass... shot... GOAL! It\'s America\'s favorite new sport, soon to become your favorite new home video game, thanks to Jaleco! Because GOAL! brings soccer to life like you\'ve never seen it. You play with a full team of 11 players, each one rated in 7 different skill categories. You can match them against a team controlled by the computer or another player. You can even team up with a friend and match your combined skills against the best computer team. So if you want soccer at its best, tune in to the undisputed champion of home soccer software: GOAL!', '/images/nes/250/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/4/46264_front.jpg', 4, NULL),
(251, 'Goal! Two', NULL, NULL, 'Get ready for the ultimate rematch! It\'s too real! Too fast! Too good to be anything less than the best soccer game ever created for the NES! It\'s GOAL! TWO, the long-awaited sequel to the original title that set the standard for world class soccer simulation. It\'s living proof that you can never get too much of a great thing!', '/images/nes/251/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/5/49185_front.jpg', NULL, NULL),
(252, 'Godzilla: Monster of Monsters', 'Gojira', NULL, 'The invaders from Planet X attack earth as part of their plan to conquer the entire universe, using a legion of space monsters. The earth sends Godzilla, the strongest monster on the earth, and Mothra, to defend itself. Godzilla advances through 8 battle stages to defeat a legion of space monsters controlled by Planet X. For the sake of the future of the earth, Godzilla\'s fierce battle now begin...', '/images/nes/252/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/4/49194_front.jpg', NULL, 5),
(253, 'Godzilla 2: War of the Monsters', NULL, NULL, 'The earth is besieged by Godzilla and monsters, and is in a critical situation. Who will be the ultimate winner, human wisdom or the instincts of the monsters? A highly challenging yet simple simulation game to play! Just choose the commands from the "pop-up" menu and all operations can be done easily. Concentrate on your battle strategy and destroy all the enemy monsters on the earth. Popular monsters are up against the newest "smart" weapons! As the commander of the Allied Defense Forces, you place those controversial smart weapons on the map. Fire and attack as you see fit. There are even some monsters that come to the aid of the Allied Defense Forces!', '/images/nes/253/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/2/49192_front.jpg', NULL, NULL),
(254, 'Golf', NULL, NULL, 'Nintendo GOLF lets you choose your clubs, change your stance, control your swings - even select the angle of impact! You\'ll view the hole from both close up and far away, judge the changing conditions of the green, and measure the wind velocity. But watch out! When the wind changes, so does the flight of your ball. With Nintendo\'s state-of-the-art graphics and realistic game play, you\'ll really believe you\'re on the fairways. So play Nintendo GOLF, because there\'s not a video golf game on par with it anywhere!', '/images/nes/254/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/92/Golf_Coverart.png', 1, 1),
(255, 'Golf Grand Slam', NULL, NULL, 'Now, in Golf Grand Slam, you\'ll face all the conditions you would on a real golf course! Learn more about using each of the 14 golf clubs, how to choose a strike point on the ball, and setting up putts - all while you\'re contending with wind resistance, sloping greens, complex faiways and more. Two training modes have been specifically designed to help you sharpen your golf techniques. Then, after you\'ve mastered those, you can take on the Golf Grand Slam Top 30 Pros in a tournament that will push you to the limit! So if you\'re ready to enjoy golf and improve your game without leaving home, let\'s go!', '/images/nes/255/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/7/49197_front.jpg', NULL, NULL),
(256, 'Golgo 13: Top Secret Episode', 'Golgo 13: Kamigami no Koukon', NULL, 'He\'s Golgo 13, the legendary agent who\'s never failed on a mission. Now, he\'s facing his toughest challenge: to recover a stolen vial of "Cassandra G," the deadliest weapon in the history of biological warfare. But he can\'t do it without your help. Join forces with Golgo 13 on an action-packed odyssey to recapture Cassandra G before it is unleashed on the human race. Whether he succeeds or not is up to you - and every second counts!', '/images/nes/256/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/b/bd/Golgo_13_Top_Secret_Episode_%28cover_art%29.jpg/220px-Golgo_13_Top_Secret_Episode_%28cover_art%29.jpg', 4, NULL),
(257, 'The Goonies II', NULL, NULL, 'Packin\' a heap of ugliness, mean old Ma Fratelli\'s come back for revenge. And this time she plans to do away with "The Goonies" for good! One by one this crazed mama and her two nutty sons have kidnapped your fellow Goonies, hauling them off to a spooky shack and hiding them in a maze of adventure filled with danger, including the slippery ice cavern, secret underground sea, and eerie attic. Now you\'re the only Goonie left. The fate of your friends is in your hands. But saving the day won\'t be easy. Armed with your trusty yo-yo and whatever weapons you can find, you\'ll be forced to fight off fearsome foes, and solve menacing mysteries. You\'ll have to be willing to risk it all, being brave and bold, to rescue your buddies, "THE GOONIES!"', '/images/nes/257/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/76/Goonies2.jpg', 3, NULL),
(258, 'Gotcha! The Sport!', NULL, NULL, 'It\'s just you now... you\'re alone... no one to turn to for help. Sure, the odds are against you, but this is when you can really show your stuff. You\'ve got your Nintendo Zapper in your hand and a pretty good supply of paint pellets. Don\'t waste any, \'cause you\'ll need them all! Your opponents are all around and they\'re good shots. Whether you\'re in the dense green woods, the steamy urban ghetto, or the snow covered winter forest, there\'s only one thing on your mind... survival. Register a hit on an enemy player and mark him with a paint splot. Watch out though, because in this game they shoot back and the only way to be safe is to shoot first and shoot straight. This is the ultimate challenge... dare to take it... try to survive!', '/images/nes/258/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/0/1/49201_front.jpg', NULL, NULL),
(259, 'Gradius', NULL, NULL, 'You are the last hope of the gentle people of Gradius. You\'ve just lifted off to confront the all-out attack of the amoeboid Bacterions. Your hyper-space fighter is armed with the greatest arsenal in the galaxy. Air-to-surface and double beam laser cannons for incredible firepower. Powerful force fields for protection. Time and space warps for fleeing the dimension. You\'ll need it all just to survive. Because at the heart of the Bacterion Empire lies the Xaerous Superfortress - the nerve center of the all-knowing, all-seeing Bacterion Bio-Computer. It\'s a duel to the death, while the entire galaxy watches, waits, and hopes!', '/images/nes/259/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/13/Gradius.jpg', 1.5, 8),
(260, 'The Great Waldo Search', NULL, NULL, 'When Whitebeard the wizard lost his powerful magic scrolls, he knew who to turn to for help - Waldo! Whitebeard asks his good friend to search the Realms of Enchantment to find his missing parchments. Well, you know Waldo\'s famous love of challenges... so he takes his walking stick, his trusty dog Woof and off he goes! Now it\'s your turn to help Waldo in his thrilling search across lands filled with hungry ogres, flaming dragons, massive castles, fire druids, wild beasts and plenty more! Find alarm clocks that give you a little extra time, Bonus Points that add to your score, and even Waldo\'s canine buddy who will take you on a magic carpet ride! All the fun and crazy cartoons are here for Waldo lovers everywhere!', '/images/nes/260/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/4/21974_front.jpg', 1, 1),
(261, 'Greg Norman\'s Golf Power', NULL, NULL, 'Close your eyes and imagine the perfect golf course. Whether you conjure up an image of a real-life, world famous course or visualize a championship course all of your own design - if you can dream it, you can play it with Greg Norman\'s GOLF POWER. Our exclusive course designer with battery back-up allows you to customize your own 18-hole championship course and then save it in memory. Create a dream course, play one of the pre-set courses in England, Scotland, the USA or Japan, or rejoin a saved game right where you left off. Just like the Great White Shark, you\'ll need total concentration, strategy and control to make the leader board.', '/images/nes/261/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/71/GregNormansGolfPowerBoxShotNES.jpg', NULL, NULL),
(262, 'Gremlins 2: The New Batch', NULL, NULL, 'Gizmo is trapped inside Clamp Centre by the evil Gremlins. Your mission? Help him battle his way to the control center and rid the city forever of the Gremlin menace! It\'s not going to be easy. You\'ll have to use cunning and wits to survive with only the weapons you find inside Clamp Centre... matches, a flashlight, tomatoes, and a homemade bow and arrow. But, if you\'re lucky, the door to Mr. Wing\'s Magic Shop may mystically appear... and let you buy some very special - and powerful - items to help you. This game has all the traps, mazes, and lightning quick moves to push your skill to the limits. And it has graphics that seem to come alive on the screen. Gremlins. Stopping them is not going to be easy. Don\'t say we didn\'t warn you!', '/images/nes/262/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/thumb/e/e5/Gremlins2nes.PNG/250px-Gremlins2nes.PNG', NULL, NULL),
(263, 'The Guardian Legend', NULL, NULL, 'Long ago, in a distant galaxy, an alien race sent a huge world - called Naju - hurtling toward Earth, loaded with a cargo of mysterious lifeforms. During the long journey, these creatures have multiplied and become increasingly evil - and now Naju teems with evil. However, deep within this complex globe are self-destruct mechanisms that can be activated to destroy it before it reaches Earth. Now, you must battle your way deep within Naju\'s labyrinths to destroy it. You are the guardian of Earth and your saga will become The Guardian Legend!', '/images/nes/263/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/0/3/49203_front.jpg', 4.5, NULL),
(264, 'Guerrilla War', 'Guevara', NULL, 'Your small island country is struggling against the cruel domination of an evil dictator. Two players can join forces as guerilla fighters to battle the dictator\'s army, rescue the prisoners, and bring liberation!', '/images/nes/264/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1b/Guerrilla_War_Cover.png', 1, 2),
(265, 'Gumshoe', NULL, NULL, 'Gumshoe is an Adventure game, developed by Hiding Buffalo,  with no announced release date.', '/images/nes/265/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/56/Gumshoebox.jpg', 1, NULL),
(266, 'Gun-Nac', NULL, NULL, 'The most happening place in the universe is the trendy, upscale solar system of IOTA Synthetica, part of the Galactic Federation of artificial stars. It\'s as far from dirty old Earth as can be... But don\'t sign up to go yet! A strange cosmic energy field with a major attitude has engulfed the system, and the most outrageous things are happening. Ordinary inanimate objects are coming to life - harmless little animals are becoming rabid giants - and the freaked-out residents are under attack! The only Galactic Commander who can handle this ordeal is the eccentric renegade called Gun-Nac. He can oust this aura that\'s threatening the destruction of comfortable artificial life as we know it. But where in the universe is he? He could be as far away as Earth, searching for a new Game Pak. Commander Gun-Nac, if you read this, call H.Q., A.S.A.P., O.K.? We N.E.E.D. you!', '/images/nes/266/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d6/Gun_Nac_Cover.jpg', 1, NULL),
(267, 'Gun.Smoke', NULL, NULL, 'Gun.Smoke by Capcom takes you back to the days of the Gold Rush, to a small, bustling mining town of the Old West. Ruthless gold-stealing bandits are terrorizing the townsfolk and it\'s up to you to stop them! The thieves are notorious killers, and when they challenge you to a draw, they\'re playing for keeps! Although your gunslinging prowess is legendary, this may be the toughest High Noon you\'ll ever face. But you\'ve got to stand your ground - this town ain\'t big enough for both you and them!', '/images/nes/267/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/81/Gunsmoke_game_flyer.png', 1, NULL),
(268, 'Gyromite', 'Robot Gyro', NULL, 'You\'ll need R.O.B. - the world\'s first Robotic Operating Buddy - to play this action-packed game! You\'ve got to keep R.O.B.\'s gyroscope spinning in order to help a mad scientist deactivate all the dynamite in his laboratory. You\'ll move columns up and down to speed the scientist on his way while trying to avoid the lethal Smicks. And you\'ll get him to his dynamite even faster if you can get R.O.B. to spin two gyros at the same time! But don\'t take your eyes off the scientist, because anything can happen in GYROMITE! Where two hands and one pair of eyes aren\'t always enough!', '/images/nes/268/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/36/Gyromite_front.jpg', 4, NULL),
(269, 'Gyruss', NULL, NULL, 'It\'s A.D. 2500 and mankind has penetrated the galaxy\'s fringes, establishing colonies of peace from Mercury to Pluto. Suddenly, the tranquility of the Milky Way erupts into a frothing fury as armadas of alien deathships swarm into our solar system like killer bees preying on an innocent bystander. No one is spared. Even beloved Mother Earth is stung. These vicious cosmic Visigoths are war starved Gyrusians. And, led by the immortal Genghis Khan (whom they recruited from Mongolia centuries ago), they\'re out to trash civilization. With our galactic fleet flattened, you\'re the lone space cowboy who escaped the Gyruss shroud of doom. Now you must scorch through the galaxy, freeing planets by zapping endless enemy attacks with Neo-Bomb-Blastic Cannons and Ultra-Lazonic Phasers. So prepare for the fight of your life. And don\'t flinch, or else the entire universe will get pulverized!', '/images/nes/269/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/5/41615_front.jpg', 8, NULL),
(270, 'Hammerin\' Harry', 'Daiku no Gen-San', NULL, 'Hammerin\' Harry is an Action game, developed and published by Irem,  which was released in Japan in 1991.', '/images/nes/270/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/43/HammerinHarry_arcadeflyer.png', 1, NULL),
(271, 'Harlem Globetrotters', NULL, NULL, 'Those international superstars of basketball, the Harlem Globetrotters, are here! Now you can play with 1, 2, or 3 friends, or against computer-selected opponents, and perform the antics made famous over the past 65 years by the irrepressible Clown Princes of Basketball. Choose to play as a Harlem Globetrotter or face off against them. In either case, you\'ll combine awesome basketball skills with high hilarity. It\'s unpredictable! It\'s unequaled! It\'s an action-packed entertainment treat for "kids" of all ages!', '/images/nes/271/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f6/Harlem_Globetrotters_cover.jpg', NULL, NULL),
(272, 'Hatris', NULL, NULL, 'Remember Tetris? The way those cubes kept coming at you? That was tricky enough, but what if they were half a dozen different hats instead? Derbies, baseball caps, cowboy hats, wizard hats, top hats and crowns? Well, that\'s the whole idea behind Hatris. The hats keep coming at you two at a time. All you have to do is stack them up five at a time and - poof - they\'re history. It sounds perfectly simple. Until you get into it. Then you\'ll wish you had six heads instead of one. Because this is the latest game from Alexey Pajitnov, the designer of Tetris, and his partner Vladimir Pokhilko. And anyone who could turn geometry into a contact sport is a force to be reckoned with. And this time they really want you to use your head. If you don\'t, you\'ll look pretty strange with that pile of hats on it!', '/images/nes/272/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/2/46292_front.jpg', 8.5, NULL),
(273, 'Heavy Barrel', NULL, NULL, 'The impossible and unthinkable has happened. Terrorists have seized the underground control complex of a nuclear missile site. It\'s up to you to infiltrate the installation and eliminate the leader of the terrorist army. It won\'t be easy. Powerful tanks, treacherous waterways and the bridges are all part of enemy territory now. The only weapon you\'ll be able to defeat the terrorists with is HEAVY BARRELL - but it\'s been dismantled and is in pieces inside the installation itself. Once you\'ve battled your way inside, you must find the keys and reassemble the weapon. Brute force alone won\'t defeat the terrorists. This isn\'t a job for just anyone. That\'s why you are here!', '/images/nes/273/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/7/49217_front.jpg', 1, 1),
(274, 'Heavy Shreddin\'', NULL, NULL, 'Part skiing, part skateboarding, part surfing...it\'s snowboarding, the radical winter sport that\'s taking the country by storm!', '/images/nes/274/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/9/49219_front.jpg', NULL, NULL),
(275, 'High Speed', NULL, NULL, 'The hottest pinball game ever has been converted to video! All the action and excitement of the original HIGH SPEED is here - Freeway Frenzy, Ramp Race and Running the Red - plus excellent new features like Lightning Bombs and attacking enemies! It\'s a real-life adventure. The screen flashes and a siren shrieks when you run the red light! Police car radio messages and original chase music both add to the thrills. Go for the burn - grab the jackpot and get away at HIGH SPEED!', '/images/nes/275/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9d/High_Speed_box_art.jpg', NULL, NULL),
(276, 'Hogan\'s Alley', NULL, NULL, 'You need split-second timing and sharp-shooting accuracy to join the FBI. Have you got what it takes? Prove it! Use your Zapper light gun to shoot the gangsters in the FBI line-up, without hitting the innocent bystanders. Hit the gangsters and you\'ll score enough points to move to the next location: Hogan\'s Alley. Here\'s where the going gets rough. The gangsters pop in and out of windows, doorways and shadows, and are visible for a shorter amount of time. Beat the gangsters this time around and you\'ll move to the Trick Shoot round. How long can you keep the tin cans hopping in the air? Keep them up there long enough and you\'ll score enough points to become a full-fledged Agent in this exciting Nintendo Light Gun game!', '/images/nes/276/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/12/Hogan%27s_Alley_Cover.jpg', 1, NULL),
(277, 'Hollywood Squares', NULL, NULL, 'Play with friends and family on the famous "tic-tac-toe" game board occupied by "center squares" Kathy Griffin, Brad Garrett, Martin Mull and Jeffrey Tambor. Host Tom Bergeron asks the celebrities questions, and players judge whether the responses are true or false. Be the first to mark three squares in a row to win! Enjoy hilarious video from the TV show filled with "zingers" to fuel the fun. With a multiplayer mode played on one PS3 or online through the PlayStationNetwork it\'s never been so much fun to play "tic tac toe" with Hollywood stars! ', '/images/nes/277/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/65/Hollywood_Squares_%28TV_series%29_titlecard.jpg', NULL, NULL),
(278, 'Home Alone', NULL, NULL, 'As young Kevin McCallister, you have mistakenly been left home alone this Christmas by your family. The big problem here is that a couple of bumbling burglars have set their sights on the McCallister belongings as their ultimate heist. You\'re the only thing that stands in their way and they\'re not about to negotiate. Scramble through the house, basement and tree fort while setting incredible traps for the unwanted intruders! Bounce chandeliers and irons off their noggins in an attempt to gain valuable time for yourself as the police race to your rescue. Can you keep out of Marv and Harry\'s clutches and protect your family\'s treasures? Find out in this hilarious adaptation of the classic comedy hit of the year!', '/images/nes/278/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/57/HomeAlone1game.jpg', 2, 2.5),
(279, 'Home Alone 2: Lost in New York', NULL, NULL, 'Guess who\'s all alone again... only this time in the biggest metropolis of them all - New York City! Help Kevin McCallister in his newest comedy adventure! Marv and Harry bring reinforcements this time to nab the kid that sent them to jail. As Kevin, you\'ll collect assorted toys and items to blast your opponents right out of action and into early retirement! This time it seems a whole city is out for Kevin. Voracious vacuum cleaners and mean house detectives chase him through a posh hotel. Watch out for nasty gang members in Central Park and beware of holes in the floor of his uncle\'s townhouse - all the while looking out for a dangerous reunion with the Wet Bandit Gang! Now you can show them what "just a kid" can do!', '/images/nes/279/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/59/HomeAlone2LINY.jpg', NULL, 1),
(280, 'Hook', NULL, NULL, 'Hook is a Puzzle game, developed and published by Megabyte Bomb,  which was released in 2015.', '/images/nes/280/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6b/Hook_game_cover_art.jpg', 2, 4),
(281, 'Hoops', 'Moero!! Junior Basket', NULL, 'Gym rats, beware! HOOPS takes you out to the asphault, where basketball is a half-court game of fast hands, faster moves and slam-jam-thank-you-Sam dunks! The legends of the Playground are all here: Mr. Doc, Jammer, Legs, Bomber, Wiz, eight players in all. You can pit them one-on-one or two-on-two. You pick the court - Eastern or Western - and you pick the rules, too. You can play against the computer or one other player. Or you can even team up with another player against the computer. You can block shots, make steals, pass off or go strong to the hoop - in fact, you control just about everything in this ultra-realistic rendition of the playground game. Except, of course, the final score. But win or lose, you know you\'ve been in a game after you\'ve played a game of HOOPS!', '/images/nes/281/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/2/49242_front.jpg', NULL, NULL),
(282, 'Hudson Hawk', NULL, NULL, 'Eddie Hawkins, a.k.a. The Hudson Hawk, is called the world\'s greatest cat burglar, but he\'s called it quits. Some others, though, aren\'t ready for the Hawk to retire. They blackmail him into stealing priceless works by Leonardo da Vinci from a heavily guarded auction house and from the Vatican itself! The job has Hawk dodging bullets and guard dogs, thwarting sophisticated security systems, dangling from rooftops and crawling through booby-trapped ventilation shafts. And if Hawk makes it out alive? Well maybe he can turn the tables on his blackmailers. Because they aren\'t just art collectors, they have a plot to rule the world! But if Hawk can break into their lair, he just might be able to steal the one object that can stop them. The Hudson Hawk? Saving the world? It\'s a dirty job, but hey, somebody\'s got to do it!', '/images/nes/282/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/8/4288_front.jpg', 1, NULL),
(283, 'The Hunt for Red October', NULL, NULL, 'Now you can capture all the spine-tingling espionage action and suspense of the hit motion picture in this powerful Nintendo video game! The superpowers confront one another yet again with incredible new technology and dangerous weapons. As Captain Ramlus, you must guide the Soviet Typhoon submarine Red October through its perilous mission and make a desperate attempt to defect to America!', '/images/nes/283/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2b/Redoctober.png', NULL, NULL),
(284, 'Hydlide', 'Hydlide Special', NULL, 'The young knight, Jim, has a tough challenge: He must avenge the death of the king and save Princess Ann by destroying the devil Boralis and his monstrous companions. Jim comes face-to-face with many forms of evil - water dragon, vampire, zombie, sea monster, a moving forest, and fireballs. But the king\'s sword and shield are what he needs to conquer Boralis!', '/images/nes/284/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ac/Hydlide_Cover.jpg', 2.5, 2.5),
(285, 'Ice Climber', NULL, NULL, 'If you can break through 8 levels of treacherous arctic ice, you\'ll reach the top of the mountain! But watch out. The Nitpickers, Condors, and Ploar Bears don\'t want you up there. And they\'ve got a bag of tricks that will test every ounce of your strength and courage. Are you going to let them stop you? No way! There are 32 mountains to choose from and endless thrills as you fight these arctic creatures alone or with a friend, and ascend to the top of the mountain in ICE CLIMBER!', '/images/nes/285/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/df/IceClimberboxartnes.jpg', 3.5, 5.5),
(286, 'Ice Hockey', NULL, NULL, 'It\'s fast skatin\', hip checkin\', high scoring action. Lead your team into center ice, over the opponent\'s blue line. Pass over to the point and set up for the tip in - Score! Choose a country for you and your opponent, select a level of play and face off at center ice to become the top goal scorer in Nintendo\'s Ice Hockey! Get charged with a penalty and test your defense. Or attack on a power play and use your puck handling skills to catch your opponents off guard. Either way, you can become a superstar in the league of Nintendo Ice Hockey!', '/images/nes/286/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3d/Icehockeyvideogame.jpg', NULL, NULL),
(287, 'Ikari Warriors', 'Ikari', NULL, 'You and a friend are warriors with secret orders to invade an enemy nation. Working together as a team, you must fight for survival against a relentless onslaught of enemies!', '/images/nes/287/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/bc/Ikari_flyer.png', 2, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(288, 'Ikari Warriors II: Victory Road', 'Ikari II', NULL, 'Victory Road (怒号層圏 Dogō Sōken, lit. "Bellowing Atmosphere") an arcade video game released in 1986. It is the sequel to Ikari Warriors.\n\nThe objective is to defeat the enemy aliens using grenades and other weapons. The story directly picks up at the ending of Ikari Warriors. Congratulated by General Kawasaki for rescuing him, Paul and Vince return home to their native country in a plane arranged by the general. A mysterious storm appears and they are hurtled thousands of years into the future. They are met by an alien creature who says that the villain Zang Zip has taken over the land.', '/images/nes/288/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7c/Victory_Road.png', 4, NULL),
(289, 'Ikari Warriors III: The Rescue', 'Ikari III', NULL, 'It\'s the end of the 20th century. A worldwide economic recession wreaks havoc with the nation and the planet. The impending threat of anarchy has given rise to a secret vice organization called "Crime Ghost." Dangerously poised to take over the world with its diabolic strategy, "Crime Ghost" has infiltrated every country simultaneously. There is one President who has initiated a plan to wipe out the association, but now his home has been attacked and his daughter Elise abducted. A letter has arrived demanding that he resign his powerful position within a number of days, or else his beautiful Elise will be executed in a most unpleasant manner. The letter is signed "Faust," the notorious mastermind of Crime Ghost. The president knows to whom he must turn. He has summoned two men, Paul and Vince, the incredible Ikari Warriors. Now YOU become Paul and Vince! You must go to the enemy hideout, rescue the lovely Elise, fight Crime Ghost and destroy them all!', '/images/nes/289/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/2/49252_front.jpg', NULL, NULL),
(290, 'Image Fight', NULL, NULL, 'Mankind struggles to survive! Without warning they came... And laid waste to the moon and man\'s bases on it. Ill-prepared and outgunned, Earth scientists worked feverishly to build a weapon to turn the tide. The "OF-1" is the ultimate fighter. Even as the crews prepare to fight, industrial and military space complexes disappear, one by one. Viewing screens, hooked to spy satellites, flash images of unidentified fighter attacks and a strange vegetation coiling itself around the moon\'s computer like an insidious serpent. Victory will come only to the worthy. Are you?', '/images/nes/290/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/0/44680_front.jpg', 1, NULL),
(291, 'The Immortal', NULL, NULL, 'When nightmares come to life... You discover you\'re not immortal! You\'re a mighty wizard in search of your lost master, Mordamir. Venture into the dungeon and slove the mysteries of each level. Unravel the secrets of The Immortal!', '/images/nes/291/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/85/The_Immortal_cover_Apple_IIGS.jpg', NULL, 5),
(292, 'The Incredible Crash Dummies', NULL, NULL, 'Have fun with some real headbangers... THE INCREDIBLE CRASH DUMMIES!! Spare Tire\'s been dummy-napped, and it\'s up to Slick \'n\' Spin to rescue him from the clutches of The Junkman! Lend \'em a hand as they: Slam and jam on the Crash Test Center tire bounce! Try not to fall head over heels on the Big Top high wire! Go to pieces steering clear of rowdy truckers on The Docks! Shake a leg past snarling dogs and runaway tires at The Junkyard! Knock heads with the Junkman to set Spare Tire free! THE INCREDIBLE CRASH DUMMIES... where fun is a farewell to arms!', '/images/nes/292/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/6/30956_front.jpg', 3, NULL),
(293, 'Indiana Jones and the Last Crusade', NULL, NULL, 'The search for the Holy Grail is on! Hitler must have the Grail to secure his domination of the world and is willing to do anything to get it. Indy\'s father, Dr. Jones Sr., was close to finding the Grail, but was kidnapped. Now Indy must save his father and find the Grail before it\'s too late! Explore six treacherous levels of excitement in a race against time, evil and ancient mysteries!', '/images/nes/293/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e0/Indiana_Jones_and_the_Last_Crusade_%281991%29_Coverart.png', NULL, NULL),
(294, 'Indiana Jones and the Last Crusade ', NULL, NULL, 'The search for the Holy Grail is on! Hitler must have the Grail to secure his domination of the world and is willing to do anything to get it. Indy\'s father, Dr. Jones Sr., was close to finding the Grail, but was kidnapped. Now Indy must save his father and find the Grail before it\'s too late! Explore six treacherous levels of excitement in a race against time, evil and ancient mysteries!', '/images/nes/294/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e0/Indiana_Jones_and_the_Last_Crusade_%281991%29_Coverart.png', NULL, NULL),
(295, 'Indiana Jones and the Temple of Doom', NULL, NULL, 'So you want to wear Indy\'s Stetson hat? Dress up in his beat up leather jacket? Snap his trusty bullwhip? And go on the most exciting adventure of your life? Well, here\'s your chance! Penetrate deep into the Temple of Doom to free enslaved children and recover the sacred Sankara Stones. Fight your way through treacherous caverns, twisting tunnels, narrow ledges and fiery chasms. Take on Thuggee guards, giant spiders and dive-bombing bats. Survive all this and you\'ll meet the evil High Priest, Mola Ram, on the dangling rope bridge for a battle to the death!', '/images/nes/295/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b1/IndianaJonesandTheTempleofDoom_arcadeflyer.png', NULL, 8),
(296, 'Infiltrator', NULL, NULL, 'You\'re Captain Johnny "Jimbo-Baby" McGibbits - The Infiltrator: Ace helicopter pilot, ballistics expert, rock star, motorcycle racer, and all-around good guy. Your assignment: Stop the Mad Leader before he fulfills his life-long goal of total world destruction. Fly through enemy airspace in your Gizmo DHX-3 Attack Chopper, better known as "The Snuffmaster." If hostile aircraft try to stop you, let \'em have it with a few rounds of cannon fire or a heat-seeking missile. Locate your target area, then land your Chopper and carry out the specified ground mission before time runs out. The fate of the free world is in your hands!', '/images/nes/296/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/ec/Infiltrator_Coverart.png', NULL, NULL),
(297, 'International Cricket', NULL, NULL, 'HOWZAT!!? Your teammates let out a loud cry of appeal to the umpire. It seems like an eternity before he raises his arm to indicate the batsman is out. Out LBW for a duck! Your fast bowlers have been deadly accurate. Let\'s hope your batsmen can perform as well when it\'s your team\'s turn to bat. Warning! This is not a spectator sport. International Cricket puts you in total control of bowling, batting and fielding skills. Choose your team from the international line-up, select the best players for the day and may the best team win. International Cricket is a multi-player game that allows you to choose to play a single match or series of matches. Practice in the nets or go straight into the game. Whether you are batting or fielding, your skills will make the difference between winning and losing.', '/images/nes/297/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/82/InternationalCricketAUBoxShotNES.jpg', NULL, NULL),
(298, 'Iron Tank', NULL, NULL, 'The date: June 5, 1944. The United Forces are preparing for their final assault on the Normandy Coast. The mission: Establish a beachhead, break through the front lines, and infiltrate and destroy enemy headquarters. To spearhead the invasion, they have chosen Paul, from Command Unit 88 - a secret unit known as "Iron Snake." An experienced combat veteran with special forces training, Paul has been called a Man of Iron. But to succeed in his mission, Paul will need the full firepower of the United Forces\' mightiest fighting juggernaut: the Iron Tank!', '/images/nes/298/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/7/49267_front.jpg', NULL, NULL),
(299, 'Ironsword: Wizards & Warriors II', NULL, NULL, 'The land of Sindarin summons you, Kuros. This time, the evil Wizard Malkil has unleashed his fury in the form of the four elementals: Earth, Wind, Water and Fire. In order to conquer them and defeat the Wizard, you must reconstruct the IronSword, the only weapon Malkil fears. You\'ll journey through dark caverns and fiery terrain, discovering hidden treasures and magic spells as you go. Seek help from the Animal Kings, but beware of slimy spitters and snapping skulls. Good luck, Kuros. You\'re about to face what no warrior has faced before!', '/images/nes/299/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/6d/Ironsword_cover.png', 3, NULL),
(300, 'Isolated Warrior', 'Max Warrior', NULL, 'They\'re coming to your town! Isolated Warrior is a high-speed, uniquely developed game based on a 3-D concept that features over 40 types of enemy creatures, realistic graphics and explosive sound effects! Become Max Maverick, a lone warrior, who must defeat the awesome creatures that attack his highly civilized planet!', '/images/nes/300/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/70/Isolated_Warrior_Cover.png', NULL, NULL),
(301, 'Ivan \'Ironman\' Stewart\'s Super Off Road', NULL, NULL, 'Grab the wheel and hit the gas! For the first time ever, race up to 4 players simultaneously with Ivan "Ironman" Stewart\'s Super Off-Road. Based on the #1 arcade game, this all-out dirt-grinding race is now available for the NES. Watch out for the mud holes, jumps and other obstacles on the 8 different Stadium tracks. From match-offs to spin-outs, Super Off-Road is as close to genuine short-course racing as you can get!', '/images/nes/301/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/6/49766_front.jpg', 1, 2),
(302, 'Jack Nicklaus\' Greatest 18 Holes of Major Championship Golf', NULL, NULL, 'Hackers beware! You\'re about to tee off on a course so challenging that it would\'ve had history\'s greatest golfers trembling in their knickers. Handpicked by the master himself, 18 of the greatest holes in golf have now been linked together, including the 14th at St. Andrews, 18th at Muirfield, and 12th at Royal Lytham. All the elements of the major championships are here as well - the harsh winds of Scotland, the lightning fast greens of Augusta, Oakmont\'s death traps and the great ocean hazard at Pebble Beach. Trees are everywhere. Birdies are few. And it has more doglegs than a kennel. Even pin placements change from round to round, making double bogeys as common as pars. Up to a foursome can compete, or you can go it alone against a computerized Golden Bear. You also have the option of playing a skins game or stroke play. So get a grip on yourself. Then swing into action on a course as legendary as the man who designed it.', '/images/nes/302/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1c/Jack_Nicklaus%27_Greatest_18_Holes_of_Major_Championship_Golf.jpg', NULL, NULL),
(303, 'Jackal', NULL, NULL, 'Your brothers-in-arms are hostages behind enemy lines, and you\'re their only hope for freedom. But the firepower you\'ll face to rescue them is awesome. Cannons, tanks, submarines and snipers will blast you with horrific crossfire, while jet fighters zero in from above. To defend yourself, you control the army\'s advanced all-terrain attack jeep, with its arsenal of guided missiles and incendiary grenades. Of course these are merely tools, and to save your countrymen you\'ll need more than a handful of gunpowder. You\'ll need a pocketful of miracles, and the ferocity of a wild Jackal!', '/images/nes/303/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/12/Jackal_game_flyer.png', 1, NULL),
(304, 'Jackie Chan\'s Action Kung Fu', 'Jackie Chan', NULL, 'Jackie and his sister, Josephine, are tough on tyrants. As China\'s supreme kung fu champs, they guard their country against the Prince of Sorcerers, who lurks just beyond the Great Wall. It comes as no surprise when this fiend and his ghouls try yet again to seize China for themselves. But this time they\'re clever, casting a spell over Josephine which causes her to vanish into thin air! Jackie is in shock! How can he save his country without his sister? The two have been an unbeatable team! Meanwhile, a demon horde led by the Sorcerer storms the Great Wall and prepares to establish a fierce empire. At the urging of his revered Master, Jackie must now battle the dreaded Sorcerer and rescue Josephine. Maybe he can learn a little magic on his own, because he\'s going to need all the help he can get!', '/images/nes/304/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/34/Jackie_Chan%27s_Action_Kung_Fu_Coverart.png', 1, NULL),
(305, 'James Bond Jr.', NULL, NULL, 'The world\'s greatest scientists have disappeared and now it\'s up to you, as James Bond Jr., to rescue them! Intelligence reports indicate that your old enemy S.C.U.M. Lord has imprisoned them on his island fortress in the Carribean. Following orders from Colonel Monty, you head out on four dangerous missions to save the scientists and thwart S.C.U.M. Lord\'s plans! The action never stops! All your skills as a super spy are put to their limit! Deactivate missiles before they launch to disaster. Crack open safes that hold blueprints of the menacing World Domination Device and use your well-honed combat prowess against scores of enemy agents. Surprises wait around every corner in this thrilling adventure from THQ!', '/images/nes/305/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/16/JamesBondJrTitleCard.jpg', 5, NULL),
(306, 'Jaws', NULL, NULL, 'Based on the successful 1975 film of the same name, Jaws lets you play as a great white shark who must defend his territory from underwater drillers. The game features locations from the movie and destructible underwater environments. Damage the surrounding vehicles, enemies, and structures with your underwater and surface attacks. With "shark vision," you can see your victims before they know you\'re coming. In addition to tearing apart your victims, you must solve puzzles, battle bosses, and overcome a variety of challenges.', '/images/nes/306/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1e/Jaws_%28NES%29.jpg', 1, NULL),
(307, 'Jeopardy!', NULL, NULL, 'Jeopardy! is a Miscellaneous game, developed and published by Ubisoft,  which was released in 2017.', '/images/nes/307/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/c/ce/Jeopardy%21_logo.png', NULL, NULL),
(308, 'Jeopardy! 25th Anniversary Edition', NULL, NULL, 'For the last quarter of a century, some of the smartest people in the world have been competing for cash prizes on Jeopardy!, the high-pressure answers and questions television game show. Now it\'s your turn. Share the excitement with thousands of TV winners. Test your memory against even more challenging "answers" in this all-new edition especially created to commemorate Jeopardy\'s Silver Anniversary. You\'ll be amazed at the things you know!', '/images/nes/308/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/7/49277_front.jpg', NULL, NULL),
(309, 'Jeopardy! Junior Edition', NULL, NULL, 'Now all the fast-paced fun and excitement of Jeopardy! is just for kids! It has all the fun of the adult version... everything you see on TV and more. But the puzzles have been created just for the younger player. It\'s your turn to be the contestant. Compete against your friends or match wits with the computer. There are almost 2000 "answers" to challenge you in over 400 categories... all waiting for your correct "questions" for the big money. Get set to enjoy state-of-the-art graphics, the actual theme music, and hours of fun when you play the Junior Edition of Jeopardy!', '/images/nes/309/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/3/21993_front.jpg', NULL, NULL),
(619, 'The Jetsons: Cogswell\'s Caper!', NULL, NULL, 'George must save Planet M38 from Cogswell\'s destruction! Elroy, Jane, Judy, Astro and Rosie the Robot will give George the things he needs to meet the challenge. Using his anti-gravity boots, glider, and jet board, George will be walking on ceilings, dodging aliens and flying through danger on his way to stop Cogswell. Leap into the future and rescue another world with the JETSONS!', '/images/nes/619/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/8/49288_front.jpg', NULL, NULL),
(620, 'Jimmy Connors Tennis', NULL, NULL, 'Jimmy Connors, ranked number one for 159 weeks, holder of eight Grand Slam titles and a record 109 singles titles - more than any other player in history - is the GREATEST tennis champion ever! Now YOU\'RE Jimmy Connors battling your way to the number one spot. Enjoy a choice of three court surfaces: grass, hard and clay; three skill levels - beginner, intermediate, advanced; tournament or training mode; play singles matches with one or two players.', '/images/nes/620/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a1/JimmyConnorsTennisUSNovember1993NESCoverArtImage.jpg', NULL, NULL),
(621, 'Joe & Mac', NULL, NULL, 'It started out as a warm, peaceful summer day. Joe was lying in the green grass daydreaming about brontosaurus burgers while Mac was away hunting for dinosaurs. Hungry and relaxed, Joe returns to the village... BUT WAIT! Where are all the cavewomen? And where is all the food? That bogus bunch of Neanderthal nerds must have kidnapped the cavewomen and eaten the food! With no time to lose, Joe must single-handedly rescue the beloved cavewomen... and find some dinner along the way!', '/images/nes/621/cover.png', 'https://upload.wikimedia.org/wikipedia/en/thumb/2/28/Joe_%26_Mac_Coverart.png/220px-Joe_%26_Mac_Coverart.png', 1, 2),
(622, 'John Elway\'s Quarterback', NULL, NULL, 'John Elway\'s QUARTERBACK is the home video game you\'ve been waiting for. So real you can see the game like a quarterback does, from the line of scrimmage. You call the plays, you throw the passes, run the ball, and make the tackles. It\'s third down and a long four long yards to the first down that will stop the clock. No time-outs left. The weak side linebacker is lined up inside his defensive end. They\'re coming! You check-off the play at the line of scrimmage and call for a quick pass to the tight end. He breaks it for a T.D.! Named for the quarterback who twice won the AFC Player of the Year Award, this is the game made for every kid who ever wanted to play the game as well as John Elway!', '/images/nes/622/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/4/49284_front.jpg', NULL, NULL),
(623, 'Jordan vs. Bird: One on One', NULL, NULL, 'Here\'s your chance to perform those fakes, drives, rebounds and strategies that make Bird and Jordan the NBA\'s best. Bury 3-pointers from Larry\'s sweet spots. Or slam and jam Jordan style! Plus fouls, steals, shot clock pressure and stat screens. Who\'s the best - Jordan or Bird? The verdict is up to you!', '/images/nes/623/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0f/Jordan_vs_Bird_-_One_on_One_Coverart.png', NULL, NULL),
(624, 'Journey to Silius', 'Raf World', NULL, 'In the ruins of Silius, intergalactic terrorists - and their deadly arsenal of weapons - are waiting for you. Are you prepared to face an endless onslaught of flying war robots, humanoid laser cannons, bone crushing traps, and the seemingly invincible Master Ship? Still want to make the journey? If you do, it will take all your skills to reach the final battle with the terrorist\'s supreme leader, the merciless, all-powerful Skeletal Android. Journey to Silius. It\'s level upon level of gigantic supercharged graphics, thundering sound effects and danger at every turn. Go ahead. We dare you!', '/images/nes/624/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f1/Journey_to_Silius_box.jpg', 1, 4),
(625, 'Joust', NULL, NULL, 'In the medieval age, knights were proving their skills and bravery by playing the game called JOUST. In the future well beyond our knowledge, the knights of hyperspace are playing their version of JOUST. They saddle up the space ostrich, and fight with aliens. You must adjust yourself to this unknown environment called hyperspace. You are not fighting for fame or glory, you are fighting for your own life. Knock the aliens off before they get to you. It is not an easy task, but somebody must do it. Can you be the survivor of this space flight? Good luck! Believe me, you will need it!', '/images/nes/625/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/88/Joust_Flyer.png', 1, NULL),
(626, 'Jurassic Park', NULL, NULL, 'Plunge into a heart-wrenching race for survival! On a tropical island, a violent hurricane rips through the dinosaur preserve, trapping the tourists and freeing the most terrifying animals in prehistory! Two bigger-than-life ways to play: Be a dinosaur!  As a Raptor, rampage across the island battling other beasts and eluding the traps and weapons of your human enemies. As Grant, the paleontologist, arm yourself with tranquilizer guns, and sleeping-gas grenades. Dodge the slashing jaws of the Tyrannosaurus Rex and the paralyzing spit of the Dilophosaurs! 16 mammoth megs of nerve-shredding action!', '/images/nes/626/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/2/21452_front.jpg', NULL, NULL),
(627, 'Kabuki Quantum Fighter', 'Jigoku Gokuraku Maru', NULL, 'The setting - Earth, the future. The defense computer protecting the entire planet has been invaded by a constantly mutating, evolving virus. One lone volunteer has the courage to face the virus on its own ground. Converted to raw data and transferred into the circuits of the computer, the molecular structure of this brave warrior is transformed by the as-yet untested Image Transfer System. Into the circuits of the computer steps an unlikely hero - the Quantum Fighter! Six levels of challenging action, unequalled game control, and a surprising arsenal of weapons!', '/images/nes/627/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/23/Kabuki_Quantum_Fighter.jpg', 1, NULL),
(628, 'Karate Champ', NULL, NULL, 'Your karate championship is at stake. Can you master all the lunges, kicks, spins, somersaults, foot sweeps, reverse punches, and defensive blocks needed to retain your title? Move fast and play smart or you\'ll get flattened before you can grunt! Compete against a friend or challenge the computer. Nine different picturesque settings (plus three challenging bonus screens) provide the backdrops for your matches. Hiiiiieeeeeooooo!', '/images/nes/628/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b7/Karate_Champ_flyer.png', 2, NULL),
(629, 'The Karate Kid', NULL, NULL, 'Think you can handle a real Martial Arts challenge? Then how about guiding Daniel-San through the series of hazards, obstacles, and challenges that stand in his path? But don\'t think that just being able to fight will get you through. This time it\'s not enough to just punch, kick and jump... this time your total martial arts training will be put to the test. Your discipline and inner control could be what saves your life. You must prove that you are capable of thinking, reasoning, and reacting. Catching a fly with your chopsticks or splitting blocks of ice with your bare hand is just as important as fighting face to face with your enemy. This challenge will take you to the streets of L.A., the back roads of Okinawa and many strange areas beyond. Always keep your mind clear and remember all that you\'ve been taught, and maybe... just maybe... you\'ll make it!', '/images/nes/629/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/0/2/49302_front.jpg', 1, NULL),
(630, 'Karnov', NULL, NULL, 'KARNOV, the fire-breathing Russian, is seeking the lost treasure of Babylon. He runs, swims, jumps, climbs and flies through nine levels of game play. Countless bizarre enemies of various sizes and strengths are out to prevent KARNOV from finding the treasure!', '/images/nes/630/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/ea/Karnov_game_flyer.png', 1, NULL),
(631, 'Kick Master', NULL, NULL, 'King Ou II The Kick Master is an Action game, developed and published by Dragon Studio,  which was released in Japan in 1993.', '/images/nes/631/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/fe/Kick_Master_Coverart.png', 3, NULL),
(632, 'Kick Off', 'Super Kick Off', NULL, 'Whatever your style of play may be, be it playing the Long Ball or playing the Sweeper, your players will be in position to receive the passes, control the midfield and tackle an advancing striker. Each player on the field is an individual with a unique combination of four attributes - Pace, Accuracy, Stamina and Aggression. Watch out for the Brazilians at the International level, they are dynamite! Featuring 5 skill levels from International to Sunday League, full size multi-directional scrolling pitch with scanner showing all the players on the field, option to practice and learn ball control, take corners and pratice penalties, and much more!', '/images/nes/632/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/56/Kick_Off_Amstrad_cover.jpg', NULL, NULL),
(633, 'Kickle Cubicle', 'Meikyuu Shima', NULL, 'The Kingdom\'s covered with ice! And it\'s likely to stay that way unless Kickle saves the day! The Wicked Wizard King came to the Fantasy Kingdom and covered the Four Lands with ice. Now, armed with his freezing breath, Kickle sets out to save his friends. Join Kickle as he attempts to rescue the kingdom from this puzzling predicament of perpetual winter.', '/images/nes/633/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Kickle_Cubicle_cover.jpg', 2, NULL),
(634, 'Kid Icarus', NULL, NULL, 'Far away in a kingdom called "Angel Land," the evil goddess Medusa has stolen the Three Sacred Treasures and imprisoned the goddess of light, Palutena. As Kid Icarus, your mission is to find the treasures, destroy Medusa and rescue Palutena from the depths of the Palace in the Sky. To find the treasures you\'ll travel through ruins collecting weapons and storing power for use in combat against creatures of Medusa\'s army. Use your bow and arrow to ward off gatekeepers of the Underworld, Overworld and Skyworld as you strive towards your battle against Medusa. Will you survive to restore Palutena\'s light and return it to "Angel Land?" Only you know!', '/images/nes/634/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b1/Kid_Icarus_NES_box_art.png', 3.5, 4),
(635, 'Kid Klown in Night Mayor World', 'Mickey Mouse III: Yume Fuusen', NULL, '"Hi kids. I\'m Kid Klown. And you know what? It looks like that mean old magician, the Night Mayor (get it? Nightmare?) has klown-napped my funny family. So I\'m going to play a joke on the dude. But I really need your help. Because he lives in a wild klown-dominion, with a bunch of real goons. And all I have is some magic balloons. So c\'mon and give me a hand. I just "nose" you can\'t wait to get started!"', '/images/nes/635/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/9/49319_front.jpg', NULL, NULL),
(636, 'Kid Kool', 'Kakefu Kimi no Jump Tengoku', NULL, 'This is the fastest paced video game anywhere. A race against the clock that only lightning-quick reflexes can win.', '/images/nes/636/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/80/Kid_Kool_Coverart.png', NULL, NULL),
(637, 'Kid Niki: Radical Ninja', 'Kaiketsu Yancha Maru', NULL, 'KID NIKI is truly AWESOME! This rad and bad punk dude is out to rescue his spike-haired girlfriend, Princess Margo, from the clutches of the Stone Wizard. Armed with a razor-sharp sword, this miniature madman slices his rivals down to size!', '/images/nes/637/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5b/KaiketsuYanchamaru_arcadeflyer.png', 1, NULL),
(638, 'King\'s Knight', NULL, NULL, 'Four brave warriors have set out into the Kingdom of Izander to rescue Princess Claire from the grip of a fiendish Dragon. Through five thrilling, fast-action stages, our gallant heroes, a Knight, a Wizard, a Monster, and a Thief, will take on incredible enemies. Join in and help this tough team reach their goal!', '/images/nes/638/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/03/King%27s_Knight_Screenshot1.jpg', 1, NULL),
(639, 'Kings of the Beach', NULL, NULL, 'Sun-bathed beaches from San Diego to Sydney are yours to conquer, as you challenge heavy-hitting volleyball superstars in world championship style competitions. From the opening serve to match point, the sand-blasting never stops. And to survive each grueling round, you must spike, crush, block and make daredevil returns. Timing and positioning are critical in this slam-fest, complete with aces, kills, digs and the dreaded hammer spike. Teamwork is crucial as well, since up to four players can compete at once. So hold nothing back, and bury your opponents in the sand. Because if your tandem wins three matches, you\'re qualified for the next big tournament, the next enormous challenge. But lose and you\'ll be just another couple of beach bums, washed-up like a pile of seaweed!', '/images/nes/639/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/df/Kings_of_the_Beach_Coverart.png', NULL, NULL),
(640, 'King\'s Quest V: Absence Makes the Heart Go Yonder!', NULL, NULL, 'Dark powers summon a cold wind from the north. The terrifying gust surrounds Sir Graham\'s castle, and mysteriously sweeps his fortress and family into the prison of oblivion. It\'s a bitter omen that chills the bones of every man, woman and child in the once peaceful Kingdom of Daventry. Who or what is responsible for this royal theft, and the misery that ravages the heart of Daventry? Has the ruthless wizard Manannan cast another evil spell? Or are the Black Forest Witch and the unforgiving Ice Queen using sinister powers to promote their wicked cause? Only you can answer these questions, as you assume the role of Sir Graham, then set forth on an adventure that will test your intelligence, challenge your skill and rip your courage to shreds.', '/images/nes/640/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/80/King%27s_Quest_V_-_Absence_Makes_the_Heart_Go_Yonder%21_Coverart.jpg', 4, 7.5),
(641, 'Kirby\'s Adventure', 'Hoshi no Kirby: Yume no Izumi no Monogatari', NULL, 'What would Dream Land be without dreams? A nightmare! The Dream Spring, source of all dreams, has dried up, taking with it all the blissful dreams of Dream Land. It\'s up to Kirby, the bombastic blimp, To return happy naps to the inhabitants of Dream Land! Kirby\'s appetite for adventure is as big as ever as he eats his way through a feast of all-new enemies! In this adventure, he can also steal the abilities of the bad guys he scarfs down! With this new power, Kirby can perform 20 new tricks that will help him make his way through the nightmare infested Dream Land! Kirby\'s Adventure features brand new worlds to explore with the same fun action-packed feel that made Kirby\'s Dream Land for Gameboy a hit!', '/images/nes/641/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/ae/Kirby%27s_Adventure_Coverart.png', 3.5, 6),
(642, 'KlashBall', NULL, NULL, 'Sofel takes life simulation into the future with Klashball, for the NES. In a stadium hundreds of years from now, techno-gladiators do battle, combining contact with speed and finesse. Two five-man teams go for it, each fighting to deliver a three-kilo metallic energy sphere into the opponents goal zone. Teams challenge each other in a surreal arena that utilizes devices such as a warp tunnel, ball launcher, and magnetically charged bounce domes. Klashball features a complete league system. There are 11 rowdy teams, each with unique skills, strengths, and weaknesses. After each match the central computer analyzes the outcome and records the stats. Play against the computer or klash it out with a friend. If you\'re ready, take a trip into the 23rd century with Klashball. A game so real, it\'s in your face!', '/images/nes/642/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/0/49330_front.jpg', NULL, NULL),
(643, 'Knight Rider', NULL, NULL, 'KITT is more than a car, it\'s an extension of you, Michael Knight! With radar, lasers, missiles and a turbo-boost that catapults you 50 feet in the air, KITT has no equal. And now, on your most dangerous assignment ever, you take off on a high-speed adventure against a gang of ruthless criminals. You\'ll race day and night through sizzling deserts, icy mountains, big city freeways and more! It\'s up to you and KITT to bring these thieves to justice! Go get \'em Michael Knight. Get every last one!', '/images/nes/643/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/thumb/4/43/KR_NES.PNG/220px-KR_NES.PNG', NULL, NULL),
(644, 'Konami Hyper Soccer', NULL, NULL, 'There is a lot more to this soccer game than meets the eye... Compete in a tournament, play against the computer or your friend, or even watch the computer play both teams. In the event of a tie, you get to do a real penalty kick play-off. You can choose your team from among 24 different countries, and give the team the qualities you like. Figure out your strategy before the game and set your formation. Winning depends on your skill... and a little bit of luck!', '/images/nes/644/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/b/b4/Konamihypersoccer.JPG', NULL, NULL),
(645, 'The Krion Conquest', 'Magical Kids Doropi', NULL, 'Once upon a time, long long ago, the world was experiencing great ruin. Enormous animals were bestowed upon the earth to create terrible pain and hardship for the people. The people were desperate, so they called upon the Old Witches\' World for help.', '/images/nes/645/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/fc/TheKrionConquest_boxart.png', NULL, NULL),
(646, 'Krusty\'s Fun House', NULL, NULL, 'Hey kids! Give a hoot! Help out your old pal Krusty the Clown! My official Krusty\'s Fen House is infested with rats! There are over 60 leverls in this game, and they\'re all crawling with the little varmints! I\'ve got my loyal cadets, Bart and Home Simpson, Sideshow Mel, and Corporal Punishment to guard the rat traps, but I need you to lead the filthy rodents into those traps! Then we blow \'em up! We incinerate \'em! We laser-blast\'em! We electrocute\'em! We Krusterize the little stinkers!!! Hoo boy!', '/images/nes/646/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/96/NES_Krusty%27s_Fun_House.jpg', 3, NULL),
(647, 'Kung-Fu', 'Spartan X', NULL, 'You\'ll need lightning fast reactions to knock out the Knife Thrower, stop the Stick Fighter, and trip up the evil Tom Tom Brothers in this action-packed martial arts contest! Are you sure you\'re tough enough? Because it\'ll take all your strength and skill to master the moves in KUNG FU, beat your opponents, and rescue the fair Sylvia who\'s held captive on the top floor! The action is non-stop, and just when you think you\'ve got your enemies licked there\'s always a Giant, a Snake, or a fire-breathing Dragon to contend with in KUNG FU!', '/images/nes/647/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/82/KungFuMaster_arcadeflyer.png', NULL, NULL),
(648, 'Kung-Fu Heroes', 'Super Chinese', NULL, 'The monsters have taken Princess Min-Min and the treasures. The land has fallen into sorrow. Can Jacky and Lee really save the princess? Now, defeat the enemies with Punch and Miracle Kick! What\'s waiting for you at the 8 castles? Monster Land is full of thrills and mystery!', '/images/nes/648/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/4/4/49344_front.jpg', NULL, NULL),
(649, 'Laser Invasion', 'Gun Sight', NULL, 'A summer offensive in the year 1999. Never in your military career have you been in such a hot spot, as the world\'s most threatening power, Sheik Toxic Moron, deploys his arsenal of TechnoScorch Weapons. To achieve total victory over 4 intense levels, you must possess numerous skills, including precision reflexes for air combat, a cut throat mentality for land assaults, the brains to gather secrets from underground informants, and a keen sense for surviving 3-D battle mazes. If you\'ve got the guts to match those skills, then prepare for action. Because it\'ll really heat up the second you blast across the Sheik\'s firing line, piloting the world\'s most advanced super weapon - the Mach 4 Laser Invasion Helijet, which can go from hovering to a six "G" vertical climb in a heartbeat. From the moment you activate your Vulcan Cannons and Sidewinder Missiles, you\'ll take dead aim on an insane assault, featuring Anti-Copter Rocket Launchers, High-Altitude Bombers and Aerial Mines. But the battle\'s just begun, and there\'s no time to kill between firefights!', '/images/nes/649/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a2/Laser_Invasion_Coverart.png', NULL, NULL),
(650, 'Last Action Hero', NULL, NULL, 'Last Action Hero™ blasts you out of the real world - onto the silver screen - and back again, in seven levels of non-stop action and adventure based on the epic fantasy feature starring Arnold Schwarzenegger. As movie hero Jack Slater, you\'ll team up with your biggest fan, Danny Madigan, who\'s got a magic movie ticket that\'s the ticket to serious trouble. Leaping between both the movie world and the real world with this magic ticket, you\'ll get into wild chases and deadly fights with the most dangerous criminals imaginable. Last Action Hero delivers all the excitement of the Schwarzenegger film with just one difference... you\'re the star! But this time, you must ultimately defeat the arch villains to ensure a happy ending.', '/images/nes/650/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/3/46413_front.jpg', 2, NULL),
(651, 'The Last Ninja', NULL, NULL, 'Brotherhood. Survival. Revenge.', '/images/nes/651/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d3/LastNinja-c64_cover01.jpg', NULL, 15),
(652, 'The Last Starfighter', NULL, NULL, 'You\'re the best there is-the #1 arcade champion. Now your special talents are needed desperately by another galaxy... where the game is about to become reality. Rylos is under attack by the alien forces of Xur and the Ko-Dan Armada. You must repel waves of Xurian fighters, then land and destroy each Command Ship before it penetrates the Frontier and devestates another planet.', '/images/nes/652/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4c/Last_starfighter_post.jpg', NULL, NULL),
(653, 'Lee Trevino\'s Fighting Golf', 'Fighting Golf', NULL, 'LEE TREVINO', '/images/nes/653/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8a/LeeTrevinoFightingGolfBoxart.jpg', NULL, NULL),
(654, 'Legacy of the Wizard', 'Dragon Slayer IV: Drasle Family', NULL, 'Long, long ago, an evil dragon terrorized the forest until it was imprisoned by a powerful wizard. Now, years later, the dragon has revived and it\'s up to you to use the power of the wizard\'s descendants, the Draslefamily, to defeat the dragon once again.', '/images/nes/654/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ec/Legacyofthewizard.jpg', 5.5, NULL),
(655, 'The Legend of Kage', 'Kage no Densetsu', NULL, 'This classic ninja-action game first appeared in arcades in 1985 and became instantly popular. As the Iga ninja named "Kage," players embark on an action-packed quest as they move toward a magic castle where the Princess "Kiri" is held captive by "Yohshirou Yukikusa." To stay alive, players move vertically and horizontally through forest and castle environments and execute massive jumps, all the while using throwing-star knives and a sword to take down hordes of enemies.', '/images/nes/655/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/13/Kageflyer.jpg', 3.5, NULL),
(656, 'The Legend of Prince Valiant', NULL, NULL, 'The quest to find the legendary Viking Ring of Peace begins in treacherous marshland, where every step is potentially lethal. Armed with a mere crossbow, the prince must fight his way through a vast forest, inhabited with cut throats and thieves, down into the underground caverns, through the deadly maze to the ring\'s resting place. Now he must cross the stormy sea and battle the hostile viking armada to reach Camelot. Arthur\'s Hall lies beyond the labyrinthine maze of corridors and passageways...will Prince Valiant make it and fulfil his dream of knighthood?', '/images/nes/656/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/1/36891_front.jpg', NULL, NULL),
(657, 'The Legend of Zelda', 'Zelda no Densetsu 1', NULL, 'Welcome to the Legend of Zelda. Where the only sound you\'ll hear is your own heart pounding as you race through forests, lakes, mountains and dungeonous mazes in an attempt to restore peace to the land of Hyrule. Along the way you\'ll be challenged by Tektites, Wizzrobes and an endless array of ruthless creatures who\'ll stop at nothing to prevent you from finding the lost fragments of the Triforce of Wisdom. But don\'t despair. With a little luck and a lot of courage, you\'ll conquer your adversaries, unite the Triforce fragments and unravel the mystery of the Legend of Zelda.', '/images/nes/657/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/41/Legend_of_zelda_cover_%28with_cartridge%29_gold.png', 9, 12),
(658, 'Legendary Wings', NULL, NULL, '20,000 years in the future, mankind has built a giant supercomputer named DARK to rule the planet. For hundreds of years, DARK has governed with wisdom and justice. But now the unthinkable has happened: DARK is malfunctioning, and humanity is writhing in the grasp of a ruthless tyrant. DARK has built a fleet of robot warships to patrol the skies, and has created an army of mutant monsters to guard the underground bases from which he now terrorizes mankind. Lulled by hundreds of years of peace, the people of earth are defensless against the minions of DARK. But two brave young men, following an ancient legend of Greek mythology, have devised mechanical wings to bear them aloft in search of DARK\'s hidden fortress. Armed with the last remaining guns and missiles from a crumbling arsenal, you must fly them across the continents and oceans to seek out and destroy the cruel colossus! If you fail, mankind is lost. Take wing, Legendary Soldiers!', '/images/nes/658/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/da/Legendary_Wings_game_flyer.png', 1, NULL),
(659, 'Legends of the Diamond', NULL, NULL, 'For decades baseball has been the national past-time of the U.S. with a history both rich and exciting. And for every youngster who ever looked to their sports heroes for inspiration, there have been countless legends of the diamond that rose to the task and made baseball the great game it was and still is today. Babe Ruth, Lou Gehrig, Hank Aaron, and Dizzy Dean are but a few of the superstars that graced this wonderful sport.', '/images/nes/659/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/ca/Legends_of_the_Diamond_cover.jpg', NULL, NULL),
(660, 'Lemmings', NULL, NULL, 'Thousands of Lemmings are on the loose, marching towards extinction unless you can save them. Without minds of their own, they are completely helpless, faithfully following their leader through 125 levels of blazing fires, endless canyons, deadly tunnels and ancient ruins. You or you and a friend can command the Lemmings to dig, climb, tunnel, float and build their way to safety. But you have to move fast, because each moment you hesitate, more Lemmings may drop from above!', '/images/nes/660/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0c/Lemmings-BoxScan.jpg', 13.5, 21.5),
(661, 'L\'Empereur', NULL, NULL, 'Fighting his way from an Officer to Emperor of France, he came closer to unifying Europe than any other leader. A military genius, his weakness in politics eventually led to his demise.', '/images/nes/661/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ed/L%27_Empereur_cover.jpg', NULL, NULL),
(662, 'Les Chevaliers du Zodiaque: La Légende d\'or', 'Saint Seiya: Ōgon Densetsu', NULL, 'The fight has just begun... You will play the role of Seiya, the Knight of Zodiac. You should challenge the Galaxian Wars, the Silver Knights or the Gold Knights to get the sacred armour of Sagittarius. Go, Seiya! Fight against the evil for the sake of Justice!!!', '/images/nes/662/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/4/20454_front.jpg', NULL, NULL),
(663, 'Lethal Weapon', NULL, NULL, 'You know what it\'s all about. That\'s right. The crazy cop and his almost crazy partner are back to do the city a world of good. As Martin Riggs or Rogar Murtaugh, you\'ve got a lot to decide - like how you\'re gonna outwit and outdo the major outlaws of L.A. It doesn\'t get rougher or tougher than the streets of Los Angeles, where you\'ll take on drug smugglers, terrorists, The Organization and a hostage situation at a shopping mall. Which of these four mission will you tackle first? One thing\'s for sure, they\'ll all be tricky ...and deadly. How much of your life and your future are you willing to risk? As Riggs? As Murtaugh? Choose the best man for each mission. Remember, you\'ll need muscle and wits, so choose wisely. If you\'re sharp enough and quick enough, you may have time to catch your breath before you begin your final task for the Internal Affairs Department. This time, you\'ll be tracking down a corrupt police offier; one who knows how you move! So get moving...and do it carefully!', '/images/nes/663/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/18/Lethal_Weapon_Coverart.png', 1, NULL),
(664, 'Life Force', 'Salamander', NULL, 'You\'ve saved the innocent people of Gradius from the vile Bacterions. But now an even deadlier plague has slimed into the neighborhood. It\'s Zelos, an all-engulfing, planet-eating alien who\'s hungering to take a bite out of you! Only this time you don\'t have to rescue the millions of Gradians alone. You can call on a starfighter friend from the planet Latis, who\'ll fight beside you in his RoadBritish space destroyer. You\'ll both be gunning for max power-ups, with ripple lasers, plutonic missiles and impregnable force fields. But you better be on target. For this isn\'t your ordinary space scum. And to crush him you\'ve gotta soar through his guts, blast past his death traps and ultimately blow out his heart. Good luck, Commander. The galaxy\'s counting on you!', '/images/nes/664/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/0/9/44709_front.jpg', 1, 1),
(665, 'Little League Baseball: Championship Series', NULL, NULL, 'Little League Baseball! It\'s the game every kid in America loves to play... And now you can experience the fun and excitement of Little League Baseball at any time of the year, rain or shine, day or night - right in your own living room!', '/images/nes/665/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/3/49373_front.jpg', NULL, NULL),
(666, 'Little Nemo: The Dream Master', NULL, NULL, 'Little Nemo receives a royal invitation to visit the castle in Slumberland. Is he dreaming? It seems the princess is looking for a new playmate. When he arrives he is told that King Morpheus has been kidnapped. Nemo sets off on a wild adventure to rescue the good king and restore peace to the land. Anything can happen in this realm of imagination. Little Nemo even learns how to get a ride from the local creatures so he can pass through the roughest parts of Slumberland. Rescue the King of good dreams and thwart the Master of Nightmares!', '/images/nes/666/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0b/Littlenemocover.png', 3, NULL),
(667, 'Little Ninja Brothers', 'Super Chinese 2', NULL, 'Start out on a journey. You are spirited Ninja boys, Jack and Ryu. Now, go out on your journey to save the once merry world, Chinaland!', '/images/nes/667/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/5/49375_front.jpg', 13.5, NULL),
(668, 'Little Samson', 'Seirei Densetsu Lickle', NULL, 'The Imperial Forgy has been invaded by Ta-Keed the Prince of Darkness! Only the owners of the Magic Bells can stop his forces from destroying the realm. Led by the mountaineering youth, Samson, a force of unlikely heroes sets out to banish evil forever! Become a fire-breathing dragon, a living statue of solid stone or a nimble and crafty mouse. Soar the skies and belch fire balls as Kikira the Dragon Lord! Crush enemy troops with fists of granite as Gamm the Rock Lord! Scurry past dangerous monsters while setting time bombs as K.O. the mouse! These creatures join Little Samson to form a unique and powerful alliance as the last hope for the Imperial Forgy!', '/images/nes/668/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0f/NES-LittleSamson.jpg', 2, NULL),
(669, 'Lode Runner', NULL, NULL, 'You\'re a highly trained Galactic Commando, deep in enemy territory. Your mission: to recover a fortune in gold, stolen from the Bungeling people by their power-hungry leaders. ', '/images/nes/669/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/35/Lode_Runner_Coverart.png', NULL, NULL),
(670, 'The Lone Ranger', NULL, NULL, 'Evil arch villain Butch Cavendish has been a burr on your saddle ever since he did in your dad. Now he\'s kidnapped the President just to lure you to your doom, and there\'s nothing but a trail of doom between you. In fact, kemosabe, there\'s eight wild west stages of pistol packin\' danger to run, shoot, and gallop through, including first person 3-D stages that put peril in a whole new perspective. So hop on your fiery horse Silver, track down that cad Cavendish, and rescue the President. Or with the speed of light and a cloud of dust you\'ll wind up a mere tumbleweed in time!', '/images/nes/670/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/db/The_Lone_Ranger_for_NES_%28cover%29.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(671, 'Loopz', NULL, NULL, 'It\'s really very simple: you get pieces of different sizes and shapes. Then you have to fit them together to form complete loops. It\'s so simple, in fact, that most people can easily finish their first session in... oh... five to ten hours. But by then you\'re addicted.', '/images/nes/671/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a6/Loopz_Coverart.png', NULL, NULL),
(672, 'Low G Man: The Low Gravity Man', NULL, NULL, 'You are the Low Gravity Man! When powered up, you can jump one and three quarters screens high. Capture and use enemy vehicles, including the spider vehicle which can crawl on ceilings. Catch and power up enemy weapons, and much, much more. Your mission is to take back the robot-producing exploration planet from the evil aliens before they reprogram all of the robots for the destruction of the human race. Includes password, infinite continue, and multiple quests for long-term enjoyment!', '/images/nes/672/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0c/Low_G_Man_NES_US_box.jpg', NULL, NULL),
(673, 'Lunar Pool', 'Lunar Ball', NULL, 'Lunar Pool is the first advanced home video billiards game ever. Never before has the player been able to choose among 60 different "tables." Jump around to your favorite, or master each stage consecutively. Your score is kept automatically. You set up the electronic cue stick, aim the cue ball, choose the power you need and shoot! Then watch the ball ricochet around the "table" and land in the pocket. Learn to be a "hustler" by mastering all 60 stages!', '/images/nes/673/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/25/LunarPoolNESBoxart.jpg', NULL, NULL),
(674, 'M.C. Kids', NULL, NULL, 'Meet Mick and Mack - the coolest kids in McDonaldland. Now that Hamburglar has run off with Ronald\'s magic bag, the M. C. Kids need your help to find him. You\'ll need to move pretty fast to dodge creatures like Goferit and I. Psycho, solve tricky puzzles and explore the secret levels of McDonaldland. If you\'re going to help the M.C.Kids track down Hamburglar, you\'re going to have to make some totally fresh moves of your own. Oh yeah - once you\'ve figured out how to play this game right side up - try it upside down!', '/images/nes/674/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/89/M.C._Kids_cover.png', 1, 2),
(675, 'M.U.L.E.', NULL, NULL, 'IRATA. A New World rich with opportunity. For wealth. And power. And you can become the richest, most powerful inhabitant of the newly discovered planet by owning the most land, mining the most precious metal, and supplying the most food and energy to all the peasants - otherwise known as your opponents. To win you need MULEs (Multiple Use Labor Elements), kind of mechanical donkeys which do your dirty work: growing food, mining, and producing energy. MULEs are critical, so you want to get as many as possible as cheaply as possible. And by the way, treachery is acceptable. So use it when needed. Then sit back and enjoy your wealth and power, OH MIGHTY RULER!', '/images/nes/675/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e0/Mule_box.jpg', 6, NULL),
(676, 'M.U.S.C.L.E.', 'Kinnikuman: Muscle Tag Match', NULL, 'With the world\'s tage team wrestling championship up for grabs, wrestlers have gathered to battle it out for this prestigious title. But only those with the most M.U.S.C.L.E. even stand a chance!\nYou and your partner can team up against some great ring tacticians in this fun, action-filled Game Pak. Your opponents\' special wrestling techniques can dazzle, confuse and conquer you. But with the wise use of the Booster Ball when it\'s thrown your way, your team can jump, kick and punch its way to the top in this thrilling and challenging game.', '/images/nes/676/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8a/MUSCLE_game.jpg', NULL, NULL),
(677, 'Mach Rider', NULL, NULL, 'Grip the handles of your futuristic motorcycle. Feel the freezing wind crack against your cheeks. Suddenly you\'re off! Riding at speeds up to 500 miles per hour in a desperate attempt to save the planet. You\'ll love every hair pin curve because you\'ve created this daredevil course yourself. Along the way you\'ll be challenged by an endless array of ruthless villains who will do everything in their power to destroy you and your planet. You\'ll defend yourself with a specially mounted Power Blaster. But watch out! The action is fast. The danger is imminent. Design your own course or ride one of ours, in this lightning fast Nintendo Programmable game!', '/images/nes/677/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/2/49392_front.jpg', NULL, 5),
(678, 'Mad Max', NULL, NULL, 'To understand you must go back, to when the world was powered by the black fuel. For reasons long forgotten, two mighty tribes went to war and touched off a blaze which engulfed them all. Without fuel they were nothing. Man began to feed on man. The gangs took over the highways, ready to wage war for a tank a gas. In the maelstrom of decay, ordinary men were smashed...men like Max -- a man who wondered out into the wasteland. And it was there, in that blighted place, that he learned what it takes to survive. \n\nAnd now it\'s your turn. Survive multiple levels of holocaust on the highways, mayhem in the mine-shafts, and anarchy in the arenas. Then face the final challenge -- if you dare.', '/images/nes/678/cover.png', 'https://upload.wikimedia.org/wikipedia/en/thumb/0/03/Mad_Max_Coverart.png/220px-Mad_Max_Coverart.png', NULL, NULL),
(679, 'The Mafat Conspiracy', 'Golgo 13 II', NULL, 'A "Star Wars" satellite has been snatched out of orbit, the world edges toward nuclear oblivion, and the CIA and KGB are blaming each other. Golgo 13 is back just in time. The Mafat Conspiracy is a phantasmagora of action and interaction. Your eyeballs will stretch from their sockets as you speed through Europe in Golgo\'s Ferrari. Your bones will rattle as you leap across the cars on the Orient Express. And if you think you\'ve seen bad dudes, wait till you feel the power of Duke Togo\'s wicked karate kick. The Mafat Conspiracy is for those who demand the very best in video games!', '/images/nes/679/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0b/The_Mafat_Conspiracy_cover.jpg', NULL, NULL),
(680, 'Magic Darts', NULL, NULL, 'Darts is one of the most popular leisure games of all time. MAGIC DARTS has tournament style action which brings the excitement of real competition into your home. Up to four players can compete using standard NES controllers. Get yourself on target and play MAGIC DARTS.', '/images/nes/680/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f5/Magic_Darts_Cover.jpg', NULL, NULL),
(681, 'Magic Johnson\'s Fast Break', NULL, NULL, 'DRIVE, PASS, SHOOT, SCORE! Now you can slam dunk like the pros!Magic Johnson\'s Fast Break is slammin\' jammin\' basketball action. Play against the computer or an opponent. Up to four players can play simultaneously. Head for the hoop and slam dunk the ball! The better you get the better your salary gets! Simple enough for beginners, challenging enough for pros. Shoot free throws, 3-pointers, execute special plays, and more! Master all five levels of this ultimate basketball contest!', '/images/nes/681/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f2/Magic_Johnson%27s_Basketball_Coverart.png', NULL, NULL),
(682, 'The Magic of Scheherazade', NULL, NULL, 'The Magic of Scheherazade. It\'s the fantasy role-playing game that\'s unlike anything you\'ve encountered. It\'s the action-adventure game you\'ve been waiting for.', '/images/nes/682/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/5/59/Magic_of_Scherezade.JPG', 6.5, 8),
(683, 'Magician', NULL, NULL, 'Long ago in a faraway land, there lived the peaceful people of Merlwood. Here, the art of magic had been refined until all aspects of life were in some way related to magic, and powerful wizards and magicians kept order.', '/images/nes/683/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Magician_Cover.jpg', 4, NULL),
(684, 'MagMax', NULL, NULL, 'It\'s up to you to save the human race by transforming mechanical parts into the ultimate robot warrior--MagMax. On land, on sea, and in outerspace you shoot deadly lasers from your beam gun to fight off the forces of the three-headed mechanical monster of Babylon. If you survive the undersea volcano, you come face to face with Babylon in the final battle of the giant space robots.', '/images/nes/684/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cf/MagMax_Cover.jpg', NULL, NULL),
(685, 'Major League Baseball', NULL, NULL, 'Sure you\'ve always wanted to be a professional ball player but have you ever thought about managing? Well, here\'s your chance to prove yourself both on and off the field.', '/images/nes/685/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e2/MajorLeagueBaseballLJNCover.jpg', NULL, NULL),
(686, 'Maniac Mansion', NULL, NULL, 'Why is there a chainsaw in the kitchen? And a nuclear reactor in the basement? And disembodied tentacles hopping around? And why does that peculiar doctor keep going "Heh, heh, heh... "? Strange things have been going on for years up at Dr. Fred\'s old mansion, ever since that meteor landed just outside the house. But when a sweet young cheerleader named Sandy disappeared into the basement, boyfriend Dave knew it was time to take a look behind the good doctor\'s door. Your task is to help Dave choose a rescue team and guide them on the wildest, wierdest mission your NES system has ever seen. The storyline depends on the individual talents and quirks of the team members you select, and no matter how many times you play, the outcome is never quite the same. Sometimes it\'s puzzling, sometimes scary, sometimes downright funny, but it\'s always, always a challenge. So if you\'re looking for a comedy-adventure that makes you think as hard as you laugh, get into Maniac Mansion today. And then try, just try, to get out!', '/images/nes/686/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5e/Maniac_Mansion_artwork.jpg', 2.5, 6.5),
(687, 'Mappy-Land', NULL, NULL, 'Mappy, who is a policeman, prepared all kinds of wonderful birthday presents for his girlfriend, Mapico. But, Nyamco and his child Mukies have hidden them in the eight towns of Mappyland. What a pity! Mappy must hurry to get the presents back before Mapico\'s birthday party. The problem is that there are so many mysterious towns where Mappy must search, while fighting off his enemies. Can you accept the challenge and help Mappy to succeed?', '/images/nes/687/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/1/49411_front.jpg', NULL, NULL),
(688, 'Marble Madness', NULL, NULL, 'It drove you bonkers in the arcades. Now this mixed-up marble marathon is ready for your Nintendo! The challenge is to roll your marble to the hidden Goal Line on 6 treacherous 3-D raceways. Every corner\'s a cliffhanger. And every second counts! Each raceway is a unique maze of tricky terrain and marble menaces. Can you stay in control as you hunt for the goal? You\'ll teeter up, down and around narrow ramps and ridges. Sneak past hungry Marble Munchers. Battle nasty Steelies for the right of way. It\'s enough to make you lose your marbles! Beat the clock in a battle against time. Or fight a friend\'s marble to the finish! Either way you play, you\'ll be right on the edge to the very last edge!', '/images/nes/688/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/17/MarbleMadness_arcadeflyer.png', 1, 3),
(689, 'Mario Bros.', NULL, NULL, 'Mario and Luigi are doing some underground plumbing when all sorts of weird creatures come flying out of the pipes. Turtles, crabs - even fighterflies - attack the helpless Mario Bros. It\'s up to you to kick, punch, and knock out these sewer pests before time runs out! But beware. Just when you think you got rid of them, they come back for more! Play against the computer, or with a friend - either way, this is one underground classic you\'ll want to play time and time again!', '/images/nes/689/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/4e/Mariobrothers.png', 1.5, 3.5),
(691, 'Mario Is Missing!', NULL, NULL, 'Don\'t look now, but Bowser\'s back, and this time he\'s in your world! But where is that mastermind of reptilian trouble doing his dastardly deeds? And what has he done with Mario??\n\nWelcome to Mario is Missing! Take a trek with your travel agent, Luigi, and see the world! Track down troublesome turtles. Figure out where in the world you are, and what on earth happened to Mario. If your grasp of georgraphy is good enough, you\'ll get the goods, stomp the hoods, and grab Mario out of Bowser\'s ghastly guest house. A learning adventure that the whole family can share.\n\nThis is no Koopa stomping mayhem. It\'s a fun way to learn about our world.', '/images/nes/691/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/Mario_Is_Missing_cover.jpg', 2.5, 4.5),
(692, 'Mario\'s Time Machine', NULL, NULL, 'YOU AND MARIO MAKE QUITE A PAIR. Especially when you\'re battling the common enemy: Bowser.\nSeems Bowser\'s sneaky Koopas have been, throughout time, stealing objects belonging to famous people who, without these valuable objects, wouldn\'t have been able to help and inspire mankinds.\nBut Mario is on to Bowser and his crew. He\'s persuaded the greatest minds in the world to build him a time machine - so that you and he can go anywhere in the world, during and century, in order to find those precious objects and return them to their rightful owners.\n\nYou\'ll visit Cleopatra in the Alexandria of 48 B.C., Plato in the Athens of 369 B.C. and even Thomas Edison in New Jersey in 1879.\n\nSo get ready for an incredible, easy-to-take adventure. Not only will you help the human race, but you\'ll meet the most famous people who ever lived. And you\'ll travel all over the globe and back, back, back into history.\n\nWHAT A TRIP!\n\nGrab your backpack for the learning adventure of your life!\n', '/images/nes/692/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a6/Mario%27s_Time_Machine_SNES.jpg', 1, 2),
(693, 'Mechanized Attack', NULL, NULL, 'At first, it looked like just another revolution. But reports have come in that the rebel forces are backed by an unusual array of high-tech weaponry - and that the rebel soldiers may actually be a fearsome new breed of fighting robots! If this revolution succeeds, the safety of the entire world may be threatened... And that\'s where you come in. You must attempt to infiltrate the island base of the rebel forces. But before you even reach the shore, you\'ll have to contend with enemy gunboats, frogmen, choppers, and destroyers. If you make it to the island, you\'ll find it patrolled by enemy soldiers armed with machine guns, daggers and grenades; vicious attack dogs; and lethal airborne probes, programmed to destroy intruders on sight. Other unknown dangers lie in wait as well. But if you manage to reach the rebel headquarters, you will face the most terrifying threat of all - only no one has made it back to reveal its nature! You\'ll be equipped with a complete arsenal - an assault gun, rocket launcher and grenades - to provide you with a fully mechanized system of attack. You haven\'t got a minute to waste - it\'s time to launch your MECHANIZED ATTACK!', '/images/nes/693/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/27/MechanizedAttack.jpg', 5, NULL),
(694, 'Mega Man', 'Rockman', NULL, 'It\'s MEGA MAN versus the powerful leaders and fighting forces of Monsteropolis - that strange multi-layered land of robot-like humanoids created by the wrongly-performed experiments with human beings by Dr. Wily. Mega Man - the chosen defender of the human race. For he dares to single-handedly penetrate Monsteropolis\' seven separate societies to stop the rapid expansion of strange misrepresentations of humans. Mega Man\'s goal is monumental. He must infiltrate seven separate heavily-guarded empires. By himself, he must break down and destroy the following empire leaders: Cutman, Gutsman, Iceman, Bombman, Fireman, Elecman, and Dr. Wily. The action involves Mega Man armed only with laser beam weapons, encountering strangely-configured humanoids. They\'re atop, in and out of fortified prison-like structures strengthened with thick walls. Hidden amid gun turrets embedded in concrete uprights, even in subterranean passages below icefields. WOW!', '/images/nes/694/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9b/Rockman_1987.jpg', 3, 3.5),
(695, 'Mega Man 2', 'Rockman 2: Dr. Wily no Nazo', NULL, 'He\'s Back! And this time the evil Dr. Wily (once the supreme power in the universe) has created even more sinister robots to mount his attack. But as MegaMan, you\'ve also grown in power and ability. Can you save mankind from the evil desires of Dr. Wily? Each of the eight empires is ruled by a different super-robot. You must defeat each enemy on his own turf, building up weapons as you go. Only after all are destroyed will you go head-on with the mastermind himself, the evil Dr. Wily.', '/images/nes/695/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/be/Megaman2_box.jpg', 5, 5.5),
(696, 'Mega Man 3', NULL, NULL, 'It\'s robot rebellion, and nobody\'s safe! Least of all, Mega Man! This time the superpowerful cyborg takes on a horde of metal maniacs who\'ve had it with being obedient! And they use every android-annihilator ever invented to make you believe it! Mega Man goes berserk, blasting through a galaxy of mining stations in search of energy crystals. But it takes more than guts to battle the phenomenal robot masters who control these worlds. It\'s a wrenching job, the worst - and the best - that Mega Man\'s faced so far!', '/images/nes/696/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/49/Megaman3_box.jpg', 4.5, 5.5),
(697, 'Mega Man 4', NULL, NULL, 'For a year the city has been quiet, but a new robotic terror has gripped the city! That scheming scientist, Dr. Cossack has arrived in town with eight new metal maniacs who are bigger and badder than anything Dr. Wily dreamed of. It\'s going to be a cybernetic showdown as the streets of the city erupt with the sizzling sounds of molten metal! Armed with the new Mega Buster, Mega Man runs, jumps and dodges his way through mazes of metallic munchkins on his way to the Siberian citadel of Dr. Cossack for the final cataclysmic clash!', '/images/nes/697/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Megaman4_box.jpg', 3.5, 5),
(698, 'Mega Man 5', NULL, NULL, 'Protoman has gone berserk! Destroying half the city was not enough. Now, he has snatched Dr. Light and is holding him and the entire city hostage. Speeding to the rescue is Mega Man and his modified Mega Buster, but eight of Protoman\'s cybernetic soldiers plan to send Mega Man to the scrap heap for good! Feel the weight of the world on your shoulders as you battle Gravity Man! Chip away at the rock-like defenses of Stone Man and bring him crumbling down! Hit the surf and sail up against the tidal power of Wave Man! Help Mega Man defeat all eight of Protoman\'s robots and then get ready for the fight that pits brother against brother in the battle of the century!', '/images/nes/698/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2c/Megaman5_box.jpg', 4, 5.5),
(699, 'Mega Man 6', NULL, NULL, 'From the United States, Canada and Japan they came. The world\'s premier designers and their finest robotic warriors traveled to do battle in the First Annual Robot Tournament. But what began as a game suddenly took a terrifying twist! On the eve of the Grand Championship, the sponsor of the event announced that the entire tournament was just an elaborate scheme to get his hands on the world\'s most powerful robots! Now faced with an army of metallic mercenaries, Mega Man must fight a ferocious new foe - The Mysterious Mr. X!', '/images/nes/699/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/17/Megaman6_box.jpg', 4.5, 7.5),
(700, 'Mendel Palace', 'Quinty', NULL, 'Candy needs your help! She\'s fallen fast asleep and may never wake up--because she\'s trapped in her own dream!', '/images/nes/700/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/3/49433_front.jpg', 1, NULL),
(701, 'Metal Gear', NULL, NULL, 'Outer Heaven leader CaTaffy has activated the ultimate super weapon: Metal Gear! Responding to the crisis, covert unit "Fox Hound" is called into action, and that\'s where you come into play. Trained in hand-to-hand combat and skilled in every weapon known to man, you\'re Fox Hound\'s lethal fighting machine, code named "Solid Snake". But on this mission you better be sly as well, to surprise heavily-armed enemies, busting \'em up quietly and rescuing their hostages before alarms are triggered. Plus you gotta maintain radio contact with Commander South, who\'ll feed you crucial info on Metal Gear\'s whereabouts. To survive, capture sub-machine guns, Barettas, grenade launchers, and plastic explosives, until you find and destroy Metal Gear, ending CaTaffy\'s reign of terror!', '/images/nes/701/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/6/38726_front.jpg', 4, 5),
(702, 'Metal Mech', NULL, NULL, 'It can save mankind, but beware... this machine has a mind of its own! Welcome to the all-terrain attack vehicle of the future. It\'s what you need in a world gone to the dogs! You can beat \'em into the ground, or blast \'em underground, or fight \'em alone!', '/images/nes/702/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/18/MetalMechManMachineBoxShotNES.jpg', NULL, NULL),
(703, 'Metal Storm', 'Juuryoku Soukou Metal Storm', NULL, 'Battle Station Cyberg\'s massive computer that keeps peace throughout the solar system is no longer user friendly. It\'s gone wildly out of control. The LaserGun it operates has already destroyed Neptune. Earth is its next target. As a high-tech hotshot, you must enter Cyberg\'s core and activate the system\'s self-destruct mechanism. Mankind is relying on your know-how and toughness to see this thing through. But time is running out... Oh yes, one more thing. the powers of your "Gravity Flip" Suit are essential for a successful outcome to this mission. The Suit empowers you to proceed both upside down and rightside up as you dash to put this computer permanently "on the blink!"', '/images/nes/703/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/46/Metal_Storm_North_American_NES_box_art.jpg', 2, 5.5),
(704, 'Metroid', NULL, NULL, 'It\'s you against the evil Mother Brain in the thrilling battle of Metroid! You\'re inside the fortress planet Zebes. The planet of endless secret passageways where the Metroid are multiplying. Left alone the Metroid are harmless. But in the wrong hands they could destroy the galaxy. It\'s up to you to prevent the Mother Brain that controls Zebes from using the Metroid for evil purposes. But that won\'t be easy. You\'ll have to use your spacesuit to absorb valuable energy for your search to gain the use of power items like the Ice Beam, Wave Beam, High Jump Boots and Varia. If you survive, it will be you and your acquired powers against the Mother Brain.', '/images/nes/704/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Metroid_boxart.jpg', 7.5, 8.5),
(705, 'Michael Andretti\'s World GP', NULL, NULL, 'Superstar Michael Andretti personally guides you through the perilous and exciting world of Grand Prix Racing! Four of the most powerful racing machines are your to command on 16 famous international Grand Prix courses from around the globe! Hone your driving skills or challenge the best - it\'s all up to you in this amazing simulation of Formula One racing!', '/images/nes/705/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/4/1/49441_front.jpg', NULL, NULL),
(706, 'Mickey Mousecapade', 'Mickey Mouse', NULL, '"Help! Help!" echos a mysterious voice. Mickey Mouse, the famous world explorer, has heard the cries of one of his friends and he\'s off on a rescue mission... This adventure starts in a zany Fun House. Join Mickey and Minnie as they turn it inside out looking for their missing friend. A mischievous creature may fly off with Minnie, and you\'ll have to get her back. Now that Minnie is safe, you must help our heroes make it across a vast ocean - on foot! Even the feisty flying fish can\'t stop Mickey from his search, but what about the cantankerous crocodile waiting at the shore? Enter the world of fantasy, mystery and excitement with Mickey and Minnie as you solve the mystery of Mickey\'s missing friend!', '/images/nes/706/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/83/MickeyMousecapadeBoxart.jpg', 1, NULL),
(707, 'Mickey\'s Adventures in Numberland', NULL, NULL, 'Immensely entertaining, Mickey\'s Adventure in Numberland helps improve early number identification and counting skills as it invites children to join Mickey on his quest to locate and return Numberland\'s stolen numbers. The game features 5 imaginative worlds of fun and fantasy-each with two levels and a seemingly endless supply of animated surprises.', '/images/nes/707/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/4/8/49448_front.jpg', 1, NULL),
(708, 'Mickey\'s Safari in Letterland', NULL, NULL, 'Endlessly entertaining, MICKEY\'S SAFARI IN LETTERLAND is a delightful way to help children improve important early recognition skills as they have fun with Mickey and his Disney pal, Goofy! 6 Exciting animated worlds of adventure await all who join Mickey on his safari to find the lost letter tablets and return them to the museum. Hidden surprises are scattered throughout each level--including rare "alphabet jewels" that spell out words and add extra challenge to the fun.', '/images/nes/708/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/53/Mickey%27s_Safari_in_Letterland_Cover.jpg', 1, NULL),
(709, 'Might and Magic Book One: The Secret of the Inner Sanctum', NULL, NULL, 'Feel the Power, Experience the Magic.\n\nLead your party of hand-picked adventurers into the enchanted Land of Varn. From dark, moldy caverns, through corridors of majestic castles, you\'ll travel in search of clues to unlock the Secret of the Inner Sanctum!\n\nADVENTURE!\nDaring exploits of heroism and sorcery will keep you riveted for hours!\n\nMIGHT!\nChoose from a variety of extraordinary personalities, and lead them on an adventure of a lifetime!\n\nDISCOVERY!\nOver 250 weapons and items, and more than 92 mystical spells to use in your search for the Inner Sanctum!\n\nDANGER!\nBattle legions of ravenous monsters as you travel through forests and islands shrouded in mystery!\n\nSURVIVAL!\nThe Battery Back-up feature will save your party from extinction, and Auto-mapping will display and retrace every step of your journey!', '/images/nes/709/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8b/M%26MI.jpg', NULL, NULL),
(710, 'Mighty Bomb Jack', NULL, NULL, 'You and Jack must challenge the king demon Beelzebut to a final fight to the bitter end. Beelzebut has abducted the merciful King Pamera, his queen and the fair princess. He has imprisoned them in his cursed pyramid. The mighty brothers fought bravely against Beelzebut and failed. Jack - the youngest of all the brothers - must restore peace and order in the world. He needs your help.', '/images/nes/710/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f9/Mighty_Bomb_Jack_cover.jpg', NULL, 4),
(711, 'Mighty Final Fight', NULL, NULL, 'The Mad Gear Gang has spread crime and violence throughout the streets of Metro City. Only one man has enough guts to take the streets back from them, Mayor Mike Haggar. Now the Mad Gear Gang has kidnapped his daughter Jessica to bring him under their control. But they\'ve made one mistake: Haggar\'s furious and he wants someone\'s head! Guy and Jessica\'s boyfriend, Cody, are joining Haggar to clean up the slime-filled streets and rescue Jessica. Along the way you\'ll find food to replenish your health, or better yet, search for weapons to knock the living daylights out of your enemies. So join Haggar and his friends as they try to free the city from the evil clutches of the Mad Gear Gang!', '/images/nes/711/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/3/49453_front.jpg', 1.5, NULL),
(712, 'Mike Tyson\'s Punch-Out!!', 'Punch-Out!!', NULL, 'It\'s a right jab, a left hook, an uppercut - it\'s Mike Tyson\'s Punch-Out!! where you\'ll get the chance to compete against boxers from around the globe. Punch your way through 13 bouts in the minor, major and world circuits against tough contestants like Piston Honda, Glass Joe, Super Macho Man and many, many more! Defeat all your opponents and meet the ultimate challenge against the World Heavyweight Champion Mike Tyson in the greatest fight of all - The Dream Bout! Knockout Tyson and you can become WVBA (World Video Boxing Association) Champ!', '/images/nes/712/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/thumb/3/3d/Punch-out_mrdream_boxart.PNG/220px-Punch-out_mrdream_boxart.PNG', 3, 4),
(713, 'Millipede', NULL, NULL, 'Creepy, crawly bugs - jumping spiders, buzzing bees, bouncing beetles, mosquitoes, dragonflies, inchworms and earwigs - have invaded your little garden patch. And you\'ve got to blast fast to get rid of them! But watch out! The millipedes - cousins to the famed CENTIPEDE - are the most insidious insects of all! And if you\'re not careful, you might be caught in a swarm of bees, mosquitoes, or dragonflies. Fast action graphics and real bug sounds make this game just like the arcade smash hit!', '/images/nes/713/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/af/Millipede_Poster.png', 1, NULL),
(714, 'Milon\'s Secret Castle', 'Meikyuu Kumikyoku', NULL, 'Guide Milon through the four levels of Garland Castle in his quest to reach the top floor and vanquish the big boss!  The journey is a difficult one though, because the castle is locked up tight and Milon doesn\'t have the keys.  You will have to use your bubble attacks to fend off the castle baddies while busting up every block in sight trying to find all of the hidden treasure and other secrets throughout the game. Unlike most platformers, Milon\'s Secret Castle is less about defeating all of the enemies in an area, and more about scouring every bit of each room to find the secrets that lie within Garland Castle!  Milo can uncover practically anything in the game.  This includes:   items, power-ups, money, shields, keys, level exits, even shops!  The only way to get to each level boss is to find the right secret items!', '/images/nes/714/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fb/Milon%27s_Secret_Castle_cover.jpg', 1.5, 4.5),
(715, 'The Miracle Piano Teaching System', NULL, NULL, 'Learning is easier when you\'re having fun. The Miracle Piano Teaching System packs all the excitement of true NES-style video games. Plus, the built-in orchestra plays along with you for an incredible musical experience!', '/images/nes/715/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/7/49457_front.jpg', NULL, NULL),
(716, 'Mission: Impossible', NULL, NULL, 'Good Morning, Mr Phelps...', '/images/nes/716/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/66/Mission_Impossible_for_N64%2C_Front_Cover.jpg', 10, NULL),
(717, 'Monopoly', NULL, NULL, 'This special MONOPOLY game brings to life all the wheeling, dealing, money-making fun of the world\'s most popular board game - and adds the fast action, hands-on excitement of the NES! There\'s visual entertainment with the animated Rich Uncle Pennybags and Community Chest and Chance Cards, and the speedy sports car and other tokens that zoom around the board. Now listen for voice enhancemants such as the "jailer" who kicks Rich Uncle Pennybags out of Jail, and the digitized sound of the train whistles on the Railroad spaces. Like a real estate big shot, you let computer "accounting" keep track of your cash, assets, properties, houses and hotels. You can play with real, live real estate moguls, or take on the computer opponents, who might be beginners - or savvy big-time traders! The MONOPOLY game everyone grows up with, plus the NES... all in all, it\'s a real sweet deal!', '/images/nes/717/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0d/Monopoly_%281991%29_Video_Game_Cover.jpg', NULL, NULL),
(718, 'Monster in My Pocket', NULL, NULL, 'Thousands of history\'s famous monsters gather for the meeting of the century. But their volcanic convention center erupts, mysteriously turning them into terrors of pint-size proportions. They escape to the home of Jack, the teenage "Captain of Cool." There begins a battle between the good ghouls and The Warlock\'s band of evil beasts. You must become The Vampire or The Monster and lead the forces of right through a humongous, human-size world six levels deep, featuring Jack\'s house, a scummy sewer, a hazardous construction site, and an odd oriental palace. Don\'t get burned on the kitchen stove or crushed by runaway golf balls. Meanwhile you\'ll have to punch and zap at all your fiendishly favorite monsters including the head-rolling Skeleton, the rock candy throwing Goblin, the bone-crushing Cyclops, and dozens more! Every monster you mash is worth points. Score enough and you\'ll get an extra life. Something you\'ll really need when you finally face the powerful Warlock and his magic lightning jolts. So be a pocket-size peacemaker and conquer the smallest threat to monsterdom the world has ever known!', '/images/nes/718/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/c/cd/Monster_in_my_Pocket_cover_%28NES%29.PNG', 1, NULL),
(719, 'Monster Party', NULL, NULL, 'Walking home from a baseball game one evening, Mark gazed up at the misty sky. Suddenly, a blazing star plummeted to earth with a blinding light. When Mark regained his sight, a mysterious creature was standing before him. The creature told an eerie tale about his home planet, the Dark World, where evil monsters were terrorizing the helpless population. He was searching the galaxy for a warrior capable of freeing them from their terrible plight. The creature explained that Mark\'s bat was the perfect weapon for defeating the evil monsters. Mark considered the creature\'s proposal for a minute, then agreed to undertake the dangerous mission. After all, he thought, it sure beats going to school!', '/images/nes/719/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/5/49465_front.jpg', 1.5, 2.5),
(720, 'Monster Truck Rally', NULL, NULL, 'You\'ve never experienced anything like the incredible action of MONSTER TRUCK RALLY! Compete against the computer - or against up to three of your friends at once - in nine grueling, gear-grinding events: hill climb, drag race, car crush, sled pull, monster rally, drawbridge, donuts, tug-o-war, and bog! Whether you build your own custom course, or have the computer build one for you randomly - out of millions of possible combinations - every event is sure to be an awesome new challenge, every time!', '/images/nes/720/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/57/MonsterTruckRallyBoxShotNES.jpg', NULL, NULL),
(721, 'Motor City Patrol', NULL, NULL, 'You are one of MotorCity\'s finest performing your regular duties: patrolling every street, making routine arrests, issuing tickets, and setting up speed traps. Suddenly the calm is broken! There\'s a crime in progress and you\'re the first to respond. You contact the helicopter patrol who\'s already on the scene. Time is of the essence. Using your surveillance map, you find the best route to the scene of the crime just in time to make the collar. It\'s a tough job, but somebody\'s got to do it!', '/images/nes/721/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Motor_City_Patrol_Cover.jpg', NULL, NULL),
(722, 'Mr. Gimmick', 'Gimmick!', NULL, 'You\'ve gotta have a gimmick!', '/images/nes/722/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/9/37289_front.jpg', NULL, NULL),
(723, 'Ms. Pac-Man', NULL, NULL, 'Ms. Pac-Man is here to drive you totally wild and crazy with more fun than you\'ve ever imagined! Four feisty ghosts are chasing MS. PAC-MAN. Use your skill and strategy to rack up points while outrunning the gobbling ghosts. Grab an energy pill, and score even more points. Now gobble up all those fearless ghosts!', '/images/nes/723/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/3/80413_front.jpg', 1, 2),
(724, 'Muppet Adventure: Chaos at the Carnival', NULL, NULL, 'Yipes! The awful, evil Dr. Grump has pignapped the lovely Miss Piggy and taken her to his secret carnival hideout! Now Kermit and the whole crazy Muppet crew need your help! Jump! Leap! Hop! And charge into action! But watch out! Dr. Grump\'s Carnival of Clamorous Confusion is a rollicking roller coaster of thrills, spills, and chills! Join Kermit as he faces the fearsome challenge of the Raging River Ride. Help Fozzie lick the Amazing Ice Cream Maze. (But beware of those Canine Carnival Barkers!) Blast off with Gonzo on the Lost in Space Ride. Then let Animal drive you crazy on the incredible Crash Car Course. And if you dare, enter the ultimate challenge - the Cave of the Grumpasaurus! Only your quick wrist, sharp wit - and some help from Kermit and the gang - can defeat Dr. Grump and rescue the still-lovely Miss Piggy! It\'s Muppet mayhem! You\'ll want to play again and again!', '/images/nes/724/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/03/Muppet_Adventure_Chaos_at_the_Carnival_Cover.jpg', NULL, NULL),
(725, 'The Mutant Virus: Crisis in a Computer World', NULL, NULL, 'Ron Trainer, the hottest of the elite corps of Computer Master Debuggers is enjoying his first week of vacation in over two years. He\'s been busy keeping CPI running errorfree. CPI, the Central Programing Institute, is what allows the world to exist the way it does. It controls everything; from global databases and grids to holographic theater software as well as the simple timing of the traffic signals. But something is terribly wrong tonight... cities around the globe have lost their power and data feeds. There have been several major aerial collisions between passenger liners and heavy freighters and the skyways have been closed until global traffic control is back on-line. All power and light have been lost and the atmospheric control system can only continue to function on auxiliary power for the verge of collapse. There is rioting reported in several areas. What\'s going on??? This appears to be more than a simple system\'s bug... but how much more?', '/images/nes/725/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5e/The_Mutant_Virus_-_Crisis_in_a_Computer_World_Coverart.jpg', NULL, NULL),
(726, 'Mystery Quest', NULL, NULL, '"As my apprentice, you have been studying a long time to master the secrets of magic. Now the time has come to prove yourself. You must journey to the four Mystery Castles in search of four magic talismans. You will face many perils along the way: the castles are riddled with underground passages and intricate mazes, where you may become lost forever! And strange creatures prowl the castles, ready to pounce upon you when you least expect it! But you will find magic powers hidden along the way, to help you in this Mystery Quest. The magic talismans you seek are the greatest gifts known to man: wealth, wisdom, happiness, and peace. Go now, complete your quest, and prove that you are as great a wizard as I!"', '/images/nes/726/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6c/MysteryQuestNABoxart.jpg', 4.5, NULL),
(727, 'NARC', NULL, NULL, 'A routine stop for a traffic violation turns into a bloodbath as a drug dealer kills eight police officers. The DEA sends Detectives Jack Forzenski and Marcus Hill to help investigate a new mystery drug and to untangle a web of lies, betrayals, secrets, and temptations. As Jack and Marcus, your decisions determine whether you\'re a good cop or a bad cop--turn the drugs into evidence and become the hero, or sell them on the street to earn some cash. No matter what path you choose, NARC gives you the chance to bust criminals, wield an arsenal of hi-tech police weaponry, and engage in rough street fighting.', '/images/nes/727/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/52/Narc_arcade_flyer.png', NULL, NULL),
(728, 'NES Open Tournament Golf', 'Mario Open Golf', NULL, 'Whether you\'re an aspiring amateur or a professional-class golfer, NES Open Tournament Golf puts you right in the thick of a world-class golf tournament. Select your club, check the wind and the lay of the turf, and then drive your way toward winnings worth over one million dollars! Pick from three tough courses: one in the US, one in Japan, and one in the UK. Practice your strokes, then compete against a friend. For the ultimate challenge, tee off against 36 computerized golfers and compete for top ranking. It\'s all here in NES Open Tournament Golf! So warm up on 18 holes and move up to tournament play. The better the golfer, the bigger the prize. Give it your best shot and go for the big money!', '/images/nes/728/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f8/Nesopen.jpg', 2.5, 20),
(729, 'NES Play Action Football', NULL, NULL, 'Nintendo takes to the gridiron with the classic football powerhouse NES Play Action Football. Featuring a distinct overhead viewpoint that creates an almost 3-D field, the action is more simulation-based than many of the more arcade-based games of the time. Play through four 15-minute quarters (in accelerated time) and even substitute players when your first-stringers get tired', '/images/nes/729/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/86/NES_Play_Action_Football_Cover.jpg', NULL, NULL),
(730, 'New Ghostbusters II', NULL, NULL, 'The world-wide hit movie is now available on the Nintendo Entertainment System! Capture the ghost that haunted New York City in this comedy-action-adventure. Six stages in all, including a Courtroom, the Subway, the Art Museum and more!', '/images/nes/730/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8e/New_Ghostbusters_2_Coverart.png', 1, NULL),
(731, 'Kiwi Kraze', NULL, NULL, 'When Wally the Walrus kidnaps 20 of your your kiwi pals, you rush to the rescue. As Tiki the kiwi bird, that\'s not so easy - you can\'t fly and you wouldn\'t hurt a flea. But Wally\'s stashed your friends in dangerous spots all over New Zealand and it\'s up to you to save them. Beak up, Tiki! Just rely on your quick wit and fast footsies. And keep your bow and arrow on the draw, because every Kiwi Kraze creature you meet will try to do you in - from playful penguins to ornery octopi. Hurry up! Better find your birdie buddies in time. Wally\'s got himself a kiwi cookbook, and your friends are the main ingredient!', '/images/nes/731/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/1/49331_front.jpg', NULL, NULL),
(732, 'NFL Football', NULL, NULL, 'It\'s very simple... the NFL is football and this is the only officially licensed NFL game for the NES... the closest thing to "real" professional football that you can play without a helmet and shoulder pads. You can select any of the American and National Conference teams, and if you\'re good enough, you can take them all the way to the Super Bowl! Team rosters are broken down into positions and individually rated according to skills, with position upgrade packages, player ability handicapping, actual NFL Offensive and Defensive Playbook alignments with audibles and even variable wind direction and strength. You not only coach from the sidelines, you also control all the movements of the players on the field. Run, pass, catch, kick, punt, jump, tackle, block and dive... Refs even call penalties. No matter what kind of fan you are, whether you know the rulebook inside-out or just watch an occasional game on TV... this is the one football game you\'ve got to have!', '/images/nes/732/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d4/Football_Intellivision_cover.jpg', NULL, NULL),
(733, 'Nigel Mansell\'s World Championship Racing', NULL, NULL, 'Hold onto your engines and pour on the coal as you hit the track with the greatest name in World Championship racing, Nigel Mansell. You\'re in control. You\'ve got the machine. But can you handle it? Try rough weather, a mean track and competition that won\'t quit. Or, go for one-on-one pointers from Mansell and have the track all to yourself while you practice the moves of a master. Then, check in for the big one. And don\'t forget your crash helmet.', '/images/nes/733/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/5/46515_front.jpg', 10, NULL),
(734, 'A Nightmare on Elm Street', NULL, NULL, 'Something frightening has been happening on Elm Street lately. It seems that with each waking day another grussome discovery is made... another neighborhood teen has mysteriously passed away into the dark stillness of the night. Everyone says it\'s "natural causes," but it seems as if something (or someone) has been picking them off one by one in their sleep. It\'s a horrible nightmare come true... and this nightmare has a name: Freddy Krueger.', '/images/nes/734/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/30/A_Nightmare_on_Elm_Street_NES_box_art.jpg', 2, NULL),
(735, 'Nightshade', NULL, NULL, 'The shadows of doom grow long as the ancient Egyptian villain Sutekh envelops Metro City with a wave of crime. But Sutekh\'s seedy underworld is about to be infiltrated by a superhero unlike any the world has ever seen. A superhero who can melt into the darkness like a phantom. By day this brave new crimefighter is a common ordinary citizen. But when night falls, he is cloaked in a secret identity to seek out and destroy the dark forces that lurk on midnight streets. Who is this man the press calls Nightshade? Only you can answer that... for he is you! Every night you solidify your superhero status, patrolling 100 of the city\'s darkest corners. Here you\'ll find thieves, muggers, and other alley scum that you must either deal with or destroy for clues. But be warned. You\'re not the only night stalker. For as you hunt Sutekh, Sutekh hunts you with the human printing press, the closing wall of spikes, deadly jackal pits, and the chilling freeze ray. Of course the ultimate key to destroying Sutekh is your popularity. For it\'s a power source that gives you the wit to decipher clues and the strength to pulverize villains and rescue innocent bystanders. Remember, if this heroic prowess ever diminishes, you\'ll no longer control the night. You\'ll be consumed by it.', '/images/nes/735/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Nightshade_%28PS2%29_Coverart.png', NULL, NULL),
(736, 'Ninja Crusaders', NULL, NULL, 'They struck without warning, wiping out the Earth\'s defenses in one master stroke. Cities were crushed, and the invading aliens showed no mercy! A small resistance force of Ninja, refusing to be conquered, still remained to fight the evil Inimicus. A daring plan was devised by the Ancient Ones to send out two special Ninja, and annihilate the alien threat once and for all!', '/images/nes/736/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/6/49496_front.jpg', NULL, NULL),
(737, 'Ninja Gaiden', NULL, NULL, 'Ninja Action! The stage is set for conspiracy, mystery and evil in America. Come with Ninja Ryu as he takes you on his fateful journey. Tecmo\'s unique cinema display system develops the story stage by stage. You piece together the puzzle, while watching the movie-like graphics. Decide what action to take. Use the secret sword and items collected during the action scenes to fight your way to the goal!', '/images/nes/737/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1d/Ninja_Gaiden_%282004_video_game%29.png', NULL, NULL),
(738, 'Ninja Gaiden II: The Dark Sword of Chaos', NULL, NULL, 'Dynamic action scenes! Split your body into three, destroy all enemies with the Invincible Fire Wheel and other new Ninja fighting techniques! Ninja Gaiden II gives you the feel of real Ninjutsu! Exciting cinema display format! Ninja Gaiden II uses the same Cinema Display Format as the original. The fiendish plot unfolds in a movie-like sequence. Action, drama, revenge. Just wait till you get to the end!', '/images/nes/738/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/66/Ninja_Gaiden_II-_The_Dark_Sword_of_Chaos_boxart.jpg', 2, 4),
(739, 'Ninja Gaiden III: The Ancient Ship of Doom', 'Ninja Ryuukenden III', NULL, 'Thrilling new cinema screen! Follow the story of Ryu\'s epic adventure through Tecmo\'s movie-like Cinema Screen Animation. As you complete each level, a new part of the story unfolds. Exciting new powers and weapons! Over the years Ninja Ryu\'s fighting skills have improved to include fantastic new powers and weapons. Action-packed Ninja adventure! Can you get Ryu through his most challenging adventure, as he battles the hideous ancient forces of darkness to save mankind? The Ultimate Ninja Challenge!', '/images/nes/739/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ec/Ninja_Gaiden_III_The_Ancient_Ship_of_Doom.jpg', 2.5, 14),
(740, 'Ninja Kid', 'Gegege no Kitaro: Youkai Daimakyou', NULL, 'When the monsters of Demon Island steal human spirits as their first step in conquering the world, Ninja Kid comes to the rescue. In this Game Pak, the young champion of justice must evade a number of traps that these demons have contrived. And in this action-packed adventure, Ninja Kid survives a wicked dogfight, fights enormous fires, and duels against a giant demon in order to recover the stolen human spirits.', '/images/nes/740/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/0/6/49506_front.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(742, 'Nintendo World Championships', NULL, NULL, 'Have you ever wondered who the best video game player in the world is? Or have you ever pondered how your scores would stack up against the very best? Well wonder no longer - your questions may soon be answered!', '/images/nes/742/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/5/64795_front.jpg', NULL, NULL),
(743, 'Nintendo World Cup', 'Nekketsu Koukou Dodgeball-bu Soccer-hen', NULL, 'The eyes of the world are upon you. National pride is at stake. Only seconds left and the crowd rises in anticipation of the greatest upset in soccer history. The horn sounds and you\'ve won it all! The coveted world cup trophy is yours! Pick your team and plan your game strategy. Use advanced super moves like the Bicycle Kick or the Super Header. Choose from 13 teams, representing countries from around the world. Defeat your opponents and you\'re on your way to the prestigious world cup final. Bring the excitement of international soccer home with Nintendo World Cup!', '/images/nes/743/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f0/Nintendo_World_Cup_Cover.jpg', 5, NULL),
(744, 'Noah\'s Ark', NULL, NULL, 'Flood, Sweat and Tears-', '/images/nes/744/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/88/Noah%27s_Ark_NES_cover.jpg', NULL, NULL),
(745, 'Nobunaga\'s Ambition', 'Nobunaga no Yabou: Zenkokuban', NULL, 'Enter a world most people have never heard of -- 16th century Japan. The Shogun has just fallen, leaving the government weak and ineffective. The country\'s greatest warlords, the daimyos, have taken up arms against each other. Alliance and friendships are quickly forgotten as each daimyo pursues the same goal: to rule the entire nation -- to become Shogun.', '/images/nes/745/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3e/Nobunagas_ambition_gen.jpg', 40, NULL),
(746, 'Nobunaga\'s Ambition II', NULL, NULL, 'Released December 1988 for PC-88SR, then quickly ported for various Japanese PCs. Taking after the Romance of the Three Kingdoms series, this game introduces the concept of "generals" to this series. The Tōhoku and Kyūshū areas were removed. Releases for Family Computer, PlayStation, Sega Saturn, DOS, and mobile phones were made subsequently. The U.S. Nintendo Entertainment System release was titled Nobunaga\'s Ambition II.', '/images/nes/746/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/0/7/49507_front.jpg', NULL, NULL),
(747, 'North & South', 'North and South', NULL, 'CHAAARRGE!!! Strategy and skill are required for this unique game. Its numerous options will allow you to live the Civil War again. In the world of the comic book - Les Tuniques Bleues - you become a Yankee or Confederate. Encircle your enemy and launch surprise attacks. Selecting one or two players, move your troops, stop trains, take forts by assault and in the final part, lead a genuine little army on the field. To your sabres!', '/images/nes/747/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/0/49510_front.jpg', 1.5, NULL),
(748, 'Operation Wolf', NULL, NULL, 'A group of desperate terrorists is keeping hostages in their jungle fortress. As a member of the elite tactical squad Operation Wolf, you must invade their hideout, destroy their operations, and get the hostages out alive! Maneuver through a series of missions and fight off soldiers, patrol boats, helicopters, and more.', '/images/nes/748/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/03/Operation_Wolf_Poster.png', 1, NULL),
(749, 'Orb-3D', NULL, NULL, 'You are about to face the challenge of your lifetime. The evil wizard, Krohn, has threatened to engulf the galaxy in an enormous Black Hole. Your best hope for survival lies with the Millenium Orb, the only ship capable of withstanding the Black Hole\'s gravitational forces. Dive into the Black Hole and battle Krohn, face to face. But to reach the Wizard, you must master 30 mystical puzzles that test your skill, wits, cunning and courage at every turn. You\'ll battle the power of black magic as you attempt to reach Krohn\'s lair for the ultimate confrontation. Mind-boggling challenges await you as you fly the Orb into the depths of the Black Hole and the very face of destruction.', '/images/nes/749/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/5/49515_front.jpg', NULL, NULL),
(750, 'Othello', NULL, NULL, 'The well-acclaimed board game for all ages, Othello, is now on Nintendo Switch! Play in the comfort of your home or outside, and play in a style that suits you best!', '/images/nes/750/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b6/Othello_%28video_game_-_box_art%29.jpg', NULL, NULL),
(751, 'Over Horizon', NULL, NULL, 'Over Horizon is an Action game, developed by Pixel and published by Hot-B,  which was released in Japan in 1991.', '/images/nes/751/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9b/OverHorizonBoxShotNES.jpg', 1.5, NULL),
(752, 'Overlord', NULL, NULL, 'Controlling a mysterious figure that has inherited the legacy of the evil, long-dead Overlord, the player emerges, near death, from the ruins of the old Overlord\'s Dark Tower. Only the player\'s actions determine if they will rise to become the new all-powerful Overlord; it\'s all down to how much of a bad ass they want to be in order to succeed...evil or really evil! Played out with plenty of black humour and dark irony, the game immerses players in twisted parodies of classic fantasy scenarios and characters. Overlord\'s key innovation is the introduction of an array of impish creatures  the Minions. They believe you are the old Overlord reborn and will use their unique skills to fetch, fight and die for you. Throughout the game players actively control a horde of these gremlin-like critters and they follow your every instruction no matter how despotic or, for the Minions, life threatening it is.', '/images/nes/752/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7c/Overlord_pc_uk.jpg', NULL, NULL),
(753, 'P.O.W.: Prisoners of War', 'Datsugoku', NULL, 'Control a military prisoner who breaks free from his cell, and must fight through waves of incoming enemy combatants. Fight via close-quarters-combat, or shoot your enemies with weapons they have dropped in this side-scrolling beat \'em up originally released in 1988!', '/images/nes/753/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/6/49516_front.jpg', 4, NULL),
(754, 'Pac-Man', NULL, NULL, 'Gobble, gobble, gulp! Who\'s munching Power Pellets? Who\'s zipping around the maze at top speed, chomping up ghosts and scoring big points? It\'s Pac-Man, the world\'s hungriest character! Devour a fruit treat and get a big bonus score. But if you\'re caught by the little haunters, you\'re ghostflakes! Use the warp tunnel for a quick escape. Hours of ghost-chomping action!', '/images/nes/754/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/16/Pac_flyer.png', 1, 6),
(756, 'Palamedes', NULL, NULL, 'Palamedes is a puzzle-shooter... a refreshing new type of video game for which you\'ll need sharp wits and quick fingers to escape the lines of dice that come rapidly plummeting down on you. Your objective is very simple, destroy the cascading lines of dice before you are squashed under their weight. The pace is fast and the action intense. Palamedes is not for the weak or for the meek.', '/images/nes/756/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c9/Palamedes_Cover.jpg', NULL, NULL),
(757, 'Panic Restaurant', 'Wanpaku Kokkun no Gourmet World', NULL, 'Hot dogs on legs, jumping eggs, flying apple slices, hungry hamburger buns, pans shooting fried shrimp - WHAT\'S GOING ON?? Ever since the mad chef, Ohdove, stole the Eaten Restaurant from Cookie, strange things have been happening! To win back the Eaten, Cookie must face a restaurant that has come to life! Mutant food and appliances are just eager to cook Cookie! But Cookie knows his way around a restaurant, so armed with just a few simple kitchen tools, he is going to challenge Ohdove and the army of mutants!', '/images/nes/757/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/1/49521_front.jpg', 2, NULL),
(758, 'Paperboy', NULL, NULL, 'Hop on your bike for a free-wheeling ride up the avenues of not-so-typical suburbia. There are papers to be delivered, robbers to be foiled, and fame and fortune to be won as you brave the mean streets. Avoid motorcycles, tricycles, traffic, tires, gratings, curbs, dogs, skateboarders, breakdancers, bad guys, and other hazards as you deliver to your customers. Earn bonus points by hitting targets along the obstacle course at the end of your route. With superb animation and sound effects, Paperboy brings home all the thrills, spills, challenge, and excitement you loved in the arcades.', '/images/nes/758/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7e/Paperboy_arcadeflyer.png', 3, 3),
(759, 'Paperboy 2', NULL, NULL, 'Rise and shine, bud! A great day\'s ahead, just waiting for you to become the neighborhood\'s terror of a paperboy. but it\'s a whole new job with double the fun and twice the excitement! That\'s right, you\'ve now got houses on both sides of the street - which means even more customers\' homes to deliver papers to and non subscribers\' homes to damage. It also means you\'ve got to watch out for lots more obstacles and meanies that are out to knock you off your bike! Wreak mischief across the town or do good deeds like saving the baby and stopping the burglar. At the end of the day, hone your skills on the all-new BMX-style test course. Add the new awesome graphics, and you\'re in for a rip roaring time on your bike!', '/images/nes/759/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c7/Paperboy_2_Cover.jpg', 5.5, NULL),
(760, 'Parasol Stars: Rainbow Islands II', NULL, NULL, 'Get ready for some finger-searing action as Bub and Bob blast their way onto your computer screen. Use four kinds of elements - Fire, Water, Lightning and Star - to overcome wave upon wave of nasties bent on ending your quest to rid the universe of the evil mastermind Chaostikahn! Whether you play alone or with a friend, stay alert! Your only hope of reaching the final showdown is to unlock the secret of Parasol Stars!', '/images/nes/760/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/9/28589_front.jpg', NULL, NULL),
(761, 'Parodius', 'Parodius Da! -Shinwa kara Owarai e-', NULL, 'Jikkyou Oshaberi Parodius is an Action game, developed by KCEO and published by Konami,  which was released in Japan in 1995.', '/images/nes/761/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f9/Parodius_logo.png', 1.5, NULL),
(762, 'Peter Pan and the Pirates', NULL, NULL, 'Neverland. That magical island where dreams come true and children never get old. Home to mythical tree fairies and beautiful mermaids. The most wonderful place in the whole world. "Wonderful, indeed," thought Captain Hook, the wickedest pirate on the seven seas, "but not for long! When my crew of cutthroats is done ravaging the island, Neverland will be mine at last. Then, I\'ll have my revenge on that litttle pest Peter Pan!He\'ll walk the gangplank before I\'m through!" Now you can help Peter Pan rid Neverland of the evil pirates and destroy Captain Hook once and for all! But hurry! There\'s no time to lose!', '/images/nes/762/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Peter_Pan_and_the_Pirates_NES_cover.jpg', NULL, NULL),
(763, 'Phantom Fighter', NULL, NULL, 'Wacky Chinese phantoms, Kyonshies, are on the loose, wreaking havoc in eight villages. Phantom Fighter and his incompetent assistance are the only ones who can save the villagers from these zombie ghosts that get bigger and stronger as you get better. Answer tricky quizzes to acquire special skills from the Kung Fu Master. Then you can chop and kick your way to victory!', '/images/nes/763/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f3/Phantom_Fighter_cover.png', NULL, NULL),
(764, 'Pictionary', NULL, NULL, 'Pictionary is a Miscellaneous game, developed and published by Etermax,  which was released in 2017.', '/images/nes/764/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/8/49528_front.jpg', NULL, NULL),
(765, 'Pinball', NULL, NULL, 'Be a pinball wizard, right in your own home! Bank off bumpers, flip double-flippers - even win a bonus round - in Nintendo\'s lightning fast PINBALL! You\'ll have the time of your life as you flip from upper to lower game screens, rack up points to beat your opponent, and, if you\'re lucky, progress to the bonus round where you\'ll save the falling maiden in this video version of the real thing!', '/images/nes/765/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/f/f3/P_NES.PNG', NULL, NULL),
(766, 'Pinball Quest', NULL, NULL, 'Don\'t let the name fool you - Pinball Quest is much more than video pinball. In fact, it\'s the first-ever multi-screen fantasy in a pinball format! Every move you make tells a story; every shot takes you another step closer in your quest to rescue the captive princess of the castle. Along the way you\'ll meet ghosts, goblins, witches and demons, in an endless labyrinth of treacherous passages and deadly doorways. It takes a fearless heart and a fast mind to conquer Pinball Quest. It also takes the skills of a true pinball wizard... which you can hone on the three other video pinball games included on this cartridge! So before you pour any more money into your NES library, get the one title that\'s a library all by itself! No matter how hard you try, you can\'t get enough of Pinball Quest!', '/images/nes/766/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f3/Pinball_Quest_cover.jpg', NULL, NULL),
(767, 'Pin*Bot', NULL, NULL, 'DARES YOU TO SURVIVE.', '/images/nes/767/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/3/1/49531_front.jpg', NULL, NULL),
(768, 'Pipe Dream', NULL, NULL, 'Pit your pipe-fitting prowess against a surging stream of soggy sewage. But slow down for a second and it\'s sludge city! You\'ll play instinctively, while you think strategically. You\'ll get good quickly, but you\'ll always have room to get better. Pipe Dream is a perfect desktop stress-buster and a terrific tournament game and a seriously special strategy puzzle!', '/images/nes/768/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/3/5/49535_front.jpg', NULL, NULL),
(769, 'Pirates!', NULL, NULL, 'The year is 1671. After a lifetime of building your fortune on countless expeditions across the Spanish Main, the crown jewel lies before you: Panama... the largest and richest city in the New World! Today, you will risk all your wealth and prestige in a bold effort to seize your rightful place in history. Nestled out of sight in nearby coastal waters is a fleet of captured pirate raiders awaiting your order to attack. At your side, hundreds of brave buccaneers. All is ready. Soon the fabled treasures of the Spanish Empire shall be yours!', '/images/nes/769/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/3/3/49533_front.jpg', NULL, NULL),
(770, 'Platoon', NULL, NULL, 'Are you ready for the real thing? In the jungle, everything is invisible. Including the enemy. Suddenly, a firefight explodes all around you. That\'s jungle combat as you saw it in the movie Platoon. Now, Platoon the game takes you right into the action. You\'ll fight for your life against deadly guerillas and hidden snipers, always on guard against the booby traps and napalm airstrikes that could end it all in an instant. Jungle combat, as close as you\'ll ever want to get to the real thing.', '/images/nes/770/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/75/Platoon_Amiga.jpg', 5.5, 15),
(771, 'Popeye', NULL, NULL, 'Are you ready to climb ladders, jump landings, eat spinach and punch-out Brutus, Seahag and the flying Bernard? Because that\'s what it takes to win Olive Oyl\'s hand in marriage. You\'ll score points by defeating your enemies and collecting the "love tokens" Olive drops from her window. The more you collect, the more points you\'ll score and the faster you\'ll win her love. But watch out. Around every corner lurks another jealous suitor. You\'ll have to think with your head as well as your heart to win this fast action love affair!', '/images/nes/771/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/4/22174_front.jpg', 1, NULL),
(772, 'Power Blade', 'Power Blazer', NULL, '22nd CENTURY WARRIOR! When New Earth\'s Master Computer is attacked by aliens, only NOVA, lord of the ancient Power Blade, can hope to battle through to Control Center and restore the Database!', '/images/nes/772/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/10/Power_Blade_Boxart.jpg', 1.5, NULL),
(773, 'Power Blade 2', NULL, NULL, 'Time to sharpen the blade! NOVA is suddenly called to take action against a cyborg army. The Delta Foundation has developed a line of fighting robots that pose a threat to national security. NOVA has been picked to eliminate the danger by destroying the Delta Foundation - all five locations. Fortunately, he will be using different suits which give him the ability to walk on ceilings, swim long distances, and fly - not to mention the latest top secret suit. And of course, NOVA will be wielding the ancient Power Blade, a weapon of art and science. He must draw on all his skills and cunning to defeat these near-perfect fighting machines!', '/images/nes/773/cover.png', 'https://upload.wikimedia.org/wikipedia/en/thumb/9/94/Power_Blade_2_cover.png/256px-Power_Blade_2_cover.png', 1.5, NULL),
(774, 'Power Punch II', NULL, NULL, 'It\'s the year 2006. You\'re Mark "Tough Guy" Tyler and you\'ve just defended your Heavyweight title for the 9th consecutive time. After demolishing the best boxers on the planet, it\'s now time to face off with the best in the universe. The Intergalactic Boxing Federation (IGBF) has invited you to go head-to-head with 12 of their greatest fighters. From metallic cyborgs, to heavy hitting mutants, you\'ll trade punches with opponents whose strength, stamina and speed are like nothing you\'ve ever seen. If pure technique doesn\'t stop these sluggers (and with the best of them it won\'t), get hold of those Power Punches. They\'ll guarantee to send your tin-coated opponent to the junkyard and you to a new title; undisputed Heavyweight Champion of the Universe!', '/images/nes/774/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1f/Power_Punch_II_Cover.jpg', NULL, NULL),
(775, 'Predator', NULL, NULL, 'You\'ve heard about PREDATOR, the Arnold Schwarzenegger movie - now you can play the leading role! Take a crack commando unit into the South American jungle to rescue a bunch of trapped diplomats. Should be easy enough... and so it would be, if it weren\'t for the mysterious alien who keeps on taking out your men!', '/images/nes/775/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/6/38436_front.jpg', 1, 1),
(776, 'Prince of Persia', NULL, NULL, 'Set in a land rooted in ancient Persian mythology, the Prince finds himself caught in an epic battle between the primal forces of light and darkness: the God of Light, Ormazd versus his brother Ahriman, the destructive God of Darkness. The Prince arrives just in time to witness the destruction of the legendary Tree of Life - an act which threatens to plunge the entire world into eternal darkness. Manifested in the form of the Corruption, a dark substance that physically contaminates the land and the skies, the Prince must partner with Elika, a deadly companion, to heal the world from the evil Corruption.', '/images/nes/776/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c6/Prince_of_Persia_2008_vg_Box_Art.jpg', 15.5, NULL),
(777, 'Princess Tomato in the Salad Kingdom', 'Salad no Kuni no Tomato Hime', NULL, 'You\'ve got a problem. You\'re a Cucumber. But you\'re also a Knight of the Realm, which helps make up for the fact that you go through life long, green, and with seeds.', '/images/nes/777/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f6/Princesstomato.jpg', 2, 4.5),
(778, 'Pro Sport Hockey', 'USA Ice Hockey in FC', NULL, 'REAL PRO PLAYERS! REAL PRO STATS! REAL PRO ACTION!', '/images/nes/778/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a9/ProSportHockeyBoxShotNES.jpg', NULL, NULL),
(779, 'Pro Wrestling', NULL, NULL, 'Pro Wrestling is a Sports game, published by D3Publisher,  which was released in Japan in 1999.', '/images/nes/779/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8d/Nesprowrestlingbox.jpg', NULL, NULL),
(780, 'Punch-Out!!', NULL, NULL, 'Nintendo is reviving one of its most storied and popular franchises with the first new Punch-Out!! boxing game in 15 years. Players will once again follow the exploits of the up-and-coming challenger, Little Mac, and take on a series of opponents, including favorites from the past like Glass Joe and King Hippo.', '/images/nes/780/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/5/14835_front.jpg', NULL, NULL),
(781, 'The Punisher', NULL, NULL, 'Enter the mind of The Punisher, a vigilante driven by more than just revenge. In a world marked by corruption, you serve as judge, jury, and executioner as you terrorize criminals with their own ruthless methods. Use a combination of physical force and character interaction to coerce criminals into coughing up valuable information, and then put them out of their misery with your arsenal of realistic weapons. The Punisher War Journal lets you relive in-game moments, collect items from Marvel\'s Punisher history, unlock bonus DVD footage, and more.', '/images/nes/781/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fb/Punisher_game_cover.jpg', NULL, NULL),
(782, 'Puss \'n Boots: Pero\'s Great Adventure', 'Nagagutsu o Haita Neko: Sekai Isshū 80 Nichi Dai Bōken', NULL, 'Pero is Puss N\' Boots of storybook fame and he\'s caught up in a whirlwind adventure, traveling through time and around the world! True-blue Pero has been "cat-apulted" back through time by the terrible Count Gruemon. Now Pero must cross many dangerous lands to defeat Count Gruemon and recover the Time Machine which will return Pero home. It\'s a "cat-astrophe!"', '/images/nes/782/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/3/49563_front.jpg', 1, NULL),
(783, 'Puzznic', NULL, NULL, 'PUZZNIC seems so easy. Just match the shapes together before the timer reaches zero. But looks can be deceiving! Each puzzle you encounter must be completed in a certain sequence. Some of them will please you, others will tease you, and a few are going to drive you mad. We will not be held responsible for the loss of your sanity!', '/images/nes/783/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fe/Puzznic_Cover.jpg', NULL, NULL),
(784, 'Q*bert', NULL, NULL, 'The Tazmaniac Kings of Chaos have trapped your ol\' pal Q*bert in their treacherous time warp. And, with nearly 40 perilous pyramids to escape from, he\'s in trouble up to his "schnoz"! Now, you\'re his only hope. But to secure Q*bert\'s safety, you\'ll have to be a whiz-bang player, bouncing our pug-nosed hero around like a banshee, and matching the pyramid squares with escape code colors. All the while, you\'ll dodge untold zillions of Whammy Balls that\'ll fall onto the Q*bster\'s punky hairdo - SPLAT! Plus, you gotta outsmart Q*bert\'s archest enemies - Ugg, Wrong-Way, Slick, Sam and Coily (the slimiest purple headed snake you\'ll ever meet) - who\'ll be on your tail from square one. It\'s a regular Zany Zone in here, a loony bin of mischief and mayhem. And if you don\'t have the nerve - you may go nuts!', '/images/nes/784/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/7/49567_front.jpg', 4.5, NULL),
(785, 'Qix', NULL, NULL, 'Get your kicks from QIX, the original brain-twisting arcade hit now available for your NES! QIX is one of the quirkiest adversaries you\'ll ever encounter. It thrives on finding new and outrageous ways to perplex, vex and manipulate your mind. QIX appears as a whirling multi-colored helix that lives in the depths of your system - relentlessly seeking to wear down your mental defenses. The only way to neutralize QIX is by containing it. But you\'ll have to think fast, and act even faster. QIX will use its mutant offspring Sparx and Spritz to squelch any attempt to stop it. Capture QIX, or suffer the ultimate mental anguish. Total breakdown! Just remember, your mind is your only weapon.', '/images/nes/785/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/53/Qix_Poster.png', 1.5, NULL),
(786, 'R.B.I. Baseball', 'Pro Yakyuu Family Stadium', NULL, 'No other baseball game gets you closer to playing in the big time than R.B.I. Baseball. Because every one of the ten teams in R.B.I. Baseball contains the rosters and player stats officially licensed from the MLB Players Association. Like real baseball, these skills and stats affect the outcome of every play. Like a real manager, you\'ll need to make good use of this vital information - and wise strategy decisions - if you want a winning record. R.B.I. Baseball is so intensely realistic, we\'ve added amusing animation and a touch of humor to keep the action light-hearted and fun. You can play against the computer in a nine game season or compete against a friend in your own best-of-seven series. Stop playing with no-names and step up to the plate with real superstars in R.B.I. Baseball!', '/images/nes/786/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7b/R.B.I._Baseball_Cover.jpg', 10, NULL),
(787, 'R.C. Pro-Am', NULL, NULL, 'Grab your controller and pull up to the starting line. It\'s you against four other all-star racers in this thrilling Nintendo R.C. racing competition! You\'ll face hair pin turns, outrageous curves, oil slicks and rain clouds as you make your way through 32 treacherous courses that will test your driving ability like never before. Along the way, you\'ll pick up performance boosters like Turbo Acceleration, Sticky Tires and Top Speed that will help you get to the finish line first. But if the going gets rough, you\'ll use your bombs and missiles to knock the competition for a loop to make sure you\'re the winner! Collect the letters that spell N-I-N-T-E-N-D-O and you\'ll collect an even more powerful car. Then hop in and enjoy the ultimate in video racing competition, R.C. Pro Am!', '/images/nes/787/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/46/RC_Pro_Am_cover.jpg', 1.5, 2.5),
(788, 'R.C. Pro-Am II', NULL, NULL, 'In the tradition of Pro-Am racing, gear up for the excitement of R.C. PRO-AM II®! The challenge is greater, the tracks are faster, and your opponents are better than ever! Feel every turn and hug every corner as your tires squeal and burn their way across the finish line. Fierce competition awaits you, whether you\'re pitted against ruthless opponents or unforgiving friends, or if you\'re gutsy enough to try your luck against the computer. It\'s not gonna be easy!', '/images/nes/788/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9c/RC_Pro_Am_2_cover.jpg', 1, 1.5),
(789, 'Alex DeMeo\'s Race America', NULL, NULL, 'Race coast-to-coast across the U.S.A. in the most exciting race ever! Pit your consummate driving skills and the power of your Corvette against eight great computer opponents. Or drive in a one-to-one challenge against a friend. Either way, you\'ll thrill to the dangers of exciting drag racing and wild road racing. And if you can avoid the hazards, the wipe-outs and the spins, you\'ll score high!', '/images/nes/789/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/37/Race_America_Cover.jpg', NULL, NULL),
(790, 'Racket Attack', 'Moero!! Pro Tennis', NULL, 'This is no amateur hour. This one\'s for keeps. The national finals. Will you play tough enough to hear the umpire call "point, set, match!" A million eyes bore into you from the stands. Moments to start... RACKET ATTACK has made you a pro, the toughest, most awesome champ ever to hit center court. You\'ve a power serve and a ferocious backhand. You\'re fearsome at the net and in the backcourt. On clay or grass you attack. But your opponent knows your game. And he\'s ready. Screams go up as you step to the base line. It\'s 100 degrees. Your service. You launch it like a rocket. Ace... Let... Fault! The umpires\' call reminds you to hang tough and be consistent. 15 love... 30 love... 40 love... MATCH POINT. Sweating, you grip your racket. The crowd hushes. Can you deliver an ace? Bear down. Psych up. Get tough!', '/images/nes/790/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/65/Racket_Attack.jpg', NULL, NULL),
(791, 'Rackets & Rivals', NULL, NULL, 'Rackets & Rivals is a Sports game, developed and published by Palcom,  which was released in Europe in 1993.', '/images/nes/791/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/9/23519_front.jpg', NULL, NULL),
(792, 'Rad Racer', 'Highway Star', NULL, 'This is no ordinary game pak. This is Rad Racer. Nintendo\'s thrilling 3-D video game Rad Racer comes action-packed with revolutionary 3-D technology and 3-D glasses (they\'re free inside) that will have you really believing you\'re in the middle of a cross-country rally race - cruising along at 200 miles per hour! Rad Racer takes you through 8 treacherous race courses including the Los Angeles Nightway, the San Francisco Highway and the Grand Canyon. Choose the Ferrari and you\'ll enter a Super Machine competition where you\'ll race against Corvettes and Lamborghinis. Select the F-1 Machine and you\'ll compete against incredibly fast cars. Whether it\'s Ferrari or F-1, 3-D or regular mode, Rad Racer\'s hairpin curves, daredevil turns and realistic action will bring home all the fun and excitement of real rally racing. Think you\'re up to it? Then drivers, start your engines. It\'s Rad Racer!', '/images/nes/792/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/49/Rad_racer_box_front.jpg', 2, 2),
(793, 'Rad Racer II', NULL, NULL, 'Feel the exhilaration of road racing with lightning fast Turbo Boost acceleration to 250 miles per hour! Plus the sensational ups and downs of zooming over rugged terrain in the hottest cars on the road today. All it takes to handle the action is skill, reflexes and nerves of steel. Rad Racer II gives you all-out access to 8 of the most challenging race courses ever, including the streets of New York City, Las Vegas and San Francisco. You\'ll feel more sense of speed and more responsiveness than ever before. And you can test your skills in both nighttime and daytime driving conditions. With realistic new graphics, dynamite new music and perilous new challenges - including dizzying spin-outs that make Rad Racer II the most fun you\'ve ever had behind the wheel!', '/images/nes/793/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/49/Rad_racer_box_front.jpg', NULL, NULL),
(794, 'Raid on Bungeling Bay', NULL, NULL, 'On a tiny, remote planet, the evil Bungeling Empire is creating an awesome war machine. Civilization as we know it seems doomed. One faint hope remains.', '/images/nes/794/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/04/Raid_on_Bungeling_Bay_Cover.jpg', NULL, NULL),
(795, 'Rainbow Islands', 'Rainbow Island: The Story of Bubble Bobble 2', NULL, 'Bubby and Bobby travel to Rainbow Islands in search of hidden treasure. Instead, they find only trouble. Seven worlds, plus a special bonus world. 32 action-packed rainbow-jumping levels of play. Play a demo round to get ready for the real thing. Defeat seven unsavory enemies to earn seven colored diamonds.', '/images/nes/795/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3b/Rainbowislandsevolution.jpg', NULL, NULL),
(796, 'Rainbow Islands: Bubble Bobble 2', NULL, NULL, 'Bubby and Bobby travel to Rainbow Islands in search of hidden treasure. Instead, they find only trouble. Seven worlds, plus a special bonus world. 32 action-packed rainbow-jumping levels of play. Play a demo round to get ready for the real thing. Defeat seven unsavory enemies to earn seven colored diamonds.', '/images/nes/796/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/eb/Bubbobpart2.jpg', NULL, NULL),
(797, 'Rally Bike', 'Dash Yarou', NULL, 'There\'s a cross-country motorcycle rally and you\'re invited! Race from San Francisco to New York in six exciting stages.', '/images/nes/797/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/38/RallyBike_arcadeflyer.png', NULL, NULL),
(798, 'Rambo', NULL, NULL, 'Freedom is everything.', '/images/nes/798/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/64/Rambo_NES_game_cover.png', NULL, NULL),
(1288, 'Rampage', NULL, NULL, 'Mass destruction has never been so much fun! And arcade superstars Ralph the Wolf, George the Ape, and Lizzie the Lizard make a riotous wrecking crew. So go wild! Crunch the concrete. Trash a trolley. Snack on a soldier. Have an office building for lunch. Go on a RAMPAGE!', '/images/nes/1288/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Rampage_flyer.png', 3, 4.5),
(1289, 'Rampart', NULL, NULL, 'A medieval masterpiece of power, strategy and ingenuity! The objective is brutally simple: engage your enemy in an all-out exchange of cannonfire, then assess the damage and rebuild your castle. But the reality of RAMPART is far more complex. The key to victory lies in how quickly you can pick up the pieces and redesign, refortify, and extend your walls before the next battle begins. Whether you\'re facing an onslaught from the computer\'s armada, or pitting your castle cannons against another player\'s, there\'s only one way out. Defend... or perish.', '/images/nes/1289/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/1/10491_front.jpg', 3, NULL),
(1290, 'Remote Control', NULL, NULL, 'Now you can play the only game show that started in a basement right on your PC! Just answer the silly questions about rock \'n\' roll  and junk trivia and win lots of points. Senseless? You bet! Fun? Always! You\'ll be the envy of your friends, and best of all you don\'t have to be smart to win! Over 1,000 challenging questions in 9 absurd, thematic, tasteless and humorous categories. Crazy interruptions such as "Off the Air", "Home Shopping Zone", and "Ranger Bob", just like the real show. End game round where only the best win it all. Single or group gameplay options.', '/images/nes/1290/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/4/49604_front.jpg', 1, NULL),
(1291, 'The Ren & Stimpy Show: Buckaroo$!', NULL, NULL, 'Help! We\'re trapped in our own T.V. show!', '/images/nes/1291/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/9/49609_front.jpg', 2.5, NULL),
(1292, 'Renegade', 'Nekketsu Kouha Kunio Kun', NULL, '2 A.M. is no time to be alone in the subway. And you\'re about to find out why. They\'ve got clubs, chains and blades. And it\'s three against one... but they\'ve picked the wrong one. The streets are a mess and it\'s time to do a little street cleaning. They started it... You\'ve gotta finish it!', '/images/nes/1292/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/4/39414_front.jpg', 1, 2.5),
(1293, 'Rescue: The Embassy Mission', 'Hostages', NULL, 'A diplomatic mission in a foreign city is seized by political fanatics. Innocent lives are in jeopardy. Outrageous demands are being made for their safety. Only you and your elite crisis intervention team can rescue the ambassador and his helpless staff. Position your sharpshooters around the embassy\'s perimeter. Focus your sights on the curtained windows. Squeeze off rounds of cover fire to protect your assault squad. Once your men are inside, an electronic diagram of the building\'s floor plan provides your only guide down to the captives - and the awaiting enemy. Look sharp. Stay frosty. Rescue is an interactive action-adventure game that lets you control each member of your strike team through three different game scenarios. Avoid searching spotlights, dodge enemy gunfire, rappel down walls, and smash through windows. Neutralize your adversaries and liberate the embassy personnel!', '/images/nes/1293/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/5/49615_front.jpg', 1, 3),
(1294, 'Ring King', 'Family Boxing', NULL, 'Challenge your friends or your computer to the Data East Championship Title Bout! Challengers from around the globe, each with his own style of boxing, knuckle up to take the title. Win by knock-out or points using a wild assortment of hooks, jabs, uppercuts, and combinations!', '/images/nes/1294/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/0/49620_front.jpg', NULL, NULL),
(1295, 'River City Ransom', 'Downtown Nekketsu Monogatari', NULL, 'Hear the message from Sick, the meanest ganglord in town: "I hold your high school captive, and some of the students will have a trying moment, if they\'re ever fool enough to cross my path!" But you aren\'t afraid of anybody! Face the terrible gangs and neutralize their bosses, in order to deliver the city from terror!', '/images/nes/1295/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/46/River_City_Ransom-front.jpg', 2, NULL),
(1296, 'Road Fighter', NULL, NULL, 'Enter into the fiery heat of competition, as you head for the glory awaiting you at the finish line ! You\'ll need all your wits about you as engage in this fast-paced road fight.', '/images/nes/1296/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/3/29513_front.jpg', 1, NULL),
(1297, 'RoadBlasters', NULL, NULL, 'The race is on! Survive the ultimate contest of futuristic warfare - a brutal combination of high-speed racing and deadly combat. Blast opponents with laser artillery as you spin around turns in your high-performance armored vehicle. Command Cars, Cycles, Stingers and Rat Jeeps combine forces to prevent you from reaching the next rally point. For extra firepower, arm yourself with an array of special weapons - from U.Z. Cannons and Nitro Injectors to Electro Shields and Cruise Missiles. Take on the RoadBlasters challenge in 50 levels of non-stop action... only one warrior will prevail in the end!', '/images/nes/1297/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/7/48757_front.jpg', 2, NULL),
(1298, 'Robin Hood: Prince of Thieves', NULL, NULL, 'England is in turmoil! While King Richard the Lion-Hearted is off fighting the Crusades in Jerusalem, the relentlessly greedy Sheriff of Nottingham rises to power by running roughshod over the poor folk of Britain. Now you are Robin Hood: Prince of Thieves, the only man with enough cunning, agility and courage to combat the Sheriff and his evil witch, Mortianna. First, you must battle cutthroat guards and escape the Saracen dungeon where you, your friend, Peter Dubois, and your new companion, the mysterious, but loyal, Azeem, are held prisoners of the Crusades. Back in England, you\'ll explore the treacherous Sherwood Forest where you\'ll muster your band: Little John, Friar Tuck and Will Scarlett. But remember, they will only follow you if you prove yourself worthy enough to lead them, rescue the lovely Maid Marian and free England from tyranny.', '/images/nes/1298/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1a/Robin_Hood_-_Prince_of_Thieves_Coverart.png', 2.5, 3),
(1299, 'RoboCop', NULL, NULL, 'A sadistic crime wave is sweeping through old Detroit. The situation is explosive - in fact, it is so bad, a private corporation, O.C.P., has assumed control of the police force. Then, a research team creates an unstoppable, indestructible law enforcement cyborg - named RoboCop. Using a wild assortment of weapons, including RoboCop\'s Special Issue Auto-9, you must stop every sleazeball criminal you encounter with deadly, piercing accuracy. But beware, there are forces on the street - and within O.C.P. - that will stop at nothing to see RoboCop eliminated. Make your way past 6 levels of street thugs, Boddicker and the powerful ED-209 to your final battle with Dick Jones. Prepare yourself for non-stop action in one of the most explosive games you will ever play. It\'s going to take more than a cop to clean up the scum of old Detroit - it\'s going to take RoboCop. "Your move, creep."', '/images/nes/1299/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b7/RoboCop_%28franchise%29_logo.jpg', 1, 1),
(1801, 'RoboCop 2', NULL, NULL, 'Seven levels of muscle-straining, reflex-testing, sideways scrolling fury! Destroy the lethal drug Nuke, face a stream of deadly Nuke gangs, and then - if you survive - face the terror that is Robocop 2! More than a game - ROBOCOP 2 is the prime directive!', '/images/nes/1801/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b7/RoboCop_%28franchise%29_logo.jpg', 1, NULL),
(3561, 'RoboCop 3', NULL, NULL, 'Old Detroit. The streets are full of danger. Only one man can stand alone against such numbers - ROBOCOP! With state of the art weaponry, a skin of steel and nerves to match, he stalks his prey... evil-doers everywhere!', '/images/nes/3561/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b7/RoboCop_%28franchise%29_logo.jpg', 1, NULL),
(3562, 'Robowarrior', 'Bomber King', NULL, 'RoboWarrior takes place on an alien planet called Altile. The player operates a cyborg named ZED (Z-type Earth Defence). In the game, ZED raids Altile to fight the Xantho empire and destroy its leader, Xur. ZED deploys bombs to clear a path through rocks, walls, and forests, while killing enemies and collecting items. Some gameplay elements resemble those of Bomberman (1983).\n\nRoboWarrior comprises five level formats. In one, the player must obtain a key before the time limit expires. In another, the key is unavailable until the player acquires a crystal or chalice. Some levels are cast in darkness, rendering obstructions invisible unless the player has a lit lamp. Still other levels are mazes in which a player must find and blast-through weak points in walls to proceed. Periodically, a player engages a boss level.', '/images/nes/3562/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/de/Robowarrior_Cover.jpg', NULL, NULL),
(3563, 'Rock \'n\' Ball', 'Family Pinball', NULL, 'Nostalgic pinball is back with some very modern concepts! Enjoy seven different games with six different characters such as Twister Tom for Pinball, Rock \'n\' Roller Billy for Sports Pinball, and more! Team up with your favorite Rock \'n\' Ball character and reach for higher and higher scores! Pinball is famous in video game history. Challenge your skills against Rock \'n\' Ball\'s brand new twists on this popular game!', '/images/nes/3563/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/3/49623_front.jpg', NULL, NULL),
(3564, 'Rocket Ranger', NULL, NULL, 'The 21st century needs you! Across the boundaries of time and space you have been chosen to save Planet Earth from a monstrous alien invasion. Rise to the challenge with courage, skill, and the help of three fantastic devices: a rocket suit, ray gun and powerful wrist computer. Only you can change our planet\'s destiny as the world\'s first hero of the future... ROCKET RANGER!', '/images/nes/3564/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e5/Rocket_ranger.jpg', NULL, NULL),
(3565, 'The Rocketeer', NULL, NULL, 'FUEL UP YOUR SUPER NINTNEDO ENTERTAINMENT SYSTEM WITH THE ROCKETEER FROM IGS.', '/images/nes/3565/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/5/25145_front.jpg', 1.5, NULL),
(3566, 'Rockin\' Kats', 'New York Nyankies', NULL, 'It\'s a Dance with Danger when Willy tries to rescue Jill!', '/images/nes/3566/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4b/Rockin_Kats_cover.jpg', 5, NULL),
(3567, 'Rod Land', 'Yousei Monogatari RodLand', NULL, 'Something very bizarre has happened in the fairy village. What has happened to change the inhabitants from chummy chappies into fluffy fiends? They\'ve only gone and kidnapped the beloved Mom of our angelic fairy heroes, Tam and Rit. She now lies captured in the top of the Maboots Tower waiting to be rescued. There\'s only one thing for it: Tam and Rit must put on the Rainbow shoes given to them by the Elder, and armed with the rods of Sheesanomo, a gift from their Dad, must go and wop anything that moves on the head!', '/images/nes/3567/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/71/RodLand_arcadeflyer.png', 1, 1),
(3568, 'Roger Clemens\' MVP Baseball', NULL, NULL, 'It took LJN and Roger "The Rocket" Clemens, the pest pitcher in baseball, to bring home the greatest baseball game ever!', '/images/nes/3568/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0e/Roger_Clemens%27_MVP_Baseball_cover.jpg', NULL, NULL),
(3569, 'Rollerball', NULL, NULL, 'ROLLERBALL - The action-packed Pinball Game with the distinctly American touch! New from HAL America, Rollerball brings you two new games in one! SKYSCRAPER is a fast-paced, realistic Pinball Game on four vertically-scrolling screens, for one to four players. MATCHPLAY is a one-on-one game for two players that will test any Pinball Wizard! A brand new type of game for the kids, a familiar old friend to dads and moms. Finally, a game dad can play, and win! And, Rollerball won\'t TILT!', '/images/nes/3569/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9a/Rollerball_NES_cover.jpg', NULL, NULL),
(3570, 'Rollerblade Racer', NULL, NULL, 'The Most RADICAL Race on WHEELS', '/images/nes/3570/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/4/1/49641_front.jpg', NULL, 1),
(3571, 'RollerGames', NULL, NULL, 'Is nothing sacred? RollerGames, the 21st Century\'s most popular thrill sport, is the latest victim of V.I.P.E.R. (Vicious International Punks and Eternal Renegades). With their greedy eyes on RollerGames\' mega prize money, they\'ve corrupted three teams and kidnapped Emerson "Skeeter" Bankhead, the games\' beloved commissioner. You and your own three teams of righteous skate kings must stop V.I.P.E.R.\'s criminal venom from infecting the entire city. So you\'ve got to take the fight to the streets. And the sewers, and the junkyards, and the highways and the jungles... through 6 stages of dastardly traps of doom as you leap over open manholes, careening oil drums and treacherous landslides. Race around oil slicks and man-eating canines. And avoid ambush by combat copters, bomb-wielding goons and creeps like Captain Meat Hook and the Fish Face. But time is against you. And so are V.I.P.E.R.\'s judo masters, skateboard thugs, motorcycle madmen and other assorted sinister scum. If your multi-faceted fists can\'t punch you through, you\'ll need your special assault body blocks, jump kicks and double-whammy slams. It\'s a bone-crunching skate-athon for your life, Skeeter\'s life, and for the good of RollerGames. So vanquish V.I.P.E.R. before they melt your ball-bearings into bullets!', '/images/nes/3571/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/3/6/49636_front.jpg', 1, NULL),
(3572, 'Romance of the Three Kingdoms', 'San Goku Shi', NULL, 'China\'s Second Han Dynasty has collapsed. The entire country is in chaos as warlords battle each other for control. Each claims to be emperor, however none is powerful enough to retain the title. Romance of the Three Kingdoms puts you in the role of one of the warlords of Second Century China. As a master, you must recruit the best generals in the country and win their loyalty. They will advise you in times of peace, and fight alongside you on the battlefield. Negotiate with other masters, or simply attack them. Always use terrain to your best advantage, making sure to choose the right kind of attack for the situation. In times of peace, manage your states to increase their productivity and prepare your army for battle. Romance of the Three Kingdoms combines a huge database with advanced programming to give you a game in which the characters are so historically accurate and life-like, and the game events so real, you will swear you\'re living in Second Century China.', '/images/nes/3572/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/29/NES_Three_Kingdoms.png', 6, NULL),
(3573, 'Romance of the Three Kingdoms II', 'San Goku Shi II', NULL, 'Return to an age of chivalry and courage, a time when the destiny of entire kingdoms could be decided by combat between two heroes.', '/images/nes/3573/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/9/48029_front.jpg', 6, NULL),
(3574, 'Roundball: 2 on 2 Challenge', NULL, NULL, 'You\'re Not On The Schoolyards Anymore.', '/images/nes/3574/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3d/RoundballNABoxShotNES.jpg', NULL, NULL),
(3575, 'Rush\'n Attack', NULL, NULL, 'Up for a little guerilla warfare? You asked for it. You\'re behind enemy lines, armed with only a knife and a mission: to free dozens of POWs hidden in an isolated, well-armored camp. If you\'re good, you\'ll pick off the heavily-armed enemy guerillas, one by one, and grab their bazookas and hand grenades. If you\'re great, you\'ll turn their weapons against them, to blow away a pack of attack dogs, a fleet of choppers, and a whole battalion of guards. But make one mistake, and it\'s all over. For you, our POWs... the future of the Free World!', '/images/nes/3575/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/e/e4/Rush%27n_Attack_artwork.PNG', 1, NULL),
(3576, 'Rygar', 'Argos no Senshi', NULL, 'You and Rygar, the legendary warrior of Argool, must defeat the evil king and his army of dangerous beasts. With powers and weapons from the Indora war gods, you go into battle with Rygar. It\'s up to you! The enemies are strong, the terrain treacherous, and the challenges difficult. The sun is setting and Rygar is depending on you. Rygar\'s exploits were once confined to arcades, but now he is battling the forces of evil everywhere. Join forces with Rygar!', '/images/nes/3576/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/6/23276_front.jpg', 2, 3);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(3577, 'S.C.A.T.: Special Cybernetic Attack Team', 'Final Mission', NULL, 'It\'s the year 2029 and humanity faces certain extinction! An alien force led by the Supreme Commander Vile Malmort is positioned to destroy the earth.', '/images/nes/3577/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4c/S.C.A.T._-_Special_Cybernetic_Attack_Team_%28game_box_art%29.jpg', 2, NULL),
(3578, 'Section Z', NULL, NULL, 'Planet Earth in the year 2XXX. You are relaxing at the console of your computerized superconductor-generated interplanetary satellite communications system. Suddenly, high frequency radio and television transmissions blast warnings to all inhabitants to prepare for the brutal invading forces of Balangool Empire. Battle and defeat the space soldiers of Balangool. Penetrate their base divided in section A through SECTION Z, then destroy Balangool master control "L-Brain."', '/images/nes/3578/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/25/Section_Z_%28brochure%29.png', 1, NULL),
(3579, 'Seicross', NULL, NULL, 'Danger zones, suicide bikers, explosions, and booby traps-all stand in your way as you race your super space bike into the enemy city to rescue the captured people of Petras. Then you must destroy the Dinosaur Tank that is aimed straight at you. But, watch out! Your Energy Pack needs to be replaced to keep your bike energized and your laser beam strong.', '/images/nes/3579/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/7/49657_front.jpg', NULL, NULL),
(3580, 'Sesame Street: 1-2-3', NULL, NULL, 'Sesame Street 1-2-3 featured two different games: "Astro-Grover," and "Ernie\'s Magic Shapes." In Ernie\'s magic shapes, you had to match the right symbol to a base symbol. Astro-grover was a simple math game.', '/images/nes/3580/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c8/SesameStreet123ABC.jpg', NULL, NULL),
(3581, 'Sesame Street: A-B-C', NULL, NULL, 'Sesame Street A-B-C is an educational Nintendo game featuring two educational video games.\n\nThe goal was to create a series of connections, for Rubber Duckie to make his way to Ernie\'s bathtub. The game teaches basic logic, directions (North, South, East and West) and sequencing.\n\nThe video game was created by Hi Tech Expressions, for ages 3 to 6.\n\nIt was originally made for DOS,[17] but was released for the Nintendo Entertainment System in 1990. On NES, it was released on the cartridge Sesame Street ABC, supplementing Letter-Go-Round. At some point in time, the game was released for the Unisys ICON operating system, a platform commissioned by the Ontario education system. No copies of this format exist, as the last ICON computers and software were destroyed in the early-2000s.', '/images/nes/3581/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c8/SesameStreet123ABC.jpg', NULL, NULL),
(3583, 'Sesame Street: Big Bird\'s Hide & Speak', NULL, NULL, 'The first talking game for NES', '/images/nes/3583/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/3/2/48932_front.jpg', NULL, NULL),
(3584, 'Sesame Street: Countdown', NULL, NULL, 'Counting, adding and subtracting numbers have never been more fun, now that the batty, but lovable COUNT is here!', '/images/nes/3584/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/6/0/49660_front.jpg', 1, NULL),
(3585, 'Shadow of the Ninja', NULL, NULL, 'It\'s the year 2029 A.D. and a madman controls the largest city in America. When reports have reached the Emperor Garuda, he feels an inner chill, for he knows the invaders are Ninja!', '/images/nes/3585/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Shadow_of_the_Ninja_cover.jpg', 1.5, NULL),
(3586, 'Shadowgate', NULL, NULL, 'A hidden key unlocks an ancient castle\'s door. As it creaks open on rusted hinges, the whisper of a dank, stale wind delivers this chilling warning: Danger awaits you. Yet within these dark and ominous walls lies your quest. Welcome to the Castle Shadowgate. Your destiny, as the last of a great line of hero-kings, is to terminate the diabolical Warlock Lord before his dreaded black magic unleashes the hideous behemoth and destroys the world. With a strong heart and shining armor, you carefully choose your path of travel throughout the castle\'s sinister grounds. Along the way you\'ll discover strange and wondrous objects. Some things may be useful on your journey, others may be deadly to the touch. 3-D images, unsurpassed graphics, and special sound effects unfold as you venture through those grave ruins. But beware! Your next move could be your last. Using screens and graphics like those in the best interactive PC games, Shadowgate is the most challenging, participatory adventure you\'ve ever experienced on the NES! Shadowgate. Enter if you dare!', '/images/nes/3586/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/9/22219_front.jpg', 2, 16.5),
(3587, 'Shatterhand', 'Tokkyū Shirei Solbrain', NULL, 'Imagine packing the power of 100 strategic missiles in every punch. Imagine needing every single megaton just to hold your own against a cybernetic army of metallic monstrosities. That\'s the guts of SHATTERHAND, the game that redefines hand-to-hand combat in the 21st century... along with all the standards for single-player action games for the NES. Seven levels of programmed adventure - you choose the action! State-of-the-art graphics featuring 8-direction scrolling! "Anti-gravity" levels force you to fight upside-down! Armed "satellite robots" assist you in battle. No arms on Earth can withstand the power in your hands!', '/images/nes/3587/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Shatterhand_cover.jpg', 1.5, 2),
(3588, 'Shingen the Ruler', 'Takeda Shingen II', NULL, 'You are SHINGEN, 16th century samurai warlord. This is the ultimate in war simulation games. With your skill as a strategist you develop your country into a mighty war machine. You control agriculture, mining and morale among your people. You must overcome typhoons, epidemics, mine cave-ins, as well as powerful enemies. Now, enter SHINGEN\'s dream of total domination. Riflemen, Lancers, Calvary and Ninja spies are waiting for your commands on 42 different battlefields. Only your skill shall determine victory or defeat!', '/images/nes/3588/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/69/Shingen_the_Ruler_cover.jpg', NULL, NULL),
(3589, 'Shooting Range', NULL, NULL, 'Think you have what it takes to be the fastest gun in the west? How about the ace of outer space? You\'ll need a quick draw, a steady hand, and a dead eye to prove your stuff in this fast paced test of sharpshooting skill. But remember when all is said and done, in Shooting Range, you\'re either a hot shot or your not.', '/images/nes/3589/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/4/49674_front.jpg', 1, NULL),
(3590, 'Short Order / Eggsplode!', NULL, NULL, 'TWO GAMES FOR FAMILY FUN', '/images/nes/3590/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/3/49673_front.jpg', NULL, NULL),
(3591, 'Side Pocket', NULL, NULL, 'Chalk up your cue stick and rack up those balls. Now get ready, get set, break! The balls scatter and the match is on... It\'s the Data East Pool Tournament Finals, and you\'re behind the 8-ball! It\'ll take a steady hand and a sharp eye to hustle your way to the top. Challenge your friends to the ultimate game of skill, but you\'ve got to stay cool... It\'s a green felt jungle out there!', '/images/nes/3591/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/47/Side_Pocket_NES_cover.jpg', 2, NULL),
(3592, 'Silent Service', NULL, NULL, 'Prepare to dive into Silent Service, the ultra-realistic submarine simulation that recreates authentic WWII sea patrols in the bloody waters of the South Pacific. From the second you take command, you\'ll live by the motto FIND \'EM, CHASE \'EM, SINK \'EM, as you follow instruments, charts and your instincts in search of hostile convoys. Every decision you make will tempt fate, whether you risk a nighttime surface attack with deck guns blazing, or fire your last torpedo at a troop transport escorted by sub-killing destroyers. Your only relaxing moments away from the depth charges will come during torpedo and gunnery practice off the bomb ripped coast of Midway Island. So batten down your mental hatches. And remember, only 2 inches of steel and your tactical genius come between you and a watery grave!', '/images/nes/3592/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/42/Silent_service.jpg', NULL, NULL),
(3593, 'Silkworm', NULL, NULL, 'In this exciting rendition of the arcade megahit, "SILKWORM" you are challenged alone or with a friend to take on the roles of Robert or Stacey, elite members of the SILKWORM team. Their assignment and yours is to command the G-Cobra attack helicopter and the B-Panther interceptor jeep to combat and destroy the MHC2, an artificial brain of the future which has taken over the military forces and weapons of the world\'s population and forcing them to worship him as a god.', '/images/nes/3593/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/4/49684_front.jpg', 1, NULL),
(3594, 'Silver Surfer', NULL, NULL, 'High over the roof of the world he soars... free and unfettered as the roaring wind itself! Behold the sky-born spanner of a trillion galaxies... the restless, streaking stranger from the farthest reaches of space... this glistening, gleaming seeker of truth, whom man shall call forevermore... The Silver Surfer!', '/images/nes/3594/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6f/Silver_Surfer_NES_box.jpg', 1, NULL),
(3595, 'The Simpsons: Bart vs. the Space Mutants', NULL, NULL, 'Hello, fellow humans! Barthlomew J. Simpson here, with a very important secret: SPACE MUTANTS ARE INVADING SPRINGFIELD! That\'s right, man! A buncha slimy, horrible, totally gross and putrid monsters are taking over the bodies of the people who live here and they wanna build a weapon that\'s gonna take over the entire planet! Pretty cool, huh? Anyway, yours truly is the only one who can see \'em \'cause of my X-ray glasses - so it\'s up to me to stop \'em! I\'ve gotta spraypaint things, get radical on my skateboard, use my trusty slingshot, and in general behave like a nuisance, man. Plus, with evil dudes like Nelson the bully and Sideshow Bob getting in my way, it\'s a good thing I\'ve got the rest of the Simpsons to help me out! So if you\'re a decent person, a patriot, and somebody who cares about this sorry planet, you\'ll do the right thing. Save the Earth! BUY THIS GAME! Thanks, man!', '/images/nes/3595/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c2/Bart_vs._The_Space_Mutants_cover.jpg', 2.5, 2.5),
(3596, 'The Simpsons: Bart vs. the World', NULL, NULL, 'When I heard I\'d won the Krusty the Clown art contest, I said, "Forget it, man. This is Bart Simpson you\'re talking to, and Bart Simpson never won anything in his life." But Krusty said it, so there\'s no way to deny it. My family and I get to go on this really cool worldwide Treasure Hunt - to China, Egypt, the North Pole and Hollywood. And I need your help if I want to reach my final destination: a guest appearance on the Itchy and Scratchy Show. Here\'s the deal: I have to collect Krusty faces and Krusty products. The faces are worth bonuses and power-ups, and if I collect all the products I get a special reward. Wish me luck, man. I\'m outta here. Your friend, Bart Simpson.', '/images/nes/3596/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/2/22222_front.jpg', 2, NULL),
(3597, 'The Simpsons: Bartman Meets Radioactive Man', NULL, NULL, 'LISTEN UP, CRIME FIGHTERS!', '/images/nes/3597/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/8/48578_front.jpg', 3, NULL),
(3598, 'Skate or Die!', NULL, NULL, 'Psych up for 5 of the raddest skating events ever.', '/images/nes/3598/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e0/Skate_or_Die%21_cover.jpg', 1, NULL),
(3599, 'Skate or Die 2: The Search for Double Trouble', NULL, NULL, 'The good, the rad, the airborne! Get into double trouble! The twisted adventure. The ultimate ramp. Newspaper headlines scream: "Punk flattens Mayor\'s poodle... Ramp demolished... Local skateboarding suffers!" Now whaddaya do? Scour sewers and alleys. Score hot moves and boards from Rodney and Lester. Scrape together the ramp plans blowin\' down the beach. Nail the homeboys with stink-eggs and paint pellets. If you skate, you can relate.', '/images/nes/3599/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/f/fb/Skate_or_Die_2_Cover.PNG', NULL, NULL),
(3600, 'Ski or Die', NULL, NULL, 'Welcome to Rodney\'s Winter Wonderland of tasty tournaments. A gnarly snow sport spectacular of five events - Snowboard Half Pipe, Snowball Blast, Inner Tube Thrash, Downhill Blitz, and Acro Aerials. Whether you\'re trying to win points or the judges\' hearts, it\'s a torture test of slope-slicing skill for up to six skiers. But Rodney warns you the mountain\'s crawlin\' with contest crashers like punk penguins, abnormal abominables, chainsaw-toting rabbits and bodacious polar bears. Frenzied freaks of nature who want you to cash it in on a snow bank. But buckle down and you\'ll rack up points for pulverizing all kinds of ski shack scum. Assuming, of course, you can swoosh past bear traps, trees and other ouch-inducing obstacles. And when you\'re not engaged in wild tubular warfare with twisted slope slime like Lester or the iglooheads, you must blind the keen-eyed judges with your brilliant backflips, ollies, pikes, hand plants, daffies and helicopters. Just stay cool while you hone your skills in practice or hot-dog it in competition. Because one bogus move and you\'ll be plowing the slope with your chin.', '/images/nes/3600/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/9/0/49690_front.jpg', 1, NULL),
(3601, 'Sky Kid', NULL, NULL, 'The odds are definitely against them. The enemy\'s coming by land, by sea, and by air, with an arsenal of every deadly weapon known to man. Tanks. Machine guns. Battleships. And the most villainous army of soldiers this peaceful little land has ever seen. And the defense? Just two lonely skykids in thinly armed, single engine prop bi-planes. They\'ve got guts, but they\'ll need help from Above to win this battle - a steady hand, lightning reflexes, nerves of steel, and a heart of gold. Do you have what it takes? Then fasten your seat belt and take a deep breath. Because you are their only hope, SkyKid!', '/images/nes/3601/cover.png', 'https://upload.wikimedia.org/wikipedia/en/thumb/0/04/Skykid_arcadeflyer.png/180px-Skykid_arcadeflyer.png', NULL, NULL),
(3602, 'Sky Shark', NULL, NULL, 'Nobody ever said it would be easy... Deep in enemy territory, you\'ve got to fly your P-40 on a dangerous top secret mission. The skies are thick with a deadly rain of armor-piercing fire. They chose you for one reason - you\'re the best there is! You know the score, so aim right and fly tight. The skies are anything but friendly tonight.', '/images/nes/3602/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/04/SkyShark_arcadeflyer.png', 1, NULL),
(3603, 'Slalom', NULL, NULL, 'The freezing wind cracks against your face. The tension mounts. Suddenly you\'re off! Speeding through the gates on one of Nintendo\'s 24 snow-covered runs. Welcome to SLALOM! Where you feel every bump, every jump, every death defying turn, just like in a real slalom race. Along the way you\'ll dodge other competitors, trees, sledders - even snowmen -as you speed down mountains like Snowy Hill, Mount Nasty and Steep Peak in a heart-pounding race against the clock. Challenge the moguls and execute trick jumps. You\'ll find SLALOM just as thrilling and dangerous as the real thing!', '/images/nes/3603/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/66/NES_Slalom.jpg', 1, 3),
(3604, 'Smash TV', NULL, NULL, 'Congratulations! You\'re the next lucky contestant on the game show with the ultimate in prizes... YOUR LIFE! Sorry, no mindless blondes spinning your wheels here. Just deadly action, flying shrapnel, and total carnage - all in front of a live studio audience! Instead of picking vowels, you pick up 6 futuristic weapons like triple photon lasers and lethal plasma grenades. And the 2 controller action gives you 360 degree arcade firepower. Sure, you can win toasters and microwaves... after you defeat hordes of cyborg mutants, power orbs, tactical assault tanks and the 30-ton Mutoid Man! Any wonder this show\'s #1 in the ratings? Don\'t forget to wave hello to Mom!', '/images/nes/3604/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/34/SmashTV_flyer.jpg', 1, 2.5),
(3605, 'The Smurfs', NULL, NULL, 'The Smurfs is an Action game, developed by Bit Managers and published by Infogrames, which was released in Europe in 1994.', '/images/nes/3605/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/2/42802_front.jpg', 3.5, NULL),
(3606, 'Snake Rattle \'n\' Roll', NULL, NULL, 'It\'s a race to the moon! But first you must travel through 11 levels of adventure. Hurtling anvils, exploding Nibbley Pibbleys, flying carpets, ferocious 3-D terrain, plus BIGFOOT and more!', '/images/nes/3606/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b7/Snake_Rattle_n_Roll_gamebox.jpg', 2, 3),
(3607, 'Snake\'s Revenge', NULL, NULL, 'After his ironclad plan to rule the world rusted away, crazed Colonel Vermon CaTaffy went psycho. Unfortunately, your two best friends took the brunt of his frenzy and lost their fight to live. As nutty as ever, CaTaffy has sought asylum from the world\'s premiere bad guy - Higharolla Kockamamie. Grateful to this \'Rolla Radical, the Colonel has donated the biggest, baddest Ultra-Sheik Nuclear Attack Tank to his fellow madman\'s world dominating cause. Now your mission is to not only save Earth, but to inflict revenge. It\'s a job you\'ll definitely take personally as you infiltrate a nation of armed lunatics. Blow up a battleship. Hijack a train. Locate dozens of weapons and a truth serum that\'ll force enemy commanders to spill their guts. Then, destroy Vermon, Higharolla and the Earth Threatening Device with one lethal blow. All this, while staying in radio contact with a foxy spy named Jennifer and a Stealth copter pilot who\'ll be hovering nearby. So whaddaya think, Snake - are you commando enough to handle this Kockamamie scheme?', '/images/nes/3607/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b2/NES-E2-USA-REV-A.jpg', 3, NULL),
(3608, 'Snoopy\'s Silly Sports Spectacular', 'Donald Duck', NULL, 'Hey kids! Come along with Snoopy, his dusty brother Spike and his good pal Woodstock as they prepare to compete in Snoopy\'s Silly Sports Spectacular.', '/images/nes/3608/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/63/Snoopy%27s_Silly_Sports_Spectacular_Cover.jpg', NULL, NULL),
(3609, 'Snow Brothers', 'Snow Bros.', NULL, 'Snowing the Enemy is a Real Ball!', '/images/nes/3609/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/0/8/46708_front.jpg', NULL, NULL),
(3610, 'Soccer', NULL, NULL, 'The most exciting computerised soccer game ever!', '/images/nes/3610/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/78/Soccer_Cover.jpg', NULL, NULL),
(3611, 'Solar Jetman: Hunt for the Golden Warpship', NULL, NULL, 'Solar Jetman is on a one-man rescue mission to recover the most powerful spacecraft in the galaxy - The Golden Warpship. But first he must survive the 12 deadly alien worlds which hide the sabotaged vessel\'s parts, each with its own legion of menacing obstacles. Devastating gravitational forces, vicious alien armies, paralyzing booby traps, cosmic space warps, and mysterious black holes stand in the way. It\'s all up to Jetman\'s quick wits and galactic combat skills to carry him through the Herculean tasks that lie ahead. Only then can The Golden Warpship continue on its original mission.', '/images/nes/3611/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/95/Solarjetmancover.jpg', 2.5, 3.5),
(3612, 'Solomon\'s Key', 'Solomon no Kagi', NULL, 'You and Dana, the wizard of Lyrac, must unlock Solomon\'s scroll of secrets to restore peace in the constellations. With Dana\'s magic, fire, and mystical powers, you will help release the imprisoned Princess of the Fairies and harness the evil forces within the constellations. But first, you need the key! Solomon\'s Key - the arcade hit!', '/images/nes/3612/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/68/Solkeybox.jpg', 8, 50),
(3613, 'Solstice: The Quest for the Staff of Demnos', 'Solstice', NULL, '"From Out of the Darkness... Shall Arise a Challenge To Your Wisdom" Join Shadax\'s quest as he searches through the deadly fortress of Kastlerock for the six pieces of the magical Staff of Demnos, in a brave attempt to save Princess Eleanor from the evil magician Morbius! Over 250 challenging rooms to explore. Brilliant 3-D graphics, music and sound effects. Powerful potions and magical keys. Fearless evil characters to defeat. Non-violent fun for the entire family!', '/images/nes/3613/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/2/49712_front.jpg', 2.5, NULL),
(3614, 'Space Shuttle Project', NULL, NULL, '"...an 8-bit achievement. Spectacular."', '/images/nes/3614/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/0/49710_front.jpg', NULL, NULL),
(3615, 'Spelunker', NULL, NULL, 'Wander through miles of uncharted caves in search of the legendary underground pyramid and its vast treasures. To complete your adventure, you will swing from ropes and ladders, run across unstable terrain and down ravines, operate elevators, mining carts and rafts. You will collect keys, bombs, flares, jewels, sacks of gold coins and other valuable items as you navigate the hazardous terrain.', '/images/nes/3615/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/72/Spelunker_originalcover.png', 4, NULL),
(3616, 'Spider-Man: Return of the Sinister Six', NULL, NULL, 'Doctor Octopus is planning the crowning caper of his criminal career... to RULE THE WORLD! He has recruited The Sinister Six: Electro, Sandman, Mysterio, The Vulture, and Hobgoblin. With these Super Villains together again nothing stands in their way... except your friendly neighborhood Spider-Man! Can Spider-Man save the world? Are his spider powers enough to defeat The Sinister Six or is this more than even Spidey can handle? Only you hold the answer because YOU are Spider-Man - swinging into your first NES adventure ever!', '/images/nes/3616/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a1/Spiderman_return_of_the_sinister_six_NES.jpg', 1, 1),
(3617, 'Spot: The Video Game', 'Spot', NULL, 'DISCOVER THE MOST ADDICTIVE STRATEGY GAME SINCE TETRIS!', '/images/nes/3617/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/5/22245_front.jpg', 1, NULL),
(3618, 'Spy Hunter', NULL, NULL, 'The evil NOSTRA Corporation prepares to unleash havoc on the world, and only the SpyHunter is equipped to stop them. Get behind the wheel of the powerful G-6155 Interceptor, a vehicle that can transform into a boat, Jet Ski, or motorcycle. With an arsenal of both offensive and defensive weapons, you must elude NOSTRA spies, henchmen, and assassins at any cost. Hordes of air, ground, and water enemies pursue you as you try to save the world from the mind of a madman.', '/images/nes/3618/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c9/Spy_Hunter_side_art.png', 1, NULL),
(3619, 'Spy vs. Spy', 'Spy vs. Spy', NULL, 'It\'s Heckel and Jackel, those MAD, zany, black and white spies from everyone\'s favorite magazine! This time, they\'re on missions that will provide you and a friend with hours of fun. Five important items have been hidden in a series of rooms. One spy must get the items and escape to the airport... before the timer runs out! Catch the other spy and knock him silly with powerful punches and kicks. Or use the spy traps to booby trap doors, pictures and bookcases. If the other spy hits the trap... Kaboom! It\'s espionage, intrigue and madcap fun... only from Sega!', '/images/nes/3619/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/1/7511_front.jpg', NULL, NULL),
(3620, 'Sqoon', NULL, NULL, 'SOS! THE WORLD IS SINKING! This is the beginning of Neptunian invasion of the Earth. Humans are becoming food for the aliens. You must: Rescue the people and bring them to safety; Destroy the hot water factories which are melting the ice caps; Destroy the bio-factories which create the scary Pirame, Anchos, and more; Destroy the base where hateful Neptunians live! You must rescue the Earth! SOS! SOS! The world is sinking! Neptunian invasion has begun!', '/images/nes/3620/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Sqoon_boxart.jpg', NULL, NULL),
(3621, 'Stack-Up', 'Robot Block', NULL, 'Here\'s a high-tech, high-strategy juggling act that\'s loads of fun!', '/images/nes/3621/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6b/Stackup_boxart.jpg', NULL, NULL),
(3622, 'Stadium Events', NULL, NULL, 'Stadium Events Game Pak, which turns your home into an exciting stadium, dares you to increase your physical ability and better your athletic record. You\'ll compete against a runner in the Tournament Mode, and in 4 events for a total score in the Olympic Mode. The top 6 winners\' names and their scores will appear on the electronic billboard. The top 3 winners will stand on the winners platform!', '/images/nes/3622/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/70/Stadium_Events_cover.jpg', NULL, NULL),
(3623, 'Stanley: The Search for Dr. Livingston', NULL, NULL, 'DANGER', '/images/nes/3623/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/1/49721_front.jpg', NULL, NULL),
(3624, 'Star Force', NULL, NULL, 'Moving in the darkness of the cosmos is a evil and mysterious planet named GORDESS. Everyone gave up fighting against GORDESS because of it\'s awesome power, until one day a soldier riding a space patroller challenged GORDESS to fight! Join forces with STAR FORCE and travel across the galaxy in order to defeat GORDESS.', '/images/nes/3624/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/52/Star_Fox_SNES.jpg', NULL, NULL),
(3625, 'Star Soldier', NULL, NULL, 'A strange and evil presence is lurking in space. Crushing everything in its path, destroying spaceships full of innocent people, the brutal Starbrain is threatening the entire Galactic Empire. Starbrain, a giant computer programmed only for destruction, inhabits an enormous space station, guarded by enemy ships and robot creatures. To penetrate the station is a job for the most skillful and experienced Star Soldier - you! You\'ll be piloting Caesar, the fastest fighter ship in the Galactic Fleet, with an awesome arsenal of weapons at your finger-tips. Only you can end the fearsome Starbrain\'s spree of destruction, and restore peace to the galaxy!', '/images/nes/3625/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e1/Star_Soldier_Cover.jpg', 1, NULL),
(3626, 'Star Trek: 25th Anniversary', NULL, NULL, 'Fasten your seatbelts, bring your seat backs to an upright position, and stow away those other computer games. You\'re about to pilot a Federation Starship on a wild roller coaster ride through the final frontier.', '/images/nes/3626/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ad/St25thannivboxsm.jpg', 2.5, 10),
(3627, 'Star Trek: The Next Generation', NULL, NULL, 'Critically-acclaimed on Game Boy!', '/images/nes/3627/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/8/46758_front.jpg', NULL, NULL),
(3628, 'Star Voyager', 'Cosmo Genesis', NULL, 'Adjust your warp meter. Check support systems, laser cannons, defense shields, enemy location. And strap yourself in for the ultimate starfight! Your civilization boarded CosmoStation Noah and left the dying red sun behind. A generation of searching for a new home had only led to frustration. And then, in Spiral Galaxy IX, a flotilla of Molok Wardrivers surrounded Noah. No escape. Prisoners of your own CosmoStation. You and Adam, the bio-computer, had trained for years. You climb into the most supra-tech attack vessel ever conceived. You set out with laser cannons, barrier shields, starbombs, and the guts to win or die. Ahead lie 8 alien galaxies, 9 Molok squadrons, space streams, asteroid belts, black holes... and hope.', '/images/nes/3628/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/33/StarVoyagerAtari2600BoxArt.jpg', NULL, NULL),
(3629, 'Star Wars', NULL, NULL, 'Your mission: Rescue Princess Leia from Darth Vader\'s EVIL clutches! Seek help from Obi-Wan Kenobi and Han Solo, but first you must find them. Finally, blast your last, fatal missile and destroy the Dark Side\'s headquarters... and MAY THE FORCE BE WITH YOU!', '/images/nes/3629/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/6/31476_front.jpg', NULL, NULL),
(3630, 'Star Wars: The Empire Strikes Back', 'Star Wars: Teikoku no Gyakushuu', NULL, 'This game follows the non-stop action of the movie and is a direct conversion of the famous coin-op. All games players and STAR WARS fans alike will enjoy this version of the world\'s best known space-age epic. Brought to you by the team who produced the top-selling STAR WARS game, THE EMPIRE STRIKES BACK is the next stage of the unfolding drama. The player takes the role of Luke Skywalker, piloting a snow-speeder against the huge Imperial Walkers. Darth Vader controls his forces with deadly cunning, using his Probots to search and attack the Rebel Base. The action continues as the player becomes Han Solo in the Millenium Falcon, looking for safety in the galaxy whilst being attacked by Tie-Fighters and dodging asteroid storms.', '/images/nes/3630/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0e/Star_Wars_-_The_Empire_Strikes_Back_-_Atari_2600.jpg', 1, 5),
(3631, 'Starship Hector', 'Hector \'87', NULL, 'In the Star Year of 2038, the 4th world war on Earth destroyed all of mankind. The Starship Hector was thousands of light years away on an exploration mission. Upon their return to what is now ancient Earth, the Starship Hector found Earth to be desolate and inhabited by gruesome bio-mechanical Creatures.', '/images/nes/3631/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e3/Starship_Hector_Cover.jpg', NULL, NULL),
(3632, 'StarTropics', NULL, NULL, 'Find out just how resourceful you can be in this classic game, with its mixture of adventure and RPG elements. Step into the shoes of Mike Jones, a teenage star pitcher from Seattle who has come to the tropics to visit his famous archeologist uncle, Dr. Jones. After being told that his uncle has been abducted, Mike begins a perilous quest in order to rescue him and figure out the mysterious plot behind his disappearance.', '/images/nes/3632/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/84/Startropics_box.jpg', 7, 7.5),
(3633, 'Stealth ATF', NULL, NULL, 'Something Deadly in the Air.', '/images/nes/3633/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/23/Stealth_ATF2.jpg', NULL, NULL),
(3634, 'Stinger', 'Moero TwinBee', NULL, 'Save The Earth From An Alien Snack Attack!', '/images/nes/3634/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Stinger_%28arcade_game%29.png', 1, NULL),
(3635, 'Street Cop', 'Family Trainer: Manhattan Police', NULL, 'LIFE ON THE BEAT', '/images/nes/3635/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/3/7/49737_front.jpg', NULL, NULL),
(3636, 'Street Fighter 2010: The Final Fight', '2010 Street Fighter', NULL, 'Conquer a galaxy with your bare hands! Twenty-five years ago you ruled in the world of the street fighter. Since then you and your partner have created a formula that turns men into supermen. Your partner is dead, the formula has been stolen, and you\'re out for revenge. You use your serum to transform into the most powerful man in the galaxy. You\'ll cross the stars in search of the killers that changed your life forever. With your newfound strength and your old street fighter training, you can\'t wait for your final fight! Teleport across the galaxy in this action/adventure game for the NES! Detailed graphics bring you all the excitement of countless worlds!', '/images/nes/3636/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d3/Street_Fighter_2010_box.jpg', 1.5, NULL),
(3637, 'Strider', NULL, NULL, 'Originally released in 1989, Strider remains one of Capcom\'s most enduring franchises.  The game tells the story of Hiryu, the youngest ever "Super A" ranked agent of an elite corps known as the Striders.  Strider Hiryu receives orders to assassinate Grandmaster Meio, supreme dictator of Earth, who has plunged humanity into a dystopian dark age.', '/images/nes/3637/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/54/Strider_Hiryu_arcade_flyer.png', NULL, NULL),
(3638, 'Super C', 'Super Contra', NULL, 'After losing a confrontation against Super Commandos Mad Dog and Scorpion, the juices of destruction drip from the spiked tongue of the vile alien warmonger - Red Falcon. Now, he\'s coming back stronger than ever, with a sinister plan that includes having his intergalactic warriors seep into the brains of the U.S. Army. To support his disguised forces of doom, he\'s recruited Jagger Froid, a demented alien from the Black Hole Galaxy. He\'s also shuttled in The Babula Destructoid Mechanism with its Beam of Death. With torrential terror about to rain down upon civilization, Earth\'s only hope rests with you, Scorpion, and your pal, the Dogster. And if your spread guns, lasers, flame throwers and mega shells fail to destroy Red Falcon\'s eight levels of terror, including radioactive lava fields, it\'s all over but for the shouting, the screaming and the cries from a disintegrating world!', '/images/nes/3638/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4e/Super_contra.jpg', 1, 3),
(3639, 'Super Cars', NULL, NULL, 'Get ready for some high-speed racing action! Select your car and strap on the extras, then power your way through 27 stages of highway horror, engaging in mile after mile of awesome motorized combat! Do you have the driving skills necessary to come out on top?', '/images/nes/3639/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/80/Super_Cars.png', NULL, NULL),
(3640, 'Super Dodge Ball', 'Nekketsu Koukou Dodge Ball Bu', NULL, 'Team USA is on its way to a Cinderella success story in the Super Dodgy Ball World Cup Championships. From out of nowhere, this scrappy bunch of rookies is advancing to the final round of competition. Seven powerful teams still stand between Team USA and their ultimate challenge; the long awaited grudge match with the undefeated, defending world champions, Team USSR. Only you can lead the U.S. to victory over the highly-favored competition, and give them the chance to crush the mighty Soviets.', '/images/nes/3640/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/89/Super_Dodgeball_poster.png', 1, 5),
(3641, 'Super Glove Ball', NULL, NULL, 'Now you can really reach in and grab the action! Super Glove Ball bridges the gap between game and reality by giving you the sensation of real depth regardless of which controller you use. Throw, catch, punch, and swerve through a maze of rooms, progressing up spiraling skill levels towards your ultimate goal. Along the way you\'ll experience amazing dimensional effects as you ricochet the ball off walls to knock out tiles, blocks, and adversaries.', '/images/nes/3641/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/5/5f/SGB_NES.PNG', NULL, NULL),
(3642, 'Super Jeopardy!', NULL, NULL, 'More Questions! More Players! More Challenge! More Fun! Now you can test yourself and up to three friends against over 2000 of the most challenging questions and answers on television. Here\'s your chance to prove that you can hold your own with the big brains! Play the all-new, expanded format game show that brought the top Jeopardy! money winners together, competing in prime time for the championship. Digitized speech, state-of-the-art graphics, extended play time... it\'s hours and hours of fun for the real Jeopardy! fan!', '/images/nes/3642/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/2/49762_front.jpg', NULL, NULL),
(3643, 'Super Mario Bros.', NULL, NULL, 'Do you have what it takes to save the Mushroom Princess?', '/images/nes/3643/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/03/Super_Mario_Bros._box.png', 1, 2),
(3647, 'Super Mario Bros. 2', NULL, NULL, 'Mario\'s back! Bigger and badder than ever before! This time it\'s a fierce action-packed battle to free the land of Subcon from the curse of the evil Wart. It\'s up to you, along with Mario, Luigi, Toad and the Princess, to fight your way through bizarre multi-level worlds and find him! This time you\'ve got a brand new kind of power - plucking power - and now anything you find can be a weapon. But beware! You\'ve never seen creatures like these! Shyguys and Tweeters! Ninji and Beezos! And you\'ve never had an adventure like this! Only cunning and speed can save you now...', '/images/nes/3647/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/00/Super_Mario_Bros_2.jpg', 6, 20),
(3648, 'Super Mario Bros. 3', NULL, NULL, 'New, different worlds!', '/images/nes/3648/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a5/Super_Mario_Bros._3_coverart.png', 5, 9.5),
(3649, 'Super Pitfall', NULL, NULL, 'Join Pitfall Harry as he searches a vast subterranean cave dwelling high in the Andes. Harry\'s mission is simple - recover the Raj diamond. Interested in helping out? Perhaps a few details, before you volunteer. You\'ll have to be in great shape. The full extent of these caves is unknown, and you must be prepared to explore every square foot to succeed. So, a little dirt, a few cuts and bruises and total physical exhaustion doesn\'t scare you? OK, how about poisonous frogs, bats, snakes, scorpions, tarantulas, cavemen, lavapits and deadly condors? Oh, did we forget to mention Harry\'s niece, Rhonda, and his faithful companion, Quickclaw the Lion? They\'re both trapped below and must be saved before you leave the caves. Just a minor complication. Still with us? Good. Because it gets better and better - over 270 screens loaded with danger and adventure. New enemies and challenges at every turn. Sound like your cup of tea? Then step forward and join Pitfall Harry in the greatest adventure of his career!', '/images/nes/3649/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/2/20/Superpitfall.JPG', 2, NULL),
(3650, 'Super Spike V\'Ball', 'US Championship V\'Ball', NULL, 'Warm up with a few exercise games then face contenders in the American Circuit. For the ultimate challenge play against the best in the World Cup. Jump and block opponent\'s spikes, dive to dig a cross court spike, or set one up for a smash that only the best player can return. Kabooom! Your Super Spike blasts your opponent off his feet! "X" marks the spot so you can track the ball. Pick players with speed, strong defense, or killer offense. Your quick reflexes and competitive spirit complete the team. Play against the computer, by yourself or challenge a friend. With the NES Satellite or the NES Four Score any combination of one to four can play - even two vs. two! Now you can play on sand courts from Daytona to Los Angeles. Face off international teams in Hawaii or challenge the hot Navy team aboard an aircraft carrier. Watch the sand fly! Hear the applause. Soak up the rays! It\'s Super Spike V\'Ball for World Class fun!', '/images/nes/3650/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/9/49769_front.jpg', 2, NULL),
(3651, 'Super Spike V\'Ball/Nintendo World Cup', NULL, NULL, 'SUPER SPIKE V\'BALL', '/images/nes/3651/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/4/49774_front.jpg', NULL, NULL),
(3652, 'Super Spy Hunter', 'Battle Formula', NULL, 'As you blast your way through the next millenium, you\'ll be fighting for your life. Aerial bombs, machine guns, and flying warriors will be on the attack. But that\'s just for starters. You\'ll be piloting the next generation of pursuit craft, including a super-charged racer, aqua blaster water craft and turbo copter. Assuming you can manuever through twists and turns at maximum turbo force, you\'ll need to blast a menacing Boss at the end of each stage. To survive you better have reflexes, guts and a sixth sense to avoid disaster. With the speed and G-force-inflicting action of a super chase into worlds you\'ve never imagined, Super Spy Hunter is light years beyond the original. And with multi-dimensional graphics and sound effects that bombard your senses, it\'ll take everything you\'ve got. Super Spy Hunter. It\'s a manhunt at the speed of light.', '/images/nes/3652/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c9/Spy_Hunter_side_art.png', 3, NULL),
(3653, 'Super Team Games', 'Family Trainer: Daiundōkai', NULL, 'Get out your Power Pad, it\'s time for some serious fun and games! Welcome to SUPER TEAM GAMES. This fast-paced Nintendo Power Pad game will have your heart pounding as you go head to head against a friend or the System in obstacle course events like Wall Jump, Log Run, Crab Walk and Water Cross. Then, for some SUPER TEAM action, choose up sides and play Relay Race, Tug Of War and Six-Legged Race. SUPER TEAM GAMES will make you and all your friends championship competitors. So don\'t delay. Get out your Power Pad and start playing today!', '/images/nes/3653/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/5/49775_front.jpg', NULL, NULL),
(3654, 'Super Turrican', NULL, NULL, 'You are Bren McGuire, on a United Planets Freedom Forces mission to save the peaceful planet Katakis from the Machine, source of all that is cruel and evil in the universe. The only weapon on your side is the state-of-the-art Turrican Assault Suit. Equipped with multiple weapons, including the incredible Freeze-Beam that temporarily immobilizes almost any enemy, the Turrican Assault Suit gives one man the power of an entire army.', '/images/nes/3654/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Super_Turrican_NES.jpg', 1.5, NULL),
(3655, 'Superman', NULL, NULL, 'Superman is an Action game, developed and published by Taito Corporation,  which was released in 1988.', '/images/nes/3655/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3b/Superman64box.jpg', NULL, NULL),
(3656, 'Swamp Thing', NULL, NULL, 'Part Man. Part Monster. Defender of the Earth!', '/images/nes/3656/cover.gif', 'https://upload.wikimedia.org/wikipedia/en/b/bf/SwampThingTitleScreenNES.gif', 2, NULL),
(3657, 'Sword Master', NULL, NULL, 'Sharpen the Blade. Summon the Magic. Your Enemies Await! You are the Sword Master - the supreme warrior. Unleash your magic when a sword won\'t cut it. A kingdom to save... a slew of deadly levels to conquer! Huge enemies only a Sword Master would love. Razor-sharp graphics. Explosive special effects. Get airborne with the exclusive "Multi-Jump" feature.', '/images/nes/3657/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9a/Sword_Master_for_NES_cover_art.jpg', 1, NULL),
(3658, 'Swords and Serpents', NULL, NULL, 'Step into a new world of gaming, where you not only play, you become. Embark on a quest to slay the evil serpent lurking in the inner most depths of the dungeon. Create a mighty band of adventurers, each having unique powers: A fearless warrior, a cunning thief, a wizard with mystical powers, and an enchanting mystic. While fighting skills are vital, Swords and Serpents will stretch your mind and your imagination. As you explore the dungeons, searching for the trappings of the legendary Ruby Warrior, you\'ll confront challenges and decisions at every turn. Will you fight? Will you run? Which of your inventory of strength, experience and magical powers will you use? The serpent is coiled, ready to strike. But you are the master of your destiny. Will you rise to the challenge? No NES game has gone this far before!', '/images/nes/3658/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/02/Swords_and_Serpents_cover.jpg', 15, NULL),
(3659, 'Taboo: The Sixth Sense', NULL, NULL, 'Taboo is your personal link to the future, your window onto the unknown! Based on traditions centuries old, it combines the ancient tarot system of predicting events to come with the high technology of the computer. The result is answers to your questions about future events, plus personal lucky numbers when you want them!', '/images/nes/3659/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/4/22274_front.jpg', 1, 1),
(3660, 'Tag Team Wrestling', 'Tag Team Pro Wrestling', NULL, 'You are challenged to match the awesome skills of your opponents...to gain the Title in the World Super Championships of TAG TEAM WRESTLING', '/images/nes/3660/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/df/Tag-TeamWrestling_arcadeflyer.png', NULL, NULL),
(3661, 'TaleSpin', NULL, NULL, 'Talespin is a Miscellaneous game, developed by Various and published by MicroDeal,  which was released in Europe in 1988.', '/images/nes/3661/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/3/46823_front.jpg', 1, 2.5),
(3662, 'Target: Renegade', NULL, NULL, 'Every move you make, every step you take, they\'re watching you fight your way through the precinct,  the back alleys, the car parks. Fight your way through the villainous community, the skin-heads, the Beasts, the bouncers. And this is just the tip of the iceberg on your chilling quest to confront "MR. BIG".', '/images/nes/3662/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b8/Target_renegade_inlay.jpg', NULL, NULL),
(3663, 'Tecmo Baseball', NULL, NULL, 'Manage your own team to the series championship. Even create your own All-Star Game!', '/images/nes/3663/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/8/8/49788_front.jpg', NULL, NULL),
(3664, 'Tecmo Bowl', NULL, NULL, 'TECMO BOWL! You\'ve trained for it in the arcade. Now, strap on your helmet and go for it! Choose your team and select plays for your own game plan. From the snap, total control of every pass, block, run, and tackle is in your hands. Tecmo Bowl! The game of guts and glory!', '/images/nes/3664/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9d/TecmoBowl_arcadeflyer.png', 5, NULL),
(3665, 'Tecmo Cup Soccer Game', 'Captain Tsubasa', NULL, 'Tecmo Cup Soccer is a totally unique concept in a sports strategy and cinema action game. As you gain knowledge and experience of soccer, you can advance to the world cup soccer matches. Follow the dynamic sports career of Robin Field, the son of a world famous soccer star, from his early years in the junior leagues on his quest for fame and glory in the world cup soccer matches.', '/images/nes/3665/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/9/20359_front.jpg', NULL, NULL),
(3666, 'Tecmo NBA Basketball', NULL, NULL, 'Are you ready to take your favorite NBA team to the NBA Finals?', '/images/nes/3666/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/21/Tecmo_NBA_Basketball_cover.png', NULL, NULL),
(3667, 'Tecmo Super Bowl', NULL, NULL, 'The teams, the players, and the halftime shows are ready for the ultimate football season, and you\'re in control. From the first pre-season game to the playoffs, it\'s your call, your skill, and your team. Can you get to and win the Super Bowl? Tecmo Super Bowl is the only football game to feature onside kicks, blocked passes and kicks, fumbles, pitchout to the running back, player injuries, time-outs, and much, much more! For 1 or 2 players. All 28 NFL teams! Four running plays, four passing plays. Team stats and data. Create your own Pro Bowl. Coach Mode, where you call the plays!', '/images/nes/3667/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/3/49793_front.jpg', NULL, NULL),
(3668, 'Tecmo World Cup Soccer', NULL, NULL, 'Sixteen unique representative teams compete for the world championship. Can the team you choose get an amazing 15 consecutive wins and become the best in the world? You yourself actually control all 11 players on the screen! Control various techniques such as the sliding and overhead shots, as well as the running directions! TECMO WORLD CUP SOCCER is packed full of the exciting world of soccer. With a wide variety of ball control techniques, set plays, and penalty kick shoot-offs, anyone can become a superstar in no time!', '/images/nes/3668/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/0/49790_front.jpg', NULL, NULL),
(3669, 'Tecmo World Wrestling', 'Gekitou Pro Wrestling!! Toukon Densetsu', NULL, 'It\'s your call from the opening bell to the final pin. Select your wrestler and take on any challenge. Every bodyslam, every cobra twist and piledriver brings you closer to victory. Will you be the one receiving the Tecmo World Wrestling Championship Belt?', '/images/nes/3669/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/4/49804_front.jpg', 1, NULL),
(3670, 'Teenage Mutant Ninja Turtles', 'Gekikame Ninja Den', NULL, 'Carnivorous robots chow-down in China Town, while brutal Ninjitsu Warriors, blood descendants of the deadly "Foot" Clan, bust-up bystanders from the Bronx to Broadway. Police SWAT Teams can\'t stop them, but the Teenage Mutant Ninja Turtles can! \'Cause, powered by slices of pizza, they\'re always ready to rumble - with nunchukus, Katana Blades, and a party bus loaded with Anti-Foot Clan Missiles. So team up with the turtles, Raphael, Leonardo, Michaelangelo and Donatello, then switch on the tortoise radar, following your map and sixth sense past savage traps and secret sewage passages. Knock heads with the nasty Ninjitsu and either splatter them senseless or get yourself turned into turtle soup!', '/images/nes/3670/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6d/Teenage_Mutant_Ninja_Turtles_%28Kevin_Eastman%27s_art%29.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(3671, 'Teenage Mutant Ninja Turtles II: The Arcade Game', 'Teenage Mutant Ninja Turtles: Super Kame Ninja', NULL, 'Yo! After being treated like garbage by the Ninja Turtles, Shredder has trained a new, more merciless breed of Foot Soldiers to inflict his revenge: A clan of over 700 Taekwondo turtle terminators who have once again captured April O\'Neil to use as turtle bait. Fortunately you don\'t have to face these freaks of torture alone. For the first time ever, two dudes or dudettes can join forces and double-team Shredder, kicking shell while covering each others tails. But to survive you\'ve gotta fight through 8 action-packed arcade levels, including Vinnie\'s Valet "Stalking" Lot and the Soho Sewer System, plus two new never-before-seen shell-squashing stages! Each of these deathtraps is reinforced by lethal electro zappers, laser beams, freezer burners or enemies such as Scorpion Robots, Stone Warriors and Baxter Stockman. Shredder has also hired the all-powerful Tora and Shogun, two alien bounty hunters who have never known defeat. Even though Master Splinter has prepared the turtles well for battle, teaching them radical new attack moves, it doesn\'t mean this war to save April and turtlekind will be a piece of cake or even a slice of pizza. Because with the forces of revenge on his side and the bounty boys in town, it\'s payback time for Shredder!', '/images/nes/3671/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4e/Turtles_in_Time_%28SNES_cover%29.jpg', 1, 1.5),
(3672, 'Teenage Mutant Ninja Turtles III: The Manhattan Project', 'Teenage Mutant Ninja Turtles II: The Manhattan Project', NULL, 'Surf\'s up, dude! The Teenage Mutant Ninja Turtles make a little getaway to the Sunshine State. Until Shredder makes a major getaway with the entire island of Manhattan! His power hungry plot gets even more bogus when April O\'Neil becomes part of the heist. What a relaxing vacation. Not! Those mondo mutants must make waves to get back home to save April and Manhattan, and send Shredder on a one way trip to geeksville! So unless you want Shredder to ninja-kick sand in your face and make off with your best girl and your hometown, you better get busy. Squashing him once and for all will be no holiday.', '/images/nes/3672/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c9/TMTN3_CoverArt.jpg', 3, 3.5),
(3673, 'Teenage Mutant Ninja Turtles: Tournament Fighters', NULL, NULL, 'Trash the surf board and heave the \'za. It\'s a whole new breed of Turtles and they\'re fixated on fighting. We\'re dead serious, Tournament Fighters takes dude-on-dude demolition to new heights of intensity with 4 modes of pain-producing battles, deadly warriors, secret arenas, astounding graphics and sound effects that\'ll make you cringe! Clash with Krang-created clones of the Turtles, Casey Jones, April O\'Neil, Ray Filet and Sisyphus, plus bosses Triceraton, Krang\'s Android and Karai. There\'s flying body presses, knee drops, head butts, rocket punches, elbow smashes, somersault throws, you\'ll feel and inflict them all. And the settings include Magma Ocean Planet, Jungle Planet, and every other bizarre corner of Dimension X!', '/images/nes/3673/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/6/48246_front.jpg', 1, 6),
(3674, 'Tennis', NULL, NULL, 'Slam a serve, fire a blazing backhand, smash a forehand volley... you call the shots in Nintendo TENNIS! Nintendo lets you choose an opponent from five different skill levels, so as your game improves, so does your playing partner! Plus, you can actually gauge the speed of your serve! The better your timing, the faster it moves across the net. You\'ll have hours of fun rushing the net, playing the baseline or roaming the court. With Nintendo\'s state-of-the-art graphics and realistic game play, you\'ll really believe you\'re at center court!', '/images/nes/3674/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/98/Tennis_%28video_game%29.jpg', 2, 3),
(3675, 'The Terminator', NULL, NULL, 'The cult movie phenomenon batters its way into your home in the most relentless arcade/adventure game of all time! From the nightmare world of the future to the mean streets of Los Angeles, The Terminator takes you right to the very edge... then pushes you over! Play urban commando Kyle Reese and pit your speed, skill and cunning against the most perfect killing machine ever devised. Or take a trip through the dark side and become The Terminator, a ruthless cyborg juggernaut bent on destroying mankind\'s last hope. It\'s your choice. One thing is certain... the fate of all humanity rides upon your next move!', '/images/nes/3675/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/70/Terminator1984movieposter.jpg', NULL, NULL),
(3676, 'Terminator 2: Judgment Day', 'Terminator 2', NULL, 'It comes from the future. It can take any shape and survive almost any injury (even when a 10-gauge shotgun blast opens it up like a tin can). Its mission: eliminate John Connor. Its name: the T-1000. Against it stands one hope: you, a terminator model T-800... equipped with on-screen target search displays, a lever-action Winchester, and 10 barrels of high explosives... one mean machine. Protect John Connor (before a 23,000 lb. tow-rig plows your Harley into tomorrow). Save humanity (while Uzi-armed SWAT teams try to blow you away). Terminate the T-1000 (steel mill metldown!)... or mankind is history.', '/images/nes/3676/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/2/32922_front.jpg', 1, 1.5),
(3677, 'Terra Cresta', NULL, NULL, '\'TERRA CRESTA\' is a shooting game that was released from Nihon Bussan in 1985.  Players recapture parts that have been left in the ground.  Intercept the enemy in formation attack and aim to the space devil Mandora.    ', '/images/nes/3677/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/6/49806_front.jpg', 1, NULL),
(3678, 'Tetris', NULL, NULL, 'The Soviet game sensation is now on your Game Boy! Beams, boxes, zig-zags and L-shaped blocks drop down a narrow passage. Feel your pulse quicken as you spin, shift and align the shapes for a perfect fit. It\'s challenging and demands split-second decision making! Start at new heights for a tougher contest. Pick the music and set your pace from 20 progressive skill levels!', '/images/nes/3678/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8d/NES_Tetris_Box_Front.jpg', 6, 7.5),
(3679, 'Tetris 2', 'Tetris Flash', NULL, 'The mesmerizing fun of Tetris returns - and the challenge escalates to new heights! Test your dexterity, tease your brain and rack up points with Tetris 2. Your split-second decisions lead you to a new dimension in puzzle-solving action! Play alone or challenge a friend in simultaneous split-screen action. A tougher Tetris with more shapes, more components, 30 levels - and unlimited solutions! If you loved the international game sensation Tetris, you\'ll be wild for the newest dimension in puzzle fun: Tetris 2!', '/images/nes/3679/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0a/Tetris_2_NES.jpg', 1, NULL),
(3680, 'The Three Stooges', NULL, NULL, 'Moe, Larry & Curly star in their own Cinemaware Interactive Movie! Join those zany masters of mirth as they try to save an old lady and her 3 beautiful daughters from the clutches of an evil banker. You\'ll hear the real Stooges\' voices as you maneuver them through a variety of antics, including prizefighting, pie throwing and medical madness in the famous "Calling Dr. Howard, Dr. Fine, Dr. Howard" scene.', '/images/nes/3680/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/2/23382_front.jpg', NULL, NULL),
(3681, 'Thunder & Lightning', 'Family Block', NULL, 'Mr. Chin the world renowned connoisseur is back to his zany antics. After chasing delicacies around the world, he has found himself trapped within the realm of the Thunder Warrior.\n\nThe Thunder Warrior is not pleased with Mr. Chin\'s meal chasing escapade, and has trapped Mr. Chin, within the Thirty Walls Of Regret. As Mr. Chin, you must blast your demoe ball through the Walls Of Regret to make it home in time for dinner!\n\nGAME FEATURES:\n-One player, two player, or two player simultaneous competition.\n-Use with your standard NES Joypad or any other authorized Nintendo joystick.\n-Multiple screen patterns for maximum player enjoyment.', '/images/nes/3681/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/9/49809_front.jpg', NULL, NULL),
(3682, 'Thunderbirds', NULL, NULL, 'Think you\'ve got what it takes to fly a Thunderbird? Find out in this thrilling action game based on the classic TV show! It\'s your once-in-a-lifetime chance to enroll with International Rescue and pilot all the ships made famous by the legendary Tracy family. Rescue trapped civilians with Thunderbird 1, ferry nuclear payloads with Thunderbird 2, soar into space with Thunderbird 3, and search the ocean depths in Thunderbird 4! Ready for launch? FAB! Over 50 fun-filled missions set all around the world! Control the Thunderbirds over land, under sea and even in space! Stay alert for The Hood he\'s always lurking, waiting to strike!', '/images/nes/3682/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/2/49812_front.jpg', NULL, NULL),
(3683, 'Thundercade', NULL, NULL, 'Terrorism has reached new heights. AATOM (Atomic Age Terrorist Organization of Miracali) has constructed its own nuclear power plant, and threatens the world with atomic terror.', '/images/nes/3683/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/5/49815_front.jpg', NULL, NULL),
(3684, 'Tiger Heli', NULL, NULL, 'The Mission: Shatter the enemy defense lines and destroy the military headquarters of a war-crazed nation. The Time: Sunrise. The Place: Classified information. The Weaponry: Tiger-Heli and you. Tiger-Heli. The result of a billion-dollar defense project. The ultimate stealth helicopter. Turbine powered. Forged from ebony metal and glistening chrome. Armed with heat-seeking missiles and impact bombs. Able to fly in the stratosphere or inches above the ground. With only enough fuel to get you to the heart of the mega-fortress. Getting out is up to you. It\'s a last-ditch effort to halt a war-crazed nation. Fanatics sworn to overrun any country they can conquer. And, in this war, they\'ve been winning. They have rocket firing tanks, destroyers, and weapons never seen before. You have Tiger-Heli!', '/images/nes/3684/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/7/49817_front.jpg', 5, NULL),
(3685, 'Time Lord', NULL, NULL, 'It is the year 2999, and warriors from the planet Drakkon are launching a savage attack on Earth. Their weapon: a powerful time travel device. Their objective: to control us by changing the course of our history. To win this war, we must meet the Drakkons on a unique and dangerous battleground: our own past! You are a fearless fortune-hunter, hired by desperate scientists for an experimental journey into the 4th dimension. Your code name is Time Lord. Your mission: blast into the past to save the present from certain doom! Battle the aliens in four historical time zones. Search for weapons sent back by the scientists - and decide when to use them. Solve puzzles to collect the mysterious Orbs that hold the secret of time travel. Be cautious yet quick, Time Lord. You have one short year to free history or be history! And the evil Drakkons have all the time in the world...', '/images/nes/3685/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/6d/Time_Lord_Coverart.png', 4.5, 6),
(3686, 'Times of Lore', NULL, NULL, 'Enter the Kingdom of Albareth! An action-packed fantasy role-playing game that lets you adventure in strange and faraway lands with super graphics and super fun! Travel along seashores or explore desert ruins. Test your strength, skill, and courage using your sword and wit against your enemies in Times of Lore! Times of Lore is a real-time action game that lets you experience an epic story with you as the hero! The fantasy role-playing game filled with endless fantastic excitement!', '/images/nes/3686/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fa/Times_of_Lore_cover.jpg', 1, NULL),
(3687, 'Tiny Toon Adventures', NULL, NULL, 'These Tiny Toons have big problems. That\'s right. The arch enemy of Acme Acres, Montana Max, has kidnapped the ever-so-popular Babs Bunny. Now the furry female\'s fate rests in the paws of Buster Bunny and his crime fighting pals - Dizzy Devil, Furrball and Plucky Duck. Four kooky buddies with their own special talent. Buster can bounce over bad guys with the best of them. Furrball uses his feline claws to climb walls. Dizzy Devil prefers to spin through them. And Plucky can glide through the air and swim like a fish. Choose which partner you want at the beginning of each level before you face-off against time and goofballs gone bad in 6 zany wonderlands. So you better get jumping or it will be curtains for our playful pals!', '/images/nes/3687/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f8/Tiny_Toon_Adventures_NES_cover.jpg', 1, 1),
(3688, 'Tiny Toon Adventures 2: Trouble in Wackyland', 'Tiny Toon Adventures 2: Montana Land e Yōkoso', NULL, 'ACME ACRES IS IN FOR A BIG SURPRISE!', '/images/nes/3688/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/26/Tiny_Toon_Adventures_2_Trouble_in_Wackyland_cover.jpg', 2, NULL),
(3689, 'Tiny Toon Adventures Cartoon Workshop', NULL, NULL, 'LIGHTS! CAMERA! ACTION!', '/images/nes/3689/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/ce/Tiny_Toon_Adventures_Cartoon_Workshop_cover.jpg', NULL, NULL),
(3690, 'To the Earth', NULL, NULL, 'You are on a mission to save the Earth. You are the commander of a highspeed astro cruiser.', '/images/nes/3690/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/7/49827_front.jpg', NULL, NULL),
(3691, 'Toki', 'JuJu Densetsu', NULL, 'No ugly wart-nose is gonna make a monkey out of me! But that\'s just what that witch has done - one minute I\'m the mighty Toki and the next I\'m having breakfast delousing my armpits, I can\'t walk a step without tripping over my knuckles and, oh, there\'s an overhanging vine - time to swing out sister! But my broken heart is going ape. My beloved Miho (I can\'t wait to share a banana with her) has been kidnapped and somehow I\'ve got to regain my manhood - until then I\'m just swingin\' in the rain!', '/images/nes/3691/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/9/1/33091_front.jpg', 1, NULL),
(3692, 'Tom & Jerry: The Ultimate Game of Cat and Mouse!', NULL, NULL, 'EEEK! There\'s a mouse in the house! But that\'s no ordinary rodent. It\'s one half of Hollywood\'s most famous cat and mouse team - Tom & Jerry! Can you help Jerry outwit Tom and rescue his nephew Tuffy from the trunk in the attic? It\'s a classic cartoon chase game filled with action, excitement and hilarious surprises! Start in the basement and race up into the kitchen. Then leap out into a tree, climb onto the roof, slide down the chimney, charge through the living room and dash up into the attic. It\'s enough to make a little mouse dizzy! Every floor is filled with hidden dangers. Bees and Squirrels, Bats and hot embers. And let\'s not forget Tom himself. So get a move on, Jerry! Tom\'s hot on your trail!', '/images/nes/3692/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/5/49835_front.jpg', NULL, NULL),
(3693, 'Tombs & Treasure', 'Taiyou no Shinden Asteka II', NULL, 'Deep in the jungles of Mexico lie the ancient Mayan tombs of Chichen Itza. Eternal resting place of kings - and the vast treasure that was buried with them, including the legendary Sun Key. Now a famous archaeologist has vanished there, leaving behind only a tattered notebook that speaks not just of treasure, but of the bloodthirsty demons that guard it. And with the notebook, the legacy of treasure and terror has passed to you... Can you penetrate the heart of the mystery, and find the mythical Sun Key? Or will the tombs of Chichen Itza claim you among the dead?', '/images/nes/3693/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/6/49836_front.jpg', 4.5, NULL),
(3694, 'Top Gun', NULL, NULL, 'You\'re a High Flying Fighter Jock. The Hottest Pilot in the Heat of a Battle.', '/images/nes/3694/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/4/33124_front.jpg', NULL, NULL),
(3695, 'Top Gun: The Second Mission', 'Top Gun: Dual Fighters', NULL, 'So you think you\'re a Top Gun hero, just because you splashed a few bogeys in the Persian Gulf. Well, before polishing your ego, you\'ve gotta survive a second mission that\'s ten times more deadly than the first. Soaring against an Armageddon bound armada of planes, tanks, ships, and satellite laser beams, every ounce of your skill and courage will be drained as you fight fire with fire, while out-maneuvering anti-aircraft blasts, cannon bursts and heat seeking missiles that are looking to roast your tail.', '/images/nes/3695/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/9/49839_front.jpg', NULL, NULL),
(3696, 'Top Players\' Tennis', NULL, NULL, 'Play the game of your dreams with Top Players\' Tennis - the only game where you "become" Ivan Lendl or Chris Evert.', '/images/nes/3696/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e3/Top_Players_Tennis_NES.jpg', NULL, NULL),
(3697, 'Total Recall', NULL, NULL, 'How would you know if someone stole your mind? As Doug Quaid, you travel to Mars to discover your true identity. Your mission is now a journey of non-stop action, strange mutants, futuristic vehicles and a startling array of weaponry all captured in superbly-executed graphics and gameplay that compliments the success of the year\'s top movie!', '/images/nes/3697/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/3/7/33137_front.jpg', 4, NULL),
(3698, 'Totally Rad', 'Magic John', NULL, '-Totally magic... 10 super spells!', '/images/nes/3698/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/2/49842_front.jpg', 1.5, NULL),
(3699, 'Touch Down Fever', 'Touch Down Fever: American Football', NULL, 'TOUCHDOWN FEVER! It\'s the muscle, the hustle, the chomp, the stomp and the strategy that make it football! Run I-formations, quarterback sneaks, shot-gun plays, and more. Try a 40-yard field goal, or punt if you have to! Watch out for the safety, and don\'t cross that line of scrimmage!', '/images/nes/3699/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5b/TouchDownFever_arcadeflyer.png', NULL, NULL),
(3700, 'Town & Country Surf Designs: Wood & Water Rage', NULL, NULL, 'O.K. dudes, the time has come to really get radical. You and the rest of "DA BOYS," T&C\'s famous group of skate and surf crazies, can kick out and pull off some awesome maneuvers together.\n\nWhether you\'re jammin\' the ramps, jumping the cracks, riding the rails or just laying back tall, the skate action is hotter than hot!\n\n...and when you hit the beach to rip up the surf you\'ll be face to face with some of the most explosive swells around. Execute some low, hard bottom turns, flawless spinouts or just skate the lip in order to rack up some serious points on your way to becoming the ultimate skate and surf champion. This action is hardcore... and it\'s your turn.', '/images/nes/3700/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/b/bd/WoodWaterRageNESBoxShot.jpg/220px-WoodWaterRageNESBoxShot.jpg', 1.5, NULL),
(3701, 'Town & Country II: Thrilla\'s Surfari', NULL, NULL, 'Whoa, Thrilla Gorilla! Bag your boards and lay back tall for the raddest, weirdest surf and skate action ever! Wazula, an evil Kahuna, has stolen your babe and taken her to Africa. No curbs and quarter-pipes here, just the ultimate skate challenge of gnarly jungles and bakin\' deserts! It\'s hardcore surfin\' down killer volcanoes and mammoth waterfalls... ever catch a wave riding a shark? Wazula\'s got some smooth moves of his own, like a two-headed flying Rhino, a saw-toothed Great White, and a way-tough Lava Monster big as a volcano. So get rippin\' through the scorpions, slashin\' through the rapids, and trash that Wazula doofus! But don\'t choke, Thrilla... or your babe\'s toast.', '/images/nes/3701/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/7/7c/ThrillasSurfariBoxShotNES.jpg/220px-ThrillasSurfariBoxShotNES.jpg', NULL, NULL),
(3702, 'Toxic Crusaders', NULL, NULL, 'Only a complete and helpless nerd like Melvin Junko could be such a klutz that he would run into a vat of Grossolium 90, a terribly toxic waste by-product of the Island City Chemical Plant. Now the wimpy nerd Melvin has mutated into Toxie, a hideously deformed creature of superhuman size and strength. But all is not lost. Toxie, with his newfound power, has joined forces with Major Disaster, Nozone, Headbanger, and Junkyard to form the Toxic Crusaders. No, not the ultimate heavy metal band, you moron! This motley crew is sworn to defend Tromaville and the rest of the U.S. from the polluting ways of Dr. Killemoff and his Radiation Rangers! It won\'t be any easy mop up operation, but with your help the Toxic Crusaders are sure to make a clean sweep of the six levels of sludge, slime, goop, and grime, while washing Killemoff and his filthy friends off the face of earth forever!', '/images/nes/3702/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e8/Toxic_Crusaders.jpg', 1, NULL),
(3703, 'Track & Field', 'Hyper Olympic', NULL, 'This ain\'t no 20-minute workout. It\'s the ultimate in head-to-head competition, in 8 grueling events. 100 meter dash. Long jump. Hurdles. Javelin. Skeet shooting. Triple jump. Archery. And the high jump. No timeouts, no breathers, no water boys. Just you and your own exhaustion. So get psyched. Pick your level of competition and the opening event. Then block out the roar of the crowd and take a deep breath. Because it\'s not whether you win or lose. It\'s whether you survive!', '/images/nes/3703/cover.png', 'https://upload.wikimedia.org/wikipedia/en/thumb/1/1e/Track%26Field_arcadeflyer.png/220px-Track%26Field_arcadeflyer.png', 1, NULL),
(3704, 'Track & Field II', 'Konami Sports in Seoul', NULL, 'The greatest athletes from around the world have gathered for the grandest sporting spectacle since the golden age of Greece. This pressure-packed competition is as fierce as a starved lion. Surviving is a matter of sweat and concentration in Taekwondo, pole vaulting, canoeing, skeet shooting, hammer throwing, high diving, archery, hurdles, gymnastics, hang gliding, pistol firing, arm wrestling, fencing, triple jumping and swimming... Whew! Wears you out just to read them all. The odds in Vegas say you don\'t have enough strength, stamina or skill, but you know better. And as long as you win, you\'re the crowd favorite. But lose, and you might as well turn in your jockstrap and joystick.', '/images/nes/3704/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/0/03/Track_and_Field_2_cover.jpg/220px-Track_and_Field_2_cover.jpg', 1, NULL),
(3705, 'Treasure Master', NULL, NULL, 'THE ULTIMATE COMPETITION FOR FANTASY PRIZES!', '/images/nes/3705/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3a/TreasureMasterNes.jpg', NULL, NULL),
(3706, 'Trog!', NULL, NULL, 'It\'s survival of the fastest in the prehistoric land of Og. That crazy, one-eyed caveman, the Trog, is hungry... and dinos Spike and Bloop know what that means: RUN FOR YOUR LIVES! Here\'s your chance to change the course of history and save the dinosaurs. Don\'t become Trog\'s Stone Age feast! Instead, use your reflexes and wits racing through 50 fun-filled islands, packed with dino-mite action and surprises. You\'ll witness the greatest inventions of all time: fire, the wheel, the pogo stick (the pogo stick?) - all invented by Trog to catch his dinner - you! Just watch out for the Tar Pits... sticky business. You\'ve got special pick-ups to keep that carnivorous chow hound in check, like pineapples that turn you into a ferocious Trog-munching T-Rex. It\'s like this: either you save the Dinos... or you\'re extinct!', '/images/nes/3706/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/20/Trogvideogame.jpg', NULL, NULL),
(3707, 'Trojan', 'Tatakai no Banka', NULL, 'Prepare yourself for exciting confrontation with the ancient evil army. You are at the controls. The fate of throngs of suffering people held hostage by the brutal king\'s troops await freedom by TROJAN™!', '/images/nes/3707/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/89/Trojan_%28video_game_brochure%29.png', 1, 1),
(3708, 'The Trolls in Crazyland', NULL, NULL, 'The Trolls in Crazyland is an Action game, developed by Kid and published by Vap,  which was released in Japan in 1991.', '/images/nes/3708/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/3/31463_front.jpg', NULL, NULL),
(3709, 'Twin Cobra', 'Kyuukyoku Tiger', NULL, 'You\'re an elite chopper jockey, ready to launch your Cobra against the coastal defenses of an evil superpower. They\'ve got the numbers. You\'ve got the might and the fight! You\'re Twin Cobra, the most awesome attack weapon in the skies!', '/images/nes/3709/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/10/TwinCobra_arcadeflyer.png', 2, NULL),
(3710, 'Twin Eagle', 'Twin Eagle: Revenge Joe\'s Brother', NULL, 'Engage in the most challenging shoot-em-up action packed game yet for the Nintendo Entertainment System. Twin Eagle is a simultaneous two player action adventure with the continue play feature. Your mission is to avenge your brother\'s death by advancing through enemy territory and defeating the enemy\'s fortress.', '/images/nes/3710/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/4/49864_front.jpg', NULL, NULL),
(3711, 'Ufouria: The Saga', NULL, NULL, 'Join Bop Louie as he searches for his three friends - Shades, Freeon Leon and Gil - to help him complete his mad scramble. It won\'t be easy. Brain-boggling mazes, traps and bizarre pitfalls stand in your way back to Ufouria. You\'ll rely on your friends to survive in this strange, changing world. But beware. You better have the right powers for the strange worlds you\'ll encounter... or you lose. As you make your trek through mystical forests, deserts and oceans, you\'ll need to seek out and destroy monstrous creatures every step of the way. Will you have the right powers at the right time? Don\'t let the mind-zapping colors and stupefying sound effects throw you off. Remember - it\'s only a game.', '/images/nes/3711/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/09/Ufouria-box-art.jpg', 4, 5),
(3712, 'Ultima III: Exodus', NULL, NULL, 'This is the ultimate role playing fantasy game. You put together a team of any four character - assume their identities and powers - to conquer the evil Exodus who has created havoc in Britannia. Hostile forests, high mountains, and dangerous oceans all stand in your way as you destroy monsters, search for gold, find clues, and explore dungeons to discover the hiding place of Exodus.', '/images/nes/3712/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b6/Ultima_III_Exodus_cover.jpg', 23, 57.5),
(3713, 'Ultima IV: Quest of the Avatar', 'Ultima: Seisha he no Michi', NULL, 'Prepare yourself for a grand adventure: Ultima IV, sixteen times larger than Ultima III, is a milestone in computer gaming. Lord British has produced a game to challenge, not only your physical and mental skills, but the true fabric of your character. The evil triad of Mondain, Minax, and the hellspawn Exodus, have been vanquished and peace reigns throughout the land of Britannia. Evil yet abounds, but in isolated pockets and in the hearts of men. A new age awaits the coming of one who can conquer evil on all frontiers through the mastery of both magic and the use of force. Daemons, dragons, and long-dead wizards still plague the countryside and must be destroyed. The seeker on the path of the Avatar will face hostile groups composed of mixed enemy types and will survive such encounters only by strategic use of weapons and terrain. Earthly victories over seemingly impossible odds lead to the final conflict, where the ultimate challenge - the self - awaits...', '/images/nes/3713/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/ff/Ultima_IV_box.jpg', 27.5, 50),
(3714, 'Ultima V: Warriors of Destiny', NULL, NULL, 'Enter the realm of Britannia: a world rich in history, adventure, and intrigue. Lord British, the benevolent ruler of Britannia, has been lost on an expedition to explore the vast reaches of a newly discovered underworld. Panic erupts in Britannia when the sole survivor of the expedition returns with dread tales of their fate. To restore peace, the trusted but ambitious subject, Blackthorn seizes control of Britannia. His fanatical devotion to order ultimately transforms him into a self-righteous tyrant. Now, Britannia\'s destiny depends on your ability to discover the fate of Lord British and to unseat the merciless Blackthorn.', '/images/nes/3714/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/89/Ultima5box.jpg', 31, 70),
(3715, 'Ultimate Air Combat', 'Aces: Iron Eagle III', NULL, 'This Ain\'t No Prop-Job Joy Ride.', '/images/nes/3715/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1f/Ultimate_Air_Combat_Cover.jpg', NULL, NULL),
(3716, 'Ultimate Basketball', 'Taito Basketball', NULL, 'This is IT! Real basketball for your NES! Control one of seven teams and challenge the computer at three levels, go head-to-head with a friend, or enter the U.B. tournament and compete for the title! Getting tired of challenging your friends? O.K., then team up with them against the computer! ULTIMATE BASKETBALL - all the fast-breaking, slam-dunking, IN-YOUR-FACE action you can handle! This full court basketball game puts you in charge. Make the plays, dribble-drive the ball, and even substitute players!', '/images/nes/3716/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/6/49876_front.jpg', NULL, NULL),
(3717, 'The Uncanny X-Men', NULL, NULL, 'The entire human race is in danger! Magneto and his band of evil mutants are on the rampage and nothing can stop them... except for you, professor Xavier and your uncanny X-Men. Cerebro, your advanced computer system, displays the different missions, all of which must be completed in order to accomplish your ultimate goal... the defeat of Magneto!', '/images/nes/3717/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/bd/The_Uncanny_X-Men_Coverart.png', 3.5, NULL),
(3718, 'Uncharted Waters', 'Daikoukai Jidai', NULL, 'Climb aboard your flagship and set sail! As a young Portuguese captain, you are in search of fortune and fame. With your first mate at the helm, navigate the way to distant lands and legendary riches.', '/images/nes/3718/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/16/Uncharted_Waters_Cover.jpg', 27, NULL),
(3719, 'Uninvited', 'Akuma no Shoutaijou', NULL, 'What a pity about your automobile. And your sister, she came to our mansion for help. But now, I\'m afraid she desperately needs yours! Welcome to our humble abode... I regret you\'ll have to carry on your search alone. It seems we\'re down to a skeleton staff. Oh my! Is that your sister screaming? I hope you\'re not too late to save her. Horrors! It\'s becoming grotesquely obvious why all our guests feel so... Uninvited!', '/images/nes/3719/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d7/Uninvited_cover.png', 1.5, NULL),
(3720, 'The Untouchables', NULL, NULL, 'Take on the mob! The ultimate six exciting action sequences put you in control of Elliot Ness\'s elite squad of crime-busters. Alleyway shootouts, the Border Raid, the Railway Station confrontation and Warehouse bust, culminating in the thrilling denouement of a rooftop duel as you re-live the knife-edge existence of Ness in his stuggle against the retribution of Capone! The Untouchables - live an American legend!', '/images/nes/3720/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/0/49880_front.jpg', NULL, NULL),
(3721, 'Urban Champion', NULL, NULL, 'Are you tough enough to take on the baddest guys on the block?', '/images/nes/3721/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8d/Urban_Champion_cover.jpg', 1, NULL),
(3722, 'Vegas Dream', 'Viva Las Vegas', NULL, 'Bring a casino home to your living room! Up to four high-rollers can play Blackjack, Roulette, Keno, or Slot Machines. Odds are you are going to love VEGAS DREAM!', '/images/nes/3722/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/1/49881_front.jpg', NULL, NULL),
(3723, 'Vice: Project Doom', 'Gun-Dec', NULL, 'Everybody\'s craving it, and the hunt is on... "Gel" is the latest drug to hit the streets. It\'s neon green, lethal, and dropping its users like flies. You\'re Vice officer Quinn Hart, a no-nonsense sledgehammer for the law. You pack a vicious .44, crushing grenades, and a lightning fast laser whip that gives you an edge over anything on two feet. Your mission: take down the big boss of this operation. It ain\'t easy... You\'ve got an army of assassins just waiting to take you for a ride - a LONG ride. You\'ll battle in the dark alleyways of Chinatown, on the highways, and through steamy jungles. Ultimately, you\'ll have to seek and destroy the vendor of the green elixir!', '/images/nes/3723/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/2/49892_front.jpg', 2, NULL),
(3724, 'Videomation', NULL, NULL, 'With Videomation, everyone is an artist! Videomation has drawing tools, stamps and an animation feature that lets your imagination go wild! Use with the NES to create vivid pictures with spectacular colors - some you can even program to move! Add fun stamps to your drawing and direct the animation selection to make it come alive. Hook up your VCR with Videomation to create wonderful, crazy additions to your family videos. It\'s easy enough for everyone! Bring the action of a starship battle or the mystery of a dark forest into your home. Remember, the only limits to Videomation is your own imagination!', '/images/nes/3724/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/2/22292_front.jpg', NULL, NULL),
(3725, 'Volleyball', NULL, NULL, 'Slam the perfect serve. Spike the game-winning point. Make the save that saves the game! It\'s all up to you. Because you call the shots in Nintendo VOLLEY-BALL. You\'ll start by selecting a team from the country of your choice. As Captain, you\'ll lead your team through a fast-paced warm-up round, then quickly move into the heat of real volleyball competition. You\'ll decide when to spike, when to lob, when to make a diving save - everything just like the captain of a real volleyball team! Play against a friend or challenge the computer. Either way, Nintendo\'s true-to-life graphics and realistic game play will bring all the fun and excitement of voleyball right into your home!', '/images/nes/3725/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/83/Volleyball_Cover.png', NULL, NULL),
(3726, 'Wacky Races', 'Chiki Chiki Machine Mou Race', NULL, 'The wackiest, wildest cartoon racing game ever is here. Based on the original Hanna-Barbera cartoon, Wacky Races lets you join your favorite characters on a wild race where only your wits, your driving skills and your bag of dirty tricks will get you across the finish line first!', '/images/nes/3726/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/7/8767_front.jpg', 1.5, 2.5),
(3727, 'Wall Street Kid', 'Money Game II: Kabutochou no Kiseki', NULL, 'Where life, love and money all depend on how well you play the game. Make billions of dollars when you deal with the giants of Wall Street. Not only do you take risks by playing the stock market, but you must prove you can uphold a high standard of living. If you dream of fame and fortune, this Life Simulation game is your way to the top. You can taste the victory of success, but only if you\'re strong enough to face the challenge of life. Now, are you ready to deal?', '/images/nes/3727/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/4/22294_front.jpg', NULL, NULL),
(3728, 'Wario\'s Woods', 'Wario no Mori', NULL, 'It\'s up to Toad to keep the woods safe in this new puzzle-action!', '/images/nes/3728/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5f/Wario%27s_Woods_NES.jpg', 5, 10),
(3729, 'Wayne Gretzky Hockey', NULL, NULL, 'Face off with the "Great One" Number "99," Wayne Gretzky, nine time winner of the NHL\'s MVP award and the leading point scorer in the history of the game. Designed with Wayne and other hockey professionals, this riveting simulation is packed with all the excitement and hard-hitting action that could be squeezed into the Nintendo Entertainment System. From the adrenaline rush of a breakaway goal to the tension of Sudden Death Overtime, WAYNE GRETZKY HOCKEY takes you onto the ice for the ultimate test of skill.', '/images/nes/3729/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/5/49905_front.jpg', NULL, NULL),
(3730, 'Wayne\'s World', NULL, NULL, 'Are you ready  for this? Number One of the Top Ten Most Bizarre Things to Happen This Year: Garth has been kidnapped! No way, you say? Hway!! It\'s the work of a most heinous goon - a pixelated purple putridosity called Zantar. And now you, Wayne Campbell, must heartily rescue your excellent sidekick from a fate most unbecoming!', '/images/nes/3730/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/3/3/46933_front.jpg', 1.5, NULL),
(3731, 'WCW Wrestling', 'Super Star Pro Wrestling', NULL, 'WCW Wrestling is a Sports game, developed and published by Electronic Arts,  which was cancelled before it was released.', '/images/nes/3731/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1f/WCW_World_Championship_Wrestling_Coverart.png', NULL, NULL),
(3732, 'Werewolf: The Last Warrior', 'Choujinrou Senki Warwolf', NULL, 'He\'s BAD, RAD and extremely MAD - because to a WEREWOLF, there\'s nothing like revenge! The world\'s been destroyed by Dr. Faryan, a twisted madman possessed by an ancient spirit. Faryan\'s henchmen rule. But one buff warrior\'s been granted magical powers of the wolf and is now out to bust-up Faryan. And when WEREWOLF finds him, the fur and fangs will fly!', '/images/nes/3732/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9f/Werewolf_The_Last_Warrior_cover.jpg', NULL, NULL),
(3733, 'Wheel of Fortune', NULL, NULL, 'Wheel of Fortune is a Miscellaneous game, developed and published by Ubisoft,  which was released in 2017.', '/images/nes/3733/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/d/d3/Wheel_of_Fortune_logo.png', NULL, NULL),
(3734, 'Wheel of Fortune Family Edition', NULL, NULL, 'The exciting software version of television\'s number one game show has an all-new Family Edition! Now, everybody\'s favorite, Wheel of Fortune, has even more great fun: over 1000 challenging puzzles in both regular categories and new ones to give you even more great game play. You\'re the contestant competing against your friends or matching wits with the computer. You already know how to play... and it\'s your turn. Let the theme music inspire you and spin for a consonant or buy a vowel if you have the cash. If you\'re right, the pretty hostess will turn the letters. Do you want to take a shot at guessing the puzzle, or do you want to run up your score? Get set to spin, get set to win - the Wheel of Fortune Family Edition is hours of fun for the whole family!', '/images/nes/3734/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/d/d3/Wheel_of_Fortune_logo.png', 1, NULL),
(3735, 'Wheel of Fortune: Featuring Vanna White', NULL, NULL, 'Wheel of Fortune as now bigger and better than ever in this all new Super Nintendo edition of television\'s most popular game-show. Featuring over 4,500 all new puzzles, digitized photography of the actual set and even digitized speech from the beautiful Vanna White. Choose the contestant you want to be, play against the computer or up to two friends spin the Wheel, buy a vowel or attempt to solve the puzzle before you go bankrupt.', '/images/nes/3735/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/4/49914_front.jpg', NULL, NULL),
(3736, 'Wheel of Fortune Junior Edition', NULL, NULL, 'Now everyone\'s favorite TV Game Show is just for kids! It\'s got all the excitement of the adult version... everything you see on TV and more. But the puzzles have been created just for the young player.', '/images/nes/3736/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/1/49911_front.jpg', NULL, NULL),
(3737, 'Where in Time Is Carmen Sandiego?', NULL, NULL, 'Carmen Sandiego, notorious ringleader of Villains International League of Evil, is travelling through time stealing history\'s treasures. It\'s up to you to catch her before she alters the course of time! Hundreds of cases to solve, spanning 15 centuries!', '/images/nes/3737/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e9/Where_in_Time_is_Carmen_Sandiego_Coverart.png', 4, NULL),
(3738, 'Where\'s Waldo?', NULL, NULL, 'TAKE A WORLD-WIDE HIKE!', '/images/nes/3738/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/5/22295_front.jpg', 1, 1.5),
(3739, 'Who Framed Roger Rabbit', NULL, NULL, 'Get the Doom Out of Town!', '/images/nes/3739/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4a/Roger_Rabbit_NES.jpg', NULL, NULL),
(3740, 'Whomp \'Em', 'Saiyuuki World 2', NULL, 'Unknown perils lurk behind every corner! Seven powerful magical objects to use. Fight your way through eight complete worlds. Choose your own adventure. Grapple evil beasts at the end of each world.', '/images/nes/3740/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8c/Whomp_%27Em_Coverart.png', NULL, 1.5),
(3741, 'Widget', NULL, NULL, 'A Widget for all troubles! When Widget accidentally sends himself to Earth, he finds a whole planet-full of problems. Luckily, he can transform into many different shapes and fight the criminals who are trying to destroy Earth. As a Cannon, a Bird, a Dolphin, and more, Widget can tackle these fiends and finally face his own corrupt twin. Now join in the most dangerous, action-packed adventure a young Widget has ever faced!', '/images/nes/3741/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/09/Widget_Coverart.png', NULL, NULL),
(3742, 'Wild Gunman', NULL, NULL, 'You palm sweats as you grip your Zapper™ light gun. The Outlaw\'s eyes flash. He yells "Fire!" And suddenly you\'re in the middle of a Wild West shootout! Get the Outlaw before he gets you, and you\'ll win a reward! But watch out - the more you win the tougher it becomes, because this gunman has some very nasty friends. You can take on one outlaw, two outlaws - or the whole wild gang. And you up to the action? Because it\'s fast and furious in this quick -on- the-trigger Nintendo Light Gun game!', '/images/nes/3742/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d1/Wild_Gunman_Coverart.png', 1, NULL),
(3743, 'Willow', NULL, NULL, 'Long ago, in a time of magic and sorcery, an evil sorceress named Queen Bavmorda ruled the land under a reign of terror.', '/images/nes/3743/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c1/Willow_1988_DOS_box_art.jpg', 2, 4),
(3744, 'Win, Lose, or Draw', NULL, NULL, 'All the challenge and action of the real TV show! And more . . . introducing the unique video drawing feature that lets YOU draw the clues, or the Computer Artist automatically draws the clues for you. Hurry! The clock begins to tick . . . the tension mounts . . . your concentration and reflexes are put to the test as pictures of wacky phrases and famous people are revealed on the screen.', '/images/nes/3744/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b5/Win%2C_Lose%2C_or_Draw.jpg', NULL, NULL),
(3745, 'Winter Games', NULL, NULL, 'It\'s all here - the strategy, the challenge, the competition and the pageantry of the Winter Games. Compete against a friend or take on the computer in four completely realistic and action-packed events. Choose the country you want to represent. Then practice, train and develop the winning strategy for each competition... Speed Skating in a grueling race on ice. Hot Dog Aerials for daredevils on skis. Figure Skating to test balance, stamina and precision. Bobsled, where every screaming turn could mean the difference between wiping out and winning gold. Your adrenaline and heart are racing. Let the games begin!', '/images/nes/3745/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/74/Winter_Games_Coverart.png', 1, NULL),
(3746, 'Wizardry: Proving Grounds of the Mad Overlord', NULL, NULL, 'Are you ready to step into the world of Wizardry? Unmatched by any other fantasy role-playing game, the Wizardry Gaming System allows for unlimited combinations of strategies and tactics, so that each quest into the Maze is always fresh and interesting.', '/images/nes/3746/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/20/Wizardry_pgotmo.jpg', 26, NULL),
(3747, 'Wizardry II: The Knight of Diamonds', NULL, NULL, 'Are you ready to take the next step into the world of Wizardry? A step so dangerous, the mere utterance of a spell can decimate the entire city of Llylgamyn. Knight of Diamonds is the Second Scenario in the Wizardry Master Series, the fantasy role-playing simulation for the Nintendo Entertainment System. In Wizardr Knight of Diamonds, only the bravest may venture through murky dungeons more dangerous than any ever encountered by earthly mortals. Only the most cunning may recover the magical Staff of Gailda and save the city of Llylgamyn.', '/images/nes/3747/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/6d/Wizardry_II_-_The_Knight_of_Diamonds_Coverart.png', 34, NULL),
(3748, 'Wizards & Warriors', 'Densetsu no Kishi Elrond', NULL, 'You are Kuros, the knight warrior, hero of the Books of Excalibur. Your journey begins deep within the woods of Elrond, where even the wind obeys the Supreme Wizard, Malkil. A wizard so great, Merlin calls him teacher. But Malkil has strayed from the path, and is now part of the dark side. Buried within the catacombs and dungeons of Elrond lies the key to your quest. The powers of levitation, the cloak of darkness, and the mysterious potions only Kuros can drink will be revealed to you. In caverns of fire, through demons that fly and crawl, against the soldiers of the undead you must continue. No sorcery can prevail, for you are the only knight with the strength to wield the Brightsword. The prisoner of the wizard awaits. She calls to you from Castle IronSpire. But the wizard is watching you, warrior. And this tale has just begun.', '/images/nes/3748/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/6/60/Wizards_and_Warriors_NES_cover.jpg/220px-Wizards_and_Warriors_NES_cover.jpg', 3, NULL),
(3749, 'Wizards & Warriors III: Kuros: Visions of Power', NULL, NULL, 'When Kuros last did battle with the Evil Wizard Malkil atop Icefire Mountain, he raised his Ironsword in triumph and glory... or so he thought. Suddenly, a powerful bolt of magic has robbed Kuros of his armor, memory, and honor. But the distant presence of evil stirs in his mind, leading him to the once fair city of Piedup, the very same place where the villainous soul of Malkil survives. Without his armor, Kuros will need crafty disguises to travel undetected, ready to do battle as a wizard, nobleman or thief. His quest will take him from the depths of the dungeon to the palace containing riches beyond belief - building strength, perfecting fighting skills and acquiring rare knowledge of magic along the way. The time has come for Kuros to turn his visions of power... into reality!', '/images/nes/3749/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/3/34/Wizards_and_Warriors_III_NES_cover.jpg/220px-Wizards_and_Warriors_III_NES_cover.jpg', 4, NULL),
(3750, 'Wolverine', NULL, NULL, 'Stranded on a remote, deserted island by his arch enemies, Sabretooth and Magneto, Marvel Comics\' Wolverine must fight the battle of his life. Super-human powers, including regenerative healing abilities, an indestructible Adamantium skeleton and retractable razor sharp claws that slice through anything, make Wolverine a terrifying adversary... but has he finally met his match? Lead Wolverine in this world-class struggle against Sabretooth and the evil genius, Magneto. In the heat of battle, fellow X-Men Havok, Jubilee and Psylocke come to your side helping even out the score. To survive, you must complete 9 missions, including The Battle for the Skies, Trial by Fire, Trial by Water, The Dungeon of Traps, and The Land of Nightmares, until, at long last, you face your ultimate foes. Prepare for the most exciting and unpredictable X-Men adventure of them all!', '/images/nes/3750/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fb/Wolverine_Cover.jpg', 8, NULL),
(3751, 'World Champ', 'Great Boxing - Rush Up', NULL, 'You enter the arena to the sound of thunderous applause. The spotlight hits you as you approach the ring. The chants deafen you as you step onto the canvas. Sweat streams down your forehead as your adrenaline begins to flow.', '/images/nes/3751/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/3/5/49935_front.jpg', NULL, NULL),
(3752, 'World Class Track Meet', NULL, NULL, 'SUPER MARIO BROS.', '/images/nes/3752/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/3/49763_front.jpg', NULL, NULL),
(3753, 'World Games', NULL, NULL, 'Take on the world! WORLD GAMES by EPYX', '/images/nes/3753/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c3/World_Games_cover.jpg', 45, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(3754, 'Wrath of the Black Manta', 'Ninja Cop Saizou', NULL, 'Big Apple crime is rotten to the core. Now, there\'s only one way to keep the peace. The way of the Ninja! Introducing the deadliest fighting skills the game world has ever seen! Ten awesome powers, including: Art of Invisibility. Disappear and become invulnerable to attack. Art of Fire Ring: incinerate enemies caught in your deadly ring of fire. Art of Teleportation: Freeze time to reposition yourself and surprise attackers.', '/images/nes/3754/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/4/49944_front.jpg', 1.5, NULL),
(3755, 'Wrecking Crew', NULL, NULL, 'This amazing Nintendo Programmable game lets you design your own building, place obstacles wherever you want them, and then blow everything to smithereens! You can play the game as designed by Nintendo, or you can be the game designer and build a different maze of barriers to tear down every time. You\'ll have hours of fun demolishing monsters like Gotchawrench and Eggplant Man, and blowing up a building you built yourself, in this off-the-wall demolition game!', '/images/nes/3755/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/0/41680_front.jpg', 15.5, 18),
(3756, 'Wurm: Journey to the Center of the Earth', 'Chitei Senkou Bazolder', NULL, 'The year is 1999.', '/images/nes/3756/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/44/Wurm_Journey_To_The_Center_Of_The_Earth_Cover.jpg', NULL, 2),
(3757, 'WWF King of the Ring', NULL, NULL, 'It\'s the event everyone\'s talking about - the King of the Ring - and now it\'s time to prove you\'re the best! It\'s a brutal, no-time-out elimination tournament for the wrestling crown!', '/images/nes/3757/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c0/Kingofthering.jpg', NULL, NULL),
(3758, 'WWF WrestleMania', NULL, NULL, 'The thrills and spills of the World Wrestling Federation brought to your screen! Test your strength in this muscle-bound wrestling extravaganza! Become the undisputed champion as Hulk Hogan, The Ultimate Warrior or the British Bulldog. Battle for survival against Sgt. Slaughter, the Warlord and a host of other WWF superstars. Anything goes in this all-action event, and only the toughest survives!', '/images/nes/3758/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/5/5b/WWF_NES.PNG', 1, NULL),
(3759, 'WWF WrestleMania Challenge', NULL, NULL, 'Get ready for the greatest in powerhouse action - both in and out of the ring. Go head-to-head with eight of the biggest WWF Superstars.', '/images/nes/3759/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/2/24/Wmchallenge.JPG', NULL, NULL),
(3760, 'WWF WrestleMania: Steel Cage Challenge', NULL, NULL, 'Accept the toughest challenge in all of wrestling: the WWF WrestleMania Steel Cage Challenge!', '/images/nes/3760/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a3/Steelcagechallengesega.jpg', NULL, NULL),
(3761, 'Xenophobe', NULL, NULL, 'Zee-no-phobe: fear of anything alien. At first glance, you\'d never guess there was a living thing aboard the deserted starbase. But inside, it\'s alive and crawling - with the most gruesome horde of alien lifeforms in the arcade galaxy. They lurk around every corner, they blend into every background. They multiply, they metamorphize, they jump from room to room and screen to screen. Watch out or you\'ll get slimed! So grab your joystick and get ready for the latest, most frightening split-screen action imaginable. Xenophobe conquered the arcade. Now it wants you!', '/images/nes/3761/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3c/Xenophobe_Coverart.png', 1, NULL),
(3762, 'Xevious', NULL, NULL, 'The aliens have landed! Or have they? These invading barbarians from deep space claim they are the true Earth people, and we are the aliens!', '/images/nes/3762/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/3/41873_front.jpg', NULL, 6),
(3763, 'Xexyz', 'Kame no Ongaeshi', NULL, 'In the year 2777 nuclear war and natural disasters have long since devastated the earth. Only five sparsely inhabited worlds survive to form a single nation, XEXYZ, where mankind lives peacefully under the rule of good King Xeu Star. But one day XEXYZ is attacked! From deepest space comes GORUZA, a mighty fortress of bizarre and vicious mechanical beasts. XEXYZ is defensless against the assault. All hope is dead. Until, at last, Space Warrior Apollo decides he can no longer endure his people\'s suffering. In full battle gear, he challenges the robotic monsters of GORUZA and their cruel empire, vowing to destroy them and to free XEXYZ from its terrible fate!', '/images/nes/3763/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/02/Xexyz_Coverart.png', 2, NULL),
(3764, 'Yo! Noid', 'Kamen no Ninja Hamaru', NULL, 'Or, How a Yo-Yo Saved New Yoik!', '/images/nes/3764/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/0/9/22309_front.jpg', 1.5, NULL),
(3765, 'Yoshi', NULL, NULL, 'An airborne puzzle invasion! It\'s raining Goombas, Bloobers and Boo Buddies! You have to help Mario cope with the airborne invasion! As the critters fall, catch them on trays. Switch and shuffle to save the day! Stack two of a kind and they both disappear. Or, capture the whole bunch in-between egg shells. When the egg shells match, out hatches Yoshi and up goes your score! The action heats up as the characters fall faster and faster. If your piles get too high, the game is over. Choose your difficulty level and play for a high score or challenge a friend in a head-to-head hatch-off! If you like Dr. Mario, but you\'re ready for a whole new kind of challenge, you\'ll love this quick-shuffle action puzzle game!', '/images/nes/3765/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7d/Yoshi_game_cover.jpg', NULL, NULL),
(3766, 'Yoshi\'s Cookie', 'Yoshi no Cookie', NULL, 'Mario and Yoshi are filling in at the Cookie Factory, and the snacks are piling high! As fresh-baked cookies roll out of the ovens, it\'s up to Mario to sort and stack \'em before they pile too high!', '/images/nes/3766/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c4/YoshisCookieSNESBoxArt.jpg', 2.5, 7),
(3767, 'The Young Indiana Jones Chronicles', NULL, NULL, 'Here is your chance to become Young Indiana Jones, as you set out to single-handedly save the world from the Kaiser\'s war machine. In this World War I epic, you\'ll battle through 19 stages of globe-spanning action, from the deserts of Mexico to the trenches on the Western front to the heart of the German headquarters. You\'ll take on Pancho Villa and Big Bertha, battle tanks and tri-planes and team up with Canadian flying ace Billy Bishop in a dogfight against the Red Baron.', '/images/nes/3767/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a3/Young_Indy_%28NES%29.jpg', NULL, NULL),
(3768, 'Zanac', NULL, NULL, 'The "system" was created by an organic intelligence body many milleniums ago and began attacking the human race. The earth was thrown into turmoil with only one hope for salvation. Fighter model AFX-6502 ZANAC was perfected by the 256th Riot Fleet to ward off the enemy system. It\'s your job, as ZANAC, to save the human race. Using eight special weapons and secret power forces buried along the way, guide ZANAC through 12 screens of enemy creatures to victory.', '/images/nes/3768/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1d/ZanacBoxArt.jpg', 1.5, NULL),
(3769, 'Zelda II: The Adventure of Link', NULL, NULL, 'There are six palaces hidden in Hyrule. Link must gain experience by fighting Ganon\'s underlings, and get information while visiting towns here and there. And, after defeating the guardians at the palaces of Death Valley, he must obtain the Triforce of Courage -- That is Link\'s mission.', '/images/nes/3769/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fd/Zelda_II_The_Adventure_of_Link_box.jpg', 11.5, 12),
(3770, 'Zen the Intergalactic Ninja', NULL, NULL, 'IF YOU LIKE FIGHTING DIRTY, YOU\'RE GONNA DIG ZEN!', '/images/nes/3770/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/3/46973_front.jpg', NULL, NULL),
(3771, 'Zoda\'s Revenge: StarTropics II', NULL, NULL, 'Intrepid adventurer Mike Jones, just back from the South Pacific, is off on a new journey through time and space. Mike\'s mission: to save seven mystic Tetrads while he faces the avengers of his fallen foe, the evil Zoda! Now three alien clones are hot on his trail through time! Unfold nine new chapters of adventures to decipher codes, solve mysteries and battle dragons with heroes of days gone by. Mike won\'t stop until the Tetrads are found and the Zodas are history!', '/images/nes/3771/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/f/fd/Zodasrevenge_box.PNG', 6, 7),
(3772, 'Zombie Nation', 'Abarenbou Tengu', NULL, '1999. What appeared to be a harmless meteorite crashing in the Nevada desert has turned out to be Darc Seed, an evil alien creature with horrible powers. By shooting strange magnetic rays, Darc Seed had turned the helpless nation into zombies and had brought the Statue of Liberty to life to do his dirty work. These rays had also given him control over many deadly weapons, but none were more powerful than the legendary samurai sword, Shura. When the great head of the samurai, Namakubi, heard that the sword had fallen into evil hands, he set off immediately for the United States. For only he possessed the strength and knowledge needed to recapture the magical sword and free the U.S. from the evil clutches of Darc Seed.', '/images/nes/3772/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/2/49952_front.jpg', 1, NULL),
(3817, '\'89 Dennō Kyūsei Uranai', NULL, NULL, '\'89 Dennou Kyuusei Uranai is a Miscellaneous game, developed by Micronics and published by Jingukan Polaris,  which was released in Japan in 1988.', '/images/nes/3817/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/4/2/41642_front.jpg', NULL, NULL),
