(3840, 'Akumajou Special: Boku Dracula Kun', NULL, NULL, 'His pearly fangs drive the girls wild, while his dead-of-the-party sense of humor makes them scream. He\'s Kid Dracula, star of the mythical Transylvania 92010, and the coolest living corpse ever to stake his claim on the Game Boy. If you thought Mario had a way with magic, you should see junior jugular\'s spellbinding powers, including the mesmerizing bat transformation. Poof! Nobody wings it better than Kid Drac.', '/images/nes/3840/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Akumajo_Special-Boku_Dracula-kun%21%28cover%29.jpg', NULL, NULL),
(3841, 'America Daitōryō Senkyo', NULL, NULL, NULL, '/images/nes/3841/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/AmericaDaitouryouSenkyoBoxArtNES.jpg', NULL, NULL),
