(3862, 'Ballblazer', NULL, NULL, 'The year is 3097 ... you are the contestant in the fastest, most competitive, and by far the most popular sport in the universe. Jump immediately into head-to-head action against a friend, or hone your skills against a selection of Droids; either way, you\'re in for the match of the century!', '/images/nes/3862/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a2/Ballblazer_Coverart.png', NULL, NULL),
(3863, 'Baltron', NULL, NULL, 'Baltron is an Action game, developed by Shouei and published by Toei Animation,  which was released in Japan in 1986.', '/images/nes/3863/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7a/BaltronBoxShotNES.jpg', NULL, NULL),
