(3884, 'Bio Miracle Bokutte Upa', NULL, NULL, 'BIO MIRACLE BOKUTTE UPA is an action game released in 1988, but it was never before available outside of Japan. Players take on the role of baby Upa, a prince of the Akuyo kingdom. Prince Upa must take on an adventure spanning seven different worlds in order to rescue the kingdom from the dangerous demon Zai. Upa must defeat the enemies he meets along the way by inflating them. Upa can then use these floating enemies to his advantage by bouncing off of or riding on top of them. The prince must also avoid deadly thorns and pits while keeping an eye out for helpful items such as milk (to restore health) and bells (for temporary invincibility) if he hopes to succeed. If youre looking for a cute and solid platformer with a hero unlike those in most other games, then look no further than BIO MIRACLE BOKUTTE UPA.', '/images/nes/3884/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a8/BioMiracleBokutteUpa_FDScover.png', 2.5, NULL),
