(4034, 'Dragon Wars', NULL, NULL, 'Sailing across uncharted seas, you and your party are in search of a legendary paradise called Dilmun - a place where the streets are paved with gold and no one wants for anything.  However King Drake of Phoebus has declared all magic illegal - magickers have been slain or fled into exile.  In retaliation, enemy islands have threatened to unleash their guardian dragons, the most destructive force in the world.  While docked at a harbor in Dilmun, you are arerested on suspicion of spellcasting.  Imprisoned and stripped of everything but your wits, you are sentenced to life in a cesspool called Purgatory.  Magic is you only salvation - a worldly possession in a world possessed.', '/images/nes/4034/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/0/25270_front.jpg', NULL, NULL),
