(4255, 'Fantasy Zone', NULL, NULL, 'Imagine the wildest, wackiest place in the Universe and you\'ve got Fantasy Zone! As Opa-Opa, a living spaceship, you\'ll marvel at the incredible landscapes filled with the strangest creatures. Watch out! They may look cute and innocent, but they\'re Menons, nasty aliens that have overrun the eight planets that make up Fantasy Zone. Your job is to clear each world of Menons. Every time you zap one, it turns into a coin. Collect enough coins and you can buy power-up items like deadlier weapons and mightier engines. At the end of every planet lurks a super-powerful boss. Find a way to blast past these monsters in order to continue your exciting journey in the Fantasy Zone!', '/images/nes/4255/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/0/09/Fantasy_zone_arcadeflyer.PNG', 1, 2),
(4256, 'Fantasy Zone 2: The Teardrop of Opa-Opa', NULL, NULL, NULL, '/images/nes/4256/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/Fantasy_Zone_2_Sega_Master_System_US.jpg', NULL, NULL),
(4257, 'Field Combat', NULL, NULL, 'Field Combat is an Action game, developed by TOSE and published by Jaleco Entertainment,  which was released in Japan in 1985.', '/images/nes/4257/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/0/40560_front.jpg', NULL, NULL),
(4258, 'Fighting Road', NULL, NULL, 'Fighting Road is an Action game, developed and published by Toei Animation,  which was released in Japan in 1988.', '/images/nes/4258/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/4/5/41645_front.jpg', NULL, NULL),
(4259, 'Final Fantasy II', NULL, NULL, 'The legend continues. A new evil threatens the land, and once more, a band of young heroes stands against it. More new dungeons, more improved graphics. Still the same great story and gameplay.', '/images/nes/4259/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/4/21944_front.jpg', 59, 157),
(4260, 'Final Fantasy III', NULL, NULL, 'First released in 1990, FINAL FANTASY III introduced series hallmarks such as the job system and summon spells, and became the first in the series to sell over a million copies. Reborn in full 3D in 2006, this classic installment of the FINAL FANTASY series is now available for the PSP (PlayStation Portable) system! Graphics have been re-adjusted to fit the 16:9 aspect ratio, and new features such as the sound and image gallery, an option to switch to the original BGM and an \'auto-battle\' system that doubles the speed of combat, have been added!', '/images/nes/4260/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/9/21949_front.jpg', 27.5, 70.5),
(4261, 'Final Lap', NULL, NULL, 'Final Lap is a Racing game, developed by Arc System Works and published by Namco,  which was released in Japan in 1988.', '/images/nes/4261/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/47/Final_Lap_arcade_flyer.jpg', NULL, NULL),
(4262, 'Fire Emblem: Shadow Dragon and the Blade of Light', 'Fire Emblem: Ankoku Ryu to Hikari no Tsurugi', NULL, 'Fire Emblem: Ankoku Ryu to Hikari no Tsurugi is a Strategy game, developed by Intelligent Systems and published by Nintendo, which was released in Japan in 1990.', '/images/nes/4262/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/39/Fe1box.jpg', 28, 50),
(4263, 'Fire Emblem Gaiden', NULL, NULL, 'Fire Emblem Gaiden is a Strategy game, developed by Intelligent Systems and published by Nintendo,  which was released in Japan in 1992.', '/images/nes/4263/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/ee/Fe2box.png', 25.5, 41.5),
(4264, 'Flappy', NULL, NULL, 'Flappy is a Puzzle game, developed and published by DB Soft,  which was released in Japan in 1985.', '/images/nes/4264/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/12/Flappy_Cover.jpg', NULL, NULL),
(4265, 'Fleet Commander', NULL, NULL, 'Fleet Commander is a Strategy game, developed and published by ASCII Entertainment,  which was released in Japan in 1988.', '/images/nes/4265/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/4/40884_front.jpg', NULL, NULL),
(4266, 'Flipull', NULL, NULL, 'ADDICTION! That\'s the name of the game! It all seems so easy, but can you beat the micro or your partner, at this hideously mind boggling game. Special blocks will give you extra lives... GREAT! but believe me, you\'ll need to take every advantage of this software\'s hardware! Plot your move, take aim and block \'em out!... It\'s that simple... as simple as grilling ice cubes!', '/images/nes/4266/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/8/2/41782_front.jpg', NULL, NULL),
(4267, 'Flying Hero', NULL, NULL, 'Flying Hero is an Action game, developed by Aicom and published by Epic/Sony Records,  which was released in Japan in 1989.', '/images/nes/4267/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/1/41671_front.jpg', 1, NULL),
(4268, 'Formation Z', NULL, NULL, 'Formation Z is an Action game, developed by Hect and published by Jaleco Entertainment,  which was released in Japan in 1985.', '/images/nes/4268/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Formation_Z_Cover.jpg', NULL, NULL),
(4269, 'Front Line', NULL, NULL, 'You\'re a lone infantryman on a perilous mission behind enemy lines! The battleground changes constantly as you advance. You\'ll fight every step of the way through all kinds of treacherous terrain... open roadway, dense underbrush and a danger-laden desert. Do you have the strategy, skill and courage it takes to reach and destroy the enemy\'s fortress?', '/images/nes/4269/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d3/Front_Line_Arcade_Flyer.jpg', NULL, 1),
(4270, 'Fushigi no Umi no Nadia', NULL, NULL, NULL, '/images/nes/4270/cover.png', 'https://howlongtobeat.com/gameimages/FushiginoUminoNadia_title.png', NULL, NULL),
(4271, 'Fuzzical Fighter', NULL, NULL, NULL, '/images/nes/4271/cover.jpg', 'https://howlongtobeat.com/gameimages/48174_Fuzzical_Fighter.jpg', 4, NULL),
(4272, 'Galaxian', NULL, NULL, 'The Galaxian Fleet has invaded and it\'s up to you to stop them. There\'s two-way action in this game; as you fire at them, they\'re firing back at you! All that is required of you is quick reflexes and an accurate aim. Can you destroy the Galaxian Fleet before they destroy you?', '/images/nes/4272/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/1/32351_front.jpg', 1, NULL),
(4273, 'Gambler Jiko Chuushinha', NULL, NULL, 'Gambler Jiko Chuushinha is a Miscellaneous game, developed by Game Arts and published by Asmik Ace Entertainment, Inc,  which was released in Japan in 1988.', '/images/nes/4273/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/8/41608_front.jpg', NULL, NULL),
