(4297, 'Goonies', NULL, NULL, 'Packin\' a heap of ugliness, mean old Ma Fratelli\'s come back for revenge. And this time she plans to do away with "The Goonies" for good! One by one this crazed mama and her two nutty sons have kidnapped your fellow Goonies, hauling them off to a spooky shack and hiding them in a maze of adventure filled with danger, including the slippery ice cavern, secret underground sea, and eerie attic. Now you\'re the only Goonie left. The fate of your friends is in your hands. But saving the day won\'t be easy. Armed with your trusty yo-yo and whatever weapons you can find, you\'ll be forced to fight off fearsome foes, and solve menacing mysteries. You\'ll have to be willing to risk it all, being brave and bold, to rescue your buddies, "THE GOONIES!"', '/images/nes/4297/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/2/21972_front.jpg', NULL, NULL),
