(4301, 'Gradius II', NULL, NULL, 'This shooter is the sequel to the seminal masterpiece, GRADIUS. Two years after its last epic battle, the GRADIUS army recommissions the VIC VIPER superdimensional warplane to combat the invasion of a new nemesis known as GOFER. Piloting the latest model of the VIC VIPER, players can select between multiple WEAPON MODULES and SHIELDS to tackle the varying stages and enemy attack patterns they come up against. With a total of nine stages, this perfect port of the original boasts one of the longest adventures in the series and features more of its trademark fast-paced background music to accompany the intense action!', '/images/nes/4301/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/63/Gradius_III_Japanese_Arcade_flyer.jpg', 1, 1.5),
