(4345, 'Hydlide 3', NULL, NULL, 'The Fairyland Council feared that the same evil in the legends was back again. A wise old oracle was among them. He predicted the second coming of evil. He also spoke of a young man who could save Fairyland from its gravest crisis. A young man was chosen to find the reason and source of the evil. As the people gathered to bid him good luck, they couldn\'t help but wonder if they had chosen the right one. What fate awaits our hero and Fairyland? Only you can answer those questions.', '/images/nes/4345/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ac/Hydlide_Cover.jpg', NULL, NULL),
