(4498, 'Murder Club', NULL, NULL, 'The mystery begins with a stream of blood runninng down Bil Robbins\' back. Now its up to you, J.B., to track down the culprit whose hand twisted the knife. Enemies? The victim had so many, they must have been standing in line to bump him off. But the murderer will never get away because the amazing technology of TurboGrafx-CD will make all suspects answer to you as you grill them and dig up clues. Unravel a dark world of chilling secrets, hidden mysteries, sultry dames and deceit to crack the case. Yeah, J.B., everyone has something to hide. Don\'t let them hide it from you!', '/images/nes/4498/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/7/41727_front.jpg', NULL, NULL),
