(4514, 'New Ghostbusters 2', NULL, NULL, 'The world-wide hit movie is now available on the Nintendo Entertainment System! Capture the ghost that haunted New York City in this comedy-action-adventure. Six stages in all, including a Courtroom, the Subway, the Art Museum and more!', '/images/nes/4514/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8e/New_Ghostbusters_2_Coverart.png', 1, NULL),
