(4565, 'Pooyan', NULL, NULL, 'One day, in the middle of a forest, a group of fierce Wolves attacked the House where a Mother Pig (Mama) and her little Piglets (Pooyans) were living together peacefully. To protect her Pooyans, Mama fought back using arrows and bait, but despite all of her efforts, some of the Pooyans were kidnapped. Full of hate for the Wolves, Mama bravely seeks out the Wolves\' Lair to rescue her Pooyans. Will she succeed in overcoming the Wolves and bringing her Pooyans back home?', '/images/nes/4565/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/52/Pooyan_Cover.jpg', NULL, NULL),
