(4731, 'Wagyan Land 3', NULL, NULL, 'Wagyan Land 3 is an Action game, developed and published by Namco,  which was released in Japan in 1992.', '/images/nes/4731/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/61/WagyanLand_frontcover.png', NULL, NULL),
(4732, 'Wai Wai World', NULL, NULL, 'Wai Wai World is an Action game, developed and published by Konami,  which was released in Japan in 1988.', '/images/nes/4732/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/6/40866_front.jpg', NULL, NULL),
(4733, 'Wai Wai World 2: SOS!! Parsley Jō', NULL, NULL, 'Wai Wai World 2: SOS!! Paseri Jou is an Action game, developed and published by Konami,  which was released in Japan in 1991.', '/images/nes/4733/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b3/Waiwaiworld2cover.jpg', NULL, NULL),
(4734, 'Warpman', NULL, NULL, 'Warpman is an Action game, developed and published by Namco,  which was released in Japan in 1985.', '/images/nes/4734/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/9/40559_front.jpg', NULL, NULL),
(4735, 'Wily & Right no RockBoard: That\'s Paradise', NULL, NULL, 'Wily and Light no Rock Board: That\'s Paradise is a Miscellaneous game, developed and published by Capcom,  which was released in Japan in 1993.', '/images/nes/4735/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e2/Rock_Board_Cover.png', NULL, NULL),
