(4737, 'Winners Cup', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4738, 'Wit\'s', NULL, NULL, 'Wit\'s is a Puzzle game, published by Athena,  which was released in Japan in 1990.', '/images/nes/4738/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/5/316765_front.jpg', NULL, NULL),
