(4740, 'Woody Poko', NULL, NULL, 'Woody Poco is an Action game, developed and published by DB Soft,  which was released in Japan in 1987.', '/images/nes/4740/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/5/311085_front.jpg', NULL, NULL),
(4741, 'World Boxing', NULL, NULL, 'World Boxing is a Sports game, developed by Natsume and published by TSS,  which was released in Japan in 1990.', '/images/nes/4741/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/4/311404_front.jpg', NULL, NULL),
(4742, 'Yie Ar Kung Fu', NULL, NULL, 'Oolong has spent his entire life training for the Martial Arts Championship. The Championship has attracted masters of different disciplines, all fighting to be named champion. In Yie Ar Kung-Fu, Oolong must use his own fighting moves and face masters of the throwing shuriken, nunchaku, bo, chain, and more to fulfill his destiny. Will you fight like a tiger or run away in shame?', '/images/nes/4742/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Yie_Ar_Kung-Fu_flyer.png', NULL, NULL),
(4743, 'Yokai Dochuki', NULL, NULL, NULL, '/images/nes/4743/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/57/Yokai_douchuuki_arcadeflyer.png', NULL, NULL),
(4744, 'Youkai Club', NULL, NULL, 'Youkai Club is an Action game, developed by TOSE and published by Jaleco Entertainment,  which was released in Japan in 1987.', '/images/nes/4744/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/8/311068_front.jpg', NULL, NULL),
(4745, 'Ys', NULL, NULL, 'As Adol, hero of Ys Book I & II, your most fearsome new adventure is about to begin! The curse of the monster Demanicus terrorizes your friend Dogi\'s homeland. Chaos rules as blood-thirsty creatures threaten innocent lives. Only you have the courage and strength to defeat them! Gather your fiercest swords and deadly amulet to battle these horrific creatures with a thrilling new action view. Survive the fiery depths of Alcaino. Conquer the terrifying Nekevil. But stay alert, brave Adol! The fury of Demanicus awaits your final epic struggle!', '/images/nes/4745/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a6/Ys_logo.png', NULL, NULL),
(4746, 'Ys II', NULL, NULL, NULL, '/images/nes/4746/cover.gif', 'https://howlongtobeat.com/gameimages/YsIIbox.gif', 8.5, 11.5),
(4747, 'Ys III: Wanderers from Ys', NULL, NULL, NULL, '/images/nes/4747/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/YsIII-tg16.jpg', 5.5, 11),
(4748, 'Yume Penguin Monogatari', NULL, NULL, 'Yume Penguin Monogatari is an Action game, developed and published by Konami,  which was released in Japan in 1991.', '/images/nes/4748/cover.jpg', 'https://howlongtobeat.com/gameimages/YumePenguinMonogatariBoxShotNES.jpg', 1, 1),
(4749, 'Zippy Race', NULL, NULL, 'Zippy Race is a Racing game, developed and published by Irem,  which was released in Japan in 1985.', '/images/nes/4749/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/3/40563_front.jpg', NULL, NULL),
(4750, 'Zoids: Chuuou Tairiku no Tatakai', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4751, 'Zoids 2: Zenebasu no Gyakushuu', NULL, NULL, 'Zoids 2: Zenebasu no Gyakushuu is a Role-Playing game, developed by Micronics and published by Toshiba EMI,  which was released in Japan in 1989.', '/images/nes/4751/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/6/2/41662_front.jpg', NULL, NULL),
(4752, 'Zoids: Mokushiroku', NULL, NULL, 'Zoids: Mokushiroku is a Strategy game, published by Tomy Corporation,  which was released in Japan in 1990.', '/images/nes/4752/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/9/42159_front.jpg', NULL, NULL),
(4753, 'Zombie Hunter', NULL, NULL, 'Exploration and Adventure in the Land of the Living Dead', '/images/nes/4753/cover.jpg', '', NULL, NULL),
(4754, 'Zunō Senkan Galg', NULL, NULL, 'Zunou Senkan Galg is an Action game, developed by Team Bioteckers and published by DB Soft,  which was released in Japan in 1985.', '/images/nes/4754/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/9/310949_front.jpg', NULL, NULL),
(4770, 'Ace of Aces', NULL, NULL, 'Ace of Aces captures the spirit and puts you in the cockpit of the Mosquito, maverick RAF fighter bomber of World War II. Down the Nazi bombers, sink the U-boats, outrun the V-1 rockets and stop the enemy trains. Choose your weapons and fuel wisely - once you\'re out on mission, there\'s no going back. To become Ace of Aces, you must complete all missions successfully!', '/images/sms/4770/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/2/312722_front.jpg', NULL, NULL),
(4771, 'Action Fighter', NULL, NULL, 'Get ready to play a starring role in the incredible world of international espionage. You receive five different assignments. All action-packed. And all extremely dangerous. Your secret weapon? A vehicle that transforms into a dozen different deadly devices. Your high-speed motorcycle can turn into a customized car and then into a sound barrier-breaking jet plane. All in a matter of seconds. The real test? To know when to use which weapon. Because the wrong machine, at the wrong time, can prove fatal.', '/images/sms/4771/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/ff/Action_Fighter.jpg', NULL, NULL),
(4772, 'The Addams Family (SMS)', NULL, NULL, 'Morticia has been kidnapped! Uncle Fester has lost his memory and fallen under the spell of Abigail Craven - only Gomez can save the day, finally confronting the evil Judge! Dare you freak out in the kooky spooky climax?\n', '/images/sms/4772/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/3/43683_front.jpg', NULL, NULL),
(4773, 'Aerial Assault', NULL, NULL, 'It\'s the 21st century and N.A.C., a feared terrorist group of the galaxy, threatens to destroy Earth. They\'ve developed the super weapon "EL" that will blast away Earth\'s ozone layer. And they\'ve threatened to use it! As the world\'s top jet fighter pilot, you\'re in command of the of the ultimate in combat aircraft - the "Freedom Fighter." Armed with the latest in new high-tech weaponry, you and your jet are Earth\'s only chance against the merciless N.A.C. Good luck!', '/images/sms/4773/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Smsaacv.jpg', NULL, NULL),
(4774, 'After Burner', NULL, NULL, 'You\'re a Navy Air Captain. At your control is the most advanced fighter jet ever to set the sky on fire! You supply the skill, reflexes, and guts. Your F-14 Thunder Cat gives you Mach 2+ speeds, unlimited firepower and a state-of-the-art battle computer which targets your enemies for destruction. Fire guided missiles, then blast away with your Vulcan cannon. Roll your F-14 left and right! Enemy missiles slide under your wings. Your afterburners roar as you dive for the wave tops! In this sky battle you\'re outnumbered. But that\'s O.K. When it comes to flying the unfriendly skies, you\'re the one they call "The Ace."', '/images/sms/4774/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/13/AfterBurner_JParcadeflyer.png', NULL, NULL),
(4775, 'Air Rescue', NULL, NULL, 'Maneuver your Rescue Chopper through tight underground passages, blazing wreckage and treacherous enemy attacks to save the leaders of the world from the hands of terrorists!', '/images/sms/4775/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c8/Sega_air_rescue.jpg', NULL, NULL),
(4776, 'Disney\'s Aladdin (SMS/GG)', 'Disney\'s Aladdin', NULL, 'Disney\'s Aladdin is a 1994 video game developed by SIMS Co., Ltd. for the Sega Game Gear and Master System. Based on the film of the same name, Disney\'s Aladdin is a side-scrolling platform game in which the player character is Aladdin.\n\nThe Genesis game differs markedly from the 8-bit game on the Game Gear and Master System.', '/images/sms/4776/cover.png', 'https://play-roms.com/sites/default/files/packshots/sega-master-system/aladdin-europe.png', NULL, NULL),
(4777, 'Alex Kidd BMX Trial', NULL, NULL, 'BMX Trial: Alex Kidd is a Sports game, developed and published by Sega, which was released in Japan in 1987.\n', '/images/sms/4777/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/67/Alex_Kidd_BMX_Trial_box_art.jpg', NULL, NULL),
(4778, 'Alex Kidd: High-Tech World', NULL, NULL, 'Being the Crown Prince of Planet Aries is never easy. On top of being a galactic hero, you have to deal with parents, teachers and palace retainers! But you\'re a Kidd at heart, and you just have to go to the new High-Tech World video arcade to play the newest Sega games. The problem is, the map to the arcade has been torn up into 8 pieces and hidden in the castle. As you look for the pieces you\'ll discover just how weird life in a castle can be! If you find them, you\'ll have to fight your way through a forest filled with blue Ninjas. Survive this ordeal and you\'ll have to find a travel pass in the village to make it over the border!', '/images/sms/4778/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/fc/Alex_Kidd_in_High-Tech_World_Coverart.png', NULL, NULL),
(4779, 'Alex Kidd in Miracle World', NULL, NULL, 'Your name is Alex Kidd. You have courage. A karate chop that shatters rocks. And a big job to do. You learn that the mysterious city Radactian is in great danger. All your skills and talents are desperately needed to help. But there\'s a catch: how do you get there? Your only clues are a puzzling map and a medallion made of Sunstone. Will that be enough to solve the riddle of the pathway? You face the obstacles. Solve the mysteries. learn the secrets as you go along. but there\'s high adventure around every corner. it takes a Kidd like you handle a challenge like this.', '/images/sms/4779/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ae/AlexKiddInMiracleWorldBox.jpg', NULL, NULL),
(4780, 'Alex Kidd in Shinobi World', NULL, NULL, 'After ten thousand years, the once-banished Dark Ninja returns to make another attempt to take over the Miracle World. Someone\'s definitely got to stop him! Guess who dares to meet the challenge? You! You\'re Alex Kidd, the prince who knows no fear. A lovely girl has been kidnapped and her life is at risk. And she\'s your girlfriend from the planet Shinobi! By holding her hostage, the Dark Ninja plans to realize his fiendish scheme. She must be saved before it\'s too late!', '/images/sms/4780/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/dc/AlexKiddInShinobiWorld.jpg', NULL, NULL),
(4781, 'Alex Kidd: The Lost Stars', NULL, NULL, 'The stars have been taken from the skies of the planet Aries! Only one of royal blood can get them back... and that\'s Alex Kidd! Join him in a journey beyond space, time and imagination to return the stars of Aries to the constellation.', '/images/sms/4781/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/98/Alexkidd2.jpg', NULL, NULL),
(4782, 'ALF', NULL, NULL, 'The world\'s favorite bad boy alien is back... on your Sega System! Its Alf! And he\'s got a mission... get to Mars to visit his friends Rhonda and Skip. The problem is, his space ship is broken. And the Alfer is not about to grow wings. So it has to be fixed... and that\'s where you come in! Guide Alf as he searches for the things needed to fix his ship. Pearls snatched from the jaws of giant clams, space scooter fuel in the darkest caves, spacesuits, costumes and more! Succeed, and you\'ll send the Alfer on his way to a happy reunion. Mess up, and the Alfer stays stuck on Earth. Do you think you can do it? "NO PROBLEM!"', '/images/sms/4782/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/3/50223_front.jpg', NULL, NULL),
(4783, 'Alien3 (SMS)', NULL, NULL, 'The Xenomorph are fast, spit acid, and are right behind YOU! Can\'t see very far ahead in these air ducts. Hard to breathe. Face-huggers can be anywhere. Must find the Mother Alien. The closer you get, the more Aliens you find... better not have them find you first! Just keep telling yourself, "this isn\'t really happening... it\'s only a game!"\n', '/images/sms/4783/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/6/22476_front.jpg', NULL, NULL),
(4784, 'Alien Storm', NULL, NULL, 'Shape-changing alien scum take over your city. Fry the slimy horrors and smash their bid for global conquest. Blast into action with ray guns, flame throwers, power-whips, and more! But watch your step! Harmless objects might transform into vicious aliens. A trash can erupts with spiked tentacles that slash at the helpless! Only quick reflexes and precision weaponry can keep you off the aliens\' menu.', '/images/sms/4784/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Alien_Storm_Cover.jpg', NULL, NULL),
(4785, 'Alien Syndrome', NULL, NULL, 'A mysterious alien space fleet has invaded human occupied space.  Called the Alien Syndrome™, they are the deadliest creatures mankind has ever encountered.  The Alien Syndrome shoots first...and asks no questions!  A battalion of your friends attacks the alien fleet.  But they are captured and held hostage.  Earth Command sends one soldier to get them back...You!  You\'re RICKY, Earth Command Trooper.  When it comes to deep space combat, you are the best.  Armed only with a combat rifle, you must infiltrate each alien ship rescue the hostages and escape...before a time bomb vaporizes the ship into cosmic debris.  The odds...and the clock...are against you.  The aliens can appear anywhere...at any time.  So shoot fast and straight.  The hostages are depending on you!', '/images/sms/4785/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/ce/Alien_Syndrome_Cover.png', NULL, NULL),
(4786, 'Altered Beast', NULL, NULL, 'You were a Roman Centurion.  You died bravely in battle.  Now, a hundred years later, you have been called back from the grave by Zeus, God of Thunder.  Even as he grants you new life he gives you a mission.  You must rescue his daughter Athena from the evil clutches of Neff; Lord of the Underworld.  From the surface to the very heart of the Underworld you must journey, fighting Neff\'s undead army every step of the way!  Zombies, demons, gargoyles, three-headed Wolves.  But in this life you have been given an edge...the power to transform into magical beasts of awesome power!  From a man to a superman...to a werewolf, were-dragon, were-tiger and the ultimate...a Golden Wolf!  Each form has supernatural abilities.  You\'ll need them all...for Neff is a fearsome enemy.  Fail, and Athena\'s fate will be unspeakable.  Win...and you may take a place in the Pantheon of Immortality!  Remember...Never say die!', '/images/sms/4786/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Altered_Beast_cover.jpg', NULL, NULL),
(4787, 'Andre Agassi Tennis', NULL, NULL, 'Andre Agassi\'s explosive forehand is yours! Be Agassi or play against Agassi. For the first-time ever, win big cash with the \'skins\' match where stakes double with every return. With 4 courts, 8 exciting players each with different playing styles and an umpire who calls every shot, Andre Agassi Tenni cannot be beaten.', '/images/snes/4787/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/bf/Andre_Agassi_Tennis_cover_art.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(4788, 'Arcade Smash Hits', NULL, NULL, 'DEFEND cities from never-ending nuclear attack in Missile Command!  BASH bricks with a bat and ball in Breakout!  Eradicate a garden full of mutant insects in Centipede!  For the first time ever, THREE classic arcade blasts from the past are brought together in ONE cartridge for UNLIMITED playability!', '/images/sms/4788/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8e/Arcade_Smash_Hits_Cover.jpg', NULL, NULL),
(4789, 'Argos no Juujiken', NULL, NULL, 'You and Rygar, the legendary warrior of Argool, must defeat the evil king and his army of dangerous beasts. With powers and weapons from the Indora war gods, you go into battle with Rygar. It\'s up to you! The enemies are strong, the terrain treacherous, and the challenges difficult. The sun is setting and Rygar is depending on you. Rygar\'s exploits were once confined to arcades, but now he is battling the forces of evil everywhere. Join forces with Rygar!', '/images/sms/4789/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/9/306559_front.jpg', NULL, NULL),
(4790, 'Assault City', NULL, NULL, 'Robots Go Berserk! Dateline: Assault City, 2092. It\'s a robot mutiny! Central Computer Control is in chaos. Armed KillerBots are running amok, blasting loyal Bots into metal junk and piles of whining servomotors!', '/images/sms/4790/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cf/AssaultCityCover.jpg', NULL, NULL),
(4791, 'Asterix (SMS)', NULL, NULL, 'Getafix, the Druid whose magic potion has kept his village from falling into Caesar\'s hands, has been kidnapped! Join Asterix and Obelix as they try to rescue the druid and save the village!\n', '/images/sms/4791/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/4/50224_front.jpg', NULL, NULL),
(4792, 'Asterix and the Great Rescue', NULL, NULL, 'Getafix the Druid and Dogmatix have been captured by the evil Roman forces. Use your magic potions to help Asterix and Obelix fight their way through five levels to Rome itself and free their buddies from Caesar\'s clutches!', '/images/sms/4792/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/7/78/Asterix_And_The_Great_Rescue_-EUR-.PNG', NULL, NULL),
(4793, 'Asterix and the Secret Mission', NULL, NULL, 'Getafix the Druid is out of magic potion! If Caesar finds out, it\'s invasion for sure. Asterix and Obelix set out to find the necessary herbs. A mission through all sorts of Roman-infested terrain - seas and rivers, forests and deserts, temples and ruins.', '/images/sms/4793/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/2/6/43326_front.jpg', NULL, NULL),
(4794, 'Astro Warrior', NULL, NULL, 'Astro Warrior pits you against the enemy\'s fleet of superpowered spaceships. And ultimately, the invincible Master Ship. In this treacherous black universe you can only count on yourself. To shoot fast. To shoot straight. If you do - you get more power. More weapons. To beat the villains. To beat the odds. If you don\'t - the odds beat you!', '/images/sms/4794/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/97/Astro_Warrior.png', NULL, NULL),
(4796, 'Ayrton Senna\'s Super Monaco GP II', NULL, NULL, 'Experience the heart-stopping action of Formula 1 racing on the most challenging circuits in the world! You are in control of a precision machine, ready to test your skill and abilities to the limit to win the ultimate prize: The championship cup!', '/images/sms/4796/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d3/Ayrton_Senna%27s_Super_Monaco_GP_II_Coverart.png', NULL, NULL),
(4797, 'Aztec Adventure', NULL, NULL, 'Welcome to the land of the ancient Aztecs, where money talks and enemies can be bought. You\'re El Nino, wanderer, traveler, and adventurer at heart. You\'re about to embark on a mysteriously dangerous adventure that will lead you through forests, underwater passages and phantom zones to name a few. Your objective: reach the Aztec Paradise, where the tokens of wealth and happiness await. But the land is rich with thieves and traitors, so be prepared to spend a small fortune in search of a greater one. And remember, in a kingdom of Gods, no one is smiled upon.', '/images/sms/4797/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Aztecadventurescover.jpg', NULL, NULL),
(4798, 'Back to the Future II (SMS)', NULL, NULL, 'It\'s time to go back...Great Scott!  Returning from the year 2015, Doc Emmet Brown has some bad news for Marty McFly...His future\'s in danger unless he can put things right.  Guide Marty through five levels in this exciting interpretation of the smash-hit film.  Can you assure a safe future for Marty?  Or will Biff ensure there\'s no future at all?', '/images/sms/4798/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d2/Back_to_the_Future.jpg', NULL, NULL),
(4799, 'Back to the Future III', NULL, NULL, '1885 was never like this!  The time-traveling adventures of Marty McFly and Doc Brown step up pace for this, the final and most exciting in the Back To The Future trilogy!  Stranded in Hill valley back in the Wild West, you play both Marty AND Doc in a frantic race against time - not easy with Buford "Mad Dog" Tannen and his gang of gunslingers standing in your way!', '/images/sms/4799/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d2/Back_to_the_Future.jpg', NULL, NULL),
(4800, 'Bank Panic', NULL, NULL, 'Set against the background of America\'s pioneer era, you as the HERO, are a quick draw artist - whose job it is to protect the customers who are depositing money at the bank.', '/images/sms/4800/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b2/Bank_Panic_Cover.jpg', NULL, NULL),
(4801, 'Basketball Nightmare', NULL, NULL, 'You are the captain of the Hometown High School\'s basketball team. You\'ve won the tournaments and are trying to win the All-American High School Championship! But then one night you had a very strange dream...', '/images/sms/4801/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/8/8e/BasketballNightmareTitleScreenSMS.PNG', NULL, NULL),
(4802, 'Batman Returns (SMS)', NULL, NULL, 'Batman really has his work cut out for him this time! There\'s triple trouble in Gotham City with the Red Triangle Circus Gang, Catwoman and the diabolical Penguin in league to take over the city. Get ready for the fight of your life!', '/images/sms/4802/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/BatmanReturnsCoverart.jpg', NULL, NULL),
(4803, 'Battle Out Run', NULL, NULL, 'Battle Out Run was a 1989 videogame released by Sega on the Master System. Despite being part of the Out Run series, this game plays little like its namesake and more like Chase H.Q., where the objective is to ram the cars of specified criminals. A notable feature is to enhance the car\'s attributes by buying upgrades that are inside of a truck that passes at certain moments and must be entered from the rear.', '/images/sms/4803/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b3/Battle_Out_Run.jpg', NULL, NULL),
(4804, 'Black Belt', NULL, NULL, 'The most life-like karate game ever to meet the video screen. It\'s a post nuclear war setting. And the bad guys seem to be getting the best of things. You use your Black Belt standing to try to restore order to a chaotic world. In each round you must battle an entire enemy corps as well as its leader. And in each round the backgrounds - as well as your opponent\'s fighting styles - continue to change. Use everything the masters have taught you to stop the violence and restore peace.', '/images/sms/4804/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/83/Blackbeltgame.jpg', NULL, NULL),
(4805, 'Blade Eagle 3-D', NULL, NULL, 'It began when the evil Arvians, aided by robot drones programmed to destroy, struck without warning.  In days, the three worlds of your solar system were under siege.  One ship escaped capture...yours.  Now only you have the power to return freedom to the solar system.  That\'s because you have BLADE Eagle, the most powerful one-man fighter in the fleet.  You\'ll need every trick in the book to maneuver through 9 levels of the most true-to-life 3-D battleground ever created...and hordes of virtually indestructible mechanical monstrosities.  The odds are a million to one against success.  Anyone taking bets?', '/images/sms/4805/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f8/Blade_Eagle_3-D.png', NULL, NULL),
(4806, 'Bomber Raid', NULL, NULL, 'Who has mach-6 speed, helabad weapons, and a love for wastin\' dweebs in tanks?  You do.  It\'s the gnarliest fighter-bomber game ever.  So hot it feels like a coin-op.  Why?  Two-mega power means we cram a lot more game in the cartridge.  So you get more action for your money.', '/images/sms/4806/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/45/Bomber_raid_2m.jpg', NULL, NULL),
(4807, 'Bonanza Bros.', NULL, NULL, 'Robo and Mobo, the Bonanza Bros., are the clumsiest thieves around. They\'re in deep trouble now, and they need your help to avoid becoming jailbirds!', '/images/sms/4807/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/Bonanza_Bros_flyer.jpg', NULL, NULL),
(4808, 'Bonkers Wax Up!', NULL, NULL, 'Toon terror rules! Creepy Madame Who-Said has lured Bonkers to her ancient Wax Museum. She\'s been busy coating famous Toons with wax to make statues for her displays. Now she needs Bonkers to top off her gruesome collection!', '/images/sms/4808/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/2/31062_front.jpg', NULL, NULL),
(4809, 'Buggy Run', NULL, NULL, 'Your tires slide on the gravel, costing you precious seconds. A competitor slips by on the inside of the track. You kick in the turbocharger and regain the lead -- but can you keep it? Over 25 different tracks! Land mines and other hazards make the race twice as exciting! This is the most fun you can have on four wheels!', '/images/sms/4809/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/9/306579_front.jpg', NULL, NULL),
(4810, 'California Games 2', NULL, NULL, 'Push your courage and cool to their limits in four innovative action sports from California.  Showcase your skills speeding around the skateboard track, body boarding on foaming breakers, hang gliding over the ocean and snowboarding down perilous slopes.', '/images/snes/4810/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7e/California_Games_Coverart.png', NULL, NULL),
(4811, 'Casino Games', NULL, NULL, 'Welcome to Sega Royale, where fortunes can be made or lost with the turn of a card.  You have $500 to play the games of your choice.  Which will they be?  Challenge high stakes gamblers in a game of poker.  Beat the dealer in a fast-moving game of Black Jack.  Enter the world of the rich and famous in the famous game of Baccarat.  Run the gambit with Lady Luck on the Sega slot machines, or just relax with a game of pinball!  Bet as little as $1, up to $1,000, in your living room.  Casino Games even has a Password save so you can keep your winnings for your next gambling trip!  If you lose all your cash, remember; at Sega Royale experience is the greatest reward.  There\'s always tomorrow...and another $500 to play!', '/images/sms/4811/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/3/50243_front.jpg', NULL, NULL),
(4812, 'Castle of Illusion Starring Mickey Mouse', NULL, NULL, 'The evil Witch Mizrabel is jealous and has kidnapped Minnie. It is up to you to help Mickey rescue her. To unlock Mizrabel\'s wicked grip, Mickey must run, climb and leap his way through all the Rooms of Illusion, and by defeating the many protectors of each Master you can fight for the ownership of the gems. Your goal: gather seven magical gems and win Minnie\'s freedom! Think you can handle the challenge? Mickey could sure use your help!', '/images/sms/4812/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f4/Castle_of_illusion_Mickey_mouse.jpg', NULL, NULL),
(4813, 'Champions of Europe', NULL, NULL, 'Your chance to be a champion has arrived! Compete against Europe\'s finest teams in the football game for 1992. Fast-paced action, multiple options, "instinctive" controls and superb animation make Champions of Europe - The official game of UEFA \'92 rock solid soccer!', '/images/sms/4813/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/da/Championsofeuropefrontboxart_160w.jpg', NULL, NULL),
(4814, 'Championship Hockey', NULL, NULL, 'Complete in a super realistic ice hockey game with all the frantic action of Championship Hockey - skillful skating, thundering body checking and rifling slap shots. You\'ll have to skate well to avoid crunching body checks from defenders and out maneuver goalkeepers in your quest for the Cup!\n', '/images/sms/4814/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d5/ChampionshipHockeyCoverArtSMS.jpg', NULL, NULL),
(4815, 'Chase H.Q.', NULL, NULL, 'The fastest, most thrilling, 3D driving game yet! Take the wheel of your turbo-charged Porsche as you and your partner go in pursuit of dangerous criminals all driving an evil array of souped-up roadsters. TURBO BOOST! Need to catch up in a hurry? Well, just one press of your Turbo Button will leave your eyes in the back of your head! Barrelling through the city streets, along the roughest of dirt tracks and through busy tunnels - if you can hold the line! The low-life can run, but they can\'t hide...', '/images/sms/4815/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0d/Chasehq_flyer.png', NULL, NULL),
(4816, 'Cheese Cat-Astrophe Starring Speedy Gonzales', NULL, NULL, 'Sylvester\'s alter ego, the dastardly Dr. Cheesefinger, has "kidnapped" the cheese supply and Speedy Gonzales\' girlfriend, Carmel. Can this "speedy-mouse" outwit the callous cat and rescue the village cheese supply?', '/images/sms/4816/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e2/Cheese_Cat-Astrophe_Starring_Speedy_Gonzales_Box_Art.png', NULL, NULL),
(4817, 'Chuck Rock', NULL, NULL, 'Unga Bunga! Chuck Rock\'s wife, Ophelia, has been captured by that no-good Gary Gritter. Can Chuck belly-butt his way through five increasingly challenging stages, each one packed with dozens of deranged dinosaurs and surprises galore? Or is his love destined to end up on the rocks?', '/images/snes/4817/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8a/Chuck_Rock_cover_MD.jpg', NULL, NULL),
(4818, 'Chuck Rock II: Son of Chuck', NULL, NULL, 'Eighteen months after his victory over Gary Gritter, Chuck Rock is now the owner of the hugely successful "Chuck Motors" and has become a father. Kidnapped by his evil enemy Brick Jagger, Chuck Rock is likely to become Chuck Dust unless somebody rescues him... A sudden crash as Chuck Junior  bursts from his playpen. "Goo Goo Gaa Gaa, I\'ll be back."', '/images/sms/4818/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8b/Chuck_Rock_II_Son_of_Chuck_cover.jpg', NULL, NULL),
(4819, 'Cloud Master', NULL, NULL, 'Enter the wild, fun-filled world of Mike Chen.  He\'s out to learn the secrets of the five lands so he can become a powerful wizard of the skies!  Already he has tamed a cloud to carry him around.  He has learned the art of the shooting Ki force from his fingertips!  but standing against him are more wacky, zany creatures than you can shake your chopsticks at!  Bird men.  Flying cat heads.  Pigs with guns.  And flying bowls of soup!  Sounds funny...but remember that each can zap you with a touch!  You do have a couple of tricks up your sleeve.  Collect power-up pots to fly faster and make your Ki force even more powerful!  Defeat the mid-round bosses and you will earn the use of true magic...fireballs, guardian flames and bouncing bombs.  Defeat the five world guardians and you\'ll become a Cloud Master!  Fail, and you\'ll be locked in combat forever.  Are you really going to let a flying dumpling get the best of you?', '/images/sms/4819/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/0/50250_front.jpg', NULL, NULL),
(4820, 'Columns', NULL, NULL, 'Drift back to ancient Phoenicia and challenge yourself with Columns, a game favored by ancient merchants.  Forget the passage of time and tickle your mind with this brilliant game of strategy and skill.', '/images/sms/4820/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/9/47219_front.jpg', NULL, NULL),
(4821, 'Comical Machine Gun Joe', NULL, NULL, 'Comical MachineGun Joe is an Action game, developed and published by Sega,  which was released in Japan in 1986.', '/images/sms/4821/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/1/306561_front.jpg', NULL, NULL),
(4822, 'Cool Spot', NULL, NULL, 'NO WAY! Your Cool SPOT chums are locked away! YES WAY! You, as Cool SPOT are here to save the day! Quit gawping over the dreamy scenery, the awesome animation and most savory sound around. Play! Man, this is the hairiest...', '/images/snes/4822/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ec/Cool_spot_box_art.jpg', NULL, NULL),
(4823, 'Cosmic Spacehead', NULL, NULL, 'Absorb your senses in this giant Extra Terrestrial Odyssey of Cosmic discovery! Radical Adventure, Awesome Arcade and superb Sub-Games combine in Cosmic Spacehead\'s 50\'s Sci-fi quest to prove the Earth\'s existence!', '/images/sms/4823/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/9/30989_front.jpg', NULL, NULL),
(4824, 'Cyber Police ESWAT', NULL, NULL, 'E-SWAT IS: the toughest fighting force alive! E-SWAT MEANS: Enhanced Special Weapons and Tactics! You\'re starting straight into the evil E.Y.E., a power-mad horde of vicious terrorists. But you are the ultimate crimebuster. Decimate their front lines with your lead-belching Gatling gun! Incinerate their mobs with your super-charged arsenal of weapons! Start as an E-SWAT rookie and blast your way up to become an awesome supercop...More machine than man! Metal attack! Annihilate killer hovercraft maniac machines and flame-throwing robots. Grapple with bionic monsters to face the final showdown! Stay glued to your weapons through 5 missions of grueling combat! You have the ultra-tech gear and the guts to survive! The E-SWAT force is waiting. Are you ready to "Hit The Streets"?\n', '/images/sms/4824/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/6b/ESWATCyberPolice_arcadeflyer.png', NULL, NULL),
(4827, 'The Cyber Shinobi', NULL, NULL, 'Cyber Zed is back!  And they\'re stealing plutonium from every atomic power plant in the world!  Every nation sent out its best forces to try to put and end to this disastrous situation, but none of them succeeded.  There was one brave soul who dared to meet the challenge -- Joe Musashi.  Be Joe Musashi and save our beautiful planet from destruction!', '/images/sms/4827/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9d/The_Cyber_Shinobi_Coverart.png', NULL, NULL),
(4828, 'Cyborg Hunter', NULL, NULL, 'The Year: 2242.  You\'re the toughest bounty hunter in the galaxy.  You\'ve amassed a fortune by defeating the most vicious creatures known to man.  And now, deep inside the enemy Cyborg Fortress, you can almost taste your next paycheck.  But there\'s a little work to be done before you cash in.  Like blasting swarms of deadly Cyborgs with your powerful psycho gun.  And a battle-to-the-death showdown with Vipron, the vile Cyborg leader.  Prepare yourself for one explosive payday!', '/images/sms/4828/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Cyborg_hunter_cover.jpg', NULL, NULL),
(4829, 'Daffy Duck in Hollywood', NULL, NULL, 'Presenting the world famous Daffy Duck P.I. Armed with your lethal bubble gun, search the Hollywood film sets for Yosemite Sam\'s Golden Cartoon World Movie Awards and the despicable Mad Professor Duck Brain.', '/images/sms/4829/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/0/0f/Daffy_Duck_in_Hollywood.PNG', NULL, NULL),
(4830, 'Danan: The Jungle Fighter', NULL, NULL, 'Danan, the infant who was rescued from the remains of a wrecked airplane by Jimba, a young Amazon tribesman, came home from hunting one day to find his guardian mortally wounded!  What happened to Jimba?  Who would do such a thing?  Help Danan to find the answers -- stalk the hot, wet jungles of the Amazon, putting the pieces together as you go, and avenge Jimba\'s death!', '/images/sms/4830/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e9/Danan_The_Jungle_Fighter_Cover_art.jpg', NULL, NULL),
(4831, 'Dead Angle', NULL, NULL, 'You\'re George Phenix, one very tough private eye.  You\'re so tough that you were the one who was able to put mob kingpin Robert King behind bars.  He vowed revenge, but at the time you laughed it off.  However, while you were in Italy with your girlfriend, Jane, King got his revenge.  His thugs got their hands on Jane and disappeared.  Now you stalk the streets of the city of Napoli, your blood boiling, your gun drawn!  "Dead Angle" takes you back to the 1930\'s, when the mob did almost anything they wanted to.  Now they\'ve crossed the line, and you can put an end to the reign of Robert King.  Put your enemies away with your revolver, or if you\'re lucky, pick up a Tommy gun and let \'er rip!  Save Jane from the Big Sleep!', '/images/sms/4831/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8e/DeadAngleArcade.jpg', NULL, NULL),
(4840, 'Deep Duck Trouble Starring Donald Duck', NULL, NULL, 'Uncle Scrooge found a magical necklace on a mysterious island, but the necklace put a curse on him. Now Uncle Scrooge is doomed to float around in the air forever! (Of course Donald always said Scrooge was full of hot air anyway!) To take the curse off Uncle Scrooge, Donald has to take the necklace back to the island. But there\'s plenty of danger awaiting Donald there. How about lending him a hand?\n', '/images/sms/4840/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/26/Deep_Duck_Trouble_Starring_Donald_Duck_Coverart.png', NULL, NULL),
(4841, 'Desert Speedtrap Starring Road Runner & Wile E. Coyote', NULL, NULL, 'Road Runner is a freewheeling bird, just speeding down the road and minding his own business. But Wile E. Coyote, Road Runner\'s old foe, has decided that he\'s hungry for some roast Road Runner. Wile E. will stop at nothing to dine on Road Runner, but with a little luck - and a little help from you - Road Runner may just be able to outsmart that crafty coyote!', '/images/sms/4841/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/2/306572_front.jpg', NULL, NULL),
(4842, 'Desert Strike: Return to the Gulf', NULL, NULL, 'The Scuds are back! With a fiery blast from your Hellfire missiles you must annihilate a ruthless tyrant\'s military arsenal. Smoke his private yacht and tear into his air force as you challenge the Madman\'s forces in a series of surgical strikes. Rip through 27 fiery missions. Force is highly recommended.', '/images/sms/4842/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/6/31026_front.jpg', NULL, NULL),
(4843, 'Dick Tracy (SMS)', NULL, NULL, 'Calling Dick Tracy!  Calling Dick Tracy!  The mob\'s got the city by the throat!  The next move\'s yours.  You\'ve got to grapple with the meanest guys around and break this crime ring before it breaks you!  You\'ve got pistols, machine guns, dynamite fists, and the law.  The mob\'s got Molotov cocktails, a trainload of nitro and bad intentions.  Shoot it out with the likes of Lips Manlis, Flattop, The Brow, and Pruneface.  Hang onto the side of a speeding car in frenzied street gunbattles.  Blast\'em in alleys, railyards, and warehouses.  Hit the right targets on the gun range and get more time to fight.  Clean up the town\'s seamy side.  Then rip into the racketeers at the Ritz.  Blast your way to the final showdown with Big Boy Caprice.  Think you\'re tough?  Here\'s your chance to prove it, Dick Tracy.', '/images/sms/4843/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/de/Dicktracy1238.jpg', NULL, NULL),
(4844, 'Double Dragon (SMS)', NULL, NULL, 'In a city destroyed by war and crime, you count on each other to survive!  You are Billy and Jimmy Lee, the twins they call the Spike and the Hammer.  When it comes to martial arts, you\'re both street lethal.  Leaping kicks.  Knee smashes.  Judo throws.  You are the masters.  Now get ready for the biggest battle of all.  The Black Warriors, meanest gang in the city, has kidnapped Jimmy\'s girlfriend Mary Ann.  She\'s the bait they\'re using to lure you onto their turf.  You\'re going to get her back...and take care of the Black Warriors\' gang once and for all!  It\'s going to take every fighting skill you have.  And if you make it to the headquarters of the Black Warriors, you\'ll face the greatest surprise of all, the leader of the gang!', '/images/sms/4844/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1e/Double_Dragon_Logo.png', NULL, NULL),
(4845, 'Double Hawk', NULL, NULL, 'You control the action as John and Jack, two warriors hand-picked by the United Nations, attempt to bring down a terrorist organization which is responsible for a worldwide wave of violence!  The terrorists are capable of launching attacks from the sky, the sea, and by land.  Are you the one person who can end this reign of terror?', '/images/sms/4845/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/2/30792_front.jpg', NULL, NULL),
(4847, 'Dr. Robotnik\'s Mean Bean Machine', NULL, NULL, 'You\'ll have to stay calm and think fast to win this highly addictive puzzle game.  Play against a friend, or slam Dr. Robotnik\'s evil hechbots in the competition modes!  Pit yourself against the timer, or try the Puzzle mode for a special challenge!', '/images/sms/4847/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c2/Sonic_Mean_Bean_Machine.jpg', NULL, NULL),
(4848, 'Dragon: The Bruce Lee Story', NULL, NULL, 'Enter the world of Dragon. A place where the martial arts legend Bruce Lee lived for 32 troublesome years. A place where you will encounter a multitude of the smartest and fiercest opponents ever to be seen in a Master System beat-\'em-up. At your disposal is a devastating array of over 35 different fighting moves. You WILL need them... Contains three different fighting styles: Mantis, Fighter and Nunchuku. Many secret special moves to discover. Using a Multi Tap, three human opponents can fight to the finish.', '/images/sms/4848/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/6/30996_front.jpg', NULL, NULL),
(4849, 'Dragon Crystal', NULL, NULL, 'You\'re caught in a fantastic world of unearthly beauty and deadly demons. You\'ll pass through thirty worlds in search of the Magic Goblet. There\'s no way out of this musical nightmare...until you find it.', '/images/sms/4849/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/1/37511_front.jpg', NULL, NULL),
(4850, 'Dynamite Duke', NULL, NULL, 'Dr Neil Ashe, once a highly respected scientist, is now a wanted man! He stole the plans for a \'super being\' that could withstand the strongest rays given off by the sun, and is using them to build an army of mutants with one objective - Global Domination! Enter Duke Frederick, a war hero with a bionic right arm. Guide Dynamite Duke into Ashes base on the island of Rantan, and put an end to the mutant threat!', '/images/sms/4850/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b1/DynamiteDuke_arcadeflyer.png', NULL, NULL),
(4851, 'Dynamite Dux', NULL, NULL, 'The terrible Achacha the Great has turned you into a duck and taken your fiend Lucy into the Achacha dimension. If you don\'t get her back, you\'ll both be duck soup!', '/images/sms/4851/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d3/Dynamite_D%C3%BCx_arcade_flyer.jpg', NULL, NULL),
(4853, 'Dynamite Headdy', NULL, NULL, 'Hot-headed Headdy gets into some real head-banging to thwart the Dark Demon\'s devious deeds. This wacky headcase is up to his neck in surprises! Switch heads to match the job! Over 15 heads to choose from! Bash heavy objects with Slammer Head! Suck up foes with Vacuum Head! Stick it to your enemies with Spike Head! Headdy\'s spring-loaded head gets him where he\'s gotta go! Use it to swing over ledges, grab onto objects and shoot hoops in the basketball bonus round. Use your head to whiz through a radical variety of play! Action, shooting and strategy speed you on to a surprise ending!', '/images/sms/4853/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/78/Dynamite_Headdy_Coverart.png', NULL, NULL),
(4854, 'Ecco the Dolphin', NULL, NULL, 'Ecco\'s underwater world has been devastated by a swirling gust of air and water.  Help him navigate back to this dolphin pod, through treacherous tropical reefs and freezing polar ice floes.', '/images/sms/4854/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/0/21360_front.jpg', NULL, NULL),
(4858, 'Enduro Racer', NULL, NULL, 'Countdown to adventure.  Three, rev your engine.  Two, get ready.  One, you\'re off.  And this is the wildest race on the toughest course and Pro has ever had to cross.  Luckily you\'re prepared with the all-terrain handling and speed of the Enduro Racer.  Everything from super-sized jumps, competing machines, natural and man-made obstacles will make your journey a perilous one.  But you\'ve got one direction: the Finish Line.  So drive your fastest, you\'re racing against the clock.  And be careful.  Once you\'re down, it\'s hard to get up and you\'ve got only one bike to burn through this demanding track.  Now, grip those gears, spin those wheels and take the lead to victory.', '/images/sms/4858/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/3/5/30635_front.jpg', NULL, NULL),
(4859, 'F1 (SMS)', NULL, NULL, 'F1 is an Official Formula One Racing Game. It\'s also the fastest, most authentic, most thrilling Master System racing game yet. Battle it out on the real Formula One Circuits against the real teams and the real drivers of the FIA Formula One World Championship.\n', '/images/sms/4859/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/5/295845_front.jpg', NULL, NULL),
(4860, 'F-16 Fighting Falcon', NULL, NULL, 'It\'s dog-eat-dog in the wild blue yonder. This is the most perilous dogfight ever to explode on the video screen. It\'s between an F-16 (you!) and a MIG-25 plane. Your F-16 is a multipurpose fighter. But the MIG-25 was built for speed. So it\'s going to take everything you\'ve got to catch up with her. But then, "everything you\'ve got" is quite a lot. Your F-16 can fly as high as 50,000 feet. It has a top speed of 1,450 mph. And missiles and cannons are just part of its standard armament. Its fully advanced electronic control pad supplies you with a wealth of valuable flight information. It even includes an automatic homing device as well as ECMs (electronic countermeasures). This is simulated flight at its most realistic. And simulated battle at its most deadly.', '/images/sms/4860/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/5/50265_front.jpg', NULL, NULL),
(4861, 'Fantastic Dizzy', NULL, NULL, 'Dizzy\'s cartoon adventure in Zakeria - a magical kingdom ruled by the evil wizard Zaks. Explore the mysterious diamond mines, fabulous caverns, dragon\'s lair, cloud castle, encounter strange magicians, wizards, trolls, pirates, leprechauns and many other weird and wonderful creatures.', '/images/sms/4861/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a0/Cover-of-the-fantastic-adventures-of-dizzy.jpg', NULL, NULL),
(4862, 'Fantasy Zone (SMS)', NULL, NULL, 'Take command of the spaceship Opa-Opa and blast your way through various fantastical levels as you try to take out all the enemy bases in each stage. Once you\'ve destroyed the bases, you\'ll have to beat the stage boss in order to move on to the next level. By using your guns and bombs wisely, you\'ll be able to take down your enemies and explore each of the crazy environments in this side-scroller. You can also buy upgraded weapons for your ship by accessing the shop.', '/images/sms/4862/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/0/09/Fantasy_zone_arcadeflyer.PNG', NULL, NULL),
(4863, 'Fantasy Zone II: The Tears of Opa-Opa', NULL, NULL, 'Opa-Opa is at it again in this zany return to his original homeland some ten years later. Welcome to Fantasy Zone II where perils are great and rewards even greater. During your visit you\'ll discover that peace is at stake once again and those who threaten it are more cunning and wicked than before. So beware, the evil Blackhearts are near and they\'re not alone. Scores of unusual and seemingly innocent creatures will enthusiastically approach you. But don\'t be fooled. They\'re not here to help. They\'re henchmen for the dark powers of the Blackhearts. And they\'ll sabotage every chance you\'ve got to protect the warp gates from total ruin. So fight valiantly, because just when you think you\'ve made it, the Blackhearts will be waiting.', '/images/sms/4863/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/Fantasy_Zone_2_Sega_Master_System_US.jpg', NULL, NULL),
(4864, 'Fantasy Zone: The Maze', NULL, NULL, 'The evil Menons have returned... in multi-level bases which are hidden in seven different planets! The brave Opa-Opa has been called to battle their evil threat. And joining him in the fight is his younger brother, Upa-Upa. Your Mission: Guide this brave team of brothers through level after level of treacherous mazes. Get the golden coins stolen by the Menon hoard and use them to purchase powerful weapons. The Fantasy Zone is counting on you! Don\'t let them down.', '/images/sms/4864/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/9/50279_front.jpg', NULL, NULL),
(4865, 'Fire and Forget II', NULL, NULL, 'With FIRE & FORGET 2, prepare to experience the most extraordinary arcade game ever designed for a console! You will have to pilot the THUNDER MASTER II, capable of 850 horsepower on the road and able to convert itself into a genuine airborne attacker, both equipped with ionic phasers and missile launcher.', '/images/sms/4865/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/2/306582_front.jpg', NULL, NULL),
(4866, 'Fire and Ice (SMS)', NULL, NULL, 'Fire & Ice is an Action game, developed by Graftgold and published by Tec Toy,  which was released in South America in 1993.', '/images/sms/4866/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/0/313560_front.jpg', NULL, NULL),
(4867, 'The Flash', NULL, NULL, 'Electronics wizard Trachmann and master villain Trickster have teamed up to take control of Central City, and it\'s up to The Flash to set things right. Use your wits and The Flash\'s super speed to track down these villains before time runs out!', '/images/sms/4867/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ed/The_Flash_Family.jpg', NULL, NULL),
(4868, 'The Flintstones', NULL, NULL, 'It\'s the weekend and Fred Flintstone returns home from work very excited about the Bedrock Super Bowl final tonight. As he arrives home Wilma reminds him of his promise to paint the living room before her mother arrives on Sunday. Wilma insists that Fred can only go bowling if he paints the living room. Reluctantly, Fred agrees, but he doesn\'t bargain for baby-sitting Pebbles and painting at the same time. Chaos, fun and the Flintstones humor is everywhere!', '/images/sms/4868/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/51/The_Flintstones.jpg', NULL, NULL),
(4869, 'Forgotten Worlds', NULL, NULL, 'Ruins, destruction, wastelands - that\'s all there is to see. The fiendish Aliens have infested your planet! As a Warrior, you swear to win back the Dust Planet for its rightful owners, the Human Beings. Get ready to face brutal Alien fiends and risk your life in battle. Your only goal is to stay alive long enough to destroy your most powerful enemy, the War Tyrant!', '/images/sms/4869/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8e/Forgotten_Worlds_%28flier%29.png', NULL, NULL),
(4870, 'G-LOC: Air Battle', NULL, NULL, 'Vigilante forces have raided government military installations and "confiscated" tanks, planes, even warships! Pilot your G-LOC fighter to victory against the guerillas!', '/images/sms/4870/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/2/30822_front.jpg', NULL, NULL),
(4871, 'Gain Ground', NULL, NULL, 'Gain Ground became a sensation overnight as the newest human vs. Android competition. One day, though, the Mother Computer that controlled the androids went crazy and trapped spectators in the Coliseum. Join the group of skilled fighters who are trying to defeat the system, and save those innocent people from a fate worse than death!', '/images/sms/4871/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/03/Gain_Ground_%28leaflet%29.png', NULL, NULL),
(4872, 'Galactic Protector', NULL, NULL, 'Galactic Protector is an Action game, developed and published by Sega,  which was released in Japan in 1988.', '/images/sms/4872/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/21/Galactic_Protector_Cover_art.jpg', NULL, NULL),
(4873, 'Galaxy Force', NULL, NULL, 'CAUTION: FOUR MEGA POWER! Not double, not triple, but FOUR times the playing power of a regular cartidge. You get the hottest space combat, the baddest explosions, and the coolest sounds ever! Journey to four different planets, each with stunning but deadly landscapes. There\'s so many awesome enemies, you won\'t have time to stargaze!', '/images/sms/4873/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/6/50286_front.jpg', NULL, NULL),
(4874, 'Gangster Town', NULL, NULL, 'The time is the wild 1920\'s. The place is a great American city that has been taken over by rampant crime. The corruption is led by cruel and cunning gangsters who have let fear and destruction loose in the city. You are the only hope for law and order to return. As a member of the FBI, you wear the badge of the bravest. Your mission: rid the city of these thugs. Armed with your machine gun and plenty of courage, you\'re dedicated to making gangsters a thing of the past. But it won\'t be easy. The streets are riddles with gunfire, the local nightclubs are now criminal hang-outs, and the waterfront\'s docks are in the grip of the most menacing crime-lover, Big Boss. It\'s you or them - good luck, you\'ll need it!', '/images/sms/4874/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/3/50293_front.jpg', NULL, NULL),
(4875, 'Gauntlet (SMS)', NULL, NULL, 'Call upon the mighty axe of Thor, the scything sword of Thyra, the mystical magic of Merlin or the swift arrows of Questor in your conquest of the Dungeons of Darkness. Fight your way through hordes of monsters and legions of demons in this, the ultimate arcade combat gameplay!\n', '/images/sms/4875/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/0/50290_front.jpg', NULL, NULL),
(4876, 'George Foreman\'s KO Boxing (SMS)', NULL, NULL, 'This is your chance, big guy! James "Buster" Douglas Knockout Boxing throws you into the ring with the meanest power-punchers around. Pound your way to the title in a game designed with input from James "Buster" Douglas, the boxer who beat Mike Tyson. Slug and jab with devastating accuracy. Daze your opponent with a flurry of straight shots and hooks, then send him to the canvas with some vicious uppercuts. Be one of five boxers, including "Buster" Douglas. Each fighter has his own style and characteristics, making every fight a whole new challenge. Once you win the title, you better be prepared to defend it. Each fighter will come back madder and meaner! If you\'re looking for a real boxing challenge, James "Buster" Douglas is looking for you!', '/images/sms/4876/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/0/30920_front.jpg', NULL, NULL),
(4877, 'Ghost House', NULL, NULL, 'A spooky romp through Count Dracula\'s incredible haunted house.  You\'re Mick.  And the good news is that your grandfather just told you that you\'re to inherit the family jewels.  A flashy collection of diamonds, rubies, sapphires, even opals.  All yours.  The bad news is that they\'re hidden inside Count Dracula\'s mansion.  They have been for years.  First, you have to wipe out the bats, Draculas, and eventually their annoying henchman.  Then you have to find the hidden keys and passageways that should lead to your family\'s long lost treasure.  Ghoul luck -- you\'ll need it.', '/images/sms/4877/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f8/Ghosthousecard.jpg', NULL, NULL),
(4878, 'Ghostbusters (SMS)', NULL, NULL, 'Starting your own Ghostbusters business is tough. It takes a lot of money. A lot of equipment. And lots of hard work. But someone\'s gotta do it. Besides, look at the rewards. You get to drive some of the world\'s hottest cars. And play with the latest high-tech equipment. Like Super Ion Beams, Laser Confinement Systems and Image Intensifiers. You get to get closer than anyone\'s ever been to the ominous Marshmallow Man. And best of all, if you\'re lucky, you\'ll meet face to face with the ghost leader of the universe, Gorza. So if you\'re tired of your regular old job, why not sign on as a Ghostbuster? And find out what a real job is!', '/images/sms/4878/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2f/Ghostbusters_%281984%29_theatrical_poster.png', NULL, NULL),
(4879, 'Ghouls \'n Ghosts', NULL, NULL, 'The time is yesteryear, when knights scoured the countryside in search of the Holy Grail, defended the honor of fair maidens and fought a never-ending battle against rampant evil forces. Thrown into this mayhem is the courageous Sir Arthur. A victorious knight with the awesome task of penetrating the Demon\'s Castle to pulverize the Prince of Darkness. You\'ll travel through the Place of Execution, the Village of Decay, the Town of Fire and the Crystal Forest with an arsenal of weapons at your side. And when you\'re really down on your luck, magic fights might with powerful results. The only problem? You\'ll have to learn how to use it. Because their magic has the power to change you into a helpless duck, among other things. But there\'s not much time. Lives depend on you. So brandish your sword and make mincemeat of your foes.', '/images/sms/4879/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/43/Ghouls_and_Ghosts_sales_flyer.png', NULL, NULL),
(4880, 'Global Defense', NULL, NULL, 'Earth is under attack! From secret bases hidden in the farthest reaches of the galaxy, deadly missiles have been sent to destroy your home planet. Earth needs a Champion, someone with courage... the skill to operate a Global Defense satellite... someone who is brave enough to fight a space battle with almost impossible odds. Earth needs you to take on the enemy in one of the meanest, toughest space battles ever! You\'ve got the Global Defense Satellite and a supercharged laser cannon. Through ten waves of non-stop action, seek out and destroy the enemy missiles and satellites... zapping anything that gets in your way. Each wave is tougher. The risks, greater. Nobody said it would be easy. Are you ready for Global Defense?', '/images/sms/4880/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/0/1/50301_front.jpg', NULL, NULL),
(4881, 'Global Gladiators', NULL, NULL, 'Strap on your GooShooter and join Mick and Mack, the Global Gladiators, on a quest to neutralize the Monsters of Slime World, the Mystical Forest and Arctic World. Check out the bodacious backgrounds, the 1,250 awesome animation frames and the most spacious sound around!', '/images/sms/4881/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/8/0/47780_front.jpg', NULL, NULL),
(4882, 'Golden Axe', NULL, NULL, 'The residents of the once-peaceful city of Yuria have lost the legendary Golden Axe - the very thing that had shielded them from evil for so long. It is now in the hands of the unscrupulous titan, Death-Adder. Tarik, the seasoned warrior whose skill with his giant sword is both praised and feared throughout the land, has come forth to try and wrest the Axe from the grasp of the black-hearted warlord. Help Tarik to battle the many types of bandits that Death-Adder has amassed to protect himself. Using the sword, and certain very special magical powers, guide Tarik through the gauntlet of bandits to Death-Adder\'s castle! He\'ll be waiting there for you, and he\'s terribly reluctant to give up the Golden Axe! Are you brave enough to bring back the Axe, and thus restore tranquility to Yuria, or will you wind up just another victim of the evil warlord?', '/images/sms/4882/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3a/Golden_Axe_logo.png', NULL, NULL),
(4883, 'Golden Axe Warrior', NULL, NULL, 'World peace is at stake! Death Adder, a wicked giant, has stolen the nine crystals from the kingdom of Firewood and has hidden them in nine labyrinths that he has created. These nine magic crystals protected the people from evil - especially from Death Adder\'s grasp. But now that the crystals are lost, the world is defenseless! Someone must put an end to the fiend\'s realm of darkness, death and destruction! Do you have what it takes to bring back peace and happiness? Trek through deep, dark forests and sail across vast, stormy seas. Chop down trees with your Battle Axe, and move rocks with your magic spells to find secret caves. When you take on Death Adder\'s gruesome monsters, think only of winning - or else you won\'t find the nine crystals. And when you do, you\'ll find the Golden Axe - the only weapon that can crush Death Adder!', '/images/sms/4883/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/0/4/50304_front.jpg', NULL, NULL),
(4884, 'Golfamania', NULL, NULL, 'You\'ll need sharp eyes, a smooth swing, and perfect judgment if you\'re going to master Golfamania. Out on the links you\'ll have to consider the distance, the wind, the lie of the ball, where to hit the ball and which club to use. Then watch that power meter and swing for the pin!', '/images/sms/4884/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/7/316177_front.jpg', NULL, NULL),
(4885, 'Golvellius: Valley of Doom', NULL, NULL, 'Enter the world of Golvellius. Where demons rule the valley of water... and control the creatures of land, sea and air. Where almost everyone stands against you. There is only one way in... and no way out except victory or death! It\'s an adventure that will take you across deserts and mountains, oceans and forests... through eerie graveyards and caves filled with danger and surprise. Golvellius has a password save feature that lets you keep all your possessions. So you never have to start an adventure empty handed!', '/images/sms/4885/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/0/8/50308_front.jpg', NULL, NULL),
(4886, 'GP Rider', NULL, NULL, 'The hottest in motercycle racing games! Show your stuff on mind boggling courses against the top riders and machines in the world!', '/images/sms/4886/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/6/30866_front.jpg', NULL, NULL),
(4887, 'Great Baseball', NULL, NULL, 'You\'re the manager. And you can field a total of 26 ball teams to battle for league leadership. Pick the team of your choice. Designate the starting pitcher. Then, play ball! And get ready for some of the most exciting baseball since the game was invented. Will it be a slugging match? A  pitching duel? Need a pinch hitter or relief pitcher? You decide. It just takes the right strategy. A cool head. And sure ball control. And if you want batting practice, call up The Home Run Contest. A great feature of Great Baseball that lets you swing at 20 perfect pitches. It\'s going... It\'s going... It\'s gone!', '/images/sms/4887/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/2/50312_front.jpg', NULL, NULL),
(4889, 'Great Basketball', NULL, NULL, 'This is basketball at the professional level. Full of international competition from the first jump ball to the last jump shot. Whether it\'s four on three or three on two - the action is fast and furious. And there are no favorites in this demanding play. You\'ll be called for double dribbling, cheered for every slam-dunk and carried off the court for making the winning free throw. But so will your opponent. So go for it. Your tough offense can put a "fast break" in the opposing team\'s stride while your defense remains solid as a rock. But think fast - because two can play at this game - and only one can win!', '/images/sms/4889/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/4/50314_front.jpg', NULL, NULL),
(4890, 'Great Football', NULL, NULL, 'Playoff fever grips you. And no wonder. You\'re the driving force that can take your football team to the top in this rough and tumble contest between the leagues. The outcome of the game is in your hands. As the quarterback, you select the plays. Line up the formations. Call the signals and carry the ball. Cut down your opponent with deadly blocking. Intercept a pass. Make a flying tackle. All you need is skill. Strategy. Cunning. And nerve. For non-stop action that charges across the screen. You decide to pass. It looks good. Touchdown!', '/images/sms/4890/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/3/6/30736_front.jpg', NULL, NULL),
(4901, 'Great Golf', NULL, NULL, 'Keep your head down. Eyes on the ball. Grip the club firmly... and swing. Welcome to the Sega Master\'s Tournament where you need to play better than "par" if you want to win. So tee-up for some real fun. And remember to play with caution. This championship course has been groomed for a truly competitive challenge. Eighteen holes full of roughs, bunkers and water hazards will put your nerves to a real test. But not to worry. You\'ve got some clever moves to meet the challenge of a "dog leg" fairway or a tricky green. So go for a sneaky slice or hard hook to outplay the rest. Winner takes all! FORE!', '/images/sms/4901/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/9/50319_front.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(4905, 'Great Ice Hockey', NULL, NULL, 'Welcome to the Big Leagues. Here\'s a rough and tumble hockey game that takes a steady hand and quick reflexes. Because your mean opponents mean business. Teams line up in full defense. Tackle one another. Scramble for the puck. Drive relentlessly for a goal. Victory for your team depends on you. So you need sharp techniques. Quickness. Power. And smooth stick-shifting ability. Show you have the right touch, hit the puck straight into the goal. But just relax your guard, and see why they call the game of hockey "wrestling on ice."', '/images/sms/4905/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5c/Great_Ice_Hockey.jpg', NULL, NULL),
(4907, 'Great Volleyball', NULL, NULL, 'So you wanna win the world championship? Give it your best shot. Gonna take teamwork. Nerves of steel. Service... spike... point for your side. Nice going. You\'re on your way!', '/images/sms/4907/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/2/8/50328_front.jpg', NULL, NULL),
(4908, 'Hang-On', NULL, NULL, 'Neck-breaking speeds, tight curves and world-class competition make Sega\'s Hang On the most exciting motorcycle racing game around. Hop aboard your supercycle and test your racing skill against the top riders on earth! Think you can beat them all to the finish? Prove it!', '/images/sms/4908/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/3/50333_front.jpg', NULL, NULL),
(4909, 'Heroes of the Lance', NULL, NULL, 'Discover the world of Krynn in this AD&D epic. Control the Companions of the Lance (they aren\'t heroes until they succeed) in their quest to recover the Disks of Mishakal. Only they can defeat the Queen of Darkness and restore the balance between Good and Evil.', '/images/sms/4909/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Advanced_Dungeons_%26_Dragons_Heroes_of_the_Lance_Cover.png', NULL, NULL),
(4910, 'High School! Kimengumi', NULL, NULL, 'High School! Kimengumi is an Action Adventure game, developed and published by Sega,  which was released in Japan in 1986.', '/images/sms/4910/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1d/Kimen-gumi1.jpg', NULL, NULL),
(4911, 'Home Alone (SMS)', NULL, NULL, 'Oh no! Kevin\'s home alone, and two burglars plan to break into the house and steal all the loot! It\'s up to Kevin to find and lock up all the valuables first, and delay the two crooks long enough for the police to arrive!', '/images/sms/4911/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/76/Home_alone_poster.jpg', NULL, NULL),
(4912, 'Hook (SMS)', NULL, NULL, 'Your blood is pumping and a chill races down your spine! You\'ve finally come face-to-face with the most infamous pirate of them all, Captain Hook, the fiend who\'s kidnapped your children and sworn never to let them go. As Peter Pan, this is the fight of your life. Everything that came before - your duel with Rufio, your battles against the pirates, even your soaring flights high above Neverland - are nothing compared to this moment. Lots of fun levels of incredible excitement. Multiple destinations: forests, caves, caverns, towns, lagoons, icy regions, and the Nevertree. Magical items that will give you strength and special powers: apples, leaves, and pixie dust.', '/images/sms/4912/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0e/Hook_poster_transparent.png', NULL, NULL),
(4913, 'Hoshi wo Sagashite...', NULL, NULL, 'Hoshi o Sagashite... is an Adventure game, developed and published by Sega,  which was released in Japan in 1988.', '/images/sms/4913/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/3/30743_front.jpg', NULL, NULL),
(4914, 'Impossible Mission', NULL, NULL, 'Your mission, Agent 4125, is to foil a horrible plot. From an underground laboratory, Elvin, the scientist, is holding the world hostage under the threat of nuclear annihilation. You must penetrate his stronghold, avoid his human-seeking robots and find the pieces of the security code. Somersault over the robots or use a precious snooze code to deactivate them long enough to search each room. Use the Agency\'s computer to unscramble the passwords from the code pieces, or try to solve them yourself. You\'ve got to reach Elvin\'s control center, but you\'d better beware... this mission is stamped IMPOSSIBLE!', '/images/sms/4914/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/4/50334_front.jpg', NULL, NULL),
(4915, 'The Incredible Crash Dummies (SMS)', NULL, NULL, 'It\'s a crashing, bashing good time guaranteed to break you up! Whether it\'s an avalanche of laughs on the ski slopes, the boulevard bounce after a stunt jump, or a burst of high pressure humor testing air bags, the Incredible Crash Dummies are a real crack-up! They may have a few screws loose...but the Incredible Crash Dummies will knowck themselves out so you have a good time.', '/images/sms/4915/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/6/30946_front.jpg', NULL, NULL),
(4916, 'The Incredible Hulk', NULL, NULL, 'As The Incredible Hulk™ you must defeat The Leader™\'s evil forces. Plans are afoot to produce a destructive biochemical army and The Leader™ has enlisted the assistance of your deadliest foes - Tyrannus™, Absorbing Man™, Abomination™ and Rhino™ in a quest for world domination!', '/images/sms/4916/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b5/The_Incredible_Hulk_-_Ultimate_Destruction_%28game_box_art%29.jpg', NULL, NULL),
(4917, 'Indiana Jones and the Last Crusade: The Action Game', NULL, NULL, 'Use your whip! Use your fists! Use your wits! The chase is on, all the way to the greatest treasure in history, the Holy Grail! Scramble over the rumbling circus train, fight your way out of a giant zeppelin and race against time and ancient booby traps. You control Indy as you battle to survive one testing action-packed level after another.', '/images/sms/4917/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/21/Ijatlcts.png', NULL, NULL),
(4918, 'James Bond 007: The Duel', NULL, NULL, 'James Bond is back, pitting his wits and firepower against many of his old adversaries in an attempt to rescue the daughter of Professor Michael Jones. Brilliant Multi-Screens and fantastic animated action make this a Master System Tour de Force.', '/images/sms/4918/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b1/James_Bond_-_The_Duel_Coverart.png', NULL, NULL),
(4919, 'James "Buster" Douglas Knockout Boxing', NULL, NULL, 'This is your chance, big guy! James "Buster" Douglas Knockout Boxing throws you into the ring with the meanest power-punchers around. Pound your way to the title in a game designed with input from James "Buster" Douglas, the boxer who beat Mike Tyson. Slug and jab with devastating accuracy. Daze your opponent with a flurry of straight shots and hooks, then send him to the canvas with some vicious uppercuts. Be one of five boxers, including "Buster" Douglas. Each fighter has his own style and characteristics, making every fight a whole new challenge. Once you win the title, you better be prepared to defend it. Each fighter will come back madder and meaner! If you\'re looking for a real boxing challenge, James "Buster" Douglas is looking for you!', '/images/sms/4919/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/0/30920_front.jpg', NULL, NULL),
(4920, 'James Pond 2: Codename Robo', NULL, NULL, 'The Evil \'Dr Maybe\' is scheming to destroy every game factory in the world by planting his deadly penguin bombs. You must dive to the rescue as \'Robocod\' - licensed to grill. \'finning off\' speeding bullets, scaling walls of danger and \'fiercely filleting\' killer caterpillars!', '/images/sms/4920/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/9/31029_front.jpg', NULL, NULL),
(4921, 'Joe Montana Football', NULL, NULL, 'It\'s a snap! This is your chance to rub shoulder pads with Joe Montana, the man who led the "Team of the Eighties" to four Super Bowl Championships. You provide all the fourth quarter heroics, play-calling brilliance, and pinpoint passing as you hit the field against any of 28 pro teams. Call all your own plays! Each team has a playbook with 17 offensive and six defensive options. Pick the play that you think will work best, or take the advice of Joe Montana himself, as he recommends the play he would call in each situation. You control the action on the field by switching to the key players as the play unfolds. Your strength and speed will vary by position, just like the real sport. Knock helmets with the computer or punch holes in a friend\'s defense. Can you keep your head cool and your passing arm hot? Pick your team. Choose the plays. Think you have what it takes to be the next Joe Montana?', '/images/sms/4921/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Joe_Montana_Football_boxart.jpg', NULL, NULL),
(4922, 'The Jungle Book', NULL, NULL, 'Get down to the bare necessities of life and escort Mowgli through the jungle to the safety of the human village. Fight the boggle-eyed snake, Kaa, and defeat Shere Khan the hungry tiger in this exciting adventure based on Disney\'s classic! It\'ll drive you ape crazy!', '/images/sms/4922/cover.jpg', 'https://upload.wikimedia.org/wikipedia/commons/f/f5/JunglebookCover.jpg', NULL, NULL),
(4923, 'Jurassic Park (SMS)', NULL, NULL, '"Look Grant, you\'ve got to help us. With the computer security system out of commission, there\'s no telling how many dinosaurs have escaped and are running around free. We have to recapture them or Jurassic Park won\'t open on schedule. Not to mention the fact that with these dangerous animals out there we have no way of getting off the island alive!"', '/images/sms/4923/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/93/Jurassic_Park_%28franchise_logo%29.png', NULL, NULL),
(4924, 'Kenseiden', NULL, NULL, 'It was a land of peace and plenty... until the evil Warlocks returned in a storm of ruin and destruction! Now, they have struck the final blow by stealing your heritage... the Sword of the Dragon King and the Five Secret Scrolls. You are Hayato. The blood of the Dragon King runs in your veins. Armed only with a samurai sword, you must travel through the 16 provinces of ancient Japan, battling the Warlocks and their monstrous armies in nightmare caves and castles! If you defeat the Warlocks, you will learn the sword magic of the scrolls and... maybe... regain the Sword of the Dragon King. Fail, and your country is doomed to a thousand centuries of terror! It is a battle only you can win!', '/images/sms/4924/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/4/1/50341_front.jpg', NULL, NULL),
(4925, 'King\'s Quest: Quest for the Crown', NULL, NULL, 'There\'s plenty of action, adventure and danger in this animated video game based on one of the best-selling computer games...', '/images/sms/4925/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/4/2/50342_front.jpg', NULL, NULL),
(4926, 'Kung Fu Kid', NULL, NULL, 'Get ready to perform the martial arts with the precision of a master. Now is the time to accept your fate as the most courageous man alive. You\'re the invincible Wang. The most skilled Kung Fu artist in the history of ancient China. Armed with the mysterious and traditional Talisman, your talents are the only defense against the wicked Madanda, the most dreaded creature to ever live. He\'s just awakened from a sleep of several thousand years and his desire is to terrorize your village and devour its people. The battle will be furious. And nobody knows the outcome for sure. So fight with pride and power to send this unnatural force to a final resting place.', '/images/sms/4926/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/52/Kung_Fu_Kid_Coverart.png', NULL, NULL),
(4927, 'Land of Illusion Starring Mickey Mouse', NULL, NULL, 'Journey with Mickey Mouse through spooky castle ruins, dark caverns, an enchanted forest and a toy shop gone crazy! Use your wits and Mickey\'s magic to evade challenging traps, explore secret passages, and restore peace and happiness to the Land of Illusion!', '/images/sms/4927/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/4e/Land_of_Illusion_starring_Mickey_Mouse_Coverart.png', NULL, NULL),
(4928, 'Laser Ghost', NULL, NULL, 'Poor Katherine is scared stiff. Ghosts and goblins have stolen her soul and imprisoned her. "Help me... somebody please help me..."', '/images/sms/4928/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d2/Laser_ghost.jpg', NULL, NULL),
(4929, 'Legend of Illusion Starring Mickey Mouse (SMS)', NULL, NULL, 'Mickey is tricked into a perilous quest when the kingdom is threatened by an evil cloud of darkness. As temporary king, Mickey must solve riddles, find maps and avoid trickery across 5 magical lands to save the Tree of Life from the cowardly King Pete.', '/images/sms/4929/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/bb/GG_Legend_of_Illusion_Cover_art.jpg', NULL, NULL),
(4930, 'Lemmings 2: The Tribe', NULL, NULL, 'A whole new world! Those lovable green-haired Lemmings are back with a whole new bunch of skills, levels and mayhem to challenge your dexterity and tax your wits. You\'ve gotta save those goofy critters. The Lemmings have split into 12 different tribes and are spread all over Lemming Island. It\'s up to you to lead them on. With your brains and their magic, you\'ll be unstoppable as you blaze through tons of awesome puzzles! Take the adventure to a higher level and reunite The Tribes!', '/images/snes/4930/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/be/Lemmings_2_box_art.jpg', NULL, NULL),
(4931, 'Line of Fire', NULL, NULL, 'Just as you stole the enemy\'s secret weapon and started back, the enemy spotted you! Now you must fight your way back to safety. But be careful! You\'re in the line of fire.', '/images/sms/4931/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/7/306577_front.jpg', NULL, NULL),
(4932, 'The Lion King', NULL, NULL, 'Join the Lion King on his journey through ten levels of adventure. Play bonus levels as Simba\'s friends. Fight hyenas and avoid wildebeests. Face the ultimate battle against evil Uncle Scar.', '/images/sms/4932/cover.svg', 'https://upload.wikimedia.org/wikipedia/commons/3/3d/The_Lion_King_logo.svg', NULL, NULL),
(4933, 'Lord of the Sword', NULL, NULL, 'The followers of the evil Ra Goan have toppled the king from the throne. None are brave enough to take his place. The Elders have decreed that any man who can pass three tests will become King of Baljinya. Find the Tree of Merill. Defeat the Goblin of Balala Valley. Destroy the Statue of Evil. It sounds easy. But the followers of Ra Goan are waiting to stop you! It\'s an adventure that will take you across rivers and oceans, through swamps and over mountains. You have a sword and a bow. But magical weapons may become yours... for a price. Pass the tests and you shall be king. But remember: There\'s more to being a Lord of The Sword than hacking apart thine enemies!', '/images/sms/4933/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Lord_of_the_Sword_box.jpg', NULL, NULL),
(4934, 'Loretta no Shouzou', NULL, NULL, 'Sherlock Holmes: Loretta no Shouzou is an Adventure game, developed and published by Sega,  which was released in Japan in 1987.', '/images/sms/4934/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/9/317389_front.jpg', NULL, NULL),
(4935, 'Lucky Dime Caper Starring Donald Duck', NULL, NULL, 'Evil Magica De Spell has stolen the Lucky Dimes and has captured Huey, Dewey and Louie! Trek through six treacherous lands with Donald to save his nephews and retrieve the Lucky Dimes!', '/images/sms/4935/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f2/SMS_Lucky_Dime_Caper_Cover_art.jpg', NULL, NULL),
(4936, 'Mahjong Sengoku Jidai', NULL, NULL, 'Mahjong Sengoku Jidai is a Miscellaneous game, developed by Sanritsu and published by Sega,  which was released in Japan in 1987.', '/images/sms/4936/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/5/306555_front.jpg', NULL, NULL),
(4937, 'Marble Madness (SMS)', NULL, NULL, 'The arcade sensation of the 80\'s comes to your Sega Master System! Have you got what it takes to guide a lone marble through six weird and wonderful courses packed with odd obstacles and insane indestructible inhabitants? Find out in Marble Madness!', '/images/sms/4937/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/17/MarbleMadness_arcadeflyer.png', NULL, NULL),
(4938, 'Marksman Shooting & Trap Shooting', NULL, NULL, 'Try your hand at three different shooting styles; an FBI firing range, Clay pigeons, and Hunting. A three-in-one game guaranteed to test your overall sharpshooting ability to the utmost.', '/images/sms/4938/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2c/Marksman_Trap.jpg', NULL, NULL),
(4939, 'Marksman Shooting / Trap Shooting / Safari Hunt', NULL, NULL, 'Try your hand at three different shooting styles; an FBI firing range, Clay pigeons, and Hunting. A three-in-one game guaranteed to test your overall sharpshooting ability to the utmost.', '/images/sms/4939/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2c/Marksman_Trap.jpg', NULL, NULL),
(4940, 'Master of Darkness', NULL, NULL, 'The shadow of Dracula has spread over Victorian England. Make your way through strange and forbidding streets and cavernous warehouses while fighting his army of monsters. Find Dracula, the Master of Darkness, and rescue England from his terrifying grasp.', '/images/sms/4940/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7e/Master_of_Darkness_Coverart.png', NULL, NULL),
(4941, 'Master Games 1', NULL, NULL, 'Congratulations on your purchase of a SEGA Master System. We hope this Master Games cartridge will give you many hours of fun and give you a great start to your games collection.', '/images/sms/4941/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/5/314965_front.jpg', NULL, NULL),
(4942, 'Masters of Combat', NULL, NULL, 'Choose one of four colossal fighters, each one with a number of special moves and fighting techniques, and go head-to-head against the other three! Take on a friend in an exhibition combat, or make your way to the top in the one-player tournament, where you must fight for your life - and the lives of all the people on Earth!', '/images/sms/4942/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/5/304195_front.jpg', NULL, NULL),
(4944, 'Maze Hunter 3-D', NULL, NULL, 'TRAPPED! Above you is the star-filled void of space. Below... a mysterious, twisting maze filled with unknown dangers! To survive this maze you\'ll have to fight your way to the bottom. Put on your SegaScope 3D glasses. The maze comes to life with 3D graphics that will blow you away! The walls are so high they\'ll make you dizzy! Five areas and twenty levels... and countless dead ends. And, of course, the evil maze creatures! If you\'re fast enough you can try to jump over them. But find the maze weapons and you can hunt them down! If you make it to the bottom, you\'ll earn the title of maze hunter... and become a legend!', '/images/sms/4944/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/5/50355_front.jpg', NULL, NULL),
(4945, 'Megumi Rescue', NULL, NULL, 'Megumi Rescue is an Action game, developed and published by Sega,  which was released in Japan in 1988.', '/images/sms/4945/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/7/306557_front.jpg', NULL, NULL),
(4946, 'Mercs', NULL, NULL, 'You are a Merc, a professional mercenary. Use your awesome fighting skills to rescue the former U.S. President from the hands of terrorists!', '/images/sms/4946/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/5/30845_front.jpg', NULL, NULL),
(4947, 'Michael Jackson\'s Moonwalker', NULL, NULL, '"Michael!" Katy\'s voice rings out - you\'ve found her! But more children are still lost! Can you stop the psycho mastermind Mr. Big and his goon squad before they kidnap all the kids? You can, if you\'re Michael Jackson! Moonwalk on muggers, lean on meanies, and pop the punks! Outfight, outjump, outdance! Move like only Michael can, to the beat of Smooth Criminal, Beat it, Billie Jean, and Bad! No bad guy can last through Michael\'s Star Magic! Punch down gangsters in Club 30. Rumble in the streets. Swing, spin, and kick past graveyard ghouls. Chill in the caverns, then sizzle \'em with ultra-tech weapons in Mr. Big\'s hideout. Experience the baddest video game ever. Defy physics with Michael\'s dancing! You never lose your cool. See it and be it - Michael Jackson\'s Moonwalker!', '/images/sms/4947/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/6/23216_front.jpg', NULL, NULL),
(4948, 'Micro Machines', NULL, NULL, 'It\'s miniature mayhem! Race micro cars, choppers, boats, tanks and formula one! Whiz around the spectacular scale mini tracks. Can you handle sand pits, pool tables and school desk courses? It\'s excellent!', '/images/sms/4948/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b9/Micro_Machines_logo.png', NULL, NULL),
(4949, 'Miracle Warriors: Seal of the Dark Lord', NULL, NULL, 'Fate calls thee to bar evil\'s way! The Dark Lord Terarin has removed the Golden Seal from the Pandora Passage to let monstrous creatures roam the Five Lands. An ancient prophecy foretells of four brave warriors destined to battle Terarin and return the Seal to its rightful place. Art thou the one fated to lead the Miracle Warriors? Dost noble blood flow in thy veins? Join now in a fantasy role-playing quest across time to a world of swords and sorcery. Three companions await you... if you can wake them from slumber.', '/images/sms/4949/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c9/MiracleWarriorsCoverArt.jpg', NULL, NULL),
(4950, 'Missile Defense 3-D', NULL, NULL, 'War has been declared between two super powers. At play are real nuclear missiles and the outcome looks dim. If their missiles make contact, there\'s no chance for survival. Luckily there\'s hope. You and The Eliminator, the only anti-nuclear laser in operation. Aboard a fugitive space station, you\'re armed for intervention and your mission is clear: stop all nuclear missiles. But it won\'t be easy. Because those missiles are being launched at you, too. So play for keeps. This is the most important challenge you may ever face.', '/images/sms/4950/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/8/50368_front.jpg', NULL, NULL),
(4951, 'Monopoly (SMS)', NULL, NULL, 'Monopoly is fantastic fun for the entire family. You can play against the computer - with skill levels you select - or get up to 10 players in on the action. It has special features such as a built-in battery so you can save games and play them later. Roll the dice with a push of a button. Your token comes to life and moves around the board! Buy companies and properties. Increase the value of your properties by building houses and hotels. Land on "Chance" or "Community Chest" and pick a card. With strategy and luck, you can become a winner. But you never know how the dice will roll!', '/images/sms/4951/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/5/5285_front.jpg', NULL, NULL),
(4952, 'Montezuma\'s Revenge', NULL, NULL, 'Once you start this game, you are PANAMA JOE. In 11 graduated levels of gameplay, you race against perils and time through the 100-room mazes of Emperor Montezuma\'s death-dealing pyramids. Your goal: to collect a fortune in hidden Aztec loot, rack up points - and stay alive! So grab a torch and enter the first pyramid. But keep your eyes and ears open... or you could be the next victim of MONTEZUMA\'S REVENGE!', '/images/sms/4952/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a1/MontezumasRevengeCoverArtC64.jpg', NULL, NULL),
(4953, 'Mortal Kombat (SMS)', NULL, NULL, 'PREPARE YOURSELF! The #1 arcade hit is here: from Sub-Zero, Rayden and the rest of the Kombat Warriors to the grueling endurance and intense mirror matches! Execute bone-shattering combos and awesome finishing moves! Defeat the half-human dragon Goro, and destroy the shape-changing Shang Tsung to become the Supreme Mortal Kombat Warrior!', '/images/sms/4953/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/0/7/21107_front.jpg', NULL, NULL),
(4954, 'Mortal Kombat II (SMS)', NULL, NULL, 'NOTHING, NOTHING CAN PREPARE YOU! The fierce kombatants of the #1 arcade smash gather for Mortal Kombat II. All yours to Kommand. Brutal moves, friendships, Babalities, hidden surprises, crushing combos, and outrageous finishing moves. Let the Kombat Kontinue...', '/images/sms/4954/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/4/20144_front.jpg', NULL, NULL),
(4955, 'My Hero', NULL, NULL, 'A bunch of seedy punks - complete with mohawks - try to steal your girl. It\'s a new variation on the old "Boy loses Girl" theme. Only it\'s more like "Boy loses life, if he doesn\'t get Girl back." Battle knife throwers, ferocious bulldogs, flying bottles, even the gang leader - whose name happens to be Mohikan. If it all seems hopelessly overwhelming, take heart. You\'re a high-ranking kung fu master. So you do have incredible martial arts skills in your favor. But then again, you don\'t have your girl. The punks do.', '/images/sms/4955/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/5/50375_front.jpg', NULL, NULL),
(4956, 'Nekyuu Kousien', NULL, NULL, 'A baseball game developed and published by Sega for the Sega Master System. It was never released outside of Japan.', '/images/sms/4956/cover.jpg', 'https://static.giantbomb.com/uploads/scale_tiny/2/23093/2359320-nekyuu_koushien.jpg', NULL, NULL),
(4957, 'The New Zealand Story', NULL, NULL, 'Tiki the kiwi stars in this adventure of a lifetime in this arcade No 1 Hit. Watch the feathers fly as you guide Tiki through the islands of NewZealand solving mazes, defeating fiendish foes, rescuing his kiwi friends and finally facing the evil Wally Walrus in the ultimate battle. Will you be the next dish on the fresh kiwi menu? Only time will tell and it is running out fast!', '/images/sms/4957/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e0/TheNewZealandStory_arcadeflyer.png', NULL, NULL),
(4958, 'Ninja Gaiden (SMS)', NULL, NULL, 'The Dragon Ninja village has been massacred! The powerful scroll of the Bushido has been stolen! You are Ryu Hayabusa, last of the Dragon Ninja, and you must find the Bushido before it can be used to unleash evil across the Earth!', '/images/sms/4958/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/71/Ninja_Gaiden_logo.png', NULL, NULL),
(4959, 'The Ninja', NULL, NULL, 'The Dragon Ninja village has been massacred! The powerful scroll of the Bushido has been stolen! You are Ryu Hayabusa, last of the Dragon Ninja, and you must find the Bushido before it can be used to unleash evil across the Earth!', '/images/sms/4959/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/7/29387_front.jpg', NULL, NULL),
(4960, 'Olympic Gold: Barcelona \'92', NULL, NULL, 'Experience for yourself the thrill and excitement of competing in seven spectacular Olympic track, field and pool events. Olympic Gold, the challenge - to win you\'ll need all the strength, skill and determination you can muster!', '/images/sms/4960/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/8/56148_front.jpg', NULL, NULL),
(4961, 'The Ottifants', NULL, NULL, 'All is not well for Bruno, the baby Ottifant. A father captured by aliens? Or so our Otti-infant imagines as he follows the trail of sweets that will lead him to his abducted parent. It\'s a trail of peril and adventure - terrifying toys, a blood-chilling basement and an office of high-tech horror!', '/images/sms/4961/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/3/30833_front.jpg', NULL, NULL),
(4962, 'Out', NULL, NULL, 'Brace yourself for the most realistic racing experience yet. And to play, you\'ve got to have what it takes: NERVE, SKILL and BRAINS. NERVE - you\'re behind the wheel of a supertuned race car with one speed only: fast. SKILL - you\'re maneuvering a car that can nearly reach a simulated 270 KMH. BRAINS - because you\'re in control of your car\'s speed and handling at a dangerous pace, you have to use your head and not just your hands to survive. So get geared for the ride of your life and stay alert. The track may look terrific, but at these speeds anything can turn into a danger zone.', '/images/sms/4962/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/04/Out_Run_Coverart.png', NULL, NULL),
(4963, 'OutRun 3-D', NULL, NULL, 'Strap yourself in and take a 3D ride on the wild side. Sega\'s Out Run 3D is so close to reality it will leave you breathless! As your car whips around treacherous curves and over hills, you can almost feel the engine screaming and the wind whipping through your hair!\n', '/images/sms/4963/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/9/90009_front.jpg', NULL, NULL),
(4964, 'OutRun Europa', NULL, NULL, 'Strap yourself in for a life or death ride. In hot pursuit of enemy agents, blaze a trail across Europe in the world\'s most powerful vehicles. Only your skill and determination will get you all the way to your destination - Berlin!\n', '/images/sms/4964/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/5/30905_front.jpg', NULL, NULL),
(4965, 'Pac-Mania', NULL, NULL, 'Pac-Man faces his toughest challenge yet in the 3D scrolling playfields of Pacmania. With exciting worlds to discover, secret levels to find and armed with new super BOUNCE power, Pac-Man has to use speed and cunning to outwit those creeps, Clyde, Sue and Funky and get on with the serious business of... eating!!!', '/images/sms/4965/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/70/Pac-Mania_cover.jpg', NULL, NULL),
(4966, 'Parlour Games', NULL, NULL, 'Choose from the exciting challenges and action of Billiards, Darts or World Bingo! In Billiards, choose nine-ball or rotation. Play the Dart games 301 or 501. Or test your luck in a high-stakes game of World Bingo.', '/images/sms/4966/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/7/50387_front.jpg', NULL, NULL),
(4967, 'Penguin Land', NULL, NULL, 'Welcome to Penguin Land. Your mission: bring fragile eggs back to safety to home from a foreign land. Your journey will take you deep into mysterious caverns where dangerous animals await to attack and destroy your eggs.', '/images/sms/4967/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/36/Penguin_land.png', NULL, NULL),
(4968, 'PGA Tour Golf', NULL, NULL, 'A hush comes over the crowd surrounding the 18th hole. After 27,032 yards, 71 holes, and four grueling rounds, a 23-foot birdie putt separates you and your first tournament victory. This is the big-time. PGA TOUR Golf puts all the excitement, fun, challenge and rewards of the real PGA TOUR right in your hands!', '/images/sms/4968/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/73/Tiger_Woods_PGA_Tour_current_logo.jpg', NULL, NULL),
(4969, 'Phantasy Star', NULL, NULL, 'The time: Space Century 3240. The place: The Algol Star System. It began when King Lassic turned evil and let hordes of hideous, magical creatures run amok on the three planets. When her brother was killed, Alis vowed to avenge his death and put an end to Lassic forever. Join her in a journey across time and space to worlds where creatures speak... where magic and science combine to take you on the ultimate video quest. PHANTASY STAR IS TOTAL ADVENTURE ROLE PLAYING with towns full of people and shops... 16 level dungeons full of traps and treasure... three companions who will help you if you find them and some of the most awesome graphics ever put in a video game.', '/images/sms/4969/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7b/Phantasy_Star_logo.png', NULL, NULL),
(4970, 'Pit-Fighter', NULL, NULL, 'In the Pit, it\'s mean, it\'s tough and it\'s no place for the fainthearted.  Take on all comers - the fighting\'s below the belt and rules don\'t exist.  Survival and the prize are all that matter.  Welcome to the world of the Pitfighter!', '/images/sms/4970/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/8/21498_front.jpg', NULL, NULL),
(4971, 'Pit Pot', NULL, NULL, 'Two super hits in one!  Turn back the invaders and save the galaxy in ASTRO WARRIOR.  Can you find your way safely through the magical mazes in PIT POT?', '/images/sms/4971/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/85/PitPotJPBoxShotSegaMasterSystem.jpg', NULL, NULL),
(4972, 'Populous', NULL, NULL, 'Now it\'s your chance to play God! Create the world in a week and destroy it in a heartbeat. Conquer 5,000 hostile worlds. Unleash floods, volcanos, swamps and earthquakes.', '/images/sms/4972/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/64/Populous-the-beginning.png', NULL, NULL),
(4973, 'Poseidon Wars 3-D', NULL, NULL, 'Battle Stations! Battle Stations! Your country is being attacked. You\'ll be fighting on the U.S.S. Poseidon; an armor-plated attack cruiser with radar, sonar, 76mm cannons and surface-to-surface missiles. First come the training rounds. They\'ll throw everything they have at you... jets, cruisers, torpedoes, cannons. And then the fun really starts! Combat missions! You\'re on the open seas. You have blips on the radar. Line up your gunsights and let \'em have it. You pick up an enemy cruiser on your sonar. Get ready with an armor piercing missile and send them to Davey Jones locker. If you complete your missions, you will be awarded with the Navy\'s highest honor... a promotion to Fleet Admiral.', '/images/sms/4973/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f1/PoseidonWars3DCoverArtSegaMasterSystem.jpg', NULL, NULL),
(4974, 'Power Strike', NULL, NULL, 'Your planet has been overrun by the meanest mutant vegetation ever created in a genetics laboratory. It\'s taken over buildings, labs, fighter craft... even people! And it\'s getting bigger... and meaner... with each passing second. But it hasn\'t taken over you. Now, you\'re going in on a mission to deliver a POWER STRIKE! You have a special attack ship with the ability to use weapons you free from the ground. The action is hot and heavy. The enemy is coming faster than you could ever believe! So fight hard and fast. If you don\'t turn the mutated vegetation into a giant tossed salad, they\'ll turn you into toast!', '/images/sms/4974/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/5/50395_front.jpg', NULL, NULL),
(4975, 'Power Strike II', NULL, NULL, 'A lone pilot puts on his flight gear and gets ready. His life has been leading up to this moment - he knows that the time has come to take on the air pirates sky forces! The battle has begun. Are you ready to help in the fight to free the skies from the clutches of the air pirates?', '/images/sms/4975/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/9/27479_front.jpg', NULL, NULL),
(4976, 'Predator 2', NULL, NULL, 'The Predator is in town with a few days to kill! It comes from a distant world... Invisible, it\'s armed with powerful  weapons unlike anything we know. It mercilessly stalks humans.. for sport. As Lt. Harrigan, it\'s up to you to rescue innocent people from the clutches of the evil drug gangs - before they become trophies of the Predator. Search the streets, rooftops and subways until you confront it. The Predator is on the hunt... find him before he finds you!', '/images/sms/4976/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a7/Aliens_vs._Predator_2_Box_Cover.jpg', NULL, NULL),
(4977, 'Prince of Persia (SMS)', NULL, NULL, 'Taken from hundreds of movie clips, the animated sequences are so uncannily human you will be addicted in seconds. Your sword fighting skills will be tested to the full in this amazing puzzle solving challenge. A multitude of secret passages, fantastic rooms, violent opponents and magic potions await you in a bid to foil the evil Grand Vizier Jafar and rescue the beautiful princess to become the PRINCE OF PERSIA.', '/images/sms/4977/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0c/Princeofpersialogo.jpg', NULL, NULL),
(4978, 'Pro Wrestling (SMS)', 'Gokuaku Doumei Dump Matsumoto', NULL, 'ro Wrestling, known as Gokuaku Doumei Dump Matsumoto (極悪同盟 ダンプ松) in Japan, is a professional wrestling video game released for the Sega Master System in 1986 by Sega. It centers around tag team wrestling, with four duos that players can select and guide to various championship titles around the world. Pro Wrestling was the only professional wrestling title released for the Master System in United States.\n\nIn Japan, the game is the home counterpart to the Sega arcade title Dump Matsumoto (released outside Japan as Body Slam). Like the arcade game, it features female wrestler Dump Matsumoto and her stable Gokuaku Doumei. In addition to having an entirely different, all-female roster, the Japanese version also has a final hidden matchup against aliens on another planet.', '/images/sms/4978/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/2/29/Sms_pro_wrestling_box.jpg/220px-Sms_pro_wrestling_box.jpg', NULL, NULL),
(4979, 'Psychic World', NULL, NULL, 'Dr. Knavik needs you to use his special "ESP Booster" to rescue young Cecile. She and her sister, Lucia, were his assistants, and the monsters Dr. Knavik kept for experiments escaped with her! Venture out into this frightening, mystical, often beautiful world, fend off the many creatures and dangers, and save poor Cecile!', '/images/sms/4979/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6d/Psychic_World_Cover.jpg', NULL, NULL),
(4980, 'Psycho Fox', NULL, NULL, 'You\'re Psycho Fox, an extraordinary fox that goes out to save the world from the wicked Madfox Daimyojin. He\'s the powerful, evil fox that sends out all sorts of bizarre creatures to conquer the world. Watch out for those trick stairways and disappearing bridges! The Madfox has completely changed the landscape - just to give you a hard time! Sounds like a tough trek? Don\'t give up yet! You have the power to transform into other animals to help you get through certain obstacles. Remember, you\'re not an average fox, you\'re Psycho Fox!', '/images/sms/4980/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1b/PsychoFoxUSBoxShotSMS.jpg', NULL, NULL),
(4981, 'Putt & Putter', NULL, NULL, 'The waves crash against the shore as you tee up. Ahead in the distance... pinball bumpers? An outrageous combination of miniature golf and pinball! It\'s Putt & Putter!', '/images/sms/4981/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/1/30771_front.jpg', NULL, NULL),
(4982, 'Quartet', NULL, NULL, 'If you hate aliens, you\'ll love Quartet! You see, space colony Number Nine is being threatened by an invasion of the most dangerous kind. Alien attack. And the place is crawling with them. These vicious, vile parasites have even managed to confiscate the casket of the late great Queen Cynthia. It\'s your job to exterminate these treacherous creatures. To return the casket to its hallowed tomb. And save the colony from certain collapse. You\'ll have special equipment to help you along the way. Like a supersonic jet engine, a special bomb, missiles and a magic key. But time is running out. So don\'t just stand there thinking about it. Get on it. And get rid of this gruesome group. For good!', '/images/sms/4982/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/2/23252_front.jpg', NULL, NULL),
(4983, 'R-Type', NULL, NULL, 'The galaxy is in deep peril: foul creatures from the evil Bydo Empire have warped across space to invade and conquer our planet! There is only one hope for victory. The Earth Defense League has chosen you to pilot R-9, a nuclear-powered space fighter that can cut through invading aliens faster than a light saber through butter. Fly R-9 through 8 exciting levels of high-powered action. Use your plasma gun to rip through armies of nasty creatures and their deadly machines. And when the going gets really tough, pick up Droid Units to make your ship even harder hitting!', '/images/sms/4983/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2f/R-Type_arcadeflyer.png', NULL, NULL),
(4984, 'R.C. Grand Prix', NULL, NULL, 'Get ready to rev up your motors, hit the dirt, and become "World Champion Remote Control Racer"!', '/images/sms/4984/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/4/50404_front.jpg', NULL, NULL),
(4985, 'Rambo: First Blood Part IISecret Command', NULL, NULL, 'You are Rambo, the super hero of the movies. And you come to life on your own screen. You must go deep into enemy territory to rescue your comrades from concentration camps. Blow those camps. And escape with your skin. It\'s no picnic. You\'re menaced by infantry. Artillery. Flame throwers and rocket launchers. Everything the enemy can throw at you. So you must use every tactic at your command. Your weapons? Your M-60. A supply of arrow-bombs. Your savage strength. And steel nerves. Play the game by yourself. Or with your partner. Alone or together, you\'ll find yourself in the middle of enough color and action for a battalion to take on. And remember. You take no prisoners.', '/images/sms/4985/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/9/41969_front.jpg', NULL, NULL),
(4986, 'Rambo III', NULL, NULL, 'Colonel Trautman has been captured by the Soviet Forces in Afghanistan. The C.I.A. is ready to leave him there. They are afraid a rescue mission will cause an international incident. You don\'t care what it causes. Trautman is your friend... and you\'re going in to get him back! For weapons you have a Sega Light Phaser with the power of an AK-47 and the blast of a hand grenade. But the Soviets know you are coming and they\'re armed and waiting! Gunship helicopters. Spetsnaz troopers. Their meanest fighters. But you\'re Rambo, the eternal warrior. If anyone can beat the odds and rescue Trautman, it\'s you. But this battle won\'t be easy. After all, you\'re the one they called expendable...', '/images/sms/4986/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/51/Rambo_III_Coverart.png', NULL, NULL),
(4987, 'Rastan', NULL, NULL, 'You are Rastan, an iron muscled barbarian from the cold northlands. A bounty hunter by trade, you fear no man or dark, slavering beast! For you are a master of every edged weapon. Now, a king has given you a quest. Rescue his daughter from the deepest reaches of Semia; a land where even villains fear to tread. Succeed, and wealth beyond your wildest dreams shall be the reward! Take destiny into your own hands. Journey through seven rounds into the darkest heart of Semia, using magical weapons, armor and potions you find and win on the way. At every turn you\'ll encounter nightmarish creatures determined to stop you. But beware... the king has sent over 100 men into Semia... and each has met his doom! Will you?', '/images/sms/4987/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/6c/RastanSaga_arcadeflyer.png', NULL, NULL),
(4988, 'Reggie Jackson Baseball', NULL, NULL, 'Ever wanted to play in the big leagues? Now is your chance. Step up to the plate with Sega\'s Reggie Jackson Baseball. It\'s so real you\'ll be grabbing for the hotdogs as you hammer \'em out of the ball park! Play against the computer or with a friend. Take your pick of twenty-six American or National City teams. You can choose a mini two-out-of-three tournament, go for the Series or test your batting skills in the Home Run contest. Reggie Jackson Baseball gives you the power to select your pitchers and pitches, to bat high and low, to lead off or try to steal your way around the bases. Is there a man leading off on second? fake a pitch and catch him off base. Move fast and snatch a ground ball from the infield for a double play! When the game is over, you\'ll get tips from Reggie himself. Go far enough and win the Series! It\'s baseball action like you\'ve never seen before, only from Sega.', '/images/sms/4988/cover.jpg', 'https://upload.wikimedia.org/wikipedia/commons/2/28/Reggie_Jackson_at_Dodger_Stadium_2010.jpg', NULL, NULL),
(4989, 'Rescue Mission', NULL, NULL, 'It\'s war... and your buddies are trapped behind enemy lines! Before they can escape, they urgently need medical attention... and desperately need your help! You\'re an Army sharpshooter. You have the Sega Light Phaser and lightning-fast reflexes. Now, you are going on a hero\'s mission to save your friends. With only a railroad handcart for transportation, you\'re taking three combat medics deep into enemy territory. They\'ll take care of your friends. Your job: shoot down everything the enemy throws at them... and you!', '/images/sms/4989/cover.jpg', 'https://upload.wikimedia.org/wikipedia/commons/7/71/Phoenix_Rescue_Mission_logo.jpg', NULL, NULL),
(4995, 'Road Rash', NULL, NULL, 'The Challenge: Race for your life - there are no rules, no speed limits, and no going back! Watch out for roadblocks, oil spills and the cops! Reach speeds of at least 150mph whilst punching, kicking and clubbing your opponent before he gets you first. The adrenalin is pumping - and he\'s waiting for you!', '/images/sms/4995/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/1/31021_front.jpg', NULL, NULL),
(4996, 'Rocky', NULL, NULL, 'You\'re Rocky. A fighter with a dream, to be the best boxer the world has ever seen. The chances were one in a million, but you made it to the most exciting event in boxing: The World Class Heavyweight Championship. In the ring, your first fight is your most feared. And you\'ll have to master your uppercut to knock-out the never-beaten brawn of Apollo, the reigning champion. Then, train diligently. Because once you\'re champion, the contenders will come forth like crazy. And they\'re hungry for your defeat. But you\'re a powerful fighter with a deadly straight-on and a heavy hook that connects with sheer force. So play for keeps. This is the only title you\'ve got and every ruthless fighter wants it.', '/images/sms/4996/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/18/Rocky_poster.jpg', NULL, NULL),
(4997, 'Running Battle', NULL, NULL, 'A neighboring city has fallen into the hands of the sinister "M" and his "Soldiers of the Darkness." Get inside the "Dark Zone" and punch, kick and blast your way through to the final conflict!', '/images/sms/4997/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e1/RunningBattleCoverArtSegaMasterSystem.jpg', NULL, NULL),
(4998, 'Sagaia', NULL, NULL, 'Darius was once a planet that boasted a highly advanced civilization, but fell into ruin after succumbing to the relentless assaults of Belser and his mysterious space aliens. Proco and Tiat, two survivors of Belser\'s evil quest, escaped and fled to the planet Orga where they began a new civilization. Centuries later, the descendants of Proco and Tiat received a strange radio signal emitted from a distant part of their galaxy. To their amazement, it was a May Day signal from another line of Darius descendants who also had survived Belser\'s terrible assault. Team with the Organites aboard the spacecraft Silver Hawk and blast with them across the galaxy to rescue what remains of the once-proud civilization of Darius.', '/images/sms/4998/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/9/50419_front.jpg', NULL, NULL),
(4999, 'Satellite 7', NULL, NULL, 'Satellite 7 is an Action game, developed and published by Sega,  which was released in Japan in 1985.', '/images/sms/4999/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/0/306560_front.jpg', NULL, NULL),
(5000, 'Scramble Spirits', NULL, NULL, 'The Earth has been attacked by extra-terrestrial forces. Their weaponry is fierce and their numbers are almost too great to count. It will take a couple of fearless fighter pilots to bring them to defeat. Feel up to the job?', '/images/sms/5000/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/6/305656_front.jpg', NULL, NULL),
(5001, 'Sega Chess', NULL, NULL, 'Patience, cunning and a desire to be the best - the keys to becoming a master of chess. Sega Chess gives even the most seasoned player the game of a lifetime!', '/images/sms/5001/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/1/30821_front.jpg', NULL, NULL),
(5002, 'Sega World Tournament Golf', NULL, NULL, 'Challenging courses, a variety of modes and realistic gameplay - Sega World Tournament has it all!', '/images/sms/5002/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/9/306569_front.jpg', NULL, NULL),
(5003, 'Sensible Soccer', NULL, NULL, 'Take charge of your favourite club or national team from all over Europe in a whole host of different cup and league competitions.', '/images/sms/5003/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/4/30844_front.jpg', NULL, NULL),
(5004, 'Shadow Dancer', NULL, NULL, 'A violent terrorist group is trying to foil a crucial space mission. You, as Takashi, the noble Ninja warrior, attempt to take them out using your death stars, your mighty sword and Ninjutsu magic!', '/images/sms/5004/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e1/ShadowDancer_Arcade01.jpg', NULL, NULL),
(5005, 'Shadow of the Beast', NULL, NULL, 'From beyond the edge of darkness the warrior cries revenge. Shadow of the Beast is unleashed on the Master System in a superlative arcade adventure. Relentless combat as the Beast battles over 100 different alien forms in eight hostile regions of a supernatural world. It feels so real - you can almost taste knuckle!', '/images/sms/5005/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/90/Shadow_of_the_beast_cover_art.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(5006, 'Shinobi', NULL, NULL, 'You\'re Jo-Musashi, a mild-mannered martial arts instructor. But you have another job as well. When duty calls, you\'re a Master Ninja! Your mission: An evil terrorist network, the Ring of Five, has kidnapped the children of the world\'s leaders! You must get the hostages back... and defeat the Ring of Five! They\'re waiting for you with gunmen, thugs, mongos and green ninjas. But you alone have the power of Ninja Magic!', '/images/sms/5006/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Shinobi_Sega_logo.png', NULL, NULL),
(5007, 'Shooting Gallery', NULL, NULL, 'If you think this is just another shoot \'em up game, think again. Nothing demands more skill, more daring, more intense gameplay than SHOOTING GALLERY! And hopefully, you\'ve got what it takes to survive. A keen eye. A steady hand. And the invincible Sega Light Phaser that actually records misses. If you aim straight and aim on target, just maybe you\'ll be able to shoot everything from iron-clad Spaceships to incredibly fast Blimps. But don\'t despair if the going gets tough. Because it gets tough for everyone.', '/images/sms/5007/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/8/30768_front.jpg', NULL, NULL),
(5008, 'Slap Shot', NULL, NULL, 'Get all of the hard-hitting excitement of real ice hockey with "Slap Shot"! Shooting, passing, and teamwork on offense, and lots of checking, blocking and general chaos on defense. Play an Exhibition game, or enter the Tournament and play against the top teams in the world! Watch out for the other team\'s goons, though - they like to fight. If you get in a brawl and come out on the losing end, you\'ll have 2 minutes in the penalty box to lick your wounds. Accept the challenge - take on and defeat the best in hockey. Once you start, you\'ll be "hooked"!', '/images/sms/5008/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a8/Slap_Shot_Cover.jpg', NULL, NULL),
(5009, 'Super Smash TV (SMS)', NULL, NULL, 'Congratulations! You\'re the next lucky contestant on the game show with the ultimate in prizes... YOUR LIFE! Pick six futuristic weapons and defeat hordes of cyborg mutants, power orbs, assault tanks and the 30-ton mutoid man!', '/images/sms/5009/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/34/SmashTV_flyer.jpg', NULL, NULL),
(5010, 'The Smurfs 2: Travel the World', NULL, NULL, 'Inquisitive Smurf and Smurfette have broken the magic crystal and now they are being taken off to various parts of the world. Collect all the crystals to be found along your route. To reveal them, brave the sea lions of the North Pole, the Indians of America, and the octopuses of the deep... Only after you have smurfed all these challenges and many others will you be able to return to the village...', '/images/sms/5010/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/3/31063_front.jpg', NULL, NULL),
(5011, 'Snail Maze', NULL, NULL, 'Dear Sega customer,', '/images/sms/5011/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/2/272412_front.jpg', NULL, NULL),
(5012, 'Solomon no Kagi - Oujo Rihita no Namida', NULL, NULL, 'You and Dana, the wizard of Lyrac, must unlock Solomon\'s scroll of secrets to restore peace in the constellations. With Dana\'s magic, fire, and mystical powers, you will help release the imprisoned Princess of the Fairies and harness the evil forces within the constellations. But first, you need the key! Solomon\'s Key!', '/images/sms/5012/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/5/294845_front.jpg', NULL, NULL),
(5013, 'Sonic Chaos', NULL, NULL, 'Dr. Robotnik\'s stolen the red Chaos Emerald, and it\'s up to Sonic The Hedgehog to get it back! As Sonic or "Tails" the two-tailed fox, you\'ll zip through the Zones, using your quick moves and quicker thinking to collect rings and evade Robotnik\'s latest batch of badniks!', '/images/sms/5013/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/0/22370_front.jpg', NULL, NULL),
(5014, 'Sonic Spinball', NULL, NULL, 'From slimy sewers to monstrous machine rooms. Dr. Robotnik\'s latest fortress is a giant pinball machine! Will it withstand a Sonic spin-vasion? Bounce from giant flippers and hissing steam vents. Rev through dizzying loops and up death-defying ramps!', '/images/sms/5014/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/6/30876_front.jpg', NULL, NULL),
(5015, 'Sonic the Hedgehog', NULL, NULL, 'Bust the video game speed barrier wide open with Sonic The Hedgehog. Blaze by in a blur using the Super Sonic Spin Attack. Plummet down tunnels and spin through space. Bounce around till you\'re dizzy in a pinball machine. You\'ve never seen anything like it!', '/images/sms/5015/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f7/SonicSeriesLogo.png', NULL, NULL),
(5016, 'Sonic the Hedgehog 2', NULL, NULL, 'Sonic\'s back in action! Sonic\'s back for another 2 fast, 2 cool adventure! Dr. Robotnik has transformed South Island\'s animals into metal robots and kidnapped Sonic\'s best friend "Tails" the Fox. Blast into action with Sonic\'s famous Super Spin Attack to recover the Chaos Emeralds, squash Robotnik and free Sonic\'s friends from their Prison Eggs.', NULL, 'https://upload.wikimedia.org/wikipedia/en/9/9f/Sonic2_European_Box.jpg', NULL, NULL),
(5017, 'Space Gun', NULL, NULL, 'From a crippled starship at the edge of the galaxy comes a cry for help. Alien monsters have taken over and it\'s up to you to save what human crew remains! Choose your own path down dark corridors and through deadly arenas in non-stop shooting action!', '/images/sms/5017/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/89/Space_Gun_Cover.jpg', NULL, NULL),
(5018, 'Space Harrier 3-D', NULL, NULL, 'The intergalactic warrior Space Harrier returns... in an all-new 3D adventure! The peaceful Land of the Dragons is again under attack. Evil creatures fill the land and sky. Euria, the magnificent white dragon, is being held prisoner in a diabolical trap. Only you, the Space Harrier, can set him free. But this time, the challenge is greater than ever before! Put on your SegaScope 3D Glasses. The screen will come alive with new 3D graphics, enemies and wild new battle scenes! Only you stand between the peaceful dragons and defeat. Get ready for the battle of a lifetime!', '/images/sms/5018/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/00/Space_Harrier_3-D_Cover.jpg', NULL, NULL),
(5019, 'Special Criminal Investigation', NULL, NULL, 'Your mission is to track down, chase and apprehend the dangerous criminals. It\'s FASTER - explosive power sends you bulleting through various terrains - hold the line or plough the fields. It\'s TOUGHER - the criminals wield some heavy hardware - but so do you! You can shoot but you must dodge their flak... heavy gunfire, trucks unloading their cargo onto your bonnet... it\'s the meanest pursuit game to hit the micro screen! The extra features will leave you gasping for extended play - weather changes, bodyguard squads, grenade-lobbing bikers, gun-choppers... just play it! We dare you to stop!', '/images/sms/5019/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b1/Special_criminal_investigation_arcadeflyer.png', NULL, NULL),
(5020, 'Speedball', NULL, NULL, 'The Sport Of The Future!', '/images/sms/5020/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/2/7/50427_front.jpg', NULL, NULL),
(5021, 'Speedball 2', NULL, NULL, 'Speedball 2: A violent quasi-legal future sport with one rule - slam a solid steel ball into your opponent\'s goal. The only thing tougher than the brutal bloodsport is the thugs who play it. And they don\'t come any tougher than Brutal Deluxe, new faces at the bottom of the league, thirsting for blood and hungry for success!', '/images/sms/5021/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/5/27575_front.jpg', NULL, NULL),
(5022, 'SpellCaster', NULL, NULL, 'You are Kane, the SpellCaster warrior of Summit Temple. You have mastered the art of shooting Ki Force from your fingertips. With magic spells you have the power to call down the strength of the Gods! Now an army of evil is sweeping the countryside, destroying temples and villages. You have been called into battle to discover who the enemy is... and what is at the heart of their evil plans. It\'s an adventure that will take you above and below ground, across time, space and even into the Land of the Dead! As you battle strange creatures and gain the use of magical weapons, you\'ll learn the truth behind the attacks and much about your destiny as an eternal warrior of truth and justice! Live through the final battle and you\'ll discover what it really means to be called SpellCaster!', '/images/sms/5022/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/0/50430_front.jpg', NULL, NULL),
(5023, 'The Amazing Spider-Man vs. The Kingpin (SMS)', NULL, NULL, 'The 8-bit Sega Master System version is noted as one of the last Master System games sold in North America. It had the same basic format and storyline as the 16-bit version, with redesigned levels, cutscenes (that included a cameo from Doctor Strange) and even on the easiest setting was seen as being difficult to complete. In this version Mary Jane wouldn\'t be kidnapped but still appear at the end of the game if players attain the best ending.\n\nA nearly identical port was also released for the Sega Game Gear portable system.', '/images/sms/5023/cover.png', 'https://play-roms.com/sites/default/files/packshots/sega-master-system/spider-man-vs.the-kingpin-usa-europe.png', NULL, NULL),
(5024, 'Streets of Rage', NULL, NULL, 'Adam Hunter, Axel Stone and Blaze Fielding are three ex-cops that are trying to save their city from the evil crime syndicate that has taken it over. Choose one of them and battle with bare hands, or any weapon you can find... as you walk the Streets of Rage!', '/images/sms/5024/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d1/Streets_of_Rage_logo.png', NULL, NULL),
(5025, 'Streets of Rage 2', NULL, NULL, 'New thrasher Skate hunter joins ex-cops Axel Stone and Blaze Fielding in an all-out gang war against street punks, bikers, ninja and professional fighters armed with high-tech weapons! Use your bare fists, or grab a knife or a lead pipe and leap into the action!', '/images/sms/5025/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/a/a3/Streets_Of_Rage_2_-EUR-.PNG', NULL, NULL),
(5026, 'Strider (SMS)', NULL, NULL, 'The earth is under siege --- Grand Master Meio has unleashed his diabolical creations on an unsuspecting world.  Strider Hiryu faces teh wave of terror alone, and needs your help to wipe out the threat!  The Master awaits!', '/images/sms/5026/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/54/Strider_Hiryu_arcade_flyer.png', NULL, NULL),
(5027, 'Strider II', NULL, NULL, 'Strider, athletic commando and ultimate warrior returns!  This time his mission is to cut through 5 hazard-packed levels in order to reach the evil Grand Master and save the Earth from destruction.  This time there will be NO LIMITS...NO MERCY...NO SURRENDER!', '/images/sms/5027/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/bb/US_Gold_Strider_II_ad.jpg', NULL, NULL),
(5028, 'Submarine Attack', NULL, NULL, 'The Meta-creature has returned to haunt the citizens of Balderia, who haven\'t yet recovered from their last encounter with the monster four years ago! Guide Admiral Mikan through the underwater dangers and into the enemy complex, and help him get rid of the monster for good!', '/images/sms/5028/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/7/306567_front.jpg', NULL, NULL),
(5029, 'Sukeban Deka II (SMS)', NULL, NULL, 'Sukeban Deka II: Shoujo Tekkamen Densetsu is an Adventure game, developed and published by Sega,  which was released in Japan in 1987.', '/images/sms/5029/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c6/Sukeban_Deka_Manga_1.jpg', NULL, NULL),
(5030, 'Summer Games', NULL, NULL, 'The ceremonial flame is lit, the pigeons released... the Summer Games have officially begun! Athletes from eight different nations are gathered here to display their various talents. You have the chance to outshine them all. Compete in swimming, diving, and track and field events. Choose a nation to represent and go for the Golden Medal, or even a new world record!', '/images/sms/5030/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/0/7/45707_front.jpg', NULL, NULL),
(5031, 'Super Kick-Off', NULL, NULL, 'Super Kick Off Captures all the thrills and exitement of the football field. Played at a blistering pace this is a true test of speed, control and footballing skill!', '/images/sms/5031/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/7/50437_front.jpg', NULL, NULL),
(5033, 'Super Monaco GP', NULL, NULL, 'Fly up the track on long straightaways, or downshift into neck-wrenching hairpin curves. Super Monaco GP sends you screaming around the most demanding tracks on earth in the hottest racecar ever built - the Formula 1. Choose your car\'s transmission. Slide through a practice run with an automatic transmission or battle rival drivers grinding gears to victory piloting a 3, 5, or 7-speed machine. The on-screen track display gives you the lay of the road and position of the other drivers. Super Monaco GP\'s World Championship sends you and your pit crew on a 16-race international circuit. Burn rubber with the best drivers around in a piston-pounding test of speed, road savvy, and endurance.', '/images/sms/5033/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2d/Super_Monaco_GP_Coverart.png', NULL, NULL),
(5034, 'Super Off Road', NULL, NULL, 'Super Off-Road is the ultimate off-road racing event. Four tough trucks speed around rough and ready tracks packed with pitfalls, power-boosters and prizes. No one knows the meaning of sportsmanship here. Have you got the skill and determination to come out on top?', '/images/sms/5034/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/93/Super_Off_Road_Racer_ZX_Spectrum_Inlay.jpg', NULL, NULL),
(5035, 'Super Racing', NULL, NULL, 'Super Racing is a Racing game, developed and published by Sega,  which was released in Japan in 1988.', '/images/sms/5035/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/6/306556_front.jpg', NULL, NULL),
(5036, 'Super Space Invaders', NULL, NULL, 'Space Invaders is the most famous video game ever! Now SUPER SPACE INVADERS has arrived with a host of amazing new features - wave after wave of weird and hostile aliens, fantastic multiway scrolling playfields, huge end of level mega monsters and secret levels for only the best to find! It\'ll drive you crazy, but you won\'t be able to leave it alone!', '/images/sms/5036/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0f/Space_Invaders_flyer%2C_1978.jpg', NULL, NULL),
(5037, 'Super Tennis', NULL, NULL, 'On your first serve, the ball explodes off your racquet like a fiery missile. Instinctively you move toward the net. Your opponent returns your serve, but you\'re ready for him. With lightning speed you raise your racquet and smash the ball. He never had a chance. You\'re the Tennis Ace!', '/images/sms/5037/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/4/7/50447_front.jpg', NULL, NULL),
(5039, 'Superman: The Man of Steel', NULL, NULL, 'Lois Lane has been kidnapped by Brainiac. The Doom Star orbits the Earth. The deadlist adversaries Superman has ever encountered are running amok. What greater challenge for The Man of Steel, his Heat Vision and the Might of his Super Punch?', '/images/sms/5039/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c9/Man_of_Steel_Box_Art.jpg', NULL, NULL),
(5040, 'Taz-Mania', NULL, NULL, 'Join TAZ, the Tasmanian devil as he whirls off in search of the world\'s biggest omelette. Nothing can stand in his way for long as he munches his way through an island filled with precarious plateaus, hostile jungles, eerie caves and crumbling ruins.', '/images/sms/5040/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/1/7941_front.jpg', NULL, NULL),
(5041, 'Tecmo World Cup \'93', NULL, NULL, 'Twenty-four teams from around the globe have come to participate in this soccer showcase. Pick one and match your skills against the computer in an exhibition match, take on a friend, or put it all on the line in the World Cup Tournament! The action never stops!', '/images/sms/5041/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/0/306570_front.jpg', NULL, NULL),
(5042, 'Teddy Boy', NULL, NULL, 'It\'s a video dream. Or nightmare. Depending on how well you\'re doing. Scramble from maze to maze - each more magnificent than the one before it - bumping off bugs, guppies, snails, dominos and more as you go. Grab precious points for tennis shoes, teddy bears, snails, and other identifiable objects. And try to avoid the ugly Den Den, a snapping dragon head. Or you\'ll be forced to wake up to reality. The colors are fantastic. Even the music is wild!', '/images/sms/5042/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/Teddy-Boy-Blues-arcade-flyer.jpg', NULL, NULL),
(5043, 'Tennis Ace', NULL, NULL, 'On your first serve, the ball explodes off your racquet like a fiery missile. Instinctively you move toward the net. Your opponent returns your serve, but you\'re ready for him. With lightning speed you raise your racquet and smash the ball. He never had a chance. You\'re the Tennis Ace!', '/images/sms/5043/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/13/Mario_Tennis_Aces.jpg', NULL, NULL),
(5044, 'Tensai Bakabon', NULL, NULL, 'Tensai Bakabon is an Adventure game, developed and published by Sega,  which was released in Japan in 1988.', '/images/sms/5044/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Tensaibakabon.jpg', NULL, NULL),
(5045, 'The Terminator (SMS)', NULL, NULL, 'In the near future, the worlds of Robocop and The Terminator merge into a single reality. You, as Robocop, must save mankind by destroying the Skynet super computer in the possible future in which machines rule the earth and Skynet is supreme.', '/images/sms/5045/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/70/Terminator1984movieposter.jpg', NULL, NULL),
(5046, 'T2: The Arcade Game', NULL, NULL, 'The #1 arcade shooting game of all time explodes onto Master System! You\'re a T-800 terminator with an awesome array of weapons: rapid-fire machine gun, shotgun, rockets and an M-79 grenade launcher. Blast endoskeletons and HK\'s... terminate the liquid metal T-1000 or be TERMINATED!', '/images/sms/5046/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/7/21167_front.jpg', NULL, NULL),
(5047, 'Thunder Blade', NULL, NULL, 'Get ready to take part in the greatest helicopter battle of the century with THUNDER BLADE! You\'re the Gunship Gladiator. You fly the Thunder Blade chopper. Some say you\'re unstoppable. This mission will put you to the test! The enemy has invaded your country. That makes you mad. So you\'re going to stop them... all by yourself! In cities... over deserts and oceans... in caves and through refineries... you\'re cutting loose with your cannons and dropping air-to-surface missiles from your skids. They\'ve got tanks, airpower and incredible super fortresses. But you have guts, a taste for glory... and the meanest fightin\' copter in the sky!', '/images/sms/5047/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/76/Thunder_Blade_arcade_flyer.jpg', NULL, NULL),
(5048, 'Time Soldiers', NULL, NULL, 'Team up with a friend and join a battle that crosses time and space. The evil space tyrant Gylend has attacked Earth and turned five of your friends into energy balls. As the leader of the Earth Command Troopers, your job is to track your friends down and get them back. The problem is, Gylend has scattered them across time in different parts of Earth\'s history. You have the D-Scanner... a device that can guide you through the river of time! You have shoulder-mounted cannons and access to even more powerful weapons. But Gylend has the might of the creatures of history turned against you! From cavemen to armored attack craft, all will fight you with everything they have. If you succeed in rescuing your friends, you will face the fiercest battle of all... Gylend. Only you stand between Earth and total defeat!', '/images/sms/5048/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5b/Time_Soldiers_arcade_flyer.jpg', NULL, NULL),
(5049, 'Tom and Jerry: The Movie', NULL, NULL, 'Oooooh, that mouse! If there\'s one thing Tom can\'t stand, it\'s a rascally rodent named Jerry, and if that mouse isn\'t careful, Tom is going to nab him. But Jerry is pretty tricky. So muster up all your feline courage, Tom, \'cause there\'s a dangerous little mouse in the house!', '/images/sms/5049/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/4/30824_front.jpg', NULL, NULL),
(5050, 'TransBot', NULL, NULL, 'Thwart an underground invasion with your transforming weaponry. The ground is scarred by craters, a reminder of the recent Dalaus invasion. And continuous acid rains give the sky an eerie irridescence. You are the only Transbot pilot left from the now defunct regime. So you must battle wave after wave of orbiting debris. To try to get to the notorious Dalaus artificial intelligence computer. Fortunately, your astro-plane can go through 6 different transformations. Turn into a robot warrior and more. By the time you transform, you should be able to penetrate the fortress of Dalaus. And rid the galaxy of her evil influence forever!', '/images/sms/5050/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/8/50458_front.jpg', NULL, NULL),
(5051, 'Trivial Pursuit: Genus Edition', NULL, NULL, 'Trivial Pursuit is the world\'s greatest and best selling board game. This Sega version incorporates everything that has helped make it so. Plus, Russell your animated and friendly question master, superb sound and color, wonderful screen background and over 2,000 brain teasing questions.', '/images/sms/5051/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/8/29818_front.jpg', NULL, NULL),
(5052, 'Ultimate Soccer', NULL, NULL, 'You\'re on the pitch, ready to kick off. The crowd is going crazy. The season has been long and challenging. You\'ve been up against a lot of teams and come out on top, and today\'s the day - to prove that you have the skill and determination to become the Ultimate Soccer champion!', '/images/sms/5052/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/92/Ultimate_Soccer_Coverart.png', NULL, NULL),
(5053, 'Vigilante', NULL, NULL, 'On the baddest streets of the city they know your name. You are lean and mean... the karate master they call the Vigilante! Your turf was left alone. Your friends and neighbors lived in peace. Until the Rogue gang got too big for their britches. You chilled, hoping things wouldn\'t get too rough. No such luck. They\'ve taken your girlfriend Maria, and there\'s only one thing you can do... get her back... anyway you can! You have fists of steel! Legs like pistons! And courage that just won\'t quit! You will need all three because the Rogues are waiting with knives, guns and a whole bunch of nasty punks. And you\'ll have to fight fast. If the Rogues make it back to their headquarters before you rescue Maria, all hope will be lost. But catch them first and you\'ll fight the leader of the Rogues. Win Maria... and your turf... will remain safe. Feel any pressure? No way. You\'re the Vigilante!', '/images/sms/5053/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/83/Vigilante_8.jpg', NULL, NULL),
(5054, 'Walter Payton Football', NULL, NULL, 'It\'s the snap!  You sweep to the right.  The quarterback hands you the ball.  You head for daylight as the linemen open a hole.  Suddenly, 250 lbs. of screaming tackle is heading your way.  He wants to make you splat city.  What will you do?  This game gives you the chance to find out.  With Walter Payton Football you can play against the computer, or against a friend, in a Monday Night Game or in a series on the Road to The Superbowl.  Choose from 28 west, central and eastern teams.  Offense and defense.  Should you run or pass?  Will a reverse throw \'em off guard?  In the middle of a hot series, you can save your standings with a Password save.  If you like football, then Sega\'s Walter Payton Football is the game for you!', '/images/sms/5054/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/8/50228_front.jpg', NULL, NULL),
(5055, 'Wanted!', NULL, NULL, 'The desperadoes are back! It\'s time for you to put on your silver badge, strap on your Light Phaser and restore peace to the quiet little western towns. It won\'t be easy... because this time the bad guys are gunning for you!', '/images/sms/5055/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/4/516254_front.jpg', NULL, NULL),
(5056, 'Where in the World is Carmen Sandiego?', NULL, NULL, 'Where in the world is Carmen Sandiego, and where has her gang of thieves taken the loot? You\'re the detective tracking down culprits in this globe-hopping mystery action game. And as you work your way up the 5 challenge levels from Rookie to Ace Detective, the mysteries get more complicated and your suspect and his henchmen become more aggressive, firing bullets and throwing knives you must duck on-screen. In each case, one of 10 elusive villains has stolen one of 90 national treasures and absconded to one of 30 foreign cities. Chase your suspect around the world, racing the clock and making crucial decisions: What city did he go to? Where will you investigate, the Embassy of the Warehouse? Collect pertinent facts from the special Almanac, and travel the globe till you\'ve got the goods on your crook. When you know whodunit, visit Interpol and bring your suspect to justice!', '/images/sms/5056/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8b/Where_in_the_World_Is_Carmen_Sandiego_1985_Cover.jpg', NULL, NULL),
(5057, 'Wimbledon', NULL, NULL, 'Control one of the world\'s top players, or enter yourself in the Tour and test your skill. Singles, Doubles, practice, four exciting tournaments - fast, heart-stopping action from beginning to end!', '/images/sms/5057/cover.svg', 'https://upload.wikimedia.org/wikipedia/en/1/1c/AFC_Wimbledon.svg', NULL, NULL),
(5058, 'Wimbledon 2', NULL, NULL, 'You started out at the bottom, an unknown name in a field of highly talented players. You worked your way up the ranks, playing in America, Australia and France. And now, the big day... the day you take on the best tennis players in the world for the Wimbledon Open Cup!', '/images/sms/5058/cover.svg', 'https://upload.wikimedia.org/wikipedia/en/1/1c/AFC_Wimbledon.svg', NULL, NULL),
(5059, 'Winter Olympics: Lillehammer 94', NULL, NULL, 'Winter Olympics offers you the ultimate experience in sports simulations. You\'ll race against the best in the world... and the clock... fighting for gold in a game where you\'ll face 10 spectacular events testing your speed, skill, strength and endurance to the limit. It\'s your chance to go for gold in the world\'s greatest winter sports spectacle!', '/images/sms/5059/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/86/Winter_Olympics_-_Lillehammer_94_Coverart.jpg', NULL, NULL),
(5060, 'Wolfchild', NULL, NULL, 'The world\'s most renowned biogenetic scientist has been kidnapped and brainwashed into creating an army of bloodthirsty mutant warriors. Suddenly the fate of all manking rests in the hands of his youngest son...and a top-secret mutating experiment known as "Project Wolfchild."', '/images/sms/5060/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/5/296855_front.jpg', NULL, NULL),
(5061, 'Wonder Boy', NULL, NULL, 'As Tom-Tom the Wonder Boy, it\'s up to you to rescue your girlfriend Tanya from the vile clutches of the monster that has kidnapped her. To do so, you must navigate a series of worlds in a race against time to reach your goal. Along the way, you\'ll battle foes and collect fruit that will add to the amount of time you have to complete your mission.', '/images/sms/5061/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/b/b6/Monster_World_MW_logo.png', NULL, NULL),
(5062, 'Wonder Boy in Monster Land', NULL, NULL, 'Wonder Boy is back! But this time he\'s playing for keeps. No more cute dolls, fruit or milk. Now it\'s swords, armor, shields, labyrinths and fire-breathing dragons. Help Wonder Boy through 12 perilous, monster-filled levels of challenging adventure!', '/images/sms/5062/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/71/Monster_Land_for_the_Master_System_cover_artwork.jpg', NULL, NULL),
(5063, 'Wonder Boy III: The Dragon\'s Trap', NULL, NULL, 'To save Monster Land from the evil Meka Dragon, you\'ve entered his castle and are about to go into battle. If you defeat the dragon, a terrible surprise awaits you... a curse! You\'ll turn into a lizard-man, and more. The only way you can return to human form is to find the Salamander Cross, a magical item with the power to remove curses. But where is it hidden? Finding it is an adventure that will take you across strange lands, against strange creatures, into battles where you never know what strange shape you\'ll turn into! Hawk-man, Lion-man, and more! You\'ll be able to buy armor, weapons and use magic items! Hidden rooms hold even greater surprises! Can you beat the dragon\'s bosses and recover the Salamander Cross? When you look at the shape you\'re in, it\'s your only hope!', '/images/sms/5063/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/be/Wonder_Boy_III_-_The_Dragon%27s_Trap_boxart.jpg', NULL, NULL),
(5064, 'Wonder Boy in Monster World', NULL, NULL, 'As the legendary hero Wonder Boy, it\'s up to you to rid Monster World of the terrible creatures that have taken over. Purchase your armor, weapons and spells, and embark on a quest through fantastic lands in search of the source of the evil monsters!', '/images/sms/5064/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/bf/Wonder_Boy_in_Monster_World.jpg', NULL, NULL),
(5065, 'Woody Pop', NULL, NULL, 'The Mad Machine has shut down the Enchanted Mansion toy factory. Massive barricades have been set up, blocking off all contact with the outside world. The only thing the crazed machien didn\'t count on was resistance from a courageous wooden toy--Woody Pop! Join Woody as he clashes with mechanized forces and nearly impossible barriers.', '/images/sms/5065/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/db/GG_Woody_Pop_Cover_art.jpg', NULL, NULL),
(5066, 'World Class Leader Board', NULL, NULL, '"World Class" Leader Board gives you the opportunity to play the courses that have challenged golf\'s greatest legends. Featuring the famous St. Andrews, Doral Country Club and Cyprus Creek courses, plus the specially designed Gauntlet Country Club - the ultimate golfing challenge.', '/images/sms/5066/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/6/30896_front.jpg', NULL, NULL),
(5067, 'World Cup USA \'94', NULL, NULL, 'Realistic gameplay with over 15 different moves. Customise gameplay to suit your own soccer style using pre-match options. Over 3000 frames of animation.', '/images/sms/5067/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/53/World_Cup_USA_%2794_Coverart.png', NULL, NULL),
(5068, 'World Cup Italia \'90', NULL, NULL, 'Go head to head with the most skilled teams in the world! Prove your mettle in a Test Match, show off your sharpshooting prowess in a Penalty Kick Contest, or go for the gold in the World Cup competition! Fast-paced and realistic - video soccer at its heart-stopping finest!', '/images/sms/5068/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/c/c5/WorldCupItalia90BoxShotSMS.jpg/220px-WorldCupItalia90BoxShotSMS.jpg', NULL, NULL),
(5069, 'World Grand Prix', NULL, NULL, 'Design some of the hottest Grand Prix race tracks in the world.  And hti them fast in the hottest wheels ever to fly across the home video screen.  Your speed and daring will determine the race.  If you\'re one of the top five finishers you can use your money to purchase even more supercharged parts for your car.  You win again.  You get more parts.  Making your car hotter.  And hotter.  So nothing can stop you from nabbing the world championship.  Except maybe the car that just pulled up beside you.', '/images/sms/5069/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/2/50472_front.jpg', NULL, NULL),
(5072, 'Xenon 2 Megablast', NULL, NULL, 'The Xenites are back and the very fabric of time is in danger. Five time bombs have been planted at various points throughout history. Only you can save the day, not to mention the universe! Featuring ground-breaking graphics, digitized Bomb the Bass soundtrack, 1 or 2 competitive player option, and 5 vertically-scrolling parallax levels.', '/images/sms/5072/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/Xenon_2_Megablast_Amiga_cover.jpg', NULL, NULL),
(5073, 'Ys: The Vanished Omens', NULL, NULL, 'Once long ago, the Kingdom of Y\'s fell under a reign of evil. But the Goddesses of Y\'s saved the Kingdom from ruin. Their feats were written in 6 magical books and hidden until the time the Goddesses would be needed again. A thousand years later, that time has come. You are Aron, a wanderer. An evil sorcerer named Dark Dekt is planning diabolical magic. And the Seer Sara is desperately looking for a swordsman to help her find the vanished 6 books of Y\'s. Now arm yourself and prepare for an adventure into the unknown. Where caverns and towers are filled with creatures and hoards of treasure. Where the strangest people have clues to tell you. Where your skill in combat depends on your reflexes. If you succeed, you\'ll have the power to call down the Goddesses. Fail, and Dark Dekt will rule the Kingdom under a reign of terror forever!', '/images/sms/5073/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/8/50468_front.jpg', NULL, NULL),
(5074, 'Zaxxon 3-D', NULL, NULL, 'The enemy has built battle fortresses in the farthest reaches of space. There\'s only one way in... and one way out. Your Mission: Infiltrate the enemy\'s defenses and destroy their motherships!', '/images/sms/5074/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/4/50474_front.jpg', NULL, NULL),
(5075, 'Zillion', NULL, NULL, 'Are you ready for the ultimate danger? You\'re alone, outnumbered and there\'s no guarantee you\'ll make it alive. You\'re J.J. Your objective: secretly infiltrate the underground labyrinth of The Norsa Empire and steal their plans for domination. Armed with the ultra speed and power of the Zillion Laser, your mission is complex. And sheer strength will not win this one alone. You\'ll need more brains than brawn in this sophisticated operation. So, how will you think your way to victory? With cunning strategy and memory to guide you successfully through the maze which awaits. Where once inside, you\'ll find the information needed to destroy the Norsas and restore peace forever.', '/images/sms/5075/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/45/Zillion_Coverart.jpg', NULL, NULL),
(5076, 'Zillion II: The Tri Formation', NULL, NULL, 'They\'re at it again. The dreaded Norsa Empire is back... and stronger than ever before. This time they won\'t make any mistakes. Others have tried to stop them and all have failed. The evil Baron Ricks knows you are coming. And it\'s a trap! But you\'re the galaxy\'s last hope. Can you do what\'s never been done before?', '/images/sms/5076/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/8/0/50480_front.jpg', NULL, NULL),
(5077, 'Zool', 'Nobunaga no Yabō: Zenkokuban', 'Nigel Mansell\'s F-1 Challenge', 'Once every year, the games world is rocked by a game so stunning, so fast, so colorful, so big, so demanding, so mega, so awesome, so varied, so incredible, and so full of fabulous features and unexpected treats, that everybody just looks at it and says "THAT\'S IT!" This year, Zool, The Ninja From the Nth Dimension, is definitely "IT!"', '/images/snes/5077/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/13/Zool_cover.jpg', NULL, NULL),
(5079, '3 Ninjas Kick Back', NULL, NULL, 'You first saw Rocky, Colt, and Tum Tum on the silver screen when their martial arts skills and extreme exploits saved the honor of Grandfather Mori and defeated an evil arms dealer. Now, it\'s up to you! In this action-packed adventure, you become any one of the 3 Ninjas. And that\'s when the fun begins. Wild animals and even wilder ninjas attack! A trio of spaced-out heavy metal rockers join forces with the evil Koga in an all-out effort to do you dirty. But if you rescue Grandfather Mori and his ceremonial dagger, you\'ll have the last laugh... and unlock a secret room filled with more gold than Fort Knox!', '/images/snes/5079/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e7/3_Ninjas_Kick_Back_Coverart.jpg', NULL, NULL),
(5080, '3rd Super Robot Wars', NULL, NULL, 'The game take place after the 2nd Super Robot Wars, the Divine Crusaders reformed under the leadership of the Zabi family, led by Gihren Zabi, who plans to use the DC to create a dictatorship. However, as the Federation tries to deal with the resurgence of the DC, a new foe appears, the aliens which Bian Zoldark warned of', '/images/snes/5080/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b1/3rd_Super_Robot_Wars.jpg', NULL, NULL),
(5081, '3×3 Eyes Jūma hōkan', NULL, NULL, '3x3 Eyes: Juuma Houkan ("3x3 Eyes: Respectful Restoration of the Magic Beast") is a side-scrolling action game with graphic adventure elements based on the manga 3x3 Eyes. The player, as Yakumo, helps his companion Pai, a legendary magical creature who resurrected Yakumo as her immortal undead servant to spare his life, to become a human. In doing so, his mortality will also return.\n\nThe game balances adventure areas and action areas. When in an adventure area, Yakumo investigates the environment and speaks to NPCs for hints on where to go next. When in action zones, the player can run, jump or climb over obstacles and fight hostile demons.\n\nJuuma Houkan is the second Super Famicom game to be based on 3x3 Eyes, after 1992\'s 3x3 Eyes: Seima Kourinden, and the sixth adaptation overall.', '/images/snes/5081/cover.jpg', 'https://static.giantbomb.com/uploads/scale_small/0/7900/277277-3x3_eyes.jpg', NULL, NULL),
(5082, '3×3 Eyes Seima kōrin-den', NULL, NULL, '3x3 Eyes: Seima Kourinden is a Role-Playing game, developed by Nova Games Ltd. and published by Yutaka,  which was released in Japan in 1992.', '/images/snes/5082/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/9/303689_front.jpg', NULL, NULL),
(5083, '4 Nin Shōgi', NULL, NULL, '4 Nin Shogi is a Miscellaneous game, developed and published by Pow,  which was released in Japan in 1995.', '/images/snes/5083/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/0/5/307105_front.jpg', NULL, NULL),
(5084, '4th Super Robot Wars', NULL, NULL, '4th Super Robot Wars (第4次スーパーロボット大戦 Dai 4 Ji Sūpā Robotto Taisen) is a Tactical RPG game for the Super Famicom developed by both Banpresto and Winky Soft and published by Banpresto. It\'s the 5th entry to the classic Super Robot Wars series and the last entry to the Divine Crusaders Arc. It was first released on March 17, 1995, and received mostly positive, highly praising the improvements from the last game while criticizing the game\'s increased difficulty. The game is ported into the Sony PlayStation in January 26, 1996, under the name 4th Super Robot Wars Scramble (第4次スーパーロボット大戦S Dai 4 ji Sūpā Robotto Taisen S).', '/images/snes/5084/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a0/Super_Robot_Wars_4_Front_Box_Art.jpg', NULL, NULL),
(5085, 'The 7th Saga', 'Elnard', NULL, 'The graphics are eye-popping, breath-taking, stunning and unbelievable, not to mention incredible. This is no hack-and-slash, rip-your-guts-out fighter! This is the future of RPGs, right here in your hands! With music this good, you won\'t turn the sound off--you\'ll turn it up!', '/images/snes/5085/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d5/The_7th_Saga_box_art.jpg', NULL, NULL),
(5086, '90 Minutes European Prime Goal', 'J.League Soccer Prime Goal 3', NULL, 'Enter into Europe. Challenge any one of the fourteen greatest European football teams and play the game how it was meant to be played. Exciting action, feverish atmosphere and the highest level of football detail from training and single matches to full blown cup and league modes are here to satisfy the urge for the irresistible game.', '/images/snes/5086/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/8/75398_front.jpg', NULL, NULL),
(5087, 'A.S.P. Air Strike Patrol', 'Desert Fighter: Suna no Arashi Sakusen', '', 'Zarak has invaded Sweit! You, as Air Force commander, MUST marshall all your resources and defeat them. Using hi-tech intelligence, locate your targets, load your plane, and destroy... chemical weapon plants, radar sites, enemy vehicles, and more. So strap yourself into a cockpit and fly into the challenge of a lifetime.', '/images/snes/5087/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/77/A.S.P._-_Air_Strike_Patrol_Coverart.png', NULL, NULL),
(5088, 'AIII S.V.: Let\'s Take the A-Train 3 Super Version', 'AIII S.V.: A-Ressha de Ikou 3 Super Version', NULL, 'You\'ll start with a bit of bare land and a small bank loan, then establish transportation systems, buy and sell land and businesses, and even invest in the stock market. If all goes well, you\'ll be rich and powerful. Then you can hop a train and take a first-person 3-D joy ride through your empire. If all doesn\'t go well... well. you\'ll have to find out for yourself. Trains, power and money - what more could you want?', '/images/snes/5088/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/4/312544_front.jpg', NULL, NULL),
(5089, 'AAAHH!!! Real Monsters', NULL, NULL, 'Greetings, terror-trainees! Ickis, Krumm, and Oblina will have to prove themselves on the Monster midterm exams if they want to call themselves real monsters! They must work together as a team to receive a single gruesome grade on their frightful performance. So...go out and petrify someone!', '/images/snes/5089/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/56/AaahhRealMonsters.jpg', NULL, NULL),
(5090, 'ABC Monday Night Football', 'ABC Mande Naito Futtoboru', NULL, 'ABC\'s Monday Night Football gives you football action like you\'ve never seen before! This is the only game that takes you from the bright lights of the announcer\'s booth to the gut-wrenching action on the field. You are the Quarterback - check off your receivers and find the open man. Now you\'re the wide receiver - catch the winning touchdown as the crowd goes wild! You\'ll feel the hits, hear the grunts and experience football as only the best players can. You are the action! You set the formations and you call the plays! This is the game you\'ve been waiting for!', '/images/snes/5090/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b8/ABC_Monday_Night_Football_Coverart.png', NULL, NULL),
(5091, 'Accele Brid', NULL, NULL, 'Accele Brid is an Action game, developed by Genki and published by Tomy Corporation,  which was released in Japan in 1993.', '/images/snes/5091/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2b/Accele_Brid_Cover_Art.jpg', NULL, NULL),
(5092, 'Acme Animation Factory', NULL, NULL, 'Get set to "draw gard\'ner" -- and design, paint and animate too! Acme Animation Factor is more than a video game. It actually lets you create your own cartoon adventures starring your favorite Looney Tunes friends!', '/images/snes/5092/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/97/ACME_Animation_Factory_Coverart.png', NULL, NULL),
(5093, 'Acrobat Mission', NULL, NULL, 'Acrobat Mission is an Action game, developed by Micronics and published by Techiku,  which was released in Japan in 1992.', '/images/snes/5093/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8d/Acrobat_Mission.jpg', NULL, NULL),
(5094, 'Action Pachio', NULL, NULL, 'Action Pachio is an Action game, developed by C-Lab and published by Coconuts Japan,  which was released in Japan in 1993.', '/images/snes/5094/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/4/306844_front.jpg', NULL, NULL),
(5095, 'ActRaiser', NULL, NULL, 'Long ago, you and your people built a peaceful land. Since then, your world has been taken over and inhabited by the evil Tanzra and his Guardians. Your once-tranquil land has become a breeding ground for monsters, Injured, you have retreated to your Sky Palace and have fallen into a deep sleep. Now, many years have passed and you have recovered from your injuries and slumber. You must punish Tanzra and restore the world to your people or lose their faith forever.', '/images/snes/5095/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/42/ActRaiser_Coverart.png', NULL, NULL),
(5096, 'ActRaiser 2', 'ActRaiser 2: Chinmoku e no Seisen', NULL, 'The Destroyer is back... Amazing graphics, spellbinding music, 100% action adventure, all taking place in a universe of ghouls and furies! Dive into the dream... or the nightmare!', '/images/snes/5096/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/45/ActRaiser_2_box_art.jpg', NULL, NULL),
(5097, 'The Addams Family (SNES)', NULL, NULL, 'Uncle Fester has lost his memory and has fallen under the spell of Abigail Craven, a conniving character who is anxious to lay her greedy hands on the Addams\' hidden fortune. Having recruited a misled Uncle Fester, and assisted by her cohorts Tully and The Judge, she manages to capture and imprison the other members of the Addams family within the huge Addams mansion! Only Gomez can save the day by freeing his son Pugsley, his daughter Wednesday, and Granny - and by restoring Uncle Fester\'s memory. Accomplishing these tasks is daunting enough, but then Gomez must seek out Morticia in the underground vaults of the Addams mansion and confront the evil Judge in a kooky and spooky climax!', '/images/snes/5097/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/5/22415_front.jpg', NULL, NULL),
(5098, 'The Addams Family: Pugsley\'s Scavenger Hunt (SNES)', NULL, NULL, 'Darling little Pugsley has lost his family to kidnappers who have hidden them as prisoners in their own spooky home. Only lovable little Pugsley can rescue them by hunting for delightfully strange items located in secret spots in their weird mansion. What oddities and atrocities await him! There are twisted creatures and complex features at every turn of the task.', '/images/snes/5098/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/1/22431_front.jpg', NULL, NULL),
(5099, 'Addams Family Values', NULL, NULL, 'Become Uncle Fester in this adventure of gargantuan proportions.', '/images/snes/5099/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/1/46981_front.jpg', NULL, NULL),
(5100, 'The Adventures of Batman and Robin', NULL, NULL, 'Now there is The Adventures of Batman and Robin.', '/images/snes/5100/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/ca/BatmanRobinSNES.jpg', NULL, NULL),
(5101, 'The Adventures of Dr. Franken', NULL, NULL, 'Franky and his girlfriend Bitsy have decided to take a vacation. Unfortunately, Bitsy does not have a passport. Not to be thwarted, our spare parts hero has a cunning plan. He dismantles Bitsy, packages up her parts and mails them to their vacation destination - New York City - with predictable results. The combination of Franky\'s lock of brain cells and the incompetence of the Transylvanian post office has scattered Bitsy across the globe. And so, the adventure begins...', '/images/snes/5101/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/6/50496_front.jpg', NULL, NULL),
(5102, 'The Adventures of Mighty Max', NULL, NULL, 'The Adventures of Mighty Max is a video game developed by British studio WJS Design and published by Ocean Software for the Sega Genesis and Super Nintendo Entertainment System in 1994.', '/images/snes/5102/cover.jpg', 'https://i.ytimg.com/vi/0fIKsGVl8zI/maxresdefault.jpg', NULL, NULL),
(5103, 'The Adventures of Rocky and Bullwinkle and Friends (SNES)', NULL, NULL, 'Moose on the Loose or Squirrely Heroes! An all-new episode in Bullwinkle\'s life when he finds out he\'s the Lost Earl of Moosechester!', '/images/snes/5103/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/17/Adventures_of_Rocky_and_Bullwinkle_NES_box_art.jpg', NULL, NULL),
(5104, 'The Adventures of Tintin: Prisoners of the Sun', NULL, NULL, '- A thousand curses!', '/images/snes/5104/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ee/The_Adventures_of_Tintin_-_14_-_Prisoners_of_the_Sun.jpg', NULL, NULL),
(5105, 'Adventures of Yogi Bear', 'Yogi Bear\'s Cartoon Caper', NULL, 'Here comes Yogi! America\'s favorite cartoon bear is coming to the Super Nintendo Entertainment System. Help Yogi Bear make his was past the furry denizens of Jellystone Park. Collect picnic baskets and other goodies as you travel through the different areas of the park in an attempt to save Jellystone from industrial developers.', '/images/snes/5105/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/83/Adventures_of_Yogi_Bear_box_art.jpg', NULL, NULL),
(5106, 'Aero Fighters', 'Sonic Wings', NULL, 'The world\'s hope hinges on your combat skills and sheer determination as an "aero fighter". Defend the world from unknown alien forces that are attempting to take over the world. You must extract these unknown forces before they can execute their plot for dominance. After conquering the unknown forces, the battle continues into space where the "controlling intellect" dictated the take-over attempt. You must seek and destroy this evil force to prevent it from seizing other worlds.', '/images/snes/5106/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/eb/Aero_Fighters_Poster.png', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(5107, 'Aero the Acro-Bat', NULL, NULL, 'Step right up to the acro-batiest show on earth! The madman industrialist Edgar Ektor has siezed control of the World of Amusement. He and a deranged cast of fairground freaks threaten the circus. The only hope for survival is the high-flying, death-defying Aero the Acro-Bat! ', '/images/snes/5107/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/10/Aero_the_Acro-Bat_cover.jpg', NULL, NULL),
(5108, 'Aero the Acro-Bat 2', NULL, NULL, 'The aerialist extreme, Aero the Acro-Bat bounds back into the spotlight once again to stop the wicked industrialist, Edgar Ektor! Aero has entered a new realm of enchantment and must now use all his acrobatic prowess to foil a criminal plot known only as "Plan B!" Join Aero as he discovers new friends (and enemies) in a world custom built for his high-flying adventures.', '/images/snes/5108/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/06/Aero_the_Acro-Bat_2_Coverart.png', NULL, NULL),
(5109, 'Aerobiz', 'Air Management: Ōzora ni Kakeru', NULL, 'You\'re ambitious and you strive for excellence. Your goal is to create a global airline network. You know travelers depend on your airline to get them where they want to go. Now convince them your airline is the best way to fly!', '/images/snes/5109/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2f/Aerobiz_Coverart.png', NULL, NULL),
(5110, 'Aerobiz Supersonic', 'Air Management II: Kōkū Ō wo Mezase', NULL, 'It\'s the beginning of the 21st century and competition in the airline industry is heating up. As a young, ambitious CEO, it\'s up to you to make sure your airline is a survivor and not just another casualty. To succeed, you will have to make some tough decisions including where to fly, which planes to purchase and how to attract visitors to the cities you service. Your goal: to differentiate your airline from the rest while still turning a profit. Get ready to make some tough decisions! If you make the right ones, your planes will dominate the skies of the 21st century!', '/images/snes/5110/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7e/Aerobiz_Supersonic_box_art.jpg', NULL, NULL),
(5111, 'Aim for the Ace!', NULL, NULL, 'Ace o Nerae! ("Aim for the Ace!") is a tennis game that uses the Super Famicom\'s Mode 7 capabilities. It is based on the Ace o Nerae! anime and manga about a female tennis athlete-in-training and her travails with becoming better at tennis and being a more confident person. The game uses numerous characters from the source, several of which are selectable for multiplayer, and features a story mode.\n\nWhile the game is default played with the Mode 7 view, which turns the court around to reflect whatever the player character is looking at, it\'s possible to play with a standard static 2D perspective.', '/images/snes/5111/cover.jpg', 'https://static.giantbomb.com/uploads/scale_small/0/7135/2648546-aceneraecover.jpg', NULL, NULL),
(5112, 'Air Cavalry', NULL, NULL, 'Air Cavalry is a one or two-player, dual mode-7 game in which each player controls a high-tech helicopter gunship. Flying above the desert, ocean or jungle, the players will accomplish a series of missions from recon to full assault. Recon missions will use the OH-6 Defender. Transport and rescue missions will use the UH-60 Black Hawk. Attack missions will use either the AH-64H Apache or the futuristic AH-94. Air Cavalry. Choose from three theatres of  of operations with six to eight missions of increasing danger and complexity. Practice in the training mission, climb into your automated cockpit and prepare for air war.', '/images/snes/5112/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Air_cavalry_snes.jpg', NULL, NULL),
(5113, 'Al Unser Jr.\'s Road to the Top', NULL, NULL, 'Have You Got The Drive To Make It To The Top?', '/images/snes/5113/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/39/AlUnserJr%27sRoadtotheTopTitleScreen.png', NULL, NULL),
(5114, 'Albert Odyssey', NULL, NULL, 'Albert Odyssey is a Role-Playing game, developed and published by SunSoft,  which was released in Japan in 1993.', '/images/snes/5114/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/18/AlbertOdysseyfront.jpg', NULL, NULL),
(5115, 'Albert Odyssey 2', NULL, NULL, 'Albert Odyssey 2: Jashin no Taidou is a Role-Playing game, developed and published by SunSoft,  which was released in Japan in 1994.', '/images/snes/5115/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/18/AlbertOdysseyfront.jpg', NULL, NULL),
(5116, 'Alcahest', NULL, NULL, 'Alcahest is a Role-Playing game, developed by HAL Labs and published by SquareSoft,  which was released in Japan in 1993.', '/images/snes/5116/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c5/AlcahestSNES_boxart.jpg', NULL, NULL),
(5117, 'Alice\'s Paint Adventure', NULL, NULL, 'Alice no Paint Adventure is an Adventure game, developed by SAS Sakata and published by Epoch,  which was released in Japan in 1995.', '/images/snes/5117/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3d/Alice_no_Paint_Adventure.jpg', NULL, NULL),
(5118, 'Alien 3 (SNES)', NULL, NULL, 'The ALIENS are fast, spit acid and are right behind you! The motion tracker is your only warning. No time to think, no time to catch your breath... RUN! Can\'t see very far ahead in these air ducts. Hard to breathe. Face-huggers can be anywhere. You have the firepower... blast the ALIENS with your machine gun, flame thrower and grenade launcher. You know what you have to do... rescue the trapped prisoners and end this nightmare! Just keep telling yourself, "This isn\'t really happening. It\'s only a game!!!"', '/images/snes/5118/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4b/Alien3_game_cover_art.jpg', NULL, NULL),
(5119, 'Alien vs Predator', 'Aliens vs Predator', NULL, 'The Cosmic Clash of the Century', '/images/snes/5119/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f1/Alien_vs_Predator_%28Jaguar_game%29.jpg', NULL, NULL),
(5120, 'AmaThe Amazing Spider-Man: Lethal Foes', NULL, NULL, 'The Amazing Spider-Man: Lethal Foes is an Action game, developed by Agenda and published by Epoch,  which was released in Japan in 1995.', '/images/snes/5120/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/61/LFSPMN.png', NULL, NULL),
(5121, 'America Ōdan Ultra Quiz', NULL, NULL, 'America Oudan Ultra Quiz is a Miscellaneous game, developed by Genki and published by Tomy Corporation,  which was released in Japan in 1992.', '/images/snes/5121/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/0/306810_front.jpg', NULL, NULL),
(5122, 'American Battle Dome', NULL, NULL, 'American Battle Dome is an Action game, developed by Betop and published by Tsukuda Original,  which was released in Japan in 1995.', '/images/snes/5122/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/8/31918_front.jpg', NULL, NULL),
(5123, 'American Gladiators (SNES)', NULL, NULL, 'Television\'s most innovative sporting event, AMERICAN GLADIATORS is now bigger than life in this all-new Sega Genesis version. All the action, drama, and competitiveness are here from the hit television show that plays "like a video game come to life." Six events including: THE WALL, THE JOUST, THE ASSAULT, ATLASPHERE, POWERBALL and THE ELIMINATOR, all captured with incredible detail. NITRO, ICE, LASER, THUNDER, GOLD, TURBO, ZAP, LACE, BLAZE and GEMINI are here and ready to psyche you out of your game.', '/images/snes/5123/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/1/21771_front.jpg', NULL, NULL),
(5124, 'An American Tail: Fievel Goes West', 'Amerika Monogatari 2/Faiberu nishi e Iku', NULL, 'The Mousekewitz family has been lured out west by the dastardly Cat R. Waul. He plans to round up all the mice in one place and turn them all into mouseburgers. Fievel and you are their only hope. Mosey on down through five challenging stages along with Fievel on a wild west adventure to rescue his family. So buckle up your six shooter, you\'re the only hope to help Fievel save his family.', '/images/snes/5124/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f9/Fievel_Goes_West_SNES.jpg', NULL, NULL),
(5125, 'Ancient Magic: Bazoo! Mahou Sekai', NULL, NULL, 'Ancient Magic: Bazoe! Mahou Sekai is a Role-Playing game, developed and published by Hot-B,  which was released in Japan in 1993.', '/images/snes/5125/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/7/31717_front.jpg', NULL, NULL),
(5126, 'Angelique', NULL, NULL, 'Angelique is a Strategy game, published by Koei,  which was released in Japan in 1994.', '/images/snes/5126/cover.jpg', 'https://upload.wikimedia.org/wikipedia/commons/a/a5/Paris-FR-75-open_de_tennis-2018-Roland_Garros-stade_Lenglen-4_juin-Angelique_Kerber-20.jpg', NULL, NULL),
(5127, 'Angelique Voice Fantasy', NULL, NULL, 'Angelique is a young girl from earth, chosen by the Queen to be a prospective candidate to rule Elysion, but only one person is keeping her from her goal, her rival and scoolmate, Rosalia. Angelique must prove her worth by winning over all the officers of the court and showing the people of Elysion how kind she is in this 1996 romantic strategy rpg from Koei.', '/images/snes/5127/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/5/303845_front.jpg', NULL, NULL),
(5128, 'Animaniacs', NULL, NULL, 'The Brain stole Hollywood\'s hottest new movie script. As the Warner Bros. CEO, I\'m giving you (and the Animaniacs) the job of finding the script\'s missing scenes by searching through 7 Warner Bros.\' movie sound stages filled with hilarious hijinks. Watch for Tinsel Town Traps and Movie Classic Power Ups scattered throughout the "Ocean of Door", "Adventure Kingdom", "Sci-Fi Scene" and "Fantastic Fantasy Zone".', '/images/snes/5128/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/53/Animaniacsgc.jpg', NULL, NULL),
(5129, 'Appleseed: Oracle of Prometheus', NULL, NULL, 'Appleseed is an Action game, developed by Kan\'s and published by Visit,  which was released in Japan in 1994.', '/images/snes/5129/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/9/306969_front.jpg', NULL, NULL),
(5130, 'Arabian Nights: Spirit of the Desert King', NULL, NULL, 'Arabian Nights is a Role-Playing game, developed by Pandora Box and published by Takara,  which was released in Japan in 1996.', '/images/snes/5130/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/7/42747_front.jpg', NULL, NULL),
(5131, 'Araiguma Rascal', NULL, NULL, 'Araiguma Rascal: Raccoon Rascal is a Puzzle game, developed by J-Force and published by NCS,  which was released in Japan in 1994.', '/images/snes/5131/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/3/6/312536_front.jpg', NULL, NULL),
(5132, 'Arcade\'s Greatest Hits: The Atari Collection 1', NULL, NULL, 'Blast your way through an asteroid field and destroy enemy ships in Asteroids! Super Breakout tests your eye-hand coordination as you break through walls one brick at a time! Enjoy the non-stop action of a never-ending stream of attacking insect infestation in the classic arcade hit, Centipede! In Tempest, you\'ll use unlimited firepower to shoot and destroy your enemies in a large geometric battlefield! Missile Command lets you rescue humanity from a nuclear holocaust as enemy missiles, bombers and satellites rain warheads on populated cities and missile bases! It\'s all-out war as you destroy enemy tanks, guided missiles and alien spacecraft in Battlezone!', '/images/snes/5132/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b9/Arcade%27s_Greatest_Hits-The_Atari_Collection_1_PSX-us.jpg', NULL, NULL),
(5133, 'Arcana', 'Card Master', NULL, 'Arcana - 1. Mysterious knowledge known only to initiates. 2. Ancient rites and spiritual powers understood by only a few. 3. The secrets held by the Card Mastersnow fast disappearing.', '/images/snes/5133/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/0/2/22502_front.jpg', NULL, NULL),
(5134, 'Arcus Spirits', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5135, 'Ardy Lightfoot', 'Arudi Raitofutto', NULL, 'The rainbow has been broken into 7 pieces! Ardy, our young and brave adventurer, with Pec, his friend-for-ever, are ready to sacrifice their lives to gather the 7 gems containing the colors of the rainbow, then their wishes will come true and they will finally save Nina from the clutches of Visconty.', '/images/snes/5135/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cd/Ardy_Lightfoot_cover.jpg', NULL, NULL),
(5136, 'Aretha the Super Famicom', NULL, NULL, 'Aretha the Super Famicom is a Role-Playing game, developed by Japan Art Media (JAM) and published by Yanoman,  which was released in Japan in 1993.', '/images/snes/5136/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/2/312392_front.jpg', NULL, NULL),
(5137, 'Aretha II: Ariel no Fushigi na Tabi', NULL, NULL, 'Aretha II: Ariel no Fushigi na Tabi is a Role-Playing game, developed by Japan Art Media (JAM) and published by Yanoman,  which was released in Japan in 1994.', '/images/snes/5137/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/0/43350_front.jpg', NULL, NULL),
(5138, 'Arkanoid: Doh It Again', NULL, NULL, 'Arkanoid, one of the best-selling, most loved video games in history is back with more challenges and special features than ever before! In your scout ship, you will be racing through a galaxy crowded with solar block and powerful enemies, clearing the path with laser beams and energy balls.', '/images/snes/5138/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/00/Arkanoiddohitagainbox.jpg', NULL, NULL),
(5139, 'Armored Police Metal Jack', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5140, 'Art of Fighting', 'Ryuuko no Ken', NULL, 'South Town is no place for the weak. Yet into this urban battlezone comes Ryo; braving the mean streets in order to rescure his kidnapped sister.', '/images/snes/5140/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/6a/Art_of_Fighting_1_cover.png', NULL, NULL),
(5141, 'Asahi Shinbun Rensai: Katou Ichi-Ni-San Shougi: Shingiryuu', NULL, NULL, 'Asahi Shinbun Rensai Katou Hifumi Kudan Shogi Shingiryuu is a Miscellaneous game, published by Varie,  which was released in Japan in 1995.', '/images/snes/5141/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/4/312524_front.jpg', NULL, NULL),
(5142, 'Asameshimae Nyanko', NULL, NULL, 'Asameshimae Nyanko is a Miscellaneous game, developed by J-Force and published by Zamuse,  which was released in Japan in 1994.', '/images/snes/5142/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/3/4/312534_front.jpg', NULL, NULL),
(5143, 'Ashita no Joe', NULL, NULL, 'Ashita no Joe is a Sports game, developed by Wave and published by K Amusement Leasing,  which was released in Japan in 1992.', '/images/snes/5143/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/38/Ashita_no_Joe_Volume_1.jpg', NULL, NULL),
(5144, 'Asterix (SNES)', NULL, NULL, 'OBELIX has disappeared...', '/images/snes/5144/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f0/Asterix_-_Cast.png', NULL, NULL),
(5145, 'Asterix and Obelix', NULL, NULL, 'Caesar has had a palisade constructed around the village inhabited by the Indomitable Gauls in order to keep them prisoner! Choose Obelix or Asterix and set off across the Roman Empire! Bring back a souvenir from each country crossed in order to prove to Caesar that our heroes are the strongest!', '/images/snes/5145/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/34/A_and_O_XXL.jpg', NULL, NULL),
(5146, 'The Atlas', NULL, NULL, 'The Atlas is a Strategy game, developed by Artdink and published by Pack-In-Video,  which was released in Japan in 1995.', '/images/snes/5146/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/1/296291_front.jpg', NULL, NULL),
(5147, 'Axelay', NULL, NULL, 'Mysterious aliens have invaded the Earth-like planet of Corliss, slowly draining the planet\'s resources. Take control of the prototype Axelay ship and use its wide range of advanced weaponry to battle enemy forces. Play through multiple stages of action --from other planets to space stations -- all on your way to destroying the alien headquarters.', '/images/snes/5147/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/aa/Axelay_SNES_box_art.jpg', NULL, NULL),
(5148, 'B.O.B.', 'Space Funky B.O.B.', NULL, 'Just when he thinks it\'s safe to date... He totals the car! When the star dust settles B.O.B. finds himself marooned on a hostile, back water planet, light years from home. Worse yet, the planet is inhabited by the gnarliest creatures and killer machines he\'s ever seen. You\'ve got to help B.O.B. blast his way through the alien goon squads and onward to the rendezvous with his galactic babe! Featuring over 45 grueling levels! Six tricked-out gadgets! Six grades of ammo, including fire and lasers! More than 40 menacing enemies and bosses galore! Lightning-fast rocket rides!', '/images/snes/5148/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/88/B.O.B._Coverart.png', NULL, NULL),
(5149, 'Bahamut Lagoon', NULL, NULL, 'Bahamut Lagoon is a Strategy game, developed and published by SquareSoft,  which was released in Japan in 1996.', '/images/snes/5149/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d1/Bahamut_Lagoon_Coverart.png', NULL, NULL),
(5150, 'Bakukyuu Renpatsu!! Super B-Daman', NULL, NULL, 'Bakukyuu Renpatsu!! Super B-Daman is an Action game, developed by Amble and published by Hudson,  which was released in Japan in 1997.', '/images/snes/5150/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/1/307271_front.jpg', NULL, NULL),
(5151, 'Bakumatsu Kourinden Oni', NULL, NULL, 'Bakumatsu Korinden Oni is a Role-Playing game, developed by Pandora Box and published by Banpresto,  which was released in Japan in 1996.', '/images/snes/5151/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/3/1/31931_front.jpg', NULL, NULL),
(5152, 'Bakuto Dochers', NULL, NULL, 'Bakutou Dodgers is a Puzzle game, developed by Genki and published by Bullet Proof Software,  which was released in Japan in 1994.', '/images/snes/5152/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/3/306993_front.jpg', NULL, NULL),
(5153, 'Ball Bullet Gun: Survival Game Simulation', NULL, NULL, 'Ball Bullet Gun: Survival Game Simulation is a Strategy game, developed by Betop and published by I\'Max,  which was released in Japan in 1995.', '/images/snes/5153/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/6/307156_front.jpg', NULL, NULL),
(5154, 'Ballz 3D', '3 Jigen Kakuto: Ballz', NULL, 'What is Ballz? Ballz is a killer 3-D fighting game. It\'s an in-your-face, all out fight to the finish with 8 unique characters and 8 bosses that punch, kick, club, slam, humiliate and fart on their opponents. Ballz even has an instant replay that shows you the damage from almost any angle. And with three times more special moves than those flat 2-D games, you\'re going to be doing lots of damage. Our characters will even morph into other characters whenever you want. Ballz also has a bunch of weird sound effects and a wisecracking scoreboard. It\'s the coolest *#!#@*#! fighting game on the shelf!', '/images/snes/5154/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/56/Ballz.jpg', NULL, NULL),
(5155, 'Barbarossa', NULL, NULL, 'Barbarossa is a Strategy game, developed by SystemSoft and published by Sammy Studios,  which was released in Japan in 1992.', '/images/snes/5155/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/3/306813_front.jpg', NULL, NULL),
(5156, 'Barbie: Super Model', NULL, NULL, 'Nobody said becoming a world famous Super Model would be easy. And that\'s what you and Barbie find out as you take off on a wonderful whirlwind fashion tour of the hottest cities in the USA!', '/images/snes/5156/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Barbie_Super_Model_Coverart.png', NULL, NULL),
(5157, 'Barkley Shut Up and Jam!', 'Barkley\'s Power Dunk', NULL, 'Hey, any fool can hoop in some stupid gym. I\'m talking Street Ball! No pretty uniforms. NO REFS protecting your sorry self. Just you and me against some of the toughest street legends I\'ve ever had the pleasure of busin\' a move on. And THEY AIN\'T ABOUT TO TAKE TRASH off some two-inch vertical leapin\' momma\'s boy. You got that? So don\'t embarrass me. SHOW ME WHAT YOU GOT on seven of the nastiest blacktop\'s this side of North Philly.', '/images/snes/5157/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/Barkley_Shut_Up_and_Jam%21_cover.jpg', NULL, NULL),
(5158, 'Bass Masters Classic', NULL, NULL, 'Welcome Anglers!', '/images/snes/5158/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/98/BassMastersClassicProEditionUSBoxShot.jpg', NULL, NULL),
(5159, 'Bass Masters Classic: Pro Edition', NULL, NULL, 'Don\'t miss your chance to compete in the most realistic fishing game for the Genesis. Featuring pro bass anglers George Cochran, Shaw Grigsby Jr., Gary Klein, Tom Mann Jr., Dee Thomas and Kevin VanDam, BASS MASTERS CLASSIC PRO EDITION brings world championship bass fishing indoors! Compete as one of six actual pro fishermen or as an amateur enthusiast in the Bass Masters Classic. Fish the waters in five three-day tournaments at five different lakes. Rich graphics recreate the outdoor fishing experience in vivid detail. Choose your rod, reel, lure, and even boat engine.', '/images/snes/5159/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/98/BassMastersClassicProEditionUSBoxShot.jpg', NULL, NULL),
(5160, 'Bassin\'s Black Bass with Hank Parker', 'Super Black Bass 2', NULL, 'REEL IN THE ACTION... HOT-B PRESENTS THE MOST ADVANCED FISHING SIMULATION EVER.', '/images/snes/5160/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/83/Bassin%27s_Black_Bass_with_Hank_Parker_Coverart.png', NULL, NULL),
(5161, 'Bastard!!: Ankoku no Hakai-shin', NULL, NULL, 'Bastard! is an Action game, published by Cobra Team,  which was released in Japan in 1994.', '/images/snes/5161/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/5/24215_front.jpg', NULL, NULL),
(5162, 'Batman Forever', NULL, NULL, 'Brace yourself for endless action with BATMAN FOREVER! Batman and Robin blast into Gotham City in a duo-player fighting game! Armed with over 125 incredible attacks, fierce combat moves, and an arsenal of gadgets, the Dynamic duo are ready to battle the diabolical minds of Two-Face and The Riddler!', '/images/snes/5162/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/97/Batman_Forever_cover.jpg', NULL, NULL),
(5163, 'Batman Returns (SNES)', NULL, NULL, 'One oversized bird and one stinky cat are out to take control of this urban jungle. Only you, as Batman, possess the power to stop the sinister plots of The Penguin and Catwoman!', '/images/snes/5163/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/BatmanReturnsCoverart.jpg', NULL, NULL),
(5164, 'Battle Blaze', NULL, NULL, 'Battle Blaze is an Action game, developed by Electronics Application and published by Sammy Studios,  which was released in Japan in 1992.', '/images/snes/5164/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/df/Battle_Blaze_Coverart.png', NULL, NULL),
(5165, 'Battle Cars', NULL, NULL, 'Insane Speed-Car Combat!', '/images/snes/5165/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e9/Battle_Cars_Coverart.png', NULL, NULL),
(5166, 'Battle Clash', 'Space Bazooka', NULL, 'The time is the 21st century. In the wake of natural disasters and social unrest, human society has collapsed. The only amusement left for the inhabitants of this grim Earth of the future is the Battle Game. This contest of advanced arena combat pits giant, armored riot suits known as Standing Tanks (ST\'s) against each other in a fight to the finish. The winner gains power and prestige, while the lower faces humiliation, dishonor and low class citizenship.', '/images/snes/5166/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/57/Battleclash_boxart.png', NULL, NULL),
(5167, 'Battle Commander: Hachibushuu Shura no Heihou', NULL, NULL, 'Battle Commander is a Strategy game, developed by Arc System Works and published by Banpresto,  which was released in Japan in 1991.', '/images/snes/5167/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/8/2/306782_front.jpg', NULL, NULL),
