(5189, 'Beethoven: The Ultimate Canine Caper', 'Beethoven\'s 2nd', NULL, 'It\'s canine chaos as Beethoven turns the town upside down looking for his missing puppies! Explore all the puppies\' favorite hangouts the Neighborhood, the Park, Downtown, the Supermarket, and more in this dog-gone mystery adventure.', '/images/snes/5189/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/5/37125_front.jpg', NULL, NULL),
(5190, 'Benkei Gaiden: Suna no Shou', NULL, NULL, 'Benkei Gaiden: Suna no Shou is a Role-Playing game, published by SunSoft,  which was released in Japan in 1992.', '/images/snes/5190/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/5/306815_front.jpg', NULL, NULL),
(5191, 'Big Sky Trooper', NULL, NULL, 'It\'s Jack Spudtop to the rescue! As a 21-star general in the Big Sky Troopers, it\'s your job to stop the dastardly Sultan of Slime and his alien armada of slippery slugs from taking over the universe. Navigate your way across the interstellar Skyway with the help of your sidekick FIDO, a Flexible Interactive Digital Omnicomputer, and then, battle through each and every wacky world to collect an arsenal of weapons.', '/images/snes/5191/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3e/Big_Sky_Trooper_Coverart.png', NULL, NULL),
(5192, 'Best Shot Pro Golf', NULL, NULL, 'Best Shot Pro Golf is a Sports game, developed by Kid and published by ASCII Entertainment,  which was released in Japan in 1996.', '/images/snes/5192/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/1/307221_front.jpg', NULL, NULL),
