(5196, 'Biker Mice from Mars', NULL, NULL, 'The fish-faced Plutarkians have devastated Mars--the home planet of Throttle, Vinnie and Modo. These three rebel rodents escaped the mayhems and landed in Chicago, only to find that Limburger, the Plutarkian Leader, set Earth as his next target!', '/images/snes/5196/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c5/Biker_Mice_From_Mars_%281994%29_Coverart.png', NULL, NULL),
(5197, 'Bill Laimbeer\'s Combat Basketball', NULL, NULL, 'In the 1980\'s and 1990\'s, there was a legendary rough and tough bad boy of basketball. His name was Bill Laimbeer. Unfortunately, the league didn\'t like his style of playing, so they forced him to retire.', '/images/snes/5197/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8a/Bill_Laimbeer%27s_Combat_Basketball_Coverart.png', NULL, NULL),
(5198, 'Bill Walsh College Football', NULL, NULL, 'No time left...your wishbone QB dives in from the two but you\'re still down by one...gut check...kick for the tie? or GO FOR TWO and the national title.', '/images/snes/5198/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/60/Bill_Walsh_College_Football_Coverart.png', NULL, NULL),
(5199, 'Bing Bing! Bingo', NULL, NULL, 'Bing Bing! Bingo is a Miscellaneous game, developed by Copya Systems and published by KSS,  which was released in Japan in 1993.', '/images/snes/5199/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/9/6/312596_front.jpg', NULL, NULL),
(5200, 'BioMetal', NULL, NULL, 'Wage deadly attacks to mind-blowing Techno tracks when you confront BioMetal mutants in the ultimate cyberbattle for intergalactic domination!', '/images/snes/5200/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a8/BioMetal_Coverart.png', NULL, NULL),
(5201, 'Bishoujo Janshi Suchie-Pai', NULL, NULL, 'Bishoujo Janshi Suchie-Pai is a Miscellaneous game, developed by DCE and published by Jaleco Entertainment,  which was released in Japan in 1993.', '/images/snes/5201/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/5/306855_front.jpg', NULL, NULL),
(5202, 'Bishoujo Senshi Sailor Moon: Another Story', NULL, NULL, 'Bishoujo Senshi Sailor Moon: Another Story is a Role-Playing game, developed and published by Angel (Bandai),  which was released in Japan in 1995.', '/images/snes/5202/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/1/51111_front.jpg', NULL, NULL),
(5203, 'Bishoujo Senshi Sailor Moon: Sailor Stars Fuwa Fuwa Panic 2', NULL, NULL, 'Bishoujo Senshi Sailor Moon: Sailor Stars Fuwa Fuwa Panic 2 is a Puzzle game, developed and published by Bandai,  which was released in Japan in 1996.', '/images/snes/5203/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/7/36547_front.jpg', NULL, NULL),
(5204, 'Bishoujo Senshi Sailor Moon R', NULL, NULL, 'Bishoujo Senshi Sailor Moon R is an Action game, published by Bandai,  which was released in Japan in 1993.', '/images/snes/5204/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/6/23756_front.jpg', NULL, NULL),
(5205, 'Bishoujo Senshi Sailor Moon S: Jougai Rantou!? Shuyaku Soudatsusen', NULL, NULL, 'In the game, two Sailor Senshi fight each other using both basic physical and special attacks. Each Senshi has their own set of attacks, some of which are invented exclusively for the game. All of the Solar System Senshi, with the exception of Sailor Saturn, are playable characters', '/images/snes/5205/cover.jpg', 'https://vignette.wikia.nocookie.net/sailormoon/images/a/ab/SMSJRSSCover.jpg', NULL, NULL),
(5206, 'Bishoujo Senshi Sailor Moon S: Kondo ha Puzzle de Oshiokiyo!', NULL, NULL, 'Bishoujo Senshi Sailor Moon S: Kondo wa Puzzle de Oshioki yo!! is a Puzzle game, developed by Tom Create and published by Bandai,  which was released in Japan in 1994.', '/images/snes/5206/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/3/42233_front.jpg', NULL, NULL),
(5207, 'Bishoujo Senshi Sailor Moon S: Kurukkurin', NULL, NULL, 'Bishoujo Senshi Sailor Moon S Kurukkurin is a Puzzle game, developed by Tom Create and published by Bandai,  which was released in Japan in 1995.', '/images/snes/5207/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/2/42232_front.jpg', NULL, NULL),
(5208, 'Bishoujo Senshi Sailor Moon SuperS: Fuwa Fuwa Panic', NULL, NULL, 'Bishoujo Senshi Sailor Moon Super S: Fuwa Fuwa Panic is a Puzzle game, developed by Tom Create and published by Bandai,  which was released in Japan in 1995.', '/images/snes/5208/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/8/307158_front.jpg', NULL, NULL),
(5209, 'Bishoujo Senshi Sailor Moon SuperS - Zenin Sanka!! Shuyaku Soudatsusen', NULL, NULL, 'Bishoujo Senshi Sailor Moon Super S: Zenin Sanka!! Shuyaku Soudatsusen is an Action game, developed by Monolith (Japan) and published by Angel (Bandai),  which was released in Japan in 1996.', '/images/snes/5209/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/4/37674_front.jpg', NULL, NULL),
(5210, 'Bisyoujyo Wrestlinger\'s History: Beauty Girl Wrestling', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5211, 'Blackthorne', 'Blackhawk', NULL, 'After years of awaiting his destiny on Earth, Kyle Blackthorne has finally come home to face the galaxy\'s most terrifying mutant monsters and goblin hordes. With brute strength, animal cunning and a lead-spewing shotgun he\'s on a quest to reclaim his once peaceful Planet Tuul.', '/images/snes/5211/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/40/BlackthorneSNES.jpg', NULL, NULL),
(5212, 'BlaZeon: The Bio-Cyborg Challenge', NULL, NULL, 'The Last Desperate Struggle of Humanity to Overcome its Bio-Cyborg Oppressors!', '/images/snes/5212/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9e/BlaZeon_Coverart.png', NULL, NULL),
(5213, 'Block Kuzushi', NULL, NULL, 'Block Kuzushi is an Action game, developed by OeRSTED and published by Pow,  which was released in Japan in 1995.', '/images/snes/5213/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/2/31912_front.jpg', NULL, NULL),
(5214, 'The Blue Crystal Rod', NULL, NULL, 'The Blue Crystal Rod is an Adventure game, developed by Game Studio and published by Namco,  which was released in Japan in 1994.', '/images/snes/5214/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/8/306918_front.jpg', NULL, NULL),
(5215, 'Blue Legend Shoot!', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5216, 'The Blues Brothers (SNES)', NULL, NULL, 'The greatest rock \'n\' roll game is about to commence: THE BLUES BROTHERS! Cruise along with Jake and Elwood, those all-time rhythm \'n\' blues men in this engrossing platform game - an explosive mix of adventure, comedy and music. Back by popular demand, the Blues Brothers are out to conquer the stage one more time. To an upbeat rhythm you set off across town to retrieve your stolen instruments... but it ain\'t that easy. You\'ve got to escape from prison, swim through the catacombs, and shoot to the upper heights of the big city before you can start the concert. Get ready to play the blues!', '/images/snes/5216/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/6/27256_front.jpg', NULL, NULL),
(5217, 'Bomberman B-Daman', NULL, NULL, 'Bomberman B-Daman is an Action game, developed by AI and published by Hudson,  which was released in Japan in 1996.', '/images/snes/5217/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/7/31967_front.jpg', NULL, NULL),
(5218, 'Boogerman: A Pick and Flick Adventure', NULL, NULL, 'He thinks he\'s a hero, but he\'s snot! He\'s mean. He\'s green. And he nose how to pick a fight! He\'s BOOGERMAN, as slick as he is deep, and he\'s on a pick \'n\' flick adventure to save the world. He\'s stretched to the limit of blowing away the vile slimebags who are bent on sticking it to Planet Earth, any way, every way, and everywhere they can. You\'re his first pick to help him rescue the whole world before it\'s flushed down the toilet. Join the flick-or-be-flicked race to pull the plug on the Booger Meister and his gang of filthy stinkers who aren\'t afraid to fight dirty... because yours is the only finger which can wipe \'em out!', '/images/snes/5218/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/be/Boogerman_-_A_Pick_and_Flick_Adventure_Coverart.png', NULL, NULL),
(5219, 'Bounty Sword', NULL, NULL, 'Bounty Sword is a Strategy game, developed by ITL and published by Pioneer LDC,  which was released in Japan in 1995.', '/images/snes/5219/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/2/31892_front.jpg', NULL, NULL),
(5220, 'Boxing Legends of the Ring', NULL, 'Final Knockout', 'Let\'s get ready to rumble!', '/images/snes/5220/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a8/Boxing_Legends_of_the_Ring_Coverart.png', NULL, NULL),
(5221, 'Brain Lord', NULL, NULL, 'Beyond your memory lies a time filled with Dragons and men riding the skies together. The Dragon Warrior blood flows deeply through your family. Now, you are the only one left. Your father has spent a life time searching for the Ancient Dragons, a life lived in vain. It is up to you to find the Dragons. Before you lies a world filled with puzzle and riddles, enough to drive even the most rational insane. There are too many unanswered questions in your mind. What lies ahead? Where do I start? What will I find? There is a Dark Presence that awaits you. Can you unlock the secret? Are you strong enough to survive? ARE YOU A BRAIN LORD? We shall see...', '/images/snes/5221/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/BrainlordSNESboxart.jpg', NULL, NULL),
(5222, 'The Brainies', NULL, NULL, 'The new puzzle game which will give you endless sleepless nights!!!', '/images/snes/5222/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/5/50545_front.jpg', NULL, NULL),
(5223, 'Bram Stoker\'s Dracula (SNES)', NULL, NULL, 'Bram Stoker\'s Dracula sucks you into a terrifying world of evil. And there\'s only one way to survive. Kill the Prince of Darkness! But it won\'t be easy. From deep in the cold, dark dungeons of Castle Dracula to the brutal Transylvanian countryside, you\'ll be in a constant fight for your life. As the sun sets, the evil Prince of Darkness rises and attacks as a bat, a vicious wolf, even an old man. With every multiple level - each divided into day and night - you\'re plunged deeper into the ultimate interactive experience, as Dracula rises in search of blood... yours! Incredibly realistic 3D graphics, digitized footage from the actual movie, CD sound, and characters based on real actors, turn this game into the ultimate interactive horror movie for your Sega CD.', '/images/snes/5223/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1a/DraculaSNES_boxart.jpg', NULL, NULL),
(5224, 'Brandish', NULL, NULL, 'Now that you\'ve mastered games like Breath of Fire and Brain Lord, we think you\'re ready for a role-playing game where the sun doesn\'t shine and the monsters grow big, really big! In Brandish, you stand accused of murder, being pursued by a fearless bounty hunter looking to collect the reward. About to be captured, you fall into a deep underworld maze filled with dangerous traps and deadly monsters including: giant crabs, headless fist pounding warrios and fire spitting gargoyles. With the bounty hunter still hot on your trail, you must navigate your way out of the mazes and back to the surface ASAP. Our only advice: stay alert, well armed and always moving upwards!', '/images/snes/5224/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/ee/Brandish_Coverart.png', NULL, NULL),
(5225, 'Brandish 2: The Planet Buster', NULL, NULL, 'Brandish 2 is a Role-Playing game, developed by Falcom and published by Koei,  which was released in Japan in 1995.', '/images/snes/5225/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/3/307123_front.jpg', NULL, NULL),
(5226, 'Brandish 2 Expert', NULL, NULL, 'Brandish 2 Expert is a Role-Playing game, published by Koei,  which was released in Japan in 1996.', '/images/snes/5226/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/7/36677_front.jpg', NULL, NULL),
(5227, 'Brawl Brothers', NULL, 'Rushing Beat Ran: Fukusei Toshi', 'A classic 2-player scrolling beat \'em up is back on the Virtual Console service! People are going missing in Bayside City and the rumors say someone conducting a shady human cloning experiment is responsible. For Rick (a.k.a. Hack) and Doug (a.k.a. Slash) this situation has become personal. Especially after three friends from their martial arts gym get abducted. The duo set off to the enemy\'s secret air fortress to sort this out. These guys know all the moves, from martial arts to pro wrestling throws, and they don\'t hesitate to use them. They’re not afraid of using knives, bats, and other things they find to get the job done. And if that wasn’t enough, when they get hurt they get angry—and you really don’t want to mess with them then. They ignore damage and hit even harder than usual! They’re ready for the action. The question is: are you?', '/images/snes/5227/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b7/Brawl_Brothers_Coverart.png', NULL, NULL),
(5228, 'BreakThru!', NULL, NULL, 'JUST WHEN YOU THOUGHT YOU WERE OVER TETRIS, HERE COMES BREAKTHRU!', '/images/snes/5228/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9d/Breakthru%21_SNES.jpg', NULL, NULL),
(5229, 'Breath of Fire', NULL, NULL, 'In a distant land, peace was maintained for thousands of years by a fearful dragon clan who could transform into powerful monsters. One day they discovered a goddess who could fulfill their every wish. Greed split the clan into Dark and Light Dragons, each battling the other to win her magic.', '/images/snes/5229/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2a/BreathofFire.png', NULL, NULL),
(5233, 'Breath of Fire II', NULL, NULL, 'The incredible sequel to the best-selling RPG hit Breath of Fire is here! You are the last member of the Dragon clan, fighting to rid the world of a growing evil. A cast of unusual and exciting companions joins you in your adventures across a wondrous land full of magic and mystery. You\'ll find strange mystic items, memorable monsters and exotic locations in your quest to conquer evil. There\'s strategy and spellcasting galore in the hours of compelling action and adventure that awaits you. Breath of Fire II is the ultimate in RPG excitement!', '/images/snes/5233/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Breathoffire2_box.jpg', NULL, NULL),
(5234, 'Brett Hull Hockey', NULL, NULL, '"Score On These Guys, You\'re A Hero. Miss It, And You\'re History."', '/images/snes/5234/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/BrettHullHockeyUSBoxShotSNES.jpg', NULL, NULL),
(5235, 'Brett Hull Hockey \'95', NULL, NULL, 'AL MICHAELS CALLS THE PLAY-BY-PLAY!', '/images/snes/5235/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/90/BrettHullHockey95BoxShotSNES.jpg', NULL, NULL),
(5236, 'Bronkie the Bronchiasaurus', NULL, NULL, 'A dinomite asthma adventure!', '/images/snes/5236/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5a/Bronkie_the_Bronchiasaurus_Coverart.png', NULL, NULL),
(5237, 'Brunswick World: Tournament of Champions', NULL, NULL, 'Get ready to hit the bowling alley with BRUNSWICK WORLD TOURNAMENT OF CHAMPIONS. You can compete with and against 11 Brunswick pro bowlers including Mike Aulby, Randy Peterson, and Johnny Petraglia in six different tournaments. There are three different gameplay modes Tournament, League, and Practice that allow you to show everyone the proper way to convert a 7-10 split. And in case you want to show your friends how you did it, the Instant Replay feature lets you watch it again and again. The game is licensed by Brunswick, so you\'ll find authentic equipment and rules in the most realistic bowling simulation the Super NES has ever seen.', '/images/snes/5237/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e6/Brunswick_World_-_Tournament_of_Champions_Coverart.png', NULL, NULL),
(5238, 'Brutal: Paws of Fury', 'Brutal: Animal Buranden', NULL, 'Across the world, invitations were delivered. Under the watchful eye of the great master Dali Llama, the worlds greatest martial artists would return to a place they knew well.. Brutal Island. Each will use their own unique mental and physical martial arts style and training in a tournament to prove the worlds one true champion.', '/images/snes/5238/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f8/Brutal_-_Paws_of_Fury_Coverart.png', NULL, NULL),
(5239, 'Bubsy in Claws Encounters of the Furred Kind', 'Yamaneko Bubsy no Daibouken', NULL, '"When you\'re a bankable star like me, they don\'t skimp on the megs, no siree bobcat... 16 megs! 16 mondo megs of marvelous me pouncing outta this cart - running, leaping, flying and falling all over your face! I\'m Bubsy. I\'m trying to save the Earth from Woolies. No, Woolies aren\'t what you get from wearing cheap underwear! Woolies are space dweebs in flying saucers out to purloin the earth\'s supply of yarnballs. But enough about them. Let\'s talk about me!" Over 40 awesome animations. Five wild worlds. Countless furballs. An average of 300 screens purr level. Seven music tracks, more sound effects, gorgeous graphics, and digitized voices!', '/images/snes/5239/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3b/Bubsy_1_cover.png', NULL, NULL),
(5240, 'Bubsy 2', NULL, NULL, 'Defeat droves of dive-bombing penguins! Squash squadrons of flying pigs! Trash tons of turbo-powered sheep! It\'s all waiting for you in this wacky, whirlwind adventure through the Amazatorium.', '/images/snes/5240/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9f/Bubsy_2_cover.png', NULL, NULL),
(5241, 'Bugs Bunny Rabbit Rampage', 'Bakkusu Banī Hachamecha Daibōken', NULL, '"What\'s up, Doc?" The rip-roaringest, cartoon adventure you\'ve ever seen! It stars Bug Bunny and the rest of your favorite Looney Tunes characters. And you\'re in control every uproarious minute!', '/images/snes/5241/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0c/Bugs_Bunny_Rabbit_Rampage_Coverart.png', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(5242, 'Bulls vs. Blazers and the NBA Playoffs', 'NBA Pro Basketball: Bulls vs Blazers', NULL, 'Real players. Real moves. Real NBA action. The complete 1993 NBA playoffs. All 16 teams, plus the East and West All Stars. Everything from fast breaks to alley-oops. Even current game stats. It\'s showtime.', '/images/snes/5242/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9f/Bulls_vs_Blazers.jpg', NULL, NULL),
(5243, 'Burai: Hachigyoku no Yuushi Densetsu', NULL, NULL, 'Burai: Hachigyoku no Yuushi Densetsu is a Role-Playing game, developed by Pandora Box and published by IGS (Japan),  which was released in Japan in 1993.', '/images/snes/5243/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/0/43410_front.jpg', NULL, NULL),
(5244, 'Bushi Seiryuuden: Futari no Yuusha', NULL, NULL, 'Bushi Seiryuuden: Futari no Yuusha is a Role-Playing game, developed by Game Freak and published by T&E Soft,  which was released in Japan in 1997.', '/images/snes/5244/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/1/43411_front.jpg', NULL, NULL),
(5245, 'Bust-a-Move', 'Puzzle Bobble', NULL, 'Which will burst first: your concentration or the level you\'re working on? It takes more than just swinging the bubble-turret and taking aim on the falling ceiling; tactical planning and mental dexterity are the only way to string together three or more bubbles and 100 wins to make it through all the bubble and ego-bursting rounds of Bust-A-Move!', '/images/snes/5245/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/50/Bust-a-Move_DS_Coverart.png', NULL, NULL),
(5246, 'Cacoma Knight in Bizyland', NULL, NULL, 'King Cacoma, the goofy golfing ruler of Bizyland needs you. Evil Queen Wagamama with the help of her meddling mirror have cast a spell on his Kingdom. Precious Princess Ophelia is trapped in the mirror! Bizyland has turned desolate and grey! Everyone but three slacking subjects are effected by the spell. It\'s up to you to grab the magic chalk and guide the quest to reclaim Bizyland and save the princess.', '/images/snes/5246/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/77/Cacoma_Knight_in_Bizyland_cover.jpg', NULL, NULL),
(5247, 'Cal Ripken Jr. Baseball', NULL, NULL, 'Cal Ripken Jr. 1991\'s Most Valuable Player in the American League. One of only twenty players in Major League Baseball to be MVP twice. An "iron man" in the majors, playing in over 1,600 consecutive games. When Cal plays, he plays for real! Cal Ripken Jr. Baseball brings that realism home. You\'ll get unequalled animation, accurate strategy-logic and players that respond to real game situations. You also get all-new, all-star features you won\'t find anywhere else: Choose your home field -domed, traditional outdoor or one tailored to power hitters. Play on natural grass or artificial turf and get accurate game play effects. Watch cutaway camera angles for realistic close-ups of the game action. Use Cal as a pinch-hitter for either team during the game - or create an "all-Cal" team that can challenge the best of them.', '/images/snes/5247/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/82/Calripkenjrsnes.jpg', NULL, NULL),
(5248, 'Cannon Fodder', NULL, NULL, 'Don\'t wait \'til you see the whites of their eyes. Don\'t kid yourself it will all be over by Christmas. Don\'t try to shut out the screams. And don\'t forget to wash your hands afterwards.', '/images/snes/5248/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5e/Cannon_fodder_box_art.jpg', NULL, NULL),
(5249, 'Capcom\'s MVP Football', NULL, NULL, 'BRUISING NFL FOOTBALL ACTION!', '/images/snes/5249/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4a/Capcoms_mvp_snes.jpg', NULL, NULL),
(5250, 'Capcom\'s Soccer Shootout', NULL, NULL, 'This Is Real Soccer!', '/images/snes/5250/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/5/51155_front.jpg', NULL, NULL),
(5251, 'Captain America and The Avengers (SNES)', NULL, NULL, 'Red Skull is back with a sinister mind-control device to command the most evil supervillains on earth against the forces of good. The supervillains want to control the universe!', '/images/snes/5251/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Captain_America_and_The_Avengers.jpg', NULL, NULL),
(5252, 'Captain Commando', NULL, NULL, 'The Commando Team is on the run! A corrupt mutant group headed by SCUMOCIDE plots to control the universe, and now the battle has come to Earth. CAPTAIN COMMANDO has assembled a team of 3 motley renegades to stop the crimewave and bring SCUMOCIDE to his knees. It won\'t be easy as many common Earth institutions become infested with SCUMOCIDE\'S minions, but strength and persistence runs the Commando Team into the crusade.', '/images/snes/5252/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c7/Captain_Commando.png', NULL, NULL),
(5253, 'Captain Novolin', NULL, NULL, 'Aliens disguised as sugary foods have captured the mayor of Pineville, and it\'s up to Captain Novolin to rescue him! Leaping maniac donuts and dodging ice cream blobs, Captain Novolin must save Mayor Gooden while managing his diabetes with a good diet, insulin, and exercise. It\'s an action-packed adventure that teaches you about diabetes management!', '/images/snes/5253/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/30/Captain_Novolin_Coverart.png', NULL, NULL),
(5254, 'Captain Tsubasa III: Koutei no Chousen', NULL, NULL, 'Captain Tsubasa 3 is a Sports game, developed and published by Tecmo, which was released in Japan in 1992.\n', '/images/snes/5254/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0a/CaptainTsubaba3BoxShotSNES.jpg', NULL, NULL),
(5255, 'Captain Tsubasa IV: Pro no Rival Tachi', NULL, NULL, 'Captain Tsubasa IV: Pro no Rival Tachi is a Sports game, developed and published by Tecmo,  which was released in Japan in 1993.', '/images/snes/5255/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/27/Captain_Tsubasa_4_-_Pro_no_Rival_Tachi_cover.jpg', NULL, NULL),
(5256, 'Captain Tsubasa V: Hasha no Shōgō Campione', NULL, NULL, 'Captain Tsubasa V: Hasha no Shougou Campione is a Sports game, developed and published by Tecmo,  which was released in Japan in 1994.', '/images/snes/5256/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/aa/CTVHnSCJPBoxShotSNES.jpg', NULL, NULL),
(5257, 'Captain Tsubasa J: The Way to World Youth', NULL, NULL, 'Captain Tsubasa J is a Sports game, developed by Bec and published by Bandai, which was released in Japan in 1995.\n', '/images/snes/5257/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/45/Captain-tsubasa-j-sfc.jpg', NULL, NULL),
(5258, 'Caravan Shooting Collection', NULL, NULL, 'Caravan Shooting Collection is a Miscellaneous game, developed and published by Hudson,  which was released in Japan in 1995.', '/images/snes/5258/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/0/31860_front.jpg', NULL, NULL),
(5259, 'Carrier Aces', NULL, NULL, 'Battle in the air for control of the sea. As a Japanese or American World War II pilot, attack the enemy\'s ships in fighters, dive bombers, or torpedo bombers. Outfit an entire squadron in one of the seven campaign wars. But it won\'t be easy. Your opponent will send up defense fighters, and shoot you out of the sky with antiaircraft fire. Destroy your target in brilliant split screen mode-7 graphics, and then, somehow coax your battered planes to your aircraft carrier. No time for rest; prepare your defenses because the enemy is coming after you. Play against the computer or a friend in this 16 meg airwar.', '/images/snes/5259/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/af/CarrierAcesUSBoxShotSNES.jpg', NULL, NULL),
(5260, 'Casper', NULL, NULL, 'Hey! You\'re not afraid of a challenge, are you? Of course not! You laugh in the face of fear... all three of them. Use your ghostly skills to solve complex puzzles, find secret passageways, hidden clues, and locate the lost pieces of the dismantled Lazarus Machine. Based on the hit movie, including some of the same great 3D animation, hilarious gags and original character voices, CASPER is a challenging adventure for you, your family and your friends! Just remember to choose your friends carefully!', '/images/snes/5260/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/6/2266_front.jpg', NULL, NULL),
(5261, 'Casper (Super Famicom)', NULL, NULL, 'Casper (Super Famicom) is an Adventure game, developed by Natsume and published by KSS, which was released in Japan in 1997.', '/images/snes/5261/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/9/185299_front.jpg', NULL, NULL),
(5262, 'Castlevania: Dracula X', 'Akumajō Dracula XX', NULL, 'Rising up from his eternal sleep, Count Dracula is back again to battle the descendants of the great vampire-stalking Belmont family of the Castlevania series. He has summoned his dark minions-Cerberus, Minaurus, and the Salamander-to bring a reign of terror on the land.', '/images/snes/5262/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d1/Dracula-sotn.png', NULL, NULL),
(5263, 'CB Chara Wars: Ushinawareta Gag', NULL, NULL, 'CB Chara Wars is an Action game, developed by Almanic Corp. and published by Banpresto,  which was released in Japan in 1992.', '/images/snes/5263/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/1/312601_front.jpg', NULL, NULL),
(5264, 'Champions World Class Soccer', NULL, NULL, 'GO FOR THE GOALS!! 32 International teams compete in hard-charging soccer action!', '/images/snes/5264/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/91/Champions_World_Class_Soccer_Coverart.png', NULL, NULL),
(5265, 'Championship Soccer \'94', 'Sensible Soccer: International Edition', NULL, 'It\'s addictive! No other soccer game compares. Created for hardcore soccer fans, Championship Soccer \'94 delivers the ultimate in speed, game control and ultra-realistic gameplay. It\'s the perfect soccer game for players who demand an unbeatable combination of strategy and action. Take charge of one of 100 European club or national teams from around the world. Superb gameplay featuring unique after-touch control of height and curve of ball.', '/images/snes/5265/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/87/World_Championship_Soccer_Coverart.png', NULL, NULL),
(5266, 'Chaos Seed', NULL, NULL, 'Chaos Seed is a Strategy game, developed by Neverland and published by Taito Corporation,  which was released in Japan in 1996.', '/images/snes/5266/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/6/24116_front.jpg', NULL, NULL),
(5267, 'The Chessmaster', NULL, NULL, 'Introducing...The Chessmaster, the most powerful chess program in the world today - and the friendliest! The Chessmaster is the perfect chess companion, adversary and instructor for any chess player, beginner to expert.', '/images/snes/5267/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/bc/Chessmaster_2000_cover.png', NULL, NULL),
(5268, 'Chester Cheetah: Too Cool to Fool', NULL, NULL, 'Put yourself in his paws. You\'re a cool cat. So you would like to be treated like that. But no! You\'re stuck in a zoo with nothing to do. Mean Eugene, the Zoo Keepin\' Fiend has planned an ugly scene. He wants to nail your tail without fail. So, he steals your wheels to cool your heels. Then he hides the parts in the zoo just to fool you. And that\'s just the beginning in Eugene\'s way of winning. But, stay cool and you can rule. Just find your bike and you can go where you like. The rule is cool. Remember a cool cat is just... TOO COOL TO FOOL!\n', '/images/snes/5268/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/ce/Chester_Cheetah_-_Too_Cool_to_Fool_Coverart.png', NULL, NULL),
(5269, 'Chester Cheetah: Wild Wild Quest', NULL, NULL, 'It\'s a groove to be on the move. But, if you\'re Chester Cheetah, "chill is the pill." So, when you are spotted in "Not-So-Great-Falls, Montana," "Unclearwater, Florida," and "Little Shock, Arkansas" you follow the "law of the paw," and run for the fun. Pity, these cities can\'t spot a cat that knows where it\'s at. They want to bring you down in their town. Now, follow your feet and take to the street. It\'s cool to make the rules. "Wild, Wild Quest" features a full 8 Meg, 16 bit platform of adventure. Cool characters and wild-style graphics make this trip a "Wild, Wild Quest" of the best!', '/images/snes/5269/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/97/Chester_Cheetah_-_Wild_Wild_Quest_Coverart.png', NULL, NULL),
(5271, 'Chibi Maruko-chan: Harikiri 365-Nichi no Maki', NULL, NULL, 'Chibi Maruko-Chan: Harikiri 365-Nichi no Maki is a Miscellaneous game, developed by SAS Sakata and published by Epoch,  which was released in Japan in 1991.', '/images/snes/5271/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/6/311556_front.jpg', NULL, NULL),
(5272, 'Chibi Maruko-chan: Mezase! Minami no Island!!', NULL, NULL, 'Chibi Maruko-Chan: Mezase! Minami no Island!! is an Action game, developed and published by Konami,  which was released in Japan in 1995.', '/images/snes/5272/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/4/312554_front.jpg', NULL, NULL),
(5273, 'Chinhai', NULL, NULL, 'Chinhai is a Puzzle game, developed by Pixel and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/5273/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/1/311621_front.jpg', NULL, NULL),
(5274, 'Chō Aniki: Bakuretsu Rantouden', NULL, NULL, 'Cho Aniki: Bakuretsu Ranto Hen is an Action game, developed by Bits Laboratory and published by NCS,  which was released in Japan in 1995.', '/images/snes/5274/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/1/20561_front.jpg', NULL, NULL),
(5275, 'Chō Genjin 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5276, 'Chō Mahou Tairiku WOZZ', NULL, NULL, 'Chou-Mahou Tairiku Wozz is a Role-Playing game, developed by RED Entertainment and published by Bullet Proof Software,  which was released in Japan in 1995.', '/images/snes/5276/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/2/43382_front.jpg', NULL, NULL),
(5277, 'Choplifter III', NULL, NULL, 'Sergeant Wallen was shot down by guerrilla forces last night while patrolling over enemy lines. He\'s wounded, sleepless and desperate for help. There\'s no time for diplomacy - YOU\'RE GOING IN!', '/images/snes/5277/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6a/Choplifter3sfc.jpg', NULL, NULL),
(5278, 'Choujikuu Yousai Macross: Scrambled Valkyrie', NULL, NULL, 'Choujikuu Yousai Macross: Scrambled Valkyrie is an Action game, developed by WinkySoft and published by Zamuse,  which was released in Japan in 1993.', '/images/snes/5278/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/8/37528_front.jpg', NULL, NULL),
(5279, 'Chrono Trigger', NULL, NULL, 'The millennium. A portal is opened. The chain of time is broken. A young man is transported into the past, altering the course of history and the outcome of the future. He has to find his way home, but first he must travel to the outer edges of time to repair the world\'s chronology. On the way he encounters strange friends and foes, utilizes incredible devices and vehicles, and penetrates and neutralizes the fortresses of the past, present, and future. A paradox has been created. If he does not restore the order of time, nothing will ever be the same. He is the one who will become a hero. He is Crono.', '/images/snes/5279/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a7/Chrono_Trigger.jpg', NULL, NULL),
(5280, 'Civilization', NULL, NULL, 'What would you do if you were emperor?', '/images/snes/5280/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5c/CIVILIZATION-V-FRONT-OF-BOX.jpg', NULL, NULL),
(5281, 'Classic Road', NULL, NULL, 'Classic Road is a Sports game, developed by Opera House and published by Victor Interactive Software,  which was released in Japan in 1993.', '/images/snes/5281/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/6/306866_front.jpg', NULL, NULL),
(5282, 'Classic Road II', NULL, NULL, 'Classic Road II is a Sports game, developed by Opera House and published by Victor Interactive Software,  which was released in Japan in 1995.', '/images/snes/5282/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/1/31831_front.jpg', NULL, NULL),
(5283, 'ClayFighter', NULL, NULL, 'Sticks and stones might make him groan, but clay really ticks him off!  Bad Mister Frosty is the name, and action is the game. Fists and feet will fly (and other parts) as Frosty and his friends smack it out in head-to-head fighting action.', '/images/snes/5283/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/26/ClayFighter_Coverart.png', NULL, NULL),
(5284, 'ClayFighter: Tournament Edition', NULL, NULL, 'Clay never had it so good. This outrageous new Clay Fighter Tournament Edition lets you smack it up with eight friends at a time. So, let the clay fly.', '/images/snes/5284/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ec/Box_art_Virtual_Pool_Tournament_Edition.jpg', NULL, NULL),
(5285, 'ClayFighter 2: Judgment Clay', NULL, NULL, 'Bad Mister Frosty is buffed up and faster than greased lightning. This surly snowman has mayhem on his mind... but there\'s some bunny new in town with a hare-trigger temper. You can bet the fur will fly as this wild hare unleashes a barrage of blistering rabbit punches on Bad Mister Frosty. Could there be a new top bunny in town, or will he get his cottontail kicked?', '/images/snes/5285/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/44/C2_Judgement_Clay_cover.jpg', NULL, NULL),
(5286, 'Claymates', NULL, NULL, 'Clay animation will never be the same now that Professor Potty has bagged by the evil witch doctor Jobo. It\'s up to Professor Putty\'s son Clayton to set things right. With the help of Dad\'s super secret invention, young Clayton can transform into one of five different animals as he sets of to rescue. Grab the hidden pieces of clay and "poof" - you can change just in the nick of time. Tons of levels and power-ups take this \'round-the-world adventure straight to the 100! As an added bonus, Claymates features bonus games between levels. Climb a tree, dig your way through underground caverns, soar through the air, accelerate to unimaginable speeds and explore the ocean depths - nobody is going to gobble this guppy!', '/images/snes/5286/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/84/Claymates_Coverart.png', NULL, NULL),
(5287, 'Cliffhanger (SNES)', NULL, NULL, 'Based on the white-knuckle action-adventure movie starring Sylvester Stallone, Cliffhanger challenges you to brave thundering avalanches, icy cliffs, and the head-spinning heights of the Rocky Mountains while you combat a vicious group of well-armed, extremely dangerous fugitives. You\'ll hang on for dear life through 7 exciting levels requiring all your strength and skill just to survive. Experience wild new forms of game play like mountain climbing and cave exploration, along with all the excitement of all the incredible hand-to-hand and armed combat action. The adventure isn\'t over until you find $100 million in stolen loot, defeat the fugitives, and reunite with your friends!', '/images/snes/5287/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/6/46086_front.jpg', NULL, NULL),
(5288, 'Clock Tower', NULL, NULL, 'Clock Tower is an Adventure game, developed and published by Human Entertainment,  which was released in Japan in 1995.', '/images/snes/5288/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b4/Clock_Tower_series_logo.png', NULL, NULL),
(5289, 'ClockWorks', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5290, 'Clue', NULL, NULL, 'Who killed Mr. Boddy?', '/images/snes/5290/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/18/Clue_Poster.jpg', NULL, NULL),
(5291, 'College Football USA \'97: The Road to New Orleans', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5292, 'College Slam', NULL, NULL, 'Welcome to the College Slam arena! The crowd\'s on their feet... over 40 college teams, cheerleaders... authentic fight songs... all the rivalry... all the madness! There\'s a wild dunk... the backboard shatters! This is the slammingest hoops action ever... and there\'s more... head-to-head, tournament, and season-long play! College Slam is gonna take you to school!', '/images/snes/5292/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/00/College_Slam_Coverart.png', NULL, NULL),
(5293, 'Columns (SNES)', NULL, NULL, 'Drift back to ancient Phoenicia and challenge yourself with Columns, a game favored by middle eastern merchants. In this mesmerizing pastime, tinker with your riches to align glittering jewels across, down, or diagonally. As you line up colors, the gems vanish and more sparklers drop from above. The challenge increases as the jewels fall more rapidly. You must quickly align them before the columns reach the top. Imagine yourself on the warm Mediterranean coast, or drifting over a languid sea. Forget the passage of time, and tickle your mind with Columns, the brilliant game of strategy and skill.', '/images/snes/5293/cover.png', 'https://gamefaqs.akamaized.net/images/platform-100/snes.png', NULL, NULL),
(5294, 'The Combatribes', NULL, NULL, 'The Big Apple\'s Gone Rotten', '/images/snes/5294/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/15/Combatribes.png', NULL, NULL),
(5295, 'Computer Nouryoku Kaiseki: Ultra Baken', NULL, NULL, 'Ultra Baken is a Sports game, developed and published by Culture Brain,  which was released in Japan in 1995.', '/images/snes/5295/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/6/307086_front.jpg', NULL, NULL),
(5296, 'Congo\'s Caper', 'Tatakae Genshijin 2: Rookie no Bouken', NULL, 'If you were a monkey, just hangin\' out in the jungle with your chimp-chick, and a magic ruby fell out of the sky and zapped you both, turning you into half-humans, and a demon-kid swooped down and made off with your girl  -- what would you do? You\'d high-tail it after them and stop at nothing to save her, that\'s what -- \'cause you\'re Congo, the money-turned-superkid, and only you can uphold the law of the jungle! But it\'s more than a jungle out there -- your search for little Congette will take you from ghost towns to pirate ships to ninja castles to the belly of a Tyrannosaurus. This is no time for a banana-break -- you\'d better get down to monkey business!', '/images/snes/5296/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b6/Congo%27s_Caper_cover.jpg', NULL, NULL),
(5297, 'Contra III: The Alien Wars', NULL, 'Contra Spirits', 'Welcome to 2636, the year the Notorious One gets even, with an unprecendented alien onsalught orchestrated to push 16-bit technology and its commandos to their ultimate reaches.', '/images/snes/5297/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b1/Contra_III_game_cover.png', NULL, NULL),
