(5312, 'Cyber Spin', 'Shinseiki GPX: Cyber Formula', NULL, 'The Grand Prix Championship ain\'t for wimps! Sever drivers from around the World all want that #1 spot. Take the Cyber Car to victory over some of the meanest courses ever devised?', '/images/snes/5312/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9b/Cyber_Spin_SNES.jpg', NULL, NULL),
(5313, 'Cybernator', 'Assault Suits Valken', NULL, '2065 AD. The nations of Earth have once again split into two major powers. The line dividing these new arch enemies reaches as far as the lunar frontier, where axis forces have constructed a moon base capable of launching monolithic intergalactic battle cruisers.', '/images/snes/5313/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/7/50587_front.jpg', NULL, NULL),
