(5315, 'Daffy Duck: The Marvin Missions', NULL, NULL, 'Get ready to duck and cover. Because the fate of the planets rests squarely on Duck Dodgers--alias Daffy Duck--the fearless space crusader from the cartoon adventure series.', '/images/snes/5315/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a2/DDMM_front.jpg', NULL, NULL),
