(5324, 'Darius Twin', NULL, NULL, 'For countless millennia, the space tyrant Belser and his cosmic marauders have terrorized this once peaceful galaxy. Now, no sector remains safe from these stellar mercenaries and their evil empire. The Galactic Federation has finally called on two of its ace pilots and their sleek Silver Hawk warships to do battle with Belser\'s malicious metal menaces and reclaim the beloved planet Darius. Climb into the pilot\'s seat for a solo mission against Belser\'s forces; or engage the enemies with a fellow Federation pilot in a two-player simultaneous team attack. The future of the galaxy rests on the success of this perilous quest.', '/images/snes/5324/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/0/50600_front.jpg', NULL, NULL),
(5325, 'Dark Half', NULL, NULL, 'Dark Half is a Role-Playing game, developed by West One and published by Enix Corporation,  which was released in Japan in 1996.', '/images/snes/5325/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/8/39768_front.jpg', NULL, NULL),
(5326, 'Dark Kingdom', NULL, NULL, 'Dark Kingdom is a Role-Playing game, developed and published by Nippon Telenet,  which was released in Japan in 1994.', '/images/snes/5326/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/82/Untold_Legends.jpg', NULL, NULL),
(5327, 'Dark Law: Meaning of Death', NULL, NULL, 'Dark Law is a Role-Playing game, developed by SAS Sakata and published by ASCII Entertainment,  which was released in Japan in 1997.', '/images/snes/5327/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/8/42818_front.jpg', NULL, NULL),
(5328, 'Date Kimiko no Virtual Tennis', NULL, NULL, 'Date Kimiko no Virtual Tennis is a Sports game, developed by Jorudan and published by B-AI,  which was released in Japan in 1994.', '/images/snes/5328/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/4/9/312449_front.jpg', NULL, NULL),
(5329, 'David Crane\'s Amazing Tennis', NULL, NULL, 'Trade in your racquet for a game controller. The category of sports home video games has just taken a quantum leap forward into a new dimension of realism - David Crane\'s Amazing Tennis! Developed by David Crane, an industry pioneer and one of the best-selling game designers of all time, Amazing Tennis redefines the term "state of the art." Every aspect of play has been re-created to ensure a precision feel and accuracy other tennis video games can\'t match. Amazing Tennis utilizes 22 different planes of depth and motion-picture-quality animation to provide a revolutionary gaming experience - the next best thing to being out there on the court yourself!', '/images/snes/5329/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/30/David_Crane%27s_Amazing_Tennis.jpg', NULL, NULL),
(5330, 'Daze Before Christmas', NULL, NULL, '\'Twas but Daze Before Christmas and at Santa\'s shop work on the toys has suddenly stopped!', '/images/snes/5330/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Daze_before_christmas_box_art.jpg', NULL, NULL),
(5331, 'Deae Tonosama Appare Ichiban', NULL, NULL, 'Deae Tonosama Appare Ichiban is an Action game, published by SunSoft,  which was released in Japan in 1995.', '/images/snes/5331/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/1/311371_front.jpg', NULL, NULL),
(5332, 'Dear Boys', NULL, NULL, 'Dear Boys is a Sports game, developed by Kan\'s and published by Yutaka,  which was released in Japan in 1994.', '/images/snes/5332/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/46/DearBoys_Premium.png', NULL, NULL),
(5333, 'The Death and Return of Superman', NULL, NULL, 'Brace yourself for a hard-hitting fight to the finish that lets you relive the classic DC comic book series! As Superman, fight for your life against mighty Doomsday, the vile distributor of death and destruction! Then, control the destiny of the four Supermen - each claiming to be the one, true Superman! Explode through 10 levels of super-powered battles and fly at furious speeds - until only the real Superman is left standing!', '/images/snes/5333/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/08/The_Death_and_Return_of_Superman.png', NULL, NULL),
(5334, 'Death Brade', NULL, NULL, 'Death Brade is an Action game, developed by Data East and published by I\'Max,  which was released in Japan in 1993.', '/images/snes/5334/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/3/306853_front.jpg', NULL, NULL),
(5335, 'Dekitate High School', NULL, NULL, 'Dekitate High School is a Strategy game, developed by C-Lab and published by Bullet Proof Software,  which was released in Japan in 1995.', '/images/snes/5335/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/22/Dekitate-high-school-sfc.jpg', NULL, NULL),
(5336, 'Demolition Man', NULL, NULL, 'Two men enter the future, bringing with them the values of a brutal past. One cop. One criminal. One mission: destroy the other man first!', '/images/snes/5336/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/4/45064_front.jpg', NULL, NULL),
(5337, 'Demon\'s Crest', 'Demon\'s Blazon Makaimura Monshō-hen', NULL, 'The demon realm is peaceful until six wondrous stones fall from the sky. Each stone represents a portion of the Demon\'s Crest. When united, the stones of the Demon\'s Crest bring the user ultimate power over demons and humans.', '/images/snes/5337/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/21/Demonscrest_us.jpg', NULL, NULL),
(5338, 'Dennis the Menace', 'Dennis', NULL, 'Yipes. Grab your slingshot, water pistol and peashooter. Margaret, the fist-fighting doll-toting priss and Joey, Dennis\'  wimpy but loyal friend, are missing and so is Mr. Wilson\'s valuable coin collection.', '/images/snes/5338/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/2/46142_front.jpg', NULL, NULL),
