(5346, 'Dezaemon: Kaite Tsukutte Asoberu', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5347, 'D-Force', 'Dimensional Force', NULL, 'You\'ve got the fastest bird to be had, but we\'re not sure you can handle it. If you\'re quick enough, you\'ll command the latest Nuclear Apache Helicopter, D-Force, through 7 bone-crushing levels. You\'ll roam six countries on your seemingly endless search for a powerful oil-rich Mid-Eastern Dictator. If you fail, we\'ll all be learning a new language soon! Comprende?', '/images/snes/5347/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0d/D-Force_SNES_Cover.jpg', NULL, NULL),
