(5350, 'DinoCity', 'Dino Wars: Kyouryuu Oukoku heno Daibouken', NULL, 'TEAM UP WITH THE DINOSAURS FOR A SUPER-HUGE ADVENTURE!', '/images/snes/5350/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/DinocitySNES_boxart.jpg', NULL, NULL),
(5351, 'Dino Dini\'s Soccer', NULL, NULL, 'From the creator of KICK OFF - the best-selling series of football games - comes DINO DINI\'S SOCCER. A game so packed-full of features and advanced gameplay, you\'ll still be at it when France kick off the next World Cup!', '/images/snes/5351/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/80/Dino_Dinis_Soccer_cover_art.jpg', NULL, NULL),
(5352, 'Dirt Racer', NULL, NULL, '- Challenging high performance, texture mapped 3D off road racing game for 1 or 2 players.', '/images/snes/5352/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/2/89312_front.jpg', NULL, NULL),
(5353, 'Dirt Trax FX', NULL, NULL, 'Get revved up for 3-D dirt bike action in Dirt Trax FX.', '/images/snes/5353/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/9/50629_front.jpg', NULL, NULL),
(5354, 'Disney\'s Aladdin (SNES)', NULL, NULL, 'For years, Jafar, the Sultan\'s evil advisor has sought a magic treasure - a single lamp that holds the key to the greatest power in the world. With this goal in sight, Jafar learns that only one person in the world can claim the magic lamp from the dreaded Cave of Wonders - one whose rags hide a heart that is pure - a diamond in the rough!', '/images/snes/5354/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fd/Disney%27s_Aladdin_%28SNES%29_cover_art.jpg', NULL, NULL),
(5355, 'Disney\'s Beauty and the Beast (SNES)', 'Bijo to Yajuu', NULL, 'A self-centered prince is transformed into a hideous beast by the magic of an enchantress. What\'s more, all his servants have been turned into household objects.', '/images/snes/5355/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/8/48928_front.jpg', NULL, NULL),
(5356, 'Disney\'s Bonkers', NULL, NULL, 'Once upon a Time in Toontown. . .', '/images/snes/5356/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/4/50544_front.jpg', NULL, NULL),
(5357, 'Disney\'s Pinocchio', NULL, NULL, 'Play as Pinocchio and Jiminy Cricket, through nine levels of remarkable gameplay and stunning animation from the Disney Interactive Studios. Choose the correct paths of truth, bravery and unselfishness to ensure that the Blue Fairy grants you your ultimate wish!', '/images/snes/5357/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/3/47923_front.jpg', NULL, NULL),
