(5364, 'Donald Duck no Mahō no Bōshi', NULL, NULL, 'Donald Duck no Mahou no Boushi is an Action game, developed by SAS Sakata and published by Epoch,  which was released in Japan in 1995.', '/images/snes/5364/cover.svg', 'https://upload.wikimedia.org/wikipedia/en/b/b4/Donald_Duck.svg', NULL, NULL),
(5365, 'Donkey Kong Country', 'Super Donkey Kong', NULL, 'Donkey Kong is back with a new sidekick, Diddy Kong, in a crazy island adventure! Challenged by the crazed tribe of reptilian Kremlings, they endeavor to get back their stolen banana horde! Armed with lightning-quick moves, chest-pounding muscle and awesome aerial acrobatics, our duo is ready to face their cunning adversaries. With the help of Donkey Kong\'s quirky family and his wild animal mounts, they squabble and scamper their way through the unending monkey mayhem.', '/images/snes/5365/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c1/Dkc_snes_boxart.jpg', NULL, NULL),
(5366, 'Donkey Kong Country 2: Diddy\'s Kong Quest', 'Super Donkey Kong 2: Dixie and Diddy', NULL, 'Okay kid, wipe that drool off your chin and listen up if you really want to learn something about this game. Sure, it\'s got newfangled computer graphics and what Diddy calls stereo sound that "rocks heavily and with little resistance!" BUT, the game play? Well, they FINALLY added some proper challenge to the game - a snap for me of course. AND THE STORY? You sure ask a lot of questions, kid! Kaptain K. Rool and his cruelest cut-throat Kremlings have kidnapped that flea-bitten ape Donkey Kong. I figured I\'d rescue him when the little pip-squeak DIDDY pops up along with his girlfriend, and they head off fixin\' to prove themselves heroes or something. Come to think of it, I haven\'t laid eyes on those two for quite a while. I just may have to help them out after all!', '/images/snes/5366/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c3/DK_Country_2.jpg', NULL, NULL),
(5367, 'Donkey Kong Country 3: Dixie Kong\'s Double Trouble!', 'Super Donkey Kong 3: Nazo no Krems Shima', NULL, 'Revisit Donkey Kong Island and join the Kong family for their latest adventure. The Kremlings have a mysterious new leader named KAOS and are up to their usual mischief, even capturing Donkey Kong and Diddy Kong. Now it\'s up to Dixie Kong and the newest Kong, a giant infant named Kiddy, to rescue the two missing apes.', '/images/snes/5367/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cc/Dkc3_snes_boxart.jpg', NULL, NULL),
(5368, 'Doom', NULL, NULL, 'Welcome to Doom, soldier. Now shut up and start fighting because there\'s no time to waste! We\'re talking total war against the forces of evil with the only thing standing between civilization and the end of everything as we know it is you -- one angry Marine with a handgun and a bad attitude. This is the full-auto, 16-meg faithful version of the PC original. Which means all the same monsters, levels, weapons and surprises are around for a screaming fast descent into danger with sudden death lurking around every corner. Strap on your ammo and prepare to spit lead. Because now\'s your chance to be a hero. Or die trying.', '/images/snes/5368/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/57/Doom_cover_art.jpg', NULL, NULL),
(5369, 'Doom Troopers', NULL, NULL, 'You want the rush from taking on an army of mutated warriors single-handed? Then you may have what it takes to make it as a Doomtrooper!!! Take on worlds infested with the mutated hordes of Dark Legion mutants and teach them the true meaning of fear!', '/images/snes/5369/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/5/24005_front.jpg', NULL, NULL),
(5370, 'Doomsday Warrior', 'Taiketsu!! Brass Numbers', NULL, 'Earth faced desperate times. In nearly every country water supplies were contaminated and famine raged. Governments scrambled to supply good food and water to the masses.', '/images/snes/5370/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/3/2/50632_front.jpg', NULL, NULL),
(5371, 'Doraemon: Nobita to Yousei no Kuni', NULL, NULL, 'Doraemon: Nobita to Yousei no Kuni is an Action Adventure game, developed by SAS Sakata and published by Epoch,  which was released in Japan in 1993.', '/images/snes/5371/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/8/8/296488_front.jpg', NULL, NULL),
(5372, 'Doraemon 2: Nobita no Toys Land Daibouken', NULL, NULL, 'Doraemon 2: Nobita no Toys Land Daibouken is an Action game, developed by SAS Sakata and published by Epoch,  which was released in Japan in 1993.', '/images/snes/5372/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/5/303745_front.jpg', NULL, NULL),
(5373, 'Doraemon 3: Nobita to Toki no Hougyoku', NULL, NULL, 'Doraemon 3: Nobita to Toki no Hougyoku is an Action Adventure game, developed by AIM and published by Epoch,  which was released in Japan in 1994.', '/images/snes/5373/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/8/303758_front.jpg', NULL, NULL),
(5374, 'Doraemon 4: Nobita to Tsuki no Oukoku', NULL, NULL, 'Doraemon 4: Nobita to Toki no Okoku is an Action game, developed by Agenda and published by Epoch,  which was released in Japan in 1995.', '/images/snes/5374/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/0/303760_front.jpg', NULL, NULL),
(5375, 'DoReMi Fantasy: Milon no Dokidoki Daibouken', NULL, NULL, 'This is an action game where an energetic boy named Milon sets off on a great adventure in a cute fairy-tale world. Piccolo is a village in the country of Fantasia. One day, they hear from the fairy Alis that songs and music have disappeared from the forest. Suddenly, the wizard Amon appears, grabs Alis and vanishes with her. The brave Milon must now go on a journey to rescue his kidnapped friend, with his bubble shooter as his only weapon.', '/images/snes/5375/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b9/Doremi_Fantasy_cover.jpg', NULL, NULL),
(5376, 'Dossun! Ganseki Battle', NULL, NULL, 'Dossun! Ganseki Battle is a Puzzle game, published by I\'Max,  which was released in Japan in 1994.', '/images/snes/5376/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/2/43412_front.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(5377, 'Double Dragon V: The Shadow Falls', NULL, NULL, 'Double Dragon V: The Shadow Falls! Featuring 12 big lightning-fast characters! Four to six special moves for each fighter! Set your own strength, defense and more. Three different fighting modes. Secret moves and codes! Customizable controls. Unique final moves. Hot rock music tracks and 130+ sound effects!', '/images/snes/5377/cover.gif', 'https://upload.wikimedia.org/wikipedia/en/f/f1/Ddvsnes.gif', NULL, NULL),
(5378, 'Down the World: Mervil\'s Ambition', NULL, NULL, 'Down the World is a Role-Playing game, developed and published by ASCII Entertainment,  which was released in Japan in 1994.', '/images/snes/5378/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/8/306978_front.jpg', NULL, NULL),
(5379, 'Downtown Nekketsu Baseball Monogatari: Baseball de Shoufuda! Kunio-kun', NULL, NULL, 'Downtown Nekketsu Baseball Monogatari: Baseball de Shoubu da! Kunio-kun is a Sports game, developed and published by Technos,  which was released in Japan in 1993.', '/images/snes/5379/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/6/31746_front.jpg', NULL, NULL),
(5380, 'Dragon: The Bruce Lee Story (SNES)', NULL, NULL, 'Enter the world of Dragon. A place where the martial arts legend Bruce Lee lived for 32 troublesome years. A place where you will encounter a multitude of the smartest and fiercest opponents ever to be seen in a Genesis beat-\'em-up! At your disposal is a devastating array of over 35 different fighting moves. You WILL need them... Contains three different fighting styles: Mantis, Fighter, and Nunchaku. Many special secret moves to discover!', '/images/snes/5380/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/5/31005_front.jpg', NULL, NULL),
(5381, 'Dragon Ball Z: Hyper Dimension', NULL, NULL, 'Dragon Ball Z: Hyper Dimension is an Action game, developed by TOSE and published by Bandai,  which was released in Japan in 1996.', '/images/snes/5381/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/4/4/50644_front.jpg', NULL, NULL),
(5382, 'Dragon Ball Z: Legend of the Super Saiyan', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5383, 'Dragon Ball Z: Super Butōden', NULL, NULL, NULL, '/images/snes/5383/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5c/Dbz_exBoxart_3920.png', NULL, NULL),
(5384, 'Dragon Ball Z: Super Butōden 2', NULL, NULL, 'Dragon Ball Z Super Butouden 2 is an Action game, developed by TOSE and published by Bandai,  which was released in Japan in 1993.', '/images/snes/5384/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5c/Dbz_exBoxart_3920.png', NULL, NULL),
(5385, 'Dragon Ball Z: Super Butōden 3', 'Dragon Ball Z: ChomutujeonKR', NULL, 'Dragon Ball Z Super Butouden 3 is an Action game, developed by TOSE and published by Bandai,  which was released in Japan in 1994.', '/images/snes/5385/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5c/Dbz_exBoxart_3920.png', NULL, NULL),
(5386, 'Dragon Ball Z: Super Gokuden Totsugeki Hen', NULL, NULL, 'Dragon Ball Z Super Gokuden: Totsugeki-Hen is a Role-Playing game, developed by TOSE and published by Bandai,  which was released in Japan in 1995.', '/images/snes/5386/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/6/24216_front.jpg', NULL, NULL),
(5387, 'Dragon Ball Z: Super Gokuden Kakusei Hen', NULL, NULL, 'Dragon Ball Z Super Gokuden: Kakusei-Hen is a Role-Playing game, developed by TOSE and published by Bandai,  which was released in Japan in 1995.', '/images/snes/5387/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/7/24217_front.jpg', NULL, NULL),
(5388, 'Dragon Knight 4', NULL, NULL, 'Premium Event! Get Free 3000 Coins! Run the app for free 3000 Coins! (First time only!)? Features? Choose from 4 classes with distinctive play styles! - Swordmaster ? a master warrior - Sorceress ? a skilled magician. - Black Magician ? the caster of dark powers - Blacksmith ? a hammer-wielding fighter. ? No more old-style RPG; the ever-evolving Spirits! - Divided into the Angel type and the Demon type, Spirits grow up to level 30 in form of wings. - Spirits will help you through your journey with various effects!? Online Network Dungeons! - Divided into three difficulties, network dungeons guarantee more fun and challenge! - New dungeons will be added in future updates!? Finished the story? Try Player Vs Player arena! - When you\'re done with every monsters and bosses, challenger other players. - Gain reputations through ladder tournament. - Create your own character by purchasing exclusive items with PVP reputation points!* You can upload your save data by entering Main menu  Options  Data Backup.?Change of platform(Serial, USIM, Phone number) may cause problems with the app.', '/images/snes/5388/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9f/Dragon_Knight_4_SNES.png', NULL, NULL),
(5389, 'Dragon Quest I and II', NULL, NULL, 'Step back into the wondrous land of Alefgard and defeat the evil DracoLord in the standard-setting Dragon Warrior I. Continue your amazing adventure and banish the foul Hargon in Dragon Warrior II. With tons of monsters to fight, treasures to find and mysteries to explore, you may never want to turn off your Game Boy Color again!', '/images/snes/5389/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/8/25398_front.jpg', NULL, NULL),
(5390, 'Dragon Quest III: Soshite Densetsu e...', NULL, NULL, 'Your father, the brave Ortega, is dead. He set off to destroy the Demon lord Baramos but fell in glorious battle. Unless stopped, Baramos will unleash a torrent of evil that will destroy the world. You must stop Baramos and discover the legend of Dragon Warrior! Your journey starts on Aliahan. Only you decide where it ends...', '/images/snes/5390/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/8/24218_front.jpg', NULL, NULL),
(5391, 'Dragon Quest V: Tenkū no Hanayome', NULL, NULL, 'Dragon Quest V: Tenkuu no Hanayome is a Role-Playing game, developed by ChunSoft and published by Enix Corporation,  which was released in Japan in 1992.', '/images/snes/5391/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/3/50653_front.jpg', NULL, NULL),
(5392, 'Dragon Quest VI: Maboroshi no Daichi', NULL, NULL, 'Dragon Quest VI: Maboroshi no Daichi is a Role-Playing game, developed by Heart Beat and published by Enix Corporation,  which was released in Japan in 1995.', '/images/snes/5392/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/0/50650_front.jpg', NULL, NULL),
(5393, 'Dragon Slayer: Eiyuu Densetsu', NULL, NULL, 'Dragon Slayer: Eiyuu Densetsu is a Role-Playing game, developed by Falcom and published by Epoch,  which was released in Japan in 1992.', '/images/snes/5393/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/1/31651_front.jpg', NULL, NULL),
(5394, 'Dragon Slayer: Eiyuu Densetsu II', NULL, NULL, 'Dragon Slayer: Eiyuu Densetsu II is a Role-Playing game, developed by Falcom and published by Epoch,  which was released in Japan in 1993.', '/images/snes/5394/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/0/5/31705_front.jpg', NULL, NULL),
(5395, 'Dragon View', 'Super Drakkhen', NULL, 'Warrior! Open your eyes! This is the future of gaming! Look, before you leap, this isn\'t some corny collection of cardboard dungeons and dragons. It\'s a brilliant new vision of RPG action adventure, with real-time 16 meg 3D scrolling like you\'ve never seen. Plus an incredible hero\'s-eye-view of the danger. Through caves of fire and meadows of ice, against brutal demons and unforeseen evils, all the way to a showdown you\'ll never forget, bring your bow, your sword, your magic. And don\'t blink - or you\'re doomed!', '/images/snes/5395/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/2/50652_front.jpg', NULL, NULL),
(5396, 'Dragon\'s Earth', NULL, NULL, 'Dragon\'s Earth is a Strategy game, developed and published by Human Entertainment,  which was released in Japan in 1993.', '/images/snes/5396/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/5/43355_front.jpg', NULL, NULL),
(5397, 'Dragon\'s Lair (SNES)', 'Dragon\'s Magic', NULL, 'From deep within Mordroc\'s Castle, a foul stench rose up to mix with the cold, damp midnight air; the telltale sign of the evil wizard\'s pet fire-breathing dragon, Singe; the beast that guarded the Princess Daphne in the deadly caves far below the surface. Dirk the Daring walked steadily toward the castle gate. He felt no fear; but then fear was for cowards. No other would dare to enter this perilous castle where Mordroc had imprisoned the helpless princess. But for Dirk there was no other possible course to take. Now was the time for heroes. Now was the time for action. Now was the time to enter the Dragon\'s Lair...', '/images/snes/5397/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5c/Dragons_lair.jpg', NULL, NULL),
(5398, 'Drakkhen', NULL, NULL, 'Chaos and evil have befallen us. The Great Drakkhen, source of universal magic, has been usurped. You and your companions must confront the ruling dragon princes to restore world peace. Ancient prophecy warns of dangers not yet born by mortal men. But you must not be deterred. Your wit will be tested and your lives are at risk every moment in Drakkhen.', '/images/snes/5398/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/de/Drakkhen_Coverart.png', NULL, NULL),
(5399, 'Dream Basketball: Dunk and Hoop', NULL, NULL, 'Dream Basketball: Dunk & Hoop is a Sports game, developed and published by Human Entertainment,  which was released in Japan in 1994.', '/images/snes/5399/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/3/307003_front.jpg', NULL, NULL),
(5400, 'Dream TV', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5401, 'Dual Orb', NULL, NULL, 'Dual Orb is a Role-Playing game, developed and published by I\'Max,  which was released in Japan in 1993.', '/images/snes/5401/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/3/5/311635_front.jpg', NULL, NULL),
(5402, 'Dual Orb II', NULL, NULL, 'Dual Orb II is a Role-Playing game, published by I\'Max,  which was released in Japan in 1994.', '/images/snes/5402/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/6/20556_front.jpg', NULL, NULL),
(5403, 'The Duel: Test Drive II', NULL, NULL, NULL, '/images/snes/5403/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5c/The_Duel_Test_Drive_II_cover.jpg', NULL, NULL),
(5404, 'Dungeon Master', NULL, NULL, 'Are you clever enough to solve an evil wizard\'s twisted puzzles? Do you possess the concentration needed to explore a labyrinth of mystery? Should you resist the tempting treasures, defeat the hideous monsters, and escape the devious traps that are hidden throughout the Grey Lord\'s dreadful dungeon?', '/images/snes/5404/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/6/3/50663_front.jpg', NULL, NULL),
(5405, 'DunQuest: Majin Fuuin no Densetsu', NULL, NULL, 'DunQuest: Majin Fuuin no Densetsu is a Role-Playing game, published by Technos,  which was released in Japan in 1995.', '/images/snes/5405/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/0/307110_front.jpg', NULL, NULL),
(5406, 'Dynamaite: The Las Vegas', NULL, NULL, 'Dynamaite: The Las Vegas is a Miscellaneous game, developed by Micro Factory and published by Virgin Interactive,  which was released in Japan in 1994.', '/images/snes/5406/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/5/306925_front.jpg', NULL, NULL),
(5407, 'Dynamic Stadium', NULL, NULL, 'Dynamic Stadium is a Sports game, developed by Electronics Application and published by Sammy Studios,  which was released in Japan in 1993.', '/images/snes/5407/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/6/306876_front.jpg', NULL, NULL),
(5408, 'E.V.O.: Search for Eden', '46 Okunen Monogatari: Harukanaru Eden e', NULL, 'The dawn of time...You are one of the first creatures to inhabit the earth! There were no peace treaties back in the early days, just your character in a jaw-clamping, teeth-flying, survival of the fittest, right to live. With the new Multi-change option and "Book of Life" feature, you can create and save up to 50 of the biggest, baddest creatures you can conjure up! The only thing standing between you and the fabled land of Eden, are 4.6 billion years worth of Mother Nature\'s meanest creations!', '/images/snes/5408/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d9/E.V.O._-_Search_for_Eden_Coverart.png', NULL, NULL),
(5409, 'EarthBound', 'Mother 2', NULL, 'Intergalactic terror stikes the small town of Onett as a blazing extraterrestrial object crashes in the night! The earth now faces imminent destruction by the universal evil threat known as Giygas!', '/images/snes/5409/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1f/EarthBound_Box.jpg', NULL, NULL),
(5410, 'Earth Light', NULL, NULL, 'Earth Light is a Strategy game, developed and published by Hudson,  which was released in Japan in 1992.', '/images/snes/5410/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/5/306795_front.jpg', NULL, NULL),
(5411, 'Earth Light: Luna Strike', NULL, NULL, 'Earth Light: Luna Strike is a Strategy game, published by Hudson,  which was released in Japan in 1996.', '/images/snes/5411/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/2/307232_front.jpg', NULL, NULL),
(5412, 'Earthworm Jim', NULL, NULL, 'Jim wasn\'t always a studly super-worm. He was once just a spineless, dirt eater with no real mission in life... Then a cosmic twist of fate placed him in control of an ultra-high-tech-indestructible-super-space-cyber-suit. Now Jim must make it to Princess-What\'s-Her-Name by staying clear of Psy-Crow, the intergalactic bounty hunter, until the final battle with Queen Slug-for-a-Butt.', '/images/snes/5412/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/d/da/Earthworm_Jim_2_%28EUR%29.PNG', NULL, NULL),
(5413, 'Earthworm Jim 2', NULL, NULL, 'Two times two is four! Too much to list, but keep reading:', '/images/snes/5413/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/d/da/Earthworm_Jim_2_%28EUR%29.PNG', NULL, NULL),
(5414, 'Edo no Kiba', NULL, NULL, 'Edo no Kiba is an Action game, developed by Riot and published by Micro World,  which was released in Japan in 1993.', '/images/snes/5414/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/1/311391_front.jpg', NULL, NULL),
(5415, 'Eek! The Cat', NULL, NULL, 'KOOM-BY-YAH!', '/images/snes/5415/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/2/50672_front.jpg', NULL, NULL),
(5416, 'Elfaria', NULL, NULL, 'Elfaria is a Role-Playing game, developed by RED Entertainment and published by Hudson,  which was released in Japan in 1993.', '/images/snes/5416/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/2/306822_front.jpg', NULL, NULL),
(5417, 'Elfaria 2: The Quest of the Meld', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5418, 'Elite Soccer', 'World Cup Striker', NULL, 'Play Elite Soccer and revel in the greatest soccer tournament on earth! Experience the ultimate soccer game on your Game Boy. Take your favorite international team on a journey through the most prestigious soccer tournament in the world. The World Cup! ', '/images/snes/5418/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/7/46167_front.jpg', NULL, NULL),
(5419, 'Emerald Dragon', NULL, NULL, 'Emerald Dragon is a Role-Playing game, developed by Alfa System and published by Media Works,  which was released in Japan in 1995.', '/images/snes/5419/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9e/Emerald_Dragon_Box_Cover_%28Super_Famicom%29.jpg', NULL, NULL),
(5420, 'EMIT Vol. 1', NULL, NULL, 'EMIT Vol. 1: Toki no Maigo is a Miscellaneous game, developed and published by Koei,  which was released in Japan in 1995.', '/images/snes/5420/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/5/311385_front.jpg', NULL, NULL),
(5421, 'EMIT Vol. 2', NULL, NULL, 'EMIT Vol. 2: Meigake no Tabi is a Miscellaneous game, developed and published by Koei,  which was released in Japan in 1995.', '/images/snes/5421/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/4/564004_front.jpg', NULL, NULL),
(5422, 'EMIT Vol. 3', NULL, NULL, 'EMIT Vol. 3: Watashi ni Sayonara o is a Miscellaneous game, developed and published by Koei,  which was released in Japan in 1995.', '/images/snes/5422/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/5/564005_front.jpg', NULL, NULL),
(5423, 'Emmitt Smith Football', NULL, NULL, 'Emmitt Smith, considered to be one of the greatest running backs in professional football, is now crashing into your living room. His mesmerizing moves and superior speed are rolled-up together with the down and dirty action of a real pro-football game.', '/images/snes/5423/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/1/50671_front.jpg', NULL, NULL),
(5424, 'Energy Breaker', NULL, NULL, 'Energy Breaker is a Strategy game, developed by Neverland and published by Taito Corporation,  which was released in Japan in 1996.', '/images/snes/5424/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/9/24039_front.jpg', NULL, NULL),
(5425, 'Equinox', 'Solstice II', NULL, 'As Glendaal, you wake to a horrifying scene. Evil forces have reduced the town of Galedonia to rubble and turned the villagers into mutant zombies and demons. Your father, the wizard Shadax, must be found, for only he has the magical powers to challenge the evil Sonia. The search for Shadax takes you through overworld and underworld battle zones, from strategic attack positions high in the clouds to eight mysterious dungeons below -- loaded with ghosts, wind demons and traps galore. Moving from dungeon to dungeon, you\'ll search for the hidden mystical tokens which must be found to complete a game so real that it\'s hard to believe it\'s really a game!', '/images/snes/5425/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/5/50675_front.jpg', NULL, NULL),
(5426, 'Esparks: Ijikuu Kara no Raihousha', NULL, NULL, 'Esparks is an Action game, published by Tomy Corporation,  which was released in Japan in 1995.', '/images/snes/5426/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/1/307071_front.jpg', NULL, NULL),
(5427, 'ESPN Baseball Tonight', NULL, NULL, 'Step up to the plate with ESPN Baseball Tonight, for your Sega CD, the most realistic fast-paced arcade style baseball game ever created. Featuring all 28 Major League Baseball teams and stadiums in an Exhibition, Playoffs or 162 game season. With unprecedented access to ESPN studios, this game puts you in the center of the action during a live ESPN baseball broadcast. Exceptional player control and game options make this the ultimate baseball simulation.', '/images/snes/5427/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/8/50678_front.jpg', NULL, NULL),
(5428, 'ESPN National Hockey Night', NULL, NULL, 'Now you and up to three friends can face off for an entire 84-game NHL season, including the Stanley Cup Playoffs and NHL Skills Challenge. Featuring the ultra-realistic ESPN look and feel, you can choose from two viewpoints during game play. Make on-ice line changes and save every game and player stats, thanks to battery back-up. Some 2,000 frames of body checks, slap shots and breakaways make you feel like you\'re into a real ESPN hockey broadcast. ESPN National Hockey Night - everything else is just practice.', '/images/snes/5428/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/9/47359_front.jpg', NULL, NULL),
(5429, 'ESPN Speed World', NULL, NULL, 'You\'ve got the pedal to the metal. Your 5-liter turbo-charged modified street machine is screaming down the straightaway at 200 mph. Now you\'re drafting right on the tail of your nemesis. Suddenly you sling-shot past for the lead, blowing into the backstretch and full blast into the tightest corner of the track. Welcome to ESPN SPEEDWORLD, the highest octane stock car racing simulator ever created. It leaves the competition in the pits.', '/images/snes/5429/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/2/50682_front.jpg', NULL, NULL),
(5430, 'ESPN Sunday Night NFL', NULL, NULL, 'ESPN Sunday Night NFL for the Sega CD stands head and shoulder pads above the competition with incredible game play features and a true broadcast perspective. Hosted by ESPN\'s own Chris Berman, this game puts you in total control of the action with lots of incredible plays, complete rosters of teams and players, play-by-play commentary, plus pre-game, half-time and post-game shows, full season playing options and memory backup for saving your stats. Down on the field, you\'ll have unprecedented control over your own players. Battle your way through the playoffs and "you could go all the way" to the Super Bowl!', '/images/snes/5430/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/3/50683_front.jpg', NULL, NULL),
(5431, 'Eternal Filena', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5432, 'Extra Innings', 'Hakunetsu Pro Yakyuu: Ganba League', NULL, 'The eye-popping new 16-bit "Extra Innings" for your Super NES puts you in the batter\'s box, on the pitcher\'s mound, even in the manager\'s shoes. There\'s never been a baseball game like it. You control it all. Runners steal, outfielders make diving catches, and pitchers throw everything from smoke to forkballs. But watch out when your pitcher starts wiping his brow - it could be a sign he\'s starting to tire. "Extra Innings." It beats anything you\'ve ever played.', '/images/snes/5432/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/6/50686_front.jpg', NULL, NULL),
(5433, 'Eye of the Beholder', NULL, NULL, 'Darkness has engulfed the town of Waterdeep and legend has it that the criminal conspiracy behind it is hiding in the sewers. The locks and the traps in the twisting labyrinth beneath Waterdeep are too good and Skeletons and Kolbolds lurk around every corner. Who could be at the heart of this evil? And can anyone survive to find out?', '/images/snes/5433/cover.jpeg', 'https://upload.wikimedia.org/wikipedia/en/2/2b/Eye_of_the_Beholder_I_PC_box.jpeg', NULL, NULL),
(5434, 'F-1 Grand Prix', NULL, NULL, 'F-1 Grand Prix is a Racing game, developed and published by Video System,  which was released in Japan in 1992.', '/images/snes/5434/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/9/4/304594_front.jpg', NULL, NULL),
(5435, 'F-1 Grand Prix Part II', NULL, NULL, 'F-1 Grand Prix Part II is a Racing game, developed and published by Video System,  which was released in Japan in 1993.', '/images/snes/5435/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/fe/F1_Grand_Prix_arcadeflyer.png', NULL, NULL),
(5436, 'F-1 Grand Prix Part III', NULL, NULL, 'F-1 Grand Prix Part III is a Racing game, developed and published by Video System,  which was released in Japan in 1994.', '/images/snes/5436/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/fe/F1_Grand_Prix_arcadeflyer.png', NULL, NULL),
(5437, 'F-Zero', NULL, NULL, 'The future of racing is here! F-ZERO, an intergalaxtic Grand Prix, uses machines that weigh more than a ton, reach dash speeds of over 500km/h and hover a mere twelve inches off the ground! Choose from the heroic Captain Falcon, or the suave, Dr. Stuart. Need more choices? Then try the sly alien, Pico or the not-so-honest Samurai Goroh, and race for intergalactic fame and fabulous fortune in the F-ZERO Grand Prix.', '/images/snes/5437/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/77/F-Zero_logo.png', NULL, NULL),
(5438, 'F1 Pole Position', 'Human Grand Prix', NULL, 'REV YOUR ENGINES AND RACE TOWARDS THE CHECKERED FLAG!', '/images/snes/5438/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/0/46180_front.jpg', NULL, NULL),
(5439, 'F1 Pole Position 2', 'Human Grand Prix II', NULL, 'F1 Pole Position 2, an officisl FIA game ! 16 circuits, 7 teams, 14 drivers, to rediscover the sensations and the suspense of real Grand Prix races !', '/images/snes/5439/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/1/31751_front.jpg', NULL, NULL),
(5440, 'F1 ROC: Race of Champions', 'Exhaust Heat', NULL, 'Strap yourself in the cockpit, step on the gas and take a turbo-charged ride through the high-speed world of Formula One racing with F1 ROC.', '/images/snes/5440/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/9/1/50691_front.jpg', NULL, NULL),
(5441, 'F1 ROC II: Race of Champions', 'Exhaust Heat II: F-1 Driver no Kiseki', NULL, 'OK race fans, you\'re seen the rest, now here\'s the best!', '/images/snes/5441/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/8/50688_front.jpg', NULL, NULL),
(5442, 'F1 World Championship Edition', NULL, NULL, 'F1 is an Official Formula One Racing Game. It\'s also the fastest, most authentic, most thrilling Game Gear racing game yet. Battle it out on the real Formula One Circuits against the real teams and the real drivers of the FIA Formula One World Championship.', '/images/snes/5442/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/6/92966_front.jpg', NULL, NULL),
(5443, 'Faceball 2000', NULL, NULL, 'Welcome to the exciting new world of Faceball 2000, where 3D graphics, first person perspective and 360-degree maneuverability put you and up to three friends (or foes!) inside your Game Boy. What you see is where you are, as you team up, compete with each other or play alone against computer-controlled opponents. Transport yourself inside the walls of CyberScape, a series of more than 70 treacherous mazes filled with tricks, traps and menacing enemies. Or, enter the Arena where "Have a Nice Day" takes on a whole new meaning in fast-paced rounds of high-tech combat. Wherever you go in Faceball 2000, it\'s your chance to wipe the smiles off those annoying happy faces - and maybe a few of your friends - once and for all!', '/images/snes/5443/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/3/46183_front.jpg', NULL, NULL),
(5444, 'Famicom Bunko: Hajimari no Mori', NULL, NULL, 'Hajimari no Mori is an Adventure game, developed by Pax Softonica and published by Nintendo,  which was released in Japan in 1999.', NULL, 'https://gamefaqs.akamaized.net/box/2/0/0/304200_front.jpg', NULL, NULL),
(5445, 'Famicom Tantei Club Part II: Ushiro ni Tatsu Shōjo', NULL, NULL, 'Famicom Tantei Club Part II is an Adventure game, developed by TOSE and published by Nintendo,  which was released in Japan in 1998.', NULL, 'https://gamefaqs.akamaized.net/box/9/9/0/31990_front.jpg', NULL, NULL),
(5446, 'Family Dog', NULL, NULL, 'A CANINE COMIC ADVENTURE!', '/images/snes/5446/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/9/3/50693_front.jpg', NULL, NULL),
(5447, 'Farland Story: Yottsu no Fuuin', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5448, 'Farland Story 2: Dance of Destruction', NULL, NULL, 'Farland Story 2 is a Strategy game, developed by TGL and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/5448/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/3/307173_front.jpg', NULL, NULL),
(5449, 'Fatal Fury: King of Fighters', 'Garō Densetsu Shukumei no Tatakai', NULL, 'The King of the Fighters Tournament is not for the weak. Choose among 11 strong and powerful fighters - defeat all comers and take home the Championship. As Joe Higashi, Terry or Andy Bogard, it\'s your mission to defeat the evil and sinister Geese Howard - who holds all of Southtown City in his grasp. Use your special skills and lightning fast reflexes to advance through the many stages of City Streets.', '/images/snes/5449/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/3/20743_front.jpg', NULL, NULL),
(5450, 'Fatal Fury 2', 'Garō Densetsu Tsū Aratanaru Tatakai', NULL, 'It\'s time for 20 megs of non-stop action, with another super-hot arcade game for your Super Nintendo. Rejoin the brothers Andy and Terry Bogard, with their friend Joe Higashi as they discover that FATAL FURY was just a warm up! Now they must face the meanest, most dangerous fighters ever assembled!', '/images/snes/5450/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/0/26820_front.jpg', NULL, NULL),
(5451, 'Fatal Fury Special', 'Garō Densetsu Supersharu', NULL, 'The GRANDMOTHER of all battles! 15 of the FATAL FURY series\' top stars gather in the match of the millenium! Use the resurrected Geese Howard and Wolfgang Krauser in a dazzling arena! All you have ever wanted in a fighting game is here in FATAL FURY SPECIAL!', '/images/snes/5451/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ea/Fatal_Fury_Special_%28cover%29.jpg', NULL, NULL),
(5452, 'Feda: The Emblem of Justice', NULL, NULL, 'FEDA: The Emblem of Justice is a Strategy game, developed by Max Entertainment and published by Yanoman,  which was released in Japan in 1994.', '/images/snes/5452/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/9/24219_front.jpg', NULL, NULL),
(5453, 'FIFA International Soccer', NULL, NULL, 'EA Sports has teamed up with the governing body of international soccer to bring you the most realistic soccer game ever created on the Sega Genesis. 16 megs packed with real soccer action - brought to you EA sports style! Incredible goalie saves - lunge or dive after hard to reach shots in the corners! Unique "play-finder" window lets you scope the field on corner kicks and free kicks. Find the open man and hammer the ball into the goal! Drop your opponent onto the turf with a slide tackle. Be careful, slide tackles from behind can result in yellow cards!', '/images/snes/5453/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/2/31192_front.jpg', NULL, NULL),
(5454, 'FIFA Soccer 96', NULL, NULL, 'The mother of all soccer games! New moves including 1 - 2 passing, fast dribble and volleys. 12 international leagues including English, Italian, German and French. Over 3,500 real players with accurate strengths and weaknesses. Players modeled using Motion Design technology. Practice option for enhancing your game and expert mode for the pros.', '/images/snes/5454/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/ce/FIFA97saturn.jpg', NULL, NULL),
(5455, 'FIFA 97: Gold Edition', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5456, 'FIFA: Road to World Cup 98', NULL, NULL, 'Conquer fierce defenders and defeat entire nations on your quest to compete in World Cup 98. Featuring 172 International teams from 6 zones and 16 International stadiums. Responsive player and ball control. New motion captured players and moves. Detailed stats for over 4500 players. 5 ways to compete: World Cup 98, Friendly, League, Penalty Kick Shootout and Training Mode. Edit teams and players to create your own dream team.', '/images/snes/5456/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9a/FIFA_98_cover.jpg', NULL, NULL),
(5457, 'Fighter\'s History', NULL, NULL, 'You\'re invited as one of the master champions to engage in Fighter\'s History', '/images/snes/5457/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7e/Fighter%27s_History_game_flyer.png', NULL, NULL),
(5458, 'Final Fantasy IV', 'Final Fantasy II (SNES)', NULL, 'In the kingdom of Baron, powerful airships rule the skies. At the head of this elite fighting force is Cecil, Captain of the Red Wings, As our adventure begins, Cecil and his squadron are ordered to steal a powerful crystal from a rival kingdom. Upon their return, Cecil questions the King\'s orders and is stripped of his command. To prove his loyalty, he must slay a dreadful monster and deliver a mysterious package to a neighboring town. But when the package explodes, destroying everyone, Cecil and his friend Kain vow to fight the King\'s dark forces. Will you be able to save the world from their evil plan to control the crystals? Get ready for the most challenging role-playing adventure ever.', '/images/snes/5458/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/1/3621_front.jpg', NULL, NULL),
(5459, 'Final Fantasy V', NULL, NULL, 'The Wind Crystal shatters...', '/images/snes/5459/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/9/20069_front.jpg', NULL, NULL),
(5460, 'Final Fantasy VI', 'Final Fantasy III (SNES)', NULL, 'Ages ago, evil beings created powerful creatures called Espers, and unleashed them against each other.  The resulting battles left their world a smoldering rubble.  Legend has it, the Espers destroyed themselves and most of humanity.  Magic disappeared forever.  Centuries have passed and a rational world now exists with Espers living only in myths, until one frozen solid since the ancient wars is unearthed.  Suddenly, there are reports of magical attacks on civilians.  Imperial Commandos launch raids using magic-powered MagiTek weapons.  Magic is obviously alive and the world is in danger again.  Who or what is behind the rediscovery and redeployment of this legendary power?  What chaotic plans exists that will wreak havoc on this orderly world?', '/images/snes/5460/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/6/16616_front.jpg', NULL, NULL),
(5461, 'Final Fantasy Mystic Quest', NULL, NULL, 'The planet is dying. Cold winds blow. Fires rage. Trees are withering. In other words, it\'s brutal out there. Only you can stop the Dark King from consuming the light from the Crystals of Earth. But don\'t think it\'ll be a walk in the park. You\'re up against the sleaziest of slimebags, the evilest of ecto-scum -- we\'re talking serious monsters here. This isn\'t your basic shoot-\'em-into-smithereens kiddy game, either. You\'ll have to think your way out of some tough spots. Think you can handle that?', '/images/snes/5461/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/8/15238_front.jpg', NULL, NULL),
(5462, 'Final Fight', NULL, NULL, 'Mayor Mike Haggar vows to snatch the streets of Metro City back from the crooks with his bare knuckles! But the Mad Gear Gang snatches his daughter Jessica. Now there\'s gonna be some bone-crunching dues to pay!\nJessica\'s boyfriend Cody hits the streets hard with Haggar, denting heads downtown and slugging it out in the slums. He\'s a one man army! His weapons are anything he can find -- swords, knives, or pipes.\nNow you\'re Haggar or Cody, each with his own fighting style. Demolish gangland henchmen, samurai swordsmen and musclebound crime bosses in a fist-to-nose frenzy!', '/images/snes/5462/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/9/20769_front.jpg', NULL, NULL),
(5463, 'Final Fight 2', NULL, NULL, 'It\'s Mad Gear Madness! They\'re back stronger than ever and they want revenge. With a new mysterious leader they plan to dominate the entire world. This time they\'ve kidnapped Genryusai and his daughter Rena.', '/images/snes/5463/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a2/Final_Fight_2_cover.png', NULL, NULL),
(5464, 'Final Fight 3', NULL, NULL, 'Following the defeat and subsequent disappearance of the Mad Gear Gang, a small group known only as Skull Cross is responsible for a new uprising of vandalism, terrorism and death. The government of Metro City is at a complete loss. Metro Citys mayor, Mike Haggar, and Guy are prepared to take on the new gang, but before they can act, the door bursts open, revealing Lucia, Codys old friend. Metro City is under attack! she shouts, Skull Cross is loose, and theyve got something up their sleeves. But before any of them can move, a mysterious man appears in the doorway. My name is Dean, he says. I know Skull Cross inside-and-out, and I hate them more than anything. I can help you, and you can help me. We must go! All four fighters vow to bring Skull Cross down. It will be a tough assignment, and may even be their final fight!', '/images/snes/5464/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/af/Final-fight-tough-box.jpg', NULL, NULL),
(5465, 'Final Fight Guy', NULL, NULL, 'Final Fight Guy is an Action game, developed and published by Capcom,  which was released in Japan in 1992.', '/images/snes/5465/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/0/4/50704_front.jpg', NULL, NULL),
(5466, 'Final Set Tennis', NULL, NULL, 'Final Set is a Sports game, developed by Open System and published by Forum,  which was released in Japan in 1993.', '/images/snes/5466/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/9/311999_front.jpg', NULL, NULL),
(5467, 'Final Stretch', NULL, NULL, 'Final Stretch is a Racing game, developed by Genki and published by LOZC G. Amusements,  which was released in Japan in 1993.', '/images/snes/5467/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0d/Final_Stretch_%28video_game%29.jpg', NULL, NULL),
(5468, 'Fire Emblem: Monshō no Nazo', NULL, NULL, 'Fire Emblem: Monshou no Nazo is a Strategy game, developed by Intelligent Systems and published by Nintendo,  which was released in Japan in 1994.', '/images/snes/5468/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/9/39769_front.jpg', NULL, NULL),
(5469, 'Fire Emblem: Seisen no Keifu', NULL, NULL, 'Fire Emblem: Seisen no Keifu is a Strategy game, developed by Intelligent Systems and published by Nintendo,  which was released in Japan in 1996.', '/images/snes/5469/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/1/24221_front.jpg', NULL, NULL),
(5470, 'Fire Emblem: Thracia 776', NULL, NULL, 'Fire Emblem: Thracia 776 is a Strategy game, developed by Intelligent Systems and published by Nintendo,  which was released in Japan in 1999.', '/images/snes/5470/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Fe5box.jpg', NULL, NULL),
(5471, 'Fire Pro Joshi: All Star Dream Slam', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5472, 'The Firemen', NULL, NULL, 'This fire is alive - and it\'s racing straight towards you!', '/images/snes/5472/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/e/e7/Firemensfcbox.PNG', NULL, NULL),
(5473, 'Firepower 2000', 'Super SWIVEU', NULL, 'Imagine if all the mega weapons in the world fell into the wrong hands. And then were turned against you. That\'s the time for major firepower. You\'ve got to take the wheel of a jumping, whirling, gun-heavy jeep that fires in any direction. Or master the controls of a deadlyfast, missile-loaded helicopter. Both war machines have special capabilities. Both change into different vehicles on certain levels. It\'s up to you to pick the right weapon. So get ready to collect your flamethrowers, plasma cannons, lasers, guided missiles, nuclear weapons and more. There\'s no time to assemble forces -- it\'s just you or you and a partner going straight into the blazing, blasting heart of enemy territory. Make sure you buckle up. And put your finger on firepower.', '/images/snes/5473/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/4/50714_front.jpg', NULL, NULL),
(5474, 'Firestriker', 'Holy Striker', NULL, 'Long ago, on a distant world, there were four kingdoms governed by four constantly fighting tribes. One day the Arch-Mage Wylde proposed a solution to the constant battling. He offered to bestow the title of FireStriker and ruler of the four tribes, upon the one who could control the elemental orb of fire known as the Trialight.', '/images/snes/5474/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/2/50712_front.jpg', NULL, NULL),
(5475, 'First Samurai', NULL, NULL, 'Can You Hack It As A Samurai?', '/images/snes/5475/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/9/50719_front.jpg', NULL, NULL),
(5476, 'First Queen', NULL, NULL, 'First Queen is a Strategy game, developed by Kure and published by Culture Brain,  which was released in Japan in 1994.', '/images/snes/5476/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/7/296197_front.jpg', NULL, NULL),
(5477, 'Fishing Koushien', NULL, NULL, 'Fishing Koushien is a Sports game, developed by A-Wave and published by King Records,  which was released in Japan in 1996.', '/images/snes/5477/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/7/307217_front.jpg', NULL, NULL),
(5478, 'Flashback: The Quest for Identity', 'Flashback', NULL, 'Planet Titan: Brave mutants, robots, anti-matter fields and the primitive inhabitants as you find your way through the jungle. New Washington: First recover your memory, then go undercover to earn money. Finally, buy a false ID if you want to sneak back on Earth. Death Tower: Climb the 8 floors of the Death Tower labyrinth. Avoid the deadly Replicants and win a free ticket to Earth. Earth: Big trouble! The authorities have discovered your false ID and send robot cops to capture you. Paradise Club: You discovered the aliens\' plans, but somehow end up being captured and mysteriously transported through space. Planet Morphs: You materialized on their home planet. Now all you have to do is destroy the Morphs and live to tell about it!', '/images/snes/5478/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/4/25914_front.jpg', NULL, NULL),
(5479, 'The Flintstones (SNES)', NULL, NULL, 'IT\'S FRED\'S LIFE...AND YOU GET TO YABBA-DABBA-DOO-IT!', '/images/snes/5479/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/5/5b/Flintstones_Ocean_boxart.jpg/220px-Flintstones_Ocean_boxart.jpg', NULL, NULL),
(5480, 'The Flintstones: The Treasure of Sierra Madrock', NULL, NULL, 'When things go wrong in Bedrock, it\'s up to Fred Flintstone to set them right. Fly the skies on a Pterodactyl, do some tough driving in your trusty Flintmobile and hop aboard the Dino Express! Use your club to fend off zany monsters in this excellent cartoon adventure!', '/images/snes/5480/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/6/47436_front.jpg', NULL, NULL),
(5481, 'Flying Hero: Bugyuru no Daibouken', NULL, NULL, 'Flying Hero is an Action game, developed by Sting and published by Sofel,  which was released in Japan in 1992.', '/images/snes/5481/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/9/31679_front.jpg', NULL, NULL),
(5482, 'Football Fury', 'Ultimate Football', NULL, 'At Last User-Friendly Football!', '/images/snes/5482/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/2/50722_front.jpg', NULL, NULL),
(5483, 'Foreman For Real', NULL, NULL, 'PAY ATTENTION, PUG: THIS IS THE BIGGEST FIGHT OF YOUR LIFE!', '/images/snes/5483/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/8/46238_front.jpg', NULL, NULL),
(5484, 'Fortune Quest: Dice wo Korogase', NULL, NULL, 'Fortune Quest is a Miscellaneous game, developed by Natsume and published by Zamuse,  which was released in Japan in 1994.', '/images/snes/5484/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/6/306926_front.jpg', NULL, NULL),
(5485, 'Frank Thomas\' Big Hurt Baseball', NULL, NULL, 'Frank wanted big league technology to match his two-time MVP award-winning style. He wanted authentic gameplay like pitchers losing arm strength. He wanted CD-quality sound FX including umpire calls, crowd cheering and bat cracking. He wanted 8 pitch selections and 27 stat categories. He wanted 6 modes of play including Season, All-Star Game, Home Run Derby, Playoffs, and Batting Practice. He wanted 28 3D rendered stadiums to crank home runs. He wanted motion captured sprites. And he wanted a ton of camera angles to check out all the action... he got it!', '/images/snes/5485/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/6/3796_front.jpg', NULL, NULL),
(5486, 'Frantic Flea', NULL, NULL, 'Take control of Frantic Flea and save your Miniflea buddies from the Evil Insideos that are slowly taking over the Flea Homeworld!', '/images/snes/5486/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/4/50724_front.jpg', NULL, NULL),
(5487, 'Frogger', NULL, NULL, 'It\'s tough to be a frog! Life isn\'t all lazy days and lily pads--it abounds with dangers. Can you help Frogger survive some perils and spring him home to safety? First hop your frogs across a busy highway. Then cross a raging river to reach the safety of home. But your frogs will have to leap away from one danger after another before they\'re safe. Watch out for the tricky diving turtles...jump away from the frog-eating snakes...hop from the jaws of the hungry alligators!', '/images/snes/5487/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/21/Frogger_1_xbla_cover.jpg', NULL, NULL),
(5488, 'From TV Animation Slam Dunk: Dream Team Shueisha Limited', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5489, 'From TV Animation Slam Dunk: SD Heat Up!!', NULL, NULL, 'From TV animation - Slam Dunk SD Heat Up!! is a Sports game, developed by TOSE and published by Bandai,  which was released in Japan in 1995.', '/images/snes/5489/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/4/31904_front.jpg', NULL, NULL),
(5490, 'From TV Animation Slam Dunk 2: IH Yosen Kanzenhan!!', NULL, NULL, 'From TV animation - Slam Dunk 2: IH Yosen Kanzenban!! is a Sports game, developed by TOSE and published by Bandai,  which was released in Japan in 1995.', '/images/snes/5490/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/9/24229_front.jpg', NULL, NULL),
(5491, 'From TV Animation Slam Dunk: Yonkyo Taiketsu!!', NULL, NULL, 'From TV animation - Slam Dunk: Yonkyo Taiketsu!! is a Sports game, developed by TOSE and published by Bandai,  which was released in Japan in 1994.', '/images/snes/5491/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/8/8/309488_front.jpg', NULL, NULL),
(5492, 'Front Mission', NULL, NULL, 'Discover the origins of the Front Mission series in this explosive handheld saga that was never before localized for North America. Reborn exclusively on the Nintendo DS, Front Mission introduces exciting new features, such as dual screen presentation and multiplayer modes, that update the classic that gave birth to seven beloved sequels. Using Touch Screen functionality, players command a squad of customizable mechs known as wanzers and direct them through turn-based skirmishes across the battlefields of the 21st century.', '/images/snes/5492/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/2/19742_front.jpg', NULL, NULL),
(5493, 'Front Mission Series: Gun Hazard', NULL, NULL, 'Front Mission: Gun Hazard is a Role-Playing game, developed by Omiya Soft and published by SquareSoft,  which was released in Japan in 1996.', '/images/snes/5493/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4f/GunhazardSFC_boxart.jpg', NULL, NULL),
(5494, 'Full Throttle: All-American Racing', 'Full Power', NULL, 'Full Throttle racing rears across the U.S.A. bringing an arcade style water bike and motorcycle racing game to the Super Nintendo Entertainment System. Compete against your rivals as the four moves from city to city. Oven ten different locations are represented ranging from the Appalachian Mountain in North Carolina and the hilly streets of San Francisco, to the barren heat of Arizona. Mode seven graphics and other spectacular effects put you right in the action. Get ready to rev your engine high and kick away your opponents as you strive for the Race America Cup of the tour\'s completion.', '/images/snes/5494/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/7/50727_front.jpg', NULL, NULL),
(5495, 'Fun \'n Games', NULL, NULL, 'Come and enter the Clubhouse and explore the games, activities, art and music packages. There\'s loads to do, and the only limit\'s your imagination! Fun \'n\' Games - it\'s too cool for school!', '/images/snes/5495/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/4/7/47447_front.jpg', NULL, NULL),
(5496, 'Funaki Masakatsu no Hybrid Wrestler: Tōgi Denshō', NULL, NULL, 'Funaki Masakatsu Hybrid Wrestler: Tougi Denshou is a Sports game, published by Technos,  which was released in Japan in 1994.', '/images/snes/5496/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/5/306985_front.jpg', NULL, NULL),
(5497, 'Fune Tarou', NULL, NULL, 'Fune Tarou is a Sports game, published by Pack-In-Video,  which was released in Japan in 1997.', '/images/snes/5497/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/9/307269_front.jpg', NULL, NULL),
(5498, 'Furuta Atsuya no Simulation Pro Yakyuu 2', NULL, NULL, 'Simulation Pro Yakyuu 2 is a Sports game, developed and published by Hect,  which was released in Japan in 1996.', '/images/snes/5498/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/4/31954_front.jpg', NULL, NULL),
(5499, 'Fushigi no Dungeon 2: Furai no Shiren', NULL, NULL, 'Shiren and Koppa still have their primary objective of finding the Lair of the Golden Condor but an adventure is not complete without visiting new towns and going on exciting side quests! Check out some of side quests they go on and the towns these two warriors visit along the way!', '/images/snes/5499/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/3/42803_front.jpg', NULL, NULL),
