(5532, 'Ghoul Patrol', NULL, NULL, 'The main attractions at the library\'s Goblin exhibit have come to life! As the Ghoul Patrol, go back in time and de-spook an encyclopedia of zombified historic dudes. Vaporize garbage-can ghosts and Ninja spirits, rescue bug-eyed librarians and wigged-out pirates, dodge flying books and adolescent-eating plants, and ultimately put the beastly spirit back in the history books!', '/images/snes/5532/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/2/45022_front.jpg', NULL, NULL),
