(5541, 'Gods', NULL, NULL, 'In a city of doom and despair, lost in the annals of time, there awaits for one fearless soul, the prize humanity has eternally sought: Immortality. You are Hercules the Unconquered, the only warrior who can challenge the City of the Gods, and you have the chance to achieve this prize. But immortality does not come cheaply. At every level, controlled by four hideous Guardians, lunatic beasts attack and attack again. The pursuit is relentless as they conspire to steal your weapons, your treasures, and your very life! Secure the secret of immortality and return to Mount Olympus to take your place among the banks of the gods!', '/images/snes/5541/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/5/47515_front.jpg', NULL, NULL),
(5542, 'Godzilla: Kaijuu Daikessen', NULL, NULL, 'Godzilla: Kaijuu Daikessen is an Action game, developed by Alfa System and published by Toho,  which was released in Japan in 1994.', '/images/snes/5542/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/3/43353_front.jpg', NULL, NULL),
