(5546, 'Goof Troop', 'Goofy to Max: Kaizoku Shima no Daibouken', NULL, 'Set sail for adventure with the Goof Troop!', '/images/snes/5546/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/93/SNES_Goof_Troop_Box.jpg', NULL, NULL),
(5547, 'GP-1', NULL, NULL, 'The ultimate goal of a GP Rider is to race against the best riders on the most challenging courses found throughout the world. A GP Rider must invest in the best equipment to gain a competitive edge and take his riding abilities to the limit! In GP-1 you will race on 13 different courses found in 12 different countries, win races and increase your world ranking, use money winnings to build the ultimate sup bike, and even pick a mechanic whose specialized skills match those of your riding style! you too can be a world class grand prix racer!', '/images/snes/5547/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8d/GP-1_Cover.jpg', NULL, NULL),
(5548, 'GP-1: Part II', 'GP-1 Rapid Stream', NULL, 'Get Ready For Some High-Speed Action And Excitement At Home With The World Class Grand Prix Motorcycle Race.', '/images/snes/5548/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/4/50754_front.jpg', NULL, NULL),
(5549, 'Gradius III', NULL, NULL, 'The gentle Gradians thought they were cured of Bacterion\'s contemptible curse after generation of germ-free living. Guess again. That wretched fiend is once again wreaking havoc on Gradius and the surrounding planets. It\'s your destiny to put an end to it. Unless maybe you think life as an amoeba would be pleasant!', '/images/snes/5549/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/63/Gradius_III_Japanese_Arcade_flyer.jpg', NULL, NULL),
(5550, 'Granhistoria: Genshi Sekaiki', NULL, NULL, 'Granhistoria is a Role-Playing game, developed by J-Force and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/5550/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/9/31859_front.jpg', NULL, NULL),
