(5556, 'The Great Circus Mystery Starring Mickey and Minnie', 'Mickey to Minnie: Magical Adventure 2', NULL, 'Mickey and Minnie plan to spend a fun-filled day at the circus but to their dismay all the performers have disappeared. Some unknown force has replaced them with crazy characters who are out to make Mickey and Minnie\'s day an unpleasant one. And on top of that, Donald Duck and Pluto are nowhere to be seen.', '/images/snes/5556/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/7/50757_front.jpg', NULL, NULL),
