(5561, 'Hagane: The Final Conflict', NULL, NULL, 'Only one man alone stands to save the world from the KOMA-clan and their plan to destroy the world. His name was "HAGANE". The lone survivor of the FUMA-clan, which was massacred by the KOMA-clan. Brought back from the fringe of death and given a cyborg body, "HAGANE" swears vengeance against the KOMA-clan.', '/images/snes/5561/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0a/Hagane_-_The_Final_Conflict_Coverart.png', NULL, NULL),
(5562, 'Haisei Mahjong Ryouga', NULL, NULL, 'Haisei Mahjong Ryouga is a Miscellaneous game, published by ASCII Entertainment,  which was released in Japan in 1995.', '/images/snes/5562/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/8/307078_front.jpg', NULL, NULL),
(5563, 'Hakunetsu Pro Yakyuu \'93: Ganba League', NULL, NULL, 'Hakunetsu Pro Yakyuu Ganba League \'93 is a Sports game, developed by Sting and published by Epic/Sony Records,  which was released in Japan in 1992.', '/images/snes/5563/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/3/5/301735_front.jpg', NULL, NULL),
(5564, 'Hakunetsu Pro Yakyuu \'94: Ganba League 3', NULL, NULL, 'Hakunetsu Pro Yakyuu \'94 Ganba League 3 is a Sports game, published by Epic/Sony Records,  which was released in Japan in 1993.', '/images/snes/5564/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/3/4/301734_front.jpg', NULL, NULL),
(5565, 'Hal\'s Hole in One Golf', 'Jumbo Ozaki no Hole In One', NULL, 'it\'s the 18th hole-Hal Open Tournament. Sixty of the best golfers in the country are gathered in one place to determine who will walk away with the Grand Prize trophy. You\'re 7 under par, tied for first. This 22-food putt is all that stands between you and glory. A hush falls over the gallery... you address the ball... you measure your stroke... Hal America brings the excitement of golf competition to the SNES. Multiple play options and a demanding course will challenge beginners and seasoned pros alike!', '/images/snes/5565/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/8/50768_front.jpg', NULL, NULL),
(5566, 'Hamelin no Violin Tamaki', NULL, NULL, 'Hameln no Violin Hiki is an Action game, developed by Daft and published by Enix Corporation,  which was released in Japan in 1995.', '/images/snes/5566/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/4/43364_front.jpg', NULL, NULL),
(5567, 'HammerLock Wrestling', 'Tenryuu Genichiro no Pro Wrestling Revolution', NULL, 'Plug in Hammerlock and get a look at in-your-face, action-packed wrestling like you\'ve never seen it before: up close. How close? Jaleco\'s exclusive ringside perspective brings the action right under your eyelids. In addition to the main screen, you get two ringside screens. See your opponent\'s hand pull back for a punch so you can time your dodge perfectly. Then watch the close-up screen explode to twice its regular size as you grab his legs and throw him into a spine-splintering suplex. See it all like it\'s just inches away-closer than you\'ve ever seen it before.', '/images/snes/5567/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/4/50764_front.jpg', NULL, NULL),
