(5579, 'Harvest Moon', 'Bokujou Monogatari', NULL, 'City kids of all ages will want to take in the natural beauty and breathe the fresh country air in this fascinating farming simulation game. Harvest Moon gives you the chance to experience first-hand the down-to-earth goodness of life on a farm. Instead of zapping zombies from Mars, your goal is to get by on old-fashioned hard work and dedication. Success in this game is measured by the fruits of your labor, so strap on your suspenders, roll up your shirt sleeves and dig in!\n', '/images/snes/5579/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/2/19542_front.jpg', NULL, NULL),
