(5629, 'The Humans', NULL, NULL, '"Just what the heck are HUMANS?... and what are they doing in a video game anyhow?" We know... we\'ve heard it before, they\'re strange... they\'re ugly... they\'re stupid. But there\'s more to these HUMANS than meets the eye, for inside each and every one of them is a small but usable brain. Working as a team and discovering new tools is the key to survival in this cruel world of chaos and carnivores. It\'s an action-filled race against time, where you score points by finishing levels with as many of your tribesmen intact as HUMAN-ly possible (which isn\'t that easy when it comes down to survival of the fittest). With Gametek\'s Sega Genesis version of HUMANS, the only missing link is you!', '/images/snes/5629/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/5/46315_front.jpg', NULL, NULL),
(5630, 'Hungry Dinosaurs', 'Harapeko Bakka', NULL, 'Eat or be eaten!', '/images/snes/5630/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/4/306984_front.jpg', NULL, NULL),
(5631, 'Hurricanes', NULL, NULL, 'So you tthought footballs were for playing with... think again! Embark on rollercoaster journey in this platform adventure through eerie mining towns, terrifying, deadly forests and infested jungles. All this to search the stadium - and your only weapon - a football!', '/images/snes/5631/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/0/47580_front.jpg', NULL, NULL),
