(5635, 'Hyper Zone', 'HaipāZōn', NULL, NULL, '/images/snes/5635/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/8/8f/HyperZone_box_art.JPG', NULL, NULL),
