(5637, 'The Ignition Factor', 'Fire Fighting', NULL, 'Take control of a brave firefighter as he battles to save people from towering infernos and flame-filled factories. You have a large variety of equipment to help you with your task. The hero isn’t afraid to get physical by kicking objects, climbing ropes and jumping in order to get to all areas. But time works against you as the fires get gradually worse and you run out of breathable air. Different types of fire need to be extinguished using different methods, so you’ll need to use your equipment to the best of your ability. Enlist the help of the fire engine and your fellow firefighters to extinguish all the flames you can see. Can you keep your cool and save everyone in a constantly changing environment?', '/images/snes/5637/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/32/The_Ignition_Factor_Box.jpg', NULL, NULL),
(5638, 'Igo Club', NULL, NULL, 'Igo Club is a Miscellaneous game, published by Hect,  which was released in Japan in 1996.', '/images/snes/5638/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/6/312436_front.jpg', NULL, NULL),
