(5641, 'Illvanian no Shiro', NULL, NULL, 'Illvanian no Shiro: Ruins of Illvanian is a Strategy game, published by Nippon Clary Business,  which was released in Japan in 1994.', '/images/snes/5641/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/5/306995_front.jpg', NULL, NULL),
(5642, 'Imperium', 'Kidou Soukou Dion', NULL, 'Get Ready For A Heavy Metal Explosion', '/images/snes/5642/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/8/7/50787_front.jpg', NULL, NULL),
(5643, 'Inazuma Serve da!! Super Beach Volley', NULL, NULL, 'Super Beach Volley is a Sports game, developed by Nippon Bcom and published by Virgin Interactive,  which was released in Japan in 1995.', '/images/snes/5643/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/6/312466_front.jpg', NULL, NULL),
(5644, 'Incantation', NULL, NULL, 'You live in a place of peace and harmony called the Magic Kingdom. The Magic Kingdom consists of seven worlds: the enchanted forest, mountains, swamps, cursed cliffs, and the palace of the evil wizard, Necroman. From the dawn of time, the peace within the seven worlds of the kingdom was controlled by a line of very good and very powerful magicians. It was one of these magicians who was chosen to inherit the power of his ancestors and thus became the guardian of the strange Book of Sorcery, which enabled him to hold absolute power in his hands.', '/images/snes/5644/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/8/55588_front.jpg', NULL, NULL),
(5645, 'Indiana Jones\' Greatest Adventures', NULL, NULL, 'Grab your trusty whip and slash your way throughout all three Indy classics in this no-thrills-barred video game adventure! If it happens in the movies... it happens here... the giant boulder from Raiders of the Lost Ark, the mine cart chase from Temple of Doom, Three Trials from The Last Crusade. It\'s three times the Indy, all on one blockbuster game pak!', '/images/snes/5645/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/01/IJ-GA.jpg', NULL, NULL),
(5646, 'Inindo: Way of the Ninja', 'Super Inindo: Datou Nobunaga', NULL, 'You\'re a young ninja hungry for adventure and revenge. Travel on foot or by boat to famous training grounds where you will learn Ninjutsu, the secret art of stealth fighting! Use your trusty sword, throwing stars or even magic spells against vicious monsters inside Japan\'s treacherous dungeons.', '/images/snes/5646/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/28/Inindo_boxart.jpg', NULL, NULL),
(5647, 'Inspector Gadget', NULL, NULL, 'Go Go Gadget!', '/images/snes/5647/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/4c/Inspector_Gadget_DIC_animated_series_title_card.png', NULL, NULL),
(5648, 'International Superstar Soccer', 'Jikkyou World Soccer: Perfect Eleven', NULL, 'The best soccer game around has gone portable! Take part in exhibition matches, international cups and penalty shoot outs in a bid to become the top soccer nation on Earth. Choose from 36 teams with full player rosters and set your own strategies. Heat up the net as you challenge the World.', '/images/snes/5648/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/7/6/15676_front.jpg', NULL, NULL),
(5649, 'International Tennis Tour', NULL, NULL, '"International Tennis Tour", with a world championship of over 200 tournaments, a Nations\' Cup and its different training modes and game levels, is undoubtedly the most complete and realistic game simulation available today.', '/images/snes/5649/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cd/International_Tennis_Tour_Cover.jpg', NULL, NULL),
(5650, 'Ippatsu Gyakuten: Keiba Keirin Kyōtei', NULL, NULL, 'Ippatsu Gyakuten: Keiba - Keirin - Kyoutei is a Sports game, developed by Electronics Application and published by Pow,  which was released in Japan in 1996.', '/images/snes/5650/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/7/312457_front.jpg', NULL, NULL),
(5651, 'The Irem Skins Game', 'The Irem Major Title', NULL, 'Tee Up And Wager Down!', '/images/snes/5651/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/0/51140_front.jpg', NULL, NULL),
(5652, 'Iron Commando: Koutetsu no Senshi', NULL, NULL, 'Iron Commando: Koutetsu no Senshi is an Action game, developed by Arcade Zone LTD and published by Pack-In-Video,  which was released in Japan in 1995.', '/images/snes/5652/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Iron_Commando_-_Koutetsu_no_Senshi_Coverart.png', NULL, NULL),
(5653, 'Isozuri: Ritou Hen', NULL, NULL, 'Iso Zuri: Ritou Hen is a Sports game, published by Pack-In-Video,  which was released in Japan in 1996.', '/images/snes/5653/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/1/312451_front.jpg', NULL, NULL),
(5654, 'Itadaki Street 2: Neon Sign wa Bara Iro ni', NULL, NULL, 'Itadaki Street 2: Neon Sign wa Bara Iro ni is a Miscellaneous game, developed by Tomcat System and published by Enix Corporation,  which was released in Japan in 1994.', '/images/snes/5654/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/1/43391_front.jpg', NULL, NULL),
(5655, 'The Itchy and Scratchy Game', NULL, NULL, 'They fight, and bite, they fight and bith and fight. Get ready as Itchy & Scratchy slice, dice, crash and bash their way into your home. This cat\'s gonna need more than nine lives to survive bazookas, grenades, chain saws and flame throwers. There\'s more than one way to skin a cat. So, are you mouse enough!!!???', '/images/snes/5655/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c1/The_Itchy_and_Scratchy_Game_Coverart.png', NULL, NULL),
(5656, 'Itoi Shigesato no Bass Tsuri No. 1', NULL, NULL, 'Itoi Shigesato no Bass Tsuri No. 1 is a Sports game, developed by Dice and published by Nintendo,  which was released in Japan in 1997.', '/images/snes/5656/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a2/ShigesatoSFC.png', NULL, NULL),
(5657, 'Itou Haka Rokudan no Shougi Doujou', NULL, NULL, 'Itou Hatasu Mu-Dan no Shogi Dojo is a Miscellaneous game, published by ASK,  which was released in Japan in 1994.', '/images/snes/5657/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/4/312454_front.jpg', NULL, NULL),
(5658, 'Izzy\'s Quest for the Olympic Rings', NULL, NULL, 'The ancient Greeks ignited the first Olympic torch hundreds of years ago. The Eternal flame has now been stolen. IZZY, the Olympic character needs your help! Without the flame, the 1996 Olympic Games will be cancelled. Help IZZY find the five Olympic rings in six magical quests to re-enter the Reality Vortex, then relight the flame in the human world. It\'s a tough job, but with IZZY\'S morphing abilities and your help...you\'ll be big time heroes!', '/images/snes/5658/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/8/50798_front.jpg', NULL, NULL),
(5659, 'J.League \'96 Dream Stadium', NULL, NULL, 'J.League \'96 Dream Stadium is a Sports game, developed by AI and published by Hudson,  which was released in Japan in 1996.', '/images/snes/5659/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/0/307220_front.jpg', NULL, NULL),
(5660, 'J.League Excite Stage \'94', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5661, 'J.League Excite Stage \'95', NULL, NULL, 'J.League Excite Stage \'95 is a Sports game, developed by A-Max and published by Epoch,  which was released in Japan in 1995.', '/images/snes/5661/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/3/307083_front.jpg', NULL, NULL),
(5662, 'J.League Excite Stage \'96', NULL, NULL, 'J.League Excite Stage \'96 is a Sports game, developed by A-Max and published by Epoch,  which was released in Japan in 1996.', '/images/snes/5662/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/5/307215_front.jpg', NULL, NULL),
(5663, 'J.League Soccer Prime Goal', NULL, NULL, 'J.League Soccer: Prime Goal is a Sports game, developed and published by Namco,  which was released in Japan in 1993.', '/images/snes/5663/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/9/306859_front.jpg', NULL, NULL),
(5664, 'J.League Soccer Prime Goal 2', NULL, NULL, 'J.League Soccer: Prime Goal 2 is a Sports game, published by Namco,  which was released in Japan in 1994.', '/images/snes/5664/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/9/306959_front.jpg', NULL, NULL),
(5665, 'J.League Super Soccer \'95 Jikkyō Stadium', NULL, NULL, 'J.League Super Soccer \'95: Jikkyou Stadium is a Sports game, developed by AI and published by Hudson,  which was released in Japan in 1995.', '/images/snes/5665/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cc/J-LeagueSuperSoccer95JPBoxShotSNES.jpg', NULL, NULL),
(5666, 'J.R.R. Tolkien\'s The Lord of the Rings, Vol. I', NULL, NULL, 'Adventure comes alive in 16-bit fantasy with the swords and sorcery of J.R.R. Tolkein\'s "The Lord of the Rings." Prepare yourself as this treasured Tolkien tale takes you on an epic quest to destroy the One Ring that has the power to enslave Middle-earth. But beware, the evil Lord Sauron and his mighty forces will fight you at every turn in your quest to conquer the Balrog and destroy the One Ring of Power.', '/images/snes/5666/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0c/LOTRSNES.jpg', NULL, NULL),
(5667, 'Jack Nicklaus Golf', NULL, NULL, 'The biggest name in golf brings you the most realistic and feature-backed golf simulation ever! Play on two of Jack Nicklaus\' favorite courses or design an unlimited number of your own. One to four players can compete on beginner and expert levels. You control every detail of the action. The password feature even lets your take a break. If you\'re ready to play against the best, JACK NICKLAUS GOLF is your game!', '/images/snes/5667/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/3/9/4439_front.jpg', NULL, NULL),
(5668, 'Jaki Crush', NULL, NULL, NULL, '/images/snes/5668/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c1/Jaki_Crush_Coverart.png', NULL, NULL),
(5669, 'Jaleco Rally: Big Run: The Supreme 4WD Challenge', NULL, NULL, 'Jaleco Rally - Big Run: The Supreme 4WD Challenge is a Racing game, published by Jaleco Entertainment,  which was released in Japan in 1991.', '/images/snes/5669/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/7/50527_front.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(5670, 'James Pond 3: Operation Starfish', NULL, NULL, 'The sinister Dr. Maybe is back and only our slickest Special Agent, James Pond, can stop him. Special Agent Finnius Frog can help you get to those hard to reach places with his powerful jumping abilities. Explore more than 100 levels of outrageous fun! Win using an ocean of FI5H gadgets: suction boots, the fruit gun, X-ray specs, a thruster unit, spring boots and a clever fruit suit disguise. Use a special FI5H rocket pack to defeat Dr. Maybe! Fry over 40 different enemies under Dr. Maybe\'s control and avoid Maybe\'s mounted guns and missile launchers!', '/images/snes/5670/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/3/47603_front.jpg', NULL, NULL),
(5671, 'Jammes', NULL, NULL, 'Jammes is a Puzzle game, developed by Mighty Craft and published by Carrozzeria,  which was released in Japan in 1995.', '/images/snes/5671/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/4/3/307043_front.jpg', NULL, NULL),
(5672, 'Jammit', NULL, NULL, 'Okay, here are the rules - there are none! No stats. No squeaky-clean courts, high priced players or NBA (Nerds and Babies Association) rules. This is JAMMIT - where you play on the streets and push to the limit. FLAUNT IT. Man, you look too good. Forget those robots in jerseys. We used digitized players for this game. TAUNT IT. Tell \'em to back off, pay up or front this. Or shut up and let the ball do the dissin\'. SHOVE IT. Hey, you do what it takes to win. And sometimes it takes a jab in the ribs and a push in the back. PICK IT. 1 or 2 player action. 3 killer opponents. 8 different 1-on-1 games. SLAM IT. "Slam Cam" lets you show off your dunking moves from the view of the brutalized basket. KEEP IT. Passwords save your best games. Just in case some fool doubts how good you really are. FACE IT. You\'re gonna get a little dirty. And this game\'s gonna get a lot dirty. GET IT? Now JAMMIT.', '/images/snes/5672/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/08/Jammit_Coverart.png', NULL, NULL),
(5673, 'Janyuuki Gokuu Randa', NULL, NULL, 'Janyuuki Gokuu Randa is a Miscellaneous game, published by Virgin Interactive,  which was released in Japan in 1995.', '/images/snes/5673/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/5/307035_front.jpg', NULL, NULL),
(5674, 'JB The Super Bass', NULL, NULL, 'JB: The Super Bass is a Sports game, developed by Gaps and published by Naxat Soft,  which was released in Japan in 1995.', '/images/snes/5674/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/2/312002_front.jpg', NULL, NULL),
(5675, 'Jelly Boy', NULL, NULL, 'If it\'s raining... no problem... he can dodge trouble, give it the hammer or move like a rocket! It\'s not all hot air, just look again. Is it a bird? Is it a brick? No it\'s... Jelly Boy', '/images/snes/5675/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/2/50802_front.jpg', NULL, NULL),
