(5685, 'Jim Lee\'s WildC.A.T.S: Covert Action Teams', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5686, 'Jim Power: The Lost Dimension in 3-D', NULL, NULL, '"JIm Power: The Lost Dimension in 3-D" utilizes the revolutionary NUOPTIX 3D graphics, allowing you to experience the thrill of virtual reality without a virtual reality system. 3D glasses facilitate the incredible depth experience, but the thrill and the horror of "The Lost Dimension" may be fully experienced with or without 3-D glasses.', '/images/snes/5686/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c8/Jim_Power_-_The_Lost_Dimension_in_3-D_Coverart.png', NULL, NULL),
(5687, 'Jimmy Houston\'s Bass Tournament U.S.A.', 'Jissen! Bass Fishing Hisshouhou in USA', NULL, 'The only fishing game available that simulates 4 real tournament lakes. With the advice of Jimmy Houston (Two Time Winner of the B.A.S.S. Tournament "Angler of the Year" Award and 14 Time National Tournament Champion), you can learn all the ins and outs of how to actually go Bass Fishin\'! The game features Shimano Rods and Reels.', '/images/snes/5687/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/6/50806_front.jpg', NULL, NULL),
