(5693, 'Joe and Mac 2: Lost in the Tropics', NULL, 'Tatakae Genshijin 3: Shuyaku wa Yappari Joe and Mac', 'Our heroes, Joe and Mac, have volunteered to search for their leader\'s crown and bring it back so that peace can be restored. Of course, they\'re not risking their lives just out of the goodness of their hearts - they\'re out to impress the cave-babes, too!', '/images/snes/5693/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/9/50809_front.jpg', NULL, NULL),
(5694, 'John Madden Football', 'Pro Football', NULL, 'BIG, TOUGH, BONE-CRUSHING! Call plays with ease from Madden\'s playbook. Madden stacks up your stats against the competition. Grind it out in rain and mud before Super Sunday! Unique zoom camera zeroes in on receivers.', '/images/snes/5694/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3c/John_madden_football.jpg', NULL, NULL),
(5695, 'John Madden Football \'93', 'Pro Football \'93', NULL, 'Football\'s Greatest Lineup Ever!', '/images/snes/5695/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/cc/John_Madden_Football_%2793_Coverart.png', NULL, NULL),
(5696, 'JoJo no Kimyou na Bouken', NULL, NULL, 'JoJo no Kimyou na Bouken is a Role-Playing game, developed by WinkySoft and published by Cobra Team,  which was released in Japan in 1993.', '/images/snes/5696/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/5/303465_front.jpg', NULL, NULL),
(5697, 'Joushou Mahjong Tenpai', NULL, NULL, 'Joushou Mahjong Tenpai is a Miscellaneous game, developed by Game Arts and published by Enix Corporation,  which was released in Japan in 1995.', '/images/snes/5697/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/8/31898_front.jpg', NULL, NULL),
(5698, 'Judge Dredd', NULL, NULL, 'Mega-City One is in ruins. Corruption is rampant. It\'s time to take the law into your own hands. Armed with explosive Lawgiver firepower -- heat seekers, ricochet rockets, incendiary missiles and more -- take on Mean Machine, the ABC Robot and other brutal barriers to justice. Take to the skies on your high speed Lawmaster motorcycle and pacify even the most persistent perps! You\'re no above the law. You are the law!!!', '/images/snes/5698/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/3/0/24630_front.jpg', NULL, NULL),
(5699, 'Jumpin\' Derby', NULL, NULL, 'Jumpin\' Derby is a Sports game, developed by Kid and published by Naxat Soft,  which was released in Japan in 1996.', '/images/snes/5699/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/8/306078_front.jpg', NULL, NULL),
(5700, 'Jungle no Ōja Tar-chan: Sekai Manyū Dai Kakutō no Maki', NULL, NULL, 'Jungle no Ouja Tar-chan: Sekai Manyuu Dai Kakutou no Maki is an Action game, developed by Kuusou Kagaku and published by Bandai,  which was released in Japan in 1994.', '/images/snes/5700/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/4/31794_front.jpg', NULL, NULL),
(5701, 'Jungle Strike', NULL, NULL, 'The Desert Madman is dead - now his vicious son plots a nuclear strike against the U.S.A. He\'s enlisted a powerful ally -- a ruthless South American Drug Lord with an army of hi-tech mercenaries. It\'s YOUR mission to take them out!', '/images/snes/5701/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/ff/Jungle_strike_cover.png', NULL, NULL),
(5702, 'Jungle Wars 2: Kodai Mahō Atimos no Nazo', NULL, NULL, 'Jungle Wars 2 is a Role-Playing game, developed by Atelier Double and published by Pony Canyon,  which was released in Japan in 1993.', '/images/snes/5702/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/9/5/31695_front.jpg', NULL, NULL),
(5703, 'Jurassic Park 2: The Chaos Continues', NULL, NULL, 'A year has passed. No one has set foot in Jurassic Park... until now. As Dr. Grant, you\'ll venture back to the island, where more dinosaurs than you could ever imagine await your return - including all-new species.', '/images/snes/5703/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/8/46358_front.jpg', NULL, NULL),
(5704, 'Justice League Task Force', NULL, NULL, 'Batman vs. Superman! Wonder Woman vs. The Flash! Aquaman vs. Green Arrow! Are you reading this right? For the first time ever, the DC super heroes battle head-to-head! Become your favorite Justice League super hero or choose evil villains Darkseid, Cheetah, or Despero! Pit your hero\'s special powers and awesome signature moves against any character you choose... even Superman vs. Superman! Battle from the ends of the earth to Metropolis, Gotham City, Apokolips and more! Incredible, pulse-pounding one-on-one fighting action and super sound FX put this game in a league of its own!', '/images/snes/5704/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Justice_League_Task_Force_game_cover.jpg', NULL, NULL),
(5705, 'Jyutei Senki', NULL, NULL, 'Jyutei Senki is a Strategy game, developed by TamTam and published by Enix Corporation,  which was released in Japan in 1993.', '/images/snes/5705/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/1/31721_front.jpg', NULL, NULL),
(5706, 'JWP Joshi Pro Wrestling: Pure Wrestle Queens', NULL, NULL, 'JWP Joshi Pro Wrestling: Pure Wrestle Queens is a Sports game, published by Jaleco Entertainment,  which was released in Japan in 1994.', '/images/snes/5706/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/3/307033_front.jpg', NULL, NULL),
(5707, 'Ka-Blooey', 'Bombuzal', NULL, 'It\'s a mind-blower! Welcome to the mind-blowing, bomb-throwing, brain-twisting world of KA-BLOOEY--where any button you push could lead you right to oblivion. You\'re a weird little bug-eyed spud in a land of exploding tiles, and only your knowledge of demolitions can save you from certain disaster. Use your strategic skill to set off the bombs, before they get you. Watch your step on a tile that\'s cracked--it\'s liable to break your back. And be sure not to blow it too soon. There are 130 levels before you make it to total safety!', '/images/snes/5707/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/2/50812_front.jpg', NULL, NULL),
(5708, 'Kabuki-chou Reach Mahjong: Toupuusen', NULL, NULL, 'Kabuki-chou Reach Mahjong: Toupuusen is a Miscellaneous game, developed by Studio Softmov and published by Pony Canyon,  which was released in Japan in 1994.', '/images/snes/5708/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/0/306940_front.jpg', NULL, NULL),
(5709, 'Kabuki Rocks', NULL, NULL, 'Kabuki Rocks is a Role-Playing game, developed by RED Entertainment and published by Atlus,  which was released in Japan in 1994.', '/images/snes/5709/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/0/31760_front.jpg', NULL, NULL),
(5710, 'Kachō Kōsaku Shima: Super Business Adventure', NULL, NULL, 'Kachou Shima Kousaku: Super Business Adventure is an Adventure game, developed by Tom Create and published by Yutaka,  which was released in Japan in 1993.', '/images/snes/5710/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/2/306862_front.jpg', NULL, NULL),
