(5718, 'Kawasaki Caribbean Challenge', NULL, NULL, 'Roar off to the Caribbean with GameTek and Kawasaki as they take you on a location for a super-heated, super-rally. Pick your power, Jet Ski Watercraft or Ninja Motorcycle you\'ve got the moves of a moray eel and the speed of a hammerhead shark with full range-of-motion maneuverability. Digitized island pics, digitized engine noise and shots of the real machines make you think you\'re on island time with the spray in your face, the sun on your back and a sure win just past the next reef. Let the good times roll!', '/images/snes/5718/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/3/50813_front.jpg', NULL, NULL),
