(5723, 'Ken Griffey Jr. Presents Major League Baseball', NULL, NULL, 'From power hiting to playing awesome defense, "The Kid" can do it all! Now, you can too, with KEN GRIFFEY JR. PRESENTS MAJOR LEAGUE BASEBALL®! Hundreds of unique characters from your favorite teams are here-- the very best Major League Baseball has to offer!', '/images/snes/5723/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/3/6/24136_front.jpg', NULL, NULL),
(5724, 'Ken Griffey Jr.\'s Winning Run', NULL, NULL, 'Now you can make baseball history with Ken Griffey Jr.s Winning Run! Play with all 28 Major League teams and challenge your baseball skills over a full season. Capture the pennant and you\'re off to the World Series!', '/images/snes/5724/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Ken_Griffey_Jr.%27s_Winning_Run.png', NULL, NULL),
