(5731, 'Kid Klown in Crazy Chase', NULL, NULL, '"Hey, kid! Help me out! I\'ve got to run for my life from evil space pirate Blackjack. He wants to conquer the planet with bombs, banana peels and booby traps; and I need all kinds of balloons and klown coins to escape! It\'s the spookiest, kookiest race you can run, with new diagonal scrolling for pie-in-your-face action! Plus hidden zones, power ups and bonus stages that make it a riot to play every time. So get off your butt! Let\'s go klown around!"', '/images/snes/5731/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/4/50584_front.jpg', NULL, NULL),
