(5742, 'King Arthur and the Knights of Justice', NULL, NULL, 'King Arthur Needs Your Help!', '/images/snes/5742/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9b/King_Arthur_and_the_Knights_of_Justice_cover_art.jpg', NULL, NULL),
(5743, 'King Arthur\'s World', 'Royal Conquest', NULL, NULL, NULL, NULL, NULL, NULL),
(5744, 'The King of Dragons', NULL, NULL, 'Darkness has fallen over the kingdom of Malus. Gildiss rises from his slumber and is looking to take his place as the KING OF DRAGONS. As the armies of Malus lie in defeat, you are part of a new band of adventurers that have come to challenge Gildiss. Choose to be one of five different classes including fighter, dwarf, elf, and wizard, and then battle your way through 16 levels of medieval action. If a friend wants to join the action, he can in the two-player simultaneous option. Defeat, and you will save the kingdom in... KING OF DRAGONS.', '/images/snes/5744/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/2/50822_front.jpg', NULL, NULL),
(5745, 'King of the Monsters', NULL, NULL, 'King of the Monsters is an action/fighting game that features city-destroying battles between huge monsters. Choose one of six monsters and travel around Japan, stopping to fight in various famous cities, with the aim of becoming the ultimate winner. In addition to punches, kicks, and other regular moves, each character has the ability to use more devastating maneuvers, like throwing flames and shooting laser beams, to defeat opponents. Wrestling elements are also incorporated, as you must completely exhaust your opponent and get a three-count to pin him and be victorious. Take on the challenge and claim the title of King of the Monsters!', '/images/snes/5745/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d4/Kotmneogeo.jpg', NULL, NULL),
(5746, 'King of the Monsters 2', NULL, NULL, 'In 1996, the country of Japan was devastated by the monster invasion. Six monsters did battle in the most destructive and terrifying catastrophe of all time. The war lasted 3 years and is known in history books as the KING OF THE MONSTERS massacre. Three monsters survived and have become more advanced and dangerous than ever before. But now, a new nemesis is on the scene. The alien invasion will be the biggest challenge for Earth\'s monstrosity. An unimaginable rumble that will rock the world and this new war will certainly be coined by witnesses as the... King of the Monsters 2 colossal confrontation!', '/images/snes/5746/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d4/Kotmneogeo.jpg', NULL, NULL),
(5747, 'The King of Rally', NULL, NULL, 'The King of Rally is a Racing game, developed by Kaze and published by Meldac,  which was released in Japan in 1992.', '/images/snes/5747/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/5/31685_front.jpg', NULL, NULL),
(5748, 'Kingyo Chuuihou! Tobidase Game Gakuen', NULL, NULL, 'Kingyo Chuuihou! Tobidase! Game Gakuen is an Action game, developed and published by Jaleco Entertainment,  which was released in Japan in 1994.', '/images/snes/5748/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/0/43390_front.jpg', NULL, NULL),
(5749, 'Kinnikuman: Dirty Challenger', NULL, NULL, 'Kinnikuman: Dirty Challenger is a Sports game, published by Yutaka,  which was released in Japan in 1992.', '/images/snes/5749/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/7/306797_front.jpg', NULL, NULL),
(5750, 'Kirby no Kirakira Kizzu', NULL, NULL, 'Join Kirby as he stacks the falling stars with help from his friends, Rick the Hamster, Kine the Sunfish, and Coo the Owl. Watch out for King Dedede. He is out to stop you! With a few quick moves and some well-timed strategy, you can quickly outwit him and move on to the next challenging level. Kirby\'s Star Stacker features pure puzzle fun for everyone. From above, blocks rain down constantly. From below, whole lines appear with unrelenting clock-like regularity. Simply sandwich the stars between Kirby\'s pals and you\'ll soon be on your way to the high score.', '/images/snes/5750/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/0/30510_front.jpg', NULL, NULL),
(5751, 'Kirby Super Star', NULL, 'Hoshi no Kirby Super Deluxe', 'Dream Land is under siege again! Our hero, Kirby, returns to instigate a rescue. King Dedede is snatching up Dream Land\'s food supply, but he\'s not the only one! Dyna Blade, Meta Knight and a slew of other evil baddies are on the loose and wreaking havoc throughout the land.', '/images/snes/5751/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3a/Kirby_Super_Star_Coverart.png', NULL, NULL),
(5752, 'Kirby\'s Avalanche', 'Kirby\'s Ghost Trap', NULL, 'AVALANCHE! The call is heard in the hills and valley throughout Dream Land! The people of the country hold their breath in wonder. The First Annual Dream Land\'s Avalanche Competition has begun!', '/images/snes/5752/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/63/Kirby%27s_Avalanche_Coverart.png', NULL, NULL),
(5753, 'Kirby\'s Dream Course', 'Kirby Bowl', NULL, 'Scan the course and check out the obstacles ahead. Get ready for the most surprising game play imaginable in Kirby\'s battle against King Dedede!', '/images/snes/5753/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/Kirbydreamcourse.jpg', NULL, NULL),
(5754, 'Kirby\'s Dream Land 3', 'Hoshi no Kirby 3', NULL, 'Kirby, Dream Land\'s resident hero (and everyone\'s favorite puffball), must once again save the day when the mischievous King Dedede starts causing trouble. Kirby must travel through an assortment of levels, battling an exotic array of enemies (both new and familiar) determined to stop him from completing his mission. Always armed with his trusty ability to swallow enemies and gain special attacks, Kirby can also unite with some of his animal friends and make use of their particular talents. Featuring detailed graphics, challenging boss battles and the distinct charm of a Kirby game, it\'s no wonder this title is considered a classic.', '/images/snes/5754/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/8/19628_front.jpg', NULL, NULL),
(5755, 'Kishin Douji Zenki: Batoru Raiden', NULL, NULL, 'Kishin Douji Zenki: Rettou Raiden is an Action game, developed by CAProduction and published by Hudson,  which was released in Japan in 1995.', '/images/snes/5755/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/1/310331_front.jpg', NULL, NULL),
