(5759, 'Knights of the Round', NULL, NULL, 'Legend says that the man who pulls the sword, Excaliber, from the stone is destined to be king. But even the power of Excaliber can not release Britain from the chaos into which it has plunged. Years of civil war have taken their toll and now only the power of the legendary grail can bring peace back to the land.', '/images/snes/5759/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/3/2/40132_front.jpg', NULL, NULL),
