(5781, 'Lagoon', 'Ragūn', NULL, 'Lakeland has a drinking problem. All the water has been fouled, and it\'s up to you to find out why. As Nasir, Child of Light, you will embark on a quest that demands great courage and fortitude. It\'s a journey that takes Nasir from childhood to manhood, played out against breathtaking, 16 bit backdrops. Along the way, you must negotiate a network of labyrinths filled with horrifying, 3-D creatures. Using weapons, magical items and 16 spells, you can turn the tide, defeating the forces of evil and restoring pure water to this once tranquil little town.', '/images/snes/5781/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/0/50860_front.jpg', NULL, NULL),
(5782, 'Lamborghini American Challenge', NULL, NULL, 'Imagine speeding along endless American highways in the fastest sports car in the world, racing against a multitude of artificially intelligent competitors in a bid to become the world number one.', '/images/snes/5782/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/53/Lamborghini_American_Challenge.jpg', NULL, NULL),
