(5785, 'The Lawnmower Man', 'Virtual Wars', NULL, 'As a movie. The Lawnmower Man exploded the boundaries of graphics technology. As a game, it will blow your mind with a dazzling blend of breath-taking 3D and blockbustin action.', '/images/snes/5785/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/76/The_Lawnmover_Man_PC_Cover.jpg', NULL, NULL),
