(5787, 'Leading Jockey', NULL, NULL, 'Leading Jockey is a Sports game, developed by Media Entertainment and published by Carrozzeria,  which was released in Japan in 1994.', '/images/snes/5787/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/2/306972_front.jpg', NULL, NULL),
(5788, 'Leading Jockey 2', NULL, NULL, 'Leading Jockey 2 is a Sports game, published by Carrozzeria,  which was released in Japan in 1995.', '/images/snes/5788/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/5/307155_front.jpg', NULL, NULL),
(5789, 'The Legend of the Mystical Ninja', 'Ganbare Goemon: Yukihime Kyuushutsu Emaki', NULL, 'A curse has stricken the village of Horo-Horo. Their beloved princess has vanished. And without her powers, a plague of giant locusts will ravage the helpless. Talk about sick!', '/images/snes/5789/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/12/The_Legend_of_the_Mystical_Ninja_Coverart.png', NULL, NULL),
(5790, 'The Legend of Zelda: A Link to the Past', 'The Legend of Zelda: Triforce of the Gods', NULL, 'Venture back to Hyrule and an age of magic and heroes. The predecessors of Link and Zelda face monsters on the march when a menacing magician takes over the kingdom. Only you can prevent his evil plot from shattering the land of Hyrule. In your quest, you\'ll venture into twisting mazes, dungeons, palaces and shadowy forests. Test your mettle with mighty swords and magical weapons. Or heft a boulder and hurl it at your enemies. If the going gets tough, dive into a river - you can swim to escape! Learn the powerful spells, locate magical artifacts and solve the mysteries of the evil magician and the hidden realm of Hyrule.', '/images/snes/5790/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/21/The_Legend_of_Zelda_A_Link_to_the_Past_SNES_Game_Cover.jpg', NULL, NULL),
(5791, 'Lennus II: Fuuin no Shito', NULL, NULL, 'Lennus II: Fuuin no Shito is a Role-Playing game, developed by Copya Systems and published by Asmik Ace Entertainment, Inc,  which was released in Japan in 1996.', '/images/snes/5791/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/9/20529_front.jpg', NULL, NULL),
(5792, 'Lester the Unlikely', 'Odekake Lester: Lelele no Le', NULL, 'Marooned on a tropical island far from home, Lester faces it all with the courage of a small frightened rodent. Our unlikely hero has as much trouble walking as he does facing treacherous obstacles. It\'s the ultimate "geek to greatness" adventures as you guide Lester through his rite of passage. Help him face the terrors of the beach, the haunting chills of the underworld and the dreaded pirates of the south seas. Do all of this and Lester just might make it home, maybe even a little cooler than when he started. There\'s just one catch though, Lester can be slithly opinionated when it comes to his safety.', '/images/snes/5792/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e3/LestertheUnlikely_boxart.png', NULL, NULL),
(5793, 'Lethal Enforcers', NULL, NULL, 'Lethal Enforcers is out to clean up the streets in the baddest parts of Chicago. Digitized graphics and sound will slam you into cold reality and heated action. Your job is to defend the innocent and protect yourself from a fatal case of lead poisoning.', '/images/snes/5793/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0a/Lethal_Enforcers.png', NULL, NULL),
(5794, 'Liberty or Death', 'Dokuritsu Sensou: Liberty or Death', NULL, 'Crush The Rebel Resistance!', '/images/snes/5794/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/00/Liberty_or_Death_Coverart.png', NULL, NULL),
(5795, 'Libble Rabble', NULL, NULL, 'Libble Rabble is an Action game, developed and published by Namco,  which was released in Japan in 1994.', '/images/snes/5795/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8a/Libble_Rabble_Poster.png', NULL, NULL),
(5796, 'Light Fantasy', NULL, NULL, 'Light Fantasy is a Role-Playing game, developed by Advance Communication Company and published by Tonkin House,  which was released in Japan in 1992.', '/images/snes/5796/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/0/312400_front.jpg', NULL, NULL),
(5797, 'Light Fantasy II', NULL, NULL, 'Light Fantasy 2 is a Role-Playing game, published by Tonkin House,  which was released in Japan in 1995.', '/images/snes/5797/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/8/312378_front.jpg', NULL, NULL),
(5798, 'Little Master: Nijiiro no Maseki', NULL, NULL, 'Little Master is a Strategy game, developed and published by Tokuma Shoten,  which was released in Japan in 1995.', '/images/snes/5798/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/1/306231_front.jpg', NULL, NULL),
(5799, 'Live A Live', NULL, NULL, 'Live A Live is a Strategy game, developed and published by SquareSoft,  which was released in Japan in 1994.', '/images/snes/5799/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b8/LiveALiveBoxArt.jpg', NULL, NULL),
(5800, 'Lock On', 'Super Air Diver', NULL, 'Wreak havoc in the air when you lock on target and blast your enemies out of the skies. You are Jake Steel and it\'s up to you to stop a crazed madman from blowing up the United Nations.', '/images/snes/5800/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/7/50877_front.jpg', NULL, NULL),
(5801, 'Lode Runner Twin: Justy to Liberty no Daibouken', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5802, 'Lodoss Tou Senki: Record of Lodoss War', NULL, NULL, 'Lodoss Tou Senki is a Role-Playing game, developed by Thinking Rabbit and published by Kadokawa,  which was released in Japan in 1995.', '/images/snes/5802/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e3/Record_of_Lodoss_War%2C_Volume_1.jpg', NULL, NULL),
(5803, 'Logos Panic', NULL, NULL, 'Logos Panic: Goaisatu is a Puzzle game, developed by Kan\'s and published by Yutaka,  which was released in Japan in 1995.', '/images/snes/5803/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/3/307153_front.jpg', NULL, NULL),
(5804, 'Looney Tunes B-Ball', 'Looney Tunes Basketball', NULL, 'Tighten your laces and take the court for Looney Tunes B-Ball - the wacky, fast jammin\' games of roundball where anything goes!', '/images/snes/5804/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/4/50874_front.jpg', NULL, NULL),
(5805, 'Lord Monarch', NULL, NULL, 'Lord Monarch is a Strategy game, developed by AIM and published by Epoch,  which was released in Japan in 1992.', '/images/snes/5805/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4c/Lord_Monarch_cover.jpg', NULL, NULL),
(5806, 'The Lost Vikings', 'Viking no Daimeiwaku', NULL, 'It\'s just another cool day of Nordic seafaring and pillaging when Erik the Swift, Baleog the Fierce and Olaf the Stout are suddenly sucked into an alien spaceship. And only you can help them find their way home. But each mysterious door you help them through throws them into different eras in time - and smack into new enemies! Will Baleog conquer Elmo the Dinosaur in Prehistoria? Will Olaf shield himself from the berserker mummies in the Great Pyramids of Egypt? And can Erik outrun the maniacal ripsaw in the Great Factory? Hurry! Only you can get these vanished Vikes out of the grasp of their alien captors and home through the chaotic arcade action!', '/images/snes/5806/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/74/The_Lost_Vikings_SNES_cover.jpg', NULL, NULL),
(5807, 'The Lost Vikings 2', NULL, NULL, 'Help the Lost Vikings home. The lost boys are back. Erik the Swift, Balog the Fierce and Olaf the Stout. Armed with all new high tech weaponry the boys heisted from Tomator, they set out to find the time machine that will send them back home.', '/images/snes/5807/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/56/Lost_Vikings_2_Boxshot.jpg', NULL, NULL),
(5808, 'Love Quest', NULL, NULL, 'Love Quest is a Role-Playing game, developed by C-Lab and published by Tokuma Shoten,  which was released in Japan in 1995.', '/images/snes/5808/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/4/312404_front.jpg', NULL, NULL),
(5809, 'Lucky Luke', NULL, NULL, 'EXPERIENCE THE FIRST AND FASTEST 3D COWBOY ADVENTURE IN THE WEST!', '/images/snes/5809/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0e/LuckyLuke2.png', NULL, NULL),
(5810, 'Lufia and the Fortress of Doom', 'Estpolis Denki', NULL, 'The Sinistrals, four masters of Doom, arrived in this land on their floating island 100 years ago.  You will begin your quest by traveling through time to join in a tremendous battle against them--and you will determine the outcome.  When you return to present time, you and Lufia, your companion, must join forces with two others to prevent the Sinistrals from regaining control of your world.  It will be a long and difficult task--This land is larger than that of most RPG games.  And in the end, the balance of fate will be overturned in a contest of love and betrayal that could destroy you all.', '/images/snes/5810/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/36/Lufia_Fortress_of_Doom.jpg', NULL, NULL),
(5811, 'Lufia II: Rise of the Sinistrals', NULL, 'Estpolis Denki II', 'This exciting sequel to the Lufian legend pits monster hunter Maxim and six adventuring companions against the sinister Sinistrals.  The story develops into a complex maze, challenging you with big battles, puzzles and loads of surprises.  You can even grow your own monsters!  You will enjoy countless hours on a fantastic journey in the world of Lufia!', '/images/snes/5811/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/8/50888_front.jpg', NULL, NULL),
(5812, 'Lupin III: Densetsu no Hihō o Oe!', NULL, NULL, 'Lupin III: Densetsu no Hihou o Oe! is an Action game, developed by SAS Sakata and published by Epoch,  which was released in Japan in 1994.', '/images/snes/5812/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/3/50883_front.jpg', NULL, NULL),
(5813, 'M.A.C.S. Basic Rifle Marksmanship', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5814, 'Madden NFL \'94', 'NFL Pro Football \'94', NULL, 'He\'s All pro tight end. He\'s big and pretty. Big as a dump truck. Runs like a gazelle. But hey. Come across the middle and I send him to another zip code. C.O.D. Next trip through my zone he\'ll remember. It\'s a long season.', '/images/snes/5814/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/25/Madden_NFL_%2794_Coverart.png', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(5815, 'Madden NFL \'95', NULL, NULL, 'ACTION! Ultra-competitive computer opponent. New 3-D rendered player moves; straight arms, high steppin\', QB slides. Bigger field DEPTH! Complete 1994 NFLPA rosters. 48 player rosters - sub any player in any formation. Over 100 player injuries. Full NFL season, Playoffs and Super Bowl. 28 NFL and All Madden teams. STRATEGY! Windowless passing option forces QBs to read zone or man coverages. All-new Madden-designed defenses. Best play calling logic ever - based on \'94-\'95 NFL strategies!', '/images/snes/5815/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d1/Madden_NFL_%2795_Coverart.png', NULL, NULL),
(5816, 'Madden NFL \'96', NULL, NULL, 'Get in the game! Featuring better control: laterals, fair catches, show blitz. 3 difficulty settings. Tougher computer opponents: 2-minute drill, kill the clock, tighter pass coverage. 5-receiver passing mode, individual player stats, league leaders sorted in 8 categories. New formations and plays - both offense and defense: over 240 from Madden\'s playbook. Global substitutions, custom TD celebrations, NFL and scouting combine records. Hidden codes reveal secret teams!', '/images/snes/5816/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/fe/Madden_NFL_%2796_Coverart.png', NULL, NULL),
(5817, 'Madden NFL 97', NULL, NULL, 'Madden NFL™ 97 reloads with an arsenal of new and classic features to field the most complete Madden ever.', '/images/snes/5817/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a1/Madden_NFL_97_Coverart.png', NULL, NULL),
(5818, 'Madden NFL 98', NULL, NULL, 'Madden NFL 98 captures everything you love about football. Huge hits. A burst up the middle. Tough play calls. A diving catch in the corner of the endzone. Roster decisions. You\'ll have to do it all to get the Super Bowl®, because this is the biggest, baddest most realistic Madden ever.', '/images/snes/5818/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/87/Madden_NFL_98_Coverart.png', NULL, NULL),
(5819, 'Madō Monogatari: Hanamaru Daiyōchienji', NULL, NULL, 'Madou Monogatari: Hanamaru Daiyouchi Enji is a Role-Playing game, developed by Compile and published by Tokuma Shoten,  which was released in Japan in 1996.', '/images/snes/5819/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/9/43389_front.jpg', NULL, NULL),
(5820, 'Magic Boy', NULL, NULL, 'As a wizard\'s apprentice, Hewlett has made some mistakes in the past, but this time he\'s really blown it! He\'s turned the master into a gigantic blue elephant and every other creature within a hundred mile radius into a monster! Now it\'s up to you to return everything to normal.', '/images/snes/5820/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Magic_Boy_Cover.jpg', NULL, NULL),
(5821, 'Magic Knight Rayearth', NULL, NULL, NULL, '/images/snes/5821/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/66/Magic_Knight_Rayearth_Coverart.png', NULL, NULL),
(5822, 'Magic Sword', NULL, NULL, 'The fearless warrior, Mohun, and his Magic Sword are the last hope of the Kingdom. At Drockmar Keep the dragon\'s tower glows red. Mohun has journeyed there on a quest to find the Black Orb and rid it of its command. You must guide him through each floor of the dreaded tower. You must help him find strong allies to fight unspeakable monsters and traps that lurk in its depths. Be brave. The Black Orb has been reawakened. Destroy it and bring light back to our world!', '/images/snes/5822/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a6/Magic_Sword_sales_flyer.jpg', NULL, NULL),
(5823, 'Magical Drop', NULL, NULL, 'Magical Drop is a Puzzle game, developed and published by Data East,  which was released in Japan in 1995.', '/images/snes/5823/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/62/MagicalDrop_titlescreen.png', NULL, NULL),
(5824, 'Magical Drop 2', NULL, NULL, 'The worldwide arcade hit brought to you by Bandai will keep you bursting bubbles and stacking combo points in this puzzler that will have your brain bubbling!', '/images/snes/5824/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/62/MagicalDrop_titlescreen.png', NULL, NULL),
(5825, 'The Magical Quest Starring Mickey Mouse', 'Mickey no Magical Adventure', NULL, 'Pluto has disappeared and his pal Mickey is hot on his trail! But evil Emperor Pete won\'t make it easy. He\'s snatched poor Pluto and hidden him deep within his dungeon. Now, Mickey must summon his courage and begin a treacherous trek through Emperor Pete\'s magical world to rescure his chum before it\'s too late!', '/images/snes/5825/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d4/Magical_Mirror.jpg', NULL, NULL),
(5826, 'Magna Braban: Henreki no Yuusha', NULL, NULL, 'Magna Braban: Henreki no Yusha is a Role-Playing game, developed by Lenar and published by ASK,  which was released in Japan in 1994.', '/images/snes/5826/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/1/307001_front.jpg', NULL, NULL),
(5827, 'Mahjong Gokuu Tenjiku', NULL, NULL, 'Mahjong Gokuu Tenjiku is a Miscellaneous game, developed and published by Chat Noir,  which was released in Japan in 1994.', '/images/snes/5827/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/0/295960_front.jpg', NULL, NULL),
(5828, 'Mahjong Hanjouki', NULL, NULL, 'Mahjong Hanjouki is a Miscellaneous game, published by Nichibutsu,  which was released in Japan in 1995.', '/images/snes/5828/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/4/307114_front.jpg', NULL, NULL),
(5829, 'Mahjong Taikai II', NULL, NULL, 'Mahjong Taikai II is a Miscellaneous game, published by Koei,  which was released in Japan in 1994.', '/images/snes/5829/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/9/31799_front.jpg', NULL, NULL),
(5830, 'The Mahjong Touhaiden', NULL, NULL, 'The Mahjong Touhaiden is a Miscellaneous game, developed by Khaos and published by Video System,  which was released in Japan in 1993.', '/images/snes/5830/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/5/306845_front.jpg', NULL, NULL),
(5831, 'Mahou Poi Poi Poitto!', NULL, NULL, 'Mahou Poi Poi Poitto! is a Puzzle game, developed by Metro and published by Takara,  which was released in Japan in 1994.', '/images/snes/5831/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/1/3/312013_front.jpg', NULL, NULL),
(5832, 'Mahōjin Guru Guru', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5833, 'Mahoujin Guru Guru 2', NULL, NULL, 'Mahoujin GuruGuru 2 is a Role-Playing game, published by Enix Corporation,  which was released in Japan in 1996.', '/images/snes/5833/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/0/312540_front.jpg', NULL, NULL),
(5834, 'Majin Tensei', NULL, NULL, 'Majin Tensei is a Strategy game, developed and published by Atlus,  which was released in Japan in 1994.', '/images/snes/5834/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Majin_Tensei_cover.png', NULL, NULL),
(5835, 'Majin Tensei II: Spiral Nemesis', NULL, NULL, 'Majin Tensei II: Spiral Nemesis is a Strategy game, developed and published by Atlus,  which was released in Japan in 1995.', '/images/snes/5835/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/1/312121_front.jpg', NULL, NULL),
(5836, 'Majuu Ou', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5837, 'Maka Maka', NULL, NULL, 'Maka Maka is a Role-Playing game, developed by Office Koukan and published by Sigma Ent. Inc.,  which was released in Japan in 1992.', '/images/snes/5837/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/8/5/306785_front.jpg', NULL, NULL),
(5838, 'Makeruna! Makendō 2: Kimero Youkai Souri', NULL, NULL, 'Makeruna! Makendou 2: Kimero Youkai Souri is an Action game, developed by Success and published by Datam Polystar,  which was released in Japan in 1995.', '/images/snes/5838/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/8/31838_front.jpg', NULL, NULL),
(5839, 'Manchester United Championship Soccer', 'Lothar Matthäus Super Soccer', NULL, '- Take control of the \'Mighty Reds\' as they battle their way into Europe!', '/images/snes/5839/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/5/41175_front.jpg', NULL, NULL),
(5840, 'Marchen Adventure Cotton 100%', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5841, 'Mario and Wario', NULL, NULL, 'Mario and Wario is a Puzzle game, developed by Game Freak and published by Nintendo,  which was released in Japan in 1993.', '/images/snes/5841/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a2/MariowarioSFC_boxart.jpg', NULL, NULL),
(5842, 'Mario no Super Picross', NULL, NULL, 'This Super NES version of the popular picture crossword game was originally released only in Japan and features hundreds of relaxing yet challenging brainteasers.', '/images/snes/5842/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fc/Mario%27s_Super_Picross.jpg', NULL, NULL),
(5843, 'Mario Paint', NULL, NULL, 'Mario Paint lets you draw, paint, animate and compose music! Creation! Imagination is your only limit with an amazing variety of drawing tools. Animation! Add exciting dimension by creating moving animation with up to 9 frame sequences. Orchestration! Compose your own songs by selecting from over 15 different musical sounds and the entire scale of notes. Coordination! Increase your Super NES Mouse dexterity by playing Gnat Attack, the clever fly swatter game included inside.', '/images/snes/5843/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ea/Mario_paint_box.jpg', NULL, NULL),
(5844, 'Mario\'s Early Years! Fun with Letters', NULL, NULL, 'In FUN WITH LETTERS, children are introduced to the fundamentals of letters and sounds by way of numerous learning worlds: Alphabet, Vowel, First Letter, Last Letter, Building, Sound, Sentence, and more.', '/images/snes/5844/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/1/50901_front.jpg', NULL, NULL),
(5845, 'Mario\'s Early Years! Preschool Fun', NULL, NULL, 'In PRESCHOOL FUN, children develop concepts through the exploration of shapes, colors, sounds, opposites, and numbers. With Mario\'s help, your children learns to define and identify these subjects without pressure.', '/images/snes/5845/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/0/50900_front.jpg', NULL, NULL),
(5846, 'Mark Davis\' The Fishing Master', 'Oomono Black Bass Fishing: Jinzouko Hen', NULL, NULL, NULL, NULL, NULL, NULL),
(5847, 'Marko\'s Magic Football', NULL, NULL, 'Welcome to the world of Marko, a world of cartoon madness. Experience the addictive blend of football skills and platform action that combine to make a superb gameplaying experience. Add the most incredible graphics ever to be seen and the result is Marko\'s Magic Football. It\'s just like playing a cartoon.', '/images/snes/5847/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/0/93710_front.jpg', NULL, NULL),
(5848, 'Marmalade Boy', NULL, NULL, 'Marmalade Boy is a Strategy game, developed by Kuusou Kagaku and published by Bandai,  which was released in Japan in 1995.', '/images/snes/5848/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7c/Marmalade_Boy_1_manga_cover.jpg', NULL, NULL),
(5849, 'Marvel Super Heroes: War of the Gems', 'Māvuru Supā Hīrōzu: Wō obu za Jemu', NULL, 'The most powerful collection of MARVEL SUPER HEROES now unite to battle treacherous mobs of Super-Villians! A mysterious foe has kicked off his plan to rule the world by collecting the Infinity Gems. While each gem controls one force of nature, combined they command limitless power.', '/images/snes/5849/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ae/MshSNES_boxart.jpg', NULL, NULL),
(5850, 'Marvelous: Mōhitotsu no Takarajima', NULL, NULL, 'Marvelous: Mouhitotsu no Takarajima is an Action Adventure game, developed and published by Nintendo,  which was released in Japan in 1996.', '/images/snes/5850/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/9/39889_front.jpg', NULL, NULL),
(5851, 'Mary Shelley\'s Frankenstein', NULL, NULL, 'From the pages of Mary Shelley\'s classic novel and the blockbuster film comes your own living nightmare - Mary Shelley\'s Frankenstein! Brought to life by Dr. Frankenstein, you\'re plunged into six huge levels of intense action. Dramatically unfolding through a unique "storyteller" feature, Mary Shelley\'s Frankenstein demands that you use both brains and brute strength to defeat a fearsome array of enemies, ranging from leeches and giant spiders to wolves and mounted soldiers. This fantastic world of Gothic horror is brought to life through stunningly realistic graphics and an eerie soundtrack, creating an atmosphere of unrelenting suspense.', '/images/snes/5851/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ad/Mary_Shelley%27s_Frankenstein_Cover.jpg', NULL, NULL),
(5852, 'The Mask', NULL, NULL, 'Somebody Stop Me!', '/images/snes/5852/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/9/50909_front.jpg', NULL, NULL),
(5853, 'Maten Densetsu: Senritsu no Ooparts', NULL, NULL, 'Maten Densetsu: Senritsu no Ooparts is a Role-Playing game, developed by Thinking Rabbit and published by Takara,  which was released in Japan in 1995.', '/images/snes/5853/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/5/312565_front.jpg', NULL, NULL),
(5854, 'Math Blaster: Episode 1', NULL, NULL, 'Oh no! The dreaded Trash Alien has captured Spot and littered the universe with garbage! Join our hero Blasternaut on a daring mission to rescue his robot pal. Blast your way through space junk, chase through dark and dangerous caverns, and fend off nasty alien creatures. Spot\'s fate is in your hands - good luck!', '/images/snes/5854/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/9/44189_front.jpg', NULL, NULL),
(5855, 'Matsukata Hiroki no Super Trawling', NULL, NULL, 'Matsukata Hiroki no Super Trawling is a Sports game, developed by Atelier Double and published by Tonkin House,  which was released in Japan in 1995.', '/images/snes/5855/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/5/307125_front.jpg', NULL, NULL),
(5856, 'Matsumura Kunihiro Den: Saikyō no Rekishi o Nurikaero!', NULL, NULL, 'Matsumura Kunihiro Den: Saikyou no Rekishi o Nurikaero! is an Action game, developed by Office Koukan and published by Shouei,  which was released in Japan in 1994.', '/images/snes/5856/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/8/306968_front.jpg', NULL, NULL),
(5857, 'Maui Mallard in Cold Shadow', 'Donald in Maui Mallard', NULL, 'When he morphs into a ninja, you better duck! Play as Maui. Play as the Ninja. Play as Maui. Play as the Ninja. Try not to get dizzy. Find the missing Shabuhm Shabuhm idol before your island paradise goes kaboom kaboom! 40 hours of intense gameplay. So pack plenty of attitude. And your bug gun. Come beak to beak with MudDrakes, Rotting Pirates, Duck Zombies, Amazon Warriors. And a bunch of fowl-tempered hangers-on. Laugh in the face of danger from the top of a volcano, the bottom of the sea, the Realm of the Dead, and Ninja Training Grounds. Then get the heck out! Live every level like it\'s your last - \'cuz it may be!', '/images/snes/5857/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/3/5033_front.jpg', NULL, NULL),
(5858, 'Mazinger Z', NULL, NULL, 'Mazinger Z is an Action game, developed by WinkySoft and published by Bandai,  which was released in Japan in 1993.', '/images/snes/5858/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/0/7/31707_front.jpg', NULL, NULL),
(5859, 'Mecarobot Golf', 'Serizawa Nobuo no Birdie Try', NULL, 'His golf is perfect because he hits the ball with matchless power and at angles calculated using data stored in his highly advanced artificial brain. The engineers whoh created Eagle have an ambition: to participate in a pro golf tournament.', '/images/snes/5859/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/5/50915_front.jpg', NULL, NULL),
(5860, 'MechWarrior', 'BattleTech', NULL, '70 tons of armer, muscle and weaponry stand between you and victory. Impossible odds? No, just another day\'s work for a 31st century MechWarrior pilot in this 3D action adventure.', '/images/snes/5860/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/1/24721_front.jpg', NULL, NULL),
(5861, 'MechWarrior 3050', 'BattleTech 3050', NULL, 'It is the year 3050. The universe is a brutal and violent place. The galaxy is racked by a devastating war waged by massive 75-ton BattleMechs with the most ruinous weapons systems of the 31st century. It\'s up to MechWarriors like you to pilot the MadCat Heavy OmniTech on desperate missions against enemy installations.', '/images/snes/5861/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/be/Mechwarrior3050SNES_boxart.jpg', NULL, NULL),
(5862, 'Mega Man 7', 'Rockman 7: Shukumei no Taiketsu!', NULL, 'Dr. Wily\'s crusade to rule the world ends abruptly at the hands of Mega Man, so what\'s a villain to do? Create a diversion and break out of prison! Mega Man has his hands full as 4 gigantic machines exit Dr. Wily\'s lab to ravage the city, but... who is behind this new plot as Wily sits behind bars?', '/images/snes/5862/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/27/Mega_Man_7_Coverart.jpg', NULL, NULL),
(5863, 'Mega Man Soccer', 'Rockman\'s Soccer', NULL, 'Dr. Wily will stop at nothing to control the world and who would have thought his next move would be to attack the world\'s most popular sport? Dr. Light is ready and he\'s preparing Mega Man for a new type of battle.', '/images/snes/5863/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2a/MMSoccerBox.jpg', NULL, NULL),
(5864, 'Melfand Stories', NULL, NULL, 'Melfand Stories is an Action game, developed by Sting and published by ASCII Entertainment,  which was released in Japan in 1994.', '/images/snes/5864/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/7/306917_front.jpg', NULL, NULL),
(5865, 'Metal Combat: Falcon\'s Revenge', NULL, NULL, 'It has been three years since Michael Anderson defeated Emperor Anubis and his Standing Tank (ST), Thanatos. Now Anubis is back, and his government of ST Chiefs once again have the world in their iron grip.', '/images/snes/5865/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/14/MetalcombatSNES_boxart.jpg', NULL, NULL),
(5866, 'Metal Marines', 'Militia', NULL, 'Clash Of Steel!', '/images/snes/5866/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/8d/Metal_Marines_Coverart.png', NULL, NULL),
(5867, 'Metal Max Returns', NULL, NULL, 'Metal Max Returns is a Role-Playing game, developed by Crea-Tech and published by Data East,  which was released in Japan in 1995.', '/images/snes/5867/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/6/43356_front.jpg', NULL, NULL),
(5868, 'Metal Slader Glory: Director\'s Cut', NULL, NULL, 'Metal Slader Glory: Director\'s Cut is an Adventure game, developed by HAL Labs and published by Nintendo,  which was released in Japan in 2000.', '/images/snes/5868/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/0/309960_front.jpg', NULL, NULL),
(5869, 'Metal Warriors', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5870, 'Michael Andretti\'s Indy Car Challenge', NULL, NULL, 'It just doesn\'t get any faster than this!', '/images/snes/5870/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4f/MichaelAndretti%27sIndyCarChallengeJPBoxShotSNES.jpg', NULL, NULL),
(5871, 'Michael Jordan: Chaos in the Windy City', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5872, 'Mickey Mania: The Timeless Adventures of Mickey Mouse', NULL, NULL, 'Featuring characters created by the legendary Disney Studios, an all action technicolour tale incorporating a myriad of gameplay possibilities that will scroll, rotate and propel you through the magical career of the World\'s most famous cartoon star.', '/images/snes/5872/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Mickey_Mania.jpg', NULL, NULL),
(5873, 'Mickey no Tokyo Disneyland Daibōken', NULL, NULL, 'Mickey no Tokyo Disneyland Daibouken is an Action game, developed by Graphic Research and published by Tomy Corporation,  which was released in Japan in 1994.', '/images/snes/5873/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2c/MickeysTokyoDisneylandDaiboukenJPBoxShotSNES.jpg', NULL, NULL),
(5874, 'Mickey to Donald: Magical Adventure 3', NULL, NULL, 'Mickey to Donald Magical Adventure 3 is an Action game, developed and published by Capcom,  which was released in Japan in 1995.', '/images/snes/5874/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/7/31917_front.jpg', NULL, NULL),
(5875, 'Mickey\'s Ultimate Challenge', NULL, NULL, 'Five Magical Puzzles', '/images/snes/5875/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a9/Mickey%27s_Ultimate_Challenge_cover.jpg', NULL, NULL),
(5876, 'Micro Machines 2: Turbo Tournament', NULL, NULL, '16 crazy characters to choose from!', '/images/snes/5876/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/ff/MicroMachines2Cover.jpg', NULL, NULL),
(5877, 'Might and Magic II: Gates to Another World', 'Might and Magic: Book II', NULL, 'What is happening in the world of Cron? Chaos sweeps across the land, wreaking havoc amongst its peace loving citizens. Respected and powerful community leaders are vanishing mysteriously, Law and Order is quickly being replaced by sword and sorcery, rumours of doom and death abound. Now you must embark on a glorious journey to save the world of Cron and yourself.', '/images/snes/5877/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/dc/Might_and_Magic_II_Coverart.png', NULL, NULL),
(5878, 'Might and Magic III: Isles of Terra', NULL, NULL, 'Emerging from the depths of the nebulous void, there came four lords. To each lord, a dominion: fire; water; air and earth. But each lord lusted for more -- to be the ultimate ruler of the void. The Four Lords of the Elements descended into a hideous conflict that unleashed a raging storm.', '/images/snes/5878/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0c/MM3_Box_Art.jpg', NULL, NULL),
(5879, 'Mighty Morphin Power Rangers', NULL, NULL, 'Don\'t look now, because her Hideousness is back and she\'s meaner and uglier than ever. This time Rita Repulsa is out to pulverize the Power Rangers once and for all and she\'s brought all of her nasty friends along to do the dirty work. But, Jason, Trinl, Billy, Kimberly, and Zack are at their morphing best with the awesome power of the Super NES machine on their side. Incredible graphics, amazing sound, and unbeatable action make this battle of good and evil an instant SNES classic. The game features seven challenging levels of play ending with breathtaking, all-out battles against Rita\'s most fearsome henchmen including Bones, Eye Guy, and many more! Only the power of the Super NES can put all of the characters and excitement of the phenomenal hit TV series right at your fingertips. So what are you waiting for? Morph into action now with the Mighty Morphin Power Rangers.', '/images/snes/5879/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/cc/Mighty_Morphin_Power_Rangers_logo.png', NULL, NULL),
(5880, 'Mighty Morphin Power Rangers: The Fighting Edition', NULL, NULL, 'Get ready to rock your world with the Mighty Morphin Power Rangers Fighting Edition, a three mode, smashing, bashing, monster trashing no-holds barred slugfest. This one-on-one two player simultaneous fighting game features your favorite Power Zords and a host of evil meanies. The Thunder Megazord, the Shogun Megazord, the Ninja Megazord, Lord Zedd, Goldar, and many more compete for total galactic supremacy in the mother of all battles. When the dust clears, only one will remain standing. Who will be crowned the mightiest, morphiest warrior in the universe? Only you can control the ultimate outcome.', '/images/snes/5880/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4f/MM_Power_Rangers_The_Fighting_Edition_SNES_cover.jpg', NULL, NULL),
(5881, 'Milandra', NULL, NULL, 'Milandra is a Role-Playing game, developed by Tomcat System and published by ASCII Entertainment,  which was released in Japan in 1997.', '/images/snes/5881/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/1/31971_front.jpg', NULL, NULL),
(5882, 'Mini Yonku Let\'s and Go!!: Power WGP 2', NULL, NULL, 'Mini-Yonku Let\'s & Go!! Power WGP 2 is a Racing game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 1998.', '/images/snes/5882/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/1/307281_front.jpg', NULL, NULL),
(5883, 'Mini Yonku Shining Scorpion: Let\'s and Go!!', NULL, NULL, 'Mini-Yonku Shining Scorpion: Let\'s & Go!! is a Racing game, developed by Kid and published by ASCII Entertainment,  which was released in Japan in 1996.', '/images/snes/5883/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/0/31970_front.jpg', NULL, NULL),
(5884, 'Miracle Casino Paradise', NULL, NULL, 'Miracle Casino Paradise is a Miscellaneous game, published by Carrozzeria,  which was released in Japan in 1995.', '/images/snes/5884/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/9/307039_front.jpg', NULL, NULL),
(5885, 'Miracle Girls', NULL, NULL, 'Miracle Girls is an Action game, developed by Now Production and published by Takara,  which was released in Japan in 1993.', '/images/snes/5885/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2c/Miracle_Girls_Festival.jpg', NULL, NULL),
(5886, 'Miracle Piano', NULL, NULL, 'The Miracle Piano Teaching System is a Miscellaneous game, developed and published by Software Toolworks,  which was released in 1991.', '/images/snes/5886/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/3/84173_front.jpg', NULL, NULL),
(5887, 'Miyaji Shachou no Pachinko Fan: Shouri Sengen 2', NULL, NULL, 'Miyaji Shachou no Pachinko Fan: Shouri Sengen 2 is a Miscellaneous game, published by Pow,  which was released in Japan in 1995.', '/images/snes/5887/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/7/31847_front.jpg', NULL, NULL),
(5888, 'Mizuki Shigeru no Youkai Hyakkiyakou', NULL, NULL, 'Mizuki Shigeru no Youkai Hyakki Yakou is a Miscellaneous game, published by KSS,  which was released in Japan in 1995.', '/images/snes/5888/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/8/307168_front.jpg', NULL, NULL),
(5889, 'MLBPA Baseball', 'Fighting Baseball', NULL, 'Never before has a baseball game been created that captures the details of the sport like MLBPA Baseball. Realistic run-downs, accurate cut-off plays, the double switch, multiple defensive alignments, snap throws, even bad hops and booted balls. Throw in every player from Alamar to Zeile and you\'ve got the only baseball game worth playing for the Super NES.', '/images/snes/5889/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/1/48541_front.jpg', NULL, NULL),
(5890, 'Mohawk and Headphone Jack', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5891, 'Monopoly 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5892, 'Monstania', NULL, NULL, 'Monstania is a Role-Playing game, developed by Bits Laboratory and published by Pack-In-Video,  which was released in Japan in 1996.', '/images/snes/5892/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/4/42554_front.jpg', NULL, NULL),
(5893, 'Monster Maker III: Hikari no Majutsushi', NULL, NULL, 'Monster Maker III: Hikari no Majutsushi is a Role-Playing game, published by Sofel,  which was released in Japan in 1993.', '/images/snes/5893/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/3/3/303633_front.jpg', NULL, NULL),
(5894, 'Monster Maker Kids: Ousama ni Naritai', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5895, 'Mortal Kombat 3', NULL, NULL, 'Get ready for the fight of your life! 14 Selectable Fighters - including 8 new characters, 2 new bosses and 1 fighter hidden within the game! Watch out for this dude! 32 Megs - the most ever for a Mortal Kombat game! 12 new 3D rendered moving backgrounds to keep you jumping. Secret portals that allow you to smash up and down into different backgrounds for the ultimate bi-level battlefield! More fatalities, animalities and babalities! Intense, live-action, fully-digitized fight sequences for the most realistic action you\'ve ever encountered!\n', '/images/snes/5895/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/2/11182_front.jpg', NULL, NULL),
(5896, 'Mōryō Senki MADARA 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5897, 'Motoko-chan no Wonder Kitchen', NULL, NULL, 'Motoko-chan no Wonder Kitchen is a Miscellaneous game, developed and published by Ajinomoto,  which was released in Japan in 1993.', '/images/snes/5897/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/2/317652_front.jpg', NULL, NULL),
(5898, 'Motteke Oh! Dorobou', NULL, NULL, 'Motteke Oh! Dorobou is a Miscellaneous game, published by Data East,  which was released in Japan in 1995.', '/images/snes/5898/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/9/4/312594_front.jpg', NULL, NULL),
(5899, 'Mountain Bike Rally', 'Cannondale Cup', NULL, 'Pick your player, choose your Cannondale Mountain Bike and you\'re off! Face some of the toughest competitors, boss enemies and obstacles waiting to trip you up. Punch, speed jump and bump through deserts, mountains, cities and back roads as you race your way to victory!', '/images/snes/5899/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c7/Exertainment_Mountain_Bike_Rally_Coverart.png', NULL, NULL),
(5900, 'Mr. Do!', NULL, NULL, 'You need strategy and fast moves to help MR. DO! harvest the fruit from his orchards and avoid getting caught by the evil Badguys or Alphamonster! Throw your Power Ball to knock them out, or drop apples on them. Pick all the cherries or eliminate the Badguys and you can go on to the next orchard, where the Badguys are faster and meaner!', '/images/snes/5900/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3c/Mr_do_arcade.png', NULL, NULL),
(5901, 'Mr. Nutz', NULL, NULL, 'MR. NUTZ - Only he can prevent a new and permanent ice age. To help him on his way he\'s got a lotta Nutz, a lotta gutz, and one enormous tail!', '/images/snes/5901/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/c/c0/Mr._Nutz_SMD_cover.PNG', NULL, NULL),
(5902, 'Mujintou Monogatari', NULL, NULL, 'Mujintou Monogatari is a Strategy game, developed by Open Sesame and published by KSS,  which was released in Japan in 1996.', '/images/snes/5902/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/6/307186_front.jpg', NULL, NULL),
(5903, 'Multi Play Volleyball', NULL, NULL, 'Multi Play Volleyball is a Sports game, developed by Mebio Software and published by Pack-In-Video,  which was released in Japan in 1994.', '/images/snes/5903/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/4/306994_front.jpg', NULL, NULL),
(5904, 'Musya', 'Gōsō Jinrai Densetsu Musya', NULL, 'Plunge into a world of ancient Japanese horror. As Imoto, a spear wielding Samurai, it\'s your duty to descend deep into the Abyss to save the world from the horrors of the Evil One. Fight through hordes of hideous monsters to save Shizuka, the keeper of the Talisman that seals the Evil One in his prison. It\'s up to you to save her. Use your fierce spear spin attack to weave a web of destruction. Call on magical farces to blast your way through the legions leprous beasts.', '/images/snes/5904/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/8/50948_front.jpg', NULL, NULL),
(5905, 'Mystery Circle', NULL, NULL, 'Mystery Circle is a Puzzle game, developed by Wave and published by K Amusement Leasing,  which was released in Japan in 1992.', '/images/snes/5905/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/4/306814_front.jpg', NULL, NULL),
(5906, 'Mystic Ark', NULL, NULL, 'Mystic Ark is a Role-Playing game, developed by Produce and published by Enix Corporation,  which was released in Japan in 1995.', '/images/snes/5906/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8e/Mystic_Ark_SNES_Cover.jpg', NULL, NULL),
(5907, 'Nage Libre: Seijaku no Suishin', NULL, NULL, 'Nage Libre is a Strategy game, published by Varie,  which was released in Japan in 1995.', '/images/snes/5907/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/c/c1/Nage_libre.PNG', NULL, NULL),
(5908, 'Nakajima Satoru F-1 Hero \'94', NULL, NULL, 'Nakajima Satoru Kanshuu: F-1 Hero \'94 is a Racing game, developed and published by Varie,  which was released in Japan in 1994.', '/images/snes/5908/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8a/Nakajima_Satoru_F-1_Hero_94.jpg', NULL, NULL),
(5909, 'Nakano Koichi Kanshuu: Keirin-Ou', NULL, NULL, 'Nakano Kouichi Kanshuu: Keirinou is a Sports game, developed by C-Lab and published by Coconuts Japan,  which was released in Japan in 1994.', '/images/snes/5909/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/9/312529_front.jpg', NULL, NULL),
(5910, 'Naki no Ryū: Mahjong Hishō-den', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5911, 'Namco Open', NULL, NULL, 'Namco Open is a Sports game, developed by TOSE and published by Namco,  which was released in Japan in 1993.', '/images/snes/5911/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/0/306830_front.jpg', NULL, NULL),
(5912, 'Nankoku Shōnen Papuwa-kun', NULL, NULL, 'Nangoku Shounen Papuwa-kun is an Action game, developed by Daft and published by Enix Corporation,  which was released in Japan in 1994.', '/images/snes/5912/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/2/306332_front.jpg', NULL, NULL),
(5913, 'Naruhodo! The World', NULL, NULL, 'Naruhodo! The World is a Miscellaneous game, published by Tomy Corporation,  which was released in Japan in 1994.', '/images/snes/5913/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/8/312618_front.jpg', NULL, NULL),
(5914, 'Natsuki Crisis Battle', NULL, NULL, 'Natsuki Crisis Battle is an Action game, developed by TOSE and published by Angel (Bandai),  which was released in Japan in 1995.', '/images/snes/5914/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/6/9/311669_front.jpg', NULL, NULL),
(5915, 'Natsume Championship Wrestling', NULL, NULL, 'Over 50 different moves. Cobratwist, Backdrop, DDT, Rally Art, Guillotine Drop, Sleeper Hold, Reverse Shrimp Hold, Pyle Driver, Brain Buster, Kitchen Sink, Avalanche Hold, Shoulder Through, Kneedrop, Powerbomb And Much More...', '/images/snes/5915/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/2/50952_front.jpg', NULL, NULL),
(5916, 'NBA All-Star Challenge', NULL, NULL, 'Take it to the hoop basketball fans - with 27 of the biggest stars in the NBA, including the likes of Isiah Thomas, Charles Barkley, Patrick Ewing, Karl Malone and more.', '/images/snes/5916/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/0/1/46501_front.jpg', NULL, NULL),
(5917, 'NBA Give \'n Go', 'NBA Jikkyou Basket: Winning Dunk', NULL, 'No Quarters Required...', '/images/snes/5917/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/9/50949_front.jpg', NULL, NULL),
(5918, 'NBA Hangtime', NULL, NULL, 'HANG ON for the time of your life! Soar through the air and slam one home against the big boys! This game ROCKS with special moves, burnin\' hoops and high flyin\' double dunks! All 29 NBA teams represented with 5-man rosters. Unique features include team fire, alley oops, double dunks and spin moves! Secret codes enable hidden characters, arenas and options. Play against up to four friends or team-up against the computer! Create your own player!', '/images/snes/5918/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/8/8/5488_front.jpg', NULL, NULL),
(5919, 'NBA Jam', NULL, NULL, 'BOOMSHAKALAKA! Jam home the #1 arcade phenomenon! From outrageous Tomahawk jams to wild full-court shots, you control the super moves, amazing blocks and awesome slam dunks of 54 of the NBA\'s hottest stars! Ultra-realistic digitized graphics and play-by-play. 4-player adaptable for true arcade competition. NBA JAM puts you on the court and above the rim!', '/images/snes/5919/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/3/2/11132_front.jpg', NULL, NULL),
(5920, 'NBA Jam Tournament Edition', NULL, NULL, 'NBA JAM Tournament Edition brings you more senses-shattering slam dunking excitement than ever! More than twice as many NBA superstars, more than double the secret characters, Hot Spots, Super Jam Power-Ups, battery back-up and - OH MY - nine all-new rim-rattling slam dunks plus all the original jams! NBA JAM Tournament Edition... it\'s on FIRE!', '/images/snes/5920/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/5/11165_front.jpg', NULL, NULL),
(5921, 'NBA Live 95', NULL, NULL, 'NBA® LIVE \'95 is totally new EA SPORTS brings you the BEST basketball game to date. It combines fast action-packed gameplay with all the strategy and realism of 5-on-5 basketball.', '/images/snes/5921/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7b/Nba-live-95-e14932.jpg', NULL, NULL),
(5922, 'NBA Live 96', NULL, NULL, 'New for NBA Live \'96: New player animations - big blocks, tip-ins, tip-in slams, spin moves, crossover moves, two foot takeoff. New moves - one-on-one, spin dribble and crossover. Two new teams - the Vancouver Grizzlies and Toronto Raptors. Multi-Team Seasons for up to four players. Trade any player, any time. On-the-fly Playcalling, Animating Playbook and Shot Diagram screens for side-line strategies. All-Star game and the Draft for the ultimate NBA season realism.', '/images/snes/5922/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2c/NBA_Live_96_Cover.jpg', NULL, NULL),
(5923, 'NBA Live 97', NULL, NULL, 'NBA Live is where players come to play. Real NBA competition. Real NBA skills and strategy. Real players. Like you. Right? 2-on-2 and 3-on-3 halfcourt games. 3-Point and Shoot Out competitions. 1996-97 updated rosters including rookies and over 300 NBA stars. All 29 NBA teams plus 2 NBA All-Star and 4 custom teams. Complete stats and ratings for all players, plus stat tracking during season play. Exhibition, Playoffs, and full 1996-97 NBA Schedule Season play.', '/images/snes/5923/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ae/NBA_Live_97_Cover.jpg', NULL, NULL),
(5924, 'NBA Live 98', NULL, NULL, 'Experience the NBA lifestyle. Hip graphics and progressive music combine with the most realistic competitive gameplay available. LIVE 98 feeds you the raw POWER of today\'s NBA. Power control, Power moves, and Power gameplay! Real NBA stats, real NBA players, real NBA moves. Players play exactly like their real NBA counterparts!', '/images/snes/5924/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f4/Nba_live_98_front.jpg', NULL, NULL),
(5925, 'NBA Showdown', 'NBA Pro Basketball \'94: Bulls vs Suns', NULL, 'AMERICA\'S ROUGHEST NEIGHBORHOOD', '/images/snes/5925/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/6/50956_front.jpg', NULL, NULL),
(5926, 'NCAA Basketball', NULL, 'Super Dunk Shot', 'Choose your team from five of the top NCAA basketball conferences and lead it through the grueling tournament to a berth in the Final Four and a national championship! Or, challenge a friend to a head-to-head exhibition game.', '/images/snes/5926/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/8/50958_front.jpg', NULL, NULL),
(5927, 'NCAA Final Four Basketball', NULL, NULL, 'HERE\'S YOUR TICKET TO THE BIG DANCE! Lace up your hi-tops and get ready for some serious b-ball action! Practice all your hot court moves with your favorite NCAA team, then use your superstar to lead them through all the games of the NCAA Tournament to the Final Four. Life-like players with unprecedented animation put you in the power seat!', '/images/snes/5927/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/0/47810_front.jpg', NULL, NULL),
(5928, 'Nekketsu Tairiku Burning Heroes', NULL, NULL, 'Nekketsu Tairiku: Burning Heroes is a Role-Playing game, developed by J-Force and published by Enix Corporation,  which was released in Japan in 1995.', '/images/snes/5928/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/5/309495_front.jpg', NULL, NULL),
(5929, 'Neugier: Umi to Kaze no Kodō', NULL, NULL, 'Neugier: Umi to Kaze no Koudou is a Role-Playing game, developed by Wolf Team and published by Telenet Japan,  which was released in Japan in 1993.', '/images/snes/5929/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/34/NeuigerUmitoKazenoKoudouJPBoxShotSNES.jpg', NULL, NULL),
(5930, 'New Yatterman: Nandai Kandai Yajirobee', NULL, NULL, 'New Yatterman: Nanndai Kanndai Yajirobe is an Action game, developed by Tom Create and published by Yutaka,  which was released in Japan in 1996.', '/images/snes/5930/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/0/5/307205_front.jpg', NULL, NULL),
(5931, 'New Mobile Report Gundam Wing: Endless Duel', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5932, 'Newman/Haas IndyCar featuring Nigel Mansell', 'Nigel Mansell Indy Car', NULL, 'For high-performance thrills, speed toward the checkered flag in a turbo-charged, methanol-burning IndyCar You design! Push the limits of your screaming 750-horsepower Newman Haas race car on the world\'s greatest IndyCar tracks! It\'s 16 megs of pure IndyCar intensity!', '/images/snes/5932/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/89/Newman_Haas_Indy_Car_snes.jpg', NULL, NULL),
(5933, 'NFL Quarterback Club', NULL, NULL, 'It\'s a 32x blitz... NFL Quarterback Club upgrades the action with the most authentic gridiron game play and \'94 QB and team attributes! All-new advanced passing gives you 80 yards of viewable field to hit the open man, multi-view perspectives heat up the running game with in-your-face action and the exclusive Smooth-Cam delivers the most advanced instant replay from virtually any angle. NFL Quarterback Club on 32X...', '/images/snes/5933/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/88/NFL_Quarterback_Club_%28video_game%29_title_screen.jpg', NULL, NULL),
(5934, 'NFL Quarterback Club 96', NULL, NULL, 'This is the ultimate in football realism! Control any NFL player on offense or defense. 80 yards of viewable field... send \'em deep! Build your own dream team with the Custom Player feature. Player, game and full season stats... all the way to the Super Bowl. Over 800 plays including authentic QB signature plays. Perfect your gridiron skills in the exclusive Practice Mode.', '/images/snes/5934/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/6/35946_front.jpg', NULL, NULL),
(5935, 'NHL \'94', 'NHL Pro Hockey \'94', NULL, 'Over 25 NEW features in HOCKEY \'94! 4-Way Play Support - Use the EA Sports 4-Way Play and NHL \'94 becomes a 1, 2, 3 or 4 player game! Goalie Control - You control the double pad stacks and kick saves of all the greats. Penalty Shots and Shootout Mode - Take the hottest shooters and go head to head with the greatest goalies in the league. One Timers - New blistering slap shots make offense faster and more challenging. New Expansion Teams - Play with the Mighty Ducks or with the Florida Panthers. Music and Animations - Over 70 new pieces of organ music from arenas around the league. Plus new crowd and player animations!', '/images/snes/5935/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/7/11067_front.jpg', NULL, NULL),
(5936, 'NHL 95', NULL, NULL, 'This is not your ordinary cup! It\'s the Stanley Cup! And only the victors of the grueling NHL season earn the right to have their name engraved on it. That\'s a whole season of blistering slap shots, board checks, hot rookies and mid-season trades. NHL \'95 drops you into the opening face-off staring down the line at 84 relentless games - trying to carve your name on that Cup!', '/images/snes/5936/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e0/NHL95_MegaDrive.jpg', NULL, NULL),
(5937, 'NHL 96', NULL, NULL, 'The Puck Stops Here! Strap on your helmet and cinch up your skates because this is ice hockey, not nice hockey, a fast and furious all-out assault on your senses, where breakaways are met with bone-quaking body checks and the five hole looks more like a buttonhole. Skate faster, stop quicker, line it up and let it fly - this is the ultimate in breakneck, blistering sports action!', '/images/snes/5937/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/ea/NHL_96_Coverart.png', NULL, NULL),
(5938, 'NHL 97', NULL, NULL, 'Head-to-head action so real you can\'t play just one game. You want more checks, more speed, more kick saves, more NHL hockey. It\'s all here. NEW Skills Challange: See how you measure up in the Puck Blast, Rapid Fire, Shooting Accuracy, and Puck Handling Relay. Legendary EA Sports gameplay plus all the players, all the teams, and all 26 home rinks! NEW Signature Moves: 15 moves from NHL stars! Fake the shot, through your legs and around the defenseman.', '/images/snes/5938/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f5/NHL_97_Coverart.png', NULL, NULL),
(5939, 'NHL 98', NULL, NULL, 'The Ultimate Judge', '/images/snes/5939/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/5/5725_front.jpg', NULL, NULL),
(5940, 'NHL Stanley Cup', 'Super Hockey', NULL, 'The Montreal Canadians, LA Kings, Toronto Maple Leafs. Detroit Red Wings. These are just a few of hocker\'s elite teams that hit the ice in a quest for sport\'s most prestigious trophy in NHL Stanley Cup. This is the game as it\'s meant to be played: hard-hitting and lightning fast; bone-jarring yet graceful. NHL Stanley Cup\'s unique, super-realistic, three-dimensional viewpoint on the action puts you in centre ice, always on the puck, always in the play. The Stanley Cup is waiting to be won - do you have the guts to take the glory?', '/images/snes/5940/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/6/50966_front.jpg', NULL, NULL),
(5941, 'NHLPA Hockey \'93', NULL, NULL, 'Skate with all the greats! Over 500 real players have skated into the hot sequel to NHL Hockey. Now you can skate, stick and score with all the greats - Robataille, Chelios, Recchi, and Mullen. Rosters of every professional team including expansion teams Ottawa and Tampa Bay! New Signature Moves - Smack a MacInnis glass breaking slap shot a little high and smash the glass behind the net - Awesome power! Track Player Statistics - Follow how many goals you\'ve scored with your favorite players throughout the playoffs - Jagr, Stevens, Oates, Bure and more!', '/images/snes/5941/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/92/NHLPA_Hockey_%2793_Coverart.png', NULL, NULL),
(5942, 'Nice de Shot', NULL, NULL, 'Nice de Shot is a Sports game, developed by Magical Company (Mahou) and published by ASK,  which was released in Japan in 1994.', '/images/snes/5942/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/9/306929_front.jpg', NULL, NULL),
(5943, 'Nichibutsu Arcade Classics', NULL, NULL, 'Nichibutsu Arcade Classics is a Miscellaneous game, developed by Syscom and published by Nichibutsu,  which was released in Japan in 1995.', '/images/snes/5943/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/8/307088_front.jpg', NULL, NULL),
(5944, 'Nichibutsu Arcade Classics 2: Heiankyo Alien', NULL, NULL, 'OLD VERSION', '/images/snes/5944/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/4/31924_front.jpg', NULL, NULL),
(5945, 'Nichibutsu Collection 1', NULL, NULL, 'Nichibutsu Collection 1 is a Miscellaneous game, published by Nichibutsu,  which was released in Japan in 1996.', '/images/snes/5945/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/7/307247_front.jpg', NULL, NULL),
(5946, 'Nichibutsu Collection 2', NULL, NULL, 'Nichibutsu Collection 2 is a Miscellaneous game, published by Nichibutsu,  which was released in Japan in 1996.', '/images/snes/5946/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/3/307253_front.jpg', NULL, NULL),
(5947, 'Nickelodeon Guts', NULL, NULL, 'It takes more than skill to slam-dunk on a 12-foot hoop...to tear through Tornado Run...or to conquer the awesome Aggro Crag. It takes GUTS.', '/images/snes/5947/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/0/50970_front.jpg', NULL, NULL),
(5948, 'Ninja Gaiden Trilogy', 'Ninja Ryuukenden Tomoe', NULL, 'Here it is! The complete NINJA GAIDEN TRILOGY you asked for. Enjoy the 3 classic Nintendo Ninja Gaiden games on one Super NES Game Pak.', '/images/snes/5948/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/9/50969_front.jpg', NULL, NULL),
(5949, 'Ninja Warriors', NULL, 'The Ninja Warriors Again', 'Three androids, programmed with all the ancient skills of Ninja Warriors, are sent forth, untried, to defeat an army and bring down the tyrant, Banglar. They will attack their foes with fist, sword, knives, curving steel blades, and their own powerful bodies. They have no human emotions to weaken them, and only one mission - to destroy all enemies!', '/images/snes/5949/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/2/50972_front.jpg', NULL, NULL),
(5950, 'Nintama Rantarō', NULL, NULL, 'BS Nintama Rantarou 2 is an Action game, developed by Culture Brain and published by NHK,  which was released in Japan in 1998.', '/images/snes/5950/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/02/Rakudai_Ninja_Rantar%C5%8D.jpg', NULL, NULL),
(5951, 'Nintama Rantarō: Ninjutsu Gakuen Puzzle Taikai no Dan', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5952, 'Nintama Rantarō 2', NULL, NULL, 'BS Nintama Rantarou 2 is an Action game, developed by Culture Brain and published by NHK,  which was released in Japan in 1998.', '/images/snes/5952/cover.png', 'https://gamefaqs.akamaized.net/images/platform-100/snes.png', NULL, NULL),
(5953, 'Nintama Rantarō 3', NULL, NULL, 'Nintama Rantarou 3 is an Action game, published by Culture Brain,  which was released in Japan in 1997.', '/images/snes/5953/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/6/307256_front.jpg', NULL, NULL),
(5954, 'Nishijin Pachinko Monogatari', NULL, NULL, 'Nishijin Pachinko Monogatari is a Miscellaneous game, published by KSS,  which was released in Japan in 1995.', '/images/snes/5954/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/9/3/307093_front.jpg', NULL, NULL),
(5955, 'Nishijin Pachinko Monogatari 2', NULL, NULL, 'Nishijin Pachinko Monogatari 2 is a Miscellaneous game, developed by Soft Machine and published by KSS,  which was released in Japan in 1996.', '/images/snes/5955/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/2/307222_front.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(5956, 'Nishijin Pachinko Monogatari 3', NULL, NULL, 'Nishijin Pachinko Monogatari is a Miscellaneous game, published by KSS,  which was released in Japan in 1995.', '/images/snes/5956/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/9/3/307093_front.jpg', NULL, NULL),
(5957, 'No Escape', NULL, NULL, 'Based on the Hollywood action-thriller, NO ESCAPE  puts you in the shoes of Robbins, an inmate on the island penal colony of Absollom. Free to travel anywhere on the island - except off! - you\'ll come  face-to-face with ultra-realistic characters rotoscoped from real actors and confront countless deadly traps. You\'ll be forced to fight or outsmart gangs of savage Outsiders. Only the Insider\'s Camp gives you a place to rest, exchange information and trade items necessary for your escape. A detailed warden\'s overhead map lets the player choose which part of the island to explore next. If you gather together the right pieces as you proceed, you\'ll ultimately confront a final choice... to boldly break free in the prison helicopter or slip quietly away in a specially designed stealth boat. Unlike in the movie, the ending to this story is up to you.', '/images/snes/5957/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/9/8/9598_front.jpg', NULL, NULL),
(5958, 'Nobunaga Kouki', NULL, NULL, 'Nobunaga Kouki is a Strategy game, published by Yanoman,  which was released in Japan in 1993.', '/images/snes/5958/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/9/306829_front.jpg', NULL, NULL),
(5959, 'Nobunaga no Yabou: Haouden', NULL, NULL, 'Nobunaga no Yabou: Haouden is a Strategy game, published by Koei,  which was released in Japan in 1993.', '/images/snes/5959/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/0/296740_front.jpg', NULL, NULL),
(5964, 'Nobunaga\'s Ambition: Lord of Darkness', 'Nobunaga no Yabō: Bushō Fūunroku', NULL, 'Lord Nobunaga is out to take control of Japan and along the way he plans on making lots of trouble for those around him.', '/images/snes/5964/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/37/Castlevania_Legacy_of_Darkness.jpg', NULL, NULL),
(5965, 'Nomark Baku Haitou: Shijou Saikyou no Jakushi Tatsu', NULL, NULL, 'Nomark Baku Haitou: Shijou Saikyou no Jakushi Tatsu is a Miscellaneous game, published by Angel (Bandai),  which was released in Japan in 1995.', '/images/snes/5965/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/3/9/307139_front.jpg', NULL, NULL),
(5966, 'Nolan Ryan\'s Baseball', 'Super Stadium', NULL, NULL, NULL, NULL, NULL, NULL),
(5967, 'Nontan to Issho: Kurukuru Puzzle', NULL, NULL, 'Nontan to Issho: Kuru Kuru Puzzle is a Puzzle game, developed by Game Freak and published by Victor Interactive Software,  which was released in Japan in 1994.', '/images/snes/5967/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/8/307008_front.jpg', NULL, NULL),
(5968, 'Nosferatu', NULL, NULL, 'It\'s a race of time. Kyle must save his fair maiden Erin before the evil clutches of Nosferatu can sway her fate forever! Dungeons and graveyards are only a few obsticles in his path, littered with traps and beasts of unspeakable nature. Join Kyle\'s journey into darkness to return his love before her soul is lost for eternity!', '/images/snes/5968/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/92/Nosferatuposter.jpg', NULL, NULL),
(5969, 'NTT JRA PAT', NULL, NULL, 'JRA PAT is a Sports game, developed and published by NTT,  which was released in Japan in 1996.', '/images/snes/5969/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/8/106778_front.jpg', NULL, NULL),
(5970, 'NTT JRA PAT: Wide Baken Taiyou', NULL, NULL, 'JRA PAT: Wide Baken Taiyou is a Sports game, developed and published by NTT,  which was released in Japan in 1999.', '/images/snes/5970/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/9/106779_front.jpg', NULL, NULL),
(5971, 'Numbers Paradise', NULL, NULL, 'Numbers Paradise is a Miscellaneous game, developed by ISCO and published by Acclaim Japan,  which was released in Japan in 1996.', '/images/snes/5971/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/9/307239_front.jpg', NULL, NULL),
(5972, 'Obitus', NULL, NULL, 'Adventure in a Land of Ruin.', '/images/snes/5972/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c2/Obitus_Cover.jpg', NULL, NULL),
(5973, 'Ochan no Oekaki Logic', NULL, NULL, 'Ochan no Oekaki Logic is a Puzzle game, developed by Game Studio and published by SunSoft,  which was released in Japan in 1995.', '/images/snes/5973/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/0/295560_front.jpg', NULL, NULL),
(5974, 'Oda Nobunaga: Haou no Gundan', NULL, NULL, 'Oda Nobunaga: Haou no Gundan is a Strategy game, developed by TOSE and published by Angel (Bandai),  which was released in Japan in 1993.', '/images/snes/5974/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/3/3/306833_front.jpg', NULL, NULL),
(5975, 'Oekaki Logic 2', NULL, NULL, 'Oekaki Logic 2 is a Puzzle game, published by Sekaibunka Publishing, Inc.,  which was released in Japan in 1999.', '/images/snes/5975/cover.png', 'https://gamefaqs.akamaized.net/images/platform-100/snes.png', NULL, NULL),
(5976, 'Ogre Battle: The March of the Black Queen', 'Densetsu no Ogre Battle', NULL, 'It\'s been nearly a quarter of a century since the Zetegenian Empire first conqured the Kingdoms of Zenobia with a wrath of fear and bloodshed. You are the leader of a band of rebels who have fought to preserve the last shred of honor in this desperate time of treachery. This sets the somber scene for Ogre Battle, the first in the superb line of fantasy, roleplaying and simulation sagas from Enix. Manage the ranks of a full-blown rebel army complete with hundreds of characters, magic items, weapons, and mystical Tarot cards. You must succeed in ousting the evil usurpers, as your fate, and that of the entire population, depends on it!', '/images/snes/5976/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/1/50981_front.jpg', NULL, NULL),
(5977, 'Olympic Summer Games', NULL, NULL, 'Prepare Yourself For Competition!', '/images/snes/5977/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/6/46546_front.jpg', NULL, NULL),
(5978, 'Okamoto Ayako to Match Play Golf', NULL, NULL, 'Okamoto Ayako to Match Play Golf is a Sports game, developed by C.P. Brain and published by Tsukuda Original,  which was released in Japan in 1994.', '/images/snes/5978/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/3/307023_front.jpg', NULL, NULL),
(5979, 'Olivia\'s Mystery', NULL, NULL, 'Olivia\'s Mystery is a Puzzle game, published by Altron,  which was released in Japan in 1994.', '/images/snes/5979/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/9/306899_front.jpg', NULL, NULL),
(5980, 'On the Ball', 'Cameltry', NULL, 'Time to Rock and Roll!', '/images/snes/5980/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/8/50988_front.jpg', NULL, NULL),
(5981, 'Ongaku Tsukūru: Kanadeeru', NULL, NULL, 'Ongaku Tsukuru: Kanadeeru is a Miscellaneous game, developed by Success and published by ASCII Entertainment,  which was released in Japan in 1996.', '/images/snes/5981/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/3/307213_front.jpg', NULL, NULL),
(5982, 'Onita Atsushi FMW', NULL, NULL, 'Onita Atsushi: FMW is an Action game, developed by Marionette and published by Pony Canyon,  which was released in Japan in 1993.', '/images/snes/5982/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/0/43380_front.jpg', NULL, NULL),
(5983, 'Onizuka Katsuya Super Virtual Boxing', NULL, NULL, 'Onizuka Katsuya Super Virtual Boxing is a Sports game, developed by Sting and published by Sofel,  which was released in Japan in 1993.', '/images/snes/5983/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/5/306875_front.jpg', NULL, NULL),
(5984, 'Operation Europe: Path to Victory', 'Europa Sensen', NULL, 'The World\'s About To Change!', '/images/snes/5984/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/Operation_Europe_cover.jpg', NULL, NULL),
(5985, 'Operation Logic Bomb', 'Ikari no Yousai', NULL, 'The best scientists in the world have been working for years on the Subspace Particle Transfer Project, a process that uses subspace transporters to dematerialize an object, then instantly rematerializes it at another location. Short distance transfers of individuals have also been successful, and the scientists were about to begin long-range transport experiments.', '/images/snes/5985/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/32/Operation_Logic_Bomb_Coverart.png', NULL, NULL),
(5986, 'Operation Thunderbolt', NULL, NULL, 'Bringing you enhanced shoot-\'em-up action for one or two players, THUNDERBOLT not only reproduces the horizontally-scrolling gameplay of WOLF, but adds 3D action to the scenario as you test your nerve against swooping jets, helicopters, tanks and many more awesome adversaries! Use the laser sight or the bulletproof vest, but watch out for those air-to-ground missiles!', '/images/snes/5986/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/3/29403_front.jpg', NULL, NULL),
(5987, 'Oraga Land Shusai: Best Farmer Shuukaku-Sai', NULL, NULL, 'Oraga Land Shusai: Best Farmer Shuukaku-Sai is an Action game, developed by Graphic Research and published by Vic Tokai,  which was released in Japan in 1995.', '/images/snes/5987/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/0/312550_front.jpg', NULL, NULL),
(5988, 'Oscar', NULL, NULL, 'Lights! Camera! Action! It\'s time to meet Oscar, the newest legend of the silver screen, ready to take Tinseltown by storm... once he\'s used his star-power to escape the theater he\'s trapped in, that is!', '/images/snes/5988/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/4/50994_front.jpg', NULL, NULL),
(5989, 'Ossu!! Karatebu', NULL, NULL, 'Osu!! Karatebu is an Action game, developed and published by Culture Brain,  which was released in Japan in 1994.', '/images/snes/5989/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/7/306967_front.jpg', NULL, NULL),
(5990, 'Othello World', NULL, NULL, 'Othello World is a Miscellaneous game, developed by Dice and published by Tsukuda Original,  which was released in Japan in 1992.', '/images/snes/5990/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/4/31654_front.jpg', NULL, NULL),
(5991, 'Otoboke Ninja Colosseum', NULL, NULL, 'Otoboke Ninja Colosseum is a Puzzle game, developed by Mint and published by Intec,  which was released in Japan in 1995.', '/images/snes/5991/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/38/Otobokeninjasfc.jpg', NULL, NULL),
(5992, 'Otogirisou', NULL, NULL, 'Otogirisou is an Adventure game, developed and published by ChunSoft,  which was released in Japan in 1992.', '/images/snes/5992/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/70/Otogiris%C5%8D.jpg', NULL, NULL),
(5993, 'Out of This World', NULL, 'Outer World', 'You\'ll think you\'re actually on a movie set when you star in the cinematic action/adventure Out Of This World™.', '/images/snes/5993/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/4/4d/Outofthiswolrd.JPG', NULL, NULL),
(5994, 'Out to Lunch', NULL, NULL, 'Enter a wacky world where the elements of international cuisine form a recipe for disaster! The ingredients you need to make delectable concoctions have run amok... you have to chase them down and bag \'em before they make mincemeat out of you! Each of the multiple levels is set in an exotic locale, where you\'ll find a special ingredient needed to make each dish complete.', '/images/snes/5994/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a8/Out_to_Lunch_Coverart.png', NULL, NULL),
(5995, 'Ōzumō Spirit', NULL, NULL, NULL, '/images/snes/5995/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ea/Oozumoutamashiisfc.jpg', NULL, NULL),
(5996, 'P.T.O.: Pacific Theater of Operations', 'Teitoku no Ketsudan', NULL, 'Relive the entire Pacific campaign of WWII. You have the incredible opportunity to command either the Allied or Japanese forces. Challenge history and change the outcome of the great sea and air battles of the day, such as Pearl Harbor, the Battle at Midway and Okinawa!', '/images/snes/5996/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/8/47868_front.jpg', NULL, NULL),
(5997, 'Pac-Attack', NULL, NULL, 'Pac-Man makes a rare appearance outside of a maze environment in Pac-Attack, a fun and quirky puzzle game. This unique entry in the genre puts its own twist on established conventions and adds one of gaming\'s most iconic characters to the mix. The goal is simple: Keep your screen clear of falling blocks and ghosts by lining up blocks horizontally, causing them to disappear.', '/images/snes/5997/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/27/Pac-Attack_Coverart.png', NULL, NULL),
(5998, 'Pac-In-Time', NULL, NULL, 'The evil Ghost Witch has cast a vicious spell on Pac-Man and thrown him back in time to when he was a Pac-Boy. Only you can save him now. Down some Pac-Pellets and get ready to battle your way through a totally supersonic side-scrolling adventure. Journey through snowy mountains and forests, collect fireballs and bubbles, crunch Pac-Bats and ghosts, swim like a fish and swing like a monkey... and ultimately get Pac-Man back to the real world!', '/images/snes/5998/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/72/Pac-In-Time_Coverart.png', NULL, NULL),
(5999, 'Pac-Man 2: The New Adventures', 'Hello! Pac-Man', NULL, 'Enter an original animated adventure--with the world\'s first video game hero! But the star of your cartoon has a mind of his own, and it\'s going to take all your skills and patience to carefully guide Pac-man through this hilarious, action-packed cartoon adventure.', '/images/snes/5999/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Pac-Man_2_-_The_New_Adventures_Coverart.png', NULL, NULL),
(6000, 'Pachi-Slot Kanzen Kouryaku: Universal Shindai Nyuuka Volume 1', NULL, NULL, 'Pachi-Slot Kanzen Kouryaku is a Miscellaneous game, published by Syscom,  which was released in Japan in 1997.', '/images/snes/6000/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/7/307257_front.jpg', NULL, NULL),
(6001, 'Pachi-Slot Kenkyuu', NULL, NULL, 'Pachi-Slot Kenkyuu is a Miscellaneous game, published by Magical Company (Mahou),  which was released in Japan in 1994.', '/images/snes/6001/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/3/306943_front.jpg', NULL, NULL),
