(6015, 'Pachiokun Special', NULL, NULL, 'Pachiokun Special is a Miscellaneous game, developed by Marionette and published by Coconuts Japan,  which was released in Japan in 1992.', '/images/snes/6015/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/6/306816_front.jpg', NULL, NULL),
(6016, 'Pachiokun Special 2', NULL, NULL, 'Pachiokun Special 2 is a Miscellaneous game, developed by Marionette and published by Coconuts Japan,  which was released in Japan in 1994.', '/images/snes/6016/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/3/0/306930_front.jpg', NULL, NULL),
(6017, 'Pachiokun Special 3', NULL, NULL, 'Pachiokun Special 3 is a Miscellaneous game, developed by Marionette and published by Coconuts Japan,  which was released in Japan in 1995.', '/images/snes/6017/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/7/307157_front.jpg', NULL, NULL),
(6018, 'Packy and Marlon', NULL, NULL, 'Oh no! Packy and Marlon, two pachyderm pals with diabetes, are in heavy trouble. Summer camp has been raided by rats! The pesky critters have stolen food and critical diabetes supplies. Can Packy and Marlon find the food and supplies? To do it, they have to blast vicious varmints with peanuts and water. They have to remember to eat healthy stuff, check blood glucose levels, and take insulin!', '/images/snes/6018/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ae/Packy_and_Marlon_cover.jpg', NULL, NULL),
(6019, 'Paladin\'s Quest', 'Lennus: Kodai Kikai no Kioku', NULL, 'In the small town of Reiyold, a great magic potential was found within the mind of a small child named Chenzi. With much joy and some sadness, Chenzi\'s mother sent him to attend the Magic School. Having a natural talent for magic, Chenzi quickly became one of the school\'s top students. However, he will soon learn that having a "special gift" may sometimes do more harm than good. Unknowingly, Chenzi embarks on a dare that will bring about the demise of all life as he knows it.', '/images/snes/6019/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a3/Paladin%27s_Quest_box_art.jpg', NULL, NULL),
(6020, 'Panic in Nakayoshi World', NULL, NULL, 'Panic in Nakayoshi World is a Puzzle game, developed by Tom Create and published by Bandai,  which was released in Japan in 1994.', '/images/snes/6020/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/0/31810_front.jpg', NULL, NULL),
(6021, 'Parlor! Mini: Pachinko Jikki Simulation Game', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6023, 'Parodius: Non-Sense Fantasy', 'Parodiusu Da! Shinwa kara Owarai', NULL, NULL, NULL, NULL, NULL, NULL),
(6024, 'The Peace Keepers', 'Rushing Beat Syura', NULL, 'After years of worldwide war, a single corporation rises to power and promises an age of prosperity, enforced by its army of robots, The PeaceKeepers.', '/images/snes/6024/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/3/51003_front.jpg', NULL, NULL),
(6025, 'Pebble Beach no Hatou New: Tournament Edition', NULL, NULL, 'Pebble Beach no Hatou New: Tournament Edition is a Sports game, developed and published by T&E Soft,  which was released in Japan in 1996.', '/images/snes/6025/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ec/Box_art_Virtual_Pool_Tournament_Edition.jpg', NULL, NULL),
(6026, 'PGA European Tour', NULL, NULL, 'Five great PGA European Tour courses to play on with 90 new challenging holes. Featuring 60 PGA European Tour pros, five different gameplay formats, new changing weather conditions, and new Match Play!', '/images/snes/6026/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/7/51007_front.jpg', NULL, NULL),
(6027, 'PGA Tour 96', NULL, NULL, 'Here is your chance to experience the fairways and greens you\'ve always dreamed of. Walk the 18th on the TPC at Sawgrass with the best on the PGA TOUR, then pass the field by as you march on to win it all!', '/images/snes/6027/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/89/Pgatourgolf96_MD_cover.jpg', NULL, NULL),
(6028, 'Phalanx', 'Phalanx: The Enforce Fighter A-144', NULL, 'Get fired up! This is the fastest phaser-fight in the galaxy! Put your finger on the trigger! We\'re about to blast you into the next dimension of special effects - in the fastest star - fighter ever created. You\'re flying into the zone of fire. Through the deadly bio-cave. Down to the very core of the planet. Firing your missiles a mile a minute at thousands of beastly bio-weapons that are trying to eat you alive. We\'re talking certain doom - in 3D! And no matter how many big buggers attack you, the action never slows down. So buckle up, and blast off!', '/images/snes/6028/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/5/5/15455_front.jpg', NULL, NULL),
(6029, 'Phantom 2040', NULL, NULL, 'You are the Phantom, searching for the evil Rebecca Madison in the vast city of Metropia. As head of Maximum, Inc., she will stop at nothing to fulfil her twisted plans to control the world... unless you can overpower her.', '/images/snes/6029/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Phantom_2040_game_cover.jpg', NULL, NULL),
(6030, 'Picross NP Vol. 1', NULL, NULL, 'Picross NP Vol. 1 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 1999.', NULL, 'https://gamefaqs.akamaized.net/box/8/9/6/39896_front.jpg', NULL, NULL),
(6031, 'Picross NP Vol. 2', NULL, NULL, 'Picross NP Vol. 2 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 1999.', NULL, 'https://gamefaqs.akamaized.net/box/8/9/5/39895_front.jpg', NULL, NULL),
(6032, 'Picross NP Vol. 3', NULL, NULL, 'Picross NP Vol. 3 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 1999.', NULL, 'https://gamefaqs.akamaized.net/box/8/9/4/39894_front.jpg', NULL, NULL),
(6033, 'Picross NP Vol. 4', NULL, NULL, 'Picross NP Vol. 4 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 1999.', NULL, 'https://gamefaqs.akamaized.net/box/8/9/9/39899_front.jpg', NULL, NULL),
(6034, 'Picross NP Vol. 5', NULL, NULL, 'Picross NP Vol. 5 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 1999.', NULL, 'https://gamefaqs.akamaized.net/box/8/9/8/39898_front.jpg', NULL, NULL),
(6035, 'Picross NP Vol. 6', NULL, NULL, 'Picross NP Vol. 6 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 2000.', NULL, 'https://gamefaqs.akamaized.net/box/8/9/7/39897_front.jpg', NULL, NULL),
(6036, 'Picross NP Vol. 7', NULL, NULL, 'Picross NP Vol. 7 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 2000.', NULL, 'https://gamefaqs.akamaized.net/box/9/0/0/39900_front.jpg', NULL, NULL),
(6037, 'Picross NP Vol. 8', NULL, NULL, 'Picross NP Vol. 8 is a Puzzle game, developed by Jupiter Multimedia and published by Nintendo,  which was released in Japan in 2000.', NULL, 'https://gamefaqs.akamaized.net/box/2/0/6/41206_front.jpg', NULL, NULL),
(6038, 'Pieces', 'Jigsaw Party', NULL, 'If you\'re looking for a fun, family-style puzzle game that provides hours of brain-teasing action, then Pieces will thrill you to pieces! Both children and adults will find puzzles with the perfect level of difficulty. You can go it alone, or get up to five competitors to take a piece of the action on the puzzling playing field. Don\'t fall to pieces if you can\'t find a solution--there are plenty of helpful tricks and items to help along the way!', '/images/snes/6038/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/1/0/51010_front.jpg', NULL, NULL),
(6039, 'Pikiinya!', NULL, NULL, NULL, '/images/snes/6039/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/63/Pikiinyasfc.jpg', NULL, NULL),
(6040, 'Pilotwings', NULL, NULL, 'Are you ready to earn your wings at the most exclusive flight school in the world? Then report immediately to the secret Pilotwings Flight Club, where your training begins! You\'ll see the ground twist beneath you as you jump from your plane and attempt a precision skydive (don\'t forget to pull your rip cord!). You\'ll relive the early days of flying as you bring your biplane in for a pin-point landing. After you master the basics, you\'ll be called on to test an experimental rocket pack, soar in a hang glider, and pilot an advanced attack helicopter in a hazardous rescure mission.', '/images/snes/6040/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2b/Pilotwings_Box.jpg', NULL, NULL),
(6041, 'Pinball Dreams', 'Pinball Pinball', NULL, 'BUMPER TO BUMPER ACTION.', '/images/snes/6041/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Pinball_Dreams.jpg', NULL, NULL),
(6042, 'Pinball Fantasies', NULL, NULL, 'Pinball Fantasies is the official port of the classic Amiga pinball simulator originally released in 1992.', '/images/snes/6042/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6c/Pinball_Fantasies.jpg', NULL, NULL),
(6043, 'Pink Goes to Hollywood', 'Pink Panther', NULL, 'Pink Panther, MGM\'s too-cool cat, hits Hollywood to audition for his next big movie role. But Pink\'s big break may be foiled by Inspector Clouseau! Pink wreaks havoc on acres of pantherized movie sets, like Polterpink, Pinkenstein and Jungle Pink. With props like stoplights and jackhammers, Pink\'s bag of tricks is never empty!', '/images/snes/6043/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/3/21493_front.jpg', NULL, NULL),
(6044, 'Pirates of Dark Water', NULL, NULL, 'Set sail for a swashbuckling search! The Pirates of Dark Water puts you in the middle of the popular Saturday morning cartoon! Sail from island to island as one of three warrior heroes. Become Ren, the young heir to the throne and leader of the quest. Or choose Tula, the spirited heroine whose skills are as dazzling as her beauty. Or Ioz, the fortune hunting ex-pirate who\'s ready for action! The action will be fast and furious, so cast off! And let the hunt begin!', '/images/snes/6044/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/7/47927_front.jpg', NULL, NULL),
(6045, 'Pitfall: The Mayan Adventure', 'Pitfall: Maya no Daibouken', NULL, 'A vast labyrinth of interconnected levels guards the fabulous secrets of the Mayans. Hollywood-produced sound effects and revolutionary animation technology create an intense journey of excitement and discovery. Dare you take it?', '/images/snes/6045/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7e/Pitfall_The_Mayan_Adventure-cover.jpg', NULL, NULL),
(6046, 'Plok', NULL, NULL, '"Hey, you! Over here! It\'s me, Plok! Waddya mean, you don\'t know who I am? Here on the island of Akrillic, in the magic archipelago of Poly-Esta, my flags are all over the place. Here, they call me Top Banana, Head Honcho, Numero Uno, Big Cheese -- you know, King!', '/images/snes/6046/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/4/51024_front.jpg', NULL, NULL),
(6047, 'Pocky and Rocky', 'KiKi KaiKai: Nazo no Kuro Mantle', NULL, 'Pocky was enjoying a quiet cup of tea in her shrine, when Rocky the Raccoon, a Nopino goblin came running to Pocky. "Something terrible has happened. My fellow Nopino goblins have lost their minds. When I woke up, they were very agitated. When I tried to calm them, they came after me."', '/images/snes/6047/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/58/Pocky_%26_Rocky_box.jpg', NULL, NULL),
(6048, 'Pocky and Rocky 2', 'KiKi KaiKai: Tsukiyozoushi', NULL, 'Princess Luna was visiting from the moon for the joyous harvest day celebration. All the villagers were gathered around the festival square, eating, dancing and having a wonderful time. Meanwhile, far away on Demon Island, Dynagon was plotting his revenge. After the beautiful Princess Luna refused to marry him, Dynagon went into a frenzy.', '/images/snes/6048/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/ba/Pocky_and_Rocky_2_cover.jpg', NULL, NULL),
(6049, 'Poko-Nyan! Henpokorin Adventure', NULL, NULL, 'Pokonyan! Henpokorin Adventure is an Action game, published by Toho,  which was released in Japan in 1994.', '/images/snes/6049/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/5/307025_front.jpg', NULL, NULL),
(6050, 'Pop\'n TwinBee', NULL, NULL, 'One sunny day on Donguri Island, Twinbee & Winbee are buzzing about on patrol when suddenly they receive a message. It is Madoka from Dandelion Town calling for help. She is being chased and threatened by soldiers from the evil Donguri Army, who have been sent by her grandfather, Professor Mardock. The mad Professor had an accident (he banged his head on a pole) which changed him into an evil scientist, planning to take control of the world.', '/images/snes/6050/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d9/Popn_TwinBee_%28cover%29.jpg', NULL, NULL),
(6051, 'Pop\'n TwinBee: Rainbow Bell Adventures', NULL, NULL, 'Far across the universe, seven coloured bells, known as the \'Rainbow Bells\', shine in the night sky. As long as they continue to ring, peace will prevail in the universe. One day, the evil scientist Dr. Warmon steals the seven bells and divides them up among his foot soldiers. And to keep himself company Warmon kidnaps Princess Melora. Without their sacred bells and their precious Princess the people lose all hope for the future. When the good Dr. Shinamon realises what\'s happened he summons Twinbee, Winbee and Gwinbee to recover the sever \'Rainbow Bells\' and to rescue Melora.', '/images/snes/6051/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/5/8/20558_front.jpg', NULL, NULL),
(6052, 'Popeye: Ijiwaru Majo Sea Hag no Maki', NULL, NULL, 'Popeye: Ijiwaru Majo Sea Hag no Maki is a Miscellaneous game, developed and published by Technos,  which was released in Japan in 1994.', '/images/snes/6052/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/6/6f/Popeye_SFC_Cover.PNG', NULL, NULL),
(6053, 'Popful Mail', NULL, NULL, 'Kazyr, Necros, Ulgar. Ghosts from the past that nearly once destroyed Popful Mail\'s world. Now, the Black Seal is about to be broken so they can return to wreak havoc on the world once again. Three ragtag adventurers become the only hope of stopping the second coming of Evil. Play as Mail, tomboy bounty-hunter wannabe who\'s handy with a blade, Tatt, the ultra-polite apprentice magician with a deadly staff, or Gaw, a winged blue blob with breath of fire, as you search for the manicial Muttonhead, who holds all the answers. During your quest, change characters at any time! You\'ll need to, because Nuts Cracker and the minions of Evil will stop at nothing to end your party before it starts! And, thanks to the storage power of CD, Popful Mail comes alive with over 2.5 hours of spoken dialogue and 20 minutes of heart-pounding animation. Face it, your butt\'s gonna be glued to the couch till the credits roll!', '/images/snes/6053/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b0/PopfulMailBox.jpg', NULL, NULL),
(6054, 'Populous II: Trials of the Olympian Gods', NULL, NULL, 'The gods are back, and all Hell is about to break loose! As the offspring of almighty Zeus, you demand a seat among the gods. But before ascending Mt. Olympus, you must defeat 32 of Zeus\' most powerful deities. Learn to shatter the sky with lightning and shower the earth with fire. Summon heroes to aid your people and plagues to destroy the enemy. Call forth tornadoes, hurricanes, tidal waves and columns of flame. A challenging task for a god... a monumental task for a mortal!', '/images/snes/6054/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/bf/Populous_II_Trials_of_the_Olympian_Gods_Cover.jpg', NULL, NULL),
(6055, 'Porky Pig\'s Haunted Holiday', NULL, NULL, 'Porky\'s going on a dream vacation to Dry Gulch Creek Haunted Theme Park. But as he sleeps, the holiday of his dreams turns into a real nightmare...', '/images/snes/6055/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/4/51034_front.jpg', NULL, NULL),
(6056, 'Power Instinct', 'Gouketsuji Ichizoku', NULL, 'This Family Feud Is To The Death!', '/images/snes/6056/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/dc/Power_Instinct_Logo.png', NULL, NULL),
(6057, 'Power Lode Runner', NULL, NULL, 'Power Lode Runner is a Puzzle game, developed by Atelier Double and published by Nintendo,  which was released in Japan in 1999.', '/images/snes/6057/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/35/Lode_Runner_Coverart.png', NULL, NULL),
(6058, 'Power Moves', 'Power Athlete', NULL, 'This exciting action adventure game recreates the fury and explosiveness of international boxing. You take no prisoners. It\'s afight for life and the championship in an eight series match. Set against international backdrops, you\'re pitted against eight of the most powerful Masters of the Martial Arts. Each master fights with their own special weapons and fighting techniques. You must kick, punch and jump to victory. The action is powerful. Make the right move and you advance to the next match. Make the wrong move and you move over. This exciting video battle features three dimensional screens, high quality graphics, special sound and video effects and challenging game play. Enemy masters can be designed for special attacking action. The weather and seasons change during the course of the game for more challenging game action. Make your move now! We challenge you to the fight of your life!', '/images/snes/6058/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/4/42744_front.jpg', NULL, NULL),
(6059, 'Power of the Hired', NULL, NULL, 'Power of the Hired is a Strategy game, developed and published by NCS,  which was released in Japan in 1994.', '/images/snes/6059/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/8/307028_front.jpg', NULL, NULL),
(6060, 'Power Piggs of the Dark Age', NULL, NULL, 'Ready to pig-out on action-packed adventure? Hungry for a dozen magic donuts? Then Power Piggs of the Dark Age is the game for you!', '/images/snes/6060/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/03/Power_Piggs_of_the_Dark_Age_Coverart.png', NULL, NULL),
(6061, 'Power Rangers Zeo: Battle Racers', NULL, NULL, 'Fasten Your Seat Belts And Strap On Your Crash Helmets!', '/images/snes/6061/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/8/51038_front.jpg', NULL, NULL),
(6062, 'Power Soukoban', NULL, NULL, 'Power Soukoban is a Puzzle game, developed by Atelier Double and published by Nintendo,  which was released in Japan in 1999.', '/images/snes/6062/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/4/307284_front.jpg', NULL, NULL),
(6063, 'Powermonger', 'Powermonger: Mashou no Bouryaku', NULL, NULL, '/images/snes/6063/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e7/Powermonger_cover.png', NULL, NULL),
(6064, 'Prehistorik Man', 'P-Man', NULL, 'In a small prehistoric village, disaster has struck! The winter food store has been eaten by greedy dinosaurs and the villagers are facing starvation! The Village Chief has chosen Sam to save mankind by leading a quest to find the legendary Dinosaur Graveyard. Sam must cross many unfamed prehistorik lands and bring back enough valuable bones to buy all the food the villagers need to survive the winter.', '/images/snes/6064/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/43/North_American_box_art.jpg', NULL, NULL),
(6065, 'Primal Rage', NULL, NULL, 'Select one of 7 ferocious dinosaurs then pound your opponents into submission as you battle for Urth Domination. Blizzard\'s Freeze Breath and Ice Geyser fighting moves stop you cold just before his Mega Punch hammers you senseless. Diablo\'s Inferno Flash cooks up a firestorm in one dino barbecuing breath, and the foul, disgusting Chaos dazes you with an abundant supply of Power Puke, Farts of Fury, and Flying Butt Slams. Armadon\'s Gut Gouger and Gut Fling, Sauron\'s Cranium Crusher and Talon\'s Face Ripper and Shredding and Vertigo\'s Scorpion Sting - every original arcade fighting and fatality move is at your fingertips! Get Ready to Rage!', '/images/snes/6065/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/Primal_Rage_flyer.jpg', NULL, NULL),
(6066, 'Prince of Persia 2: The Shadow and the Flame', NULL, NULL, 'Journey back to Persia in the swashbuckling sequel to he award winning Prince Of Persia. Prince of Persia 2 is alive with breathtakingly fluid animation and scenery so rich in colour and feeling it\'ll change you forever.', '/images/snes/6066/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/a/ac/Pop2-saf.JPG', NULL, NULL),
(6067, 'Princess Maker: Legend of Another World', NULL, NULL, 'Princess Maker: Legend of Another World is a Strategy game, developed by Gainax and published by Takara,  which was released in Japan in 1995.', '/images/snes/6067/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/8/42748_front.jpg', NULL, NULL),
