(6072, 'Pro Mahjong Kiwame III', NULL, NULL, 'Pro Mahjong Kiwame III is a Miscellaneous game, published by Athena,  which was released in Japan in 1995.', '/images/snes/6072/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/9/7/307097_front.jpg', NULL, NULL),
