(6075, 'Pro Yakyū Nettō: Puzzle Stadium', NULL, NULL, 'Pro Yakyuu Nettou Puzzle Stadium is a Puzzle game, published by Coconuts Japan,  which was released in Japan in 1997.', '/images/snes/6075/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/5/307265_front.jpg', NULL, NULL),
(6076, 'Pro Yakyū Star', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6077, 'Psycho Dream', NULL, NULL, 'Psycho Dream is an Action game, developed and published by Riot,  which was released in Japan in 1992.', '/images/snes/6077/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1d/PsychoDreamBoxShotSNES.jpg', NULL, NULL),
(6078, 'Pushover', NULL, NULL, 'G. I. Ant is a soldier ant. He\'s extremely clever, and highly trained in tactical maneuvers. What\'s more, he\'s extraordinarily strong and super smart! His latest mission is to gain access to the crazy world of Captain Cat\'s Treasure Caves. Very straightforward.....NOT!', '/images/snes/6078/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/9/51039_front.jpg', NULL, NULL),
(6079, 'Putty Squad', NULL, NULL, 'The C.I.A has formed a crack covert team to parachute into hostile areas and rescue the Putty M.I.A.s. The team consists of Super Putty and his one time enemy Dweezil the Ginger Cat. They must also terminate the rogue Commander, Napalm the Cat who having gone crazy has set himself up as a god to the native population of spotted frogs in the area. This is their mission and they must not fail or the Putty M.I.A.s are doomed.', '/images/snes/6079/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/8/311238_front.jpg', NULL, NULL),
(6080, 'Puzzle\'n Desu!', NULL, NULL, 'Puzzle\'N Desu! is a Puzzle game, developed and published by Nichibutsu,  which was released in Japan in 1995.', '/images/snes/6080/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/5/306075_front.jpg', NULL, NULL),
(6081, 'Q*bert 3', NULL, NULL, 'Just when you thought it was safe to go hopping around on a pyramid...! Q*BERT 3 takes the classic Q*BERT arcade game theme to new heights, with an amazing variety of eye-popping, multi-screen worlds. You control Q*BERT as he tries to clear screen after screen while being chased by a wild bunch of crafty characters. You\'ll encounter the old familiar cast, lang with a whole universe of new enemies, obstacles and items. And in Q*BERT 3, Q*BERT\'s classic pyramid is only one of over 100 differently-shaped playfields, You\'ll find level after level of new and unique challenges!', '/images/snes/6081/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/4/2/51042_front.jpg', NULL, NULL),
(6082, 'Race Drivin\'', NULL, NULL, 'Here it is... the amazing conversion of the smash arcade sensation brings screaming-fast car racing to your home! Pound the pedal and grind those gears, down the straights and around wicked hairpin turns. Whip through hairy S-curves, gut-flipping loop-the-loops and crazy corkscrews! With three cars to choose from, multiple music tracks and cool sound effects, Race Drivin\' brings arcade-style auto speed competition right to you!', '/images/snes/6082/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/29/Race_Drivin_arcade_flyer.jpg', NULL, NULL),
(6083, 'Radical Rex', NULL, NULL, 'Come hang with Radical Rex. He\'s the raddest, baddest fire-breathing Tyrannosaurus ever to shred prehistoric pavement! This badboy-on-wheels is out to save the dinosaur race.', '/images/snes/6083/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1a/Radical_Rex_cover.jpg', NULL, NULL),
(6084, 'Raiden Trad', 'Raiden Densetsu', NULL, 'The year is 2090 A.D. in reaction to centuries of war and international strife the people of earth, united under a world allied government, established what was thought to be a lasting world peace. They thought wrong. A new enemy has emerged to threaten earth\'s peace, an enemy from another world...', '/images/snes/6084/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/4/6/51046_front.jpg', NULL, NULL),
(6085, 'Ranma ½: Akaneko-dan teki Hihou', NULL, NULL, 'Ranma 1/2: Akanekodan Teki Hihou is a Role-Playing game, developed by Atelier Double and published by Toho,  which was released in Japan in 1993.', '/images/snes/6085/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/4/4/51044_front.jpg', NULL, NULL),
(6086, 'Ranma ½: Chougi Rambuhen', NULL, NULL, 'Ranma 1/2: Chougi Ranbu Hen is an Action game, developed by Atelier Double and published by Shogakukan,  which was released in Japan in 1994.', '/images/snes/6086/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/4/8/51048_front.jpg', NULL, NULL),
(6087, 'Ranma ½: Hard Battle', NULL, 'Ranma Nibun-no-Ichi: Bakuretsu Rantōhen', 'Welcome to the world of RANMA 1/2 Explosive Free-Fight, the hottest new blockbuster from the phenomenon that is... MANGA!', '/images/snes/6087/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c7/Hard_Battle_cover.jpg', NULL, NULL),
(6088, 'Ranma ½: Ougi Jaanken', NULL, NULL, 'Ranma 1/2: Ougi Jaanken is a Puzzle game, developed by Atelier Double and published by Shogakukan,  which was released in Japan in 1995.', '/images/snes/6088/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/8/41588_front.jpg', NULL, NULL),
(6089, 'Rap Jam: Volume One', NULL, NULL, 'HIT THE COURTS!', '/images/snes/6089/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/4/7/51047_front.jpg', NULL, NULL),
(6090, 'Rapurasu no Ma', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6091, 'Realm', NULL, NULL, 'Welcome to 5069 AD. Earth is fighting a losing war against alien invaders, and guess who\'s mankind\'s last hope for survival... that\'s right, it\'s up to YOU. You\'re BIOMECH, a super cyborg, and it\'s your job to prevent Earth\'s total annihilation.', '/images/snes/6091/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fc/Realm_Royale.jpg', NULL, NULL),
(6092, 'Red Riding Hood Chacha', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6093, 'Redline F-1 Racer', NULL, 'Suzuki Aguri no F-1 Super Driving', 'You race against 16 F-1 World Champions. The most exciting F-1 game ever!', '/images/snes/6093/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/4/51054_front.jpg', NULL, NULL),
(6094, 'Rejoice: Aretha Ōkoku no Kanata', NULL, NULL, 'Rejoice: Aretha Oukoku no Kanata is a Role-Playing game, developed by Japan Art Media (JAM) and published by Yanoman,  which was released in Japan in 1995.', '/images/snes/6094/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/9/31849_front.jpg', NULL, NULL),
(6095, 'Relief Pitcher', NULL, NULL, '"Welcome ladies and gentlemen. It\'s a great day for baseball!" And you\'ll hear that very statement along with dozens of others from the actual, digitized voice of Jack Buck, one of the most famous baseball announcers in history. Jack Buck\'s play-by-play is just one of the many great features that makes Relief Pitcher one of the most realistic baseball games ever produced for the Super NES.', '/images/snes/6095/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/8/51058_front.jpg', NULL, NULL),
(6096, 'The Ren and Stimpy Show: Fire Dogs', NULL, NULL, 'Stimpy, inside The Firehouse, the Chief wants you to pick up all of the equipment for the fire engine: the hose, the beaver, the stinky socks... Just make sure you put out the fires and don\'t let your dalmatian paint wash off. Me, I\'ll rest up for the REAL job.', '/images/snes/6096/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/7/51057_front.jpg', NULL, NULL),
(6097, 'Rendering Ranger: R2', NULL, NULL, 'Rendering Ranger: R2 is an Action game, developed by Rainbow Arts and published by Virgin Interactive,  which was released in Japan in 1995.', '/images/snes/6097/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/1/31911_front.jpg', NULL, NULL),
(6098, 'Res Arcana: Diana Ray: Uranai no Meikyuu', NULL, NULL, 'Res Arcana is a Miscellaneous game, developed by Marionette and published by Coconuts Japan,  which was released in Japan in 1995.', '/images/snes/6098/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/4/8/31848_front.jpg', NULL, NULL),
(6099, 'Revolution X', NULL, NULL, 'Here\'s the deal... The New Order Nation - a powerful, corrupt alliance is crushing today\'s youth and destroying all things fun. It\'s a gruesome regime, under the iron rule of Headmistress Helga, a vicious vamp whose obvious attractions are fatal. Suddenly, America\'s premiere rock band, Aerosmith, is abducted by NON forces. Now it\'s up to you to stop the destruction... and Music is the Weapon!', '/images/snes/6099/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/4/9/24649_front.jpg', NULL, NULL),
(6100, 'Rex Ronan: Experimental Surgeon', NULL, NULL, 'Embark on an incredible mission, but beware!', '/images/snes/6100/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/4/51064_front.jpg', NULL, NULL),
(6101, 'Riddick Bowe Boxing', NULL, 'Ridikku Bou Bokushingu', 'TAKE A SWING AT THE CHAMP!', '/images/snes/6101/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/2/46652_front.jpg', NULL, NULL),
(6102, 'Ring ni Kakero', NULL, NULL, 'Ring ni Kakero is a Sports game, developed by Earthly Soft and published by NCS,  which was released in Japan in 1998.', '/images/snes/6102/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c0/Ring_ni_Kakero_vol_1_reprint.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(6103, 'Rise of the Phoenix', 'Kouryuuki', NULL, 'The year\'s 206 BC and things in China are heating up. The First Emperor has just died and a weak successor has been appointed. Seeing an opportunity for control of the nation, two of China\'s greatest warriors, Xiang Yu and Liu Bang are locked in a bitter rivalry for control of the nation. With their armies preparing to clash, it is said the victor has been selected by the heavens to rule all of China. Assuming the rule of either great warrior, it\'s up to you to plot the strategies that will defeat your counterpart and lead the country into the next dynasty.', '/images/snes/6103/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/3/51063_front.jpg', NULL, NULL),
(6104, 'Rise of the Robots', NULL, NULL, 'Half Human, Half Machine ... It\'s up to you to crush the android revolution with metal mashing warfare and devastating super moves.', '/images/snes/6104/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a5/Rise_of_the_Robots_Cover_art.jpg', NULL, NULL),
(6105, 'Rival Turf!', 'Rushing Beat', NULL, 'They\'re rough, they\'re tough, and they\'re tired of the street punks that have taken over their turf. And that spells trouble for trash-talkin\' Big Al and his mob of inner city riff-raff. Because these brothers are out to take back the streets, no matter what it takes--and they won\'t stop punching, kicking, and slamming until they clear the trash from every alley in America!', '/images/snes/6105/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3f/Rival_Turf%21_cover.jpg', NULL, NULL),
(6106, 'Road Riot 4WD', NULL, NULL, 'The meanest road rally ever to hit the World Circuit is here! Road Riot brings all the fun and intensity of 4WD racing and added a few surprises along the way! Muscle your opponent\'s cars off the shoulder of the road. Do somersaults and spin-outs as you try to master each course. Let the missiles fly as you tell the other drivers, "Outta My Way!!"', '/images/snes/6106/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/RoadRiot4WDflyer.jpg', NULL, NULL),
(6107, 'Road Runner\'s Death Valley Rally', NULL, 'Road Runner vs. Wile E. Coyote', '"BEEP! BEEP!"', '/images/snes/6107/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/83/Road_Runner%27s_Death_Valley_Rally_Coverart.png', NULL, NULL),
(6108, 'RoboCop Versus The Terminator', NULL, NULL, 'As Robocop--both the unwitting agent of humankind\'s destruction and its last possible champion--you must travel across time into a savage future ruled by the mechanical forces of Skynet.', '/images/snes/6108/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5a/Robocop_versus_Terminator_cover.jpg', NULL, NULL),
(6109, 'Robotrek', 'Slap Stick', NULL, 'ROBOTREK', '/images/snes/6109/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/7/51077_front.jpg', NULL, NULL),
(6110, 'Rock n\' Roll Racing', NULL, NULL, 'Yeah! With music and engines scream\'N, you pick your car, driver and weapons, then slam it into gear. With world-famous race announcer Larry "Supermouth" Huffman at the mike and some of the greatest Rock N\' Roll music of all time setting the tone, it\'s time for the line! Using laser cannons, cluster bombs and super boosters to annihilate your competition, your racing skills are pitted against a truly gruesome field of lead-footed crazies as you race to different planets. Better yet, with each checked flag your pile of cash grows and so does your buying power! More weapons! More engines! More armor! So back off wimps, this race ain\'t for no Sunday drivers!', '/images/snes/6110/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ef/Rock_N%27_Roll_Racing_Cover.jpg', NULL, NULL),
(6111, 'Rockman and Forte', NULL, NULL, 'Join Mega Man and Bass\'s fight for humankind as you face off with the newest menace in town--Robot King.  King\'s captured all of the data plans for Dr. Wily\'s creations.  They will  equip King with all the knowledge he needs to build his own indestructible army of robots.  As either Mega Man or Bass, you\'ll set out separate adventures using a variety of battle moves and weapons to defeat robot masters.  Hidden bolts and CDs give you extra items to assist in battles.', '/images/snes/6111/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/5/19625_front.jpg', NULL, NULL),
(6112, 'Rocko\'s Modern Life: Spunky\'s Dangerous Day', NULL, NULL, 'Spunky...Spunky...SPUNKY!!! Look out!', '/images/snes/6112/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/9/51079_front.jpg', NULL, NULL),
(6113, 'Rocky Rodent', 'Nitropunks: Mightheads', NULL, 'CAUTION! MERGING MANIAC!', '/images/snes/6113/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f2/RockyRodentJPBoxArtSNES.jpg', NULL, NULL),
(6114, 'Rokudenashi Blues: Taiketsu! Tokyo Shitennou', NULL, NULL, 'Rokudenashi Blues is a Role-Playing game, developed by TOSE and published by Bandai,  which was released in Japan in 1994.', '/images/snes/6114/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/0/31600_front.jpg', NULL, NULL),
(6115, 'Romance of the Three Kingdoms III: Dragon of Destiny', 'Sangokushi III', NULL, 'DO YOU HAVE THE POWER?', '/images/snes/6115/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/42/Romance_of_the_Three_Kingdoms_III_-_Dragon_of_Destiny_coverart.png', NULL, NULL),
(6116, 'Romancing SaGa', NULL, NULL, 'Romancing SaGa 2, originally released only in Japan in 1993, has been completely remastered and now receives its first ever official English translation!', '/images/snes/6116/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ea/RomancingSaGaSFBox.jpg', NULL, NULL),
(6117, 'Romancing SaGa 2', NULL, NULL, 'Romancing SaGa 2, originally released only in Japan in 1993, has been completely remastered and now receives its first ever official English translation!', '/images/snes/6117/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a2/Rmns2box.jpg', NULL, NULL),
(6118, 'Romancing SaGa 3', NULL, NULL, 'Romancing SaGa 3 is a Role-Playing game, developed and published by SquareSoft,  which was released in Japan in 1995.', '/images/snes/6118/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/9/4/51094_front.jpg', NULL, NULL),
(6119, 'RPG Tsukūru: Super Dante', NULL, NULL, 'RPG Tsukuru: Super Dante is a Role-Playing game, developed by Kuusou Kagaku and published by ASCII Entertainment,  which was released in Japan in 1995.', '/images/snes/6119/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/2/36682_front.jpg', NULL, NULL),
(6120, 'RPG Tsukūru 2', NULL, NULL, 'RPG Tsukuru 2 is a Role-Playing game, developed by Kuusou Kagaku and published by ASCII Entertainment,  which was released in Japan in 1996.', '/images/snes/6120/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/1/43361_front.jpg', NULL, NULL),
(6121, 'RPM Racing', NULL, NULL, NULL, '/images/snes/6121/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a2/RPM_Racing_cover.jpg', NULL, NULL),
(6122, 'R-Type III: The Third Lightning\'', 'Āru Taipu Surī: Za Sādo Raitoningu', NULL, 'The Evil Bydo Empire seeks to wipe out our species, and you\'re the only one who can stop the assault. As the last pilot on Earth, you must fly the untested R-90 against the Evil Bydo. Along the way, you can earn force pods (Round Force, Shadow Force, and Cyclone Force) that equip your vessel with different sets of weapons. Blast your way through intense levels filled with enemy inhabitants, large bosses, and challenging obstacles.', '/images/snes/6122/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7c/R-Type_III_Coverart.png', NULL, NULL),
(6123, 'Rudra no Hihō', NULL, NULL, 'Rudra no Hihou is a Role-Playing game, developed and published by SquareSoft,  which was released in Japan in 1996.', '/images/snes/6123/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2f/Rudracover.jpg', NULL, NULL),
(6124, 'Ruin Arm', NULL, NULL, 'Ruin Arm is a Role-Playing game, developed by TOSE and published by Bandai,  which was released in Japan in 1995.', '/images/snes/6124/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Ruin_arm.jpg', NULL, NULL),
(6125, 'Run Saber', NULL, NULL, 'The year is 2998 and the Earth is hopelessly polluted. Mankind\'s last chance for a clean planet rests in the hands of Dr. Bruford\'s plan to use radiation to trigger a change. Only, something goes horribly wrong! Dr. Bruford is mutated and begins an evil quest, for world domination!', '/images/snes/6125/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/75/Run_Saber_SNES_cover.jpg', NULL, NULL),
(6126, 'Ryuukihei Dan Danzarubu', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6127, 'Ryuuko no Ken 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6128, 'Saibara Rieko no Mahjong Hourouki', NULL, NULL, 'Saibara Rieko no Mahjong Hourouki is a Miscellaneous game, developed by Natsume and published by Taito Corporation,  which was released in Japan in 1995.', '/images/snes/6128/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/8/312588_front.jpg', NULL, NULL),
