(6131, 'Sailor Moon', 'Bishoujo Senshi Sailor Moon', NULL, 'Bishoujo Senshi Sailor Moon: Another Story is a Role-Playing game, developed and published by Angel (Bandai),  which was released in Japan in 1995.', '/images/snes/6131/cover.svg', 'https://upload.wikimedia.org/wikipedia/en/d/df/Sailor_Moon_Updated_Logo.svg', NULL, NULL),
(6132, 'Sakurai Shouichi no Jankiryuu: Mahjong Hisshouhou', NULL, NULL, 'Sakurai Shouichi no Jankiryuu Mahjong Hisshouhou is a Miscellaneous game, developed by J-Force and published by Sammy Studios,  which was released in Japan in 1995.', '/images/snes/6132/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/9/307129_front.jpg', NULL, NULL),
