(6134, 'SameGame + Tengai Makyou Zero Jikei', NULL, NULL, 'Tengai Makyou Zero is a Role-Playing game, developed by RED Entertainment and published by Hudson,  which was released in Japan in 1995.', '/images/snes/6134/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/3/43363_front.jpg', NULL, NULL),
(6135, 'Samurai Shodown', 'Samurai Spirits', NULL, 'Lost in a forgotten era... You are a fierce Samurai warrior with only one goal. To seek out and defeat your enemies with all your strength and skills. Armed only with your sword, you must rely on your keen instincts while you do battle with some of the strongest and craftiest Knights, Ninjas, and tough guys ever assembled.', '/images/snes/6135/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/3/21543_front.jpg', NULL, NULL),
