(6137, 'Sangokushi Seishi: Tenbu Spirits', NULL, NULL, 'San Goku Shi Seishi: Tenbu Spirits is a Strategy game, developed and published by Wolf Team,  which was released in Japan in 1993.', '/images/snes/6137/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/2/306852_front.jpg', NULL, NULL),
(6138, 'Sankyo Fever! Fever!', NULL, NULL, 'Sankyo Fever! Fever! is a Miscellaneous game, published by Nippon Telenet,  which was released in Japan in 1994.', '/images/snes/6138/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/8/306998_front.jpg', NULL, NULL),
(6139, 'Sanrio Shanghai', NULL, NULL, 'Sanrio Shanghai is a Puzzle game, developed by SAS Sakata and published by Character Soft,  which was released in Japan in 1994.', '/images/snes/6139/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/2/31792_front.jpg', NULL, NULL),
