(6142, 'Saturday Night Slam Masters', 'Muscle Bomber', NULL, 'It\'s Saturday night and the Slam Masters have arrived! Ten of the biggest and beefiest wrestlers ever to step into the ring have gathered for one bone-crushing, back-breaking tournament where there are NO RULES!', '/images/snes/6142/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/5/44575_front.jpg', NULL, NULL),
(6143, 'Scooby-Doo Mystery', NULL, NULL, 'Scooby, Shaggy, and the gang are up to their zany tricks again! With ghosts haunting Drabwell\'s Ranch and a crazy pirate running Deadman\'s Cove, you\'ll have to find all the creepy clues to solve the spooky mystery! Packed with classic Scooby sound effects, terrific Hanna-Barbera cartoon characters, and hidden surprises, Scooby-Doo Mystery is a scream!', '/images/snes/6143/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2f/Scooby-Doo_Mystery_box_art.jpg', NULL, NULL),
(6144, 'SD F-1 Grand Prix', NULL, NULL, 'SD F-1 Grand Prix is a Racing game, developed and published by Video System,  which was released in Japan in 1995.', '/images/snes/6144/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/7/31907_front.jpg', NULL, NULL),
