(6153, 'SeaQuest DSV', NULL, NULL, 'SeaQuest DSV, the future\'s largest, most powerful submarine, is at your command!', '/images/snes/6153/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d7/SeaQuestDSVMainTitle.jpg', NULL, NULL),
(6154, 'Secret of Evermore', NULL, NULL, 'In Dr. Sidney Ruffleberg\'s old, decaying mansion, a boy and his dog stumble upon a mysterious machine. By sheer accident they are propelled into Evermore, a one-time utopia that now has become a confounding and deadly world. A world of prehistoric jungles, ancient civilizations, medieval kingdoms and futuristic cities. During his odyssey, the boy must master a variety of weapons, learn to harness the forces of alchemy, and make powerful allies to battle Evermore\'s diabolical monsters. What\'s more, his dog masters shape-changing to aid the quest. But even if they can muster enough skill and courage, even if they can uncover the mysterious clues, they can only find their way home by discovering the Secret of Evermore™.', '/images/snes/6154/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/99/Secret_of_Evermore.jpg', NULL, NULL),
(6155, 'Secret of Mana', 'Seiken Densetsu 2', NULL, NULL, '/images/snes/6155/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b7/Secret_of_Mana_Box.jpg', NULL, NULL),
(6156, 'Secret of the Stars', 'Aqutallion', NULL, 'You know Tecmo for creating unequaled sports games, and we\'ve made history in doing so. What you don\'t know is that we\'re making history again. Only this time, we are playing a different role. Introducing Tecmo\'s first epic RPG title: Tecmo Secret of the Stars.', '/images/snes/6156/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Secret_of_the_stars.jpg', NULL, NULL),
(6157, 'Seifuku Densetsu: Pretty Fighter', NULL, NULL, 'Seifuku Densetsu: Pretty Fighter is an Action game, developed by Genki and published by Imagineer,  which was released in Japan in 1994.', '/images/snes/6157/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/8/3/309483_front.jpg', NULL, NULL),
(6158, 'Seijuu Maden: Beasts and Blades', NULL, NULL, 'Seijuu Maden Beasts & Blades is a Strategy game, published by Bullet Proof Software,  which was released in Japan in 1995.', '/images/snes/6158/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/9/31919_front.jpg', NULL, NULL),
(6159, 'Seiken Densetsu 3', NULL, NULL, 'Seiken Densetsu 3 is a Role-Playing game, developed and published by SquareSoft,  which was released in Japan in 1995.', '/images/snes/6159/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/dd/Seiken_Densetsu_3_Front_Cover.jpg', NULL, NULL),
(6160, 'Sengoku Denshou', NULL, NULL, 'It\'s the final battle. A warlord in the past planned to conquer the world by brutal attack. Now, 400 years later, this "Demon Castle" suddenly appeared in the sky above Washington D.C. The prophecy came true! Only two samurai warriors with the special weapon can stop the revival of this ghost!', '/images/snes/6160/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/9/48819_front.jpg', NULL, NULL),
(6161, 'Sengoku no Hasha', NULL, NULL, 'Sengoku no Hasha is a Strategy game, developed by Bits Laboratory and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/6161/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/7/31927_front.jpg', NULL, NULL),
(6162, 'Sgt. Saunders\' Combat!', NULL, NULL, 'Sgt. Saunders\' Combat! is a Strategy game, developed by Play Avenue and published by ASCII Entertainment,  which was released in Japan in 1995.', '/images/snes/6162/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/0/307140_front.jpg', NULL, NULL),
(6163, 'Shanghai: Banri no Choujou', NULL, NULL, 'Just when you thought your Shanghai stragety was as solid as the Great Wall of China...Three captivating new games with enticing new rules, plus Classic Shanghai for the purist. Play each game in a head-to-head tournament against a friend - or race the clock in a series of games. Perfect your stragety under extreme competitive conditions. Accept the ultimate Shanghai: Triple-Threat challenge.', '/images/snes/6163/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/8/31908_front.jpg', NULL, NULL),
(6164, 'Shanghai II: Dragon\'s Eye', 'Super Shanghai: Dragon\'s Eye', NULL, 'The ancient fascination of Mah-Jongg meets the cutting edge of video games in the most captivating strategy game to challenge the Western world - Shanghai II: Dragon\'s Eye. Calculate your moves! Beware the art of maneuver. An intricate ever-changing layout of ancient tiles marked with mysteriously eye-catching designs challenges your every move. Think before you make your move - it could be your last. Clear the board! Snap off matching pairs until the board is empty. Looks simple enough... but looks can be deceiving. The next tile you need may be buried five deep. Choose from 13 deceptively simple tile formations and 9 unshakably addictive tile sets with surprising animation, exciting sounds and enchanting musical themes. Master the basics, and then confront the ultimate challenge: Dragon\'s Eye!', '/images/snes/6164/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/9/48059_front.jpg', NULL, NULL),
(6165, 'Shanghai III', NULL, NULL, '"Shanghai III" is a puzzle game released by SUNSOFT in 1993.', '/images/snes/6165/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/83/God_of_Gamblers_III_Back_to_Shanghai_DVD_cover.jpg', NULL, NULL),
(6166, 'Shaq Fu', NULL, NULL, 'As Shaw, use your lightning-fast shuriken and other martial mart techniques to prevail over 6 intensely evil warriors in the enforcement of justice. Or choose any of the 7 warriors and fight head to head. Summon Voodoo\'s bone shattering earthquake, rebound with Rajah\'s shockwave sword or lash out with Sett\'s terrifying mummy wrap. Scores of secret power moves to discover and master.', '/images/snes/6166/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e9/ShaqFu_logo.png', NULL, NULL),
