(6203, 'Silva Saga II: The Legend of Light and Darkness', NULL, NULL, 'Silva Saga II: The Legend of Light and Darkness is a Role-Playing game, developed and published by Seta Corporation,  which was released in Japan in 1993.', '/images/snes/6203/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3c/Silvasaga2sfc.jpg', NULL, NULL),
(6204, 'SimAnt', NULL, NULL, 'Experience life as an ant: fight for queen and colony, face hungry spiders and menacing hordes of enemy ants, eat yummy caterpillars, and drive those yucky humans out of the house! Based on real ants, SimAnt has the depth of play and serious gaming challenge to really drive you buggy.', '/images/snes/6204/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f7/SimAnt_Coverart.png', NULL, NULL),
(6205, 'SimCity', NULL, NULL, 'SimCity 2000 puts an entire city in the palm of your hand. SimCity 2000 lets you create, build, and run a city of your own. Take on the role as a mayor and call the shots for the entire city. You\'ll have to keep up on the housing, industries, mass transportation, and commerce to attract potential citizens. And just when you think you have it under control, a natural disaster or alien invasion may occur to set you back. However, if you can conquer all of these problems, you just might be able to turn a small town into a thriving metropolis.', '/images/snes/6205/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0e/Logo_of_SimCity.png', NULL, NULL),
(6206, 'SimCity 2000', NULL, NULL, 'SimCity 2000 puts an entire city in the palm of your hand. SimCity 2000 lets you create, build, and run a city of your own. Take on the role as a mayor and call the shots for the entire city. You\'ll have to keep up on the housing, industries, mass transportation, and commerce to attract potential citizens. And just when you think you have it under control, a natural disaster or alien invasion may occur to set you back. However, if you can conquer all of these problems, you just might be able to turn a small town into a thriving metropolis.', '/images/snes/6206/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/d4/SimCity_2000_Coverart.png', NULL, NULL),
(6207, 'SimEarth', 'SimEarth: The Living Planet', NULL, 'An entire planet becomes your laboratory in this large-scale simulation game. Players help foster new life and promote its evolution into lifeforms of higher intelligence. Guide civilization along the path of evolution until it can achieve Exodus, the ultimate goal of settling on another planet. The basic challenge of the game is to maintain a comfortable environment for the lifeforms by adjusting atmosphere and geological parameters. Small organisms called Prokaryote and Trichordate will grow and evolve into a multitude of lifeforms. Making a drastic change is a recipe for disaster. The key to success is to make small adjustments and see how the lifeforms react. SimEarth also includes planets with environments different from Earth, such as Mars and Venus. Try your hand at terraforming these planets with harsh conditions into a world where life can thrive.', '/images/snes/6207/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/81/Simearth-box.jpg', NULL, NULL),
(6208, 'The Simpsons: Bart\'s Nightmare', 'The Simpsons: Bart no Fushigi na Yume no Daibouken', NULL, 'I can hear you saying: "Bart Simpson lost his homework? Suuure. What\'s his lame excuse this time?" Hey, I swear, I fell asleep! What a nightmare. Eight levels, each one scarier than the last, with villains like Homer Kong, Momthra, and Barney Gumble riding a pink elephant. I have to collect a page on each level, before I wake up and blow the whole assignment. You\'re my only hope, man.', '/images/snes/6208/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c0/Bart%27s_Nightmare.jpg', NULL, NULL),
(6209, 'Simulation Pro Yakyuu', NULL, NULL, 'Simulation Pro Yakyuu is a Sports game, developed and published by Hect,  which was released in Japan in 1995.', '/images/snes/6209/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/3/31853_front.jpg', NULL, NULL),
(6210, 'Sink or Swim', NULL, NULL, 'You\'ve really been dropped in at the deep end this time! The SS Luofer is on a one-way trip to the seabed after colliding with an iceberg. It\'s jam-packed with panic-stricken passengers who are waiting for their hero, Kevin, to come to the rescue. Playing the part of Kevin, you have to guide the passengers through some of the worst hazards in modern game-playing before time runs out and the compartments flood.', '/images/snes/6210/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/75/Sinkorswim.jpg', NULL, NULL),
(6211, 'Sküljagger: Revolt of the Westicans', NULL, NULL, 'There\'s never been a game like this before. Skuljagger combines a high-powered action game with a clue-filled story to create the biggest 16-bit experience ever!', '/images/snes/6211/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d3/SkujaggerBoxShotSNES.jpg', NULL, NULL),
(6212, 'Skyblazer', 'Karuraou', NULL, 'Ashura, Lord of War, has conquered the Realm and only SkyBlazer has the power to save the world from eternal evil. As SkyBlazer, son of the great sorcerer Sky Lord, you have the incredible ability to transform yourself into many different super beings and summon the powers of nature at will. Experience revolutionary action with perilous journeys over many strange and other-worldly lands, where water spouts stand like towers, sands shift like oceans, and enemies leap down from trees and rise from molten lava. The awesome collection of diabolical bosses can only be defeated by tapping SkyBlazer\'s amazing strength and resources, like the comet flash and the Fiery Phoenix. You\'ll battle on land, soar high up into the clouds, swim through underwater caverns, explore bizarre ruins, and climb sheer cliffs, as you travel from the Gateway of Eternal Storms to the Tower of the Tarolisk. Then face the ultimate challenge of defeating Ashura.', '/images/snes/6212/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/41/Skyblazer_cover.jpg', NULL, NULL),
(6213, 'Slayers', NULL, NULL, 'Slayers is a Role-Playing game, developed by Bec and published by Banpresto,  which was released in Japan in 1994.', '/images/snes/6213/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f9/Slayers_light_novel_vol_1.jpg', NULL, NULL),
(6214, 'Smart Ball', 'Jerry Boy', NULL, 'The whole family will enjoy playing this Super NES adventure. SmartBall is one of the most devilish little characters you\'ll ever meet. He clings, jumps and bounces his way through life, from the slippery tropics to a dangerous urban battlezone. You\'ll guide SmartBall through eight dizzying worlds as he takes on everything from flaming firebirds to hidden sandworms.', '/images/snes/6214/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/93/Smart_Ball_Cover.jpg', NULL, NULL),
(6215, 'Smash Tennis', 'Super Family Tennis', NULL, 'The adrenalin\'s pumping, and the crowd is on the edge of its seat, waiting for you to play Smash Tennis. Jam-packed with options and features, with 9 gloriously realistic courts, including grass, indoor, clay, and even a mountain top! Choose Tournament option and play up to four of your friends using the multi-tap system, or sweat it out against up to 20 computer opponents, if you dare!', '/images/snes/6215/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/2/31712_front.jpg', NULL, NULL),
(6216, 'Snoopy Concert', NULL, NULL, NULL, '/images/snes/6216/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/30/Snoopy_Concert.jpg', NULL, NULL),
(6217, 'Snow White: Happily Ever After', NULL, NULL, 'The classic fairy tale is back...with all new enchantment and a new twist!!! Snow White\'s beloved prince has been captured by the evil Lord Maliss, the evil brother of Snow White\'s equally evil stepmother, the wicked queen. Helping Snow White rescue the prince are the magical Seven Drawfelles, the female cousins of the original Seven Dwarves. Guide Snow White along her perilous journey through Lord Maliss\' sinister kingdom to save the prince as he once saved her. Turn about is fair play...and FUN play!! Based on the hit feature film "Happily Ever After".', '/images/snes/6217/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/12/Snow_White_in_Happily_Ever_After.png', NULL, NULL),
(6218, 'Soccer Kid', 'The Adventures of Kid KleetsNA', NULL, 'Someone has stolen the World Soccer Cup and scattered the broken pieces all over the globe. Kid Kleets to the rescue...', '/images/snes/6218/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/61/Soccer_Kid_Coverart.png', NULL, NULL),
(6219, 'Soldiers of Fortune', 'The Chaos Engine', NULL, 'Sometime during the last century, an experimenter with time, space and early computers created a bizarre machine. The inventor\'s name was Baron Fortesque. The machine was... The Chaos Engine. Although primitive, the machine became incredibly powerful and went crazy, turning ordinary humans and household pets into razor-toothed, armor-plated killing machines. Enter 6 hard-nailed mercenaries for hire. These ball-breakers are armed to the teeth with over 25 weapons and a host of special destructive devices specific to their class. Select 2 characters to form your party and enter the World of Chaos. The sprawling adventure covers 4 graphic worlds and 16 levels loaded with fiendish traps, puzzles and secret passages. Get your hands on sawn-off shotguns, molotov cocktails and a huge amount of armament, and buy, blag or blast your way through hordes of different monsters to do battle with the ultimate killing machine, THE CHAOS ENGINE!', '/images/snes/6219/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/24/Soldier_of_Fortune_Coverart.png', NULL, NULL),
(6220, 'Solid Runner', NULL, NULL, 'Solid Runner is a Role-Playing game, developed by Sting and published by ASCII Entertainment,  which was released in Japan in 1997.', '/images/snes/6220/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e9/Solidrunnercover.jpg', NULL, NULL),
(6221, 'Sonic Blast Man', NULL, NULL, 'His Body Is A Lethal Weapon!', '/images/snes/6221/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b4/Sonic_Blast_Man_Poster.png', NULL, NULL),
(6222, 'Sonic Blast Man II', NULL, NULL, 'Sonic Blast Man ---The World Needs You!', '/images/snes/6222/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/0/4/29604_front.jpg', NULL, NULL),
(6223, 'Soreyuke Ebisumaru Karakuri Meiro: Kieta Goemon no Nazo!!', NULL, NULL, 'Soreyuke Ebisumaru Karakuri: Meiro Kieta Goemon no Nazo is a Puzzle game, developed by Konami Computer Entertainment Osaka and published by Konami,  which was released in Japan in 1996.', '/images/snes/6223/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/3/43393_front.jpg', NULL, NULL),
(6224, 'SOS', 'Septentrion', NULL, 'Are You Destined To Survive, Or Fated To A Watery Grave?', '/images/snes/6224/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/9/41249_front.jpg', NULL, NULL),
(6225, 'Sotsugyou Bangai Hen: Nee Mahjong Shiyo!', NULL, NULL, 'Sotsugyou Bangai Hen: Nee Mahjong Shiyo! is a Miscellaneous game, published by KSS,  which was released in Japan in 1994.', '/images/snes/6225/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/8/7/312487_front.jpg', NULL, NULL),
(6226, 'Sougou Kakutougi: Astral Bout', NULL, NULL, 'Astral Bout is a Sports game, developed by A-Wave and published by King Records,  which was released in Japan in 1992.', '/images/snes/6226/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/8/312548_front.jpg', NULL, NULL),
(6227, 'Sougou Kakutougi: Astral Bout 2: The Total Fighters', NULL, NULL, 'Sougou Kakutougi: Astral Bout 2 - The Total Fighters is a Sports game, developed by A-Wave and published by King Records,  which was released in Japan in 1994.', '/images/snes/6227/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/8/4/312484_front.jpg', NULL, NULL),
(6228, 'Sougou Kakutougi Rings: Astral Bout 3', NULL, NULL, 'Sougou Kakutougi Rings: Astral Bout 3 is a Sports game, developed by A-Wave and published by King Records,  which was released in Japan in 1995.', '/images/snes/6228/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/9/311619_front.jpg', NULL, NULL),
(6229, 'Soukou Kihei Votoms: The Battling Road', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6230, 'Soul and Sword', NULL, NULL, 'Soul & Sword is a Role-Playing game, developed by Pandora Box and published by Zamuse,  which was released in Japan in 1993.', '/images/snes/6230/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/1/31741_front.jpg', NULL, NULL),
(6231, 'Soul Blazer', 'Soul Blader', NULL, 'Money... The root of all evil.', '/images/snes/6231/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/9/51159_front.jpg', NULL, NULL),
(6232, 'Sound Novel Tsukūru', NULL, NULL, 'Sound Novel Tsukuru is a Miscellaneous game, developed by Success and published by ASCII Entertainment,  which was released in Japan in 1996.', '/images/snes/6232/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/9/307219_front.jpg', NULL, NULL),
(6233, 'Space Ace', NULL, NULL, 'The evil commander Borf has kidnapped Ace\'s girlfriend, the beautiful Kimberly, and is plotting to enslave the Earth using his dreaded "Infanto Ray", a weapon that changes everyone it blasts into a helpless baby. Armed with only a laser gun, Ace must find and destroy the Infanto Ray, rescue Kimberly and save the Earth. All in a day\'s work for a superhero, right?', '/images/snes/6233/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/1/11711_front.jpg', NULL, NULL),
(6234, 'Space Football: One on One', 'Super Linearball', NULL, 'Space Football: One on One is a Sports game, developed by Argonaut Games and published by Triffix,  which was released in 1992.', '/images/snes/6234/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/5/51165_front.jpg', NULL, NULL),
(6235, 'Space Megaforce', 'Super Aleste', NULL, '"Space Megaforce™". The game\'s thrilling speed is its most attractive feature. The enemy movements are fast. Your shots and the enemies\' shots are fast. Finally, the scrolling is fast. The screen filled with battle action just overflows with high speed shooting excitement. On top of that there is the Shot Control System operated wiith the "R" button. You can attack the enemy in a multitude of ways with a weapon using this system. Naturally, the features of the Super NES™ such as rotation, enlarging, and shrinking functions are used to their fullest and huge enemies never before possible are packed into this exciting MEGA game!', '/images/snes/6235/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8c/SpaceMegaforceBoxShot.jpg', NULL, NULL),
(6237, 'Spanky\'s Quest', 'Hansei Zaru: Jirou-kun no Daibouken', NULL, 'Wicked witch turns fruits into monsters, Mopoland Population famished!', '/images/snes/6237/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/6/46726_front.jpg', NULL, NULL),
(6238, 'Spark World', NULL, NULL, 'Spark World is an Action game, published by Den\'Z,  which was released in Japan in 1995.', '/images/snes/6238/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/7/307087_front.jpg', NULL, NULL),
(6239, 'Sparkster', NULL, NULL, 'He\'s back, and he\'s one oppumped-up opposum! SPARKSTER is jet-packin\' into action as the toughest Rocket Knight to ever swing a sword. Grab the controls and blast through 8 wild stages in your quest to rid the world of the evil King Gedol and his allies - a pack of lizards that are tougher than a suitcase! Oh yeah, and before you get too comfortable - Axel Gear is here. This Rocket-Knight-gone-bad has a score to settle with Sparkster. Our hero will need his revved-up new rocket pack and powerful new attack moves to kick Axel\'s tail back to the dark side of the planet.', '/images/snes/6239/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ab/Sparkster_North_American_SNES_box_art.jpg', NULL, NULL),
(6240, 'Spectre', NULL, NULL, 'Spectre, a one or two player game played in a virtual world, puts the player into a futuristic Battletank, fighting for survival in a cybernet battleworld. You\'ll be in control as you sit in your fully customizable Battlecraft, armed and shielded with every futuristic tank-like feature available to man. As you power around the Cyber Arena you will battle against your Enemy Robot opponents, whose small unit combat tactics are driven by powerful realtime artificial intelligence. While stalking the enemy you must collect all flags to advance to higher levels. Replenishing your energy and ammo is the key to success as you race against the clock, battling your way deeper and deeper into the unknown.', '/images/snes/6240/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c6/SPECTRE_Logo.png', NULL, NULL),
(6241, 'Speed Racer in My Most Dangerous Adventures', NULL, NULL, 'EXPERIENCE THE THRILL OF INTENSE RACING ACTION AND DEATH DEFYING SIDE-SCROLLING ADVENTURES.', '/images/snes/6241/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/45/Speed_Racer_in_My_Most_Dangerous_Adventures_Cover.jpg', NULL, NULL),
(6242, 'Speedy Gonzales: Los Gatos Bandidos', NULL, NULL, 'Why Do You Think They Call Him Speedy?', '/images/snes/6242/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/2e/Speedy_Gonzales_in_Los_Gatos_Bandidos.png', NULL, NULL),
(6243, 'Spider-Man: The Animated Series', NULL, NULL, 'Spider-Man\'s past comes back to haunt him when more maniacal madmen than you can count on two webbed hands bust out of prison and team up to settle the score against him. Only your Spider-Sense, wall-climbing ability, web-swinging maneuvers and a little help from the Fantastic Four can even the odds! The hunt is on... but who\'s the prey?', '/images/snes/6243/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0b/Batman_the_Animated_Series_logo.jpg', NULL, NULL),
(6244, 'Spider-Man and Venom: Maximum Carnage', NULL, NULL, 'Only one maniacal madman can force Spider-Man to unite with his sinister, arch-nemesis Venom: CARNAGE! His deadly rampage is tearing New York City apart! Only wild web-slinging maneuvers, crushing combat moves and Super Hero allies can save the city from total obliteration! It\'s maximum mayhem! It\'s Maximum Carnage! Paint the town red!', '/images/snes/6244/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e8/MaximumcarnageSNES_boxart.jpg', NULL, NULL),
(6245, 'Spider-Man and the X-Men in Arcade\'s Revenge', NULL, NULL, 'Spider-Man and his mutant pals need your help to escape from Arcade\'s diabolical amusement park - battling killer clowns, hungry piranhas, lethal doom balls and deadly robot replicas of super-villains like Carnage and Juggernaut! Will Spidey\'s webs, Wolverine\'s claws, Gambit\'s energy cards, Storm\'s lightning bolts and Cyclops\' optic blasts mean GAME OVER for Arcade? That depends on YOU!!', '/images/snes/6245/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/3/1/46731_front.jpg', NULL, NULL),
(6246, 'Spindizzy Worlds', NULL, NULL, 'Spindizzy Worlds is an Action game, developed and published by ASCII Entertainment,  which was released in Japan in 1992.', '/images/snes/6246/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/35/Spindizzy_Worlds_Cover.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(6247, 'Spirou', NULL, NULL, 'Just as he is about to present his inventions to a scientific research symposium in New York, Count Champignac is kidnapped by Cyanida. The evil robot has but one aim, to rule the world. There\'s not a moment to lose. Spirou will have to scour the streets, subways and skyscrapers of New York and fly to Palombia, a marshy jungle full of surprise... good and bad...', '/images/snes/6247/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/1/0/296710_front.jpg', NULL, NULL),
(6248, 'The Sporting News: Power Baseball', NULL, NULL, 'The Sporting News: Baseball is a Sports game, developed by Now Production and published by Hudson Soft,  which was released in 1995.', '/images/snes/6248/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/1/51171_front.jpg', NULL, NULL),
(6249, 'Sports Illustrated: Championship Football and Baseball', 'All-American Championship Football', NULL, 'TWO GREAT SPORTS ONE INCREDIBLE GAME', '/images/snes/6249/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/2/46742_front.jpg', NULL, NULL),
(6250, 'Spriggan Powered', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6251, 'Sprinter Monogatari: Mezase!! Ikkaku Senkin', NULL, NULL, 'Sprinter Monogatari is a Sports game, developed and published by Vap,  which was released in Japan in 1995.', '/images/snes/6251/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/9/307059_front.jpg', NULL, NULL),
(6252, 'St. Andrews: Eikou to Rekishi no Old Course', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6253, 'Star Fox 2', NULL, NULL, 'The battle for the galaxy is over. The evil emperor Andross\'s plans to seize control of the once-great Lylat system have been thwarted by the army of Corneria - thanks in no small part to the brave deeds of elite fighter squadron Star Fox. Their mission accomplished, Fox McCloud and his team depart once more for the deep expanses of space, sent off by the cheers and adoration of Corneria\'s grateful inhabitants.', '/images/snes/6253/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/88/Star_Fox_2_box_art.jpg', NULL, NULL),
(6254, 'Star Ocean', NULL, NULL, 'Star Ocean is a Role-Playing game, developed by Tri-Ace and published by Enix Corporation,  which was released in Japan in 1996.', '/images/snes/6254/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/4/41/Star_Ocean_logo_circa_The_Last_Hope_white.png', NULL, NULL),
(6255, 'Star Trek: Deep Space Nine – Crossroads of Time', NULL, NULL, 'Join the crew of the most famous space station in the galaxy! Adventure awaits as you guide Commander Sisko through a series of mysterious events that affect all life on the station! Use every resource to secure the stability of Deep Space Nine Space Station!', '/images/snes/6255/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/76/Star_Trek_Deep_Space_Nine_%E2%80%93_Crossroads_of_Time_SNES.jpg', NULL, NULL),
(6256, 'Star Trek: Starfleet Academy - Starship Bridge Simulator', NULL, NULL, 'It\'s high tension at the Klingon Neutral Zone. You must get past the blockage and deliver supplies to the Federation colonists on a planet claimed by the Klingon Empire. One false move could lead to war and even millions of casualities. Your reputation at the Academy is at stake.', '/images/snes/6256/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/1f/Star_Trek_Starfleet_Cover.jpg', NULL, NULL),
(6257, 'Stardust Suplex', NULL, NULL, 'Stardust Suplex is a Sports game, published by Varie,  which was released in Japan in 1995.', '/images/snes/6257/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/8/307038_front.jpg', NULL, NULL),
(6258, 'Stargate', NULL, NULL, 'Travel through the StarGate to a new intergalactic dimension of non-stop action, danger and adventure! Face a hostile and unknown world in a wide variety of incredible missions. StarGate will take you a million light years from home... but can you find your way back?', '/images/snes/6258/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/90/Sg1stargatefront.jpg', NULL, NULL),
(6259, 'Steel Talons', NULL, NULL, 'Sensors detect incoming missiles! Your AT1196 Steel Talons combat helicopter has the on-board computer and the firepower to meet the challenge. But can YOU?', '/images/snes/6259/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/4/51184_front.jpg', NULL, NULL),
(6260, 'Sterling Sharpe: End 2 End', NULL, NULL, 'What drives an athlete to excel past any expectations? What drove Sterling Sharpe to break the NFL record for the most receptions in one year, then break his own record the following season? The only way to truly know is to feel that drive in yourself.', '/images/snes/6260/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/3/51183_front.jpg', NULL, NULL),
(6261, 'Stone Protectors', NULL, NULL, 'Yo Dudes! Rock\'N Scrolllllllll!', '/images/snes/6261/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/5/51185_front.jpg', NULL, NULL),
(6262, 'Street Fighter Alpha 2', 'Street Fighter Zero 2', NULL, 'The bad boys from the Street Fighter series are back for more fisticuffs of fury! Eighteen different combatants, some old and some new, are here to lay claim to the title "World\'s Best." Screamin\' moves like Ken\'s Dragon Punch, Adon\'s Jaguar Tooth and M. Bison\'s Somersault Skull Driver will blow you away! Play alone or pummel a friend in two-player simultaneous action. This ain\'t no cakewalk. This is Street Fight Alpha 2 and it\'s blazing on your Super NES!', '/images/snes/6262/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/3f/Street_Fighter_Alpha_2_flyer.png', NULL, NULL),
(6263, 'Street Fighter II: The World Warrior', NULL, NULL, 'From across the globe comes eight of the wildest fighters the world has ever known. Choose your champion, gather your courage and prepare to battle your opponents in a bare knuckle brawl. Face Ken and his devastation "Dragon Punch"! Watch the temperature rise as Dhalsim incinerates you with his mystical Yoga Flame! Hear your spine crack as Zangief smashes you to the pavement with his spinning pile driver! Cover your ears as Guile breaks the sound barrier with the awesome power of the Sonic Boom!', '/images/snes/6263/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/3/32573_front.jpg', NULL, NULL),
(6264, 'Street Fighter II Turbo: Hyper Fighting', NULL, NULL, NULL, '/images/snes/6264/cover.PNG', 'https://upload.wikimedia.org/wikipedia/en/9/95/Street_Fighter_II_Dash_Turbo_%28flyer%29.PNG', NULL, NULL),
(6265, 'Street Hockey \'95', NULL, NULL, 'It\'s Inline Anarchy!', '/images/snes/6265/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/63/StreetHockey95BoxArtSNES.jpg', NULL, NULL),
(6266, 'Street Racer', NULL, NULL, 'It\'s fast, it\'s frantic, it\'s furious, it\'s the first racing and fighting game for four players... It\'s STREET RACER! Race and fight with 24 different tracks, 5 game modes with tons of options, and 8 street racers to choose from!', '/images/snes/6266/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/11/Street_Racer_Coverart.png', NULL, NULL),
(6267, 'Strike Gunner S.T.G.', 'Super Strike Gunner', NULL, NULL, NULL, NULL, NULL, NULL),
(6268, 'Stunt Race FX', 'Wild Trax', NULL, 'The updated Super FX chip allows you to shift into high gear! Get behind the wheel of a formula racer, a 4WD monster truck, a subcompact or a motorcycle. Each will provide a unique driving experience. Choose from over 20 pedal-to-the-metal Trax. There are the no-holds-barred Speed Trax where you hone your skills and progress from a novice to a master. Stunt Trax provides an obstacle course rally complete with ups, downs and jumps. Battle Trax means head-to-head conflict in surprising terrain. For speed, variety, action and fun, Stunt Race FX finishes far ahead of the competition!', '/images/snes/6268/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/64/StuntraceSNES_boxart.jpg', NULL, NULL),
(6269, 'Sugoi Hebereke', NULL, NULL, NULL, '/images/snes/6269/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/79/SugoiHebereke_frontcover.png', NULL, NULL),
