(6283, 'Super Baseball Simulator 1.000', 'Super Ultra Baseball', NULL, 'This is the ultimate baseball game! Precise pitching, Bulls-eye batting, and Awesome fielding! It\'s all under your control with simpler yet more sophisticated operation. With loads of features. You\'ll be an All Star! It is the ultimate baseball simulation you\'ve dreamed of.', '/images/snes/6283/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0d/Baseballsim1000SNES_boxart.jpg', NULL, NULL),
