(6293, 'Super Black Bass 3', NULL, NULL, 'Super Black Bass 3 is a Sports game, published by Starfish,  which was released in Japan in 1995.', '/images/snes/6293/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/6/307166_front.jpg', NULL, NULL),
(6294, 'Super Bomberman: Panic Bomber W', NULL, NULL, 'Super Bomberman: Panic Bomber W is a Puzzle game, developed by Raizing and published by Hudson,  which was released in Japan in 1995.', '/images/snes/6294/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/dc/BombermanPanicBomber_frontcover.png', NULL, NULL),
(6295, 'Super Bomberman 2', 'Sūpā Bonbāman Tsū', NULL, 'Aliens set on world domination have sent a team of evil cyborgs to confront the mighty Bomberman! Our hero fights valiantly to no avail as the cyborgs, known as the Five Bad Bombers, succeed in capturing him. With Bomberman trapped in an underground prison, the aliens are free to carry out their evil plans with little opposition. But wait! Bomberman escapes and a shimmer of hope shines for the universe! Bomberman must face hordes of enemies and countless traps scattered throughout the huge alien base. The future of the world is in his hands!', '/images/snes/6295/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/9/92/Bomberman2SNES_boxart.JPG', NULL, NULL),
(6296, 'Super Bomberman 3', 'Sūpā Bonbāman Surī', NULL, '"Louie", A Cute New Character Now Appearing On The SNES!', '/images/snes/6296/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/4/9/25449_front.jpg', NULL, NULL),
(6297, 'Super Bomberman 4', NULL, NULL, 'Super Bomberman 4 is a Puzzle game, developed by Produce and published by Hudson,  which was released in Japan in 1996.', '/images/snes/6297/cover.jpeg', 'https://upload.wikimedia.org/wikipedia/en/3/30/Super_bomberman_4.jpeg', NULL, NULL),
(6298, 'Super Bomberman 5', NULL, NULL, 'Super Bomberman 5 is a Puzzle game, developed and published by Hudson,  which was released in Japan in 1997.', '/images/snes/6298/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9f/SuperBomberman5.jpg', NULL, NULL),
(6299, 'Super Bombliss', NULL, NULL, 'Super Bombliss is a Puzzle game, developed by TOSE and published by Bullet Proof Software,  which was released in Japan in 1995.', '/images/snes/6299/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/7/307057_front.jpg', NULL, NULL),
(6300, 'Super Bonk', NULL, 'Chō Genjin', 'Dive headfirst into the action with your famously hard head in the first installment of the Bonk series on the Super NES. This time, Bonk has been caught in King Drool\'s trap and hurled into darkness. To find his way back to prehistoric times, he must embark on adventures through streets, caves, and eventually outer space! ', '/images/snes/6300/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/0/51240_front.jpg', NULL, NULL),
(6301, 'Super Buster Bros.', 'Super Pang', NULL, 'The world has come under attack and it is up to you as a Super Buster Brother to ensure that the world is cleared of all bouncing bubbles. Every time you shoot a bubble, it breaks into two smaller ones. But be careful! If a bubble touches you, you\'re history! Whether you play in the Panic Mode or the Tour Mode, the challenges will keep you on your toes! In the Panic Mode, bubbles large and small pour down for 99 levels of exhilaration. In the Tour Mode, you will travel the world in search of new and explosive bubble bottles. Enjoy the action, but be alert! As you progress through the levels, the game becomes more exciting as the bubbles bounce faster and faster.', '/images/snes/6301/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a2/Super_Buster_Bros._SNES.png', NULL, NULL),
(6302, 'Super Caesars Palace', NULL, NULL, 'Super Caesars Palace stretches your entertainment dollar to the hilt with more casino gaming action than ever before available for the Super NES! With over twelve games to choose from, you\'ll experience the pulse-quickening excitement of casino gaming in the world famous CAESARS PALACE without leaving home.', '/images/snes/6302/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/8/51258_front.jpg', NULL, NULL),
(6303, 'Super Casino 2', NULL, NULL, 'Super Casino 2 is a Miscellaneous game, developed by OeRSTED and published by Coconuts Japan,  which was released in Japan in 1994.', '/images/snes/6303/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/7/306997_front.jpg', NULL, NULL),
(6304, 'Super Castlevania IV', 'Akumajou Dracula', NULL, 'A century of Transylvanian tranquility is about to come to a shocking end. Once again the mortifying screams of helpless villagers shake the ground as they huddle against new nightmarish horrors unleashed by the Duke of Darkness, Count Dracula. And this time he has a tombstone with your name on it, Simon Belmont.', '/images/snes/6304/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/c2/Super_Castlevania_IV_North_American_SNES_box_art.png', NULL, NULL),
(6305, 'Super Chase H.Q.', 'Super H.Q. Criminal Chaser', NULL, 'The suspects are pulling away, so you rev up to 180 m.p.h. The city passes in a blur, then some fool pulls out in front of you! Tires scream and snarl, grabbing the road as you slam on the brakes and whistle past a telephone pole! You race back up to 200 m.p.h. and close on the criminals.', '/images/snes/6305/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0d/Chasehq_flyer.png', NULL, NULL),
(6306, 'Super Chinese Fighter', NULL, NULL, 'Super Chinese Fighter is an Action game, published by Culture Brain,  which was released in Japan in 1995.', '/images/snes/6306/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d4/Super_chinese_fighter_cover.jpg', NULL, NULL),
(6307, 'Super Chinese World 2: Uchuu Ichibuto Daikai', NULL, NULL, 'Super Chinese World 2 is a Role-Playing game, published by Culture Brain,  which was released in Japan in 1993.', '/images/snes/6307/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/9/312409_front.jpg', NULL, NULL),
(6308, 'Super Conflict', NULL, NULL, 'Super Conflict is war enough for anybody whether you\'re a video gamer, a board game fan, or a soldier.', '/images/snes/6308/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/11/SuperConflictSNESBoxArt.jpg', NULL, NULL),
(6309, 'Super Double Dragon', 'Return of Double Dragon', NULL, 'The two greatest martial arts heroes of all time are back -- in SUPER DOUBLE DRAGON, an all-new adventure with awesome new moves, impossible new missions, and a hair-raising new cast of enemies!', '/images/snes/6309/cover.gif', 'https://upload.wikimedia.org/wikipedia/en/8/8f/SNS-WD-USA.gif', NULL, NULL),
