(6313, 'Super Dropzone', 'Archer MacLean\'s Super Dropzone', NULL, 'Turn on, tune in, Drop Zone!', '/images/snes/6313/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/4/64034_front.jpg', NULL, NULL),
(6314, 'Super Earth Defense Force', NULL, NULL, 'The graphics will dazzle you, the speed will astound you... but if you don\'t think fast and shoot faster, you won\'t have a choice against the alien firestorm. Because in EARTH DEFENSE FORCE, the best defence is always a great offense. So get ready to hit first and hit fast in the hardest-hitting adventure to hit the Super NESa" screen!', '/images/snes/6314/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d1/Earth_Defense_Force_North_American_SNES_box_art.jpg', NULL, NULL),
