(6336, 'Super Ghouls \'n Ghosts', 'Chō Makaimura', NULL, 'You are Arthur, the boldest bladesman alive. You are caught in a dangerous quest! Fiendish foes and grim demons are about to hurl disaster your way!', '/images/snes/6336/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/3/35/GhoulsSNES_boxart.JPG', NULL, NULL),
(6337, 'Super Goal! 2', 'Takeda Nobuhiro no Super Cup Soccer', NULL, 'Welcome to the world\'s most popular sport with the kind of detail and realism that only Jaleco can deliver. In Super Goal! 2 you\'ll be able to control a whole soccer team - from selecting a stadium and formation, right down to making a spectacular bicycle kick with 10 seconds on the clock.', '/images/snes/6337/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/ea/SuperGoal2JPSNESBoxArt.jpg', NULL, NULL),
(6338, 'Super Godzilla', 'Chou-Godzilla', NULL, 'In Super Godzilla, you operate Godzilla with all his huge power and ferocity and enjoy powerful battles between monsters complete with resounding battle cries. The game has two modes: In movement mode, you move Godzilla through cities destroying cities and crushing mountains. In battle mode, you fight dynamic one-on-one battles with enemy monsters. This game introduces a new type of battle system. You make Godzilla attack while you watch the level of his fighting spirit and that of his enemy. When Godzilla unleashes one of his major techniques, such as fire breath, the screen switches to a powerful animation.', '/images/snes/6338/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/6/51286_front.jpg', NULL, NULL),
(6339, 'Super Gomoku Narabe Renju', NULL, NULL, 'Super Gomoku Narabe: Renju is a Miscellaneous game, developed and published by Naxat Soft,  which was released in Japan in 1994.', '/images/snes/6339/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/1/306921_front.jpg', NULL, NULL),
