(6345, 'Super High Impact', NULL, NULL, 'This isn\'t just football; it\'s SUPER HIGH IMPACT! It\'s all the fast-paced action of the bone-crunching arcade smash! Quick-Action play selections get you into the action before you can say "WICKED HIT!" Choose from 18 hard-charging teams and over 30 plays, from a red-dog blitz to a never-say-die superfly! "YER TOAST" if the HIT-O-METER rates your tackle "DWEEB", but you can settle the score the ol\' fashioned way with an all-out team brawl. When you\'re tired of watching football from the sidelines... get into the button-pounding arcade action of SUPER HIGH IMPACT!', '/images/snes/6345/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/9/1/51291_front.jpg', NULL, NULL),
(6346, 'Super Hockey \'94', NULL, NULL, 'Super Hockey \'94 is a Sports game, developed by Opera House and published by Yonezawa PR21,  which was released in Japan in 1994.', '/images/snes/6346/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/9/306919_front.jpg', NULL, NULL),
