(6350, 'Super Indy Champ', NULL, NULL, 'Super Indy Champ is a Racing game, developed by Open System and published by Forum,  which was released in Japan in 1994.', '/images/snes/6350/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/8/311998_front.jpg', NULL, NULL),
(6351, 'Super International Cricket', NULL, NULL, 'From the crack of the cricket bat to cheering crowds, this game has it all - even seagulls! Batting and bowling so realistic, you\'d swear you had been selected yourself.', '/images/snes/6351/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/19/SuperInternationalCricketEUBoxShotSNES.jpg', NULL, NULL),
(6352, 'Super James Pond', 'Super James Pond IIEU', NULL, 'Dr. Maybe\'s dangerously fishy plans for world domination continue. In a slimy effort to sabotage the worlds largest toy factory, he has planted penguin-bombs in toy factories inside the North Pole! James Pond bubbles to the rescue in another massive oceanic adventure!', '/images/snes/6352/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/8/51288_front.jpg', NULL, NULL),
