(6368, 'Super Mario RPG: Legend of the Seven Stars', NULL, NULL, 'Mario returns in this incredible new role-playing adventure! His latest rival is Smithy, a menacing creature who causes fear and treachery in the Mushroom Kingdom. Mario must recover seven stars and repair the Star Road before he can make his way to Bowser\'s castle for a final confrontation with Smithy. Powerful weapons, sinister spells and other useful items help Mario to complete his harrowing journey. New friends and old allies support him along the way. Even Bowser lends a hand!', '/images/snes/6368/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/0/9/51309_front.jpg', NULL, NULL),
(6369, 'Super Mario World 2: Yoshi\'s Island', 'Super Mario: Yoshi Island', NULL, 'Yoshi returns to save Baby Mario in this sequel to Super Mario World!', '/images/snes/6369/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9a/Yoshi%27s_Island_%28Super_Mario_World_2%29_box_art.jpg', NULL, NULL),
(6370, 'Super Metroid', NULL, NULL, 'Take on a legion of Space Pirates and a new Metroid force as you forge into the covert underworld of Planet Zebes! It\'s up to you and Samus to recapture the long-surviving Metroid hatchling before evil hands unleash its energy. An army of ominous creatures are poised for battle at every turn of Zebes\' twisted, threatening passageways...including the menacing Ridley and the great lizard Kraid. Knock down enemies with a killer somersault and swing on an electric beam through narrow passageways! They\'re no match for you and Samus...but wait! It seems the Mother Brain has returned...', '/images/snes/6370/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e4/Smetroidbox.jpg', NULL, NULL),
(6371, 'Super Momotarou Dentetsu II', NULL, NULL, 'Super Momotarou Dentetsu II is a Miscellaneous game, developed by Make and published by Hudson,  which was released in Japan in 1992.', '/images/snes/6371/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/5/306365_front.jpg', NULL, NULL),
(6372, 'Super Momotarou Dentetsu III', NULL, NULL, 'Super Momotarou Dentetsu III is a Miscellaneous game, developed by Make and published by Hudson,  which was released in Japan in 1994.', '/images/snes/6372/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/4/2/306642_front.jpg', NULL, NULL),
(6373, 'Super Morph', NULL, NULL, 'Inadvertently reduced to his component molecules, young schoolboy Morph is able to transform between liquid, gas, and solid. Can you use the various properties of each to solve a maze of puzzles and help him tame his unruly molecules.', '/images/snes/6373/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/2/56112_front.jpg', NULL, NULL),
(6374, 'Super Naxat Open: Golf de Shoubu da! Dorabocchan', NULL, NULL, 'Super Naxat Open is a Sports game, developed by Kuusou Kagaku and published by Naxat Soft,  which was released in Japan in 1994.', '/images/snes/6374/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/6/306916_front.jpg', NULL, NULL),
(6375, 'Super Nazo Puyo: Ruruu no Ruu', NULL, NULL, 'Super Nazo Puyo: Rulue no Roux is a Puzzle game, developed by Compile and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/6375/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/4/43404_front.jpg', NULL, NULL),
