(6378, 'Super Nichibutsu Mahjong 2: Zenkoku Seiha Hen', NULL, NULL, 'Super Nichibutsu Mahjong 2: Zenkoku Seiha Hen is a Miscellaneous game, developed and published by Nichibutsu,  which was released in Japan in 1993.', '/images/snes/6378/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/9/306869_front.jpg', NULL, NULL),
(6379, 'Super Nichibutsu Mahjong 3: Yoshimoto Gekijou Hen', NULL, NULL, 'Super Nichibutsu Mahjong 3: Yoshimoto Gekijou Hen is a Miscellaneous game, published by Nichibutsu,  which was released in Japan in 1994.', '/images/snes/6379/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/4/306954_front.jpg', NULL, NULL),
(6380, 'Super Ninja Boy', 'Super Chinese World', NULL, 'A peaceful life in quiet Chinaland was suddenly thrown into disaster after the Universal Peace Conference was over. The Emperor\'s concerns kept growing until Jack and Ryu decided to go out and settle the problem. The places they visited during their expidition were: Chinaland, Mysteryland, Fairyland and Futureland. The more they advanced, the more suspenseful it became. What they found out was a devastating plot.', '/images/snes/6380/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c0/Super_Ninja_Boy_box_art.jpg', NULL, NULL),
(6381, 'Super Ninja-kun', NULL, NULL, 'Super Ninja-Kun is an Action game, published by Jaleco Entertainment,  which was released in Japan in 1994.', '/images/snes/6381/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/1/43401_front.jpg', NULL, NULL),
(6382, 'Super Nova', 'Darius Force', NULL, 'Prepare for the flight of your life, in a no-holds barred battle for survival! Super Nova offers three fighter options, a power balance system and other exciting new features. Fight your way through the enemy defense zones to destroy the gigantic battle cruisers of the evil empire!', '/images/snes/6382/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/0/25610_front.jpg', NULL, NULL),
(6383, 'Super Off Road: The Baja', 'Super 4WD: The Baja', NULL, 'Now you can take on the toughest off-road racecourse in the world and challenge world champion Ivan Stewart thanks to SUPER OFF ROAD: The Baja. The Baja is the pinnacle of dirt racing, and there are eight different legs patterned after the real course that will throw all kinds of jumps and obstacles in your way as you race for the checkered flag. You can take part in the Mexico 250, the Ensenada 500, and the Baja 1000 as you try to prove your mastery of off-road racing. Throughout each race, you\'ll have to make pit stops to replenish your fuel supply and make minor repairs and tweaks that could mean the difference between glorious victory and bitter defeat. So prepare yourself for the battle for dirt-track supremacy with SUPER OFF ROAD: The Baja.', '/images/snes/6383/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/9/51339_front.jpg', NULL, NULL),
(6384, 'Super Okuman Chouja Game', NULL, NULL, 'Super Okuman Chouja Game is a Miscellaneous game, published by Takara,  which was released in Japan in 1995.', '/images/snes/6384/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/3/312003_front.jpg', NULL, NULL),
(6385, 'Super Ōzumō: Netsusen Daiichiban', NULL, NULL, 'Super Oozumou Netsusen Dai-Ichiban is a Sports game, published by Namco,  which was released in Japan in 1992.', '/images/snes/6385/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/23/Superoozumousfc.jpg', NULL, NULL),
