(6396, 'Super Punch-Out!!', NULL, NULL, 'The mega-selling sports series is a knockout on Super NES!', '/images/snes/6396/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/40/Superpunchoutbox.jpg', NULL, NULL),
(6397, 'Super Putty', 'Putty Moon', NULL, 'The game of immense playability, the character of immense pliability.', '/images/snes/6397/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/4/7/51347_front.jpg', NULL, NULL),
(6398, 'Super Puyo Puyo', NULL, NULL, 'The object of this head-to-head puzzle game is to clear your grid of falling patterns called puyos by forming chains of four or more same-colored puyos in a straight line or one of several geometric patterns. What makes this a challenging two-player contest is the fact that when you clear a chain of puyos from your grid, it drops a random piece of filler onto your opponent\'s grid. The more puyos you clear, the more you fill your opponent\'s grid, and if you can clutter up his grid enough to fill it to the top, you\'ve won the game.', '/images/snes/6398/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/8/43408_front.jpg', NULL, NULL),
(6399, 'Super Puyo Puyo Tsuu Remix', NULL, NULL, 'Super Puyo Puyo Tsuu Remix is a Puzzle game, developed and published by Compile,  which was released in Japan in 1996.', '/images/snes/6399/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/9/43409_front.jpg', NULL, NULL),
