(6405, 'Super Robot Taisen Gaiden: Masou Kishin: The Lord of Elemental', NULL, NULL, 'Super Robot Taisen Gaiden: Masou Kishin - The Lord of Elemental is a Strategy game, developed by WinkySoft and published by Banpresto,  which was released in Japan in 1996.', '/images/snes/6405/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/4/0/38040_front.jpg', NULL, NULL),
(6406, 'Super Scope 6', 'Nintendo Scope 6', NULL, 'Take aim and fire! A whole library of Super Scope games in one cartridge scores a bull\'s-eye!', '/images/snes/6406/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/7/37247_front.jpg', NULL, NULL),
(6407, 'Super Shougi 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6408, 'Super Shougi 3: Kitaihei', NULL, NULL, 'Super Shogi 3: Kitaihei is a Miscellaneous game, developed by Gaibrain and published by I\'Max,  which was released in Japan in 1995.', '/images/snes/6408/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/2/307182_front.jpg', NULL, NULL),
(6409, 'Super Slam Dunk', 'Magic Johnson no Super Slam Dunk', NULL, 'Check out Olympic Star Magic Johnson in Virgin Games\' SUPER SLAM DUNK for the Super NES. SUPER SLAM DUNK gives you all the lightning fast action of 5-on-5 ball with Magic himself giving pro tips for all 28 teams.', '/images/snes/6409/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/0/51360_front.jpg', NULL, NULL),
(6410, 'Super Slap Shot', NULL, NULL, 'After some serious stick slashing, you come away with the puck and speed down the rink. You square off against your opponent as he races toward you with a high stick. Check him hard and go for the steal. Fists fly and the crowd goes insane. After you\'ve cooled off in the penalty box, go head-to-head with the goalie. Slam home a 90 MPH slapshot and the victory is yours!', '/images/snes/6410/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/5/8/51358_front.jpg', NULL, NULL),
(6411, 'Super Soccer', 'Super Formation Soccer', NULL, 'Shoot, pass, dribble and score! Super Soccer offers the gut-wrenching intensity and fast action of international soccer competition.', '/images/snes/6411/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2d/SupersoccerSNES_boxart.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(6412, 'Super Solitaire', 'Trump Island', NULL, 'The classic card game of strategy and planning comes to your Super NES with 12 different Solitaire games in one Game Pak, including Klondike, Ypramid, Aces Up, Scorpion, Golf, even a poker variation. Conquer them all in the most challenging brain game you\'ll ever deal up.', '/images/snes/6412/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e0/SuperSolitaireBoxShotSNES.jpg', NULL, NULL),
(6413, 'Super Soukoban', NULL, NULL, 'Super Soukoban is a Puzzle game, developed by Thinking Rabbit and published by Pack-In-Video,  which was released in Japan in 1993.', '/images/snes/6413/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/6/306826_front.jpg', NULL, NULL),
(6414, 'Super Star Wars', NULL, NULL, 'Join Luke, Han and Chewbacca in their fierce war against the evil Empire. Battle treacherous aliens. Pilot two vehicles in high-speed, first-person, 3-D sequences. Fight your way through the wastelands of Tatooine to the hostile streets of Mos Eisley and beyond. So grab your blaster, strap on your lightsaber, and take on the fight for galactic freedom.', '/images/snes/6414/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/17/Super_Star_Wars_box_art.jpg', NULL, NULL),
(6415, 'Super Star Wars: Return of the Jedi', NULL, NULL, 'Join the Rebellion and crush the Death Star in a giant 16-meg universe filled with all the action and adventure of the Star Wars® finale. The command of five different characters-- from Wicket the Ewok to Princess Leia--and go up against the Empire\'s worst, from Jabba the Hutt to the Emperor himself! This is it! You\'re going to need every ounce of Force you\'re got in you.', '/images/snes/6415/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/59/Super_Return_of_the_Jedi_box_art.jpg', NULL, NULL),
(6416, 'Super Street Fighter II: The New Challengers', NULL, NULL, 'For two years, they have reigned supreme. Twelve of the most gifted fighters from across the world have battled each other in the World Warrior tournament. But the time has come for them to step aside - Now is the time of the New Challengers!', '/images/snes/6416/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/34/Ultra_street_fighter_II_art.jpg', NULL, NULL),
(6417, 'Super Strike Eagle', 'F-15 Super Strike Eagle', NULL, 'It it\'s realistic flight simulation you\'re looking for, Super Strike Eagle is sure to blow you away! And blow your enemies away, too!', '/images/snes/6417/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/0/51370_front.jpg', NULL, NULL),
(6418, 'Super Tekkyuu Fight!', NULL, NULL, 'Super Tekkyu Fight! is an Action game, developed by Metro and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/6418/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/3/2/307132_front.jpg', NULL, NULL),
(6419, 'Super Tetris 2 + Bombliss', NULL, NULL, 'Super Tetris 2 + Bombliss is a Miscellaneous game, developed by TOSE and published by Bullet Proof Software,  which was released in Japan in 1992.', '/images/snes/6419/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/9/42829_front.jpg', NULL, NULL),
(6420, 'Super Tetris 3', NULL, NULL, 'Super Tetris 3 is a Puzzle game, developed by TOSE and published by Bullet Proof Software,  which was released in Japan in 1994.', '/images/snes/6420/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/8/42828_front.jpg', NULL, NULL),
(6421, 'Super Troll Islands', NULL, NULL, 'The Troll Islands have been plunged into a murky darkness by the Evil Overlord. He has summoned the power of Fire, Water, Earth and Air to starve the Trolls of life-giving light.', '/images/snes/6421/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/23/SuperTrollIslandsBoxShotSNES.jpg', NULL, NULL),
(6422, 'Super Trump Collection', NULL, NULL, 'Super Trump Collection is a Miscellaneous game, published by Bottom Up,  which was released in Japan in 1995.', '/images/snes/6422/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/7/307077_front.jpg', NULL, NULL),
(6423, 'Super Trump Collection 2', NULL, NULL, 'Super Trump Collection 2 is a Miscellaneous game, published by Bottom Up,  which was released in Japan in 1996.', '/images/snes/6423/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/7/31947_front.jpg', NULL, NULL),
(6424, 'Super Tsume Shougi 1000', NULL, NULL, 'Super Tsume Shogi 1000 is a Miscellaneous game, published by Bottom Up,  which was released in Japan in 1994.', '/images/snes/6424/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/1/9/307019_front.jpg', NULL, NULL),
(6425, 'Super Turrican 2', NULL, NULL, 'If you haven\'t played Super Turrican, chances are you won\'t last past the intro sequences here... As an intergalactic hero-wannabe commissioned to crush a venomous mutant armada, you are thrust into a chaotic world even more violent than the original. This time there are more enemies to torch (and be torched by)including the most heinous level bosses on 16-bitand enough Mode 7 graphic levels to make you wish mommy were there to hold your hand.', '/images/snes/6425/cover.png', 'https://upload.wikimedia.org/wikipedia/en/d/da/Super_Turrican_2_%28USA%29.png', NULL, NULL),
(6426, 'Super Ultra Baseball 2', NULL, NULL, 'Super Ultra Baseball 2 is a Sports game, published by Culture Brain,  which was released in Japan in 1994.', '/images/snes/6426/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/7/306947_front.jpg', NULL, NULL),
(6427, 'Super V.G.', NULL, NULL, 'Super V.G. - Variable Geo is an Action game, developed and published by TGL,  which was released in Japan in 1995.', '/images/snes/6427/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/7/24007_front.jpg', NULL, NULL),
(6428, 'Super Valis IV', 'Red Moon Rising Maiden', NULL, 'The most intense threat to the Valis warrior has come to life. . .', '/images/snes/6428/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/4/51384_front.jpg', NULL, NULL),
