(6432, 'Super Widget', NULL, NULL, 'Widget explores the Horsehead Nebula and saves Earth! With his trusty sidekick, Mega-Brain, he takes on forms to conquer the air, land, and sea. Only Widget can defeat the forces invading our planet and become a First Class World Watcher Hero!', '/images/snes/6432/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/8/2/51382_front.jpg', NULL, NULL),
