(6443, 'Syndicate', NULL, NULL, 'Mission Briefing: Sources indicate that a rival syndicate has developed a dangerous new computer program and our research boys want it. In the year 2096, the world is divided into regions controlled by a handful of massive corporations, struggling for dominance. Prepare yourself for the ultimate corporate takeover!', '/images/snes/6443/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/ae/Syndicate_coverart.jpg', NULL, NULL),
