(6458, 'Tecmo Super Bowl II: Special Edition', NULL, NULL, 'First, there was Tecmo Super Bowl. Now, there\'s Tecmo Super Bowl II: Special Edition. Updated and upgraded with greatly enhanced graphics and play featuresthe ones you\'ve asked forto provide the best football play you\'ve ever experienced. Pick your favorite NFL team with its current roster of real players, then apply your knowledge of football and game-playing skills to take your team through the regular season and the playoffs, into the ultimate game... The Super Bowl. Tecmo Super Bowl II: Special Edition.', '/images/snes/6458/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/31/TecmoSuperbowlIIGenesisBoxShot.jpg', NULL, NULL),
(6459, 'Tekichuu Keiba Juku', NULL, NULL, 'Tekichuu Keiba Juku is a Sports game, published by Banpresto,  which was released in Japan in 1996.', '/images/snes/6459/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/3/307183_front.jpg', NULL, NULL),
(6460, 'Tenchi Muyou! Game Hen', NULL, NULL, 'Tenchi Muyou! Game-Hen is a Strategy game, developed by TamTam and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/6460/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/bc/Tmgh_cover.jpg', NULL, NULL),
