(6463, 'Tengai Makyou Zero: Shōnen Jump no Shou', NULL, NULL, 'Tengai Makyou Zero is a Role-Playing game, developed by RED Entertainment and published by Hudson,  which was released in Japan in 1995.', '/images/snes/6463/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/3/43363_front.jpg', NULL, NULL),
(6464, 'Tenshi no Uta: Shiroki Tsubasa no Inori', NULL, NULL, 'Tenshi no Uta is a Role-Playing game, published by Nippon Telenet,  which was released in Japan in 1994.', '/images/snes/6464/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/75/TenshinoUtaJPBoxShotSNES.jpg', NULL, NULL),
(6465, 'Terranigma', 'Tenchi Sōzō', NULL, 'A boy\'s curiosity triggers events that leads to the resurrection of life to this planet.', '/images/snes/6465/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/ff/Terranigma_PAL_release.jpg', NULL, NULL),
(6466, 'Tetris and Dr. Mario', NULL, NULL, 'The two greatest puzzle games are now together in one exciting game pak only on Super NES! TETRIS: The relentless building block video puzzle from Russia is back and enhanced for Super NES. Play solo, with a friend or challenge one of three computer opponents in this exciting and addicting game! DR. MARIO: Those nasty viruses have returned. Dr. Mario, vitamin pills in hand, is ready to eliminate them once more. In addition to the ever-popular 2-player game, now you can challenge the computer in the guise of the Blue, Yellow or Red Virus. MIXED MATCH: Combine Tetris and Dr. Mario and what do you get? One exciting contest for 2 players! Race against the clock to outscore your opponent while playing both Tetris and Dr. Mario!', '/images/snes/6466/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/4/37744_front.jpg', NULL, NULL),
(6467, 'Tetris Attack', 'Panel de Pon', NULL, 'The Tetris sensation has landed at Yoshi\'s Island. Kamek and Bowser await to test your dexterity with a demanding race of strategic moves in this exciting new contest. As the stack of perplexing panels rises from the bottom, think fast to counteract the merciless enemy attack dropping in from above. Rapid switches and quick response are the key to clearing the way to the next challenging level. An incredible selection of competitive modes and options provide escalating action and endless fun!', '/images/snes/6467/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9c/Tetris_Attack_box_art.png', NULL, NULL),
(6468, 'Tetris Battle Gaiden', NULL, NULL, 'Tetris Battle Gaiden is a Puzzle game, developed and published by Bullet Proof Software,  which was released in Japan in 1993.', '/images/snes/6468/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Tetris_Battle_Gaiden.jpg', NULL, NULL),
(6469, 'Theme Park', NULL, NULL, 'Think you can design and build the greatest amusement park in the world? You select the site, you lay out the rides and attractions. You control every aspect of running a profitable amusement park: from staffing to R&D. Any mistakes, and tourists who populate your park will be sure to let you know. Oh, and that merry-go-round in flames is a clue too.', '/images/snes/6469/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/de/Theme_Park_cover.jpg', NULL, NULL),
(6470, 'Thomas the Tank Engine and Friends', NULL, NULL, 'It\'s full steam ahead once again for Thomas, he\'s had a busy week at the Station and now it looks likely this week is going to be just as busy. The Fat Controller\'s head is spinning with all the special trips he has to organize. He\'s got to take the children to the seaside, medicine to the hospital, logs to the saw mill, coal to the power station, deliver the mail and take some oil to the oil refinery. It\'s a good thing that he has Thomas and his friends to rely upon. You control Thomas as he tries to complete all his tasks before the week is over. But be careful not to go too fast, you never know what\'s round the next corner!', '/images/snes/6470/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/1/32981_front.jpg', NULL, NULL),
(6471, 'Thoroughbred Breeder', NULL, NULL, 'Thoroughbred Breeder is a Sports game, developed and published by Hect,  which was released in Japan in 1993.', '/images/snes/6471/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/97/Thoroughbred_Breeder_ps.jpg', NULL, NULL),
(6472, 'Thoroughbred Breeder II', NULL, NULL, 'Thoroughbred Breeder II is a Sports game, developed and published by Hect,  which was released in Japan in 1994.', '/images/snes/6472/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/97/Thoroughbred_Breeder_ps.jpg', NULL, NULL),
(6473, 'Thoroughbred Breeder III', NULL, NULL, 'Thoroughbred Breeder III is a Sports game, developed and published by Hect,  which was released in Japan in 1996.', '/images/snes/6473/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/97/Thoroughbred_Breeder_ps.jpg', NULL, NULL),
(6474, 'Thunder Spirits', NULL, NULL, 'Fasten your seatbelts! It\'s gonna be an eye popping, pulse pounding, mind blowing ride! Your super-powered starship is under attack on land, air and sea in this Action/Arcade thriller. But you\'re prepared to go out with a bang. Zap! Blast your way through a fire storm. Splash! Use the wave weapon to pulverize an enemy. It\'s an 8-stage intergalactic fight to the finish. And even the multi-level scrolling and haunting sound effects are out of this world. Boss characters with the most chillingly realistic graphics try to show you who\'s the boss. But if you\'re quick enough and smart enough, you can prevail.', '/images/snes/6474/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/6/51406_front.jpg', NULL, NULL),
(6475, 'Thunderbirds: Kokusai Kyuujotai Juudou Seyo!', NULL, NULL, 'Gerry Anderson\'s Thunderbirds: Kokusai Kyuujotai Juudou Seyo!! is an Action game, developed by Nova Games Ltd. and published by Cobra Team,  which was released in Japan in 1993.', '/images/snes/6475/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/7/31727_front.jpg', NULL, NULL),
(6476, 'The Tick', NULL, NULL, 'It\'s Night In The City, And There\'s A New SuperHero In Town!', '/images/snes/6476/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/5/48265_front.jpg', NULL, NULL),
(6477, 'Time Slip', NULL, NULL, 'Once upon a time travel past came through the future.', '/images/snes/6477/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/f7/TimeSlipEUBoxShotSNES.jpg', NULL, NULL),
(6478, 'Time Trax', NULL, NULL, 'Past Present Future', '/images/snes/6478/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/0/0f/TimeTrax_cast.JPG', NULL, NULL),
(6479, 'Timecop', NULL, NULL, NULL, '/images/snes/6479/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/f/f6/Timecop2cover.JPG', NULL, NULL),
(6480, 'Timon and Pumbaa\'s Jungle Games', NULL, NULL, '4 Slimy Yet Satisfying Games', '/images/snes/6480/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/89/Timon_%26_Pumbaa%27s_Jungle_Games_Coverart.png', NULL, NULL),
(6481, 'Tin Star', NULL, NULL, 'There\'s a new sheriff in town!', '/images/snes/6481/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/43/Tin_Star_Coverart.png', NULL, NULL),
(6482, 'Tintin in Tibet', NULL, NULL, 'Re-live the adventures of Tintin on the search for his friend Chang. What happened to Chang after the crash of the DC3 on the way to Kotmondu? Set off with Tintin to Tibet where all along your exciting journey you\'ll find vital items to aid your progress and interrogate the locals for helpful advice. You\'ll face many a danger as you examine the aeroplane wreck, climb on steep rock walls and meet the legendary Yeti.', '/images/snes/6482/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/25/The_Adventures_of_Tintin_-_20_-_Tintin_in_Tibet.jpg', NULL, NULL),
(6483, 'Tiny Toon Adventures: Buster Busts Loose!', NULL, NULL, 'It\'s just like a real cartoon, except you\'re the main character!', '/images/snes/6483/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5d/Buster_Busts_Loose_box_art.jpg', NULL, NULL),
(6484, 'Tiny Toon Adventures: Wacky Sports Challenge', NULL, 'Tiny Toon Adventures: Dotabata Daiundoukai', 'You can play a boring old normal sports video... OR GO TOTALLY WACKY WITH YOUR FAVORITE SPORTS SUPERSTARS IN SIX ALL-STAR EVENTS!', '/images/snes/6484/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/6/5/46865_front.jpg', NULL, NULL),
(6485, 'TKO Super Championship Boxing', 'Kentou-Ou World Champion', NULL, 'TKO Super Championship Boxing is a Sports game, developed by Sting and published by Sofel,  which was released in Japan in 1992.', '/images/snes/6485/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9c/TKO_Super_Championship_Boxing_cover.jpg', NULL, NULL),
(6486, 'TNN Bass Tournament of Champions', 'Larry Nixon\'s Super Bass Fishing', NULL, 'Pick out your favorite spot, drop by the Pro Shop and gear up for TNN\'s Bass Tournament of Champions. It\'ll take more than luck to catch the big ones! Test your skills and patience as you sound out bass. Choose your lure and cast your line in an honest to goodness bass fishin\' experience right in your living room!', '/images/snes/6486/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/8/48278_front.jpg', NULL, NULL),
(6487, 'Todd McFarlane\'s Spawn: The Video Game', NULL, NULL, 'They\'re vanishing - pawns in an unholy war! And out of the darkest shadows of the fearful city rises...Spawn! Enemies like Violator, Redeemer, Overtkill, and Malebolgia himself, are everywhere - from Bedlam Asylum to the nightmarish Darklands! Can Spawn\'s special powers help him survive this madness? Experience awesome combat and intense graphics in the incredible style of the comic that started is all: Todd McFarlane\'s Spawn!', '/images/snes/6487/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d1/SpawnBoxShotSNES.jpg', NULL, NULL),
(6488, 'Tokimeki Memorial: Densetsu no Ki no Shita de', NULL, NULL, 'Tokimeki Memorial: Densetsu no Ki no Shita de is a Simulation game, developed by KCEO and published by Konami,  which was released in Japan in 1996.', '/images/snes/6488/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/8/8/36688_front.jpg', NULL, NULL),
(6489, 'Tokoro\'s Mahjong', NULL, NULL, 'Tokoro\'s Mahjong is a Miscellaneous game, developed by Syscom and published by Vic Tokai,  which was released in Japan in 1994.', '/images/snes/6489/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/6/306976_front.jpg', NULL, NULL),
(6490, 'Tommy Moe\'s Winter Extreme: Skiing and Snowboarding', NULL, 'Ski Paradise with Snowboard', 'Fly done slopes at speeds topping 90 miles per hour in this incredible Mode 7 ski simulation. Dodge moguls, dry patches, and skiers and snowboarders in the FREERIDE mode or engage in real competition. Try the lunatic DOWNHILL race where every turn could leave you with a face full of ice or the SLALOM and GIANT SLALOM modes, where you must overcome the ultimate challenge of dexterity, ripping through gates for your best time. Just don\'t end up a yard sale on this side of the slope!', '/images/snes/6490/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/2/0/51420_front.jpg', NULL, NULL),
(6491, 'Tony Meola\'s Sidekicks Soccer', NULL, 'Ramos\' World Wide Soccer', 'The excitement kicks off at the kickoff in this incredible game utilizing the revolutionary Mode 7 graphics. Choose from Tony Meola and 64 World and City soccer teams in the first icon focused soccer game that facilitates both play selection and playability. Rifle the ball to a teammate then drive your adrenaline-flooded feet up the field. Whoa! Watch the defenders. Center the ball for a header or a bicycle kick and, if your good, pound the ball past the goalie for an incredible pulse-pounding score! But now it\'s your time to worry as you frantically fight off furious forwards, slide-tackling them in a desperate attempt to reclaim possession of the ball. It\'s all here, the excitement, the energy, the roar of the crowd in "Tony Meola\'s Sidekicks Soccer."', '/images/snes/6491/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/48/Tony_meola_snes.jpg', NULL, NULL),
(6492, 'Top Gear', 'Top Racer', NULL, 'This is it. The race of your life. Head to head. Nose to nose. Flag to flag for the championship of the world. And only your best friend - or your worst enemy - stands in your way as you chase each other around 32 fiendishly tricky racetracks scattered from Paris to Rio. You each choose your car carefully for speed. handling and power. Grab the controls, and punch it down the blacktop. This is awesome splitscreen racing at its best, and it takes all your skill, courage and splitsecond timing to stay on the road, day after day, night after night, past roadblocks, barriers and pitstops. So gear up. Get your motor running. And go for the nitro. There\'s only room in the winner\'s circle for one!', '/images/snes/6492/cover.svg', 'https://upload.wikimedia.org/wikipedia/commons/f/f9/TopGearLogo.svg', NULL, NULL),
(6493, 'Top Gear 2', 'Top Racer 2', NULL, 'Play this game at top speed.', '/images/snes/6493/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/dd/Top_Gear_2_cover.jpg', NULL, NULL),
(6494, 'Top Gear 3000', 'The Planet\'s Champ TG3000', NULL, 'Race around 12 solar systems across 48 of tracks in the fastest, meanest and most action packed held to head split screen racing game even. Use a Multi-Tap game adaptor for simultaneous 1-4 player action.', '/images/snes/6494/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/2/8/51428_front.jpg', NULL, NULL),
(6495, 'Top Management II', NULL, NULL, 'Top Management II is a Strategy game, published by Koei,  which was released in Japan in 1994.', '/images/snes/6495/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6e/TopManagementIIJPBoxShotSNES.jpg', NULL, NULL),
(6496, 'Toride', NULL, NULL, 'Toride is a Puzzle game, developed by Metro and published by Takara,  which was released in Japan in 1994.', '/images/snes/6496/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/1/4/312014_front.jpg', NULL, NULL),
(6497, 'Torneko no Daibōken: Fushigi no Dungeon', NULL, NULL, 'Torneko no Daibouken: Fushigi no Dungeon is a Role-Playing game, developed and published by ChunSoft,  which was released in Japan in 1993.', '/images/snes/6497/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a3/Torneko_no_Daib%C5%8Dken_Fushigi_no_Dungeon_Cover.jpg', NULL, NULL),
(6498, 'Total Carnage', NULL, NULL, 'Captain Carnage is in charge of your force... all right he is your force. That\'s right - one man against an entire army! If you need better odds, this isn\'t your game!', '/images/snes/6498/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/7/46877_front.jpg', NULL, NULL),
(6499, 'Tottemo! Luckyman: Lucky Cookie Roulette Assault!!', NULL, NULL, 'Tottemo! Lucky Man: Lucky Cookie Roulette de Totsugeki is a Role-Playing game, developed by Tom Create and published by Bandai,  which was released in Japan in 1995.', '/images/snes/6499/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/0/312390_front.jpg', NULL, NULL),
(6500, 'Touge Densetsu: Saisoku Battle', NULL, NULL, 'Touge Densetsu: Saisoku Battle is a Racing game, developed by Lenar and published by Bullet Proof Software,  which was released in Japan in 1996.', '/images/snes/6500/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/0/1/307201_front.jpg', NULL, NULL),
(6501, 'Tower Dream', NULL, NULL, 'Tower Dream is a Miscellaneous game, developed by C-Lab and published by ASCII Entertainment,  which was released in Japan in 1996.', '/images/snes/6501/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/5/307245_front.jpg', NULL, NULL),
(6502, 'Toy Story', 'Disney\'s Toy Story', NULL, '3D graphics blast you TO INFINITY AND BEYOND! Ride a rampaging Rex through a sea of hostile toys. Defeat squeeze-toy aliens and avoid the evil CLAW! Ward off mutant toys with karate-chop Buzz! But whatever you do, don\'t become dog food. Humongous characters and sharper-than-life 3D - all on an outrageous 32 Megs!', '/images/snes/6502/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/13/Toy_Story.jpg', NULL, NULL),
(6503, 'Toys', NULL, NULL, 'Toy-Nominate The Enemy! Something is very wrong at the Zevo Toy Factory.', '/images/snes/6503/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/4/48314_front.jpg', NULL, NULL),
(6504, 'Traverse: Starlight and Prairie', NULL, NULL, 'Traverse: Starlight & Prairie is a Role-Playing game, developed by Pandora Box and published by Banpresto,  which was released in Japan in 1996.', '/images/snes/6504/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/9/9/304599_front.jpg', NULL, NULL),
(6505, 'Treasure Hunter G', NULL, NULL, 'Treasure Hunter G is a Strategy game, developed by Sting and published by SquareSoft,  which was released in Japan in 1996.', '/images/snes/6505/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cb/TreasureHunterG_boxart.jpg', NULL, NULL),
(6506, 'Trinea', NULL, NULL, 'Trinea is a Role-Playing game, developed by Japan Art Media (JAM) and published by Yanoman,  which was released in Japan in 1993.', '/images/snes/6506/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/2/9/31729_front.jpg', NULL, NULL),
(6507, 'Troddlers', NULL, NULL, 'They\'re Tricky! They\'re Trouble! They\'re Troddlers', '/images/snes/6507/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/40/Troddlers_Coverart.png', NULL, NULL),
(6508, 'Troy Aikman NFL Football', NULL, NULL, 'How would you like to have the best arm in football? You can... all 28 NFL teams. Over 100 real offensive plays and over 50 defensive plays. Battery back-up to save your stats. Design your own plays, team and your own season! Go head-to-head or be the coach. Super smooth animation and life-like stadium sound. Real weather conditions that affect your game play. Troy\'s a back-to-back Super Bowl champion quarterback. Can you be one?', '/images/snes/6508/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/52/Troy_Aikman_NFL_Football_Coverart.png', NULL, NULL),
(6509, 'True Golf: Wicked 18', 'Devil\'s Course', NULL, 'Can You Take The Ultimate Test?', '/images/snes/6509/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/60/True_Golf_-_Wicked_18_Coverart.png', NULL, NULL),
(6510, 'True Golf Classics: Pebble Beach Golf Links', 'Pebble Beach no Hatou', NULL, 'This is True Golf Classics, where you\'ll test your courage against Pebble Beach Golf Link - the most breathtaking course in the world.', '/images/snes/6510/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/5/51005_front.jpg', NULL, NULL),
(6511, 'True Golf Classics: Waialae Country Club', 'New 3D Golf Simulation: Waialae no Kiseki', NULL, 'Master the Winds of Waialae!', '/images/snes/6511/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/67/True_Golf_Classics_-_Waialae_Country_Club_Coverart.png', NULL, NULL),
(6512, 'True Lies', NULL, NULL, '"It\'s not like he\'s saving the world or anything." Oh, yes it is! As special agent Harry  Tasker, it\'s up to you to prevent a nuclear holocaust and stop the Crimson Jihad! Experience all the explosive intensity of TRUE LIES™--including never-before-seen secret missions! All the action of the movie megahit--and none of the romance!', '/images/snes/6512/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/92/True_Lies_Coverart.png', NULL, NULL),
(6513, 'Tsukikomori', NULL, NULL, 'Tsukikomori is an Adventure game, developed by Pandora Box and published by Banpresto,  which was released in Japan in 1996.', '/images/snes/6513/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/7/307197_front.jpg', NULL, NULL),
(6514, 'Tsuppari Ōzumō: Risshin Shusse Hen', NULL, NULL, 'Tsuppari Oozumou: Risshin Shusse-hen is a Sports game, developed and published by Tecmo,  which was released in Japan in 1993.', '/images/snes/6514/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/0/312360_front.jpg', NULL, NULL),
(6515, 'Tsuri Tarou', NULL, NULL, 'Tsuri Tarou is a Sports game, published by Pack-In-Video,  which was released in Japan in 1994.', '/images/snes/6515/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/8/9/311589_front.jpg', NULL, NULL),
(6516, 'Tsuyoshi Shikkari Shinasai: Taisen Puzzle-dama', NULL, NULL, 'Tsuyoshi Shikkari Shinasai Taisen Puzzle-dama is a Puzzle game, published by Konami,  which was released in Japan in 1994.', '/images/snes/6516/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3d/Tsuyoshishikkarisfc.jpg', NULL, NULL),
(6517, 'Tuff E Nuff', 'Dead Dance', NULL, 'The four great champions have arrived at the Colosseum, one of the few buildings left standing after the Great War of 2151 ... when warlords took up arms against each other in a violent power struggle. Whole cities were reduced to rubble. After the dust settled, one warlord rose up to control the people with his evil powers. He was called Jade, the Fighting King.', '/images/snes/6517/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/84/Tuff_E_Nuff_cover.jpg', NULL, NULL),
(6518, 'Turf Hero', NULL, NULL, 'Turf Hero is a Sports game, published by Tecmo,  which was released in Japan in 1995.', '/images/snes/6518/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/3/307063_front.jpg', NULL, NULL),
(6519, 'Turf Memories', NULL, NULL, 'Turf Memories is a Sports game, published by Bec,  which was released in Japan in 1995.', '/images/snes/6519/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/0/307050_front.jpg', NULL, NULL),
(6520, 'Turn and Burn: No-Fly Zone', 'Super Dogfight', NULL, 'Take off from your carrier and get ready for 16 MEG supersonic action with TURN AND BURN: NO-FLY ZONE! Strapped into the cockpit of the Navy\'s sleek and lethal F-14 Tomcat jet fighter, you\'ll fly blue water operations against a fully-rotational Mode 7 horizon and search the heavens for your prey with an impressive array of avionic technology!', '/images/snes/6520/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/Turn_and_Burn_No-Fly_Zone_Cover.jpg', NULL, NULL),
(6521, 'The Twisted Tales of Spike McFang', 'Chō Makai Taisen!: Dorabocchan', NULL, 'Can Spike McFang, junior magician and vampire in training, rescure his island kingdom from the evil hands of Von Hesler? Help Spike use his magical powers to conquer the sinister leaders of 9 island areas and restore his father, Dracuman, to power.', '/images/snes/6521/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/4/0/51440_front.jpg', NULL, NULL),
(6522, 'U.N. Squadron', 'Area 88', NULL, 'Soar to glory in a high-tech aircraft! The Evil Project 4 has torn freedom from the people of Aslan. Mercenaries control the entire country, except for a tiny airfield. But this field is headquarters for the best fighter pilots in the world -- UN Squadron!', '/images/snes/6522/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9e/UN_Squadron_game_flyer.png', NULL, NULL),
(6523, 'Uchū no Kishi: Tekkaman Blade', NULL, NULL, 'Tekkaman Blade is an Action game, developed by AI and published by Bec,  which was released in Japan in 1993.', '/images/snes/6523/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/2/26742_front.jpg', NULL, NULL),
(6524, 'Uchuu Race: Astro Go! Go!', NULL, NULL, 'Uchuu Race: Astro Go! Go! is a Racing game, developed by Kaze and published by Meldac,  which was released in Japan in 1994.', '/images/snes/6524/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6f/Uchuu_Race.jpg', NULL, NULL),
(6525, 'UFO Kamen Yakisoban: Kettler no Kuroi Inbō', NULL, NULL, 'UFO Kamen Yakisoban: Kettler no Kuroi Inbo is an Action game, developed by Kid and published by Den\'Z,  which was released in Japan in 1994.', '/images/snes/6525/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/1/306981_front.jpg', NULL, NULL),
(6526, 'Ugoku E Ver. 2.0: Aryol', NULL, NULL, 'Ugoku E Ver. 2.0: Aryol is a Puzzle game, published by Altron,  which was released in Japan in 1994.', '/images/snes/6526/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/1/312571_front.jpg', NULL, NULL),
(6527, 'Ultima: Kyouryuu Teikoku', NULL, NULL, 'You, the Avatar, have been transported by your Moonstone to the primitive and savage world of Eodon. There, you must work towards uniting the native tribes to face a common threat: a race of gigantic ants known as the Myrmidex. You wont be alone, however, as you will be assisted by Professor Rafkin, ace reporter Jimmy Malone, and the exotic jungle princess Aiela. Take control of strange and powerful shamanistic magics and confront a varied bestiary that includes vicious dinosaurs and even mad high priests.', '/images/snes/6527/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/4/31884_front.jpg', NULL, NULL),
(6528, 'Ultima: Runes of Virtue II', 'Ultima Gaiden: Kuro Kishi no Inbou', NULL, 'Enter the world of Ultima! Rescure the kidnapped mayors of Britannia as either Shamino the Ranger, Mage Mariah, the Bard lolo or Dupré the Knight. Board and conquer pirate ships, visit dungeons, islands and castles, and solve puzzles in this lively adventure!', '/images/snes/6528/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/5/46915_front.jpg', NULL, NULL),
(6529, 'Ultima VI: The False Prophet', NULL, NULL, 'In this, the first Super NES game in the Ultima series, the Underworld has been destroyed during the rescue of Lord British, and fierce gargoyles have been released! Search for hidden runes while defending shrines from gargoyle attacks. Discover their secret with the magic of the moonstones. Become the key to the salvation of Britannia! If you\'ve ever played an Ultima game, you\'ll want to continue with the ultimate test of skill, Ultima: The False Prophet. And if you\'ve never played an Ultima game, it\'s time to take the challenge!', '/images/snes/6529/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/4a/Ultima_6_cover.png', NULL, NULL),
(6530, 'Ultima VII: The Black Gate', NULL, NULL, 'In A Land Where Illusions Rule, Only The Avatar Sees The Truth', '/images/snes/6530/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b3/Ultima_VII_Black_Gate_box.jpg', NULL, NULL),
(6531, 'Ultimate Fighter', 'Hiryuu no Ken S: Golden Fighter', NULL, 'Get ready for furious fighting action with ULTIMATE FIGHTER! The evil enemy made a raid on Rick\'s master\'s training school, took symbols and swords away, and left a letter of challenge behind. Rick, having vowed to be a true fighter, took up this challenge to win back the lost items.', '/images/snes/6531/cover.svg', 'https://upload.wikimedia.org/wikipedia/commons/1/11/The_Ultimate_Fighter_logo.svg', NULL, NULL),
(6532, 'Ultimate Mortal Kombat 3', NULL, NULL, 'Enter the world of ULTIMATE Mortal Kombat 3 and discover what awaits you...', '/images/snes/6532/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f9/Ultimate_MK3.png', NULL, NULL),
(6533, 'Ultra Baseball Jitsumeiban', NULL, NULL, 'Ultra Baseball Jitsumeiban is a Sports game, developed by Culture Brain and published by Micro Academy,  which was released in Japan in 1992.', '/images/snes/6533/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/9/306799_front.jpg', NULL, NULL),
(6534, 'Ultra Baseball Jitsumeiban 2', NULL, NULL, 'Ultra Baseball Jitsumeiban 2 is a Sports game, developed and published by Culture Brain,  which was released in Japan in 1994.', '/images/snes/6534/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/6/307026_front.jpg', NULL, NULL),
(6535, 'Ultra Baseball Jitsumeiban 3', NULL, NULL, 'Ultra Baseball Jitsumeiban 3 is a Sports game, developed and published by Culture Brain,  which was released in Japan in 1995.', '/images/snes/6535/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/4/7/307147_front.jpg', NULL, NULL),
(6536, 'Ultra League: Moero! Soccer Daikessen!!', NULL, NULL, 'Ultra League: Moero! Soccer Daikessen!! is a Sports game, developed by Tom Create and published by Yutaka,  which was released in Japan in 1995.', '/images/snes/6536/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/5/307115_front.jpg', NULL, NULL),
(6537, 'Ultra Seven', NULL, NULL, 'Ultra Seven is an Action game, developed by Bec and published by Bandai,  which was released in Japan in 1993.', '/images/snes/6537/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/0/2/31702_front.jpg', NULL, NULL),
(6538, 'Ultraman: Towards the Future', 'Ultraman', NULL, 'Gigantic and treacherous aliens are invading Earth. They\'re destroying our cities and leaving a path of chaos around the planet. There is one humongous hero powerful enough to eradicate these creatures... Ultraman!!! Part human, part super being, he\'s got what it takes to eliminate the evil aliens once and for all. Ultraman uses his special weapons along with martial arts, wresting, and street brawling skills to fight off each attacking monster.', '/images/snes/6538/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4a/Ultraman_SNES_cover.jpg', NULL, NULL),
(6539, 'Umi no Nushi Tsuri', NULL, NULL, 'Umi no Nushi Tsuri is a Sports game, published by Pack-In-Video,  which was released in Japan in 1996.', '/images/snes/6539/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/2/9/307229_front.jpg', NULL, NULL),
(6540, 'Umi Tsuri Meijin: Suzuki Hen', NULL, NULL, 'Umi Tsuri Mejin: Suzuki Hen is a Sports game, developed by A-Wave and published by Electronic Arts Victor,  which was released in Japan in 1994.', '/images/snes/6540/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/2/2/307022_front.jpg', NULL, NULL),
(6542, 'Umihara Kawase', NULL, NULL, 'Umihara Kawase is an Action game, developed by Atelier Double and published by TNN,  which was released in Japan in 1994.', '/images/snes/6542/cover.png', 'https://upload.wikimedia.org/wikipedia/en/e/e3/Umihara_Kawase_logo.png', NULL, NULL),
(6543, 'Uncharted Waters: New Horizons', 'Super Daikoukai Jidai', NULL, 'Imagine a time when mighty navies controlled the seven seas, ruthless pirates searched for hidden treasures and scholars argued that the Earth was round. Now, picture yourself as a young explorer on a mission that will carry you to the four corners of the globe.', '/images/snes/6543/cover.png', 'https://upload.wikimedia.org/wikipedia/commons/4/4f/New_Horizons_Transparent.png', NULL, NULL),
(6544, 'Uniracers', 'Unirally', NULL, 'Single-wheeled and single-minded. Uniracers are the best at what they do: accelerate to screen-blurring speed! They\'re also awesome at pulling flips, twists, turns and catching monster air off the many mondo ramps, hills and half pipes of their race track worlds. The more outrageous the stunt, the faster the Uniracer goes! The sky\'s the limit!', '/images/snes/6544/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0f/Uniracers_boxart.png', NULL, NULL),
(6545, 'Urban Strike', NULL, NULL, 'Save the cities of the U.S.A. from Armageddon in ten spectacular multiple-stage missions! Leave your copter and fight on foot. New choppers and ground assault vehicles. New timed sequences, power-ups and interactive control panels.', '/images/snes/6545/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/03/Urban_Strike_cover.jpg', NULL, NULL),
(6546, 'Utopia: The Creation of a Nation', NULL, NULL, 'You\'ve Got A Whole World In Your Hands.', '/images/snes/6546/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/4/51464_front.jpg', NULL, NULL),
(6547, 'Vegas Stakes', 'Las Vegas Dream', NULL, 'Risk it all in live casino action! Check into your favorite hotel, meet up with friends in the lobby, and you\'re ready to go!', '/images/snes/6547/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/57/VegasstakesSNES_boxart.jpg', NULL, NULL),
(6548, 'Venom/Spider-Man: Separation Anxiety', NULL, NULL, 'Parting is such sweet sorrow! Venom has been violently split from his living costume, spawning five deadly alien Symbiotes. In fierce two-player action, Venom joins forces with his arch-enemy, Spider-Man, to face the new strain of evil brought to life by chilling, computer-rendered graphics. Between the merciless Jury and awesome allies like Ghost Rider and Daredevil, Venom\'s out to part his Symbiote offspring from their newfound life!', '/images/snes/6548/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/1e/Spider-Man_and_Venom_-_Separation_Anxiety_Coverart.png', NULL, NULL),
(6549, 'Verne World', NULL, NULL, 'Verne World is a Role-Playing game, developed by Dual and published by Banpresto,  which was released in Japan in 1995.', '/images/snes/6549/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/1/30171_front.jpg', NULL, NULL),
(6550, 'Virtual Bart', NULL, NULL, 'Bart is in a heap of technical trouble - he\'s stuck in a virtual reality machine!!! Enter the Jurassic era as Dino Bart, and stomp through stone age mayhem. Battle Nelson and the gang in a post apocalyptic Springfield as Doomsday Bart. Deploy your diaper-chute as Baby Bart and hog the spotlight as Pork Factory Pig Bart. Even go for a butt squeaking thrill-ride down the dangerous Mt. Splashmore and more!', '/images/snes/6550/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/c4/Virtual_Bart.jpg', NULL, NULL),
(6551, 'Virtual Soccer', 'J.League Super Soccer', NULL, 'Footie At It\'s Finest!', '/images/snes/6551/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a9/J-LeagueSuperSoccerJPBoxShotSNES.jpg', NULL, NULL),
(6552, 'Vortex', NULL, NULL, 'VORTEX! Morph into a powerful Walker, a sleek Sonic Jet, a speedy Landburner or a defensive Hard Shell. Attack with lasers, rockets, cannons, heat-seeking missiles, and smart bombs. Explore the snowpacked wasteland of Cryston, Voltair, the mysterious world of trapped asteroids; the scorching desert world of Thermis, and the volcanic world of Magmento. Enter vast mechanical caverns, dodge slamming doors, leap over claw traps, closing arches and missile turrets. Fight mechanical crabs, centipedes, kamikaze alien pilots and enormous bosses intent on reducing you to rubble!', '/images/snes/6552/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/6/8/51468_front.jpg', NULL, NULL),
(6553, 'VS. Collection', NULL, NULL, 'Vs. Collection is a Miscellaneous game, developed and published by Bottom Up,  which was released in Japan in 1996.', '/images/snes/6553/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/9/307249_front.jpg', NULL, NULL),
(6554, 'Wagyan Paradise', NULL, NULL, 'Wagyan Paradise is an Action game, developed and published by Namco,  which was released in Japan in 1994.', '/images/snes/6554/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/1/6/307016_front.jpg', NULL, NULL),
(6555, 'Waka Taka Ōzumō: Brothers Dream Match', NULL, NULL, NULL, '/images/snes/6555/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fe/Wakatatasfc.jpg', NULL, NULL),
(6556, 'Waku Waku Ski Wonder Spur', NULL, NULL, 'WakuWaku Ski Wonder Spur is a Sports game, developed and published by Human Entertainment,  which was released in Japan in 1995.', '/images/snes/6556/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/54/Wakuwakusfc.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(6557, 'Wally wo Sagase!', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6558, 'War 2410', NULL, NULL, 'You Are the Last Line of Defense!', '/images/snes/6558/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/8/88/War2410SNES_boxart.JPG', NULL, NULL),
(6559, 'War 3010: The Revolution', NULL, NULL, 'The Revolution Has Begun!', '/images/snes/6559/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/3/51473_front.jpg', NULL, NULL),
(6560, 'Waratte Iitomo! Tamorin Pick', NULL, NULL, 'Waratte Iitomo! Tamorinpic is a Miscellaneous game, published by Athena,  which was released in Japan in 1994.', '/images/snes/6560/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/7/306927_front.jpg', NULL, NULL),
(6561, 'Warlock', NULL, NULL, 'The once in a millennium confrontation is upon you! Using the powerful spells and potions entrusted to you by your Druid ancestors, battle gargoyles, the Undead, fire-breathing dragons... and if you survive, the all-powerful Warlock! Combining strategy, intuition, and sorcery, you must be the first to locate six ancient runestones - and save all creation from unraveling!', '/images/snes/6561/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/7/0/48370_front.jpg', NULL, NULL),
(6562, 'WarpSpeed', NULL, NULL, 'In Your Face Combat Against A Swarming Alien Armada!', '/images/snes/6562/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/6/48366_front.jpg', NULL, NULL),
(6563, 'Waterworld', NULL, NULL, 'The oceans have risen and humanity is set adrift.', '/images/snes/6563/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5f/Waterworld.jpg', NULL, NULL),
(6564, 'Wayne Gretzky and the NHLPA All-Stars', NULL, NULL, 'Wayne Gretzky and the NHLPA All-Stars let you take on the world\'s best hockey players with incredible speed, remarkable finesse and lightning quick execution that burns the defense...and the net! Pick from 26 teams with over 600 real NHLPA players and their statistics.', '/images/snes/6564/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/25/Wayne_Gretzky_and_the_NHLPA_All-Stars_Coverart.png', NULL, NULL),
(6565, 'WCW SuperBrawl Wrestling', NULL, NULL, 'STOMP A FRIEND TODAY!', '/images/snes/6565/cover.png', 'https://upload.wikimedia.org/wikipedia/en/5/5c/WCW_SuperBrawl_Wrestling_Coverart.png', NULL, NULL),
(6566, 'Weaponlord', NULL, NULL, 'Enter a harsh medieval world and battle for your life against seven savage barbarians - all armed, all dangerous, all fighting to be the WeaponLord. But to win the DemonLord\'s tournament and fulfil the prophecy of the Warrior\'s Moon, you must defeat the biggest, baddest, most skilled killers ever seen in a Super NES fighting game.', '/images/snes/6566/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/3/30/WeaponlordSNES_boxart.JPG', NULL, NULL),
(6567, 'Wedding Peach', NULL, NULL, 'Wedding Peach is a Simulation game, developed by Shimada Kikaku and published by KSS,  which was released in Japan in 1995.', '/images/snes/6567/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b7/Wedding_Peach_manga_vol_1.png', NULL, NULL),
(6568, 'We\'re Back! A Dinosaur\'s Story', NULL, NULL, 'Awesome Action And Adventure Of Prehistoric Proportions!', '/images/snes/6568/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/6/51476_front.jpg', NULL, NULL),
(6569, 'Whirlo', 'Xandra no Daibōken: Valkyrie to no Deai', NULL, 'Whirlo is an Action game, developed by Nova Games Ltd. and published by Namco,  which was released in Japan in 1992.', '/images/snes/6569/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/7/8/30078_front.jpg', NULL, NULL),
(6570, 'Whizz', NULL, NULL, 'ONE, TWO, THREE D!', '/images/snes/6570/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8b/Whizz_Cover.jpg', NULL, NULL),
(6571, 'WildSnake', 'Super Snakey', NULL, 'A deadly nest of snakes. And only you can keep them from getting out! Maneuver each new snake so it touches another of the same kind, making the venomous viper disappear. Sound easy? As long as you con keep matching up snakes, you\'re in control. But when those poisonous reptiles pile close to the top, you better run for your life!', '/images/snes/6571/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/6f/WildSnake_SNES.jpg', NULL, NULL),
(6572, 'Williams Arcade\'s Greatest Hits', NULL, NULL, 'Play Defender once again, and navigate your vessel through alien territory! Defender II includes added villains and features not found in the original Defender! Challenge gladiators in a fight to the death in Joust! Once again, Robotron: 2084 lets you clash with a mutant force of robots to save the only remaining human family! With the coolest graphics of its time, SiniStar returns with great outerspace battle action!', '/images/snes/6572/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/6/50516_front.jpg', NULL, NULL),
(6573, 'Wing Commander', NULL, NULL, 'You\'re a starfighter pilot, the best of the best, but nothing in your training prepared you for action this hot. Deepspace dogfights against Kilrathi aces are deadly, and the future of humanity is on the line each time you fly!', '/images/snes/6573/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/cf/WC1_Logo_Ingame.png', NULL, NULL),
(6574, 'Wing Commander: The Secret Missions', NULL, NULL, 'Wind Commander: The Secret Missions™ is another thrilling chapter in the continuing saga of the TCS Tiger\'s Claw. A human colony has been obliterated by the Kilrathi. Now they challenge the defenders of humanity to a deadly game of hide and seek. You must cross into enemy space in pursuit of the Kilrathi strike fleet, only to face their secret weapon...a weapon capable of destroying an entire world.', '/images/snes/6574/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/2/2e/Civilwarsecretmissions.jpg', NULL, NULL),
(6575, 'Wings 2: Aces High', NULL, 'Sky Mission', '5,000 meters over France. Spying a pair of prowling enemy planes, you slam the stick forward and enter a screaming dive. Finger on the trigger, your plane shudders from the recoil of tracer splitting machine guns. Enemy number two rolls high over his smoking wingman into the sun.', '/images/snes/6575/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/6/51496_front.jpg', NULL, NULL),
(6576, 'Winning Post', NULL, NULL, 'Winning Post is a Sports game, published by Koei,  which was released in Japan in 1993.', '/images/snes/6576/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/5/3/296853_front.jpg', NULL, NULL),
(6577, 'Winning Post 2', NULL, NULL, 'Winning Post 2 is a Sports game, published by Koei,  which was released in Japan in 1995.', '/images/snes/6577/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/1/307061_front.jpg', NULL, NULL),
(6578, 'Winning Post 2: Program \'96', NULL, NULL, 'Winning Post 2: Program \'96 is a Sports game, published by Koei,  which was released in Japan in 1996.', '/images/snes/6578/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/0/31960_front.jpg', NULL, NULL),
(6579, 'Winter Gold', NULL, NULL, 'Jump, twist, tuck, flip, turn, kick and ski your way to victory in six world-class, winter sporting events! Go for record-breaking times in the Downhill, Luge and Bobsled events. Soar to ridiculous distances of the Ski Jump and amaze the judges with extreme combos in the Aerial and Snowboarding competitions!', '/images/snes/6579/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/7/312757_front.jpg', NULL, NULL),
(6580, 'Wizap!: Ankoku no Ou', NULL, NULL, 'Wizap!: Ankoku no Ou is a Role-Playing game, developed by SAS Sakata and published by ASCII Entertainment,  which was released in Japan in 1994.', '/images/snes/6580/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/7/5/306975_front.jpg', NULL, NULL),
(6581, 'The Wizard of Oz', NULL, NULL, 'Follow The Yellow Brick Road to Fun, Adventure & Magic', '/images/snes/6581/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/9/51499_front.jpg', NULL, NULL),
(6582, 'Wizardry Gaiden IV: Throb of the Demon\'s Heart', NULL, NULL, 'Wizardry Gaiden IV: Throb of the Demon\'s Heart is a Role-Playing game, developed by Access and published by ASCII Entertainment,  which was released in Japan in 1996.', '/images/snes/6582/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/7/31957_front.jpg', NULL, NULL),
(6583, 'Wizardry I-II-III: Story of Llylgamyn', NULL, NULL, 'Wizardry I-II-III: Story of Llylgamyn is a Miscellaneous game, developed by Game Studio and published by Media Factory,  which was released in Japan in 1999.', '/images/snes/6583/cover.png', 'https://gamefaqs.akamaized.net/images/platform-100/snes.png', NULL, NULL),
(6584, 'Wizardry V: Heart of the Maelstrom', NULL, NULL, 'Despite the greatest magic of the ancient High Sages, great floods, earthquakes and famine again pervade the land of Llylgamyn. The great Orb of Llylgamyn, an artifact of remarkable power that has protected the city for ages, is now powerless to halt the scourge.', '/images/snes/6584/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cc/Wizardry_5_cover.jpg', NULL, NULL),
(6585, 'Wizardry VI: Bane of the Cosmic Forge', NULL, NULL, 'Ten years ago, WIZARDRY set the standards in Fantasy Role-Playing (FRP). Now, after two million copies have been sold and dozens of awards have been won, Bane of the Cosmic Forge raises and redefines those standards. This new WIZARDRY, the truest simulation ever of Fantasy Role Playing, will push your computer, your mind and your sense of adventure to their very limits. Only through the power of the latest computer technology could the full dimensions of this new genre in FRP be possible.', '/images/snes/6585/cover.png', 'https://upload.wikimedia.org/wikipedia/en/b/b7/Wizardry_VI_-_Bane_of_the_Cosmic_Forge_Coverart.png', NULL, NULL),
(6586, 'Wolfenstein 3D', NULL, NULL, 'Achtung! You are OSA super agent B.J. Blazkowicz. Your goal is to escape from Castle Wolfenstein and defeat the twisted Nazi regime in Wolfenstein 3D. Fight all of the memorable enemies from Hans Grosse to Mecha-Hitler in the legendary game that launched the first-person shooter genre. Search classic levels for hidden secrets revealing stolen Nazi treasure, health packs, ammo and weapons, or even short cuts.', '/images/snes/6586/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Wolfenstein-3d.jpg', NULL, NULL),
(6587, 'Wolverine: Adamantium Rage', NULL, NULL, 'Unbreakable... Unstoppable... Uncontrollable... It\'s Wolverine in ADAMANTIUM RAGE! Armed with an arsenal of slashing combat moves, the lone X-Men battles his way from the Weapon X lab to the streets of Tokyo searching for clues to his mysterious past in the most dangerous adventure of his life. But remember, Bub... he\'s the best at what he does! \'Nuf said!', '/images/snes/6587/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/dc/Wolverine_Adamantium_Rage.jpg', NULL, NULL),
(6588, 'Wonder Project J: Kikai no Shōnen Pīno', NULL, NULL, 'Wonder Project J is a Role-Playing game, developed by Almanic Corp. and published by Enix Corporation,  which was released in Japan in 1994.', '/images/snes/6588/cover.png', 'https://upload.wikimedia.org/wikipedia/en/c/ca/Wonder_Project_J_-_Kikai_no_Shonen_Pino_Coverart.png', NULL, NULL),
(6589, 'Wondrous Magic', NULL, NULL, 'Wondrous Magic is a Role-Playing game, developed by System Sacom and published by ASCII Entertainment,  which was released in Japan in 1993.', '/images/snes/6589/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/7/31747_front.jpg', NULL, NULL),
(6590, 'Wordtris', NULL, NULL, 'It\'s a New Word Order in video games as those Soviet Blocks fall again! Letter by letter, words fall together at your command. Horizontally. Vertically. Quickly. They clear. You score. The pace quickens. So does your mind - creating words you didn\'t even know existed! You await a letter for that Magic Word. (The one that scores big, then wipes the slate clean.) Suddenly, a Wild Card Block appears. You flip through the alphabet, drop that critical letter into place, and Ahhhh. You breathe again. And you are hooked - to the letter!', '/images/snes/6590/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/2/0/25320_front.jpg', NULL, NULL),
(6591, 'World Class Rugby', NULL, NULL, 'Aim for the top - Champion of the world.', '/images/snes/6591/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/4/306824_front.jpg', NULL, NULL),
(6592, 'World Class Rugby 2: Kokunai Gekitou Hen \'93', NULL, NULL, 'World Class Rugby 2 is a Sports game, developed by Denton Designs and published by Misawa,  which was released in Japan in 1994.', '/images/snes/6592/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/3/306893_front.jpg', NULL, NULL),
(6593, 'World Heroes', NULL, NULL, 'Are you ready for a fierce battle in an ultra-deathmatch!? Who is the greatest hero in the world? You will find out today! A scientist has created a time machine that eight heroes will travel through time with to prove who is the greatest fighter of all time!', '/images/snes/6593/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/3/26793_front.jpg', NULL, NULL),
(6594, 'World Heroes 2', NULL, NULL, 'The HEROES are back in their biggest and meanest battle ever, along with six new contestants! Travel through time and face an onslaught of opponents in an exciting, bruising battle of the ages!', '/images/snes/6594/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/83/WorldHeroes2_arcadeflyer.png', NULL, NULL),
(6595, 'World League Soccer', 'Pro Soccer', NULL, 'The international best-selling action soccer game, now on Super NES!', '/images/snes/6595/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8a/World_league_soccer_snes.jpg', NULL, NULL),
(6596, 'World Masters Golf', NULL, NULL, '- 4 superb Gouraud-designed courses', '/images/snes/6596/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/5/320115_front.jpg', NULL, NULL),
(6597, 'World Soccer \'94: Road to Glory', NULL, 'Eric Cantona Football Challenge', 'The Ultimate Game Has Arrived! Accept No Substitute!', '/images/snes/6597/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/89/WorldSoccer94SNESBoxArt.jpg', NULL, NULL),
(6598, 'Worms', NULL, NULL, 'Worms is an ultra-fast-paced game of team strategy for up to 16 players. It\'s a little bit "Lemmings™" and a lotta bit "Terminator™"... only more pink and squishy, with bazookas, homing missiles and cluster bombs blasting the screen in an unrelenting fury, only the moist can survive!', '/images/snes/6598/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9d/WormsLogo.png', NULL, NULL),
(6599, 'Wrecking Crew \'98', NULL, NULL, 'Wrecking Crew \'98 is a Puzzle game, developed by Pax Softonica and published by Nintendo,  which was released in Japan in 1998.', '/images/snes/6599/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/8/31988_front.jpg', NULL, NULL),
(6600, 'WWF RAW', NULL, NULL, NULL, '/images/snes/6600/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/e/e5/WWE_RAW_Coverart.jpg', NULL, NULL),
(6601, 'WWF Royal Rumble', NULL, NULL, 'All-New 16-Meg Mayhem!!', '/images/snes/6601/cover.png', 'https://upload.wikimedia.org/wikipedia/en/4/4b/WWFRoyalRumbleSNES.png', NULL, NULL),
(6602, 'WWF WrestleMania: The Arcade Game', NULL, NULL, 'Take on wrestling to the EXTREME with intense action straight from the arcade smash! It\'s in-your-face mayhem with punishing head-to-head and team matchups! No pain, no game!', '/images/snes/6602/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/19/WWF_Wrestlemania_arcade_flyer.png', NULL, NULL),
(6603, 'Xak: The Art of Visual Stage', NULL, NULL, 'Xak: The Art of Visual Stage is a Role-Playing game, developed by Tokai Engineering and published by SunSoft,  which was released in Japan in 1993.', '/images/snes/6603/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/f/fb/Xak1cover.jpg', NULL, NULL),
(6604, 'Xardion', NULL, NULL, 'The Legend of Xardion comes to life in this Super Nintendo Mega hit. Join Alcedes, Triton, and Panthera, a trio of cyborgs as they unite forces to save the Alpha-1 Solar system. Their adventure takes them to the farthest regions of the galaxy where they discover the legendary cyborg. Thought to be destroyed long ago, Xardion has been trapped by a moat of hydrochloric acid unable to escape, until now. The legend continues in this all new, all exciting, all encompassing Super-NES title. A combination of RPG, adventure, and action games, Xardion is state of the art entertainment. 8 megs of battery backed up memory, allows you to save progress at any time! Don\'t be left out! Join the Revolution. The Xardion revolution!', '/images/snes/6604/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/12/XardionBoxShotSNESJP.jpg', NULL, NULL),
(6605, 'X-Kaliber 2097', 'Sword Maniac', NULL, 'A dark night, in the dark times of 2097. The Neo New York Special Forces have been decimated. Only two agents remain - Slash, armed with an extraordinary talismanic sword, and Alix, his beautiful partner. But Alix has been taken captive by Raptor, a tyrannical warlord on a quest for world domination. Slash must slice his way through an army of foot soldiers, shape-shifting Morphs, and patrolling Cyberdynes to rescue his partner. Impossible - if not for the interdimensional capabilities of Slash\'s sword, X-Kaliber.', '/images/snes/6605/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/5/51515_front.jpg', NULL, NULL),
(6606, 'X-Men: Mutant Apocalypse', NULL, NULL, 'For years, the tiny island nation of Genosha has enslaved its mutant population while the rest of the world has turned a blind eye. Now, as the situation turns bleak, Professor Charles Xavior is stunned to find the true force lurking behind the Genoshan government. With the fate of all mutantkind hanging in the balance, Professor Xavior must unleash the X-Men to face the most powerful mutant of them all- The Mighty Apocalypse!', '/images/snes/6606/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/2/2e/XmenSNES_boxart.JPG', NULL, NULL),
(6607, 'X-Terminator 2 Sauke', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6608, 'X-Zone', NULL, NULL, 'X-Terminator wanted for x-tremely risky business.', '/images/snes/6608/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/6/68/XzoneSNES_boxart.jpg', NULL, NULL),
