(6618, 'Yoshi\'s Safari', 'Yoshi\'s Road Hunting', NULL, 'Bowser, King of the Koopas, and his evil offspring have invaded yet another kingdom. The Koopalings have seized the Kingdom\'s precious crystals. It\'s up to you, armed with your trusty Super Scope, to ride Yoshi to the rescue!', '/images/snes/6618/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/07/Yoshi%27s_Safari_Coverart.png', NULL, NULL),
