(6645, 'Zig Zag Cat: Ostrich Club mo Oosawagi da', NULL, NULL, 'Zig Zag Cat is a Puzzle game, developed by Opera House and published by Den\'Z,  which was released in Japan in 1994.', '/images/snes/6645/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/7/2/31772_front.jpg', NULL, NULL),
(6646, 'Zoku: The Legend of Bishin', NULL, NULL, 'Bishin Densetsu Zoku: The Legend of Bishin Zoku is an Action game, published by Magifact,  which was released in Japan in 1993.', '/images/snes/6646/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/5/2/31752_front.jpg', NULL, NULL),
(6647, 'Zombies Ate My Neighbors', 'Zombies', NULL, 'Hey, where\'s that scary music coming from? Yikes! It\'s Zombies Ate My Neighbors, where you appear in every demented horror flick ever to make you hurl ju-jubes! What are two wholesome teenage stars doing in a 16-bit game like this? Trying to save the nice neighbors, cheerleaders and babies from a fate worse than polyester! Who could put this slice of suburbia in such goose-pimply behavior? Zombies, relentless Chainsaw Maniacs, Mummies, Evil Dolls that just won\'t die, Lizard Men, Blobs, Vampires, Giant Ants, Martians and more! Play Zombies Ate My Neighbors! But don\'t be surprised if your friends are missing when you hear the sound of the chainsaw hissing!', '/images/snes/6647/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/75/Zombies_Ate_My_Neighbors_box.jpg', NULL, NULL),
(6648, 'Zoo-tto Mahjong!', NULL, NULL, 'Zoo-tto Mahjong! is a Miscellaneous game, published by Nintendo,  which was released in Japan in 1998.', '/images/snes/6648/cover.png', 'https://gamefaqs.akamaized.net/images/platform-100/snes.png', NULL, NULL),
(6649, 'Zoop', NULL, NULL, 'Right here inside this little cardboard box is the excitement you crave, the challenge you need. Level after level of brain-burning action coming at you from all sides, faster and faster until your thumbs are numb, your eyes are aching and your mind is molten. 99 levels of intense, non-stop action shatter the calmest of nerves! Breakthrough "Opti-Challenge" backgrounds increase the complexity of advancing levels... don\'t let your eyes deceive you. Intensifying gameplay demands expert strategic thinking. (In other words, use your head!)', '/images/snes/6649/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Zoop_Cover.png', NULL, NULL),
(6650, 'Hebereke\'s Popoon', NULL, NULL, NULL, '/images/snes/6650/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3b/Hebereke%27s_Popoon_SNES.jpg', NULL, NULL),
(6651, 'Heisei Shin Onigashima Kouhen', NULL, NULL, 'Heisei Shin Oniga Shima: Kouhen is an Adventure game, developed by Pax Softonica and published by Nintendo, which was released in Japan in 1997.\n', '/images/snes/6651/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/8/3/31983_front.jpg', NULL, NULL),
(6652, 'Home Alone (SNES)', NULL, NULL, 'The riches of the McCallister home are under siege again from the Wet Bandit Gang! Young Kevin has to defend his family\'s treasures against his old foes, Marv and Harry. But this time the bumbling crooks brought some tough friends to even the score! Their recent stretch behind the bars has given them plenty of ideas to exact revenge on our little hero.', '/images/snes/6652/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/76/Home_alone_poster.jpg', NULL, NULL),
(6653, 'Honō no Dōkyūji: Dodge Danpei (SNES)', NULL, NULL, 'Honoo no Doukyuuji: Dodge Danpei is a Sports game, published by SunSoft,  which was released in Japan in 1992.', '/images/snes/6653/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/0/31150_front.jpg', NULL, NULL),
(6654, 'Hook (SNES)', NULL, NULL, 'PETER PAN has now grown up, and is far away from NEVERLAND, but his old enemy CAPTAIN HOOK has not forgotten and schemes his revenge. Kidnapping Peter\'s children, he lures our hero back to the island of PIRATES and "LOST BOYS" for a final confrontation. With the help of TINKERBELL, the faithful fairy, you take on the role of PETER in this magic adventure fraught with danger and excitement.', '/images/snes/6654/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0e/Hook_poster_transparent.png', NULL, NULL),
(6655, 'Human Grand Prix IV: F1 Dream Battle', NULL, NULL, 'Human Grand Prix IV: F-1 Dream Battle is a Racing game, developed and published by Human Entertainment,  which was released in Japan in 1995.', '/images/snes/6655/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/8/8/31888_front.jpg', NULL, NULL),
(6656, 'The Incredible Crash Dummies (SNES)', 'The Incredible Crash Dummies: Slick Bouya no Daichousen', NULL, 'Have fun with some real headbangers... THE INCREDIBLE CRASH DUMMIES!! Spare Tire\'s been dummy-napped, and it\'s up to Slick \'n\' Spin to rescue him from the clutches of The Junkman! Lend \'em a hand as they: Slam and jam on the Crash Test Center tire bounce! Try not to fall head over heels on the Big Top high wire! Go to pieces steering clear of rowdy truckers on The Docks! Shake a leg past snarling dogs and runaway tires at The Junkyard! Knock heads with the Junkman to set Spare Tire free! THE INCREDIBLE CRASH DUMMIES... where fun is a farewell to arms!', '/images/snes/6656/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/9/30959_front.jpg', NULL, NULL),
(6657, 'The Incredible Hulk (SNES)', NULL, NULL, 'Busting through a brick wall, Rhino charges the Hulk. KRAASH! As the Rhino closes in, the Hulk prepares to knock him to oblivion. The Hulk lands a gamma-powered uppercut! THWAAP! Bruce Banner contends with The Leader\'s Robot Warriors\' laser blasts. THKOOM! The Leader\'s Bio-Tech Mutants hurl at the angry Hulk. AAAARRRGGG!!', '/images/snes/6657/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/thumb/b/b4/Hulk_94.jpg/220px-Hulk_94.jpg', NULL, NULL),
(6658, 'International Superstar Soccer Deluxe', 'Jikkyou World Soccer 2: Fighting Eleven', NULL, 'It\'s a whole new ball game... Realistic sprites with 36 teams featuring recognisable celebrity players. Increased CPU intelligence to challenge beginners and experts alike. Choose from 16 formations, 8 strategies, 20 players and 9 adjustable player skills. Four way play possible with adaptor.', '/images/snes/6658/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3a/ISS_Deluxe.jpg', NULL, NULL),
(6659, 'James Bond Jr. (SNES)', NULL, NULL, 'The world\'s greatest scientists have disappeared and now it\'s up to you, as James Bond Jr., to rescue them! Intelligence reports indicate that your old enemy S.C.U.M. Lord has imprisoned them on his island fortress in the Carribean. Following orders from Colonel Monty, you head out on four dangerous missions to save the scientists and thwart S.C.U.M. Lord\'s plans! The action never stops! All your skills as a super spy are put to their limit! Deactivate missiles before they launch to disaster. Crack open safes that hold blueprints of the menacing World Domination Device and use your well-honed combat prowess against scores of enemy agents. Surprises wait around every corner in this thrilling adventure from THQ!', '/images/snes/6659/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/16/JamesBondJrTitleCard.jpg', NULL, NULL),
(6660, 'Jeopardy! Deluxe Edition', NULL, NULL, 'So you think you\'re good enough to be on Jeopardy!? Well, here\'s your chance. GameTek\'s new Jeopardy! Deluxe Edition featuring Alex Trebek puts you on stage, against computer-generated opponents or up to two friends. Choose a category and an amount, and if you can ring in fast enough with the right answer, you\'re on your way to becoming the new Jeopardy! champion! Features include digitized photography of the TV studio, contestants, and Alex Trebek himself, as well as Alex\'s digitized voice and that oh-so-familiar theme music. Over 3,500 questions and answers from TV\'s longest-running game show will provide you with hours of entertainment, from your very first question all the way to Final Jeopardy!', '/images/snes/6660/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/1/9/47619_front.jpg', NULL, NULL),
(6661, 'Jeopardy! Sports Edition', NULL, NULL, 'Listen up sports fans! Here\'s your chance to prove that armchair athletes have the most fun. If you\'re a sports buff, or you just love the challenge of a good contest, then this edition of Jeopardy! is just for you. Delve into past and current knowledge in Baseball, Basketball, Football and Hockey or explore categories like Bowl Games, Boxing, Coaches, College Standouts, Equipment, Golf Greats, Horse Racing, Olympic Events, Pitchers, Players, Rookies and Rules. The Sports Edition of Jeopardy! is a whole new ball game! With over 1,700 questions in sports-related categories, Jeopardy! Sports Edition will challenge your brain cells and leave you cheering. This new edition of Jeopardy! contains a variety of sports contestants, photography of Jeopardy\'s set and Alex Trebek\'s digitized voice. It\'s a truly authentic Jeopardy! experience. Take the Jeopardy! challenge today.', '/images/snes/6661/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/3/9/46339_front.jpg', NULL, NULL),
(6662, 'Jikkyou Powerful Pro Yakyuu 3 \'97 Haru', NULL, NULL, 'Jikkyou Powerful Pro Yakyuu 3 \'97-Haru is a Sports game, developed by Diamond Head and published by Konami,  which was released in Japan in 1997.', '/images/snes/6662/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/1/307261_front.jpg', NULL, NULL),
(6663, 'Jimmy Connors Pro Tennis Tour', NULL, NULL, 'Jimmy Connors, ranked Number 1 for 159 weeks, holder of EIGHT Grand Slam titles and a record 109 single titles - more than any other male player in history - is the GREATEST tennis champion ever! Now YOU\'RE Jimmy Connors, battling your way to the Number 1 spot. Past sixteen professional opponents. On center court of the most prestigious tournaments on the world circuit.', '/images/snes/6663/cover.png', 'https://upload.wikimedia.org/wikipedia/en/6/62/Jimmy_Connors_Pro_Tennis_Tour_Coverart.png', NULL, NULL),
(6664, 'Jissen Pachi-Slot Hisshouhou! Classic', NULL, NULL, 'Jissen Pachi-Slot Hisshouhou Classic is a Miscellaneous game, published by Sammy Studios,  which was released in Japan in 1995.', '/images/snes/6664/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/0/3/307103_front.jpg', NULL, NULL),
(6665, 'Jissen Pachi-Slot Hisshouhou! Twin', NULL, NULL, 'Jissen Pachi-Slot Hisshouhou! Twin is a Miscellaneous game, published by Sammy Studios,  which was released in Japan in 1997.', '/images/snes/6665/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/9/307259_front.jpg', NULL, NULL),
(6666, 'Jissen Pachi-Slot Hisshouhou! Twin Vol. 2', NULL, NULL, 'Jissen Pachi-Slot Hisshouhou! Twin 2 is a Miscellaneous game, developed by TOSE and published by Sammy Studios,  which was released in Japan in 1997.', '/images/snes/6666/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/7/0/307270_front.jpg', NULL, NULL),
(6667, 'Jissen Pachi-Slot Hisshouhou! Yamasa Densetsu', NULL, NULL, 'Jissen Pachi-Slot Hisshouhou! Yamasa Densetsu is a Miscellaneous game, published by Sammy Studios,  which was released in Japan in 1996.', '/images/snes/6667/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/1/2/307212_front.jpg', NULL, NULL),
(6668, 'Jissen Pachinko Hisshouhou! 2', NULL, NULL, 'Jissen Pachinko Hisshouhou! 2 is a Miscellaneous game, published by Sammy Studios,  which was released in Japan in 1996.', '/images/snes/6668/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/0/0/307200_front.jpg', NULL, NULL),
(6669, 'Joe and Mac (SNES)', NULL, 'Joe and Mac: Tatakae Genshijin', 'Back in the distant past (way back-line when "rock and roll" was just rock and fast food was dinner you couldn\'t catch), lived two cave dudes named Joe and Mac.', '/images/snes/6669/cover.png', 'https://upload.wikimedia.org/wikipedia/en/2/28/Joe_%26_Mac_Coverart.png', NULL, NULL),
(6670, 'The Jungle Book (SNES)', NULL, NULL, NULL, '/images/snes/6670/cover.jpg', 'https://upload.wikimedia.org/wikipedia/commons/f/f5/JunglebookCover.jpg', NULL, NULL),
(6671, 'Jurassic Park (SNES)', NULL, NULL, 'If the movie shook you, Ocean\'s REAL 3-D graphics will blow you away!', '/images/snes/6671/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/93/Jurassic_Park_%28franchise_logo%29.png', NULL, NULL),
(6672, 'Kawasaki Superbike Challenge', NULL, NULL, 'Join the legendary Kawasaki "Team Green" racing around the most exhilirating circuits in the world on the ZXR750R in the World 750cc Superbikes Championship. Developed in close association with Kawasaki to ensure total accuracy and realism, Kawasaki Superbikes is the motorbike racing game to leave all others standing!', '/images/snes/6672/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3d/Kawasaki_Superbike_Challenge.jpg', NULL, NULL),
(6673, 'Kishin Douji Zenki: Tenchi Meidou', NULL, NULL, 'Kishin Douji Zenki: Tenchi Meidou is a Miscellaneous game, published by Hudson,  which was released in Japan in 1996.', '/images/snes/6673/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/9/4/307194_front.jpg', NULL, NULL),
(6674, 'Kōryū Densetsu Villgust', NULL, NULL, 'Kouryu Densetsu Villgust is a Role-Playing game, developed by WinkySoft and published by Bandai,  which was released in Japan in 1992.', '/images/snes/6674/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/5/42825_front.jpg', NULL, NULL),
(6675, 'Krusty\'s Super Fun House', 'Krusty World', NULL, 'Hey kids! Give a hoot! Help out your old pal Krusty the Clown! My official Krusty\'s Fen House is infested with rats! There are over 60 leverls in this game, and they\'re all crawling with the little varmints! I\'ve got my loyal cadets, Bart and Home Simpson, Sideshow Mel, and Corporal Punishment to guard the rat traps, but I need you to lead the filthy rodents into those traps! Then we blow \'em up! We incinerate \'em! We laser-blast\'em! We electrocute\'em! We Krusterize the little stinkers!!! Hoo boy!', '/images/snes/6675/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/96/NES_Krusty%27s_Fun_House.jpg', NULL, NULL),
(6676, 'Kyouraku Sanyou Maruhon Parlor! Parlor! IV CR', NULL, NULL, 'Kyouraku - Sanyo - Toyomaru Parlor! Parlor! 4 is a Miscellaneous game, published by Nippon Telenet,  which was released in Japan in 1995.', '/images/snes/6676/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/0/307180_front.jpg', NULL, NULL),
(6677, 'Last Action Hero (SNES)', NULL, NULL, 'Last Action Hero™ blasts you out of the real world - onto the silver screen - and back again, in seven levels of non-stop action and adventure based on the epic fantasy feature starring Arnold Schwarzenegger. As movie hero Jack Slater, you\'ll team up with your biggest fan, Danny Madigan, who\'s got a magic movie ticket that\'s the ticket to serious trouble. Leaping between both the movie world and the real world with this magic ticket, you\'ll get into wild chases and deadly fights with the most dangerous criminals imaginable. Last Action Hero delivers all the excitement of the Schwarzenegger film with just one difference... you\'re the star! But this time, you must ultimately defeat the arch villains to ensure a happy ending.', '/images/snes/6677/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/4/46414_front.jpg', NULL, NULL),
(6678, 'The Last Battle', NULL, NULL, 'The Last Battle is a Role-Playing game, developed by Atelier Double and published by Techiku,  which was released in Japan in 1994.', '/images/snes/6678/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/8/8f/TheLastBattle%281stEd%29.jpg', NULL, NULL),
(6679, 'Legend', NULL, NULL, 'Venture back to Hyrule and an age of magic and heroes. The predecessors of Link and Zelda face monsters on the march when a menacing magician takes over the kingdom. Only you can prevent his evil plot from shattering the land of Hyrule. In your quest, you\'ll venture into twisting mazes, dungeons, palaces and shadowy forests. Test your mettle with mighty swords and magical weapons. Or heft a boulder and hurl it at your enemies. If the going gets tough, dive into a river - you can swim to escape! Learn the powerful spells, locate magical artifacts and solve the mysteries of the evil magician and the hidden realm of Hyrule.', '/images/snes/6679/cover.svg', 'https://upload.wikimedia.org/wikipedia/commons/2/2a/Zelda_Logo.svg', NULL, NULL),
(6680, 'Lethal Weapon (SNES)', NULL, NULL, 'You know what it\'s all about. That\'s right. The crazy cop and his almost crazy partner are back to do the city a world of good. As Martin Riggs or Rogar Murtaugh, you\'ve got a lot to decide - like how you\'re gonna outwit and outdo the major outlaws of L.A. It doesn\'t get rougher or tougher than the streets of Los Angeles, where you\'ll take on drug smugglers, terrorists, The Organization and a hostage situation at a shopping mall. Which of these four mission will you tackle first? One thing\'s for sure, they\'ll all be tricky ...and deadly. How much of your life and your future are you willing to risk? As Riggs? As Murtaugh? Choose the best man for each mission. Remember, you\'ll need muscle and wits, so choose wisely. If you\'re sharp enough and quick enough, you may have time to catch your breath before you begin your final task for the Internal Affairs Department. This time, you\'ll be tracking down a corrupt police offier; one who knows how you move! So get moving...and do it carefully!', '/images/snes/6680/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d9/Lethal_weapon1.jpg', NULL, NULL),
(6681, 'The Lion King (SNES)', NULL, NULL, 'You think you want to be King? Get real. You\'re starting life as Simba, the cub. To survive and grow into a powerful adult lion, you must perfect your savage pounce, reckless roar and master fighting with all four paws. If you survive the challenge, you\'ll grow into a strong, ferocious adult lion.', '/images/snes/6681/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/3d/The_Lion_King_poster.jpg', NULL, NULL),
(6682, 'Little Magic (SNES)', NULL, NULL, 'Little Magic is a Puzzle game, published by Altron,  which was released in Japan in 1993.', '/images/snes/6682/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/4/8/31748_front.jpg', NULL, NULL),
(6683, 'Magical Pop\'n', NULL, NULL, 'Magical Pop\'n is an Action game, developed by Polestar and published by Pack-In-Video,  which was released in Japan in 1995.', '/images/snes/6683/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/d8/Magical_Pop%27n_cover.jpg', NULL, NULL),
(6684, 'Magical Taruruuto-kun: Magic Adventure', NULL, NULL, 'Magical * Taruruuto-kun: Magic Adventure is an Action game, developed by Game Freak and published by Bandai,  which was released in Japan in 1992.', '/images/snes/6684/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/5/3/31653_front.jpg', NULL, NULL),
(6685, 'Mahjong Club', NULL, NULL, 'Mahjong Club is a Miscellaneous game, developed by Natsu System and published by Hect,  which was released in Japan in 1994.', '/images/snes/6685/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/9/31819_front.jpg', NULL, NULL),
(6686, 'Mahjong Sengoku Monogatari', NULL, NULL, 'Mahjong Sengoku Monogatari is a Miscellaneous game, developed by Khaos and published by Yojigen,  which was released in Japan in 1994.', '/images/snes/6686/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/9/5/31795_front.jpg', NULL, NULL),
(6687, 'Mario\'s Early Years! Fun with Numbers', NULL, NULL, 'In FUN WITH NUMBERS, children are introduced to the basics of math by way of Shape, Number, Same and Different, Counting, Comparing, How Many, and Pattern Worlds.', '/images/snes/6687/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/0/2/50902_front.jpg', NULL, NULL),
(6688, 'Mario\'s Time Machine (SNES)', NULL, NULL, 'YOU AND MARIO MAKE QUITE A PAIR. Especially when you\'re battling the common enemy: Bowser.', '/images/snes/6688/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/a6/Mario%27s_Time_Machine_SNES.jpg', NULL, NULL),
(6689, 'Mega Lo Mania', 'Mega-Lo-Mania: Jikū Daisenryaku', NULL, 'A new planet is born and only lacks its leader. Could this be you? Are you ready to face the challenge of three vicious opponents who are plotting only for your demise? To control the planet you will need to begin at the dawn of time and fight through to the present and even the future. You must take a feeble race of cave men and lead them through the ages, progressing in technological skill until you are ready to fight in the Mother of All Battles - the final conflict to be fought at the end of time!', '/images/snes/6689/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/9d/Mega-Lo-Mania_cover_art.jpg', NULL, NULL),
(6691, 'Mega Man X', 'Rockman X', NULL, 'Near the end of his life, Dr. Light succeeds in creating the first of a new series of robots which will change the world. Able to think and make decisions, this new robot holds great danger as well as great possibilities. Fearful of the possible consequences of unleashing his creation on the world, Dr. Light decides to seal him in a capsule and test his systems until they are totally reliable. The future will have to decide his fate...', '/images/snes/6691/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/f1/Mega_Man_X_Coverart.png', NULL, NULL),
(6692, 'Mega Man X2', 'Rockman X2', NULL, 'Just when Mega Man X thought he had brought down all the X-Hunters, several months later an uprising moves from within an abandoned factory. While 8 all-new X-Hunters occupy Mega Man X, a triple threat plots to resurrect a secret weapon that is all too familiar!', '/images/snes/6692/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/3/50923_front.jpg', NULL, NULL),
(6693, 'Mega Man X3', 'Rockman X3', NULL, 'Mega Man X and his trusty partner Zero have a new force to reckon with. Who or what has caused a riot of Mavericks to break out in the experimental utopia known as Doppler Town?', '/images/snes/6693/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/2/2/20122_front.jpg', NULL, NULL),
(6694, 'Metal Max 2', NULL, NULL, 'Metal Max 2 is a Role-Playing game, developed by Crea-Tech and published by Data East,  which was released in Japan in 1993.', '/images/snes/6694/cover.png', 'https://upload.wikimedia.org/wikipedia/en/1/12/Metal_Max_2_Coverart.png', NULL, NULL),
(6695, 'Metal Morph', NULL, NULL, 'AMBUSHED!', '/images/snes/6695/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/49/MetalMorphUSBoxArtSNES.jpg', NULL, NULL);
INSERT INTO `game` (`id`, `title`, `alt_title`, `alt_title2`, `description`, `cover_uri`, `cover_wikipedia_link`, `time_to_beat`, `time_to_complete`) VALUES
(6696, 'Mighty Morphin Power Rangers: The Movie', NULL, NULL, 'The Power Rangers stripped of their Mighty Morphin Powers and forced to flee Earth? Rita Repulsa and Lord Zedd overwhelmed by an evil far greater than their combined nastiness? The Command Center totally obliterated and Zordon on the brink of death The fate of the world in the slimey hands of Ivan Ooze, the most sinister monster the universe has ever seen? Could this be a bad dream? Don\'t count on it. It all happens in the Morphinominal Mighty Morphin Power Rangers the Movie! And now, you can battle Ivan Ooze, the vilest villain in Nintendo history, and a whole host of his mean and ugly minions in this hyperaction, seven level, no-hold-barred brawl featuring the eye-popping graphics and ear-pounding sounds of the Super NES. So, morph into action, and lead the Power Rangers on to their greatest victory.', '/images/snes/6696/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/d/df/Mightymorph01.jpg', NULL, NULL),
(6697, 'Momotarou Dentetsu Happy', NULL, NULL, 'Momotarou Dentetsu Happy is a Miscellaneous game, developed by Make and published by Hudson,  which was released in Japan in 1996.', '/images/snes/6697/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/5/0/307250_front.jpg', NULL, NULL),
(6699, 'Mortal Kombat', NULL, NULL, 'The #1 arcade hit is here: from Sub-Zero, Rayden and the rest of the Kombat Warriors to the grueling endurance and intense mirror matches! Execute bone-shattering combos and ferocious finishing moves! Defeat the half human dragon Goro, and destroy the shape-changing Shang Tsung to become the Supreme Mortal Kombat Warrior!', '/images/snes/6699/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/1/4/21114_front.jpg', NULL, NULL),
(6700, 'Mortal Kombat II', NULL, NULL, 'Nothing, NOTHING can prepare you -- ALL the fierce Kombatants of the #1 arcade smash gather for Mortal Kombat®II, a battle to defeat the shape-shifting demon Shang Tsung™ and his ruthless master, Shao Kahn™. Brutal special moves, Friendships, Babalities, hidden surprises, crushing combos, and outrageous finishing moves -- All yours to kommand. Let the Kombat Kontinue...', '/images/snes/6700/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/5/7/20157_front.jpg', NULL, NULL),
(6701, 'Ms. Pac-Man (SNES)', NULL, NULL, 'Ms. Pac-Man is here to drive you totally wild and crazy with more fun than you\'ve ever imagined! Four feisty ghosts are chasing MS. PAC-MAN. Use your skill and strategy to rack up points while outrunning the gobbling ghosts. Grab an energy pill, and score even more points. Now gobble up all those fearless ghosts!', '/images/snes/6701/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/3/1/44731_front.jpg', NULL, NULL),
(6702, 'NCAA Football', NULL, NULL, 'NCAA FOOTBALL puts you right in the thick of it. This game plays like your team plays! Now you can play your favorite teams in the fantasy NCAA Championship.', '/images/snes/6702/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/1/50961_front.jpg', NULL, NULL),
(6703, 'Nintama Rantarō Special', NULL, NULL, 'Nintama Rantarou Special is an Action game, published by Culture Brain,  which was released in Japan in 1996.', '/images/snes/6703/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/3/5/307235_front.jpg', NULL, NULL),
(6704, 'Nobunaga no Yabou: Tenshouki', NULL, NULL, 'Nobunaga no Yabou: Tenshouki is a Strategy game, published by Koei,  which was released in Japan in 1996.', '/images/snes/6704/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/8/307188_front.jpg', NULL, NULL),
(6705, 'Oekaki Logic', NULL, NULL, 'Ochan no Oekaki Logic is a Puzzle game, developed by Game Studio and published by SunSoft,  which was released in Japan in 1995.', '/images/snes/6705/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/0/295560_front.jpg', NULL, NULL),
(6706, 'Outlander', NULL, NULL, 'There\'s No Way Out...', '/images/snes/6706/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0b/Outlander-1991_1st_Edition_cover.jpg', NULL, NULL),
(6707, 'P.T.O. II: Pacific Theater of Operations', 'Teitoku no Ketsudan II', NULL, 'The battle rages on. Two opponents. Two strategies. The year is 1941 and the scene is the Pacific. Japanese Zeros appear on the horizon, marking the beginning of World War II. From Pearl Harbor to unconditional surrender, this is your battlefield. PTO II delivers the power to control this infamous war. With new technology, faster and better war machines are at your disposal. Command the guns of the mighty Missouri, launch devastating Japanese fighter attacks, or storm the beaches of Okinawa. India, Australia, and the east coast of the United States mark new regions for enemy domination. Three campaigns await the most ambitious of generals while single-ship engagements prepare you for more!', '/images/snes/6707/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/4/5894_front.jpg', NULL, NULL),
(6708, 'Pachi-Slot Monogatari: Universal Special', NULL, NULL, 'Pachi-Slot Monogatari: Universal Special is a Miscellaneous game, developed by Kaze and published by KSS,  which was released in Japan in 1994.', '/images/snes/6708/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/3/306953_front.jpg', NULL, NULL),
(6709, 'The Pagemaster', NULL, NULL, 'Discover a World Where Imagination and Adventure Run Wild!', '/images/snes/6709/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/2/46572_front.jpg', NULL, NULL),
(6710, 'Parlor! Mini 2: Pachinko Jikki Simulation Game', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6711, 'Parlor! Mini 3: Pachinko Jikki Simulation Game', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6712, 'Parlor! Mini 4: Pachinko Jikki Simulation Game', NULL, NULL, 'Parlor! Mini 4 is a Miscellaneous game, published by Nippon Telenet,  which was released in Japan in 1996.', '/images/snes/6712/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/8/307248_front.jpg', NULL, NULL),
(6713, 'Parlor! Mini 5: Pachinko Jikki Simulation Game', NULL, NULL, 'Parlor! Mini 5 is a Miscellaneous game, published by Nippon Telenet,  which was released in Japan in 1997.', '/images/snes/6713/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/2/307262_front.jpg', NULL, NULL),
(6714, 'Parlor! Mini 6: Pachinko Jikki Simulation Game', NULL, NULL, 'Parlor! Mini 6 is a Miscellaneous game, published by Nippon Telenet,  which was released in Japan in 1997.', '/images/snes/6714/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/7/307267_front.jpg', NULL, NULL),
(6715, 'Parlor! Mini 7: Pachinko Jikki Simulation Game', NULL, NULL, 'Parlor! Mini 7 is a Miscellaneous game, published by Nippon Telenet,  which was released in Japan in 1997.', '/images/snes/6715/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/8/307268_front.jpg', NULL, NULL),
(6716, 'PGA Tour Golf (SNES)', NULL, NULL, 'The only game to make the PGA TOUR cut', '/images/snes/6716/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/73/Tiger_Woods_PGA_Tour_current_logo.jpg', NULL, NULL),
(6717, 'Power Drive', NULL, NULL, 'Burn through blizzards in Monte Carlo at midnight or race in the blistering desert heat of Kenya. Test your rally skills through the dense forests, dizzy mountain passes and icy frozen lakes of different international courses! POWER DRIVE... drive it if you dare!', '/images/snes/6717/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/9/64039_front.jpg', NULL, NULL),
(6718, 'Prince of Persia (SNES)', NULL, NULL, 'The award winning computer software adventure that has people everywhere rattling their sabers is here for Super NES. And now the animation is more detailed, and the controls more responsive. There\'s even a five part training mode for sharpening your running, jumping, climbing and sword fighting skills.', '/images/snes/6718/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0c/Princeofpersialogo.jpg', NULL, NULL),
(6719, 'Pro Mahjong Tsuwamono', NULL, NULL, 'Pro Mahjong Tsuwamono is a Miscellaneous game, published by Culture Brain,  which was released in Japan in 1997.', '/images/snes/6719/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/6/3/307263_front.jpg', NULL, NULL),
(6720, 'The Ren and Stimpy Show: Buckaroo$! (SNES)', NULL, NULL, 'Oh, hi kids!', '/images/snes/6720/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/b/b6/Ren_%26_Stimpy_Buckaroo%24_NES.jpg', NULL, NULL),
(6721, 'The Ren and Stimpy Show: Time Warp', NULL, NULL, 'Travel back to the Far-Flung reaches of Last Week! as Ren & Stimpy team up for a time travel through their Backyard, the Big City, a Haunted House, an Unfriendly Zoo, and the entire Untamed World. Navigate the time machine through dangerous time phenomena and fire portal mazes. Use hardy watermelon bows, beaver saws, and even mystic canoes to stop Muddy Mudskipper from ruining history. Get Ren and Stimpy back to the present and make some big bucks on the side!', '/images/snes/6721/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/5/9/51059_front.jpg', NULL, NULL),
(6722, 'The Ren and Stimpy Show: Veediots!', NULL, NULL, 'Help! We\'re trapped in our own T.V. show!', '/images/snes/6722/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/4/4/46644_front.jpg', NULL, NULL),
(6723, 'RoboCop 3 (SNES)', NULL, NULL, 'Old Detroit. The streets are full of danger. Only one man can stand alone against such numbers - ROBOCOP! With state of the art weaponry, a skin of steel and nerves to match, he stalks his prey... evil-doers everywhere!', '/images/snes/6723/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/16/RoboCop_%281987%29_theatrical_poster.jpg', NULL, NULL),
(6724, 'The Rocketeer (SNES)', NULL, NULL, 'FUEL UP YOUR SUPER NINTNEDO ENTERTAINMENT SYSTEM WITH THE ROCKETEER FROM IGS.', '/images/snes/6724/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/8/3/51083_front.jpg', NULL, NULL),
(6725, 'Romance of the Three Kingdoms IV: Wall of Fire', 'Sangokushi IV', NULL, 'It\'s the Second Han Dynasty and China is on the verge of collapse. Infighting among the court families and the emergence of powerful warlords dominates the landspace. The struggle for power has brought an era known as the Three Kingdoms, complete with constant warfare among China\'s most courageous and skillful heroes.', '/images/snes/6725/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a6/Romance_of_the_Three_Kingdoms_IV_-_Wall_of_Fire_Coverart.png', NULL, NULL),
(6726, 'SD Gundam Gaiden: Knight Gundam Monogatari: Ooinaru Isan', NULL, NULL, 'SD Gundam Gaiden: Knight Gundam Monogatari - Ooinaru Isan is a Role-Playing game, developed by TOSE and published by Angel (Bandai),  which was released in Japan in 1991.', '/images/snes/6726/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/0/303870_front.jpg', NULL, NULL),
(6727, 'SD Gundam GX', NULL, NULL, 'SD Gundam GX is a Strategy game, developed by Bec and published by Bandai,  which was released in Japan in 1994.', '/images/snes/6727/cover.jpg', 'https://gamefaqs.akamaized.net/box/7/6/7/303767_front.jpg', NULL, NULL),
(6728, 'Shadowrun', NULL, NULL, 'Disoriented and confused, you are forced into a race against time, technology and termination. Running in the shadows and cracks between the Megaplexes, survival depends on your wits, your weapons and your wayward companions. Plunge into the dark side of the future, where technology and magic become one, where devolution and destruction are a way of life. Plunge into Shadowrun.', '/images/snes/6728/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/0/11000_front.jpg', NULL, NULL),
(6729, 'Shien\'s Revenge', 'Shien: The Blade Chaser', NULL, 'Enjoy a breathtaking weekend on us, in 500 B.C. Greece.', '/images/snes/6729/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/3/0/51130_front.jpg', NULL, NULL),
(6730, 'Shin Megami Tensei if...', NULL, NULL, 'In Shin Megami Tensei: if... the story is about Hazama, a poor and abused boy who goes to Karukozaka High School. In order to get vengeance on his peers he performs a ceremony in the gym (most likely referencing the original Megami Tensei) that transports his high school into Makai, the netherworld, where he has somehow become powerful enough to become Majin-Nou (Demon God Emperor). Back at the school, everyone freaks out and is scared except for a select few.The player assumes the role a nameless male or female student, who armed themselves with defensive equipment and COMP. They investigate the realms of Makai which are based on 5 of the 7 deadly sins, and finally face off against Hazama. In their quest, the player will be accompanied by fellow students and demons recruited through either negotiation or from the process of fusion, or via the Jakyou.There are four possible paths in the game, but unlike the previous games, they are not decided by the alignment system. Instead, right in the beginning of the game the player must choose one of the four main characters as a companion to investigate the misterious events and the Makai. Each main character has a defined path and once one has been chosen, the player is locked on that path. Yumi, Reiko and Charlie visit the worlds based off the deadly sins (Yumi and Reiko visit the same worlds, Charlie visits a few different ones), while Akira puts the player in an entirely different setting. Akira\'s path is much more difficult and, instead of being segmented among worlds, is composed by just one huge tower very similar to Persona 3\'s Tartarus. This path focuses much more heavily on the \'Dungeon Crawler\' aspect of the game.Each of the worlds raise a few philosophical questions about the nature and consequences of the deadly sins, but the game presents these conflicts in a non-theological manner.', '/images/snes/6730/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/2/0/20520_front.jpg', NULL, NULL),
(6731, 'Shin Momotarou Densetsu', NULL, NULL, 'Shin Momotarou Densetsu is a Role-Playing game, published by Hudson,  which was released in Japan in 1993.', '/images/snes/6731/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/9/0/306890_front.jpg', NULL, NULL),
(6732, 'Shin Nippon Pro Wrestling \'94: Battlefield in Tokyo Dome', NULL, NULL, 'Shin Nippon Pro Wrestling \'94 is a Sports game, published by Varie,  which was released in Japan in 1994.', '/images/snes/6732/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/6/4/306964_front.jpg', NULL, NULL),
(6733, 'Shougi Club', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6734, 'Shōnen Ashibe', NULL, NULL, 'Shounen Ashibe is an Action game, developed by Nova Games Ltd. and published by Takara,  which was released in Japan in 1992.', '/images/snes/6734/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/0/9/312009_front.jpg', NULL, NULL),
(6735, 'Side Pocket (SNES)', NULL, NULL, 'Chalk up your cue stick and rack up those balls. Now get ready, get set, break! The balls scatter and the match is on... It\'s the Data East Pool Tournament Finals, and you\'re behind the 8-ball! It\'ll take a steady hand and a sharp eye to hustle your way to the top. Challenge your opponents to the ultimate game of skill, but you\'ve got to stay cool... It\'s a green felt jungle out there!', '/images/snes/6735/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/47/Side_Pocket_NES_cover.jpg', NULL, NULL),
(6736, 'SimCity Jr.', NULL, NULL, 'SimCity Jr. is a Strategy game, published by Imagineer,  which was released in Japan in 1996.', '/images/snes/6736/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/1/31951_front.jpg', NULL, NULL),
(6737, 'The Smurfs (SNES)', NULL, NULL, 'Gargamel has already captured three Smurfs. Smurf to their rescue! Smurf down the mountains riding on a sledge, explore the labyrinths of the mine, travel on the back of a stork... but beware of nasty enemies such as the Buzz flies, the Angry Smurfs, the Howlibird, Azrael and... Gargamel!', '/images/snes/6737/cover.svg', 'https://upload.wikimedia.org/wikipedia/en/e/e3/The_Smurfs_logo.svg', NULL, NULL),
(6738, 'The Smurfs Travel The World', NULL, NULL, 'Inquisitive Smurf and Smurfette have broken the magic crystal and now they are being taken off to various parts of the world. Collect all the crystals to be found along your route. To reveal them, brave the sea-lions of the North Pole, the Indians of America, and the octopuses of the deep... Only after you have smurfed all these challenges and many others will you be able to return to the village.', '/images/snes/6738/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/6/4/31064_front.jpg', NULL, NULL),
(6739, 'Song Master', NULL, NULL, 'Song Master is a Role-Playing game, developed by Japan Art Media (JAM) and published by Yanoman,  which was released in Japan in 1992.', '/images/snes/6739/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/1/2/306812_front.jpg', NULL, NULL),
(6740, 'Star Fox', 'Starwing', NULL, 'In the distant Lylat star system, imagine yourself at the controls of a futuristic, heavily armed, space fighter - Arwing. Lead the counter-attack on an invasion force of hundreds of alien tanks, fighter ships, laser gun emplacements and super battleships. Maneuver at warp speed through fog-enshrouded canyons, dense asteroid belts and waves of the enemy\'s best defense. You must use skill and cunning to fight to the enemy\'s home planet Venom and smash the Core Brain for victory!', '/images/snes/6740/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/0c/Star_Fox_series_logo.png', NULL, NULL),
(6741, 'Star Trek: The Next Generation: Future\'s Past', 'Shin Star Trek: The Next Generation', NULL, 'The Mission:', '/images/snes/6741/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/8/1/51181_front.jpg', NULL, NULL),
(6742, 'Stealth', NULL, NULL, 'Stealth is a Strategy game, developed by Axes Art Amuse and published by Hect,  which was released in Japan in 1992.', '/images/snes/6742/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/2/0/306820_front.jpg', NULL, NULL),
(6743, 'Street Combat', 'Ranma ½: Chōnai Gekitōhen', NULL, 'KNOCK-OUT ACTION FOR 2 PLAYERS AT ONCE!', '/images/snes/6743/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/5/43415_front.jpg', NULL, NULL),
(6744, 'Supapoon DX', NULL, NULL, 'Supapoon DX is a Puzzle game, developed by Now Production and published by Yutaka,  which was released in Japan in 1996.', '/images/snes/6744/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/7/8/312578_front.jpg', NULL, NULL),
(6745, 'Super Battleship', NULL, NULL, 'Discover the thrill of commanding your own naval fleet of warships with this brand new spin on the classic Battleship game. Super Battleship gives you all the tough challenges of the original, plus a whole new arsenal of weapons and features. Ride the high seas with graphics so real the rookies may get sea-sick. Fire your torpedoes, aim your biggest guns and hold onto your brains as you blast your way through every battle. A challenging Campaign Scenario tests your skills in naval warfare strategy. Seek out your hidden enemy before he finds you! But hide your fleet well, or you may find your ships headed for the bottom of the sea!', '/images/snes/6745/cover.jpg', 'https://gamefaqs.akamaized.net/box/6/2/0/21620_front.jpg', NULL, NULL),
(6746, 'Super Bomberman', 'Sūpā Bonbāman', NULL, 'What A Blast!', '/images/snes/6746/cover.png', 'https://upload.wikimedia.org/wikipedia/en/7/7a/Super.Bomberman.Box.Art.SNES.PAL.png', NULL, NULL),
(6747, 'Super Bowling', NULL, NULL, 'WELCOME TO THE FAST LANE...', '/images/snes/6747/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/d/d1/SuperbowlingSNES_boxart.JPG', NULL, NULL),
(6748, 'Super Castles', NULL, NULL, 'Super Castles is a Strategy game, developed and published by Victor Interactive Software,  which was released in Japan in 1994.', '/images/snes/6748/cover.jpg', 'https://gamefaqs.akamaized.net/box/0/3/0/307030_front.jpg', NULL, NULL),
(6749, 'Super Chinese World 3', NULL, NULL, 'Super Chinese World 3 is a Role-Playing game, published by Culture Brain,  which was released in Japan in 1995.', '/images/snes/6749/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/ca/Super_chinese_world_3_cover.jpg', NULL, NULL),
(6750, 'Super Dany', NULL, NULL, 'Super Dany is an Action game, developed by Cryo Interactive and published by Virgin Interactive,  which was released in Europe in 1994.', '/images/snes/6750/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/1/93991_front.jpg', NULL, NULL),
(6751, 'Super Double Yakuman', NULL, NULL, 'Super Double Yakuman is a Miscellaneous game, published by Vap,  which was released in Japan in 1994.', '/images/snes/6751/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/2/306922_front.jpg', NULL, NULL),
(6752, 'Super F1 Circus Gaiden', NULL, NULL, 'Super F1 Circus Gaiden is a Racing game, developed by Cream and published by Nichibutsu,  which was released in Japan in 1995.', '/images/snes/6752/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/0/2/307102_front.jpg', NULL, NULL),
(6753, 'Super F1 Circus Limited', NULL, NULL, 'Super F1 Circus Limited is a Racing game, developed by Cream and published by Nichibutsu,  which was released in Japan in 1992.', '/images/snes/6753/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/0/5/306805_front.jpg', NULL, NULL),
