(6755, 'Super Fire Pro Wrestling 3 Final Bout', NULL, NULL, 'Super Fire ProWrestling 3 Final Bout is a Sports game, developed and published by Human Entertainment,  which was released in Japan in 1993.', '/images/snes/6755/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/4/8/42348_front.jpg', NULL, NULL),
