(6758, 'Super Fire Pro Wrestling X Premium', NULL, NULL, 'Super Fire ProWrestling X Premium is a Sports game, developed and published by Human Entertainment,  which was released in Japan in 1996.', '/images/snes/6758/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/3/6/37536_front.jpg', NULL, NULL),
(6759, 'Super Formation Soccer 95: della Serie A: UCC Xaqua', NULL, NULL, 'Super Formation Soccer 95: della Serie A is a Sports game, developed and published by Human Entertainment,  which was released in Japan in 1995.', '/images/snes/6759/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/53/SuperFormationSoccer95dellaSerieAJPBoxShotSNES.jpg', NULL, NULL),
(6760, 'Super Keirin', NULL, NULL, 'Super Keirin is a Sports game, developed by Betop and published by I\'Max,  which was released in Japan in 1995.', '/images/snes/6760/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/0/7/307107_front.jpg', NULL, NULL),
(6761, 'Super Kyotei', NULL, NULL, NULL, '/images/snes/6761/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Super-kyotei.jpg', NULL, NULL),
(6762, 'Super Kyotei 2', NULL, NULL, NULL, '/images/snes/6762/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/05/Super-kyotei.jpg', NULL, NULL),
(6763, 'Super Mad Champ', NULL, NULL, 'Super Mad Champ is a Racing game, developed by Givro and published by Tsukuda Original,  which was released in Japan in 1995.', '/images/snes/6763/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/a/af/SuperMadChampJPBoxShotSNES.jpg', NULL, NULL),
(6764, 'Super Mahjong Taikai', NULL, NULL, 'Super Mahjong Taikai is a Miscellaneous game, published by Koei,  which was released in Japan in 1992.', '/images/snes/6764/cover.png', 'https://upload.wikimedia.org/wikipedia/en/a/a5/Super-Mahjong-Taikai-cover-art.png', NULL, NULL),
(6765, 'Super Mario Kart', NULL, NULL, 'The Super Mario GoKart Park is open for tons of racing fun! Hit the track with Mario, Luigi, Yoshi and the Princess. Get tough and lock fenders with Donkey Kong, Jr. and Bowser. Even Toad and Koopa Troopa will mix it up in an all-out quest for the Gold Cup! Race head-to-head with a friend or challenge the computer in great, split-screen, Mode 7 graphics.', '/images/snes/6765/cover.JPG', 'https://upload.wikimedia.org/wikipedia/en/3/38/Supermariokart_box.JPG', NULL, NULL),
(6766, 'Super Mario World', NULL, NULL, 'Mario\'s off on his biggest adventure ever, and this time he\'s brought along a friend. Yoshi the dinosaur teams up with Mario to battle Bowser, who has kidnapped Princess Toadstool once again. Guide Mario and Yoshi through nine peril-filled worlds to the final showdown in Bowser\'s castle. Use Mario\'s new powers and Yoshi\'s voracious monster-gobbling appetite as you explore 96 levels filled with dangerous new monsters and traps. Climb mountains and cross rivers, and descend into subterranean depths. Destroy the seven Koopa castles and find keys to gain entrance to hidden levels. Discover more warps and thrilling bonus worlds than ever before!', '/images/snes/6766/cover.png', 'https://upload.wikimedia.org/wikipedia/en/3/32/Super_Mario_World_Coverart.png', NULL, NULL),
(6767, 'Super Momotarou Dentetsu DX', NULL, NULL, 'Super Momotarou Dentetsu DX is a Miscellaneous game, developed by Make and published by Hudson,  which was released in Japan in 1995.', '/images/snes/6767/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/6/2/307162_front.jpg', NULL, NULL),
(6768, 'Super Nichibutsu Mahjong 4: Kiso Kenkyuu Hen', NULL, NULL, 'Super Nichibutsu Mahjong 4: Kiso Kenkyu Hen is a Miscellaneous game, published by Nichibutsu,  which was released in Japan in 1996.', '/images/snes/6768/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/2/307242_front.jpg', NULL, NULL),
(6769, 'Super Pachinko', NULL, NULL, 'Super Pachinko is a Miscellaneous game, developed by Betop and published by I\'Max,  which was released in Japan in 1994.', '/images/snes/6769/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/5/5/306955_front.jpg', NULL, NULL),
(6770, 'Super Puyo Puyo Tsuu', NULL, NULL, 'The object of this head-to-head puzzle game is to clear your grid of falling patterns called puyos by forming chains of four or more same-colored puyos in a straight line or one of several geometric patterns. What makes this a challenging two-player contest is the fact that when you clear a chain of puyos from your grid, it drops a random piece of filler onto your opponent\'s grid. The more puyos you clear, the more you fill your opponent\'s grid, and if you can clutter up his grid enough to fill it to the top, you\'ve won the game.', '/images/snes/6770/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/0/8/43408_front.jpg', NULL, NULL),
(6771, 'Super Rugby (SNES)', NULL, NULL, 'Super Rugby is a Sports game, developed by TOSE and published by Tonkin House,  which was released in Japan in 1994.', '/images/snes/6771/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/9/1/306991_front.jpg', NULL, NULL),
(6772, 'Super Sangokushi', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6773, 'Super Shougi', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(6774, 'Super Smash T.V. (SNES)', NULL, NULL, 'There was a time when the only way you could experience the explosive, arcade action of SMASH TV™ was to play it in the arcades. That was then...', '/images/snes/6774/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/8/7/29287_front.jpg', NULL, NULL),
(6775, 'Super Soccer Champ', NULL, 'Hat Trick Hero', 'TAKE CHARGE OF THE BEST SOCCER TEAMS IN THE WORLD!', '/images/snes/6775/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/6/4/51364_front.jpg', NULL, NULL),
(6776, 'Super Star Wars: The Empire Strikes Back', NULL, NULL, 'Pursued across the galaxy, and your Rebel Forces now marshall new strength on the remote ice world of Hoth. Although tracked by probe droids, attacked by ice monster, and confronted by an army of gigantic Imperial Walkers, you must not give in. You are the Alliance\'s only hope. Learn the ways of the Force, then test your skills in this fast-paced, action-packed sequel to the high game, Super Star Wars®.', '/images/snes/6776/cover.png', 'https://upload.wikimedia.org/wikipedia/en/0/04/Super_Star_Wars_-_The_Empire_Strikes_Back_Coverart.png', NULL, NULL),
(6777, 'Super Tennis (SNES)', 'Super Tennis World Circuit', NULL, 'Volley, slice, lob, and overhead smash! Rip a top-spin forehand crosscourt past your opponent. join the exclusive Super Tennis club and call your own shots!', '/images/snes/6777/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/c/cb/SupertennisSNES_boxart.jpg', NULL, NULL),
(6778, 'Super Tetris 2 + Bombliss: Gentei Han', NULL, NULL, 'Super Tetris 2 + Bombliss: Gentei Han is a Miscellaneous game, developed by TOSE and published by Bullet Proof Software,  which was released in Japan in 1994.', '/images/snes/6778/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/1/5/151315_front.jpg', NULL, NULL),
(6779, 'Super Turrican (SNES)', NULL, NULL, 'You are Bren McGuire, on a United Planets Freedom Forces mission to save the peaceful planet Katakis from the Machine, source of all that is cruel and evil in the universe. The only weapon on your side is the state-of-the-art Turrican Assault Suit. Equipped with multiple weapons, including the incredible Freeze-Beam that temporarily immobilizes almost any enemy, the Turrican Assault Suit gives one man the power of an entire army.', '/images/snes/6779/cover.png', 'https://upload.wikimedia.org/wikipedia/en/f/fe/Super_Turrican_%28USA%29.png', NULL, NULL),
(6780, 'Super Uno', NULL, NULL, 'Super Uno is a Miscellaneous game, published by Tomy Corporation,  which was released in Japan in 1993.', '/images/snes/6780/cover.jpg', 'https://gamefaqs.akamaized.net/box/8/7/1/306871_front.jpg', NULL, NULL),
(6781, 'T2: The Arcade Game (SNES)', NULL, NULL, 'The #1 arcade shooting game of all time explodes onto Super Nintendo! You\'re a T-800 terminator with an awesome array of weapons: rapid-fire machine gun, shotgun, rockets and an M-79 grenade launcher. Blast endoskeletons and HKs... terminate the liquid metal T-1000 or be TERMINATED!', '/images/snes/6781/cover.jpg', 'https://gamefaqs.akamaized.net/box/1/7/6/21176_front.jpg', NULL, NULL),
(6782, 'Taikyoku Igo: Idaten', NULL, NULL, 'Taikyoku Igo: Idaten is a Miscellaneous game, published by Bullet Proof Software,  which was released in Japan in 1995.', '/images/snes/6782/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/4/5/311545_front.jpg', NULL, NULL),
(6783, 'Taz-Mania (SNES)', NULL, NULL, 'Watch TAZ\'s dust! That spinning superstar with the short fuse and gigantic appetite! TAZ whirls across Tasmania, hunting for the lost giant seabird egg to make the world\'s largest omelet! TAZ gobbles up everything! Snacks like chilli peppers really burn up his enemies. The hungrier he is, the wilder he gets. Explosive TAZ blasts through 17 levels of high-energy adventure. He rides waterspouts, skids on ice and whizzes through mine shafts in a runaway cart! Villains from the Warner Bros. hit TV series join the mischief, including the Bush Rats, Francis X, Bushlad, Bull Gator and others.', '/images/snes/6783/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/4/2/7942_front.jpg', NULL, NULL),
(6784, 'Tecmo Super Baseball', NULL, NULL, 'Officially licensed by the Major League Baseball Players Association, Tecmo Super Baseball is the most exciting game ever made for your Super NES. While most others can focus on only pitching and batting, Tecmo Super Baseball is the first to provide you with a realistic fielder\'s point of view. The field perspectives created by Tecmo\'s exclusive Flying Camera give you a feel of the game you\'ve never experienced before. From the first pitch to the last out, you\'re in control of both the offense and defense, and right in the middle of the action with large graphic pitching and batting perspectives. Only Tecmo delivers real baseball action.', '/images/snes/6784/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/9/2/51392_front.jpg', NULL, NULL),
(6785, 'Tecmo Super Bowl III: Final Edition', NULL, NULL, 'Every so often a game comes along that\'ll knock your socks off. Real football started with the original Tecmo Bowl in 1989 and now, there is Tecmo Super Bowl III: The Final Edition. Tecmo Super Bowl III is the culmination of 6 long years of development evolution and listening to you, the game player.', '/images/snes/6785/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/3/31/TecmoSuperbowlIIGenesisBoxShot.jpg', NULL, NULL),
(6786, 'Tecmo Super NBA Basketball', NULL, NULL, 'Are you ready to take your favorite NBA team to the NBA Finals? In Tecmo Super NBA Basketball you\'re in TOTAL CONTROL. It\'s the most complete basketball game ever created for the Sega Genesis System. From the tip-off to the final buzzer you control the plays, the players, the offense, the defense and the bench. Whether you want to play a single game or an entire season, only Tecmo Super NBA Basketball delivers REAL NBA ACTION!', '/images/snes/6786/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/72/Tecmo_Super_NBA_Basketball.jpg', NULL, NULL),
(6787, 'Teenage Mutant Ninja Turtles IV: Turtles in Time', 'Teenage Mutant Hero Turtles IV: Turtles in Time', NULL, 'Sunday evening. You\'re sitting around the sewer watching your main reported, April O\'Neil do a live remote from the Statue of Liberty. Then it happens. A humungoso flying android screams out of the sky and rips Lady Liberty from her foundation, sending hundreds of freaked out tourists into the harbor below. "No way!" cries Raphael. "Way," replies Donatello. And the crazy quantum chase is on!', '/images/snes/6787/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/4/4e/Turtles_in_Time_%28SNES_cover%29.jpg', NULL, NULL),
(6788, 'Teenage Mutant Ninja Turtles: Tournament Fighters (SNES)', NULL, 'Teenage Mutant Ninja Turtles: Mutant Warriors', 'Trash the surf board and heave the \'za. It\'s a whole new breed of Turtles and they\'re fixated on fighting. We\'re dead serious, Tournament Fighters takes dude-on-dude demolition to new heights of intensity with 4 modes of pain-producing battles, deadly warriors, secret arenas, astounding graphics and sound effects that\'ll make you cringe! Clash with Krang-created clones of the Turtles, Casey Jones, April O\'Neil, Ray Filet and Sisyphus, plus bosses Triceraton, Krang\'s Android and Karai. There\'s flying body presses, knee drops, head butts, rocket punches, elbow smashes, somersault throws, you\'ll feel and inflict them all. And the settings include Magma Ocean Planet, Jungle Planet, and every other bizarre corner of Dimension X!', '/images/snes/6788/cover.jpg', 'https://gamefaqs.akamaized.net/box/2/4/8/48248_front.jpg', NULL, NULL),
(6789, 'The Terminator (SNES)', NULL, NULL, NULL, '/images/snes/6789/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/7/70/Terminator1984movieposter.jpg', NULL, NULL),
(6790, 'Terminator 2: Judgment Day (SNES)', 'T2: The Arcade Game', NULL, 'It comes from the future. It can take any shape and survive almost any injury (even when a 10-gauge shotgun blast opens it up like a tin can). Its mission: eliminate John Connor. Its name: the T-1000. Against it stands one hope: you, a terminator model T-800... equipped with on-screen target search displays, a lever-action Winchester, and 10 barrels of high explosives... one mean machine. Protect John Connor (before a 23,000 lb. tow-rig plows your Harley into tomorrow). Save humanity (while Uzi-armed SWAT teams try to blow you away). Terminate the T-1000 (steel mill metldown!)... or mankind is history.', '/images/snes/6790/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/2/4/32924_front.jpg', NULL, NULL),
(6791, 'Tetris 2 (SNES)', 'Tetris Flash', NULL, 'The mesmerizing fun of Tetris returns - and the challenge escalates to new heights! Test your dexterity, tease your brain and rack up points with Tetris 2. Your split-second decisions lead you to a new dimension in puzzle-solving action! Play alone or challenge a friend in simultaneous split-screen action. A tougher Tetris with more shapes, more components, 30 levels - and unlimited solutions! If you loved the international game sensation Tetris, you\'ll be wild for the newest dimension in puzzle fun: Tetris 2!', '/images/snes/6791/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/0/0a/Tetris_2_NES.jpg', NULL, NULL),
(6792, 'Tetsuwan Atom (SNES)', NULL, NULL, 'Tetsuwan Atom is an Action game, developed by Minato Giken and published by Zamuse,  which was released in Japan in 1994.', '/images/snes/6792/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/9/3/309493_front.jpg', NULL, NULL),
(6793, 'Tom and Jerry (SNES)', NULL, NULL, 'They\'re at it again. That delightful duo of disasterTom & Jerry!', '/images/snes/6793/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5f/TomandJerryTitleCardc.jpg', NULL, NULL),
(6794, 'The Untouchables (SNES)', NULL, NULL, 'Take on the mob! The ultimate six exciting action sequences put you in control of Elliot Ness\'s elite squad of crime-busters. Alleyway shootouts, the Border Raid, the Railway Station confrontation and Warehouse bust, culminating in the thrilling denouement of a rooftop duel as you re-live the knife-edge existence of Ness in his stuggle against the retribution of Capone! The Untouchables - live an American legend!', '/images/snes/6794/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/9/92/UntouchablesThe.jpg', NULL, NULL),
(6795, 'Ushio to Tora', NULL, NULL, 'Ushio To Tora is an Action game, published by Yutaka,  which was released in Japan in 1993.', '/images/snes/6795/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/6/8/312568_front.jpg', NULL, NULL),
(6796, 'Wario\'s Woods (SNES)', NULL, NULL, 'It\'s up to Toad to keep the woods safe in this new puzzle-action!', '/images/snes/6796/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/5/5f/Wario%27s_Woods_NES.jpg', NULL, NULL),
(6797, 'Wayne\'s World (SNES)', NULL, NULL, 'Are you ready  for this? Number One of the Top Ten Most Bizarre Things to Happen This Year: Garth has been kidnapped! No way, you say? Hway!! It\'s the work of a most heinous goon - a pixelated purple putridosity called Zantar. And now you, Wayne Campbell, must heartily rescue your excellent sidekick from a fate most unbecoming!', '/images/snes/6797/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/3/4/46934_front.jpg', NULL, NULL),
(6798, 'Wheel of Fortune Deluxe!', NULL, NULL, 'Now Wheel watchers everywhere have a new way to play! This Deluxe Edition of Wheel of Fortune has over 4,000 all-new puzzles. Featres include the show\'s popular theme music, and digitized photography of the set, contestants and Vanna White. It\'s your chance to play one of television\'s most popular game shows, either against the computer or against up to two friends. Spin the Wheel, buy a vowel, or solve the puzzle, and the cash, prizes and fame are yours. GameTek\'s Deluxe Edition of Wheel of Fortune puts you right on the stage.', '/images/snes/6798/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/7/5/51475_front.jpg', NULL, NULL),
(6799, 'Wild Guns', NULL, NULL, 'The young and beautiful Annie went to see Clint, the renown space bounty hunter. "My entire family was abducted and killed by the Kid family. I will pay you whatever you want to help me get rid of those villains." "I don\'t need any help," said Clint in a haughty voice. "I insist on helping, replied Annie. "I have a personal vendetta against the Kid family, and besides, I bet I am as good a shot as you are." "We will see about that. Let\'s go get them!"', '/images/snes/6799/cover.png', 'https://upload.wikimedia.org/wikipedia/en/8/89/SNES_Wild_Guns_cover_art.png', NULL, NULL),
(6800, 'Wolfchild (SNES)', NULL, NULL, 'The world\'s most renowned biogenetic scientist has been kidnapped and brainwashed into creating an army of bloodthirsty mutant warriors. Suddenly the fate of all manking rests in the hands of his youngest son...and a top-secret mutating experiment known as "Project Wolfchild."', '/images/snes/6800/cover.jpg', 'https://gamefaqs.akamaized.net/box/4/1/5/48415_front.jpg', NULL, NULL),
(6801, 'WWF Super WrestleMania', NULL, NULL, 'Charge down to ringside in WWF Super WrestleMania!!!', '/images/snes/6801/cover.png', 'https://upload.wikimedia.org/wikipedia/en/9/9e/WWFSuperWrestleMania.png', NULL, NULL),
(6802, 'Zan III Spirits', NULL, NULL, 'Zan III Spirits is a Strategy game, developed and published by Wolf Team,  which was released in Japan in 1994.', '/images/snes/6802/cover.jpg', 'https://gamefaqs.akamaized.net/box/9/1/2/306912_front.jpg', NULL, NULL),
(6803, 'Zen-Nippon Pro Wrestling: Fight da Pon!', NULL, NULL, 'Zen-Nippon Pro Wrestling: Fight da Pon! is a Miscellaneous game, developed by Natsume and published by NCS,  which was released in Japan in 1994.', '/images/snes/6803/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/0/312510_front.jpg', NULL, NULL),
(6804, 'Zen-Nippon Pro Wrestling 2: 3-4 Budōkan', NULL, NULL, 'Zen-Nippon Pro Wrestling 2: 3-4 Budoukan is a Sports game, developed by Natsume and published by NCS,  which was released in Japan in 1995.', '/images/snes/6804/cover.jpg', 'https://gamefaqs.akamaized.net/box/5/1/5/312515_front.jpg', NULL, NULL),
(6805, 'Zero4 Champ RR-Z', NULL, NULL, 'Zero-4 Champ RR-Z is a Racing game, published by Media Rings,  which was released in Japan in 1995.', '/images/snes/6805/cover.jpg', 'https://gamefaqs.akamaized.net/box/3/4/1/312341_front.jpg', NULL, NULL),
(6806, 'Zool (SNES)', NULL, NULL, 'Once every year, the games world is rocked by a game so stunning, so fast, so colorful, so big, so demanding, so mega, so awesome, so varied , so incredible, and so full of fabulous features and unexpected treats, that everybody just looks at it and says "THAT\'S IT!" This year, ZOOL, THE NINJA FROM THE Nth DIMENSION, is definitely "IT!"', '/images/snes/6806/cover.jpg', 'https://upload.wikimedia.org/wikipedia/en/1/13/Zool_cover.jpg', NULL, NULL);
